import{_ as g,o as t,c as n,a as i,t as u,C as h,M as _,U as k,f as p,F as w,p as b,e as D,q as v}from"./chunks/framework.B1z0IdBH.js";const f={name:"PoemCard",props:{poem:{type:Object,required:!0}},methods:{handleImageError(a){a.target.src="/images/logo.svg"}}},y={class:"entry-container"},B={class:"entry"},A={class:"entry-image"},j=["src","alt"],C={class:"entry-content"},z={class:"entry-title"},S=["href"],E={class:"entry-description"};function x(a,e,s,m,o,r){return t(),n("div",y,[i("div",B,[i("div",A,[i("img",{src:s.poem.image_url,alt:s.poem.page_title,onError:e[0]||(e[0]=(...d)=>r.handleImageError&&r.handleImageError(...d))},null,40,j)]),i("div",C,[i("h2",z,[e[1]||(e[1]=i("span",{class:"title-icon"},null,-1)),i("a",{href:s.poem.page_url,target:"_blank"},u(s.poem.page_title),9,S)]),i("p",E,u(s.poem.context_page_description),1)])])])}const P=g(f,[["render",x],["__scopeId","data-v-3bee3471"]]),M=JSON.parse(`[{"page_url":"https://zh.wikipedia.org/wiki/%E6%A7%9F%E5%9F%8E%E5%8D%8E%E4%BA%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2d/Wonton_Miee_Stall%2C_Georgetown%2C_Penang%2C_Malaysia.JPG","page_title":"槟城华人","context_page_description":"槟城华人是指生长于马来西亚槟城州的华人，为来自中国迁徙而来的移民后代。2017年，华人占槟城总人口的百分之四十左右，是州内第二大族群，也是马来西亚华裔比例最高的州属。\\n槟城华人以福建闽南籍占大多数，年长一辈的日常用语是福建闽南话，其次是标准华语，40岁以下多以华语为第一语言。 民间团体为了维护民俗及方言文化，2014年开始推行“讲福建话运动”。"},{"page_url":"https://vi.wikipedia.org/wiki/Ranunculus_asiaticus","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f6/Carlsbadflowerfields1.jpg","page_title":"Ranunculus asiaticus","context_page_description":"Ranunculus asiaticus là một loài thực vật có hoa trong họ Mao lương. Loài này được L. miêu tả khoa học đầu tiên năm 1753."},{"page_url":"https://ja.wikipedia.org/wiki/%E6%85%B6%E6%87%89%E7%BE%A9%E5%A1%BE","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/cc/%E5%8D%94%E7%94%9F%E9%A4%A8-%E6%85%B6%E6%87%89%E6%97%A5%E5%90%892.jpg","page_title":"慶應義塾","context_page_description":"慶應義塾は、日本の学校法人。福澤諭吉が1858年に中津藩江戸藩邸で開いた蘭学塾が起源。シンボルマークは、ペンマーク。"},{"page_url":"https://pt.wikipedia.org/wiki/Milton_Bradley","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/Milton_bradley_portrait.jpg","page_title":"Milton Bradley","context_page_description":"Milton Bradley foi um inventor estadunidense."},{"page_url":"https://pt.wikipedia.org/wiki/Pr%C3%A1xedis_G._Guerrero_(munic%C3%ADpio)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/63/Location_Praxedis.png","page_title":"Práxedis G. Guerrero (município)","context_page_description":"Práxedis G. Guerrero é um município do estado de Chihuahua."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%98%D0%BD%D1%86%D0%B5%D0%BD%D1%85%D0%BE%D1%84_(%D0%91%D1%83%D1%80%D0%B3%D0%B5%D0%BD%D0%BB%D0%B0%D0%BD%D0%B4)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/73/Kirche_inzenhof.JPG","page_title":"Инценхоф (Бургенланд)","context_page_description":"Инценхоф — община в Австрии, в федеральной земле Бургенланд. Находится на границе с Венгрией.\\nВходит в состав округа Гюссинг. Население составляет 314 человек. Занимает площадь 6 км². Официальный код — 10421."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%AD%D8%B2%D9%85%D8%A9_%D8%A7%D9%84%D8%AF%D9%85%D8%A7%D8%BA_%D8%A7%D9%84%D8%A3%D9%85%D8%A7%D9%85%D9%8A_%D8%A7%D9%84%D8%A5%D9%86%D8%B3%D9%8A%D8%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/be/Medial_Forebrain_Bundle.jpg","page_title":"حزمة الدماغ الأمامي الإنسية","context_page_description":"حزمة الدماغ الأمامي الإنسية هي عبارة عن مسار عصبي يحتوي على ألياف عصبية من المناطق الشمية ومنطقة القشرة حول اللوزة ونواة الحاجز، بالإضافة إلى ألياف من مناطق في جذع الدماغ مثل المنطقة السقيفية البطنية."},{"page_url":"https://sv.wikipedia.org/wiki/Clermont,_Ari%C3%A8ge","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/71/Map_commune_FR_insee_code_09097.png","page_title":"Clermont, Ariège","context_page_description":"Clermont är en kommun i departementet Ariège i regionen Occitanien i södra Frankrike. Kommunen ligger i kantonen Saint-Girons som ligger i arrondissementet Saint-Girons. År 2009 hade Clermont 91 invånare."},{"page_url":"https://it.wikipedia.org/wiki/Giuseppe_Cagnina","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/92/Nero_Con_Striscia_Bianca.png","page_title":"Giuseppe Cagnina","context_page_description":"Giuseppe Cagnina è stato un calciatore italiano, di ruolo portiere."},{"page_url":"https://en.wikipedia.org/wiki/Rancho_Park,_Los_Angeles","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ef/Palms-Rancho_Park_Branch_Library.jpg","page_title":"Rancho Park, Los Angeles","context_page_description":"Rancho Park is a residential neighborhood in the Westside of the city of Los Angeles, California with mostly single family homes and tree lined streets. The community is nestled between West Los Angeles and Cheviot Hills. This enclave draws young professionals and families and is home to residents working in a variety of professional occupations. History proves the neighborhood was once a part of Westwood until Olympic Blvd. was placed dividing the area North and South. The Southern section, now known as Rancho Park, felt cut off from its North side lobbying for its own identity in the 1930s."},{"page_url":"https://de.wikipedia.org/wiki/B%C3%ADl%C3%BD_K%C3%A1men","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/98/B%C3%ADl%C3%BD_K%C3%A1men.png","page_title":"Bílý Kámen","context_page_description":"Bílý Kámen ist eine Gemeinde in Tschechien. Sie liegt sieben Kilometer nordwestlich von Jihlava und gehört zum Okres Jihlava."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9D%D1%8B%D1%81%D0%B0_(%D0%B3%D0%BE%D1%80%D0%BE%D0%B4)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8b/Nysa_-_ul._Zjednoczenia_-_panoramio.jpg","page_title":"Ныса (город)","context_page_description":"Ны́са, На́йссе — город в Польше, входит в Опольское воеводство, Ныский повят. Имеет статус городско-сельской гмины. Занимает площадь 27,5 км². Население — 46 841 человек."},{"page_url":"https://it.wikipedia.org/wiki/Guerrilla_gardening","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b4/Seed_bomb_aka_Seed_ball_%28Guerilla_gardening%29.jpg","page_title":"Guerrilla gardening","context_page_description":"Con guerrilla gardening si intende una forma di giardinaggio praticata su terreni sui quali non si ha il diritto legale di coltivare, come terreni abbandonati, aree dismesse o proprietà private. Viene praticato da persone e per motivazioni molto diverse tra loro, dai giardinieri che superano il limite fino a gruppi ambientalisti. Questi ultimi sono solitamente legati alle teorie della permacultura o alle problematiche riguardanti i diritti della terra."},{"page_url":"https://hr.wikipedia.org/wiki/Svemirski_zahod","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/46/Zvezda_toilet.jpg","page_title":"Svemirski zahod","context_page_description":"Svemirski zahod je specijalno opremljen prostor u svemirskoj letjelici ili svemirskoj postajii koji se koristiti u uvjetima mikrogravitacije za obavljanje fizioloških potreba kozmonaut a. Opremljen je školjkom, prilagođenoj za muškarce i/ili žene, koja se po svom izgledu ne razlikuje značajno od obične zahodske školjke na Zemlji. U početku su svemirska odijela astronauta imala pelene i otpadne vreće u koje su kozmonauti obavljali nuždu, a danas tu istu nuždu obavljaju u svemirskim zahodima, skoro na istovjetan način, kao pri odlasku u sanitarni čvor na Zemlji."},{"page_url":"https://pl.wikipedia.org/wiki/Dekanat_kalwaryjski","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7c/Paber%C5%BE%C4%97._Ba%C5%BEny%C4%8Dia.JPG","page_title":"Dekanat kalwaryjski","context_page_description":"Dekanat kalwaryjski – jeden z 9 dekanatów archidiecezji wileńskiej na Litwie. Składa się z 10 parafii i 11 kościołów."},{"page_url":"https://en.wikipedia.org/wiki/Heikki_Kuula","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dd/HeikkiKuula_Pipefest2010.jpg","page_title":"Heikki Kuula","context_page_description":"Heikki Kuula is a Finnish rapper, record producer and graphic designer. He is known for his frequent collaborations with the fellow rapper Pyhimys who has also served as an executive producer on Kuula's albums."},{"page_url":"https://es.wikipedia.org/wiki/Stomiiformes","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/06/Cyclothone_elongata_and_Bonaparte_pedaliota.png","page_title":"Stomiiformes","context_page_description":"Los estomiiformes son un orden de peces marinos teleósteos del superorden estenopterigios presentes en aguas tropicales o templadas, la mayoría son peces abisales de las profundidades.\\nPresentan órganos bioluminiscentes, llamados fotóforos, que les permiten las funciones de relación en la oscuridad absoluta en la que viven y que es característica de los peces de este orden.​ La luz proveniente de estos peces es prácticamente invisible para sus depredadores. La disposición más común es una o dos filas de fotóforos en la parte inferior del cuerpo a ambos lados, así como en la punta de las barbas que puedan presentar\\nAlgunas especies presentan barbas bajo la boca. Tienen largos dientes tanto en el maxilar como en el premaxilar de la boca, la cual se prolongó más allá del ojo en la mayoría de las especies. Si tienen escamas son cicloides, aunque en muchos se han perdido. Algunos no tienen aleta dorsal, pectorales ni aleta adiposa, mientras que en algunos existe una aleta adiposa ventral, presentando de 4 a 9 radios en la aleta pélvica; tienen entre 5 y 24 hendiduras branquiales.​\\nEl color en la mayoría es marrón oscuro o negro, aunque algunos Gonostomatoidei son plateados.​"},{"page_url":"https://sv.wikipedia.org/wiki/Nigella_hispanica","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/76/Nigella_damascena_1-OB9.jpg","page_title":"Nigella hispanica","context_page_description":"Nigella hispanica är en ranunkelväxtart som beskrevs av Carl von Linné. Nigella hispanica ingår i släktet nigellor, och familjen ranunkelväxter. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://pt.wikipedia.org/wiki/Vi%C3%B0oy","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ac/Faroe_stamp_349_vidoy.jpg","page_title":"Viðoy","context_page_description":"Viðoy é uma das Ilhas Feroe. De todas as ilhas do arquipélago, é que se situa mais a norte. Localiza-se a leste da ilha de Borðoy, a qual se encontra ligada por um aterro. O seu nome significa ilha da madeira, apesar de lá não existir nenhuma árvore. Na realidade, o nome refere-se a madeira transportada pelo mar, que flutua desde a Sibéria e da América do Norte até à ilha.\\nÁrea: 41 km²\\nPopulação: 617 habitantes\\nDensidade populacional: 15 habitantes/km²\\nMontanha mais elevada: Villingadalsfjall, 841 m\\nNúmero de cumes: 11\\nMunicípio: Viðareiði"},{"page_url":"https://zh.wikipedia.org/wiki/%E7%A9%86%E5%A1%9E_(%E5%A5%A5%E5%B8%83%E7%9C%81)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/01/Moussey_01_%281%29.JPG","page_title":"穆塞 (奥布省)","context_page_description":"穆塞是法国奥布省的一个市镇，位于该省中部，属于特鲁瓦区和特鲁瓦香槟都会城市圈公共社区，其市镇面积为7.25平方公里，2017年1月1日时人口数量为638人。\\n穆塞是特鲁瓦香槟都会城市圈公共社区的组成部分，位于特鲁瓦市区以南大约11公里。"},{"page_url":"https://sv.wikipedia.org/wiki/Fiorinia","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/06/Fiorinia_externa_5019024.jpg","page_title":"Fiorinia","context_page_description":"Fiorinia är ett släkte av insekter. Fiorinia ingår i familjen pansarsköldlöss."},{"page_url":"https://zh.wikipedia.org/wiki/%E7%BB%B4%E5%85%8B%E6%89%98%C2%B7%E6%A0%BC%E5%A5%A5%E5%B0%94%E5%9F%BA%E8%80%B6%E7%BB%B4%E5%A5%87%C2%B7%E5%BA%93%E5%88%A9%E7%A7%91%E5%A4%AB","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/22/Vladimir_Putin_22_November_2001-5.jpg","page_title":"维克托·格奥尔基耶维奇·库利科夫","context_page_description":"維克托·格奧爾基耶維奇·庫利科夫，蘇聯軍事家，蘇聯元帥，華沙公約組織最後一任聯合武裝部隊總司令。"},{"page_url":"https://fr.wikipedia.org/wiki/%C3%89glise_Saint-Sulpice_de_Roussines","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/Roussines_%2836%29_%C3%89glise_Saint-Sulpice_02.JPG","page_title":"Église Saint-Sulpice de Roussines","context_page_description":"L'église Saint-Sulpice de Roussines est une église catholique française. Elle est située sur le territoire de la commune de Roussines, dans le département de l'Indre, en région Centre-Val de Loire."},{"page_url":"https://en.wikipedia.org/wiki/Socii","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/RomaClivusScauri.JPG","page_title":"Socii","context_page_description":"The socii or foederati were confederates of Rome and formed one of the three legal denominations in Roman Italy along with the Latini and the Cives. The Latini, who were simultaneously special confederates and semi-citizens, should not be equated with the homonymous Italic people of which Rome was part. This tripartite organisation lasted from the Roman expansion in Italy to the Social War, when all peninsular inhabitants were awarded Roman citizenship.\\nTreaties known as foedus served as the basic template for Rome's settlement with the large array of tribes and city-states of the whole Italian peninsula. The confederacy had its origin in the foedus Cassianum signed by the fledgling Roman republic with its neighbouring Latin city-states shortly after the overthrow of the Roman monarchy in 510 BC. This provided for mutual defence by the two parties on the basis of an equal contribution to the annual military levy, which was probably under Roman overall command."},{"page_url":"https://sv.wikipedia.org/wiki/%C3%84lvsj%C3%B6v%C3%A4gen","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/67/%C3%84lvsj%C3%B6v%C3%A4gen_hist_bild.jpg","page_title":"Älvsjövägen","context_page_description":"Älvsjövägen utgör en del av länsväg 271. Trafikvolymen om 22 000 fordon per dygn är lika stor som den sammantagna dagliga gränstrafiken mellan Norge och Sverige längs Europaväg 6 och Europaväg 18."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkmale_in_Niedercunnersdorf","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8f/Umgebinde_M%C3%BChlgrabenweg_6_Niedercunnersdorf.JPG","page_title":"Liste der Kulturdenkmale in Niedercunnersdorf","context_page_description":"In der Liste der Kulturdenkmale in Niedercunnersdorf sind die Kulturdenkmale des Ortsteils Niedercunnersdorf der sächsischen Gemeinde Kottmar verzeichnet, die bis November 2018 vom Landesamt für Denkmalpflege Sachsen erfasst wurden. Die Anmerkungen sind zu beachten."},{"page_url":"https://gl.wikipedia.org/wiki/Ios","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c2/Ios_Greece.JPG","page_title":"Ios","context_page_description":"Ios é unha illa grega nas Cícladas no Mar Exeo. Ios é unha illa montañosa con cantís cara ao mar na maioría das súas partes, situada a medio camiño entre as illas de Naxos e Santorini. Ten 18 km de longo e 10 km de ancho, cunha superficie de 109 km². A poboación era de 2024 habitantes en 2011. Ios é parte da unidade rexional de Thira."},{"page_url":"https://en.wikipedia.org/wiki/2014_European_Parliament_election_in_Denmark","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a5/Ulla_Toernaes.jpg","page_title":"2014 European Parliament election in Denmark","context_page_description":"The European Parliament election of 2014 in Denmark was an election held in Denmark on 25 May 2014 to decide who would represent Denmark in the European Parliament from 2014 to 2019. The Danish People's Party with 26.6% of the votes became the largest party for the first time in a nationwide Danish election.\\nThe election was held alongside the Danish Unified Patent Court membership referendum where 62.5% of the voter approved ratification of the Agreement on a Unified Patent Court."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%AD%D8%AF%D8%A7%D8%A6%D9%82_%D9%85%D9%84%D9%88%D9%83_%D9%87%D8%A7%D9%86%D9%88%D9%81%D8%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cd/Schloss_Herrenhausen_Er%C3%B6ffnung_Schnee.jpg","page_title":"حدائق ملوك هانوفر","context_page_description":"حدائق ملوك هانوفر أو هرن-هويزر-جارتن Die Herrenhäuser Gärten in في مدينة هانوفر في شمال ألمانيا، وتتكون من الحديقة الكبرى، وحديقة الجبل Berggarten، وحديقة \\"جيورجن جارتن \\" و \\"ولفين-جارتن\\".\\nوتعتبر الحديقة الكبري الواقعة في حي \\"هرنهاوزن\\" من أهم الحدائق المزينة على نمط فن الباروك في أوروبا، وتمثل قلب حدائق هرنهويزر التاريخية. واما الحديقة المقابلة لها ويفصلهما شارع يجري فيه المترو فهي ما تسمى حديقة الجبل \\"برغ-جارتن\\"، وقد تطورت هذه من حقول لزراعة الخضروات ولتطعيم النباتات إلى \\"حديقة للنباتات\\". تحوي حديقة النباتات أيضا ثلاثة أجنحة مغطاة بالزجاج تنمو في كل جناح منها نباتات أوروبية، وجناح لأزهار، وجناح للأشجار الصحراوية.\\nيمكن زيارة الحديقة الكبرى وحديقة النباتات، ويزورها مئات الآلاف من السياح والزائرين سنويا.\\nأما \\"جيوجن-جارتن\\" فهي كبيرة وخارج أسوار تلك الحديقتين، وتصل في أطرافها من جهة وسط مدينة هانوفر بحديقة \\"ولفن-جارتن\\" وهبي تتبع الآن جامعة \\"هانوفر\\". أنشئت الحديقتان الأخيرتين على نمط الحديقة الإنجليزية، ويمكن زيارتهما مجانا، على عكس الحديقة الكبرى وال \\"برغ-جارتن\\" اللتان يلزمهما دفع رسوم لزيارتهما. تتبع الحدائق إدارة الثقافة بإدارة مدينة هانوفر."},{"page_url":"https://arz.wikipedia.org/wiki/%D9%84%D8%A7%D8%B3%D8%B2%D9%84%D9%88_%D8%B3%D8%A7%D8%B1%D9%89","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c9/S%C3%A1ry_L%C3%A1szl%C3%B3.jpg","page_title":"لاسزلو سارى","context_page_description":"الصفحه دى يتيمه, حاول تضيفلها لينك فى صفحات تانيه متعلقه بيها.\\nلاسزلو سارى ملحن مزيكا من المجر."},{"page_url":"https://fr.wikipedia.org/wiki/Gare_de_Shin-Kamagaya","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d8/Shin-Kamagaya_station_20191208%28cropped%29.jpg","page_title":"Gare de Shin-Kamagaya","context_page_description":"La gare de Shin-Kamagaya est une gare ferroviaire japonaise située à Kamagaya dans la préfecture de Chiba. Elle est gérée conjointement par les compagnies Keisei, Hokuso-Railway, Shin-Keisei et Tōbu."},{"page_url":"https://tr.wikipedia.org/wiki/P%C5%99%C3%ADbram_il%C3%A7esi","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/85/Map_CZ_-_district_Pribram.PNG","page_title":"Příbram ilçesi","context_page_description":"Příbram ilçesi Çek Cumhuriyeti'nin Orta Bohemya bölgesinde bulunan bir ilçedir. İlçenin başkenti Příbram şehridir."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%BB%D1%83%D0%B6%D0%B5%D0%B2_(%D1%81%D1%82%D0%B0%D0%BD%D1%86%D0%B8%D1%8F_%D0%BC%D0%B5%D1%82%D1%80%D0%BE)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/10/Stacja_metra_S%C5%82u%C5%BCew_2020.jpg","page_title":"Служев (станция метро)","context_page_description":"«Служев» — станция первой линии Варшавского метрополитена. Главный вход со стороны улицы Вальбжихской, неподалёку от муниципального мокотувкого кладбища. Другие входы со стороны улиц Рольной, Сонаты и Батуты."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9F%D0%B5%D1%80%D0%B5%D1%87%D0%B8%D1%86%D1%8B","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9b/Perechitsy1863.jpg","page_title":"Перечицы","context_page_description":"Перечицы — деревня в Толмачёвском городском поселении Лужского района Ленинградской области."},{"page_url":"https://es.wikipedia.org/wiki/Bollullos_Par_del_Condado","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b2/Bandera_de_Bollullos_Par_del_Condado.svg","page_title":"Bollullos Par del Condado","context_page_description":"Bollullos Par del Condado es un municipio español situado en la provincia de Huelva, en Andalucía. En el año 2019 según el INE contaba con una población de 14.272 habitantes​ y una superficie de 50 km². Recibe el apelativo de «Par del Condado» por estar junto al Condado de Niebla.\\nSu economía es principalmente de tipo agrícola, aunque también hay que reseñar la importancia de la industria vitivinícola y el auge cada vez mayor del sector servicios, en que destacan la reparación de vehículos de motor, artículos personales y de uso doméstico, la construcción, la industria de la alimentación, bebidas y tabaco, la hostelería y la industria de la madera y el corcho."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A2%D1%80%D0%B0%D0%B2%D1%8F%D0%BD%D0%B0%D1%8F_%D0%BB%D1%8F%D0%B3%D1%83%D1%88%D0%BA%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/27/Rana_temporaria_at_Muhalnitsa%2C_Botevgrad_%2801.03.2019%29_01.jpg","page_title":"Травяная лягушка","context_page_description":"Травяная лягушка — вид настоящих лягушек, широко распространённый в Европе."},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/Neptune_City_(New_Jersey)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c9/Neptune_City%2C_NJ.jpg","page_title":"Neptune City (New Jersey)","context_page_description":"Neptune City sī Bí-kok New Jersey chiu Monmouth kūn ê chi̍t ê chng-thâu."},{"page_url":"https://no.wikipedia.org/wiki/Bobo-Dioulasso","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/BoboDioulasso-Market.JPG","page_title":"Bobo-Dioulasso","context_page_description":"Bobo-Dioulasso er en by i Burkina Faso. Byen ligger sørøst i landet i regionen Hauts-Bassins og er hovedstaden i provinsen Houet. Bobo-Dioulasso er den nest største byen i Burkina Faso, etter hovedstaden Ouagadougou. I 2012 hadde byen 813 610 innbyggere, opp fra 489 967 i 2006.\\nDe viktigste næringsveiene er bomullsindustri, metallindustri og næringsmiddelindustri. Byen er også et viktig handelssenter og der finnes det et blant annet et museum, en dyrehage og et pottemarked. Det finnes også en moské som ble bygget i 1880.\\nBobo-Dioulasso ble grunnlagt på 1600-tallet. Det opprinnelige navnet var Sya. I 1897 ble byen erobret av franskmennene."},{"page_url":"https://en.wikipedia.org/wiki/Ragini_Nandwani","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8c/Ragini_Nandwani_at_the_special_screening_of_Dehraadun_Diary_%2860071215%29_%28cropped%29.jpg","page_title":"Ragini Nandwani","context_page_description":"Ragini Nandwani is an Indian film and television actress. She became popular after playing the lead in the Hindi soap opera Mrs. Kaushik Ki Paanch Bahuein. She made her Bollywood debut with the crime thriller film Dehraadun Diary, which was based on a real murder case.\\nNandwani made her debut in the Tamil film industry with the action thriller film Thalaivaa, directed by A. L. Vijay. She played a supporting role in the film and earned critical acclaim for her role.\\nShe is currently working in a Marathi film Krupa Swaminchi. She has also signed a Bollywood film which will be officially announced soon. She has done a Malayalam movie Peruchazhi, in which she appears as the female lead opposite to Mohanlal."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9B%D1%8B%D1%81%D0%B0%D1%8F_%D0%93%D0%BE%D1%80%D0%B0_(%D0%98%D0%BB%D1%8C%D0%B8%D0%BD%D0%B5%D1%86%D0%BA%D0%B8%D0%B9_%D1%80%D0%B0%D0%B9%D0%BE%D0%BD)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/53/Lysa_hora_illin_prapor.png","page_title":"Лысая Гора (Ильинецкий район)","context_page_description":"Лысая Гора — село на Украине, находится в Ильинецком районе Винницкой области.\\nНаселение по переписи 2001 года составляет 466 человек. Почтовый индекс — 22723. Телефонный код — 4345. Занимает площадь 1,850 км²."},{"page_url":"https://sv.wikipedia.org/wiki/Euclinia_longiflora","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ca/Euclinia_longiflora_Bot._Mag._62._3409._1835.jpg","page_title":"Euclinia longiflora","context_page_description":"Euclinia longiflora är en måreväxtart som beskrevs av Richard Anthony Salisbury. Euclinia longiflora ingår i släktet Euclinia och familjen måreväxter. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://de.wikipedia.org/wiki/Franz_Ignaz_Albert_von_Werdenstein","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cc/Grabdenkmal_Eyb-Werdenstein.jpg","page_title":"Franz Ignaz Albert von Werdenstein","context_page_description":"Franz Ignaz Albert von Werdenstein, auch Werthenstein war ein katholischer Geistlicher, Domherr sowie Generalvikar und Weihbischof in Freising."},{"page_url":"https://de.wikipedia.org/wiki/A._E._K%C3%B6chert","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/61/K-u-k_Hofkalender_1891_1437-Koechert-LF.jpg","page_title":"A. E. Köchert","context_page_description":"Die Juweliere A. E. Köchert zählen seit ihrer Gründung im Jahre 1814 zu den renommiertesten Juwelieren in Österreich. Das Stammgeschäft befindet sich seit 1873 am Neuen Markt 15 in Wien; im Dezember 2005 wurde ein weiteres Geschäft am Alten Markt 15 in Salzburg eröffnet."},{"page_url":"https://et.wikipedia.org/wiki/NSV_Liidu_suurmeister","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/5d/Grigory_Levenfish.jpg","page_title":"NSV Liidu suurmeister","context_page_description":"NSV Liidu suurmeister oli Nõukogude Liidus males sportlike saavutuste eest tulemuspõhiselt antav kõrgeim nimetus.\\nNSV Liidu suurmeistri nimetus kehtestati 1927. aastal V Üleliidulisel Malekongressil. Esimene maletaja, kes selle nimetuse sai, oli 1929. aastal NSV Liidu malemeistriks tulnud Boriss Verlinski. 1931. aastal Moskvas toimunud VII Üleliidulisel Malekongressil suurmeistri nimetus kaotati, kuid 1935. aastal võeti suurmeistri nimetus taas kasutusele."},{"page_url":"https://an.wikipedia.org/wiki/Cheometr%C3%ADa","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/8b/Geometria_02.svg","page_title":"Cheometría","context_page_description":"A cheometría ye a branca d'o conoiximiento que s'ocupa d'os obchectos u figuras y d'as suyas relacions en o espacio, ye dicir: distancia, posición, superficie, volumen, forma, desplazamiento, prochección, representación, etc. Estió un d'os dos campos d'as matematicas clasicas, estando l'atro campo, l'aritmetica u estudeyo d'os numeros.\\nEn a Edat Moderna, o filosofo Descartes reformuló o concepto de coordenatas cartesianas, dando paso a la cheometría analitica que introdució os metodos de calculo alchebraicos en a cheometria. Actualment, os conceptos cheometricos s'han cheneralizato dica plegar a un alto grau d'abstracción y complexidat, conseqüentment podemos parlar d'una cheometría tradicional u clasica, que ye la que totz conoixemos, ya que s'amostra en as escuelas primarias. As atras cheometrías, por un regular, son disciplinas que se basan, en parti, en os conceptos en bella traza intuitivos d'a cheometría clasica, a partir d'os qualos se formulan atras hipotesis, se desembolican metodos alternativos u s'estableixen vinculacions con atras disciplinas u matematicas."},{"page_url":"https://fr.wikipedia.org/wiki/Croix_Saint-Martin_de_Notre-Dame-du-Touchet","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4f/Croix_Saint-Martin_de_Notre-Dame-du-Touchet_-_D%C3%A9_%28face_Sud%29.JPG","page_title":"Croix Saint-Martin de Notre-Dame-du-Touchet","context_page_description":"La croix Saint-Martin est une croix de chemins située à Notre-Dame-du-Touchet, en France.\\nLa croix est en granit et elle fut érigée au XVIᵉ siècle. Elle présente un fût décoré de chevrons.Le dé est orné de bas-reliefs représentant des scènes de la passion avec une pietà.\\nSur une des faces du croisillon de la croix pattée, il est sculpté une scène de la Charité de saint Martin qui découpe sa cape et sur l'autre la scène de la Crucifixion.\\nLa croix a fait l'objet d'une restauration dans les années 2000, avec la réintégration d'une partie du fût qui était employé comme colonne d'un bénitier dans l'église Notre-Dame toute proche.\\nLe monument est inscrit au titre des monuments historiques en 1939."},{"page_url":"https://sv.wikipedia.org/wiki/Cyrtorchis_letouzeyi","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bb/Fleurs_Cyrtorchis_letouzeyi_Szlach._%26_Olsz.jpg","page_title":"Cyrtorchis letouzeyi","context_page_description":"Cyrtorchis letouzeyi är en orkidéart som beskrevs av Dariusz Lucjan Szlachetko och Tomasz Sebastian Olszewski. Cyrtorchis letouzeyi ingår i släktet Cyrtorchis, och familjen orkidéer. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://es.wikipedia.org/wiki/Tubo_de_%C3%B3rgano","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f7/Schuke-sofia-principal.JPG","page_title":"Tubo de órgano","context_page_description":"Un tubo de órgano es un elemento que produce sonidos en un órgano al resonar a una frecuencia específica cuando se insufla aire a presión por su boca o lengüeta. Cada tubo está afinado para producir una nota específica de la escala musical. El conjunto de tubos afinados que forman una escala musical, un tubo para cada nota, con un timbre similar y homogéneo se llama registro."},{"page_url":"https://he.wikipedia.org/wiki/%D7%9E%D7%9C%D7%A8%D7%99%D7%94_%D7%91%D7%90%D7%A4%D7%A8%D7%99%D7%A7%D7%94_%D7%A9%D7%9E%D7%93%D7%A8%D7%95%D7%9D_%D7%9C%D7%A1%D7%94%D7%A8%D7%94","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/20/Artemisia_annua.jpg","page_title":"מלריה באפריקה שמדרום לסהרה","context_page_description":"אפריקה שמדרום לסהרה היא אזור גאוגרפי בעל הריכוז הגדול ביותר של מחלת המלריה בעולם. מלריה היא אחת המחלות הקטלניות ביותר באפריקה שמדרום לסהרה. בעוד שבשאר העולם קיימת מאז שנות ה-80 ירידה עקבית במקרי המוות ממחלה זו, חרף העלייה באוכלוסין, באפריקה שמדרום לסהרה קיימת עלייה במספר מקרי המוות ממלריה, שם היא נחשבת לגורם תמותה שני בהיקפו לאחר מחלת האיידס הנגרמת מנגיף ה-HIV. כ-24% ממקרי המוות של ילדים מעל גיל 5 בארצות אפריקה מדרום לסהרה מתרחשים כתוצאה ממלריה."},{"page_url":"https://cy.wikipedia.org/wiki/Siop_lyfrau_Cymraeg","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d3/Siop_y_Bobol_-_geograph.org.uk_-_664616.jpg","page_title":"Siop lyfrau Cymraeg","context_page_description":"Mae siop lyfrau Cymraeg neu ar lafar siop Gymraeg yn cyfeirio at siop sy'n gwerthu llyfrau a nwyddau Cymraeg a Chymreig e.e. cerddoriaeth Gymraeg, cardiau cyfarch Cymraeg, crefftau Cymreig a llyfrau Saesneg ar Gymru. Ddiwedd y 1960au a dechrau'r 70au sefydlwyd nifer ohonynt ar hyd a lled Cymru. Roedd siopau llyfrau Cymraeg yn bod cyn hynny, y rhan fwyaf ohonynt mewn trefi colegol, er nad i gyd, a'r rhan fwyaf yn gwerthu llyfrau Cymraeg yn unig. Ond erbyn diwedd 60au'r ganrif roedd nwyddau eraill Cymraeg ar gael, er yn brin iawn.\\nRoedd Sais o'r enw Rooksby wedi prynu siop yng Nghaernarfon ac wedi gweld fod galw am gardiau Cymraeg. Roedd e wedi bod yn arwerthwr cardiau i gwmniau yn Lloegr. Aeth atynt a threfnu argraffu'r cardiau Cymraeg yr un pryd a'r rhai Saesneg ac felly yn ei gwneud yn gystadleuol o ran pris. Hefyd roedd cwmniau recordio wedi eu sefydlu - Recordiau Teldisc, gan John Edwards, Recordiau Cambrian gan Jo Jones, a Recordiau'r Dryw gan Aneirin Talfan Davies ac Alun Talfan Davies a oedd yn berchen ar Lyfrau'r Dryw."},{"page_url":"https://ceb.wikipedia.org/wiki/Verbena_halei","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f2/Verbena_halei.jpg","page_title":"Verbena halei","context_page_description":"Espesye sa tanom nga bulak ang Verbena halei. Una ning gihulagway ni John Kunkel Small. Ang Verbena halei sakop sa kahenera nga Verbena sa kabanay nga Verbenaceae. Pagka karon wala pay siak nga nalista ubos niini niya."},{"page_url":"https://es.wikipedia.org/wiki/Blazice","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2c/Flag_of_Blazice.svg","page_title":"Blazice","context_page_description":"Blazice es una localidad del distrito de Kroměříž en la región de Zlín, República Checa, con una población estimada a principio del año 2018 de 192 habitantes.\\nSe encuentra ubicada al noroeste de la región, en la zona más occidental de los montes Cárpatos, al este de Praga, cerca de la orilla del río Morava —un afluente izquierdo del Danubio— y de la frontera con las regiones de Moravia Meridional y Olomouc.​"},{"page_url":"https://hu.wikipedia.org/wiki/Gare_de_Bouaye","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d8/2012-09-09_600D_8713_XGC_au_TER59226_%C3%A0_Bouaye.JPG","page_title":"Gare de Bouaye","context_page_description":"Gare de Bouaye vasútállomás Franciaországban, Bouaye településen."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9F%D0%B0%D0%BB%D0%B0%D1%86_%D0%A5%D0%B0%D1%80%D0%B8%D1%82%D0%BE%D0%BD%D0%B5%D0%BD%D0%BA%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ad/Kiyanitsa.JPG","page_title":"Палац Харитоненка","context_page_description":"Кияни́цький пала́ц — маєток, садиба-палац підприємця і філантропа Івана Герасимовича Харитоненка. Розташований у селищі Кияниці.\\nПалац двоповерховий, з оригінальною триповерховою вежею, прибудованою з тильного боку палацу. Головний фасад прикрашений ризалітом і вхідним портиком."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%AC%D9%8A%D9%88%D9%84%D9%88%D8%AC%D9%8A%D8%A7_%D9%85%D8%B5%D8%B1","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/ac/Nile_composite_NASA.jpg","page_title":"جيولوجيا مصر","context_page_description":"جيولوجيا مصر، هي دراسة لأهم الخصائص الجيولوجية في مصر."},{"page_url":"https://es.wikipedia.org/wiki/Aechmea_bromeliifolia","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ee/Aechmea_bromeliifolia_albobracteata_BotGardBln01102011A.jpg","page_title":"Aechmea bromeliifolia","context_page_description":"Aechmea bromeliifolia es una especie botánica bromélida, típica de vegetación de restingas de un bioma ecosistema de la Mata Atlántica. La sp. crece en Brasil, donde se encuentra en la Amazonia, la Caatinga, el Cerrado y la Mata Atlántica, especialmente en los estados de Bahia, Espírito Santo, Río de Janeiro.​"},{"page_url":"https://id.wikipedia.org/wiki/Spencer_Treat_Clark","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/84/Spencer_Treat_Clark_%288611981923%29_%28cropped%29.jpg","page_title":"Spencer Treat Clark","context_page_description":"Spencer Treat Clark adalah seorang aktor asal Amerika Serikat. Ia telah tampil dalam beberapa film yang meliputi Gladiator, Mystic River, Unbreakable, dan Glass."},{"page_url":"https://pl.wikipedia.org/wiki/Waldemar_T%C4%99siorowski","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b7/Waldemar_T%C4%99siorowski_DD_Nr_0.jpg","page_title":"Waldemar Tęsiorowski","context_page_description":"Waldemar Grzegorz Tęsiorowski – polski piłkarz i trener."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D0%BE%D0%BA_%D0%BF%D1%80%D0%B0%D0%B2%D0%B8%D1%82%D0%B5%D0%BB%D0%B5%D0%B9_%D0%A4%D0%B8%D0%BD%D0%B0%D0%BB%D0%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2a/Coa_fam_ITA_del_carretto.jpg","page_title":"Список правителей Финале","context_page_description":"В данной статье перечислены правители маркграфства ди Финале, с момента его основания в 1162 году до момента упразднения в 1797 году."},{"page_url":"https://de.wikipedia.org/wiki/Che%C5%82m%C5%BCa_(Landgemeinde)","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f2/Che%C5%82m%C5%BCa_%28gmina_wiejska%29_location_map.png","page_title":"Chełmża (Landgemeinde)","context_page_description":"Die gmina wiejska Chełmża ist eine selbständige Landgemeinde in Polen im Powiat Toruński in der Woiwodschaft Kujawien-Pommern. Sie zählt 9818 Einwohner und hat eine Fläche von 178,7 km², die zu 1 % von Wald und zu 89 % von landwirtschaftlicher Fläche eingenommen wird. Verwaltungssitz der Landgemeinde ist die Stadt Chełmża."},{"page_url":"https://vi.wikipedia.org/wiki/Madascincus_nanus","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/28/Madascincus_nanus.jpg","page_title":"Madascincus nanus","context_page_description":"Madascincus nanus là một loài thằn lằn trong họ Scincidae. Loài này được Andreone & Greer mô tả khoa học đầu tiên năm 2002."},{"page_url":"https://de.wikipedia.org/wiki/Louis_Antoine_Henri_de_Bourbon-Cond%C3%A9,_duc_d%E2%80%99Enghien","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/88/Execution_of_the_duke_d_Enghien.jpg","page_title":"Louis Antoine Henri de Bourbon-Condé, duc d’Enghien","context_page_description":"Louis Antoine Henri de Bourbon, Herzog von Enghien war ein französischer Herzog aus dem Adelsgeschlecht der Condé, den Napoléon Bonaparte verschleppen und nach einem Scheinprozess als „Emigrant, der vom Ausland bezahlt wird, um eine Invasion Frankreichs zu erleichtern“, erschießen ließ. Die Entführung und anschließende Hinrichtung sorgte im übrigen Europa für große Empörung und war zugleich ein abschreckendes Signal an die royalistischen Gegner Napoléons."},{"page_url":"https://simple.wikipedia.org/wiki/San_Miguel_Department_(El_Salvador)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fb/Flag_of_San_Miguel_Department.png","page_title":"San Miguel Department (El Salvador)","context_page_description":"San Miguel is a department in the eastern part of El Salvador. The capital city is also named San Miguel."},{"page_url":"https://de.wikipedia.org/wiki/Kloster_Oetenbach","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/Z%C3%BCrich_-_Oetenbach-Waisenhaus_-_Amtshaus_I_IMG_0278.jpg","page_title":"Kloster Oetenbach","context_page_description":"Das Kloster Oetenbach oder Ötenbach war ein Kloster der Dominikanerinnen in der Stadt Zürich und gehörte zur Diözese Konstanz. Es wurde 1237 erstmals erwähnt, zog um 1285 vom Stadtrand Zürichs in die Stadtmitte und wurde 1525 aufgehoben. Nach der Reformation dienten die Gebäude verschiedenen Zwecken, insbesondere als Zucht- und Waisenhaus. Sie wurden 1902/1903 abgebrochen."},{"page_url":"https://lb.wikipedia.org/wiki/Saint_Helena","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7c/16_Napoleons_exole_St_Helena_June1970.jpg","page_title":"Saint Helena","context_page_description":"Sankt-Helena ass eng kleng Insel am Südatlantik, läit 1.868 Kilometer vun Afrika ewech an huet 7.460 Awunner.\\nSi gehéiert zu de Iwwerséigebidder vum Vereenegte Kinnekräich vu Groussbritannien an Nordirland. Verwaltungsméisseg gehéieren zu St. Helena och zwee aner Gebidder: d'Insel Ascension an eng kleng Inselgrupp ëm Tristan da Cunha.\\nDen héchste Punkt vun der vulkanescher Insel läit op 823 m. D'Klima ass mëll ozeanescht Klima. D'Landwirtschaft huet sech fréier op den Ubau vu Fluess, dee fréier fir d'Fabrkatioun vu Postsäck fir d'Royal Mail benotzt ginn ass, beschränkt. Ët gëtt och nach Kaffi, Geméis an Uebst ugebaut a Véizucht bedrief."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%B7%E3%82%AB%E3%82%B4%E5%B8%82%E9%95%B7","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b9/John_Wentworth_of_Chicago.jpeg","page_title":"シカゴ市長","context_page_description":"シカゴ市長 は、アメリカ合衆国イリノイ州シカゴの首長。シカゴ市議会の助言と同意を得て、各部門の局長等を任命する。"},{"page_url":"https://cs.wikipedia.org/wiki/Messier_25","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/15/M25map.png","page_title":"Messier 25","context_page_description":"Messier 25 je jasná otevřená hvězdokupa v souhvězdí Střelce. Na čisté a tmavé obloze je bez velkých potíží viditelná i pouhým okem. Od Země je vzdálená asi 2 000 ly. Objevil ji Jean-Philippe Loys de Chéseaux v roce 1745."},{"page_url":"https://en.wikipedia.org/wiki/Rick_Hansen_(politician)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/04/Rick_Hansen_2012.jpg","page_title":"Rick Hansen (politician)","context_page_description":"Rick Hansen is a Minnesota politician and member of the Minnesota House of Representatives who represents District 52A, which includes all or portions of the cities of West St. Paul, South St. Paul, Mendota Heights, Mendota, Lilydale, and Eagan in Dakota County, which is in the southeastern part of the Twin Cities metropolitan area."},{"page_url":"https://it.wikipedia.org/wiki/Livello_(videogiochi)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f5/TUMIKI_Fighters_-_level_start.jpg","page_title":"Livello (videogiochi)","context_page_description":"Un livello di un videogioco è una delle parti in cui il gioco è stato suddiviso per motivi di organizzazione o tecnici. Corrisponde a una singola area isolata, sequenza di eventi o scenario. Dal punto di vista della programmazione i livelli vengono solitamente caricati in memoria uno alla volta.\\nOgni specifico gioco può utilizzare altri termini al suo interno per definire i livelli, come mondo, stadio, fase, missione, area, muro.\\nSpesso i livelli si presentano in sequenza lineare, con difficoltà crescente, e sono numerati. Solo dopo aver completato il primo livello si ha accesso al secondo e così via. Per completare un livello il giocatore deve raggiungere un obiettivo, che può essere anche la semplice sopravvivenza fino alla fine; molti giochi, prima di terminare un livello, prevedono che si sconfigga un boss. A seconda di come è strutturato il gioco, in caso di perdita di una vita può essere necessario ricominciare da capo il livello che si stava affrontando. Non tutti i giochi comunque hanno livelli sequenziali, possono anche essere interconnessi in vario modo o direttamente selezionabili dal giocatore."},{"page_url":"https://ca.wikipedia.org/wiki/Llista_de_rellotges_de_sol_del_Priorat","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7b/Rellotge_de_sol%2C_cal_Rabascall%2C_Prat_de_la_Riba_n%C2%BA_18%2C_Porrera%2C_Priorat._Tarragona.jpg","page_title":"Llista de rellotges de sol del Priorat","context_page_description":"Llista de rellotges de sol instal·lats de forma permanent en espais públics de la comarca del Priorat."},{"page_url":"https://en.wikipedia.org/wiki/Granges-pr%C3%A8s-Marnand_train_crash","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/15/Eisenbahnunfall_von_Granges-Marnand.jpg","page_title":"Granges-près-Marnand train crash","context_page_description":"On 29 July 2013, two passenger trains were involved in a head-on collision at Granges-près-Marnand, Switzerland, killing one person and injuring 25 others."},{"page_url":"https://de.wikipedia.org/wiki/Geschichte_der_Architektur","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f2/Maison_longue_au_site_arch%C3%A9oligique_des_%C3%8Eles-de-boucherville.jpg","page_title":"Geschichte der Architektur","context_page_description":"Die Geschichte der Architektur umfasst ihre technische, funktionale und ästhetische Entwicklung über alle historischen Epochen hinweg, vom Beginn menschlicher Bautätigkeit bis heute.\\nDie Entwicklung einzelner Stilepochen erfolgt nach klimatischen, technischen, religiösen und kulturellen Bedürfnissen eines Kulturkreises. Durch Änderungen einzelner oder mehrerer Anforderungen und einhergehend mit Fortschritt der Technik wandeln sich auch Baustile. Dieser Prozess beschleunigte sich zunehmend, insbesondere seit der Moderne und der Industrialisierung. Mit dem Informationsaustausch gelangen die Baustile in andere Regionen. Dabei bilden sich lokale Besonderheiten heraus und der Beginn und die Dauer einer Epoche kann zeitlich variieren. Die Übergänge von einem Baustil zum anderen erfolgen meist fließend. In der zeitgenössischen Architektur gibt es eine große Vielfalt an Strömungen und Architekturauffassungen, die räumlich und zeitlich nebeneinander existieren. Hierfür gibt es in vielen Ländern keinen übergreifenden Epochenbegriff.\\nBauwerke, die über Jahrzehnte hinweg entstanden, wurden oft von mehreren Baumeistern geplant, vergrößert, überbaut und den zeitlichen „Moden“ angepasst."},{"page_url":"https://da.wikipedia.org/wiki/Mozambique","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/15/Mozambique_Topography.png","page_title":"Mozambique","context_page_description":"Mozambique er et land i det sydøstlige Afrika omkranset af Det Indiske Ocean mod øst, Tanzania mod nord, Malawi og Zambia mod nordvest, Zimbabwe mod vest og Swaziland og Sydafrika mod sydvest. Det er adskilt fra Madagaskar af Mozambique-kanalen mod øst. Hovedstaden og den største by er Maputo.\\nVasco da Gama udforskede som den første europæer Mozambiques kyststrækninger i 1498 og fra starten af 1500-tallet oprettede Portugal handelsposter og forter langs Mozambiques kyst. Landet var portugisisk koloni indtil 1975, hvor det blev en selvstændig stat. FRELIMO grundlagde et socialistisk etpartisystem ved at alliere sig med Sovjetunionen. RENAMO blev dannet i 1975 som en militær modstandsgruppe mod FRELIMO og fik støtte fra det daværende Rhodesia og apartheidstyret i Sydafrika. Disse nabolande frygtede en spredning af den kommunistiske ideologi og frigørelseskampen. En borgerkrig brød ud i 1977. Borgerkrigen sluttede først i 1990, da apartheidregimet i Sydafrika blev svækket, og en fredsaftale blev underskrevet to år senere.\\nMozambique er udstyret med rige og omfattende naturressourcer."},{"page_url":"https://fi.wikipedia.org/wiki/Laazari","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/01/%D0%A7%D0%B0%D1%81%D0%BE%D0%B2%D0%BD%D1%8F_%D0%98%D0%BB%D1%8C%D0%B8_%D0%9F%D1%80%D0%BE%D1%80%D0%BE%D0%BA%D0%B0_%28%D0%B4%D0%B5%D1%80%D0%B5%D0%B2%D1%8F%D0%BD%D0%BD%D0%B0%D1%8F%29_01.JPG","page_title":"Laazari","context_page_description":"Laazari on entinen kylä Karjalan tasavallan Karhumäen piirin Paatenen kunnassa Venäjällä. Se sijaitsee samannimisen järven rannalla noin 50 kilometriä Paatenesta luoteeseen.\\nPaatenen pogostaan kuulunut kylä mainitaan ensimmäisen kerran nimellä Lulozero vuoden 1588 tienoilla. Vuoden 1597 verokirjan mukaan siellä oli neljä taloa. Vuonna 1765 taloluku oli kasvanut kahteentoista. 1900-luvun alussa Laazari kuului Paatenen volostin Särkijärven kyläkuntaan. Vuonna 1905 siellä oli 20 taloa, 122 asukasta ja koulu. Neuvostoaikana perustettiin Seesjärven piiriin kuulunut Laazarin kyläneuvosto, johon kuuluivat myös Honkaniemen, Kuusiniemen, Lytän, Nesterinvaaran, Pölkkylän ja Tšiassalmen kylät sekä Voloman metsätyömaa. Vuonna 1933 kyläneuvostossa oli 599 asukasta, joista kymmenen oli venäläisiä ja loput karjalaisia. Toisen maailmansodan jälkeen Laazari liitettiin Särkijärven kyläneuvostoon.\\nLaazarilla on historiallisen asutuksen status. Sen 1500-luvulla pystytetty Pyhän Eliaan tsasouna on valtakunnallinen suojelukohde. Muita rakennusmuistomerkkejä ovat vanhat talousrakennukset."},{"page_url":"https://ca.wikipedia.org/wiki/Ministre_del_Medi_Ambient_(Nova_Zelanda)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/71/Labour_Leader_Phil_Goff_in_Hamilton.JPG","page_title":"Ministre del Medi Ambient (Nova Zelanda)","context_page_description":"El Ministre del Medi Ambient és el ministre del govern de Nova Zelanda amb responsabilitat pel Ministeri del Medi Ambient. Aquest ministre supervisa les lleis, estàndards i directrius ambientals del govern. L'actual Ministra del Medi Ambient és Amy Adams."},{"page_url":"https://zh.wikipedia.org/wiki/%E6%AC%A7%E7%9B%9F%E6%9C%80%E5%A4%A7%E5%9F%8E%E5%B8%82%E5%8C%BA%E5%88%97%E8%A1%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/be/Skyline_Milano_-_05.JPG","page_title":"欧盟最大城市区列表","context_page_description":"以下列出以人口排序的歐盟城市區列表：\\n本表僅列出人口超過50萬的城市區，有關歐盟城市行政界限內的人口排名，請參照歐盟城市人口列表。"},{"page_url":"https://no.wikipedia.org/wiki/Den_Norske_Frimurerorden","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c0/Crownprince_Oscar_of_Sweden_painted_by_Joseph_Karl_Stieler.jpg","page_title":"Den Norske Frimurerorden","context_page_description":"Den Norske Frimurerorden ble etablert i 1891 av seks frimurerlosjer. Ordenen arbeider etter «det svenske system» og har en klar kristen profil. Den eldste av de seks frimurerlosjene ble grunnlagt 24. juni 1749 på Ladegårdsøens Hovedgård, bedre kjent som Bygdø Kongsgård. Losjens navn var St. Olaus, oppkalt etter Olav den hellige.\\nFor å bli medlem må man være fylt 24 år, være mann med godt omdømme og med en ordnet økonomi, gi sin tilslutning til den kristne tro og bli anbefalt av minst to frimurere.\\nDet svenske system består av elleve grader og arbeider i tre skifter- St. Johanneslogene, som også kalles «det blå frimureri», arbeider i de tre første gradene. St. Andreaslogene, som også kalles «det røde frimureri», arbeider fra fjerde til sjette grad. De seks høyeste gradene omfattes av Stewardslogene, Provinciallogene og Den Norske Store Landsloge. Stewardsloger av andre orden arbeider i syvende grad, mens Stewardsloger av første orden arbeider i syvende og åttende grad. Provinciallogene arbeider fra syvende til tiende grad, og styres av en Provincialmester av ellevte grad."},{"page_url":"https://nl.wikipedia.org/wiki/Kleine_boself","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/84/Histoirenaturell00muls_0071.jpg","page_title":"Kleine boself","context_page_description":"De kleine boself is een vogel uit de familie Trochilidae. Het is een kwetsbare vogelsoort uit Colombia en Peru. De vogel is iets groter dan de bijkolibrie maar behoort tot de kleinste vogeltjes van de wereld."},{"page_url":"https://ne.wikipedia.org/wiki/%E0%A4%95%E0%A4%BF%E0%A4%B0%E0%A5%8B%E0%A4%A8_%E0%A4%AA%E0%A5%8B%E0%A4%B2%E0%A4%BE%E0%A4%B0%E0%A5%8D%E0%A4%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6d/Kieron_pollard_training.jpg","page_title":"किरोन पोलार्ड","context_page_description":"किरोन पोलार्ड वेस्ट इन्डिज राष्ट्रिय क्रिकेट टिम का खेलाडी हुन।"},{"page_url":"https://en.wikipedia.org/wiki/Coiffaitarctia_steniptera","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/Coiffaitarctia_steniptera%3F_%287408071574%29.jpg","page_title":"Coiffaitarctia steniptera","context_page_description":"Coiffaitarctia steniptera is a moth of the family Erebidae first described by George Hampson in 1905. It is found in Costa Rica, French Guiana, Suriname and the Amazon region."},{"page_url":"https://it.wikipedia.org/wiki/Zenarchopteridae","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7a/Zenarchopterus_dunckeri.jpg","page_title":"Zenarchopteridae","context_page_description":"Gli Zenarchopteridae sono una famiglia di pesci ossei d'acqua dolce, salmastra e marina appartenenti all'ordine Beloniformes."},{"page_url":"https://ca.wikipedia.org/wiki/Sport_Club_Corinthians_Paulista","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f7/Maracana_L.jpg","page_title":"Sport Club Corinthians Paulista","context_page_description":"L'Sport Club Corinthians Paulista és un club esportiu, destacat en futbol, brasiler de la ciutat de São Paulo a l'estat de São Paulo."},{"page_url":"https://eo.wikipedia.org/wiki/Princelektista_kastelo_(Koblenco)","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c3/Koblenz_im_Buga-Jahr_2011_-_Kurf%C3%BCrstliches_Schloss_04.jpg","page_title":"Princelektista kastelo (Koblenco)","context_page_description":"La princelektista kastelo en Koblenco en la germana federacia lando Rejnlando-Palatinato estis rezidejo de la lasta ĉefepiskopo kaj princelektisto de Treviro, Clemens Wenzeslaus von Sachsen, kiu konstruigis ĝin fine de la 18a jarcento. Pli poste rezidis ĉi tie la prusa konprinco kaj posta imperiestro Wilhelm la 1a kiel rejna-vestfalia militara guberniestro."},{"page_url":"https://lb.wikipedia.org/wiki/Christopher_Reeve","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2e/C_Reeve_in_Marriage_of_Figaro_Opening_night_1985.jpg","page_title":"Christopher Reeve","context_page_description":"De Christopher D'Olier Reeve, gebuer de 25. September 1952 zu New York City a gestuerwen den 10. Oktober 2004 zu Mount Kisco, New York, war en US-amerikanesche Schauspiller, Regisseur an Auteur. Hien ass virun allem bekannt dofir, de Personnage vum Comicheld Superman tëscht 1978 an 1987 a véier Filmer geezpillt ze hunn. 1995 war hien, no engem Accident, wou e vun engem Päerd gefall war, querschnëttsgeleemt. Hien hat duerno awer nach déi eng oder aner Filmroll, sou z. B. an engem Remake vum Alfred Hitchcock sengem Rear Window. Hien huet och eng Kéier, beim Film The Brooke Ellison Story, Regie gefouert, an ass Auteur vu Bicher iwwer säi Liewen."},{"page_url":"https://nl.wikipedia.org/wiki/Eugen_Cicero","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/17/Eugen_Cicero_1967.jpg","page_title":"Eugen Cicero","context_page_description":"Eugen Cicero, geboren als Eugen Ciceu, was een Roemeense klassiek opgeleide jazzpianist. Hij werd bekend om zijn jazzinterpretaties en arrangementen van barok, klassiek en romantisch werk. Zijn interpretaties van jazzstandaarden bevatten vaak muzikale citaten uit klassieke werken. Hij speelde elk stuk als een improvisatie en dus was geen enkele uitvoering identiek aan een ander, blijkend uit meer dan 70 opnames op geluidsdragers. In 1976 ontving hij de Duitse Record Award voor zijn composities van Franz Schubert."},{"page_url":"https://de.wikipedia.org/wiki/Adochi","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/28/Adochi.jpg","page_title":"Adochi","context_page_description":"Heinz Georg Adochi ist Maler und Bildhauer. Der Künstler, der meist nur seinen Nachnamen verwendet, lebt in Köln, Deutschland und im italienischen Monte a Pescia, wo sich auch sein Atelier befindet."},{"page_url":"https://zh.wikipedia.org/wiki/%E6%9C%AC%E7%AF%A4%E4%B8%80%E4%B8%96","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ec/62-Benedict_I.jpg","page_title":"本篤一世","context_page_description":"教宗本笃一世于575年6月2日至579年7月30日在位为教宗。"},{"page_url":"https://hu.wikipedia.org/wiki/Bali_S%C3%A1ndor","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7c/Bali_S%C3%A1ndor_eml%C3%A9kt%C3%A1bl%C3%A1ja_-_2013.08.01.JPG","page_title":"Bali Sándor","context_page_description":"Bali Sándor magyar politikus, 1956 hőse, a Nagy-Budapesti Központi Munkástanács társalapítója és titkára."},{"page_url":"https://azb.wikipedia.org/wiki/%D8%B3%D8%A7%D8%B1%D8%A7_%D9%86%DB%8C%D9%85%DB%8C%D8%AA%D8%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0f/SaraNiemietz_Sept29_2015_byM_Cooper.jpg","page_title":"سارا نیمیتس","context_page_description":"سارا نیمیتس آمریکالی اویونچو، شارکی یازیچی، شارکیچی و موسیقیچی - پاپ، راک موسیقی ژانرلاریندا اثرلر یارادیب. سارا نیمیتس ۷ ژوئن ۱۹۹۲ ‏ تاریخینده شیکاقو شهرینده حیاتا گؤز آچیب."},{"page_url":"https://en.wikipedia.org/wiki/Eremophila_jucunda_subsp._pulcherrima","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d7/Eremophila_jucunda_pulcherrima_%28habit%29.jpg","page_title":"Eremophila jucunda subsp. pulcherrima","context_page_description":"Eremophila jucunda subsp. pulcherrima is a plant in the figwort family, Scrophulariaceae and is endemic to Western Australia. It is a small shrub with grey, hairy leaves and sepals and blue or mauve flowers often growing in stony places. It is similar to subspecies jucunda but is distinguished from it by its grey new growth and more northerly distribution."},{"page_url":"https://eu.wikipedia.org/wiki/Donostia","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ed/San_Sebastian-Tamborrada_Festival.jpg","page_title":"Donostia","context_page_description":"Donostia Gipuzkoako hiriburu eta udalerri nagusia da, eta Euskal Herriko hiri jendetsuenen artean laugarrena, 180.179 biztanle dauzka eta. Metropoli eremuak, berriz, 400.000 bat biztanle ditu. Kantauri itsasoaren ertzean dago, Bizkaiko golkoaren magalean.\\nEuskal Herriko hiriburuetatik Donostiak du euskaldunen ehunekorik handiena: % 33,5. Administrazio, kultura, hezkuntza eta turismoaren zentro garrantzitsu bat da Euskal Autonomi Erkidegoan, eta 2016an Europako kultura-hiriburua izan zen. 2014an, National Geographic aldizkariak munduko hiri zoriontsuenen artean kokatu zuen Donostia."},{"page_url":"https://fr.wikipedia.org/wiki/Somosk%C5%91%C3%BAjfalu","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5d/Hrad_%C5%A0omo%C5%A1ka-4.jpg","page_title":"Somoskőújfalu","context_page_description":"Somoskőújfalu est un village et une commune du comitat de Nógrád en Hongrie."},{"page_url":"https://ca.wikipedia.org/wiki/Aratinga_de_Finsch","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e8/Aratinga_finschi_-pet-5b.jpg","page_title":"Aratinga de Finsch","context_page_description":"L'aratinga de Finsch és un ocell de la família dels psitàcids que habita boscos poc densos i terres de conreu del sud-est de Nicaragua, Costa Rica i oest de Panamà."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%AF%D8%A7%D8%A6%D8%B1%D8%A9_%D8%A7%D9%84%D8%B9%D9%88%D8%A7%D9%86%D8%A9","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b3/Route_nationale_entre_Aouanna_ziama_a_jijel_algerie.jpg","page_title":"دائرة العوانة","context_page_description":"دائرة العوانة إحدى دوائر ولاية جيجل الجزائرية. عاصمتها هي بلدية العوانة وتضم بلديات:\\nالعوانة\\nسلمى بن زيادة"},{"page_url":"https://arz.wikipedia.org/wiki/%D9%BE%D9%88%D9%84_%D9%83%D8%A7%D8%B1%D9%88%D8%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/61/Paul_Carus.JPG","page_title":"پول كاروس","context_page_description":"پول كاروس كان عالم لاهوت و مترجم و ناشر و فيلسوف و لجوى من امريكا."},{"page_url":"https://be-tarask.wikipedia.org/wiki/%D0%91%D0%B0%D1%80%D1%8B_(%D0%86%D1%82%D0%B0%D0%BB%D1%96%D1%8F)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0c/Bari_u_rujnu.jpg","page_title":"Бары (Італія)","context_page_description":"Бары — горад на поўдні Італіі. Насельніцтва 321 432 чалавек."},{"page_url":"https://id.wikipedia.org/wiki/Monterey,_New_South_Wales","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/08/Moneterey_Beach.JPG","page_title":"Monterey, New South Wales","context_page_description":"Monterey adalah sebuah pinggiran kota di selatan Sydney, di negara bagian New South Wales, Australia 15 km sebelah selatan distrik bisnis pusat Sydney dan merupakan bagian dari wilayah St George. Monterey berada di wilayah pemerintah daerah City of Rockdale."},{"page_url":"https://bs.wikipedia.org/wiki/Pyroloideae","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fd/Moneses_uniflora_1437.JPG","page_title":"Pyroloideae","context_page_description":"Pyroloideae su potporodica biljaka iz porodice Ericaceae. Nekada je tretiran kao zasebna porodica, Pyrolaceae. Također je tretirana i kao tribus \\"Pyroleae\\" u potporodici Monotropoideae. Sastoji se od četiri roda:\\nChimaphila,\\nPyrola, te\\nMoneses i\\nOrthilia, koji su monotipski. Oni mikotrofni, tj. dobijaju hranjive tvari od fotosinteze, ali i od mikoriznih gljivica."},{"page_url":"https://it.wikipedia.org/wiki/Champignolles_(Eure)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e2/Champignolles_%28Eure%29.jpg","page_title":"Champignolles (Eure)","context_page_description":"Champignolles è un comune francese di 39 abitanti situato nel dipartimento dell'Eure nella regione della Normandia."},{"page_url":"https://it.wikipedia.org/wiki/Fortezza_di_Soroca","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/41/Soroca_Fort_%281980%29._%2828830002673%29.jpg","page_title":"Fortezza di Soroca","context_page_description":"La fortezza di Soroca è una fortezza storica nella Repubblica di Moldavia, nella moderna città di Soroca."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A4%D0%BE%D0%BD%D1%82%D0%B0%D0%BD_%D0%BD%D0%B0_%D0%9D%D0%B5%D0%B2%D0%B5","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/3e/Fountain_on_Neva_02.JPG","page_title":"Фонтан на Неве","context_page_description":"Фонта́н на Неве́ — фонтан, который располагался в акватории реки Невы напротив стрелки Васильевского острова. Также известен как плавучий фонтан. Работа фонтана была приостановлена из-за кризиса в 2009 году без объяснения причин; в данный момент фонтан разобран. Шло обсуждение и выбор нового местоположения, запуск фонтана на новом месте планировался не ранее 2011 года, но дальше дело не пошло."},{"page_url":"https://eo.wikipedia.org/wiki/El_Campello","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7b/Puerto_de_Campello.jpg","page_title":"El Campello","context_page_description":"El Campello [elkamPEjo] estas hispanuja municipo apartenanta al Valencia Komunumo kaj al provinco Alakanto. Ĝi lokas en komarko L’Alacantí. Ĝia etendo konsistas je 55,27 km². Dudek sep mil okcent naŭdek tri personoj estis enregistritaj estantaj loĝantoj en la jaro 2018. Ĝi estas surborda al Mediteranea Maro."},{"page_url":"https://es.wikipedia.org/wiki/Tifariti","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4f/Hospital_de_navarra_tifariti_rasd.jpg","page_title":"Tifariti","context_page_description":"Tifariti es una localidad y daira saharaui situada en la parte meridional de la provincia de Saguía el Hamra en el noreste del Sahara Occidental. Actualmente está controlada por el Frente Polisario y su población es de alrededor de unas 3000 personas.​\\nSe encuentra en una meseta desértica y pedregosa, donde comienza hacia el interior la hamada, con poca vegetación aunque bajo la superficie se encuentran algunas bolsas naturales de agua. En las cercanías existe un importante yacimiento de arte rupestre del Neolítico."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9B%D0%B8%D1%86%D0%B0%D1%80%D1%96_%D0%9E%D0%A3%D0%9D_%D1%82%D0%B0_%D0%A3%D0%9F%D0%90","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/4c/Rom%C3%A1n_Shuj%C3%A9vych.jpg","page_title":"Лицарі ОУН та УПА","context_page_description":"В Українській повстанській армії було створено власну систему нагород і заохочень, запроваджену в 1944 році Наказом ГВШ УПА. У 1945 році першими відзначеними стали командири УПА Дмитро Карпенко — «Яструб» і Дмитро Пелип — «Євшан». Однак, ні вони, ні інші, згодом відзначені, вояки УПА та підпільники не отримали своїх нагород, а лише тимчасові посвідчення, що їх заміняли. У 1950 році підпільний графік Ніл Хасевич розробив проєкт нагород, який передали за кордон, де виготовили невелику кількість відзнак для вручення Лицарям ОУН та УПА, які перебували на еміграції та передачі зразків Головному командирові УПА Василеві Куку. Зважаючи на тогочасні реалії боротьби, жоден із учасників збройного підпілля ОУН так і не отримав своїх відзнак.\\nЗ метою вшанування пам'яті Лицарів ОУН та УПА Ювілейний комітет вирішив відновити повстанські нагороди та вручити їх нащадкам, тим самим реалізувавши на практиці систему нагород УПА і збройного підпілля ОУН."},{"page_url":"https://en.wikipedia.org/wiki/Culture_of_Lebanon","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/72/An_der_K%C3%BCste_Beirut_center.jpg","page_title":"Culture of Lebanon","context_page_description":"The culture of Lebanon and the Lebanese people emerged from various civilizations over thousands of years. It was home to the Phoenicians and was subsequently conquered and occupied by the Assyrians, the Greeks, the Romans, the Persians, the Arabs, the Crusaders, the Ottoman Turks and the French. This variety is reflected in Lebanon's diverse population, composed of different religious groups, and features in the country's festivals, musical styles, literature, cuisine of Lebanon and architecture of Lebanon. Tourism in Lebanon is popular with periods of interruption during conflict.\\nDespite the religious and denominational diversity of the Lebanese, they “share an almost common culture”.\\nBased on Article 11 of the Constitution of Lebanon states: \\"Arabic is the official national language. A law determines the cases in which the French language is to be used.\\" The spoken Lebanese is the language used in public which is a hybrid of the languages of the above-mentioned cultures, Food, music, and literature are deep-rooted “in wider Mediterranean and Levantine norms”.\\nThe hilly Mediterranean Geography of Lebanon has played a role in shaping the history of Lebanon and its culture."},{"page_url":"https://vi.wikipedia.org/wiki/Moju","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e8/Moju_02.jpg","page_title":"Moju","context_page_description":"Moju là một đô thị thuộc bang Pará, Brasil. Đô thị này có diện tích 9093,85 km², dân số năm 2007 là 64385 người, mật độ 7,08 người/km²."},{"page_url":"https://zh.wikipedia.org/zh-mo/%E5%8A%9B%E5%AF%B6%E9%9B%86%E5%9C%98","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/Lippo_Centre%2C_Hong_Kong.jpg","page_title":"力寶集團","context_page_description":"力寶集團是一家印尼房地產公司，也是印尼第二大財團。"},{"page_url":"https://nl.wikipedia.org/wiki/Berlindis_van_Meerbeke","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fc/Berlindiskapel_Meerbeke.JPG","page_title":"Berlindis van Meerbeke","context_page_description":"De heilige Berlinde of Berlende is een Brabantse heilige die voornamelijk wordt vereerd in Meerbeke."},{"page_url":"https://pt.wikipedia.org/wiki/Hist%C3%B3ria_do_Amap%C3%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/Carte_de_la_Guyane_fran%C3%A7oise_et_l%27isle_de_Cayenne_%28Bellin%2C_1763%29.jpg","page_title":"História do Amapá","context_page_description":"A História do Amapá tem início antes mesmo do Descobrimento do Brasil."},{"page_url":"https://de.wikipedia.org/wiki/Kurt_Scheele","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0e/Kurt_Scheele_Paar_mit_Lampe.png","page_title":"Kurt Scheele","context_page_description":"Kurt Scheele war ein deutscher Maler und Holzschneider. Sein unzerstörtes Gesamtwerk umfasst ca. 330 Holzschnitte, 150 Ölbilder, Aquarelle, Gouachen, Kupferstiche, Pinsel- und Federzeichnungen, sowie einige literarische Werke. In den 1930er Jahren erlangte Kurt Scheele internationale Anerkennung. So hat unter anderem 1936 Dwight D. Eisenhower auf einer Ausstellung in New York ein Ölbild von Kurt Scheele erworben. Ab 1937 galten Kurt Scheeles Bilder im nationalsozialistischen Deutschland als „entartet“, so dass Kurt Scheele nach dem Zweiten Weltkrieg in Vergessenheit geriet."},{"page_url":"https://it.wikipedia.org/wiki/Natural_Bridge_(Virginia)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c3/Frederic_Edwin_Church_-_The_Natural_Bridge%2C_Virginia.jpg","page_title":"Natural Bridge (Virginia)","context_page_description":"Il Natural Bridge, situato nella Contea di Rockbridge, in Virginia negli Stati Uniti è una formazione geologica in cui il Cedar Creek ha scavato una gola nel terreno calcareo, formando così un arco naturale di 66 m di altezza. Si compone di strati di calcare orizzontali ed è ciò che rimane del tetto di una grotta o di un tunnel attraverso il quale scorreva il torrente. Il Natural Bridge è stato designato un Virginia Historic Landmark e un National Historic Landmark."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_gemeentelijke_monumenten_in_Buren_(gemeente)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fd/Kerk-Avezaath_Hooiberg-en-houten-schuur_Achterstraat_40.jpg","page_title":"Lijst van gemeentelijke monumenten in Buren (gemeente)","context_page_description":"De gemeente Buren heeft 264 gemeentelijke monumenten, hieronder een overzicht. Zie ook de rijksmonumenten in Buren."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%8A%A0%E9%87%8C%E6%B3%A2%E7%AC%AC%E7%BA%AA%E5%BF%B5%E7%A2%91","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/14/GaribaldiBuenosAires.jpg","page_title":"加里波第纪念碑","context_page_description":"加里波第纪念碑是朱塞佩·加里波第的骑马雕像，位于阿根廷布宜诺斯艾利斯巴勒莫区的意大利广场，是该市的地标。\\n朱塞佩·加里波第是意大利政治和军事人物。他在二十多岁时加入了意大利爱国组织烧炭党，起义失败后逃离意大利，然后参与乌拉圭独立运动，在乌拉圭内战中领导意大利军团，此后返回意大利领导意大利统一运动。由于他在南美洲和欧洲的军事成就，而被称为“两个世界的英雄”。\\n该市的意大利居民捐赠了这座纪念碑，由意大利雕塑家Eugenio Maccagnani创作，是意大利布雷西亚加里波第纪念碑的复本，于1904年6月19日揭幕。"},{"page_url":"https://en.wikipedia.org/wiki/Goodwill_Zwelithini_kaBhekuzulu","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c9/King_Goodwill_Zwelithini.jpg","page_title":"Goodwill Zwelithini kaBhekuzulu","context_page_description":"King Goodwill Zwelithini kaBhekuzulu is the reigning King of the Zulu nation under the Traditional Leadership clause of South Africa's republican constitution.\\nHe became king on the death of his father, King Cyprian Bhekuzulu kaSolomon, in 1968. Prince Israel Mcwayizeni kaSolomon acted as the regent from 1968 to 1971 while the King took refuge in St. Helena for three years to avoid assassination. After his 21st birthday and his first marriage, Zwelithini was installed as the eighth monarch of the Zulus at a traditional ceremony at Nongoma on 3 December 1971, attended by 20,000 people."},{"page_url":"https://ko.wikipedia.org/wiki/%ED%84%B8%EC%BD%94%EB%BF%94%EC%86%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/87/Coelodonta_antiquitatis_.jpg","page_title":"털코뿔소","context_page_description":"털코뿔소는 플라이스토세에 아시아와 유럽의 북부 초원에 서식했던 코뿔소의 일종이다. 마지막 빙하기에 살아남았으나 현재는 멸종된 상태이며, 대한민국에서는 강원도 태백과 경기도에서 화석이 발굴되었다. 털코뿔소는 플라이스토세의 거대 동물군에 속한다."},{"page_url":"https://be.wikipedia.org/wiki/%D0%9A%D0%B5%D0%B2%D1%96%D0%BD_%D0%90%D0%BD%D0%B4%D1%8D%D1%80%D1%81%D0%B0%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a4/Anderson_WM17_%285%29_%2836183654065%29.jpg","page_title":"Кевін Андэрсан","context_page_description":"Кевін Андэрсан — прафесійны тэнісіст з Паўднёва-Афрыканскай Рэспублікі. Фіналіст адкрытага чэмпіянату ЗША 2017 года і Уімблданскага турніру 2018 года, пераможца чатырох турніраў серыі Сусветнага Тура ATP 250 і фіналіст чатырох турніраў серыі Сусветнага Тура ATP 500.\\nПершы тэнісіст з Паўднёва-Афрыканскай Рэспублікі, які дасягнуў топ-10 рэйтынгу, пасля Уэйна Ферэйры, які заняў 10-ю пазіцыю ў 1997 годзе."},{"page_url":"https://sv.wikipedia.org/wiki/Eciton_vagans","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a9/Eciton_vagans_casent0173509_head_1.jpg","page_title":"Eciton vagans","context_page_description":"Eciton vagans är en myrart som först beskrevs av Olivier 1792. Eciton vagans ingår i släktet Eciton och familjen myror."},{"page_url":"https://fr.wikipedia.org/wiki/Swanton_(Vermont)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0e/Missisquoi_Valley_Rail_Trail_Swanton_Vermont.JPG","page_title":"Swanton (Vermont)","context_page_description":"Swanton est une municipalité dans l'État du Vermont aux États-Unis. Sa population était de 6 203 en l'an 2000."},{"page_url":"https://id.wikipedia.org/wiki/Muchtar_Pakpahan","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/40/Rosintan_Marpaung_-_2017.jpg","page_title":"Muchtar Pakpahan","context_page_description":"Prof. Dr. Muchtar Pakpahan, S.H., M.A. adalah tokoh buruh Indonesia yang mendirikan serikat buruh independen pertama di Indonesia. Karena usahanya yang gigih untuk memperjuangkan kenaikan gaji buruh, lelaki kelahiran Bah Jambi 2 Tanah Jawa, Simalungun Sumatra Utara ini memperoleh berbagai penghargaan hak asasi manusia dari dunia internasional. Sekarang Pakpahan aktif sebagai pengacara di lawfirmnya Muchtar Pakpahan Associates dan mengajar di Fakultas Hukum Universitas Kristen Indonesia."},{"page_url":"https://no.wikipedia.org/wiki/Rabat","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6e/Rabat_Mausole_MohammedV.jpg","page_title":"Rabat","context_page_description":"Rabat er hovedstaden i Marokko, og ligger ved elva Bou Regregs utløp. Byen er kjent blant annet for praktfulle hager og en rik og lang forhistorie. Innbyggertallet i byen ligger på ca. 690 000 og er den tredje største byen i Marokko. I Rabat og områdene rundt byen bor det 1,9 millioner mennesker. Rabat er også hovedstad for Rabat-Salé-Zemmour-Zaer regionen.\\nRabat ble oppført på UNESCOs liste over verdens kultur- og naturarvsteder i 2012."},{"page_url":"https://el.wikipedia.org/wiki/%CE%9B%CE%B5%CE%BF%CE%BD%CF%84%CF%8C%CF%80%CE%BF%CE%BB%CE%B9%CF%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/93/Terzo_periodo_intermedio%2C_fine_XXII-inizio_XV_dinastia%2C_rilievo_di_re_iuput_II%2C_754-715_ac_ca._02.JPG","page_title":"Λεοντόπολις","context_page_description":"Η Λεοντόπολις ή Λεόντων πόλις ή Λεοντώ ήταν αρχαία πόλη, σε άγνωστη σήμερα θέση της Αιγύπτου, στα αρχαία αιγυπτιακά γνωστή ως Ταρεμού και στις λατινικές πηγές ως Leontos oppidum. Ο σημερινός αρχαιολογικός χώρος που ταυτίζεται με την πόλη ονομάζεται στα αραβικά Τελ ελ-Μουκντάμ."},{"page_url":"https://pt.wikipedia.org/wiki/Faculdade_de_Economia_da_Universidade_Federal_de_Mato_Grosso","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/58/Logo_ENECOMAT.png","page_title":"Faculdade de Economia da Universidade Federal de Mato Grosso","context_page_description":"A Faculdade de Economia é uma instituição de ensino e pesquisa subordinada a Universidade Federal de Mato Grosso, localizada na Cidade Universitária Gabriel Novis Neves. A faculdade oferece dois cursos de ciências econômicas em bacharelado, além de mestrado e especialização em sustentabilidade."},{"page_url":"https://fi.wikipedia.org/wiki/Baruch_Samuel_Blumberg","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f8/Baruch_Samuel_Blumberg_high_res_by_Dominic_Hart_%28NASA%29.jpg","page_title":"Baruch Samuel Blumberg","context_page_description":"Baruch Samuel ”Barry” Blumberg oli yhdysvaltalainen lääkäri ja biokemisti. Hänet tunnetaan erityisesti hepatiitti B -tutkimuksistaan, joiden ansiosta hänelle myönnettiin Nobelin lääketieteen palkinto vuonna 1976. Blumberg toimi urallaan muun muassa Oxfordin yliopiston Balliol Collegen rehtorina ja NASAn astrobiologian instituutin ensimmäisenä johtajana."},{"page_url":"https://pt.wikipedia.org/wiki/Manuel_Lobo_Antunes","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d7/Manuel_Lobo_Antunes.png","page_title":"Manuel Lobo Antunes","context_page_description":"Manuel Lobo Antunes é um jurista e diplomata português. É embaixador de Portugal em Londres."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%A4%A9%E6%B4%A5%E4%BA%A4%E9%80%9A","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/%E7%82%AB%E5%BD%A9%E6%B4%A5%E9%97%A899%E6%B5%B7%E6%B2%B3%E5%A4%9C%E6%99%AF.jpg","page_title":"天津交通","context_page_description":"天津交通包括天津市的公路、轨道交通、航空、航海、公交等多种出行方式。"},{"page_url":"https://he.wikipedia.org/wiki/%D7%9E%D7%A8%D7%97%D7%91_%D7%9E%D7%95%D7%92%D7%9F","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b4/Tama5424.jpg","page_title":"מרחב מוגן","context_page_description":"מרחב מוגן הוא סוג של מקלט הנבנה בתוך מעטפת המבנה שאת יושביו נועד לשרת. בעקבות מלחמת המפרץ הוחלט על הקמתם של מרחבים מוגנים בכל בנייה חדשה בישראל.\\nמטרתם של המרחבים המוגנים היא לספק מיגון בפני התקפות אוויר והתקפות טילים שזמן ההתרעה בפניהן הוא קצר מכדי לאפשר גישה למקלט. גישה אל מקלט הנמצא באותה הקומה בה מתגוררים ואף בתוך הדירה עצמה מצמצם באופן משמעותי את זמן ההגעה אליו. כמו כן, הפיכת המקלט לחלק מדירת המגורים או מן המרחב הקומתי מביאה להעלאת רמת התחזוקה של המקלט.\\nהמרחב המוגן מתוכנן לספק הגנה ליושביו מפני התקפות עם פצצות חומר נפץ מרסק. הוא אף אטום לחדירתם של גזים רעילים ובכך נותן מענה חלקי לתקיפות בלתי קונבנציונליות. במרחבים המוגנים קיימת אפשרות להתקין מסנני אוויר במקרה שהשהייה הנדרשת ארוכה או כשהמדובר בתקיפה באמצעים ביולוגיים, כימיים או רדיואקטיביים.\\nההגדרות המפורטות וההוראות לבניית מרחבים מוגנים מצויות בתקנות ההתגוננות האזרחית, התש\\"ן-1990.\\nקיימות מספר הגדרות משנה למרחבים מוגנים בהתאם למיקומם:\\nמרחב מוגן דירתי - מותקן בדירות מגורים: שטחו הפנימי יהיה 9 מ\\"ר לפחות.\\nמרחב מוגן קומתי - מרחב קומתי משותף בבתי דירות בהם אין ממ\\"ד בכל דירה ובבניינים רבי קומות אחרים.\\nמרחב מוגן מוסדי - מותקן בכל מבנה ציבורי."},{"page_url":"https://fr.wikipedia.org/wiki/Jeu_traditionnel_et_r%C3%A9gional","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/97/Bresle_jeu_de_l%27assiette_1_%C2%B0G7%C2%B0.jpg","page_title":"Jeu traditionnel et régional","context_page_description":"Ces jeux étaient utilisés lors des fêtes, dans les estaminets ou dans la rue."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_leden_van_de_Kantonsraad_van_Zwitserland_uit_het_kanton_Thurgau","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/18/Flag_of_Canton_of_Thurgau.svg","page_title":"Lijst van leden van de Kantonsraad van Zwitserland uit het kanton Thurgau","context_page_description":"Dit artikel bevat een lijst van leden van de Kantonsraad van Zwitserland uit het kanton Thurgau.\\nThurgau heeft zoals de meeste kantons twee vertegenwoordigers in de Kantonsraad."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%A3%D0%B8%D0%BB%D1%8F%D0%BC_%D0%A1%D0%BA%D0%BE%D1%80%D1%81%D0%B1%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0b/William_Scoresby.jpg","page_title":"Уилям Скорсби","context_page_description":"Уилям Скорсби Младши е английски изследовател на Арктика. В периода 1800 – 1823 извършва 17 плавания в полярните райони."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E7%91%9E%E6%AF%94%C2%B7%E9%A6%AC%E8%98%AD%E7%B6%AD%E7%88%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6e/Rabbit_Maranville_1914.jpg","page_title":"瑞比·馬蘭維爾","context_page_description":"华特·詹姆斯·文森·马兰维尔，绰号“兔子”，为美国职棒大联盟的二垒手与游击手。他生涯曾效力过勇士、海盗、小熊、罗宾与红雀等队。他于1912年开启他的职棒生涯，直到1935年退休。生涯共23个赛季一度是国联纪录，而这项纪录一直到1986年才被安打王彼得·罗斯打破。"},{"page_url":"https://es.wikipedia.org/wiki/Amy_(documental)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a6/Bambi_Graffiti_-_Amy_Winehouse%2C_Camden_Road_London.jpg","page_title":"Amy (documental)","context_page_description":"Amy es una película documental británica de 2015 sobre la vida y la muerte de la cantante y compositora Amy Winehouse dirigida por el cineasta Asif Kapadia, autor del también documental Senna sobre el piloto de automovilismo brasileño Ayrton Senna. La película cubre la vida de Winehouse y su lucha contra el abuso de sustancias, tanto antes como después de que su carrera floreciera, y que finalmente causó su muerte. La película, que se estrenó en el Festival de Cannes, ​ ganó el Óscar al mejor largometraje documental en 2016."},{"page_url":"https://de.wikipedia.org/wiki/American_Center_for_Law_and_Justice","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/Jay_Sekulow_%28cropped%29.jpg","page_title":"American Center for Law and Justice","context_page_description":"Das American Center for Law and Justice ist eine US-amerikanische evangelikale Organisation, die unter anderem die Lebensrechtsbewegung vertritt.\\nDas ACLJ wurde 1990 von dem evangelikalen Fernsehprediger Pat Robertson als Gegenpol zur American Civil Liberties Union gegründet, um religiöser Intoleranz gegenüber Christen entgegenzuwirken. Der Sitz der Organisation ist in Washington, D.C.\\nIm Jahr 1992 berief Robertson Jay Sekulow zum Direktor und Chefanwalt. Sekulow, der erfolgreich mehrere Verfahren vor dem Obersten Gerichtshof der Vereinigten Staaten führte und als Fürsprecher konservativer Interessen gilt, wird der Religiösen Rechten in den Vereinigten Staaten zugerechnet.\\nDas European Centre for Law and Justice wurde 1998 von Jay Sekulow und Thomas Patrick Monaghan als europäischer Ausleger des ACLJ gegründet.\\nDas ACLJ gehört zu einer Reihe von zahlreichen amerikanischen christlichen Bewegungen, die in Afrika aktiv sind, um die Verabschiedung von konservativ-christlichen Gesetzen zu beeinflussen. Dabei wird ein besonderer Schwerpunkt auf die Kriminalisierung der Homosexualität gelegt, einschließlich eines Gesetzes zur Homosexualität in Uganda."},{"page_url":"https://de.wikipedia.org/wiki/Sch%C3%B6nbrunner_Erzieherschule","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f5/Sch%C3%B6nbrunn01.jpg","page_title":"Schönbrunner Erzieherschule","context_page_description":"Die Schönbrunner Erzieherschule, auch Schönbrunner Schule oder Kinderfreundeschule Schönbrunn, war eine von 1919 bis 1924 bestehende pädagogische Ausbildungseinrichtung der damaligen österreichischen Kinderfreunde."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%94%D0%B5%D1%82%D0%B0%D0%BD%D0%B4%D0%B5%D1%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/Detan.svg","page_title":"Детандер","context_page_description":"Detander е устройство, което преобразува потенциална енергия на несвиваем газ или пара в механична енергия, до оросяване, конденз, течност, но се използва основно за охлаждане а не за извършване на външна работа. Всмукваната пара подпомага разширението и се охлажда/кондензира, улеснявайки и свиването. Използва се в производствения цикъл за получаване на втечнени газове като кислород, азот, водород и хелий. Най-разпространени са буталните детандери и турбодетандерите.\\nЕфектът на Джаул-Томсън помага да се разбере прилагането на детандерите за втечняване на газове. При този ефект се детандира силно сгъстен реален газ, като възниква слабо увеличаване на прилаганата механична работа, за сметка на монотермична топлина. Ако при дадена работна температура, Д-Т коефициентът е отрицателен, то детандиране/дроселиране няма да може да втечни газа.\\nЗа газ увеличението на работата е толкова малко, че е пренебрегвано във физиката, за разлика от слабия термичен ефект, който обаче е решаващ за упоменатото по-горе навлизане в паровото състояние на флуида."},{"page_url":"https://de.wikipedia.org/wiki/Attersee-Mondsee-Becken","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d1/Attersee-Mondsee-Becken%2C_westlicher_Teil.JPG","page_title":"Attersee-Mondsee-Becken","context_page_description":"Das Attersee-Mondsee-Becken ist eine von 41 Oberösterreichischen Raumeinheiten und liegt im Salzkammergut."},{"page_url":"https://en.wikipedia.org/wiki/Shiva_temple_of_stone","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/%E0%A6%AA%E0%A6%BE%E0%A6%A5%E0%A6%B0%E0%A7%87%E0%A6%B0_%E0%A6%B6%E0%A6%BF%E0%A6%AC_%E0%A6%AE%E0%A6%A8%E0%A7%8D%E0%A6%A6%E0%A6%BF%E0%A6%B0.jpg","page_title":"Shiva temple of stone","context_page_description":"Shiva Temple of Stone is an ancient temple and archeological site located in Mymensingh district of Bangladesh. Raja Jagat Kishore Acharya, the then zamindar of Atani in Muktagachha built the temple with the help of architect Moyez Uddin. It is the temple set up by the zamindars in front of the Armed Police Battalion Camp in Muktagachha town of Muktagachha upazila of Mymensingh district. The distance from Muktagachha Upazila to the temple is 18 kilometers."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%94%D0%B8%D0%BC%D0%B8%D1%82%D1%8A%D1%80_%D0%9F%D0%B0%D0%BB%D0%B5%D0%BE%D0%BB%D0%BE%D0%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c2/Benozzo_Gozzoli%2C_lorenzo_il_magnifico%2C_cappella_dei_Magi.jpg","page_title":"Димитър Палеолог","context_page_description":"Деметрий Палеолог от династията Палеолози е византийски принц и деспот на Морея de jure 1428 – 1460, de facto 1436 – 1438 и 1451 – 1460, владетел на Лемнос 1423 – 1440, владетел на Месембрия 1440 – 1451 и владетел на Тасос 1460 – 1466.\\nТой е малък син на византийския император Мануил II Палеолог и съпругата му сръбската принцеса Елена Драгаш. Брат е на византийския император Йоан VIII Палеолог и на последния византийскии мператор Константин XI Драгаш, на Андроник Палеолог, управител на Солун, и на деспотите на Морея, Теодор II Палеолог и Тома Палеолог.\\nТой прави неуспешен опит за преврат през 1448 г. На 29 май 1453 г. османският султан Мехмед II завладява Константинопол и предлага на Деметрий и брат му Тома да останат като васали управители на деспотство Морея.\\nВ 1458 г. турците завземат северния му дял, а в 1460 г. и останалата част от деспотството, и обсаждат столицата Мистра, която сам Деметрий Палеолог им предава без битка. Дъщеря му Елена е взета в султанския харем, затова са му дадени като компенсация Енос и островите Тасос, Лемнос, Имброс и Самотраке, фактически само приходите от тях, но не и управлението им."},{"page_url":"https://sco.wikipedia.org/wiki/One_World_Trade_Center","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ac/OneWorldTradeCenter.jpg","page_title":"One World Trade Center","context_page_description":"One World Trade Center is the main biggin o the rebiggit World Trade Center complex in Lswer Manhattan, New York Ceety. It is the tawest biggin in the Wastren Hemisphere, an the saxt-tawest in the warld. The supertaw structur haes the same name as the North Tower o the oreeginal World Trade Center, which wis completely destroyed in the terrorist attacks o September 11, 2001. The new skyscraper staunds on the northwast corner o the 16-acre World Trade Center steid, on the steid o the oreeginal 6 World Trade Center."},{"page_url":"https://en.wikipedia.org/wiki/Eurofima_coach","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/23/SBB-Eurofimawagen.jpg","page_title":"Eurofima coach","context_page_description":"The Eurofima coach, or European Standard Coach, is a passenger car designed for use on international railway routes in Europe. It was commissioned by the European Company for the Financing of Railroad Rolling Stock.\\nOverall production was 10 prototypes, followed by 500 coaches ordered in 1973 and delivered in 1977 to the following railway companies:\\nAustrian Federal Railways: 25 Amoz and 75 Bmoz;\\nDeutsche Bundesbahn: 100 Avmz 207 first class;\\nFerrovie dello Stato: 30 Az and 70 Bz;\\nFrench National Railway Corporation: 100 A9u;\\nNational Railway Company of Belgium: 20 A9 and 60 B11;\\nSwiss Federal Railways: 20 Am 61 85 19-90."},{"page_url":"https://vi.wikipedia.org/wiki/Kh%C3%A1ch_s%E1%BA%A1n_Bohema","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/84/Bohema_od_strony_parku_miejskiego.jpg","page_title":"Khách sạn Bohema","context_page_description":"Hotel Bohema là một khách sạn 5 sao được đặt trong một tòa nhà lịch sử tại số 9, đường Konarskiego, ở trung tâm thành phố Bydgoszcz, Ba Lan. Tòa nhà được đăng ký trong Danh sách Di sản của Kuyavian-Pomeranian."},{"page_url":"https://de.wikipedia.org/wiki/Boris_Bernaskoni","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3e/Dooryeltsincentreyekaterinburg.jpg","page_title":"Boris Bernaskoni","context_page_description":"Boris Bernaskoni ist ein russischer Architekt, Ingenieur, Verleger, Gewinner verschiedener Architekturpreise und Teilnehmer an verschiedenen Architekturausstellungen. Er ist der Gründer des Büros BERNASKONI. Boris Bernaskoni ist Gründungsmitglied des Stadtrats im Skolkovo Innovation Center in Moskau. Boris Bernaskoni erlangte erstmals 2008 internationale Anerkennung, als er einen internationalen Wettbewerb für das Perm-Museum für moderne Kunst gewann, bei dem Peter Zumthor Teil der Jury und an dem sich Teilnehmer wie Coop Himmelbau, Zaha Hadid und Asymptote beteiligten. Sein Matrex-Projekt erhielt 2016 auf der 15. Architekturbiennale von Venedig viel Anerkennung. Im Jahr 2019 nahm Bernaskoni an verschiedenen Veranstaltungen des Davos World Economic Forum teil, darunter an einem Vortrag über wandelbare Architektur in den Städten der Zukunft auf dem Emerging Technologies Investment Meeting des Forums und an einer Diskussion über die Digitalisierung der Städte in Russia House."},{"page_url":"https://de.wikipedia.org/wiki/Santa_Maria_delle_Grazie_(Varallo)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/99/Varallo_Sesia_Santa_Maria_delle_Grazie_002.JPG","page_title":"Santa Maria delle Grazie (Varallo)","context_page_description":"Die Kirche Santa Maria delle Grazie in Varallo wurde zusammen mit dem angrenzenden Franziskanerkloster von Pater Bernardino Caimi zwischen 1486 und 1493 gleichzeitig mit dem Beginn der Arbeiten am Sacro Monte errichtet. Im März 1931 hat Papst Pius XI. sie zur Würde einer Basilica minor erhoben."},{"page_url":"https://de.wikipedia.org/wiki/Architektur_in_D%C3%BCsseldorf","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b3/Industriehaus_in_Duesseldorf-Pempelfort%2C_von_Suedwesten.jpg","page_title":"Architektur in Düsseldorf","context_page_description":"Die Geschichte der Architektur in Düsseldorf reicht vom Mittelalter bis in das 21. Jahrhundert. Zahlreiche typische Bauwerke verschiedener Epochen sind noch erhalten oder wurden wieder aufgebaut. Seinen architekturgeschichtlichen Anfang nimmt Düsseldorf mit einer Vielzahl von Bauwerken im Stil der Vorromanik aus dem 11. Jahrhundert. Ein Beispiel für die gotische Architektur in Düsseldorf ist die Lambertuskirche. In der Neuzeit wurde das Düsseldorfer Schloss im Stil der Renaissance ausgebaut. Das Ratinger Tor gehört zu den wenigen rein klassizistischen Bauten des alten Düsseldorf. Die Stadt erlebte den Höhepunkt städtebaulicher und künstlerischer Entwicklung ab 1890 bis 1914 mit Historismus, Reformarchitektur und Jugendstil. Nach dem Ersten Weltkrieg wurde Düsseldorf für seinen Backsteinexpressionismus und Neuklassizismus bekannt. Während der Luftangriffe auf Düsseldorf wurden weite Teile der an historischen Gebäuden reichen Innenstadt zerstört. Es folgte in der Nachkriegszeit der Neuklassizismus und die Moderne. Um die 1960er Jahre erlebte Düsseldorf seinen Höhepunkt als Industrie-, Finanz-, Verwaltungs-, Messe- und Modemetropole."},{"page_url":"https://no.wikipedia.org/wiki/Liste_over_Sj%C3%B8forsvarets_fart%C3%B8yer","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/US_Navy_100927-N-6011D-032_The_Norwegian_diesel_electric_submarine_HNOMS_UTVAER_%28S303%29_arrives_at_Naval_Station_Norfolk.jpg","page_title":"Liste over Sjøforsvarets fartøyer","context_page_description":"Liste over Sjøforsvarets fartøyer er en oversikt over fartøyer som er i tjeneste i Sjøforsvaret."},{"page_url":"https://pl.wikipedia.org/wiki/My%C5%9Blib%C3%B3rz_(gmina)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/00/Piramida_wieku_Gmina_Mysliborz.png","page_title":"Myślibórz (gmina)","context_page_description":"Myślibórz – gmina miejsko-wiejska w południowo-zachodniej części województwa zachodniopomorskiego, w powiecie myśliborskim. Siedzibą gminy jest miasto Myślibórz.\\nWedług danych z 31 grudnia 2016 r. gmina miała 20 251 mieszkańców. Natomiast według danych z 31 grudnia 2017 roku gminę zamieszkiwało 20 096 osób.\\nMiejsce w województwie:\\npowierzchnia 15., ludność 15."},{"page_url":"https://en.wikipedia.org/wiki/Biloxi_Light","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/81/Biloxi_Lighthouse.jpg","page_title":"Biloxi Light","context_page_description":"Biloxi Lighthouse is a lighthouse in Biloxi, Mississippi, adjacent to the Mississippi Sound of the Gulf of Mexico. The lighthouse has been kept by female keepers for more years than any other lighthouse in the United States. It was listed on the National Register of Historic Places in 1973 and declared a Mississippi Landmark in 1987."},{"page_url":"https://cs.wikipedia.org/wiki/%C5%A0estio%C4%8Dka","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/84/Harpactea_lepida.JPG","page_title":"Šestiočka","context_page_description":"Harpactea je rod pavouků z čeledi šestiočkovití, do kterého je řazeno přes 170 druhů.\\nStejně jako ostatní příslušníci čeledi má rod Harpactea pouze šest očí. Typový druh šestiočka štíhlá dosahuje velikosti asi 6 mm a obě pohlaví jsou si vzájemně velmi podobná.\\nAreál rodu sahá od Evropy a severní Afriky po Blízký Východ, většina druhů se však vyskytuje endemicky v malých oblastech ve Středomoří.\\nJedná se o predátory, kteří nestaví sítě. Žijí často v suchých lesích a křovinách, přes den se ukrývají pod kameny nebo pod kůrou a v noci vyráží na lov. Na rozdíl od příbuzného rodu Dysdera se obvykle neživí stínkami, ale loví hmyz, druh šestiočka ryšavá loví i pavouky, např. skálovky rodu Drassodes.\\nU druhu šestiočka sadistická byla pozorována tzv. traumatická inseminace. Jedná se o způsob kopulace, kdy samec orgánem podobným injekční stříkačce vstříkne sperma přes kutikulu přímo do tělní dutiny samice. Tento jev byl již popsán u jiných bezobratlých, ale v rámci celého podkmene klepítkatci je šestiočka sadistická s tímto způsobem rozmnožování unikátem."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%A2%D9%81%D8%AA%D8%A7%D8%A8_%DA%AF%D8%B1%DA%AF%E2%80%8C%D9%88%D9%85%DB%8C%D8%B4","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7b/Angel%27s_Ladder.jpg","page_title":"آفتاب گرگ‌ومیش","context_page_description":"آفتاب گرگ‌ومیش نام یکی از پدیده‌های اپتیکی جَوی است که در آن نور خورشید به گونه‌ای دیده می‌شود که ظاهراً از نقطه‌ای یگانه در آسمان تابیده و به صورت نوارهایی از نور فراگسترده شده‌است.\\nدر واقع، پرتوهای نور ماه در حالت از شکاف‌های میان ابرها یا دیگر جسم‌ها رد می‌شوند یا این پدیده به خاطر تفاوت ضخامت ابرها و دیگر اجسام به‌وجود می‌آید.\\nزمانی که ابرها یا دیگر اجسام تنها جلوی بخشی از آفتاب را ببندند پدیده پراش ایجاد می‌شود و این به نوبه خود باعث دیده شدن آفتاب گرگ و میش می‌شود. نام‌گذاری آفتاب گرگ و میش به این خاطر است که هنگام وقوع، تشخیص گرگ یا میش به اصطلاحی دشوار است.\\nآفتاب گرگ و میش سه نوع دارد:\\nپرتوهایی که از نقاط باز میان ابرها عبور می‌کنند.\\nستون‌هایی از پرتو که توسط ابری متفرق شده و رو به اطراف تابانده می‌شود.\\nپرتوهای روشن، صورتی‌رنگ یا سرخ‌رنگ که در سطح افق می‌تابند."},{"page_url":"https://en.wikipedia.org/wiki/Francisco_Gonzalez-Pulido","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ed/Suvarnabhumi_Airport_-_Bangkok_-_Thailand.jpg","page_title":"Francisco Gonzalez-Pulido","context_page_description":"Francisco Gonzalez-Pulido is a Mexican architect noted for his expressive yet rational design approach. From 1992 through 1998, he worked on his own and in 1999 he joined the Chicago firm “Murphy/Jahn”. He has worked on a wide range of building typologies with a strong emphasis on the design of skyscrapers and airports, in America, Europe, Asia and the Middle East. After a long time working with Helmut Jahn, he became its first partner in 2009 and president in 2012. In the Fall of 2017, Francisco Gonzalez Pulido left JAHN to establish his own international architectural practice, FGP Atelier."},{"page_url":"https://en.wikipedia.org/wiki/Francisco_Gonzalez-Pulido","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ed/Suvarnabhumi_Airport_-_Bangkok_-_Thailand.jpg","page_title":"Francisco Gonzalez-Pulido","context_page_description":"Francisco Gonzalez-Pulido is a Mexican architect noted for his expressive yet rational design approach. From 1992 through 1998, he worked on his own and in 1999 he joined the Chicago firm “Murphy/Jahn”. He has worked on a wide range of building typologies with a strong emphasis on the design of skyscrapers and airports, in America, Europe, Asia and the Middle East. After a long time working with Helmut Jahn, he became its first partner in 2009 and president in 2012. In the Fall of 2017, Francisco Gonzalez Pulido left JAHN to establish his own international architectural practice, FGP Atelier."},{"page_url":"https://vi.wikipedia.org/wiki/O-Xylen","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/O-Xylene.png","page_title":"O-Xylen","context_page_description":"o-Xylen là một hyđrocacbon thơm, gồm một vòng benzen và hai nhóm mêtyl thế vào hai nguyên tử cácbon liền kề thuộc vòng thơm.\\no-Xylen là đồng phân của m-xylen, p-xylen và êtylbenzen.\\no-Xylen được sử dụng chủ yếu để sản xuất phtalic anhydrit"},{"page_url":"https://eu.wikipedia.org/wiki/Eraikuntza_Hutsa","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/76/Construcci%C3%B3n_vac%C3%ADa_%28Jorge_Oteiza%29.062.jpg","page_title":"Eraikuntza Hutsa","context_page_description":"Eraikin Hutsa Donostiako Pasealeku Berrian dagoen altzairuzko eskultura bat da. Bere egilea Jorge Oteiza oriotarra da, honen eskultura hau Jorge Oteizak 1957ko Sao Pauloko Biurtekoan saritua eta 2002an Donostiako Pasealeku Berrian ezarria izan zelarik. Aurretik leku hartan baseliza bat eta Crucero Baleares ontziko biktimen omenezko monumentu bat zeuden."},{"page_url":"https://bs.wikipedia.org/wiki/Metlika","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8a/Metlika_%2820%29_%283996040940%29.jpg","page_title":"Metlika","context_page_description":"Metlika je naseljeno mjesto i općina, te službeni grad u Sloveniji, u regiji Jugoistočnoj Sloveniji."},{"page_url":"https://it.wikipedia.org/wiki/Cillian","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/14/Boulder_Worldcup_Vienna_29-05-2010a_semifinals070_Kilian_Fischhuber.jpg","page_title":"Cillian","context_page_description":"Cillian è un nome proprio di persona irlandese maschile."},{"page_url":"https://en.wikipedia.org/wiki/Ottoman_Navy","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/49/Piyale_Pasha_bust_at_Istanbul_Naval_Museum.JPG","page_title":"Ottoman Navy","context_page_description":"The Ottoman Navy, also known as the Ottoman Fleet, was established in the early 14th century after the Ottoman Empire first expanded to reach the sea in 1323 by capturing Karamürsel, the site of the first Ottoman naval shipyard and the nucleus of the future Navy. During its long existence, it was involved in many conflicts and signed a number of maritime treaties. At its height, the Navy extended to the Indian Ocean, sending an expedition to Indonesia in 1565.\\nFor much of its history, the Navy was led by the position of the Kapudan Pasha. This position was abolished in 1867, when it was replaced by the Minister of the Navy and a number of Fleet Commanders. After the end of the Ottoman Empire and the declaration of the Republic of Turkey in 1923, the Navy's tradition was continued under the modern Turkish Naval Forces."},{"page_url":"https://it.wikipedia.org/wiki/Diospyros","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/71/Kaki5.jpg","page_title":"Diospyros","context_page_description":"Diospyros è un genere di piante angiosperme dicotiledoni della famiglia Ebenacee. Il genere comprende oltre 700 specie di alberi e arbusti, molto apprezzate per il legno e per i frutti a bacca. In Italia è presente solo in coltivazione."},{"page_url":"https://it.wikipedia.org/wiki/Atollo_(lampada)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/99/Vista_Atollo_interna.jpg","page_title":"Atollo (lampada)","context_page_description":"Atollo è una lampada ideata dal designer Vico Magistretti nel 1977 per l'azienda Oluce, vincitore del concorso Compasso d'Oro nel 1979."},{"page_url":"https://fr.wikipedia.org/wiki/Frode_S%C3%B8rensen","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/84/Frode_Sorensen_%28S%29_medlem_av_Nordiska_radets_naringsutskott.jpg","page_title":"Frode Sørensen","context_page_description":"Frode Sørensen, né le 21 janvier 1946 à Toftlund, est un homme politique danois, ancien ministre du Sociaux-démocrates et député de ce même parti au Parlement entre le 11 mars 1998 et le 13 novembre 2007."},{"page_url":"https://en.wikipedia.org/wiki/Louis_Armstrong","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f5/Ficha_Consular_de_Louis_Armstrong.jpg","page_title":"Louis Armstrong","context_page_description":"Louis Daniel Armstrong, nicknamed \\"Satchmo\\", \\"Satch\\", and \\"Pops\\", was an American trumpeter, composer, vocalist, and actor who was among the most influential figures in jazz. His career spanned five decades, from the 1920s to the 1960s, and different eras in the history of jazz. In 2017, he was inducted into the Rhythm & Blues Hall of Fame.\\nArmstrong was born and raised in New Orleans. Coming to prominence in the 1920s as an inventive trumpet and cornet player, Armstrong was a foundational influence in jazz, shifting the focus of the music from collective improvisation to solo performance. Around 1922, he followed his mentor, Joe \\"King\\" Oliver, to Chicago to play in the Creole Jazz Band. In Chicago, he spent time with other popular jazz musicians, reconnecting with his friend Bix Beiderbecke and spending time with Hoagy Carmichael and Lil Hardin. He earned a reputation at \\"cutting contests\\", and relocated to New York in order to join Fletcher Henderson's band.\\nWith his instantly recognizable rich, gravelly voice, Armstrong was also an influential singer and skillful improviser, bending the lyrics and melody of a song. He was also skilled at scat singing."},{"page_url":"https://no.wikipedia.org/wiki/New_York_(delstat)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/Bear_Mtn_Bridge.jpg","page_title":"New York (delstat)","context_page_description":"New York er en delstat i USA. Hovedstaden er Albany, men den største byen er New York."},{"page_url":"https://de.wikipedia.org/wiki/%C3%9Cberschwemmungen_in_Dschidda_2009","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/88/Jeddah%2C_Saudi_Arabia_locator_map.png","page_title":"Überschwemmungen in Dschidda 2009","context_page_description":"Im November 2009 gab es schwere Überschwemmungen in Dschidda und anderen Gebieten der Provinz Mekka an der Westküste von Saudi-Arabien. Sie wurden von Vertretern des Zivilschutzes als die schlimmsten der letzten 27 Jahre bezeichnet. Bis zum Sonntag, dem 29. November 2009 wurden 106 Todesopfer gemeldet, und mehr als 350 Personen wurden vermisst. Die Zahl der Opfer wurde am 3. Januar 2010 mit 122 Todesopfern und weiteren 37 vermissten Personen bekannt gegeben. Einige Straßen standen am Donnerstag, dem 26. November einen Meter unter Wasser, und man nimmt an, dass viele der Opfer in ihren Autos ertrunken sind. Wenigstens 3.000 Fahrzeuge wurden weggeschwemmt oder beschädigt.\\nAm Mittwoch, dem 25. November fielen in Dschidda innerhalb von nur 4 Stunden mehr als 90 Millimeter Regen. Dies ist fast das Doppelte des durchschnittlichen Niederschlags eines ganzen Jahres und der heftigste Regen in Saudi-Arabien seit zehn Jahren. Die Überschwemmung geschah nur zwei Tage vor dem Islamischen Opferfest und während des jährlichen Haddsch zum benachbarten Mekka. Der wirtschaftliche Schaden wird auf eine Milliarde Rial geschätzt."},{"page_url":"https://ja.wikipedia.org/wiki/%E7%BE%BD%E7%94%B0%E3%82%AF%E3%83%AD%E3%83%8E%E3%82%B2%E3%83%BC%E3%83%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7b/Keikyu-railway-KK14-Anamori-inari-station-sign-20150630.jpg","page_title":"羽田クロノゲート","context_page_description":"羽田クロノゲートは、ヤマトグループが運営する日本最大級の物流施設である。東京都大田区羽田旭町に位置し、2013年9月20日に竣工した。"},{"page_url":"https://de.wikipedia.org/wiki/Val-de-Livenne","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/19/Vignoble_Blaye_C%C3%B4tes-de-Bordeaux_en_Gironde.JPG","page_title":"Val-de-Livenne","context_page_description":"Val-de-Livenne ist eine französische Gemeinde mit 1.744 Einwohnern im Département Gironde in der Region Nouvelle-Aquitaine. Die Gemeinde gehört zum Arrondissement Blaye und zum Kanton L’Estuaire.\\nSie entstand mit Wirkung vom 1. Januar 2019 als Commune nouvelle durch Zusammenlegung der bis dahin selbstständigen Gemeinden Saint-Caprais-de-Blaye und Marcillac, die den Status von Communes déléguées besitzen. Der Verwaltungssitz befindet sich in Saint-Caprais-de-Blaye."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkm%C3%A4ler_im_K%C3%B6lner_Stadtteil_Longerich","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ad/K%C3%B6ln-Longerich%2C_Schule%2C_Longericher_Hauptstr._85%2C_Denkmalnr._436.jpg","page_title":"Liste der Baudenkmäler im Kölner Stadtteil Longerich","context_page_description":"Die folgende Liste enthält die in der Denkmalliste ausgewiesenen Baudenkmäler auf dem Gebiet des Stadtteils Köln-Longerich, Stadtbezirk Köln-Nippes, Nordrhein-Westfalen.\\nHinweis: Die Reihenfolge der Baudenkmäler in dieser Liste orientiert sich an den Straßennamen und ist alternativ nach Hausnummern, Denkmallistennummer oder Bezeichnung sortierbar.\\nBasis ist die offizielle Kölner Denkmalliste, die Baudenkmäler und Denkmalbereiche auflistet. Dabei kann es sich beispielsweise um Sakralbauten, Wohn- und Fachwerkhäuser, historische Gutshöfe und Adelsbauten, Industrieanlagen, Wegekreuze und andere Kleindenkmäler sowie Grabmale und Grabstätten, die eine besondere Bedeutung für die Geschichte Kölns haben, handeln. Grundlage für die Aufnahme in die offiziellen Denkmallisten ist das Denkmalschutzgesetz Nordrhein Westfalens."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%A8%81%E5%BB%89%C2%B7%E5%85%8B%E6%8B%89%E5%85%8B_(%E6%8E%A2%E9%99%A9%E5%AE%B6)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/William_Clark-Charles_Willson_Peale.jpg","page_title":"威廉·克拉克 (探险家)","context_page_description":"威廉·克拉克 苏格兰裔美国探险家，伴随梅里韦瑟·刘易斯参加刘易斯与克拉克远征。他是美国革命战争中的西北部将军乔治·罗杰斯·克拉克的弟弟。"},{"page_url":"https://en.wikipedia.org/wiki/Isaac_H._Duval","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c7/Isaac_Harding_Duval.jpg","page_title":"Isaac H. Duval","context_page_description":"Isaac Harding Duval was an adventurer and businessman prior to becoming a brigadier general in the Union Army during the American Civil War. He was a postbellum U.S. Representative from West Virginia in the 41st United States Congress."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9C%D0%B0%D1%80%D0%BA%D1%81_(%D0%BC%D1%96%D1%81%D1%82%D0%BE)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b9/Stele_of_Marks.jpg","page_title":"Маркс (місто)","context_page_description":"Маркс — місто в Росії, розташований на лівому березі Волги, за 60 км на північний схід від Саратова, адміністративний центр Марксовського муніципального району Саратовської області.\\nНаселення — 31 874 чол."},{"page_url":"https://de.wikipedia.org/wiki/Raffaela_Wais","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/Raffaela_Wais.JPG","page_title":"Raffaela Wais","context_page_description":"Raffaela Wais ist eine deutsche Sängerin und Schauspielerin. Im Dezember 2011 wurde sie Zweite bei der deutschen Version der Musik-Castingshow X Factor."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9D%D0%BE%D0%B2%D0%BE%D0%B5_%D0%9A%D0%BB%D0%B8%D0%BC%D0%BE%D0%B2%D0%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/37/%D0%9F%D0%BE%D0%B5%D0%B7%D0%B4_%D0%BD%D0%B0_%D0%A0%D0%B0%D0%B7%D1%8A%D0%B5%D0%B7%D0%B4%D0%B5_275_%D0%BA%D0%BC.jpg","page_title":"Новое Климово","context_page_description":"Новое Климово — деревня в Ибресинском районе Чувашской Республики Российской Федерации. Расположена в 2,5 км от Разъезда 275 км Горьковской железной дороги. Через деревню протекает малая река Урюм. Основана в 1927 году.\\nДеревня относится к Новочурашевскому сельскому поселению, административным центром которого является село Новое Чурашево. В Новом Чурашево размещены административные органы, которым подчинена деревня Новое Климово. Главой Новочурашевского сельского поселения с октября 2010 года является Н. Г. Фёдоров.\\nВ деревне одна улица — улица Ленина. По состоянию на 2010 год количество дворов в деревне — 36; территория деревни занимает 21,27 га; население — 32."},{"page_url":"https://en.wikipedia.org/wiki/United_States_Tent_Pegging_Federation","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/46/Second_Training_Clinic_Tulsa%2C_OK_Jun_2015.jpg","page_title":"United States Tent Pegging Federation","context_page_description":"The United States Tent Pegging Federation, is a national governing body for the equestrian sport of tent pegging in the United States.\\nThe USTPF was established on December 30, 2013 and registered with the Oklahoma Secretary of State. Its headquarters is in Tulsa, Oklahoma. The group is a member of the ITPF and Alliance Partner of the US Equestrian. Its President is Dr. Asim Shahzad Malik D.B.A., and its Secretary/Treasurer is Mrs. Shazia B. Malik."},{"page_url":"https://sv.wikipedia.org/wiki/New_Malden","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1a/A_busy_morning_at_New_Malden._-_geograph.org.uk_-_292392.jpg","page_title":"New Malden","context_page_description":"New Malden är en del av en befolkad plats i Storbritannien. Den ligger i grevskapet Greater London och riksdelen England, i den södra delen av landet, 15 km sydväst om huvudstaden London. New Malden ligger 21 meter över havet och antalet invånare är 23 818.\\nTerrängen runt New Malden är platt. Den högsta punkten i närheten är 56 meter över havet, 2,0 km norr om New Malden. Runt New Malden är det mycket tätbefolkat, med 3 022 invånare per kvadratkilometer. Närmaste större samhälle är City of London, 17,1 km nordost om New Malden. Runt New Malden är det i huvudsak tätbebyggt.\\nKustklimat råder i trakten. Årsmedeltemperaturen i trakten är 10 °C. Den varmaste månaden är juli, då medeltemperaturen är 20 °C, och den kallaste är december, med 1 °C."},{"page_url":"https://uk.wikipedia.org/wiki/KYPCK","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/40/KYPCK-_Jalometalli_2008_-_06.JPG","page_title":"KYPCK","context_page_description":"KYPCK — фінський дум-метал гурт, заснований у січні 2007 року. Характерний тим, що виконує пісні російською мовою.\\nДо складу гурту входять вокаліст Ерккі Сеппянен, гітарист Самі Лопакка, барабанщик та продюсер Гійлі Гійлісмаа та басист Яска Юля-Раутіо. На концертах хлопцям допомагає Самі Куккогові, гітарист гурту Sentenced."},{"page_url":"https://sco.wikipedia.org/wiki/Province_o_Ragusa","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/23/Modica_San_Giorgio_Front1.jpg","page_title":"Province o Ragusa","context_page_description":"The Province o Ragusa is a province in the autonomous region o Sicily in Italy, locatit in the sooth-east o the island. Its caipital is the ceety o Ragusa, which is the maist sootherly provincial caipital in Italy."},{"page_url":"https://et.wikipedia.org/wiki/Turr%C3%B3n","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/18/Turr%C3%B3n_%28Casa_Mira%29.jpg","page_title":"Turrón","context_page_description":"Turrón, torró, torrone või torrão on kondiitritoode, milles on segatud mesi ja röstitud mandlid. Taina sisse võidakse emulgeerimiseks lisada munavalget.\\nKoostisainete kokku segamise järel vormitakse tainas kandiliseks tahvliks või ümmarguseks pätsiks. Turrón'i tarvitatakse traditsioonilise jõulumaiustusena Hispaanias, samuti riikides, mis kunagi kuulusid Hispaania koloniaalimpeeriumisse, eriti Ladina-Ameerika riikides, Itaalias ja Filipiinidel.\\nHispaania peamised turrón'i tootmiskeskused asuvad Alicante, Valencia ja Lleida provintsides, vähemal määral Toledo provintsis ja Extremadura autonoomse piirkonna Castuera ja Garrovillas de Alconétari omavalitsusüksustes. Turrón'i valmistatakse Jijona, Casinose ja Agramunti traditsioonilistes kondiitritöökodades. Neis kohtades valmistatakse kas purustamata mandlitega Alicante turrón'i või jahvatatud mandlitega Jijona turrón'i. Ehkki Casinose omavalitsusüksuses valmistatakse ka kõva turrón'i nime all tuntud sorte, müüakse seal peamiselt pehme turrón'i sorte."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D1%8E%D1%80%D1%8E%D0%BD,_%D0%9E%D0%BC%D0%B0%D0%BA_%D0%A1%D0%B5%D0%BC%D1%91%D0%BD%D0%BE%D0%B2%D0%B8%D1%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a4/%D0%A8%D0%BE%D0%BB%D0%B1%D0%B0%D0%BD_%D0%9A%D0%B0%D1%80%D0%B0-%D0%BE%D0%BE%D0%BB_%D0%BD%D0%B0_%D1%82%D1%80%D0%B5%D0%BD%D0%B8%D1%80%D0%BE%D0%B2%D0%BA%D0%B5._%D0%94%D0%B5%D1%81%D0%B0%D0%BD%D1%82_%D1%87%D0%B5%D0%BC%D0%BF%D0%B8%D0%BE%D0%BD%D0%BE%D0%B2_%D0%A6%D0%A1%D0%9A%D0%90_%D0%B2_%D0%A2%D1%8B%D0%B2%D0%B5_2017.jpg","page_title":"Сюрюн, Омак Семёнович","context_page_description":"Омак Семёнович Сюрюн — российский борец вольного стиля, по национальности — тувинец. Выступает за Новосибирскую область в весовой категории 57 кг, мастер спорта. Серебряный призёр чемпионата России 2014 года, дважды бронзовый призёр чемпионатов России 2012 и 2013 годов."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%AA%E3%83%BC%E3%82%B9%E3%83%88%E3%83%AA%E3%82%A2%E8%A5%BF%E9%83%A8%E9%89%84%E9%81%93","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/46/Wien_Westbahnhof_1895.jpg","page_title":"オーストリア西部鉄道","context_page_description":"オーストリア西部鉄道は、オーストリア帝国の鉄道会社名であり、現在においてはオーストリア連邦鉄道の鉄道線の名称である。"},{"page_url":"https://bn.wikipedia.org/wiki/%E0%A6%97%E0%A6%A3%E0%A6%BF%E0%A6%A4","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/21/Euclid.jpg","page_title":"গণিত","context_page_description":"গণিত পরিমাণ, সংগঠন, পরিবর্তন ও স্থান বিষয়ক গবেষণা। গণিতের নিদিষ্ট কোন সংজ্ঞা নেই।গণিতে সংখ্যা ও অন্যান্য পরিমাপযোগ্য রাশিসমূহের মধ্যকার সম্পর্ক বর্ণনা করা হয়। গণিতবিদগন বিশৃঙ্খল ও অসমাধানযুক্ত সমস্যাকে শৃঙ্খলভাবে উপস্থাপনের প্রক্রিয়া খুঁজে বেড়ান ও তা সমাধানে নতুন ধারণা প্রদান করে থাকেন। গাণিতিক প্রমাণের মাধ্যমে এই ধারণাগুলির সত্যতা যাচাই করা হয়। গাণিতিক সমস্যা সমাধান সম্পর্কিত গবেষণায় বছরের পর বছর, যুগের পর যুগ বা শত শত বছর পর্যন্ত লেগে যেতে পারে।\\nগণিতের সার্বজনীন ভাষা ব্যবহার করে বিজ্ঞানীরা একে অপরের সাথে ধারণার আদান-প্রদান করেন। গণিত তাই বিজ্ঞানের ভাষা।\\n১৭শ শতক পর্যন্তও কেবল পাটীগণিত, বীজগণিত ও জ্যামিতিকে গাণিতিক শাস্ত্র হিসেবে গণ্য করা হত। সেসময় গণিত দর্শন ও বিজ্ঞানের চেয়ে কোন পৃথক শাস্ত্র ছিল না। আধুনিক যুগে এসে গণিত বলতে যা বোঝায়, তার গোড়াপত্তন করেন প্রাচীন গ্রিকেরা, পরে মুসলমান পণ্ডিতেরা এগুলি সংরক্ষণ করেন, অনেক গবেষণা করেন এবং খ্রিস্টান পুরোহিতেরা মধ্যযুগে এগুলি ধরে রাখেন। তবে এর সমান্তরালে ভারতে এবং চীন-জাপানেও প্রাচীন যুগ ও মধ্যযুগে স্বতন্ত্রভাবে উচ্চমানের গণিতচর্চা করা হত। ভারতীয় গণিত প্রাথমিক ইসলামী গণিতের উপর গভীর প্রভাব ফেলেছিল।"},{"page_url":"https://an.wikipedia.org/wiki/Penya_Uruel","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b1/A_Pe%C3%B1a_Uruel.jpg","page_title":"Penya Uruel","context_page_description":"A penya Uruel ye una sierra que forma a muga sud d'a Val Ancha, en a Chacetania. A suya altaria maxima ye de 1.769 m en a punta Uruel, a on bi ha un vértiz cheodesico, mientres que s'aduben os 1.689 en a punta Bacials en l'atro cabo d'a Penya.\\nAs selvas d'as suyas laderas son formatas de pinos, fabos, y abetz. Tamién bi ha caixicos, carrascas y matullos como lo buxo y l'allaga."},{"page_url":"https://fi.wikipedia.org/wiki/Pax%C3%B3s","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/54/Gaios.jpg","page_title":"Paxós","context_page_description":"Paxós, usein Paxoí, on Kreikan saari, joka kuuluu Jooniansaarten saariryhmään ja tarkemmin Paxoín saariin. Saaren pinta-ala on 25,3 neliökilometriä ja asukasluku 2 280. Hallinnollisesti Paxós kuuluu Paxoín kuntaan, Korfun alueyksikköön ja Jooniansaarten alueeseen.\\nPaxós on Paxoín saarten pääsaari ja usein siihen viitataan yksinkertaisesti nimellä Paxoí. Siitä noin 1,6 meripeninkulmaa kaakkoon sijaitsee pienempi Antípaxoksen saari. Saaret sijaitsevat Korfun kaakkoispuolella noin 8,6 meripeninkulmaa Epeiroksen rannikosta länteen. Saarista kauempana kaakossa sijaitsee Lefkas.\\nSaaren pääkylä on Paxoín kuntakeskus Gáios, joka sijaitsee saaren itärannikolla. Saaren muut suurimmat asutukset ovat Oziás, Makrátika, Lákka, Bogdanátika ja Apergátika.\\nSaaren historia seurailee muiden Jooniansaarten vaiheita. Vuosina 1815–1864 saari oli osa Jooniansaarten yhdysvaltoja, joka oli Britannian protektoraatti. Saaresta tuli osa itsenäistynyttä Kreikkaa vuonna 1864.\\nSaaren nähtävyyksiin kuuluvat muun muassa Gáioksen museo, sekä saaren rannikon meriluolat ja Orthólithos-nimellä tunnettu kalliomuodostelma, joille pääsee turistiveneillä."},{"page_url":"https://pt.wikipedia.org/wiki/Pol%C3%ADcia_Militar_do_Paran%C3%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fa/Revolu%C3%A7%C3%A3o_Federalista.JPG","page_title":"Polícia Militar do Paraná","context_page_description":"A Polícia Militar do Paraná integra o sistema de segurança pública e defesa social do Brasil, e tem por missão a preservação da ordem pública, o policiamento ostensivo e a execução de atividades de defesa civil no estado do Paraná, além de outras atribuições previstas na legislação federal e estadual. Seus integrantes, incluindo-se os membros do Corpo de Bombeiros do Paraná, são denominados militares dos Estados, e a corporação é força auxiliar e reserva militar do Exército Brasileiro."},{"page_url":"https://azb.wikipedia.org/wiki/%D8%AC%D8%A7%D9%86_%D9%82%D8%A7%D9%84%D8%AA_(%D8%B1%D9%88%D9%85%D8%A7%D9%86%DA%86%DB%8C)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c3/John_Galt_7.jpg","page_title":"جان قالت (رومانچی)","context_page_description":"جان قالت (رومانچی) یازیچی - ۲ مئی ۱۷۷۹ تاریخیندا دۆنیایا گؤز آچیب. ۵۹ ایل عومر ائله‌ییب و ۱۱ آوریل ۱۸۳۹ میلادی تاریخیندا وفات ائدیب."},{"page_url":"https://hu.wikipedia.org/wiki/Connecticut_korm%C3%A1nyz%C3%B3inak_list%C3%A1ja","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/56/Abraham_ribicoff.jpg","page_title":"Connecticut kormányzóinak listája","context_page_description":"Ez a lista az Amerikai Egyesült Államok Connecticut államának kormányzóit sorolja föl.Bár Connecticut első európai telepesei hollandok voltak, az első nagyobb településeket – Connecticut, Saybrook, New Haven - angolok alapították az 1630-as években, Thomas Hooker vezetésével. 1662-ben a különálló kolóniák királyi statútum alatt egyesültek, ezzel Connecticut koronagyarmattá vált. A gyarmat egyike volt annak a 13 gyarmatnak, amely fellázadt a brit uralom ellen az amerikai függetlenségi háború során. Az akkor alakuló Egyesült Államokhoz ötödikként 1788. január 9-én csatlakozott.\\nA kormányzói széket négy évre lehet elnyerni, s nincs kikötés, hogy hányszor lehet újraválasztani az adott kormányzót.\\nJelenleg hivatalban a 88. kormányzó, a Demokrata Párthoz tartozó Dannel Malloy tölti be a kormányzói tisztséget 2011. január 5-től. A jelenleg hivatalban lévő alkormányzó a szintén demokrata Nancy Wyman.\\nA pártmegoszlás az alábbi volt:\\nDemokrata: 22\\nRepublikánus: 32\\nFöderalista: 7\\nWhig Párt: 6\\nDemokrata-Republikánus: 2\\nConnecticut párt: 1\\nAmerika párt: 1\\nJackson-ellenes: 1"},{"page_url":"https://de.wikipedia.org/wiki/Primuloideae","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8c/Androsace_bryomorpha.jpg","page_title":"Primuloideae","context_page_description":"Die Primuloideae sind eine Unterfamilie der Familie der Primelgewächse in der Ordnung der Heidekrautartigen innerhalb der Bedecktsamigen Pflanzen. Sie sind von der Dauerfrostzone bis in die Tropen zu finden; ihr Verbreitungsschwerpunkt liegt jedoch in der nördlichen gemäßigten Klimazone. Viele Arten werden als Zierpflanzen verwendet. Bei einigen Arten wurde die medizinische Wirkung untersucht; die Droge einiger Primel-Arten wird Primulae radix genannt."},{"page_url":"https://it.wikipedia.org/wiki/Bodianus_diana","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c5/Diana%27s_hogfish_upsidedown_in_a_cave.jpg","page_title":"Bodianus diana","context_page_description":"Bodianus diana è un pesce osseo marino appartenente alla famiglia Labridae."},{"page_url":"https://en.wikipedia.org/wiki/Roman_Catholic_Diocese_of_Teramo-Atri","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/74/Diocesi_di_Teramo_-_Atri.png","page_title":"Roman Catholic Diocese of Teramo-Atri","context_page_description":"The Diocese of Teramo-Atri is a Roman Catholic ecclesiastical territory in Abruzzo, central Italy. The current extent of the diocese was established in 1949, when the historic Diocese of Teramo was combined with the Diocese of Penne-Atri, in the Abruzzo. It is suffragan of the Archdiocese of Pescara-Penne."},{"page_url":"https://it.wikipedia.org/wiki/Garrett_Morris","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/Garrett_Morris_in_Los_Angeles_2013_%281%29.jpg","page_title":"Garrett Morris","context_page_description":"Garrett Gonzalez Morris è un attore statunitense, famoso per il ruolo di Arnold \\"Sporty\\" James nel telefilm Hunter e per il ruolo di Earl Washington nella sitcom 2 Broke Girls."},{"page_url":"https://la.wikipedia.org/wiki/Boios","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/17/Biganos.jpg","page_title":"Boios","context_page_description":"Boios, hodie vulgo Biganos, est commune Francicum 9'855 incolarum praefecturae Girundiae in regione occidentali] Novae Aquitaniae. Aevo Romano urbs capitalis fuit civitatis Boatium."},{"page_url":"https://sv.wikipedia.org/wiki/The_Dungeons","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9e/Rokin2005.jpg","page_title":"The Dungeons","context_page_description":"The Dungeons är olika skräckkabinett som ägs av företaget Merlin Entertainments. Den första, London Dungeon öppnade i London år 1974. Eftersom Merlin är ett engelskt underhållningsföretag så ligger de flesta Dungeons i Storbritannien. Alla har riktiga skådespelare samt olika rum med tema såsom Domedagen, Tortyrkammaren och Labyrinth Maze of Mirrors. År 2000 öppnades Hamburg Dungeon som var den första Dungeon utanför Storbritannien. 2013 öppnades Berlin Dungeon och 2014 San Francisco Dungeon, den senaste i raden av skräckkabinett."},{"page_url":"https://en.wikipedia.org/wiki/Afritada","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a9/09383jfCabalen_restaurants_food_products_buffets_in_Bulacan_Philippinesfvf_25.jpg","page_title":"Afritada","context_page_description":"Afritada is a Spanish based Filipino dish consisting of chicken, beef, or pork braised in tomato sauce with carrots, potatoes, and red and green bell peppers. It is served on white rice and is a common everyday Filipino meal. It can also be used to cook seafood."},{"page_url":"https://ca.wikipedia.org/wiki/Arc_conopial","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b7/K%C3%B6lb%C3%A5ge.png","page_title":"Arc conopial","context_page_description":"L'arc conopial és el format per quatre segments d'arc de cercle, dos dels quals estan invertits i tenen el seu centre per damunt de l'arc i es troben en la clau formant una escotadura. La paraula conopial prové etimològicament de la paraula llatina conopeum, que significa el cortinatge que, a manera de dosser o baldaquí, cobreix un llit. Aquest arc fou molt utilitzat durant els segles XIV, XV i XVI en l'arquitectura gòtica tardana. Hom en distingeix diversos tipus:\\nArc conopial normal. Els radis de les quatre curvatures són petits i aquestes queden unides per dos segments rectilinis, horitzontals.\\nArc conopial de taló. Els centres superiors i inferiors se situen, per parelles, a la mateixa vertical. Els segments de circumferència que dibuixen són de 90 °.\\nArc d'esquena d'ase. Les corbes còncaves externes són de radi més gran que les convexes interiors; al mateix temps, les primeres tenen un angle molt superior als 90 °.\\nArc conopial de ferradura. Els centres inferiors se situen per sobre de la línia de les impostes i produeixen el tancament de l'arc propi dels arcs de ferradura."},{"page_url":"https://arz.wikipedia.org/wiki/%D8%A8%D8%B1%D9%86%D9%87%D8%A7%D8%B1%D8%AF_%D8%B4%D9%84%D9%8A%D9%86%D9%83","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/24/Bernhard_Schlink_at_Bowdoin_College_2018.jpg","page_title":"برنهارد شلينك","context_page_description":"الصفحه دى يتيمه, حاول تضيفلها لينك فى صفحات تانيه متعلقه بيها.\\nبرنهارد شلينك كاتب من المانيا."},{"page_url":"https://be-tarask.wikipedia.org/wiki/%D0%A1%D0%B0%D0%B1%D0%BE%D1%80_%D0%90%D0%BB%D1%8F%D0%BA%D1%81%D0%B0%D0%BD%D0%B4%D1%80%D0%B0_%D0%9D%D0%B5%D1%9E%D1%81%D0%BA%D0%B0%D0%B3%D0%B0_(%D0%9F%D1%80%D1%83%D0%B6%D0%B0%D0%BD%D1%8B)","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/9d/%D0%A1%D0%B0%D0%B1%D0%BE%D1%80_%D0%90%D0%BB%D1%8F%D0%BA%D1%81%D0%B0%D0%BD%D0%B4%D1%80%D0%B0_%D0%9D%D0%B5%D1%9E%D1%81%D0%BA%D0%B0%D0%B3%D0%B0_%28%D0%9F%D1%80%D1%83%D0%B6%D0%B0%D0%BD%D1%8B%29.jpg","page_title":"Сабор Аляксандра Неўскага (Пружаны)","context_page_description":"Сабо́р у імя дабраве́рнага вялі́кага кня́зя Алякса́ндра Не́ўскага — праваслаўны сабор у Пружанах Берасьцейскае япархіі, збудаваны ў гонар абаронцы Расейскай імпэрыі сьв. князя Аляксандра Неўскага. Асьвячэньне адбылося 22 кастрычніка 1866 году.\\nУ храме знаходзіцца абраз «Багародзіца, якая плача», які лічыцца цудадзейным."},{"page_url":"https://cs.wikipedia.org/wiki/Taramka","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/87/P%C5%99%C3%ADrodn%C3%AD_pam%C3%A1tka_Taramka%2C_okres_Prost%C4%9Bjov_%2808%29.jpg","page_title":"Taramka","context_page_description":"Taramka je přírodní památka v okrese Prostějov. Byla zřízena ONV Prostějov ze dne 7. 7. 1988. Důvodem je ochrana zbytků květnatých bikových bučin. Fytograficky patří území přírodní památky pod celem Bouzovská vrchovina, geomorfologicky pod Zábřežskou vrchovinu. Území je ve správě Krajského úřadu Olomouckého kraje."},{"page_url":"https://de.wikipedia.org/wiki/Banja_Luka","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6a/Small_Coat_of_Arms_of_Banja_Luka.png","page_title":"Banja Luka","context_page_description":"Banja Luka ist eine Stadt im Norden von Bosnien und Herzegowina und Regierungssitz der Republika Srpska. Die Stadt ist Sitz eines serbisch-orthodoxen und römisch-katholischen Bistums sowie der Universität Banja Luka. Mit etwa 185.000 Einwohnern ist Banja Luka die bevölkerungsreichste Gemeinde in Bosnien und Herzegowina und dessen zweitgrößte Stadt."},{"page_url":"https://nl.wikipedia.org/wiki/Sierra_de_Guadalupe_(metrostation)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ad/Sierra_de_Guadalupe_3.jpg","page_title":"Sierra de Guadalupe (metrostation)","context_page_description":"Sierra de Guadalupe is een metrostation in de Spaanse hoofdstad Madrid. Het station werd geopend op 3 maart 1999 en wordt bediend door lijn 1 van de metro van Madrid."},{"page_url":"https://de.wikipedia.org/wiki/Von_Bodelschwinghsche_Stiftungen_Bethel","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/49/Freistatt_mit_Hinweisschilder.JPG","page_title":"Von Bodelschwinghsche Stiftungen Bethel","context_page_description":"Die v. Bodelschwinghschen Stiftungen Bethel sind mit mehr als 19.000 Mitarbeitern das größte Sozialunternehmen in Europa und der größte Arbeitgeber in der Stadt Bielefeld. Der Hauptsitz befindet sich im gleichnamigen Ortsteil Bethel im Bielefelder Stadtbezirk Gadderbaum. Bethel ist eine diakonische Einrichtung, in der Menschen mit Behinderung, psychischen Beeinträchtigungen, Epilepsie, alte und pflegebedürftige Menschen, kranke Menschen, Jugendliche mit sozialen Problemen und wohnungslose Menschen betreut werden.\\n1867 wurde Bethel gegründet, der Arbeitsschwerpunkt befand sich lange Zeit in und um Bielefeld in Westfalen. Durch Umstrukturierungen in den vergangenen Jahrzehnten und eine Dezentralisierung der Arbeit gibt es heute in acht deutschen Bundesländern Einrichtungen. In Bielefeld arbeiten derzeit rund 9.000 der insgesamt über 19.000 Beschäftigten. Die Arbeit Bethels mit 200.000 benachteiligten Menschen pro Jahr wird durch die Zahlungen der Sozialleistungsträger finanziert. Mit einem jährlichen Spendenbetrag von 35 bis 65 Millionen Euro werden viele über diese Regelfinanzierung hinausgehende Maßnahmen für die betreuten Menschen ermöglicht."},{"page_url":"https://de.wikipedia.org/wiki/The_Knitters","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5b/HSB_2005_-_The_Knitters.jpg","page_title":"The Knitters","context_page_description":"The Knitters sind eine US-amerikanische Musikgruppe aus Los Angeles, die Country, Rockabilly und Folkmusik spielen."},{"page_url":"https://es.wikipedia.org/wiki/Perserschutt","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/81/Athena_Angelitos_-_Perserschutt_01.jpg","page_title":"Perserschutt","context_page_description":"El depósito de los persas es el depósito de los hallazgos arqueológicos derivados de la recogida y posterior enteramiento, en la Acrópolis de Atenas, de los restos de estatuas y exvotos realizados por los atenienses a partir del 480 a. C.: «sepultura ritual de objetos votivos, cargados de valores religiosos y, por tanto, dignos de ser retirados del deterioro».​ Las esculturas proceden de la destrucción y saqueo de la ciudad perpetrados por los persas liderados por Jerjes I en la Segunda guerra médica. Fue desenterrado a finales del siglo XIX en la terraza oriental de la Acrópolis y en la zona entre el Partenón y el Erecteo."},{"page_url":"https://en.wikipedia.org/wiki/73rd_Academy_Awards","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c2/Stephen_Gaghan_%28cropped%29.jpg","page_title":"73rd Academy Awards","context_page_description":"The 73rd Academy Awards ceremony, presented by the Academy of Motion Picture Arts and Sciences, honored the best of 2000 in film and took place on March 25, 2001, at the Shrine Auditorium in Los Angeles, beginning at 5:30 p.m. PST / 8:30 p.m. EST. During the ceremony, AMPAS presented Academy Awards in 23 categories. The ceremony, televised in the United States by ABC, was produced by Gil Cates and was directed by Louis J. Horvitz. Actor Steve Martin hosted the show for the first time. Three weeks earlier in a ceremony at the Regent Beverly Wilshire Hotel in Beverly Hills, California held on March 3, the Academy Awards for Technical Achievement were presented by host Renée Zellweger.\\nGladiator won five awards including Best Picture. Other winners included Crouching Tiger, Hidden Dragon and Traffic with four awards, and Almost Famous, Big Mama, Erin Brockovich, Father and Daughter, How the Grinch Stole Christmas, Into the Arms of Strangers: Stories of the Kindertransport, Pollock, Quiero ser, U-571, and Wonder Boys with one. The telecast garnered almost 43 million viewers in the United States."},{"page_url":"https://de.wikipedia.org/wiki/Nationalpark_Caldera_de_Taburiente","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d2/WasserfallCaldera.jpg","page_title":"Nationalpark Caldera de Taburiente","context_page_description":"Der Nationalpark Caldera de Taburiente, liegt auf der Kanarischen Insel La Palma. Er bildet eine nach Westen offene krater- oder calderaähnliche Vertiefung im Zentrum der Insel."},{"page_url":"https://es.wikipedia.org/wiki/Geograf%C3%ADa_de_Guatemala","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/Fuego_from_Acatenango.jpg","page_title":"Geografía de Guatemala","context_page_description":"Guatemala es un pequeño país —con 108 889 km², ​ el 107.º del mundo— ubicado en la región subtropical del hemisferio norte, en la sección septentrional de América Central. Limita al norte con México, al este con Belice y al sur con Honduras y El Salvador, y esta bañada al oeste por el océano Pacífico y al este por el golfo de Honduras del mar Caribe—parte del Atlántico—. Las diferentes zonas ecológicas varían desde el nivel del mar hasta aproximadamente 4000 msnm, con precipitaciones pluviales que varían desde los 400 hasta aproximadamente 4000 mm anuales, con un clima cálido tropical, más templado en el altiplano.\\nEs un país en gran parte montañoso, con la notable excepción de sus bordes marítimos donde se extienden llanuras costeras bajas y, a veces, pantanosas. Dos grandes cadenas montañosas de altitud elevada recorren la parte central del país en dirección NO-SE, dividiéndolo en tres áreas geográficas distintas:\\nlas altiplanicies de montañas y de volcanes donde vive la mayoría de la población, donde emergen dos grandes relieves montañosos con por un lado, al este, la sierra Madre y, por otro, parte, al oeste, la sierra de los Cuchumatanes;"},{"page_url":"https://es.wikipedia.org/wiki/Paseo_de_la_Libertad","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b0/Paseo_de_la_Libertad_%283192038014%29.jpg","page_title":"Paseo de la Libertad","context_page_description":"El paseo de la Libertad es una calle de la ciudad española de Albacete. La vía, con edificios de la primera mitad del siglo XX, cuenta con un bulevar central que se extiende desde la plaza del Altozano hasta la fuente de las Ranas. En abril acoge la Feria del Libro de Albacete.​\\n​"},{"page_url":"https://fr.wikipedia.org/wiki/Stroukoff_YC-134","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8c/YC-123E_with_pantobase_landing_gear_1955.jpg","page_title":"Stroukoff YC-134","context_page_description":"Conçu en 1956, le Stroukoff YC-134 était un avion de transport militaire américain, essentiellement basé sur le C-123 Provider. L'armée américaine passa un contrat avec Stroukoff Aircraft pour développer une version améliorée de l'avion, combinant les caractéristiques que la compagnie avait développées pour les YC-123D et YC-123E."},{"page_url":"https://fa.wikipedia.org/wiki/%D9%84%D9%88%D8%A6%DB%8C%D8%B3_%D8%A8%D9%88%DA%A9%D8%B3%D8%AA%D9%88%D9%86","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f1/Lewis_Buxton_2014.jpg","page_title":"لوئیس بوکستون","context_page_description":"لوئیس بوکستون یک بازیکن فوتبال اهل بریتانیا است."},{"page_url":"https://en.wikipedia.org/wiki/Eucalyptus_argophloia","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8a/Eucalyptus_argophloia_habit.jpg","page_title":"Eucalyptus argophloia","context_page_description":"Eucalyptus argophloia, commonly known as the Queensland western white gum, Queensland white gum, Scrub gum, Lapunyah, Burncluith gum or Chinchilla white gum is a tree that is endemic to a small area of Queensland. It has smooth white bark ageing to other colours, narrow lance-shaped adult leaves, more or less spherical flower buds in groups of seven, white flowers and small, hemispherical to cup-shaped fruit."},{"page_url":"https://hu.wikipedia.org/wiki/Estaci%C3%B3n_de_Coslada","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a5/Estaci%C3%B3n_de_Coslada.JPG","page_title":"Estación de Coslada","context_page_description":"Estación de Coslada vasútállomás Spanyolországban, Coslada településen a Madrid–Barcelona-vasútvonalon. Része Madrid elővárosi vasúti közlekedésének, a Cercanías Madridnak."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A2%D0%B5%D0%B9%D0%BC%D1%83%D1%80%D0%B0%D0%B7_II","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8e/%E1%83%97%E1%83%94%E1%83%98%E1%83%9B%E1%83%A3%E1%83%A0%E1%83%90%E1%83%96_II_%E1%83%AE%E1%83%94%E1%83%9A%E1%83%A0%E1%83%97%E1%83%95%E1%83%90.jpg","page_title":"Теймураз II","context_page_description":"Теймураз II — царь Кахети, затем Картли. Из династии Багратионов. Поэт-лирик. Сын царя Картли и Кахетии Ираклия I.\\nВ 1744 году царём Кахети стал сын Теймураза II — Ираклий II, что практически объединило Восточную Грузию.\\nБорясь за объединение Восточной Грузии, искусно утверждал свою власть при содействии Надир-шаха. Во внешней политике в основном ориентировался на Россию.\\nВ 1761 году прибыл в Петербург, чтобы побудить русское правительство к поддержке Восточной Грузии во взаимоотношениях с Ираном. Цели не достиг — Россия была занята Семилетней войной. Умер в Санкт-Петербурге, похоронен в Астрахани."},{"page_url":"https://no.wikipedia.org/wiki/Jacek_Wszo%C5%82a","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/Wszola_Jacek.jpg","page_title":"Jacek Wszoła","context_page_description":"Jacek Roman Wszoła er en tidligere polsk friidrettsutøver som konkurrerte i høydehopp.\\nWszoła har deltatt i to olympiske leker, under OL 1976 i Montréal vant han overraskende olympisk gull i høydekonkurransen i regnvær. I Moskva fire år senere tok han sølv. Wszoła har også hatt verdensrekorden i høydehopp, i 1980 forbedret han Vladimir Jasjtsjenkos verdensrekord med en centimeter til 2,35."},{"page_url":"https://fr.wikipedia.org/wiki/Tracteur-%C3%A9recteur-lanceur","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/14/SSR111_Sept._2008.JPG","page_title":"Tracteur-érecteur-lanceur","context_page_description":"Un tracteur-érecteur-lanceur est un véhicule avec un tracteur intégré qui peut transporter, élever en position de tir et tirer un ou plusieurs missiles. Ces véhicules existent pour les missiles sol-air et missiles sol-sol."},{"page_url":"https://en.wikipedia.org/wiki/Quarters_of_Rome","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/65/Quartieri_Roma_1930.jpg","page_title":"Quarters of Rome","context_page_description":"The Quarters of Rome are the areas in and around the Italian city of Rome which became urbanised after the foundation of the last city-centre rione, Prati.\\nThey form the second level of administrative sub-divisions of Roma Capitale. Together they cover 171.38 km² and hold 1483913 inhabitants."},{"page_url":"https://ceb.wikipedia.org/wiki/North_Perrott","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fa/North_Perrott_church.jpg","page_title":"North Perrott","context_page_description":"Parokya ang North Perrott sa Hiniusang Gingharian. Nahimutang ni sa kondado sa Somerset ug apil sa nasod sa Inglatera, sa habagatang bahin sa nasod, 200 km sa kasadpan sa London ang ulohan sa nasod. Adunay 246 ka molupyo.\\nAng klima baybayon. Ang kasarangang giiniton 8 °C. Ang kinainitan nga bulan Hulyo, sa 16 °C, ug ang kinabugnawan Enero, sa 1 °C."},{"page_url":"https://be.wikipedia.org/wiki/BMW_E21","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/8d/BMW_316-E21_Front-view.JPG","page_title":"BMW E21","context_page_description":"BMW E21 — аўтамабіль кампаніі BMW. Родапачынальнік трэцяй серыі, закладзеная ў гэтай мадэлі ідэалогія заставалася амаль нязменнай да пачатку 1990-х гадоў. Машына прыйшла на змену BMW 02-серыі. Выпуск мадэлі быў пачаты 2 мая 1975 года. Завершаны — у 1983 годзе.\\nУ конкурсе Еўрапейскі аўтамабіль года 1976 мадэльнага года заняла 2-е месца. E21 стала першай мадэллю BMW вырабленай больш за мільён асобнікаў — з 1975 па 1983 год выраблена 1 364 039 аўтамабіляў."},{"page_url":"https://fr.wikipedia.org/wiki/Liste_d%27entreprises_de_Hong_Kong","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bb/1_hong_kong_panorama_2011_dusk_victoria_peak.jpg","page_title":"Liste d'entreprises de Hong Kong","context_page_description":"Cet article contient une liste d'entreprises de Hong Kong, la plus grande et la plus peuplée des deux régions administratives spéciales de la République populaire de Chine."},{"page_url":"https://azb.wikipedia.org/wiki/%D9%88%D9%84%DB%8C%D9%84%D8%A7_%D8%AF%D9%84_%D8%B1%DB%8C%D9%88_%DA%A9%D8%B1%DB%8C%D9%88%D9%86","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/ff/Palacio_Enr%C3%ADquez_Velilla.JPG","page_title":"ولیلا دل ریو کریون","context_page_description":"{{Infobox settlement\\nofficial_name = Velilla del Río Carrión, Spain |\\nnickname = |\\nimage_flag = |\\nimage_flag = |\\nimage_seal = |\\nimage_map = |\\nmap_caption = |\\nsubdivision_type = دۆنیا اؤلکه‌لری‌ |\\nsubdivision_name = ایسپانیا |\\nsubdivision_type1 = Autonomous community |\\nsubdivision_type2 = ایسپانیا اوستانلاری |\\nsubdivision_name2 = پالنسیا اوستانی |\\nsubdivision_type3 = Municipality |\\nsubdivision_name3 = Velilla del Río Carrión |\\nleader_title = |\\nleader_name = |\\narea_magnitude = |\\narea_total_km2 = 199 |\\narea_land_km2 = |\\narea_water_km2 = |\\nelevation_m = |\\npopulation_as_of = 2004 |\\npopulation_note = |\\npopulation_total = 1632 |\\npopulation_density_km2 = 8.2 |\\ntimezone = CET |\\nutc_offset = +1 |\\ntimezone_DST = CEST |\\nutc_offset_DST = +2 |\\n}}\\nولیلا دل ریو کریون ایسپانیادا بیر یاشاییش منطقه‌سی‌دیر و پالنسیا اوستانینده یئرلشیب. بۇ شهرین مساحتی ۱۹۹ کیلومتر موربّع دیر. سوْن نۆفوس تخمین‌لرینه گؤره ۱۶۳۲ نفر و اها‌لی سیخلیغی ۸٫۲ اینسان کیلومتر موربّع دیر."},{"page_url":"https://de.wikipedia.org/wiki/P%C5%99%C3%AD%C5%A1tpo","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/00/Chapel_in_P%C5%99%C3%AD%C5%A1tpo%2C_T%C5%99eb%C3%AD%C4%8D_District.JPG","page_title":"Příštpo","context_page_description":"Příštpo ist eine Gemeinde in Tschechien. Sie liegt vier Kilometer südöstlich von Jaroměřice nad Rokytnou und gehört zum Okres Třebíč."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E7%81%B0%E8%89%B2%E7%BB%8F%E6%B5%8E","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/08/Dry_Fruit_Wala._Peshawar.jpg","page_title":"灰色经济","context_page_description":"灰色經濟，又稱黑市場、地下經濟、影子經濟，一般是指一種在國民經濟中未向政府申報登記，而經濟活動脫離政府法律法規約束，且不向政府納稅的經濟成分。又可指逃避政府的管制、稅收和監察，未向政府申報和納稅，其產值和收入未納入國民生產總值的所有經濟活動。地下經濟可以指各種地下經濟活動產生的收入和結果。地下經濟活動涉及生產、流通、分配、消費等各個經濟環節，可謂無所不在，是當前世界範圍內的一種普遍現象，被國際社會公認為「經濟黑洞」。\\n據國際貨幣基金組織估計，1998年全球地下經濟規模約9萬億美元，占全球產出的23%。"},{"page_url":"https://en.wikipedia.org/wiki/Canton_of_Pardiac-Rivi%C3%A8re-Basse","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/90/Marciac_%28Gers%2C_Fr%29_la_grande_place_centrale.JPG","page_title":"Canton of Pardiac-Rivière-Basse","context_page_description":"The canton of Pardiac-Rivière-Basse is an administrative division of the Gers department, southwestern France. It was created at the French canton reorganisation which came into effect in March 2015. Its seat is in Plaisance."},{"page_url":"https://fr.wikipedia.org/wiki/Comt%C3%A9_de_Bee","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ab/Downtown_Beeville_IMG_0983.JPG","page_title":"Comté de Bee","context_page_description":"Le comté de Bee, en anglais : Bee County, est un comté des États-Unis, situé au sud-est de l'État du Texas. Fondé le 8 décembre 1857, son siège de comté est la ville de Beeville. Selon le recensement des États-Unis de 2010, sa population est de 32 861 habitants, estimée en 2017 à 32 563 habitants. Le comté a une superficie de 2 280 km², dont 2 279,8 km² en surfaces terrestres. Il est baptisé en référence à Barnard E. Bee Sr., un avocat et homme politique du Texas."},{"page_url":"https://en.wikipedia.org/wiki/Appalachian_Trail","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/33/ANST-Triangle-Logo_1.jpg","page_title":"Appalachian Trail","context_page_description":"The Appalachian National Scenic Trail, generally known as the Appalachian Trail or simply the A.T., is a marked hiking trail in the Eastern United States extending between Springer Mountain in Georgia and Mount Katahdin in Maine. The trail is about 2,200 miles long, though the exact length changes over time as parts are rerouted or modified. The Appalachian Trail Conservancy describes the Appalachian Trail as the longest hiking-only trail in the world. More than 2 million people are said to take a hike on part of the trail at least once each year.\\nThe idea of the Appalachian Trail came about in 1921. The trail itself was completed in 1937 after more than a decade of work, although improvements and changes continue. It is maintained by 31 trail clubs and multiple partnerships, and managed by the National Park Service, United States Forest Service, and the nonprofit Appalachian Trail Conservancy. Most of the trail is in forest or wild lands, although some portions traverse towns, roads and farms."},{"page_url":"https://fa.wikipedia.org/wiki/%D9%85%D8%B9%D8%A8%D8%AF_%D8%B3%D9%88%D9%85_%D8%A7%D9%88%D8%B1%D8%B4%D9%84%DB%8C%D9%85","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9b/Pieter_de_Witte_Solomon.jpg","page_title":"معبد سوم اورشلیم","context_page_description":"معبد سوم، یا معبد حزقیال، معبد مقدس یهودی است که در کتاب حزقیال پیشگویی و از نظر معماری توصیف شده‌است، خانه‌ای برای عبادت تمام مردمی که خدمات قربانی دارند. حزقیال این مکان را به عنوان عمارت ابدی و محل سکونت دائمی یهوه بر روی کوه معبد در اورشلیم یاد کرده‌است."},{"page_url":"https://tr.wikipedia.org/wiki/Hard_Rock_Stadyumu","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/04/Dolphin_Stadium.jpg","page_title":"Hard Rock Stadyumu","context_page_description":"Hard Rock Stadyumu, Miami Gardens, Florida, ABD'de bulunan bir Amerikan futbolu stadyumu. Miami Dolphins maçlarını burada oynamaktadır. Ayrıca Florida Marlins 1993-2011 arasında burada maç yaptı. Başlangıçta adı Joe Robbie Stadium olan stadyum, zaman içinde Pro Player Park, Pro Player Stadium, Dolphin Stadium, Dolphins Stadium ve Land Shark Stadium olarak da adlandırıldı. 18 Ocak 2010'da Miami Dolphins ile Sun Life Financial arasında yapılan anlaşma ile stadyumun adı beş yıllığına Sun Life Stadium oldu. Anlaşmaya göre Sun Life, her yıl $7,5 milyon ödedi. Ağustos 2016'da stadyumun isim hakkını Hard Rock Cafe satın aldı."},{"page_url":"https://id.wikipedia.org/wiki/Reruntuhan_Bersejarah_Keluarga_Asakura_Ichij%C5%8Ddani","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a3/Asakura_Yakata_of_Ichijodani_Asakura_Family_Historic_Ruins12s5s4592.jpg","page_title":"Reruntuhan Bersejarah Keluarga Asakura Ichijōdani","context_page_description":"The Reruntuhan Bersejarah Keluarga Asakura Ichijōdani adalah reruntuhan bersejarah yang terletak di bagian Kidonouchi dari kota Fukui, Prefektur Fukui, di Wilayah Hokuriku, Japan. Area ini dikuasai klan Asakura selama 103 tahun selama Zaman Sengoku. Situs ini diangkat sebagai Tapak Bersejarah Luar Biasa pada tahun 1971, dan pada bulan Juni 2007 2,343 artifak dari situs tersebut diangkat sebagai Harta Kebudayaan Agung."},{"page_url":"https://es.wikipedia.org/wiki/Liosceles_thoracicus","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6b/PteroptochusThoracicusJennens.jpg","page_title":"Liosceles thoracicus","context_page_description":"El tapaculo amazónico, ​ también conocido como gallito pardo, tapacola fajirrojizo, tapaculo collarejo o tapaculo de faja rojiza, ​ es una especie de ave paseriforme de la familia Rhinocryptidae, la única del género monotípico Liosceles. Es nativo de la región amazónica en América del Sur."},{"page_url":"https://id.wikipedia.org/wiki/Campo_Grande","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/57/Por_do_sol.jpg","page_title":"Campo Grande","context_page_description":"Campo Grande merupakan nama kota di Brasil. letaknya di bagian selatan. Tepatnya di negara bagian Mato Grosso do Sul. Pada tahun 2006, kota ini memiliki jumlah penduduk sebanyak 765.247 jiwa dan memiliki luas wilayah 8.096 km². Kota ini memiliki kepadatan penduduk sebanyak 94,5 jiwa/km². Kota ini adalah ibu kota negara bagian Mato Grosso do Sul."},{"page_url":"https://fr.wikipedia.org/wiki/%C3%89glise_Saint-Jean-Baptiste_de_Coutras","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/89/Coutras_%C3%89glise_Saint-Jean-Baptiste_04.jpg","page_title":"Église Saint-Jean-Baptiste de Coutras","context_page_description":"L'église Saint-Jean-Baptiste est une église catholique située sur la commune de Coutras, dans le département de la Gironde, en France."},{"page_url":"https://cs.wikipedia.org/wiki/Dirck_Jaspersz._van_Baburen","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a6/Dirck_van_Baburen_-_The_Capture_of_Christ_with_the_Malchus_Episode_-_WGA01089.jpg","page_title":"Dirck Jaspersz. van Baburen","context_page_description":"Dirck Jaspersz. van Baburen byl nizozemský malíř, známý také pod jménem Teodoer van Baburen či Theodor Baburen, člen spolku Bentvueghels, kde dostal přezdívku „Biervlieg“."},{"page_url":"https://de.wikipedia.org/wiki/Rosette_Niederer-Kasthofer","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/35/Rosette_Niederer-Kasthofer.png","page_title":"Rosette Niederer-Kasthofer","context_page_description":"Rosette Niederer-Kasthofer war eine Schweizer Pädagogin und Pionierin in der Mädchenerziehung."},{"page_url":"https://de.wikipedia.org/wiki/Dschalal_Talabani","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4f/IraqPolice_Dschalal_Talabani_and_Dschawad_al-Maliki.jpg","page_title":"Dschalal Talabani","context_page_description":"Dschalal Talabani war von 2005 bis 2014 Staatspräsident des Irak und Vorsitzender der Patriotischen Union Kurdistans im Irak, neben der Demokratischen Partei Kurdistans eine der beiden großen Parteien im kurdischen Teil des Irak.\\nNach dem Irakkrieg und dem Sturz Saddam Husseins war er Mitglied des Irakischen Regierungsrats, der sich am 1. Juni 2004 auflöste. Bei den Wahlen am 30. Januar 2005 erhielt die Demokratische Patriotische Allianz Kurdistans, der sich die PUK angeschlossen hatte, 25,7 % der Stimmen und sicherte sich damit 71 Sitze im Irakischen Parlament. In der neuen irakischen Regierung stellte die Patriotische Union Kurdistans fünf von insgesamt 32 Ministern, die Demokratische Patriotische Allianz Kurdistans insgesamt stellte acht Minister.\\nTalabanis Vizepräsidenten waren der Sunnit Tarek al-Haschemi und der Schiit Khodair al-Khozaei."},{"page_url":"https://de.wikipedia.org/wiki/Albeuve","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/df/Karte_Gemeinde_Albeuve_2001.png","page_title":"Albeuve","context_page_description":"Albeuve ist eine Ortschaft und früher selbständige politische Gemeinde im Distrikt Greyerz des Kantons Freiburg in der Schweiz. Am 1. Januar 2002 fusionierte Albeuve zusammen mit Neirivue, Lessoc und Montbovon zur neuen Gemeinde Haut-Intyamon, deren Gemeindeverwaltung sich in Albeuve befindet. Der frühere deutsche Name Weissbach wird heute nicht mehr verwendet."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%A3%D0%B1%D1%88%D1%82%D0%B0%D1%82-%D0%92%D0%B0%D1%98%D1%85%D0%B5%D1%80","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/7f/Ubstadt-Weiher_im_Landkreis_Karlsruhe.png","page_title":"Убштат-Вајхер","context_page_description":"Убштат-Вајхер општина је у њемачкој савезној држави Баден-Виртемберг. Једно је од 32 општинска средишта округа Карлсруе. Према процјени из 2010. у општини је живјело 12.807 становника. Посједује регионалну шифру 8215084."},{"page_url":"https://pl.wikipedia.org/wiki/Stanis%C5%82aw_Buchholz","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5e/Stanislaw_Buchholz.jpg","page_title":"Stanisław Buchholz","context_page_description":"Stanisław Buchholz – nauczyciel z 54-letnim stażem służby zawodowej, odbudował szkolnictwo polskie w Toruniu po I oraz II wojnie światowej, założyciel oraz pierwszy rektor Polskiej Szkoły Wydziałowej Koedukacyjnej w Toruniu. Współzałożyciel Związku Nauczycielstwa Polskiego, biolog w Państwowym Gimnazjum i Liceum im. M. Kopernika w Toruniu, radny miasta Torunia za prezydentury Antoniego Bolta, prezes Kujawskiego Związku Pszczelarzy.\\nOdznaczony Złotym Krzyżem Zasługi, Srebrnym Krzyżem Zasługi i Brązowym i Srebrnym Medalem Kuratora Szkolnego za Długoletnią Służbę.\\nWięzień polityczny Obozu Koncentracyjnego Stutthof numer 12494.\\nW 2016 roku miało miejsce odsłonięcie tablicy pamiątkowej dedykowanej Stanisławowi Buchholzowi podczas obchodów rocznicy wyzwolenia Torunia po I wojnie światowej oraz powstania Polskiej Szkoły Wydziałowej."},{"page_url":"https://nl.wikipedia.org/wiki/Halichoeres_hartzfeldii","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/ItoBRygr.jpg","page_title":"Halichoeres hartzfeldii","context_page_description":"Halichoeres hartzfeldii is een straalvinnige vissensoort uit de familie van lipvissen. De wetenschappelijke naam van de soort is voor het eerst geldig gepubliceerd in 1852 door Bleeker.\\nDe soort staat op de Rode Lijst van de IUCN als niet bedreigd, beoordelingsjaar 2008."},{"page_url":"https://fr.wikipedia.org/wiki/John_Salath%C3%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ea/Sentinel_Rock.jpg","page_title":"John Salathé","context_page_description":"John Salathé, né le 14 juin 1899 à Niederschöntal près de Bâle en Suisse et mort le 31 août 1992 ou 1993 en Californie, est un grimpeur américain. Forgeron de métier, il se mit tardivement à l'escalade, à la suite d'une crise mystique. Inventant et forgeant lui-même les pitons nécessaires, il fut, à la fin des années 1940, l'un des pionniers des Big walls américains, ces parois verticales de plusieurs centaines de mètres, nécessitant plusieurs jours d'ascension et l'usage intensif de l'escalade artificielle. Il participa notamment aux premières ascensions de Lost Arrow Spire et de la face nord de Sentinel Rock, dans la vallée de Yosemite. « Il [devint], l'âge aidant, excentrique et paranoïaque, glissant petit à petit dans un monde où la religion domina totalement ses pensées », et vagabonda pendant vingt ans dans l'Ouest américain."},{"page_url":"https://da.wikipedia.org/wiki/Montpellier_HSC","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3c/HSC_Montpellier_Logo.png","page_title":"Montpellier HSC","context_page_description":"Montpellier Hérault Sport Club er en fransk fodboldklub fra Montpellier i Languedoc-Roussillon-regionen. Klubben spiller i Ligue 1. Den blev stiftet under sit nuværende navn i 1974, efter tidligere at have været kendt som SO Montpellier. Holdet spiller sine hjemmekampe på Stade de la Mosson, og dens største triumfer er sejrene i pokalturneringen Coupe de France i henholdsvis 1929 og 1990."},{"page_url":"https://is.wikipedia.org/wiki/Lei%C3%B0togask%C3%B3li_%C3%8Dslands","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/23/Lei%C3%B0togaskoli_%C3%ADslands.jpg","page_title":"Leiðtogaskóli Íslands","context_page_description":"Markmið Leiðtogaskóla Íslands er að efla leiðtogahæfni og valdefla ungt fólk í félagasamtökum. Skólinn er rekinn af Landssambandi ungmennafélaga, án hagnaðarsjónarmiða í þágu ungs fólks.\\nLUF eru regnhlífarsamtök félagasamtaka ungs fólks á Íslandi og þeim tilheyra 32 aðildarfélög. Þau eru öll lýðræðisleg frjáls félagasamtök sem starfa á landsvísu, eru leidd af ungu fólki og starfa með hagsmuni þeirra að leiðarljósi.\\nLSÍ er vettvangur aðildafélaga LUF til að þjálfa persónulega hæfni, efla tengslanet, deila reynslu, auka getu og leiðtogahæfni. Allt ungt fólk, á aldrinum 16-35 ára, getur sótt um þátttöku en meðlimir aðildarfélaganna fá forgang að skráningu. Í LSÍ fá þátttakendur tækifæri til að læra um mannréttindi og lýðræði í verki á fjölbreyttum valnámskeiðum sem tengjast starfi félagasamtka. Dæmi um námskeið eru hópefli, stjórnarsetu, fundarstjórn, ræðumennsku, fjármögnun, stefnumótun auk mannréttinda- og lýðræðisfræðslu. Þjálfarar skólans koma einnig úr röðum aðildarfélaganna og mynda Þjálfarateymi LUF\\nSkólahald fer fram á hverju hausti í Hinu húsinu og fer skráning fer fram á vefsíðu skólans."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E7%94%B0%E7%BA%B3%E8%A5%BF%E5%8F%B7%E6%BD%9C%E8%89%87","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/6a/USS_Tennessee%3B_080522-N-9610C-001.jpg","page_title":"田纳西号潜艇","context_page_description":"田納西號潛艇，屬於俄亥俄級核潛艇序列，是美國海軍中第四艘以田納西州之名命名的軍艦，也是第一艘以該州之名命名的潛艇。\\n在1980財年，建造該潛艇的計劃獲得批准；1982年1月7日，位於康乃狄克州格羅頓的通用動力下屬公司電船公司獲得建造該潛艇的合同；1986年6月9日，建造方開始鋪設該潛艇的龍骨。1986年12月13日，蘭蒂斯·凱爾索夫人主持了該潛艇的下水儀式。1988年12月17日，該潛艇正式服役，D·魏茨恩伯格和肯尼思·D·巴克分別被任命為「藍色」和「金色」輪值船員組的指揮官。\\n田納西號潛艇是第一艘配備了三叉戟Ⅱ型飛彈的潛艇。"},{"page_url":"https://uk.wikipedia.org/wiki/%D0%92%D0%BB%D0%B0%D0%B4%D0%B8%D1%81%D0%BB%D0%B0%D0%B2_%D0%9E%D0%B4%D0%BE%D0%BD%D0%B8%D1%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b6/W%C5%82adys%C5%82aw_Odonic_seal_1231.PNG","page_title":"Владислав Одонич","context_page_description":"Владислав Одонич — князь Великої Польщі у 1229—1239 роках. Більшу частину життя провів у боротьбі за батьківський спадок.\\nОнук Галицького князя Ярослава Осмомисла.\\nПо батьківській та материнській лінії був нащадком Великих князів Київських Володимира Святого та Ярослава Мудрого."},{"page_url":"https://th.wikipedia.org/wiki/%E0%B8%9B%E0%B9%89%E0%B8%AD%E0%B8%A1%E0%B8%8A%E0%B8%A2%E0%B8%84%E0%B8%A3%E0%B8%AB%E0%B9%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/97/Jaigarh_Fort_as_seen_from_Amber_Fort.JPG","page_title":"ป้อมชยครห์","context_page_description":"ป้อมชยครห์ ตั้งอยู่บริเวณเชิงเขาชีลกาทีลา ซึ่งเป็นส่วนหนึ่งของเทือกเขาอะระวัลลี โดยตั้งอยู่สูงเหนือกว่าป้อมอาเมร์ ซึ่งเบื้องล่างนั้นเป็นทะเลสาบเมาตา ซึ่งใกล้กับเมืองอาเมร์ ชานเมืองชัยปุระ ในรัฐราชสถาน ประเทศอินเดีย สร้างโดยมหาราชาสะหวายจัย สิงห์ที่ 2 ในปีค.ศ. 1726 เพื่อใช้สำหรับอารักขาป้อมอาเมร์ และพระราชวังอาเมร์ซึ่งตั้งอยู่ภายในอันเป็นพระราชฐานของพระองค์\\nป้อมแห่งนี้มีการออกแบบทางโครงสร้างสถาปัตยกรรมที่คล้ายคลึงกับป้อมอาเมร์ และยังนิยมเรียกกันว่า \\"ป้อมชัย\\" ซึ่งกินความยาวรวม 3 กิโลเมตร ทางด้านทิศเหนือจรดใต้ และกว้างประมาณ 1 กิโลเมตร ในป้อมแห่งนี้เป็นที่ตั้งของปืนใหญ่ \\"ชัยวนา\\" ซึ่งมีน้ำหนักถึง 50 ตัน ซึ่งได้ทำการหลอมโลหะและผลิตภายในป้อมแห่งนี้ โดยในขณะที่สร้างนั้นถือเป็นปืนใหญ่ที่มีขนาดใหญ่ที่สุดในโลกซึ่งมีล้อสามารถเคลื่อนย้ายได้ ภายในป้อม มีสวนที่ตกแต่งอย่างสวยงาม และหมู่พระตำหนักซึ่งประกอบด้วย \\"ลักษมีวิลาส\\", \\"ลลิตมนเทียร\\", \\"วิลาสมนเทียร\\" และ \\"อารามมนเทียร\\" ซึ่งใช้สำหรับสมาชิกพระราชวงศ์เวลาเสด็จมาประทับที่ป้อมแห่งนี้ นอกจากนี้ยังพบ \\"ศุภัตนิวาส\\" ซึ่งเป็นโถงสำหรับรวมพล โรงงานผลิตอาวุธ และพิพิธภัณฑ์ ป้อมชยครห์ และป้อมอาเมร์นั้นเชื่อมต่อกันด้วยทางเดินลับใต้ดิน จึงมักถือว่าป้อมทั้งสองนี้เป็นสถานที่เดียวกัน"},{"page_url":"https://es.wikipedia.org/wiki/Batalla_de_Grecia","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c8/German_bombing_of_Piraeus.jpg","page_title":"Batalla de Grecia","context_page_description":"La batalla de Grecia u Operación Marita fue la invasión del Reino de Grecia por las fuerzas del Eje durante la Segunda Guerra Mundial enfrentándose a los aliados. La batalla de Grecia dio comienzo el 28 de octubre de 1940 con la invasión de Grecia por la Italia fascista​ y concluyó con la caída de Kalamata, en el Peloponeso, el 28 de abril de 1941. Con la batalla de Creta y algunas otras acciones navales, la batalla de Grecia forma parte del teatro de operaciones egeo de la Campaña de los Balcanes.\\nItalia invade Grecia el 28 de octubre de 1940 desde Albania, país que había ocupado previamente en abril de 1939. Sin embargo, el ejército griego demuestra que es capaz de resistir e incluso de contraatacar, forzando al ejército italiano a la retirada. Hacia mediados de diciembre, los griegos, a su vez, ocupan la cuarta parte de Albania. En marzo de 1941, una nueva ofensiva italiana fracasa, poniendo así fin a las aspiraciones italianas.\\nEl 6 de abril de 1941, Alemania invade Grecia desde Bulgaria, con la finalidad de dotar de más seguridad a su flanco sur."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkm%C3%A4ler_in_der_Gie%C3%9Fener_Gesamtanlage_IX","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/4b/Giessen_Liebigstrasse_73_60988.png","page_title":"Liste der Kulturdenkmäler in der Gießener Gesamtanlage IX","context_page_description":"Die folgende Liste enthält die in der Denkmaltopographie ausgewiesenen Kulturdenkmäler auf dem Gebiet der Stadt Gießen, Landkreis Gießen, Hessen.\\nHinweis: Die Reihenfolge der Denkmäler in dieser Liste orientiert sich zunächst an Stadtteilen und anschließend der Anschrift, alternativ ist sie auch nach der Bezeichnung, der vom Landesamt für Denkmalpflege vergebenen Nummer oder der Bauzeit sortierbar.\\nGrundlage ist die Veröffentlichung der hessischen Denkmalliste, die auf Basis des Denkmalschutzgesetzes vom 5. September 1986 erstmals erstellt und seither laufend ergänzt wurde.\\nDiese Liste enthält alle Kulturdenkmäler der Gesamtanlage IX Universitätsviertel der Stadt Gießen."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9C%D0%BE%D1%81%D1%82_%D0%90%D1%80%D1%85%D0%B8%D0%B5%D0%BF%D0%B0%D1%80%D1%85%D0%B8%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/73/Pont_de_l%27Archev%C3%AAch%C3%A9_with_padlocks_and_Notre_Dame_Cathedral_Paris.jpg","page_title":"Мост Архиепархии","context_page_description":"Мост Архиепархии — мост в центре Парижа, соединяет остров Ситэ с левым, южным берегом Сены и, в административном плане, 4-й округ столицы с 5-м округом. Каменный мост длиной 68 м и шириной 11 м; трёхарочный мост с проёмами в 15, 17 и 15 м. Низкие арки всегда препятствовали прохождению высокого речного транспорта, но, несмотря на принятое решение в 1910 году, мост никогда не был заменён.\\nС 2010 года мост Архиепархии является символическим местом для любящих людей, крепящих на нём металлические замочки в знак своей любви."},{"page_url":"https://de.wikipedia.org/wiki/Panagidia-Galaktotrofousa-Kloster","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2a/Panagidia_Galaktotrofousa_monastry_insite.JPG","page_title":"Panagidia-Galaktotrofousa-Kloster","context_page_description":"Das Panagidia-Galaktotrofousa-Kloster ist ein kleines zypriotisch-orthodoxes Kloster im griechischen Teil der Insel Zypern. Das Kloster liegt in der Nähe des Ortes Kofinou und befindet sich im südlichen Teil des Distriktes Larnaka. In unmittelbarer Nachbarschaft des Klosters hat das griechisch-zypriotische Satelliten- und Kommunikationsunternehmen Hellas-Sat ihren Sitz mit ihren Space-Center, sowie liegt die Strecke der Nord-Süd-Autobahn A1: Lefkosia – Lemesos.\\nIm Jahr 2012 lebten dort noch drei Mönche im Kloster, wovon der älteste Mönch 82 Jahre und die anderen 78 bzw. 40 Jahre alt waren. Der eigentliche Klosterbereich besteht im eigentlichen nur aus den Schlafräumen, der Klosterkirche, dem Hof und aus einigen Zimmern, die als Ausstellungsräume eingerichtet sind. Einer dieser Räume informiert über die Geschichte des Klosters, in einem anderen Raum befindet sich in einem Vitrinenschrank die Mumie mit den sterblichen Überresten des Gründers dieses Klosters. Die Mönche leben von Spenden und von dem Verkauf ihrer eigenen Olivenölproduktion."},{"page_url":"https://fr.wikipedia.org/wiki/Classe_Lida","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/ba/%C2%AB%D0%A0%D0%A2-181%C2%BB_%D0%B8_%C2%AB%D0%A0%D0%A2-233%C2%BB.jpg","page_title":"Classe Lida","context_page_description":"La Classe Lida est une classe de chasseur de mines de Russie."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A7%D0%B0%D0%B9%D0%BA%D0%B0_%D1%87%D0%B8%D0%BB%D1%96%D0%B9%D1%81%D1%8C%D0%BA%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e8/Southern_lapwing_%28Vanellus_chilenis_lampronotus%29.JPG","page_title":"Чайка чилійська","context_page_description":"Чайка чилійська — птах родини Сивкових. Поширений на Південноамериканському континенті."},{"page_url":"https://th.wikipedia.org/wiki/%E0%B9%82%E0%B8%A1%E0%B9%82%E0%B8%95%E0%B8%A3%E0%B8%B4_%E0%B9%82%E0%B8%99%E0%B8%A3%E0%B8%B4%E0%B8%99%E0%B8%B2%E0%B8%87%E0%B8%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5b/Motoori_Norinaga_self_portrait.jpg","page_title":"โมโตริ โนรินางะ","context_page_description":"โมโตริ โนรินางะ เป็นนักปราชญ์ชาวญี่ปุ่นที่มีส่วนในการเคลื่อนไหวโคกูงากุ ในยุคเอโดะช่วงคริสต์ศตวรรษที่ 18"},{"page_url":"https://sv.wikipedia.org/wiki/Garcia_(v%C3%A4xter)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/21/Ant%C3%B4nia_Ferreira_de_Melo.jpg","page_title":"Garcia (växter)","context_page_description":"Garcia är ett släkte av törelväxter. Garcia ingår i familjen törelväxter.\\nKladogram enligt Catalogue of Life:"},{"page_url":"https://fr.wikipedia.org/wiki/Christine_Peltre","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/CHRISTINE_PELTRE-PHOTO-2018.jpg","page_title":"Christine Peltre","context_page_description":"Christine Peltre est une historienne de l’art contemporain française."},{"page_url":"https://en.wikipedia.org/wiki/Oph%C3%A9lie-Cyrielle_%C3%89tienne","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/10/Oph%C3%A9lie-Cyrielle_%C3%89tienne.jpg","page_title":"Ophélie-Cyrielle Étienne","context_page_description":"Ophélie-Cyrielle Étienne is a French swimmer from Wissembourg. In the 2012 Summer Olympics her 4 × 200 m freestyle team won a bronze medal in a time of 7:47.49. The split times were: Camille Muffat; Charlotte Bonnet; Étienne; Coralie Balmy.\\nShe also competed in 200 m freestyle, 4 x 200 m freestyle relay and the 4 x 100 m freestyle relay at the 2008 Summer Olympics, and the 200 m freestyle at the 2012 Summer Olympics."},{"page_url":"https://de.wikipedia.org/wiki/Lampertsbach_(Ahr)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/90/20131116_Lampertsbach_1.JPG","page_title":"Lampertsbach (Ahr)","context_page_description":"Der Lampertsbach ist ein etwa 9,5 km langer, westlicher und rechter Nebenfluss der Ahr im rheinland-pfälzischen Landkreis Vulkaneifel und im nordrhein-westfälischen Kreis Euskirchen."},{"page_url":"https://ceb.wikipedia.org/wiki/Cantalapiedra_(kapital_sa_munisipyo)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/Logo-cantalapiedra.jpg","page_title":"Cantalapiedra (kapital sa munisipyo)","context_page_description":"Kapital sa munisipyo ang Cantalapiedra sa Espanya. Nahimutang ni sa lalawigan sa Provincia de Salamanca ug rehiyon sa Castilla y León, sa sentro nga bahin sa nasod, 150 km sa amihanan-kasadpan sa Madrid ang ulohan sa nasod. 784 metros ibabaw sa dagat kahaboga ang nahimutangan sa Cantalapiedra, ug adunay 1,225 ka molupyo.\\nAng yuta palibot sa Cantalapiedra kay patag, ug nga tinakpan sa ubos sa amihanan. Ang kinahabogang dapit sa palibot dunay gihabogon nga 801 ka metro ug 1.5 km sa kasadpan sa Cantalapiedra. Dunay mga 14 ka tawo kada kilometro kwadrado sa palibot sa Cantalapiedra may gamay nga populasyon. Ang kinadul-ang mas dakong lungsod mao ang Madrigal de las Altas Torres, 16.0 km sa sidlakan sa Cantalapiedra. Hapit nalukop sa kaumahan ang palibot sa Cantalapiedra. Sa rehiyon palibot sa Cantalapiedra, mga suba talagsaon komon.\\nAng klima bugnaw nga ugahon. Ang kasarangang giiniton 14 °C. Ang kinainitan nga bulan Hulyo, sa 26 °C, ug ang kinabugnawan Enero, sa 2 °C. Ang kasarangang pag-ulan 606 milimetro matag tuig. Ang kinabasaan nga bulan Oktubre, sa 81 milimetro nga ulan, ug ang kinaugahan Agosto, sa 2 milimetro."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9F%D1%80%D0%B5%D0%BC%D0%B8%D1%8F_%D0%90%D1%81%D1%81%D0%BE%D1%86%D0%B8%D0%B0%D1%86%D0%B8%D0%B8_%D1%82%D0%B5%D0%BB%D0%B5%D0%B2%D0%B8%D0%B7%D0%B8%D0%BE%D0%BD%D0%BD%D1%8B%D1%85_%D0%BA%D1%80%D0%B8%D1%82%D0%B8%D0%BA%D0%BE%D0%B2_%D0%B7%D0%B0_%D0%BB%D0%B8%D1%87%D0%BD%D1%8B%D0%B5_%D0%B4%D0%BE%D1%81%D1%82%D0%B8%D0%B6%D0%B5%D0%BD%D0%B8%D1%8F_%D0%B2_%D0%B4%D1%80%D0%B0%D0%BC%D0%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f8/Carrie_Coon_at_2013_Toronto_Film_Festival.jpg","page_title":"Премия Ассоциации телевизионных критиков за личные достижения в драме","context_page_description":"Премия Ассоциации телевизионных критиков за личные достижения в драме — награда, ежегодно присуждаемая Ассоциацией телевизионных критиков за индивидуальные достижения как актёров, так и авторов в драматических программах американского телевидения. Сама премия была запущена в 1985 году, но до 1997 года данной категории не существовало, а в категории за выдающиеся достижения в драме отмечались лишь программы, а не актёры. Номинанты на премию озвучиваются в июне, а сама церемония вручения наград проводится в июле или августе.\\nЗа все время существования премии в данной категории ее получили 18 актёров, актрис и авторов драматических программ. Актриса Мишель Уильямс — последняя на данный момент обладательница премии, она получила её за роль Гвен Вердон в сериале «Фосси/Вердон». Актёр Джеймс Гандольфини завоевал большинство наград за личные достижения в драме; он является трехкратным обладателем премии. Актёры Джеймс Гандольфини и Брайан Крэнстон шесть раз номинировались на премию в данной категории; это является рекордным количеством номинаций для премии Ассоциации телевизионных критиков за личные достижения в драме."},{"page_url":"https://no.wikipedia.org/wiki/Fylkesvei_408","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fb/FV408_Blakstad_plo.jpg","page_title":"Fylkesvei 408","context_page_description":"Fylkesvei 408 går mellom Blakstad i Froland og Rykene i Arendal. Veiens lengde er 12,2 km.\\nFør 1. januar 2010 var veien riksvei, etter at regionsreformen trådte i kraft har den status som fylkesvei."},{"page_url":"https://it.wikipedia.org/wiki/Erixon_Danso","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/57/Erixon_Danso.png","page_title":"Erixon Danso","context_page_description":"Erixon Danso è un calciatore olandese, centrocampista o attaccante dell'Egersund."},{"page_url":"https://it.wikipedia.org/wiki/Maria_de%27_Medici","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/95/Maria_de%27_Medici_Frans_Pourbus_the_Younger_%28detail%29.jpg","page_title":"Maria de' Medici","context_page_description":"Maria de' Medici è stata regina consorte di Francia e Navarra come seconda moglie di Enrico IV di Francia dal 1600 al 1610."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%95%D0%BA%D0%BE%D0%BD%D0%BE%D0%BC%D1%96%D0%BA%D0%B0_%D0%91%D0%B0%D1%80%D1%81%D0%B5%D0%BB%D0%BE%D0%BD%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ce/22%40.jpg","page_title":"Економіка Барселони","context_page_description":"Барселона служила життєво важливим центром торгівлі і судноплавства, ще до того, як Христофор Колумб відплив до Америки. Її стратегічне розташування, на березі Середземного моря, недалеко від кордону з Францією, зробило становлення міста як основного промислового і торгового центру Іспанії неминучим.\\nБарселона була одним з перших районів континентальної Європи, в якому почалася індустріалізація. До середини XIX століття Барселона стала важливим центром текстильної промисловості і машинобудування. Після цього, промислове виробництво відігравало визначальну роль в історії міста. Проте, як і в інших сучасних містах, обслуговуючий сектор економіки починає переважати над виробничим.\\nБарселона має багато рис, характерних для міст північно-західної Європи. В економіці міста велике значення має сфера обслуговування, доля традиційних галузей виробництва постійно знижується, при цьому зростає роль транснаціональних інвестицій. Стрімке зростання «технічних парків» індустрії високих технологій є сучасною рисою економіки Барселони."},{"page_url":"https://de.wikipedia.org/wiki/Southwold_Y_Station","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/dc/Southwold_-_Suffolk_dot.png","page_title":"Southwold Y Station","context_page_description":"Southwold Y Station war während des Zweiten Weltkriegs ein Militärstützpunkt der britischen Royal Navy. Er lag bei Easton Bavents nahe der ostenglischen Hafenstadt Southwold und damit unweit des östlichsten Ortes des Vereinigten Königreichs. Hier befand sich eine wichtige Funkabhörstelle des britischen Geheimdienstes."},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/Biled","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/68/Biled_jud_Timis.png","page_title":"Biled","context_page_description":"Biled sī Romania Timiş Koān ê chi̍t ê chū-tī-thé."},{"page_url":"https://fr.wikipedia.org/wiki/Thalheim_(Argovie)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/97/Karte_Gemeinde_Thalheim_AG_2020.png","page_title":"Thalheim (Argovie)","context_page_description":"Thalheim est une commune suisse du canton d'Argovie, située dans le district de Brugg."},{"page_url":"https://en.wikipedia.org/wiki/List_of_Carnegie_libraries_in_California","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6d/2009-0725-CA-ExeterPublicLibrary.jpg","page_title":"List of Carnegie libraries in California","context_page_description":"The following list of Carnegie libraries in California provides detailed information on United States Carnegie libraries in California, where 142 public libraries were built from 121 grants awarded by the Carnegie Corporation of New York from 1899 to 1917. In addition, academic libraries were built at two institutions."},{"page_url":"https://ca.wikipedia.org/wiki/Districte_de_Miraflores","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d8/Escudo_de_Miraflores%28Lima%29.png","page_title":"Districte de Miraflores","context_page_description":"Miraflores és un districte a la Província de Lima al Perú. Conegut per les seves àrees comercials, jardins, parcs i platges, és un dels districtes de classe alta que conformen la ciutat de Lima. L’actual alcalde és Manuel Masias."},{"page_url":"https://en.wikipedia.org/wiki/Frans_Hals_catalogue_raisonn%C3%A9,_1989","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a6/Frans_Hals_-_Portrait_of_a_woman_with_glove_in_right_hand.jpg","page_title":"Frans Hals catalogue raisonné, 1989","context_page_description":"The following is the list of 145 paintings indexed as autograph by Frans Hals, written by the art historian and Hals specialist Claus Grimm in 1989. The list is by catalogue number and is more or less in order of creation, starting from around 1610 when Hals began painting on his own. Most of these works are still considered autograph, though one has since been reattributed to Judith Leyster. In addition to this list, Grimm added comments and additional entries to Seymour Slive's lists of lost and doubtful paintings. He also rejected several Slive attributions, making his list is considerably shorter. The autograph catalogue entries are as follows:"},{"page_url":"https://sv.wikipedia.org/wiki/Clermont-en-Argonne","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/84/Map_commune_FR_insee_code_55117.png","page_title":"Clermont-en-Argonne","context_page_description":"Clermont-en-Argonne är en kommun i departementet Meuse i regionen Grand Est i nordöstra Frankrike. Kommunen ligger i kantonen Clermont-en-Argonne som tillhör arrondissementet Verdun. År 2009 hade Clermont-en-Argonne 1 570 invånare."},{"page_url":"https://fr.wikipedia.org/wiki/Liste_de_grimpeurs_et_d%27alpinistes","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b9/Chlo%C3%A9Graftiaux.jpg","page_title":"Liste de grimpeurs et d'alpinistes","context_page_description":"La liste de grimpeurs et d'alpinistes est la liste des personnes notables pour leurs activités d'alpinisme, d'escalade."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_personen_geboren_op_18_september","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5a/Kardinal_Heinrich_von_Frankenberg.jpg","page_title":"Lijst van personen geboren op 18 september","context_page_description":"Dit is een lijst van personen die geboren zijn op 18 september.\\nDe inhoud van deze pagina is gebaseerd op gegevens in Wikidata. Als er onvolkomenheden in deze lijst zitten, gelieve dan aldaar de gegevens aan te passen. Achter iedere persoon is hiervoor een link aanwezig met de aanduiding bewerken.\\nWijzigingen in Wikidata worden met enige regelmatigheid geautomatiseerd overgenomen naar deze pagina.\\n53 - Trajanus, Romeinse keizer, Romeins senator, gouverneur en praetor, staatsman en officier uit het Oude Rome bewerken\\n1434 - Eleonora Helena van Portugal, Portugese hertogin en koningin-gemalin, Keizer van het Heilige Roomse Rijk bewerken\\n1525 - Pedro Henriquez de Acevedo, Spaanse graaf, politicus en militair bewerken\\n1539 - Lodewijk IV van Nevers, Franse hertog, diplomaat bewerken\\n1587 - Francesca Caccini, zangeres, componist, dichter, luitspeler, schrijver, muzikant en operazangeres bewerken\\n1643 - Gilbert Burnet, theoloog, priester, historicus, politicus en taalkundige uit Schotland bewerken\\n1675 - Christiaan Albrecht van Brandenburg-Ansbach, markgraaf, heerser bewerken\\n1676 - Everhard Lodewijk van Württemberg, Duitse hertog, militair leider bewerken"},{"page_url":"https://sr.wikipedia.org/wiki/SIG_P226","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f4/SIGSAUER_MK25_AND_SUREFIREX300ULTRA.jpg","page_title":"SIG P226","context_page_description":"SIG Sauer P226 је немачки полуатоматски пиштољ развијен на бази SIG P220 али са већим капацитетом оквира. Пиштољ SIG P226 је попут свог претходника, синоним за прецизност, поузданост и квалитет. Овај пиштољ је стекао велику популарност и широку распрострањеност међу цивилима, а такође је пронашао своје место и као службено оружје у многим војскама и полицијама света.\\nНа бази пиштоља SIG P226 је развијен и домаћи ЦЗ99."},{"page_url":"https://fr.wikipedia.org/wiki/Milt_Buckner","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/77/Milt_Buckner_1953.jpg","page_title":"Milt Buckner","context_page_description":"Milt Buckner est un pianiste, organiste, vibraphoniste, compositeur et arrangeur de jazz américain né le 10 juillet 1915 à Saint-Louis et décédé le 27 juillet 1977 à Chicago\\nIl est le frère du saxophoniste Ted Buckner."},{"page_url":"https://br.wikipedia.org/wiki/Negev","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/81/NachalParan1.jpg","page_title":"Negev","context_page_description":"An Negev a zo un dezerzh e kreisteiz Israel."},{"page_url":"https://hu.wikipedia.org/wiki/Krist%C3%B3f_mecklenburgi_herceg","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f6/Schwerin_Dom_-_Grabmal_Christoph_zu_Mecklenburg_2.jpg","page_title":"Kristóf mecklenburgi herceg","context_page_description":"Kristóf mecklenburgi herceg Brandenburgi Anna mecklenburgi hercegnő és VII. Albert mecklenburgi herceg fia. 1554 és 1592 között ő volt Ratzeburg hercegi püspökségének adminisztrátora."},{"page_url":"https://ja.wikipedia.org/wiki/%E6%9D%B1%E5%A4%A7%E5%AF%BA%E6%B3%95%E8%8F%AF%E5%A0%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a6/NaraTodaiji0252.jpg","page_title":"東大寺法華堂","context_page_description":"東大寺法華堂は、奈良県奈良市の東大寺にある奈良時代建立の仏堂である。一般に三月堂として知られる。日本の国宝に指定されている。東大寺に現存する数少ない奈良時代建築の1つであり、堂内に安置する10体の仏像も奈良時代の作である。"},{"page_url":"https://en.wikipedia.org/wiki/Chedoke_Falls","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c0/ChedokeFalls.jpg","page_title":"Chedoke Falls","context_page_description":"Chedoke Falls is 15.5 metre urban ribbon waterfall found atop the Niagara Escarpment in Hamilton, Ontario, Canada.\\nThe watercourse is the Chedoke Creek, an urban creek that runs through the west end of Hamilton and crosses the Bruce Trail and the Radial Trail. Denlow Falls can be found nearby just east of Chedoke Falls.\\nNearby attractions include the Bruce Trail, the Canadian Football Hall of Fame Museum, and the FirstOntario Center.\\nLower Chedoke Falls is an irregular curtain waterfall found a few hundred metres north of the main Chedoke Falls. It is 16-metres in height and 31-metres wide."},{"page_url":"https://fr.wikipedia.org/wiki/Ligne_de_Gy%C3%A9k%C3%A9nyes_%C3%A0_P%C3%A9cs","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/98/Gy%C3%A9k%C3%A9nyes_station.JPG","page_title":"Ligne de Gyékényes à Pécs","context_page_description":"La ligne de Nagykanizsa à Pécs ou ligne 60 est une ligne de chemin de fer de Hongrie. Elle relie Nagykanizsa à Pécs."},{"page_url":"https://cs.wikipedia.org/wiki/Pu%C5%A1ti%C4%8Dka_pouzdernat%C3%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/91/Lindernia_procumbens.JPG","page_title":"Puštička pouzdernatá","context_page_description":"Puštička pouzdernatá, někdy také s českým jménem puštička rozprostřená, je drobná a nenápadná bylina, kriticky ohrožený hygrofyt. Roste na místech dlouhodobě zaplavených vodou, které jen na krátkou dobu vysychají. Je to druh rodu puštička a je chráněný v celé Evropské unii v rámci projektu Natura 2000."},{"page_url":"https://arz.wikipedia.org/wiki/%D9%85%D8%A7%D9%8A%D9%83%D9%84_%D9%85%D8%A7%D8%AB%D9%8A%D9%88%D8%B2_(%D9%84%D8%A7%D8%B9%D8%A8_%D8%B3%D8%A8%D8%A7%D9%82_%D8%B9%D8%AC%D9%84)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fe/Overijse_-_Brabantse_Pijl%2C_15_april_2015%2C_aankomst_%28B11%29.JPG","page_title":"مايكل ماثيوز (لاعب سباق عجل)","context_page_description":"مايكل ماثيوز لاعب سباق عجل من اوستراليا."},{"page_url":"https://az.wikipedia.org/wiki/Elbistan","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a4/Kahramanmara%C5%9F_districts.png","page_title":"Elbistan","context_page_description":"Elbistan Qəhrəmanmaraş ilinə bağlı ən böyük ilçedir. Aralıq dənizi, İç Anadolu və Şərqi Anadolu bölgələrinin kəsişdiyi nöqtədə yer alır. Şəhər mərkəzinin əhalisi təxminən olaraq 95.000'dir. TÜİK 2014-ci il əhali sayımına görə bütün ilçe əhalisi köyleriyle birlikdə 142.168 'dir."},{"page_url":"https://fr.wikipedia.org/wiki/Lucia_et_les_gouapes","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a8/Guappi-Cardinale.png","page_title":"Lucia et les gouapes","context_page_description":"Lucia et les gouapes est un film italien réalisé en 1974 par Pasquale Squitieri."},{"page_url":"https://he.wikipedia.org/wiki/%D7%A6%D7%91%D7%90_%D7%A9%D7%95%D7%95%D7%99%D7%99%D7%A5","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0b/Eingang_Festung_Reuenthal_IMG_1607.jpg","page_title":"צבא שווייץ","context_page_description":"צבא שווייץ הוא צבאה הלאומי של הקונפדרציה השווייצרית והארגון המרכזי במערכת הביטחון שלה. באופן מסורתי שווייץ היא מדינה נייטרלית וכבר למעלה ממאתיים שנה היא לא השתתפה באופן ממשי בעימותים צבאיים כנגד כוחות זרים. באופן עקרוני שווייץ נמנעת משותפות בבריתות צבאיות, ושואפת להבטיח את ביטחונה הלאומי וריבונותה באופן עצמאי. צבא שווייץ מתגאה במערכות נשק מתקדמות ותשתיות ביטחון נרחבות, והוא כולל צבא יבשה וחיל אוויר מתקדמים וגדולים יחסית, לצד כוח ימי קטן ומינימלי.\\nהמפקד העליון הנוכחי של הצבא הוא אנדרה בלאטמאן. בהתאם לחוקה הצבא כפוף לממשלה המרכזית של שווייץ. נכון ל-2019 ראש מחלקת ההגנה הפדרלית היא ויולה אמהרד."},{"page_url":"https://tr.wikipedia.org/wiki/Harju_(il)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2b/Harjumaa_municipalities.png","page_title":"Harju (il)","context_page_description":"Harju başkent Tallinn'in de içinde bulunduğu Estonya'nın en büyük vilâyetidir. Yüzölçümü 4,333 km², nüfusu ise 525,000 kadardır.\\nŞehir Belediyeleri:\\n1 Keila\\n2 Loksa\\n3 Maardu\\n4 Paldiski\\n5 Saue\\n6 Tallinn\\nBelde Belediyeleri:\\n7 Aegviidu\\n8 Anija\\n9 Harku\\n10 Jõelähtme\\n11 Keila\\n12 Kernu\\n13 Kiili\\n14 Kose\\n15 Kuusalu\\n16 Nissi\\n17 Padise\\n18 Raasiku\\n19 Rae\\n20 Saku\\n21 Saue\\n22 Vasalemma\\n23 Viimsi"},{"page_url":"https://si.wikipedia.org/wiki/%E0%B6%85%E0%B6%AD%E0%B7%92%E0%B6%A0%E0%B7%8A%E0%B6%A1%E0%B7%8F%E0%B6%AF%E0%B6%B1_%E0%B6%A2%E0%B7%8F%E0%B6%B1%E0%B6%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/Homo_sapiens-mtDNA~NC_012920-ATP8%2BATP6_Overlap.svg","page_title":"අතිච්ඡාදන ජානය","context_page_description":"අතිච්ඡාදන ජානයක් යනු තම ප්‍රකාශ්‍ය නියුක්ලියෝටයිඩ අනුපිළිවෙළ, තවත් ජානයක ප්‍රකාශ්‍ය නියුක්ලියෝටයිඩ අනුපිළිවෙළ අඩවශයෙන් අතිච්ඡාදනය කරන ජානයකි. මේ ආකාරයට නියුක්ලියෝටයිඩ අනුපිළිවෙළකට එකක් හෝ ඊට වැඩි ජාන ඵලයන් ගණනක ක්‍රියාකාරීත්වයට දායකත්වය සැපයිය හැක. අතිමුද්‍රණය ලෙස හැඳින්වෙන අතිච්ඡාදනයේ දී එක් ජානයක අනුපිළිවෙළක සියලු හෝ සමහර කොටස්, එකම පථයක ඇති අනෙක් ජානයේ විකල්ප කියවුම් රාමුවක් තුළ දී කියවිම සිදුවේ. අතිමුද්‍රණය යනු පවතින අනුපිළිවෙළ, ගෙනෝමයේ පැරණි ජාන හෝ පෙරාතුව පැවති කේත රහිත ප්‍රදේශ තුළින් අලුතින්ම නව ජාන මතුවීමේ යාන්ත්‍රණයක් ලෙස හඳුන්වනු ලැබේ. අතිමුද්‍රිත ජාන විශේෂයෙන්ම වෛරසවල ගෙනෝම සංවිධානයේ සුලභ ලක්ෂණයක් වන අතර, කුඩා වෛරස් ජාන තොරතුරු කට්ටලයක් තුළ පැවතිය හැකි ප්‍රකාශ්‍ය ජාන සංඛ්‍යාව විශාල ලෙස වැඩි කිරීමට සුදුසුය."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%8D%97%E9%83%A8%E7%94%BA_(%E5%92%8C%E6%AD%8C%E5%B1%B1%E7%B8%A3)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9b/Minabe-Bairin_Minabe_Wakayama05n4272.jpg","page_title":"南部町 (和歌山縣)","context_page_description":"南部町是位於日本和歌山縣中部的行政區劃。\\n轄區主要位於南部川流域，境內多為山區，僅在沿海的河川出海口有平地，主要市區位於南部川出海口東側的平原。\\n特產為梅，因此也衍伸出梅乾的加工產業，1950年代更改良開發出頂級品種南高梅；現在町公所為了以梅為中心拓展南部町的經濟，甚至還設立了「梅課」專責相關業務。"},{"page_url":"https://el.wikipedia.org/wiki/%CE%9C%CF%80%CF%85%CF%81%CE%BB%CE%B9%CE%BF%CE%BD%CE%BA%CE%BF%CF%8D%CF%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/33/Burlioncourt_l%27%C3%A9glise_Saint-L%C3%A9ger.JPG","page_title":"Μπυρλιονκούρ","context_page_description":"Το Μπουρλιονκούρ είναι μια κοινότητα στο νομό Μοζέλ στο Γκραντ Εστ στη βορειοανατολική Γαλλία."},{"page_url":"https://cs.wikipedia.org/wiki/Vincent_Hlo%C5%BEn%C3%ADk","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8d/Stretnutia_K_po%C3%A9zii.jpg","page_title":"Vincent Hložník","context_page_description":"Vincent Hložník byl slovenský malíř, grafik, ilustrátor, typograf a pedagog, bratr Ferdinanda Hložníka."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%90%D1%81%D0%BA%D0%B0%D0%BD%D1%96%D1%8F-%D0%9D%D0%BE%D0%B2%D0%B0_(%D0%B7%D0%B0%D0%BF%D0%BE%D0%B2%D1%96%D0%B4%D0%BD%D0%B8%D0%BA)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4f/Ostrich_and_chick.jpg","page_title":"Асканія-Нова (заповідник)","context_page_description":"Біосферний заповідник «Асканія-Нова» ім. Ф. Е. Фальц-Фейна — науково-дослідна установа в системі Національної академії аграрних наук України, державний заповідник, заснований в 1898 році Фрідріхом Фальц-Фейном.\\nРозташований біля міста Асканія-Нова Чаплинського району Херсонської області.\\nНазву місцевості дав один з її попередніх власників — герцог Фрідріх Фердинанд Ангальт-Кетен-Плесський у 1841 році на честь маєтку Асканії в Німеччині."},{"page_url":"https://en.wikipedia.org/wiki/Mathcad","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cd/Historical_MC15.jpg","page_title":"Mathcad","context_page_description":"Mathcad is computer software primarily intended for the verification, validation, documentation and re-use of engineering calculations. First introduced in 1986 on DOS, it was the first to introduce live editing of typeset mathematical notation, combined with its automatic computations."},{"page_url":"https://ceb.wikipedia.org/wiki/Yunhe_Qu","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f1/ChinaCangzhouYunhe.png","page_title":"Yunhe Qu","context_page_description":"Gatos ang Yunhe Qu sa Pangmasang Republika sa Tśina. Nahimutang ni sa prepektura sa Cangzhou Shi ug lalawigan sa Hebei Sheng, sa sidlakang bahin sa nasod, 180 km sa habagatan sa Beijing ang ulohan sa nasod. Adunay 308,454 ka molupyo. Ang populasyon sa naglangkob sa 154,534 ka babae ug 153,920 ka lalaki. Mga anak ubos sa edad nga 15 mao ang 14.0%, ang mga hamtong nga nag-edad 15-64 78%, ug mga tigulang labaw sa 65 7.0%.\\nYunhe Qu may sa mosunod nga mga subdibisyon:\\n水月寺街道\\n南环中路街道\\n南湖街道\\n市场街道\\n西环中街街道\\n公园街道\\n小王庄镇\\n南陈屯乡\\nAng klima klima sa kontinente. Ang kasarangang giiniton 13 °C. Ang kinainitan nga bulan Hulyo, sa 27 °C, ug ang kinabugnawan Enero, sa -4 °C. Ang kasarangang pag-ulan 705 milimetro matag tuig. Ang kinabasaan nga bulan Hulyo, sa 268 milimetro nga ulan, ug ang kinaugahan Enero, sa 3 milimetro."},{"page_url":"https://fi.wikipedia.org/wiki/Pallosimput","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/Cottunculus_microps1.jpg","page_title":"Pallosimput","context_page_description":"Pallosimput on simppukaloihin kuuluva heimo. Heimon kaloja tavataan syvistä vesistä kaikista lauhkeista ja lämpimistä valtameristä."},{"page_url":"https://zh.wikipedia.org/zh-mo/%E9%BB%8E%E7%89%99%E5%AF%A6%E6%AF%94%E5%B8%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ac/Ph_locator_albay_legazpi.png","page_title":"黎牙實比市","context_page_description":"黎牙實比市是一個位於菲律賓 呂宋島 比科爾行政區 阿爾拜省的城市。也是該省的首府所在城市。"},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkmale_in_Dessau-Ro%C3%9Flau","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/99/Dessau-Ro%C3%9Flau%2CUnruhstra%C3%9Fe.jpg","page_title":"Liste der Kulturdenkmale in Dessau-Roßlau","context_page_description":"In der Liste der Kulturdenkmale in Dessau-Roßlau sind alle Kulturdenkmale der kreisfreien Stadt Dessau-Roßlau und ihrer Ortsteile aufgelistet. Grundlage ist das Denkmalverzeichnis des Landes Sachsen-Anhalt, das auf Basis des Denkmalschutzgesetzes vom 21. Oktober 1991 durch das Landesamt für Denkmalpflege und Archäologie Sachsen-Anhalt erstellt und seither laufend ergänzt wurde."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%BE%8C%E5%A3%81%E5%8D%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3c/%E5%B4%81%E9%A0%82%E5%8B%B8%E5%96%84%E5%A0%82%E5%BB%9F%E5%85%A7%E7%81%AB%E9%A6%AC.jpg","page_title":"後壁區","context_page_description":"後壁區位於中華民國臺南市北端，北以八掌溪與臺灣省嘉義縣水上鄉、鹿草鄉、義竹鄉相鄰，東鄰白河區，西鄰鹽水區，南接新營區、東山區。本區地處嘉南平原中段，係由八掌溪及急水溪沖積而成，東北方地勢稍高，氣候屬熱帶季風氣候。在位置上緊鄰嘉義都會區，與嘉義都會區屬於同一生活圈，亦屬於大新營生活圈範圍，但因新營生活機能與嘉義市相比落差懸殊，故後壁往嘉義市的通勤比例亦相當高。於2018年以「米」「蘭」的故鄉、農作體驗、在地豐富的藝術創作榮獲交通部觀光局票選「臺灣三十經典小鎮」。"},{"page_url":"https://nl.wikipedia.org/wiki/Tirreno-Adriatico_2012","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/19/Tirreno_Adriatico_2012.png","page_title":"Tirreno-Adriatico 2012","context_page_description":"De Tirreno-Adriatico 2012 was de 47e editie van deze etappekoers die in Italië wordt verreden en maakte deel uit van de UCI World Tour 2012. De wedstrijd duurde van 7 tot en met 13 maart en bestond uit zeven etappes, waaronder een ploegentijdrit en een individuele tijdrit. Titelverdediger was de Australiër Cadel Evans."},{"page_url":"https://en.wikipedia.org/wiki/Andr%C3%A9_Kuipers","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1e/Soyuz-TMA-03M-Mission-Patch.png","page_title":"André Kuipers","context_page_description":"André Kuipers is a Dutch physician and ESA astronaut. He became the second Dutch citizen, third Dutch-born and fifth Dutch-speaking astronaut upon launch of Soyuz TMA-4 on 19 April 2004. Kuipers returned to Earth aboard Soyuz TMA-3 11 days later.\\nKuipers is the first Dutch astronaut to return to space. On 5 August 2009, Dutch minister of economic affairs Maria van der Hoeven, announced Kuipers was selected as an astronaut for International Space Station Expeditions 30 and 31. He was launched to space on 21 December 2011 and returned to Earth on 1 July 2012."},{"page_url":"https://hu.wikipedia.org/wiki/Els%C5%91_h%C3%B3_(id%C5%91j%C3%A1r%C3%A1si_esem%C3%A9ny)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/77/Snow_flakes_on_leaf.jpg","page_title":"Első hó (időjárási esemény)","context_page_description":"Az első hó kifejezést a köznyelvben arra a természeti jelenségre használjuk, amely a téli csapadék első szilárd formájú megjelenésével jár. Az első hó többnyire a téli időszak, vagy másik kifejezéssel élve a síszezon kezdetén lehullott első, legalább hólepel mennyiségben egy bizonyos ideig megmaradó összefüggő, vagy foltokban megmaradó hóréteget jelent.\\nUgyanakkor az első hó kifejezést használhatjuk az adott évben először lehulló hóra, vagy az adott földrajzi helyen a valaha mért, vagy hosszabb időszak elteltével bekövetkezett legelső hóesésre is. Ez utóbbi főleg szélsőséges időjárási körülmények közt, elsősorban a melegebb éghajlati övekbe tartozó területeken fordulhat elő.\\nAz első hó a magasabb területeken, a hegyvidékeken, vagy a fennsíkokon, illetve a sarkokhoz közelebb eső területeken jelenik meg a legkorábban. A sarkvidékeken és az örök hó határa fölött elhelyezkedő hegyvidéki területeken nem beszélhetünk első hóról, mivel az állandó fagypont alatti hőmérséklet következtében egész évben szilárd halmazállapotban hullik a csapadék."},{"page_url":"https://tl.wikipedia.org/wiki/Na_(kana)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a3/%E3%81%AA-bw.png","page_title":"Na (kana)","context_page_description":"Ang な sa hiragana o ナ sa katakana ay isa sa mga kanang Hapones na kumakatawan sa isang mora. Nabubuo ang hiraganang な sa apat na paghagod, at ang katakanang ナ sa dalawa. Kumakatawan itong dalawa sa [na]. Nagmula ang な at ナ sa man'yōganang 奈. Ginagamit ang な bilang bahagi ng okurigana para sa mga simpleng negatibong anyo ng mga pandiwang Hapones, at iilang mga negatibong anyo ng pang-uri."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%94%D0%B6%D1%83%D0%B4%D0%B8%D1%87%D0%B5,_%D0%A4%D1%80%D0%B0%D0%BD%D1%87%D0%B5%D1%81%D0%BA%D0%BE_%D0%B4%D0%B5%D0%BB%D1%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/72/Francesco_del_Giudice.jpg","page_title":"Джудиче, Франческо дель","context_page_description":"Франческо дель Джудиче — итальянский куриальный кардинал. Архиепископ Монреале с 14 января 1704 по 15 февраля 1725. Секретарь Верховной Священной Конгрегации Римской и Вселенской Инквизиции с 25 февраля 1719 по 10 октября 1725. Префект Священной Конгрегации церковного иммунитета с 5 мая 1724 по 10 октября 1725. Декан Священной Коллегии Кардиналов и префект Священной Конгрегации Церемониала с 12 июня 1724 по 10 октября 1725. Кардинал-священник с 13 февраля 1690, с титулом церкви Санта-Мария-дель-Пополо с 10 апреля 1690 по 30 марта 1700. Кардинал-священник с титулом церкви Санта-Сабина с 30 марта 1700 по 12 июля 1717. Кардинал-епископ Палестрины с 12 июля 1717 по 3 марта 1721. Кардинал-епископ Фраскати с 3 марта 1721 по 12 июня 1724. Кардинал-епископ Остии и Веллетри с 12 июня 1724 по 10 октября 1725."},{"page_url":"https://de.wikipedia.org/wiki/Verwaltungsgliederung_der_Zweiten_Polnischen_Republik","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cc/Polen_1920%E2%80%931939.png","page_title":"Verwaltungsgliederung der Zweiten Polnischen Republik","context_page_description":"Die Zweite Polnische Republik gliederte sich in 16 Woiwodschaften und die Hauptstadt Warschau. Diese Verwaltungsgliederung bestand von 1922 bis 1939, juristisch bis 1950."},{"page_url":"https://de.wikipedia.org/wiki/Eugen_B%C3%B6nsch","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/22/Eugen_Bonsch.jpg","page_title":"Eugen Bönsch","context_page_description":"Eugen Bönsch war einer der erfolgreichsten Jagdflieger der k.u.k. Luftfahrtruppen im Ersten Weltkrieg."},{"page_url":"https://en.wikipedia.org/wiki/Fog_collection","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c8/Atrapanieblas_en_Alto_Patache.jpg","page_title":"Fog collection","context_page_description":"Fog collection refers to the collection of water from fog using large pieces of vertical mesh net to make the fog-droplets flow down towards a trough below, known as a fog fence, fog collector or fog net. Through condensation, atmospheric water vapour from the air condenses on cold surfaces into droplets of liquid water known as dew. The phenomenon is most observable on thin, flat, exposed objects including plant leaves and blades of grass. As the exposed surface cools by radiating its heat to the sky, atmospheric moisture condenses at a rate greater than that of which it can evaporate, resulting in the formation of water droplets.\\nWater condenses onto the array of parallel wires and collects at the bottom of the net. This requires no external energy and is facilitated naturally through temperature fluctuation, making it attractive for deployment in less developed areas. The term fog fence comes from its long rectangular shape that resemble a fence, but fog collectors are not confined to only this style of structure. The efficiency of the fog collector is based on material of the net, the size of the holes and filament, and chemical coating."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%AD%D0%B2%D0%B0%D0%BD%D1%81,_%D0%91%D1%80%D1%8D%D0%B4","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/99/Austria_vs._USA_2013-11-19_%28088%29.jpg","page_title":"Эванс, Брэд","context_page_description":"Брэ́дли Рэй Э́ванс — американский футболист, полузащитник. Наиболее известен по выступлениям за клуб «Сиэтл Саундерс». Выступал за сборную США."},{"page_url":"https://ca.wikipedia.org/wiki/Ricard_Pinet_i_Salda%C3%B1a","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fc/1974_December_Gallecs_Children_Motorcycle_Course_MX_b.jpg","page_title":"Ricard Pinet i Saldaña","context_page_description":"Ricard Pinet i Saldaña fou un conegut comerciant gracienc i un membre actiu de diverses plataformes cíviques i esportives. És molt recordat per la seva implicació amb l'organització d'importants esdeveniments motociclistes durant prop de 50 anys, havent esdevingut tota una institució en la disciplina del trial a Catalunya.\\nDins el món associatiu ha deixat també una forta empremta en entitats com ara la Federació de Colles de Sant Medir, la Colla La Gardènia o l'associació l'Arca de Noè, en què hi representava la garsa."},{"page_url":"https://en.wikipedia.org/wiki/Arthur_Prentiss","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/12/Columbia_River_Highway_showing_Loops_at_Rowena_in_Wasco_county.JPG","page_title":"Arthur Prentiss","context_page_description":"Arthur M. Prentiss was an American photographer. Some of his photos are part of the Farm Security Administration - Office of War Information Collection held in the Library Of Congress and most of his work was developed in Oregon."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%92%D0%B8%D0%BA%D0%B8%D0%BF%D0%B5%D0%B4%D0%B8%D1%98%D0%B0_%D0%BD%D0%B0_%D0%BF%D0%BE%D1%99%D1%81%D0%BA%D0%BE%D0%BC_%D1%98%D0%B5%D0%B7%D0%B8%D0%BA%D1%83","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/db/Wikipedia-logo-v2-pl.svg","page_title":"Википедија на пољском језику","context_page_description":"Википедија на пољском језику је верзија Википедије на пољском језику, слободне енциклопедије, која данас има преко 950.000 чланака и заузима на листи Википедија 8. место."},{"page_url":"https://es.wikipedia.org/wiki/Paradoja_demogr%C3%A1fico-econ%C3%B3mica","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/TFR_vs_PPP_2009.svg","page_title":"Paradoja demográfico-económica","context_page_description":"El término paradoja demográfico-económica o paradoja económico-demográfica se refiere al hecho de que cuanto más acomodada y educada es una población o clase social, menos hijos tiene. Se produce una correlación inversa entre la riqueza y la fertilidad, tanto entre naciones como dentro de las naciones. Cuanto más altos sean el ingreso per cápita y el nivel de educación, más baja será la tasa de natalidad.\\nLa paradoja demográfico-económica señala que la reducción reproductiva surge naturalmente como consecuencia del progreso económico."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E5%AE%89%E4%B8%9C%C2%B7%E4%BC%8A%E4%B8%87%E8%AF%BA%E7%BB%B4%E5%A5%87%C2%B7%E9%82%93%E5%B0%BC%E9%87%91","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8c/Anton_Denikin_1918.jpg","page_title":"安东·伊万诺维奇·邓尼金","context_page_description":"安東·伊萬諾維奇·鄧尼金，俄羅斯帝國將領，俄國白軍領袖之一。"},{"page_url":"https://sh.wikipedia.org/wiki/K%C3%B6nigsfeld_(Oberfranken)","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f9/K%C3%B6nigsfeld_in_BA.svg","page_title":"Königsfeld (Oberfranken)","context_page_description":"Kenigsfeld je grad u njemačkoj saveznoj državi Bavarska. Jedno je od 36 opštinskih središta okruga Bamberg. Prema procjeni iz 2010. u gradu je živjelo 1.335 stanovnika. Posjeduje regionalnu šifru 9471151."},{"page_url":"https://es.wikipedia.org/wiki/Virgen_del_canciller_Rolin","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/33/Virgin_with_Chancellor_Rolin-Detail.jpg","page_title":"Virgen del canciller Rolin","context_page_description":"La Virgen del canciller Rolin es una pintura religiosa realizada en óleo sobre tabla por Jan van Eyck en 1435. Actualmente está expuesta en el Museo del Louvre en París, donde se exhibe con el título de La Vierge du chancelier Rolin."},{"page_url":"https://vi.wikipedia.org/wiki/Harihar","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/81/View_of_staggered_square_layout_of_mantapa_of_Harihareshwara_Temple_at_Harihar.jpg","page_title":"Harihar","context_page_description":"Harihar là một thị xã và là nơi đặt hội đồng thành phố của quận Davanagere thuộc bang Karnataka, Ấn Độ."},{"page_url":"https://en.wikipedia.org/wiki/2008_Chinese_milk_scandal","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4b/1025demonstration_4.jpg","page_title":"2008 Chinese milk scandal","context_page_description":"The 2008 Chinese milk scandal was a significant food safety incident in China. The scandal involved milk and infant formula along with other food materials and components being adulterated with melamine. The chemical was used to increase the nitrogen content of diluted milk, giving it the appearance of higher protein content in order to pass quality control testing. Of an estimated 300,000 victims, 6 babies died from kidney stones and other kidney damage and an estimated 54,000 babies were hospitalized.\\nThe scandal was first exposed on 16 July, after sixteen babies in Gansu Province were diagnosed with kidney stones. The babies were fed infant formula produced by the Shijiazhuang-based Sanlu Group, then one of the leading producers of infant formula in the country. After the initial focus on Sanlu, further government inspections revealed that products from 21 other companies were also tainted, including those from Arla Foods–Mengniu, Yili, and Yashili.\\nThe issue raised concerns about food safety and political corruption in China and damaged the reputation of the country's food exports."},{"page_url":"https://en.wikipedia.org/wiki/Roman_Catholic_Archdiocese_of_Wroc%C5%82aw","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e8/Friedrich-Kardinal.jpg","page_title":"Roman Catholic Archdiocese of Wrocław","context_page_description":"The Archdiocese of Wrocław is a Latin Rite archdiocese of the Catholic Church centered in the capital city Wrocław in Poland. From its founding as a bishopric in 1000 until 1821, it was under the Archbishopric of Gniezno in Greater Poland. From 1821 to 1930 it was subjected directly to the Apostolic See. Between 1821 and 1972 it was officially known as Diocese of Breslau."},{"page_url":"https://es.wikipedia.org/wiki/Parlamento_de_Quil%C3%ADn_(1641)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/89/Parlamento_de_Quilin_1641_-_Alonso_de_Ovalle.JPG","page_title":"Parlamento de Quilín (1641)","context_page_description":"El Parlamento de Quilín o Quillín, también llamado Paces de Quillén, fue una reunión masiva realizada el 6 de enero de 1641 junto al Río Quillén, actual Provincia de Cautín, de la que emanó el primer tratado de paz acordado entre mapuche y españoles, después de casi un siglo de lucha en la guerra de Arauco."},{"page_url":"https://en.wikipedia.org/wiki/Bellefontaine,_Ohio","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/62/Bellefontaine_Summit.jpg","page_title":"Bellefontaine, Ohio","context_page_description":"Bellefontaine\\nis a city in and the county seat of Logan County, Ohio, United States, located 48 miles northwest of Columbus. The population was 13,370 at the 2010 Census. It is the principal city of the Bellefontaine, OH Micropolitan Statistical Area, which includes all of Logan County. The highest point in Ohio, Campbell Hill, is within the city limits."},{"page_url":"https://bs.wikipedia.org/wiki/Lotar,_kralj_Zapadne_Frana%C4%8Dke","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dd/Monvoisin_-_Lothair_of_France.jpg","page_title":"Lotar, kralj Zapadne Franačke","context_page_description":"Lotar bio je karolinški kralj Zapadne Franačke od 954. do 986."},{"page_url":"https://el.wikipedia.org/wiki/%CE%9C%CE%AD%CE%B3%CE%B1%CF%82_%CE%9C%CE%AC%CE%B3%CE%B9%CF%83%CF%84%CF%81%CE%BF%CF%82_%CF%84%CE%BF%CF%85_%CE%9A%CF%85%CF%81%CE%AF%CE%B1%CF%81%CF%87%CE%BF%CF%85_%CE%A3%CF%84%CF%81%CE%B1%CF%84%CE%B9%CF%89%CF%84%CE%B9%CE%BA%CE%BF%CF%8D_%CE%A4%CE%AC%CE%B3%CE%BC%CE%B1%CF%84%CE%BF%CF%82_%CF%84%CE%B7%CF%82_%CE%9C%CE%AC%CE%BB%CF%84%CE%B1%CF%82","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/61/Geoffroy_le_Rat%2C_by_Laurent_Cars.jpg","page_title":"Μέγας Μάγιστρος του Κυρίαρχου Στρατιωτικού Τάγματος της Μάλτας","context_page_description":"Αυτός είναι ένας κατάλογος με τους Πρίγκιπες και Μεγάλους Άρχοντες του Κυρίαρχου Στρατιωτικού Τάγματος της Μάλτας συμπεριλαμβανομένων των μεσαιωνικών προκατόχων τους Ιωαννιτών Ιπποτών, ξεκινώντας από τον ιδρυτή Όσιο Γκέραρντ Τομ. Ο σημερινός Πρίγκιπας & Μέγας Άρχων, Τζάκομο ντάλα Τόρε, εκλεγείς στις 2 Μαΐου 2018."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_personen_geboren_in_1935","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2d/JackWelchApril2012.jpg","page_title":"Lijst van personen geboren in 1935","context_page_description":"Dit is een lijst van personen die geboren zijn in 1935.\\nDe inhoud van deze pagina is gebaseerd op gegevens in Wikidata. Als er onvolkomenheden in deze lijst zitten, gelieve dan aldaar de gegevens aan te passen. Achter iedere persoon is hiervoor een link aanwezig met de aanduiding bewerken.\\nWijzigingen in Wikidata worden met enige regelmatigheid geautomatiseerd overgenomen naar deze pagina."},{"page_url":"https://hu.wikipedia.org/wiki/Monteleone_Rocca_Doria","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/55/Monteleone_Roccadoria.jpg","page_title":"Monteleone Rocca Doria","context_page_description":"Monteleone Rocca Doria település Olaszországban, Szardínia régióban, Sassari megyében. Lakosainak száma 108 fő. Monteleone Rocca Doria Padria, Villanova Monteleone és Romana községekkel határos."},{"page_url":"https://en.wikipedia.org/wiki/Bobby_Bonds","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6a/Bobby_Bonds_1969.jpeg","page_title":"Bobby Bonds","context_page_description":"Bobby Lee Bonds was an American right fielder in Major League Baseball from 1968 to 1981, primarily with the San Francisco Giants. Noted for his outstanding combination of power hitting and speed, he was the first player to have more than two seasons of 30 home runs and 30 stolen bases, doing so a record five times, and was the first to accomplish the feat in both major leagues; he became the second player to hit 300 career home runs and steal 300 bases, joining Willie Mays. Together with Barry, he is part of baseball's most accomplished father-son combination, holding the record for combined home runs, RBIs, and stolen bases. A prolific leadoff hitter, he also set major league records for most times leading off a game with a home run in a career and a season; both records have since been broken."},{"page_url":"https://en.wikipedia.org/wiki/Oak_Cliff","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0d/Lakecliff0004.png","page_title":"Oak Cliff","context_page_description":"Oak Cliff is a neighborhood of Dallas, Texas, that was formerly a separate town in Dallas County; Dallas annexed Oak Cliff in 1901. It has since retained a distinct neighborhood identity as one of Dallas' older established neighborhoods.\\nOak Cliff has turn-of-the-20th century and mid-20th century housing, many parks, and is near the central business district of downtown Dallas.\\nThe boundaries of Oak Cliff are roughly Interstate 30 on the north, Loop 12 on the west, Interstate 45 on the east, the Trinity River on the northeast and Interstate 20 on the south."},{"page_url":"https://af.wikipedia.org/wiki/Suid-Afrikaanse_Poskantoor","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/Poststeen_-_20652172_-_RCE.jpg","page_title":"Suid-Afrikaanse Poskantoor","context_page_description":"Die Suid-Afrikaanse Poskantoor is die nasionale posdiens van Suid-Afrika en 'n staatsbeheerde onderneming. Sy enigste aandeelhouer is die Suid-Afrikaanse regering. In terme van die Suid-Afrikaanse reg, is die Poskantoor die enigste entiteit wat wettig toegelaat word om voorbehoude pos te aanvaar en bedryf as sodanig 'n monopolie.\\nDit het meer as 23 820 werknemers en bedryf meer as 2 486 posafsetpunte regoor die land. Daarom word daar 'n poskantoor in elke stad, dorp en byna elke gehug in Suid-Afrika aangetref."},{"page_url":"https://hu.wikipedia.org/wiki/Vr%C4%8De%C5%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/97/Vrcen_kostel_sv_Vavrince.JPG","page_title":"Vrčeň","context_page_description":"Vrčeň település Csehországban, a Dél-plzeňi járásban. Vrčeň Sedliště, Srby, Klášter, Nepomuk, Čížkov, Čmelíny és Tojice településekkel határos. Lakosainak száma 321 fő."},{"page_url":"https://hu.wikipedia.org/wiki/Siemens_Velaro","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/10/Renfe_clase_103.JPG","page_title":"Siemens Velaro","context_page_description":"A Siemens Velaro a német ICE 3 nagysebességű villamos motorvonat exportra szánt változata. A motorvonatokat a Siemens Mobility gyártja 2001-től.\\nA Velaro név a spanyol „nagysebesség” kifejezésből ered. A megbízói igényekhez továbbfejlesztett ICE 3 típus először Spanyolországba, a Spanyol Államvasutak megrendelésére került leszállításra.\\nAz 1990-es években, több cég közreműködésével is fejlesztett ICE 3 után a Velaro-t a Siemens egyedül fejlesztette ki - a fejlesztés gyakorlatilag teljes egészében az ICE 3 koncepción alapul.\\nA vonatok a német Erlangenben kerülnek fejlesztésre, és többségük a szintén német Krefeld-Uerdingen-ben megépítésre. A vonatok az üres váz elvre épülnek, azaz a forgóváz, a kocsi szerkezete és belső üres tere az eltérő típusok ellenére sem nagyon változik, a belső kialakítást viszont a megbízó igényeihez alakítják. A járművek váz-szerkezete szinte kizárólag alumíniumból épül fel.\\nA belső tér átalakításai szezonálisan is megvalósíthatók. Klasszikus kiépítésében a vonaton 510 férőhely található, ez a szám szükség esetén 1247 férőhelyre növelhető.\\nA vonatokon jellemzően a forgóvázak 50%-a hajtott."},{"page_url":"https://ca.wikipedia.org/wiki/Holly_Hill_(Florida)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fa/Holly_Hill_City_Hall01.jpg","page_title":"Holly Hill (Florida)","context_page_description":"Holly Hill és una població dels Estats Units a l'estat de Florida. Segons el cens del 2000 tenia una població de 12.119 habitants."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%92%D0%BE%D0%BB%D0%BB%D0%B5%D1%80%D0%B0%D1%83","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cc/Wappen_wollerau.png","page_title":"Воллерау","context_page_description":"Воллерау — коммуна в Швейцарии, в кантоне Швиц.\\nВходит в состав округа Хёфе. Население составляет 7010 человек. Официальный код — 1323."},{"page_url":"https://es.wikipedia.org/wiki/Magny-en-Vexin","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b2/Magny-en-Vexin_Notre-Dame-de-la-Nativit%C3%A9_263.JPG","page_title":"Magny-en-Vexin","context_page_description":"Magny-en-Vexin es una población y comuna francesa, en la región de Isla de Francia, departamento de Valle del Oise, en el distrito de Pontoise. Es el chef-lieu del cantón de Magny-en-Vexin."},{"page_url":"https://de.wikipedia.org/wiki/Pagani_Automobili","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/88/2010-Pagani-Zonda-Tricolore-4.jpg","page_title":"Pagani Automobili","context_page_description":"Die Pagani Automobili S.p.A. ist ein italienischer Kleinserienhersteller von Sportwagen mit Sitz in San Cesario sul Panaro nahe Modena."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_personen_overleden_in_1891","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f2/Johannes_Worp.jpg","page_title":"Lijst van personen overleden in 1891","context_page_description":"Dit is een lijst van personen die overleden zijn in 1891.\\nDe inhoud van deze pagina is gebaseerd op gegevens in Wikidata. Als er onvolkomenheden in deze lijst zitten, gelieve dan aldaar de gegevens aan te passen. Achter iedere persoon is hiervoor een link aanwezig met de aanduiding bewerken.\\nWijzigingen in Wikidata worden met enige regelmatigheid geautomatiseerd overgenomen naar deze pagina."},{"page_url":"https://it.wikipedia.org/wiki/Congregazioni_di_suore_di_diritto_pontificio","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/55/Pauline_mallinckrodt.jpg","page_title":"Congregazioni di suore di diritto pontificio","context_page_description":"Le congregazioni di suore di diritto pontificio, ordinate secondo la parola più caratteristica del titolo, come elencate nell'Annuario pontificio per l'anno 2017.\\nSuore Minime dell'Addolorata, fondate da santa Clelia Barbieri\\nSuore della Santissima Madre Addolorata, fondate da Amalia Streitel\\nSuore dell'Addolorata e della Santa Croce\\nSuore dell'Addolorata Serve di Maria di Pisa\\nSuore Adoratrici Ancelle del Santissimo Sacramento e della Carità, fondate da santa Maria Michela del Santissimo Sacramento\\nReligiose Adoratrici Perpetue Guadalupane\\nSuore Adoratrici del Santissimo Sacramento, di Rivolta d'Adda, fondate dal beato Francesco Spinelli\\nSuore Adoratrici del Santissimo Sacramento del Cuore Immacolato di Maria\\nSuore Adoratrici del Sangue di Cristo, di Acuto, fondate da santa Maria De Mattias\\nSuore dell'Adorazione Riparatrice\\nSuore dell'Adorazione del Sacro Cuore\\nSuore Agostiniane di Meaux\\nSuore Agostiniane Missionarie\\nSuore Agostiniane di Nostra Signora della Consolazione\\nSuore Agostiniane Recollette\\nSuore Agostiniane Recollette del Sacro Cuore di Gesù, del Venezuela, fondate dalla beata María Alvarado Cardozo\\nSuore Agostiniane Recollette Missionarie"},{"page_url":"https://ca.wikipedia.org/wiki/T%C3%BAnel_de_Markusbierg","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ee/Tunnel_Markusbierg_S%C3%BCdportal.jpg","page_title":"Túnel de Markusbierg","context_page_description":"El Túnel de Markusbierg és el nom que reben un parell de túnels paral·lels, que formen la part més oriental de l'autopista A13 a través de Luxemburg, prop del poble de Schengen. Els túnels tenen 1.575 metres de longitud i descendeixen cap a l'est, cap a la frontera alemanya en un gradient del 5%. L'extrem oriental del túnel es dirigeix directament a un viaducte que creua el riu Mosel·la que forma la frontera amb Alemanya. Els treballs de construcció es van iniciar el 15 de setembre de 1997 i els túnels es van obrir al tràfic el 24 de juliol de 2003, juntament amb la resta de A13. Els costos totals de la construcció van ser de € 65M, incloent 15 milions d'euros per a la instal·lació de sistemes de seguretat addicionals."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%81%D9%88%D9%82%D8%B3_%D9%83%D8%A7%D9%84%D9%8A%D9%81%D9%88%D8%B1%D9%86%D9%8A","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/52/Ascophyllum_nodosum.jpg","page_title":"فوقس كاليفورني","context_page_description":"فوقس كاليفورني هو نوع من الطلائعيات يتبع جنس الفوقس مسائي من فصيلة الفوقسية."},{"page_url":"https://ja.wikipedia.org/wiki/%E6%97%A5%E9%87%8E%E3%83%BBMH","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2b/Kanazawacity_Ladder.jpg","page_title":"日野・MH","context_page_description":"MHは日野自動車が製造するはしご車専用シャーシである。現在はしご車でトップシェアを誇っている。"},{"page_url":"https://nl.wikipedia.org/wiki/Carl_Hols%C3%B8e","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e4/Woman_at_a_sunny_window-Carl_Hols%C3%B8e.jpg","page_title":"Carl Holsøe","context_page_description":"Carl Vilhelm Holsøe was een Deens kunstschilder, vooral bekend door zijn schilderijen van interieurs."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E7%9F%B3%E7%B1%AC%E9%82%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/15/Shek_Lei_Market_Vegetable_and_Fruit_Stall%2C_Southeast_Asia_Food_Store.jpg","page_title":"石籬邨","context_page_description":"石篱邨，是香港新界葵青区上葵涌石梨贝一个公共屋邨，由房屋署总建筑师设计。全邨分成石篱邨及石篱邨，邨由雅居物业管理有限公司负责屋邨管理，邨则由创毅物业服务顾问有限公司负责管理。\\n石篱邨石宁楼、石秀楼、石俊楼、石逸楼及石兴楼，乃是26座问题公屋丑闻中葵青区受影响屋邨居民的其中一批次要安置公屋楼宇，其中最后者更接收了同邨的重建户。\\n怡峰苑是香港新界葵青区上葵涌两个居者有其屋计划屋苑之一，位于梨贝街对上的山坡上。原为石篱邨内其中一个篮球场，毗邻石篱邨石兴楼，共有两座楼宇，在1999年落成，总承建商为瑞安建业。"},{"page_url":"https://en.wikipedia.org/wiki/Eternal_Gosh!","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/27/Wai_Gyi_at_Vivo_V17_Pro_Promotion_Show_at_Mandalay_2019.jpg","page_title":"Eternal Gosh!","context_page_description":"Eternal Gosh! is a Burmese pop rock band, founded in 2013. The band consists of 5 members, lead vocalist and songwriter Han Nay Tar, lead guitarists Wai Gyi and Yee Mon Oo, bassist Bon Bon and drummer Ar Ray. They have been playing many different types of music with songs ranging from pop rock to alternative rock to alternative metal.\\nThe band attracted interest from major music labels and publishers. They were collaborated with i-Entertain Company and managed by Demo Thaw, co-founder and vice-president at i-Entertain. The band's first EP, Your Surprise Is Our Heartbeats was released in 2017. Their debut full-length album, The Red Sky was released on 5 October 2017 under Bo Bo Entertainment. The band's albums were published by Legacy Music Network. On 31 August, Eternal Gosh! performed FG LIVE LOUNGE Concert at Yay Kuu Amplified Broadcast Station."},{"page_url":"https://nl.wikipedia.org/wiki/A_Wrinkle_in_Time_(2018)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/A-wrinkle-in-time-59ecf0b243faa.png","page_title":"A Wrinkle in Time (2018)","context_page_description":"A Wrinkle in Time is een Amerikaanse fantasy-avonturenfilm uit 2018, geregisseerd door Ava DuVernay en geschreven door Jennifer Lee en Jeff Stockwell, gebaseerd op de gelijknamige roman uit 1962 van Madeleine L'Engle. De film is ook een remake van gelijknamige film uit 2003."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%AA%D8%A7%D8%A8%D9%88%D8%B1_%D8%A7%D9%84%D8%AD%D8%B1%D9%8A%D8%A9_%D8%A7%D9%84%D8%B9%D8%A7%D9%84%D9%85%D9%8A","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ef/Ni_Una_Menos_from_Raqqa.png","page_title":"تابور الحرية العالمي","context_page_description":"تابور الحرية العالمي هو مجموعة مسلحة تتألف من مقاتلين أجانب يساريين تقاتل من أجل وحدات حماية الشعب في الحرب الأهلية السورية دعما لثورة روج آفا وضد تنظيم الدولة الإسلامية. تم الإعلان عن تشكيل تابور الحرية العالمي في 10 يونيو 2015 في رأس العين. وقد أتى الإلهام لهذه المجموعة من الألوية الدولية للحرب الأهلية الإسبانية. وتشمل الإيديولوجيات السياسية للمقاتلين الماركسية–اللينينية، والخوجية، والماوية، واللاسلطوية."},{"page_url":"https://zh.wikipedia.org/wiki/%E6%96%B0%E5%9C%B0%E5%8C%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/19/Catedral_Luterana_de_Helsinki%2C_Finlandia%2C_2012-08-14%2C_DD_02.JPG","page_title":"新地区","context_page_description":"新地，或译为新陆，是芬兰的一个行政区。它和西南芬兰区、坎塔海梅区、派亚特海梅区、屈米河谷区接壤。芬兰的首都及最大的城市赫尔辛基以及连同其周围的大赫尔辛基地区，均位于新地内，因此新地也是芬兰人口最多的行政区，人口数量在2020年时近170万。2011年1月1日东新地区合并至新地区。\\n由于2019冠状病毒病疫情在新地区严重爆发，芬兰政府决定自2020年3月28日起对出入新地区做出限制，非必要的旅行将不允许出入新地区。限令在2020年4月15日解除。"},{"page_url":"https://es.wikipedia.org/wiki/Ripi","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4d/Montagne_Ripi.JPG","page_title":"Ripi","context_page_description":"Ripi es una localidad y comune italiana de la provincia de Frosinone, región de Lacio, con 5.451 habitantes."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%A0%D1%83%D1%81%D0%BA%D0%B8_%D0%B8_%D1%81%D1%8A%D0%B2%D0%B5%D1%82%D1%81%D0%BA%D0%B8_%D0%BF%D0%B0%D0%BC%D0%B5%D1%82%D0%BD%D0%B8%D1%86%D0%B8_%D0%B2_%D0%93%D0%B0%D0%B1%D1%80%D0%BE%D0%B2%D1%81%D0%BA%D0%B0_%D0%BE%D0%B1%D0%BB%D0%B0%D1%81%D1%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fd/%D0%A0%D1%83%D1%81%D0%BA%D0%B8_%D0%BF%D0%B0%D0%BC%D0%B5%D1%82%D0%BD%D0%B8%D0%BA_%D0%94%D1%80%D1%8F%D0%BD%D0%BE%D0%B2%D0%BE1.jpg","page_title":"Руски и съветски паметници в Габровска област","context_page_description":"Благоевградска област\\nБургаска област\\nВарненска област\\nВеликотърновска област\\nВидинска област\\nВрачанска област\\nГабровска област\\nДобричка област\\nКюстендилска област\\nКърджалийска област\\nЛовешка област\\nМонтанска област\\nПазарджишка област\\nПлевенска област\\nПловдивска област\\nРазградска област\\nРусенска област\\nСливенска област\\nСмолянска област\\nСофийска област\\nСофия-град\\nСтарозагорска област\\nТърговищка област\\nХасковска област\\nШуменска област"},{"page_url":"https://fa.wikipedia.org/wiki/%DA%A9%D9%88%D8%B1%D9%87_%D8%A7%D9%84%D9%82%D8%A7%D8%A6%DB%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4f/InductionFurnace.png","page_title":"کوره القائی","context_page_description":"کوره القایی دستگاهی صنعتی است که برای حرارت‌دهی یا ذوب‌کردن فلزاتی مانند آلومینیوم، فولاد، مس و آلیاژهای آهنی به روش گرمایش القایی به کار می‌رود."},{"page_url":"https://he.wikipedia.org/wiki/%D7%92%27%D7%95%D7%A8%D7%92%27_%D7%A4%D7%9C%D7%A0%D7%98%D7%92%27%D7%A0%D7%98,_%D7%93%D7%95%D7%9B%D7%A1_%D7%A7%D7%9C%D7%A8%D7%A0%D7%A1","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d6/George_of_York%2C_Duke_of_Clarence.jpg","page_title":"ג'ורג' פלנטג'נט, דוכס קלרנס","context_page_description":"ג'ורג' פלנטג'נט, דוכס קלרנס היה בנו השלישי של ריצ'רד פלנטג'נט, דוכס יורק ושל ססילי נוויל, ואחיהם של המלכים אדוארד הרביעי וריצ'רד השלישי.\\nג'ורג' השתתף במלחמת השושנים וכן הוא מוזכר במחזהו של ויליאם שייקספיר \\"ריצ'רד השלישי\\", בו הוא מוטבע בחבית של יין."},{"page_url":"https://en.wikipedia.org/wiki/Tui,_Pontevedra","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/Location_of_Tui.png","page_title":"Tui, Pontevedra","context_page_description":"Tui is a municipality in the province of Pontevedra in the autonomous community of Galicia, in Spain. It is situated in the comarca of O Baixo Miño. It is located on the right bank of the Miño River, facing the Portuguese town of Valença.\\nTwo bridges connect Tui and Valença: Tui International Bridge, completed in 1878 under the direction of Pelayo Mancebo, and a modern one from the 1990s. Both countries being signatories of the Schengen Treaty, there are normally no formalities in crossing what is the busiest border-point in Northern Portugal. The municipality of Tui is composed of 11 parishes: Randufe, Malvas, Pexegueiro, Areas, Pazos de Reis, Rebordáns, Ribadelouro, Guillarei, Paramos, Baldráns and Caldelas."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%95%D0%B2%D1%80%D0%B5%D0%B9%D1%81%D0%BA%D0%B0_%D0%BC%D0%B0%D1%85%D0%B0%D0%BB%D0%B0_(%D0%A1%D0%BA%D0%BE%D0%BF%D0%B8%D0%B5)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ee/Stara_slika_od_Evrejsko_maalo%2C.jpg","page_title":"Еврейска махала (Скопие)","context_page_description":"Еврейската махала, понякога наричан Чифутски квартал или Чифутана, е махала на столицата на Северна Македония Скопие, разположена в подножието на Скопското кале на брега на река Вардар като продължение на Пайко махала. До края на XIX век кварталът е една от най-бедните и консервативни части на Скопие. В началото на XX век, със забогатяването на неговите жители, започват да се появяват по-големи и по-хубави къщи с европейски архитектурни елементи и стилове. Такъв пример е Народният театър, чието изграждане трае от 1921 до 1927 година, както и сградата на скопската община, срутила се при земетресението от 1963 година.\\nКварталът губи еврейската си идентичност с депортирането на жителите му в концентрационния лагер Треблинка през март 1943 г. След земетресението кварталът е разрушен, а на негово място са направени улици и автогара, на чието място днес има музей, посветен на Холокоста."},{"page_url":"https://ca.wikipedia.org/wiki/Pintura_de_Portugal","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/BatalhaOurique.jpg","page_title":"Pintura de Portugal","context_page_description":"L'escassetat de relíquies pictòriques a Portugal anteriors al segle XV va dur a la formulació d'una creença segons la qual en aquest país la pintura va aflorar a partir del Renaixement, no obstant això, l'absència d'exemples concrets no significa que les societats locals de temps remots, precursores de l'actual estat portuguès, no practiquessin aquest art i que, contràriament al que sovint se suposa, la pintura de Portugal té una tradició antiquíssima. Malauradament, per diferents circumstàncies, la majoria de les obres produïdes abans de mitjans del període gòtic han desaparegut, i les poques que han sobreviscut són per aquest motiu molt preuades, sent com són els únics testimonis d'una tradició artística que es remunta a la prehistòria. A partir del Renaixement, de fet, coincidint amb l'etapa dels descobriments i de l'establiment de diverses colònies ultra-mar, les grans riqueses que van arribar a les metròpolis van servir com un poderós estímul per a la intensificació de l'intercanvi cultural i comercial amb la resta d'Europa i per un desenvolupament accelerat i important de totes les arts, beneficiant-se lògicament la pintura d'aquest nou context."},{"page_url":"https://en.wikipedia.org/wiki/Battle_of_Issus","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/93/Battle_issus_movements.png","page_title":"Battle of Issus","context_page_description":"The Battle of Issus occurred in southern Anatolia, on November 5, 333 BC between the Hellenic League led by Alexander the Great and the Achaemenid Empire, led by Darius III, in the second great battle of Alexander's conquest of Asia. The invading Macedonian troops defeated Persia. After the Hellenic League soundly defeated the Persian satraps of Asia Minor at the Battle of the Granicus, Darius took personal command of his army. He gathered reinforcements and led his men in a surprise march behind the Hellenic advance to cut their line of supply. This forced Alexander to countermarch, setting the stage for the battle near the mouth of the Pinarus River and the town of Issus."},{"page_url":"https://pl.wikipedia.org/wiki/Kaplica_%C5%9Bw._Rocha_w_%C5%BBebbu%C4%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/50/7K5A0743.saint.roque.jpg","page_title":"Kaplica św. Rocha w Żebbuġ","context_page_description":"Kaplica świętego Rocha – rzymskokatolicka kaplica w Ħaż-Żebbuġ na Malcie. Dziś mieści się w niej muzeum. Zarządcą kaplicy jest organizacja pozarządowa Din l-Art Ħelwa."},{"page_url":"https://en.wikipedia.org/wiki/Heptagrammic_prism_(7/3)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/81/Septagram_prism-3-7.png","page_title":"Heptagrammic prism (7/3)","context_page_description":"In geometry, the {7/3} heptagrammic prism is one of an infinite set of nonconvex prisms formed by square sides and two regular star polygon caps, in this case two {7/3} heptagrams."},{"page_url":"https://pl.wikipedia.org/wiki/Hettstedt","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/4f/Hettstedt_Kirche.jpg","page_title":"Hettstedt","context_page_description":"Hettstedt − miasto w Niemczech, w kraju związkowym Saksonia-Anhalt, w powiecie Mansfeld-Südharz. Leży ok. 40 km na północny zachód od miasta Halle i ok. 50 km na południe od stolicy kraju związkowego - Magdeburga. Miasto jest znane z wydobycia miedzi i z hutnictwa metali nieżelaznych.\\nNa północy miasto graniczy z Wiederstedt, dzielnicą miasta Arnstein, na wschodzie z Welfesholz, na południowy wschód ze Siersleben, na południu Großörner oraz na zachodzie z Meisberg."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%9C%D0%BE%D0%BB%D0%B5%D0%BA%D1%83%D0%BB%D0%B0%D1%80%D0%BD%D0%B0_%D0%BB%D0%BE%D0%B3%D0%B8%D1%87%D0%BA%D0%B0_%D0%BA%D0%BE%D0%BB%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3f/Three-input_AND_logic_gate.png","page_title":"Молекуларна логичка кола","context_page_description":"Молекуларно логичко коло је молекул који врши логичку операцију базирану на једном или више физичких или хемијских улаза и појединачном излазу. Ова област је напредовала од једноставних логичких система заснованих на јединственом хемијском или физичком инпуту до молекула способнх за комбинаторне и секвенцијалне операције, као што су аритметичке операције, тј. молекули и алгоритми за меморисање меморије.\\nЗа логичка кола са једним улазом постоје четири могућа излазна обрасца. Када је улаз 0, излаз може бити или 0 или 1. Када је улаз 1, излаз може поново бити 0 или 1. Четири излазни битови који се могу појавити одговарају специфичном логичком типу: ПРОЛАЗ 0, ДА, НЕ и ПРОЛАЗ 1. ПРОЛАЗ 0 увек излази 0, без обзира на улаз. ПРОЛАЗ 1 увек излази 1, без обзира на улаз. ДА излази 1 када је улаз 1, а НЕ је инверзан ДА - он излази 0 када је унос 1. Пример за логичку капију ДА је молекуларна структура приказана испод. Излаз '1' се даје само када су натријумови јони присутни у раствору.\\nМолекуларна логичка кола раде са улазним сигналима базираним на хемијским процесима и излазним сигналима заснованим на спектроскопији."},{"page_url":"https://ro.wikipedia.org/wiki/Lista_monumentelor_istorice_din_jude%C8%9Bul_Neam%C8%9B","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7a/RO_NT_Vanatori-Neamt_Church_of_the_Holy_Archangels.jpg","page_title":"Lista monumentelor istorice din județul Neamț","context_page_description":"Lista monumentelor istorice din județul Neamț cuprinde monumentele istorice din județul Neamț înscrise în Patrimoniul cultural național al României. Lista completă este menținută și actualizată periodic de către Ministerul Culturii, Cultelor și Patrimoniului Național din România, ultima versiune datând din 2015."},{"page_url":"https://pl.wikipedia.org/wiki/Gajewo_(powiat_drawski)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ee/Gajewo.jpg","page_title":"Gajewo (powiat drawski)","context_page_description":"Gajewo – wieś w Polsce położona w województwie zachodniopomorskim, w powiecie drawskim, w gminie Drawsko Pomorskie. W latach 1975–1998 miejscowość administracyjnie należała do województwa koszalińskiego. W roku 2007 wieś liczyła 11 mieszkańców. Miejscowość wchodzi w skład sołectwa Zagozd.\\nW miejscowości działało Państwowe Gospodarstwo Rolne Gajewo."},{"page_url":"https://pt.wikipedia.org/wiki/Mortes_em_dezembro_de_2016","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/12/George_Michael_Symphonica_%2810%29.jpg","page_title":"Mortes em dezembro de 2016","context_page_description":"Mortes em 2016: ← Janeiro – Fevereiro – Março – Abril – Maio – Junho – Julho – Agosto – Setembro – Outubro – Novembro – Dezembro →\\nEsta é uma relação de pessoas notáveis que morreram durante o mês de dezembro de 2016, listando nome, nacionalidade, ocupação e ano de nascimento."},{"page_url":"https://hr.wikipedia.org/wiki/Ju%C5%BEna_Koreja","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/06/Korean_Peninsula_at_night_-_2012_-_NASA.png","page_title":"Južna Koreja","context_page_description":"Južna Koreja je država u Istočnoj Aziji. Zauzima južni dio Korejskog poluotoka, a nastala je u doba Hladnog rata kada je poluotok podijeljen na komunistički sjever i kapitalistički jug. Ima kopnenu granicu samo sa Sjevernom Korejom. Izlazi na Japansko more na istoku, Istočno kinesko more na jugu i Žuto more na zapadu. Ima 2413 km morske obale. Službeno pismo je Hangul, koje je stvorio kralj Sejong Veliki 1443. godine."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%A4%A9%E4%B8%BB%E6%95%99%E5%B8%83%E7%9B%A7%E7%93%A6%E6%95%99%E5%8D%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7c/Cathedrale_St_Louis_vue_d%27en_bas.jpg","page_title":"天主教布盧瓦教區","context_page_description":"天主教布卢瓦教区是法国一个罗马天主教教区。属图尔总教区。\\n教区范围包括卢瓦尔-谢尔省。2012年有教友185,097人，占辖区总人口54.7%。教区下辖293个堂区，有九十五名司铎。现任教区主教为莫里斯·勒贝格·德热米尼。\\n教区成立于1697年7月1日，1801年11月29日被并入奥尔良教区。1822年10月6日恢复，2002年12月16日前属布尔日总教区。"},{"page_url":"https://it.wikipedia.org/wiki/Teresa_Jim%C3%A9nez-Becerril_Barrio","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a1/Teresa_Jim%C3%A9nez-Becerril_Barrio_%28Martin_Rulsch%29_1.jpg","page_title":"Teresa Jiménez-Becerril Barrio","context_page_description":"Teresa Jiménez-Becerril Barrio è una politica spagnola."},{"page_url":"https://uk.wikipedia.org/wiki/100_%D0%BD%D0%B0%D0%B9%D0%B2%D0%B8%D0%B4%D0%B0%D1%82%D0%BD%D1%96%D1%88%D0%B8%D1%85_%D1%80%D1%83%D0%BC%D1%83%D0%BD%D1%96%D0%B2","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5f/Ilie_Nastase.jpg","page_title":"100 найвидатніших румунів","context_page_description":"У 2006 році румунський телеканал оголосив про голосування, метою якого було визначення ста найвидатніших представників румунського народу. Голосування проводилося в рамках телепроекту «Великі Румуни», аналогічного англійського проекту «100 найвидатніших британців». 21 жовтня 2006 року організатори голосування оголосили, що найбільшу кількість голосів за результатами голосування отримав Стефан III Великий. Він отримав перше місце і був названий «найвидатнішим румуном всіх часів і народів»."},{"page_url":"https://ro.wikipedia.org/wiki/Toma_T._Socolescu","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/92/TomaTSocolescu-Attribuable-Ploiesti-CasaStradaCantacuzinoNr17-2.jpg","page_title":"Toma T. Socolescu","context_page_description":"Toma T. Socolescu a fost un arhitect român, reprezentant al arhitecturii autohtone de la începutul secolului al XX-lea până la începutul celui de-al Doilea Război Mondial. Și-a consacrat întreaga viață dezvoltării județului Prahova și, în special, a orașului Ploiești, prin fondarea Bibliotecii Nicolae Iorga a Muzeului Județean de Artă Prahova „Ion Ionescu-Quintus”, contribuind totodată la viața culturală a României. Printre cele mai importante construcții proiectate se numără Catedrala Sfântul Ioan Botezătorul, Halele Centrale, Palatul de Justiție, Palatul Școalelor Comerciale, Banca Creditul Prahovei și Cinematograful Scala.\\nA fost primarul Ploieștiului în perioada decembrie 1919 – martie 1920, iar în 1927 s-a stabilit la Păulești, comună al cărei primar a fost între anii 1938 și 1945 și a cărei infrastructură a dezvoltat-o.\\nÎn perioada comunistă, nedorind să se afilieze Partidului Comunist, familia sa a fost persecutată de către Securitate, el a fost evacuat din casa sa de la Păulești iar bunurile i-au fost confiscate. S-a mutat la București, unde a și murit în 1960."},{"page_url":"https://lt.wikipedia.org/wiki/Nepirk_prek%C4%97s_rusi%C5%A1kos","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/20/Baner_bridge_Kyiv.JPG","page_title":"Nepirk prekės rusiškos","context_page_description":"„Nepirk rusiškos prekės!“ arba „Boikotuokite rusiškas prekes!“ – nesmurtinio pasipriešinimo kampanija, siūlanti boikotuoti rusišką verslą Ukrainoje. Protestas prasidėjo 2013 m. rugpjūčio 14 d. kaip reakcija į Rusijos Federacijos importo embargą prieš Ukrainą. Boikotą suorganizavo Vidsich socialiniuose tinkluose. Kampanija išsiplėtė iki masinio brošiūrų, plakatų ir lipdukų dalinimo daugiau nei 45 miestuose ir miesteliuose. Prislopinta prasidedančių Euromaidano demonstracijų 2013 m. lapkritį, buvo atnaujinta 2014 m. kovo 2 d. Krymo krizės ir Rusijos kariuomenės intervencijos Ukrainoje metu."},{"page_url":"https://pl.wikipedia.org/wiki/John_Harding","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/83/Harding_of_Petherton.JPG","page_title":"John Harding","context_page_description":"John Harding, właśc. Allan Francis Harding, baron Harding of Petherton – brytyjski wojskowy oraz urzędnik kolonialny, marszałek polny. Żołnierz obu wojen światowych, w latach 1952–1955 naczelny dowódca British Army, w latach 1955–1957 gubernator Cypru. Od 1958 r. 1. baron Harding of Petherton."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%9C%D0%BE%D0%B4%D0%B5%D0%BB%D0%B8_%D0%BD%D0%B0_%D0%90%D1%83%D0%B4%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/99/Audi-RS4.jpg","page_title":"Модели на Ауди","context_page_description":"Кратко описание на моделите на Ауди."},{"page_url":"https://en.wikipedia.org/wiki/United_States_Air_Force_Security_Forces_Shield","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0f/070718-F-JZ502-471.jpg","page_title":"United States Air Force Security Forces Shield","context_page_description":"The Air Force Security Forces Shield is a military badge of the United States Air Force Security Forces. Originally known as the \\"Air Police Shield\\" and the \\"Security Police Shield\\", the Air Force Security Forces Shield has existed since the early 1960s. For males, the shield is worn in the center of the left shirt pocket of all Air Force uniforms. For females, the shield is worn above the nametag, on the wearer’s right side. The Security Forces shield is the primary identification for officers and enlisted members of the Air Force Security Forces.\\nThe Air Force Security Forces Shield is considered a symbol of legal authority and Force Protection on Air Force Installations. The shield is awarded to all Security Forces members upon graduation from the Security Forces Academy.\\nA similar decoration to the Air Force Security Forces shield is the Air Force Fire Protection Badge."},{"page_url":"https://ro.wikipedia.org/wiki/Silberhausen","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0b/Wappen_Silberhausen.png","page_title":"Silberhausen","context_page_description":"Silberhausen este o comună din landul Turingia, Germania."},{"page_url":"https://en.wikipedia.org/wiki/Hildegard_of_Bingen","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0c/Hildegard_von_Bingen._Line_engraving_by_W._Marshall._Wellcome_V0002761.jpg","page_title":"Hildegard of Bingen","context_page_description":"Hildegard of Bingen OSB, also known as Saint Hildegard and the Sibyl of the Rhine, was a German Benedictine abbess, writer, composer, philosopher, Christian mystic, visionary, and polymath. She is one of the best-known composers of sacred monophony, as well as the most-recorded in modern history. She has been considered by many in Europe to be the founder of scientific natural history in Germany.\\nHildegard's fellow nuns elected her as magistra in 1136; she founded the monasteries of Rupertsberg in 1150 and Eibingen in 1165. She wrote theological, botanical, and medicinal texts, as well as letters, liturgical songs for women choirs to sing and poems, while supervising miniature illuminations in the Rupertsberg manuscript of her first work, Scivias. There are more surviving chants by Hildegard than by any other composer from the entire Middle Ages, and she is one of the few known composers to have written both the music and the words. One of her works, the Ordo Virtutum, is an early example of liturgical drama and arguably the oldest surviving morality play. She is also noted for the invention of a constructed language known as Lingua Ignota."},{"page_url":"https://de.wikipedia.org/wiki/Kristian_Kojola","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0c/Kristian_Kojola_1.jpg","page_title":"Kristian Kojola","context_page_description":"Kristian Kojola ist ein finnischer Fußballspieler."},{"page_url":"https://en.wikipedia.org/wiki/Citatah_Cliffs","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/96/Citatah_Cliff_125_Meters.jpg","page_title":"Citatah Cliffs","context_page_description":"Citatah Cliff is a row of cliffs located in Citatah, West Bandung regency, West Java, Indonesia. Its exact location is at 5 km Padalarang. With the morphology of hilly area and formed largely of limestone, Citatah looks different from other hills in general.\\nCitatah was once the subject of discussion in various local and national media, after KRBC conducted a study on this area. Some of KRBC's phenomenal discoveries were the discovery of an ancient site in the Pawon Cave on December 9, 2000. For the first time, tools made of stones and bones, earthenware, bone remnants, and animal teeth were discovered in Pawon Cave located at Pasir Pawon, which still in the area of Citatah karst.\\nCitatah is a very productive limestone mining area. This mining has been operated since the mid-19th century and still continues until now. By using more sophisticated tools and dynamite to blow up parts of the hills containing limestone, mining activity in this area has brought adverse impact on Citatah environment.\\nGenerally, there are three cliffs in Citatah which are Citatah Cliff 48, Citatah Cliff 90 and Citatah Cliff 125. The name itself is a representative of their height."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%8F%D0%B5%D1%80%D0%B5%D0%BC%D0%B8_%D0%9A%D0%BE%D1%80%D0%B1%D0%B8%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/eb/Jeremy_Corbyn_leadership_election_rally_August_2016.jpg","page_title":"Џереми Корбин","context_page_description":"Џереми Бернард Корбин је британски политичар. Био је лидер Лабуристичке странке и опозиције од 2015. до 2020. године. Члан је Парламента Велике Британије од 1983. године.\\nИзбор Корбина за лидера Лабуристичке странке у Великој Британији се сматра великим изненађењем у модерној политичкој историји ове земље.\\nКорбин се изјашњава као демократски социјалиста."},{"page_url":"https://he.wikipedia.org/wiki/%D7%94%D7%A9%D7%91%D7%A2%D7%AA_%D7%A0%D7%A9%D7%99%D7%90_%D7%A8%D7%95%D7%A1%D7%99%D7%94","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a4/Red_copy_of_the_Russian_constitution.jpg","page_title":"השבעת נשיא רוסיה","context_page_description":"השבעה נשיא הפדרציה הרוסית היא האירוע הרשמי לציון תחילת כהונה חדשה בת שש שנים של נשיא הפדרציה הרוסית. ההשבעה מתקיימת עבור כל תקופת כהונה, גם כאשר הנשיא ממשיך בתפקיד לתקופת כהונה שנייה. את שבועת המשרה עצמה מנהל נשיא בית המשפט לחוקה בהתאם לחוקת רוסיה הקובעת, כי על הנשיא להישבע אמונים לפני שיוכל להתחיל בתפקידו. לאורך השנים, הורחב טקס ההשבעה מאירוע פשוט ליום שלם של טקסים חגיגיים, הכולל מצעדים, נאומים ונשפים.\\nטקס ההשבעה של נשיא רוסיה, נערך עם סיום ששת שנות הכהונה של נשיא הפדרציה הרוסית שנבחר בבחירות הקודמות, או ב-30 יום שלאחר הכרזת ועדת הבחירות המרכזית על תוצאות הבחירות לנשיאות רוסיה. מאז שנת 2000 יום השבעתו לתפקיד של הנשיא הוא 7 במאי, כאשר כהונת הנשיא מתחילה ב-10 בצהריים באותו יום, או ב-11:45. מאחר שה-7 במאי הוא יום השנה של משמר הקרמלין, נהוג כי הנשיא לאחר טקס ההשבעה סוקר את המשמר ומברך את חיילי המשמר לרגל חגו של המשמר.\\nההשבעה האחרונה שהתקיימה היא השבעתו של ולדימיר פוטין, ביום שני, ה-7 במאי 2018, שציינה את תחילת הכהונה שלו כנשיא, לאחר שנבחר לתפקיד בפעם הרביעית."},{"page_url":"https://en.wikipedia.org/wiki/Technology_and_society","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/85/Doel_Kerncentrale.JPG","page_title":"Technology and society","context_page_description":"Technology society and life or technology and culture refers to inter-dependency co-dependence, co-influence, and co-production of technology and society upon one another. Evidence for this synergy has been found since humanity first started using simple tools. The inter-relationship has continued as modern technologies such as the printing press and computers have helped shape society. The first scientific approach to this relationship occurred with the development of tektology, the \\"science of organisation\\" in early twentieth century Imperial Russia. In moden academia the interdisciplinary study of the mutual impacts of science, technology, and society, is called science and technology studies.\\nThe simplest form of technology is the development and use of basic tools. The prehistoric discovery of how to control fire and the later Neolithic Revolution increased the available sources of food, and the invention of the wheel helped humans to travel in and control their environment. Developments in historic times, including the printing press, the telephone, and the Internet, have lessened physical barriers to communication and allowed humans to interact freely on a global scale."},{"page_url":"https://it.wikipedia.org/wiki/Oltressenda_Alta","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cf/Oltressenda_Alta_Baite_Moschel_02.jpg","page_title":"Oltressenda Alta","context_page_description":"Oltressenda Alta è un comune sparso italiano di 146 abitanti della provincia di Bergamo, in Lombardia. Composto da due frazioni situate nella valle del torrente Ogna, laterale della Val Seriana, dista circa 37 chilometri a nord-est dal capoluogo orobico. La sede comunale è posta nel nucleo di Nasolino, mentre l'altro borgo è Valzurio."},{"page_url":"https://de.wikipedia.org/wiki/Nang_Yai","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/ba/Ratchaburi_Shadow_Puppet_Museum_%28Wat_Khanon%29_4.jpg","page_title":"Nang Yai","context_page_description":"Nang yai, auch nang luang, früher nang, ist eine zu den Schattenspielen gezählte Schauspielgattung mit großen Bildtafeln aus Pergament, die im Zentrum Thailands um die Hauptstadt Bangkok gepflegt wird. Die unbeweglichen Figurenplatten werden von jeweils einem Akteur getragen und tänzerisch zur Musik bewegt. Bei der häufigeren nächtlichen Form, dem eigentlichen nang yai, tanzen die Spieler vor und hinter einem von hinten beleuchteten Bildschirm. Beim selteneren nang rabam agieren die Spieler nachmittags bis abends ausschließlich vor dem Schirm. Beide Aufführungspraktiken der höfischen Tradition unterscheiden sich vom üblichen Schattenspiel mit kleineren Figuren, von denen nur die Schatten zu sehen sind. Dieses in Thailand häufiger gespielte nang talung ist eine jüngere Entwicklung der Volksunterhaltung und stammt aus dem Süden des Landes. Anders als die übrigen Schattenspiele Südostasiens hat das nang yai keine rituelle Bedeutung, sondern dient rein der Unterhaltung. Inszeniert werden üblicherweise Episoden aus dem Ramakian."},{"page_url":"https://no.wikipedia.org/wiki/Seongnam","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cc/Bundang_Jeongja.jpg","page_title":"Seongnam","context_page_description":"Seongnam er en by i provinsen Gyeonggi i Sør-Korea."},{"page_url":"https://en.wikipedia.org/wiki/Nike-X","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/99/Sprint-i-box.jpg","page_title":"Nike-X","context_page_description":"Nike-X was an anti-ballistic missile system designed in the 1960s by the United States Army to protect major cities in the United States from attacks by the Soviet Union's intercontinental ballistic missile fleet during the Cold War. The X in the name referred to its experimental basis and was supposed to be replaced by a more appropriate name when the system was put into production. This never came to pass; in 1967 the Nike-X program was canceled and replaced by a much lighter defense system known as Sentinel.\\nThe Nike-X system was developed in response to limitations of the earlier Nike Zeus system. Zeus' radars could only track single targets, and it was calculated that a salvo of only four ICBMs would have a 90% chance of hitting a Zeus base. The attacker could also use radar reflectors or high-altitude nuclear explosions to obscure the warheads until they were too close to attack, making a single-warhead attack highly likely to succeed. Zeus would have been useful in the late 1950s when the Soviets had only a few dozen missiles, but would be of little use by the early 1960s when it was believed they would have hundreds."},{"page_url":"https://hu.wikipedia.org/wiki/M%C3%A9ra_(Kolozs_megye)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/Merai_templom_torony%2C_t%C3%A9len.jpg","page_title":"Méra (Kolozs megye)","context_page_description":"Méra erdélyi falu Kolozs megyében, Kalotaszeg tájegységben."},{"page_url":"https://nl.wikipedia.org/wiki/Mirandesa","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/77/Vaca_ra%C3%A7a_mirandesa.JPG","page_title":"Mirandesa","context_page_description":"De Mirandesa is een runderras dat van oorsprong uit de Portugese regio Miranda do Douro komt. Het ras wordt voornamelijk gefokt voor vlees. Tegenwoordig leven deze runderen vooral in het district Bragança."},{"page_url":"https://fr.wikipedia.org/wiki/Augustin_Fran%C3%A7ois_Lema%C3%AEtre","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/92/Goze_tour_des_Geants_Lemaitre_Univers_pittoresque_n01.jpg","page_title":"Augustin François Lemaître","context_page_description":"Augustin François Lemaître, né en septembre 1797 à Paris et mort le 25 février 1870 dans la même ville, est un graveur, lithographe, dessinateur, éditeur et photographe français. Il réalisa de nombreux dessins, estampes, et des réalisations de planches de cuivre et d'acier gravées ainsi que la publication d'ouvrages notamment chez l'éditeur Firmin Didot Frères. Il représenta de nombreux paysages, monuments, architectures et personnages, notamment lors de ses nombreux voyages à travers l'Europe."},{"page_url":"https://es.wikipedia.org/wiki/Puerto_de_Kaohsiung","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/49/Scooters_alighting_from_KCS_Cigu_Ferry_20080404.jpg","page_title":"Puerto de Kaohsiung","context_page_description":"El Puerto de Kaohsiung es el puerto más grande de Taiwán. Manejó alrededor de 10 millones de TEU en 2007.​ El puerto se localiza al sur de Taiwán, junto a la ciudad de Kaohsiung, rodeado por las ciudades Gushan, Yancheng, Lingya, Cianjhen, Siaogang y Cijin. Es administrado por la Kaohsiung Harbor Bureau, una división del Ministerio de transporte del Yuan Ejecutivo, el gobierno central de Taiwán."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkmale_in_Berlin-Prenzlauer_Berg","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/12/Pappelallee_5_%28Berlin-Prenzlauer_Berg%29.jpg","page_title":"Liste der Kulturdenkmale in Berlin-Prenzlauer Berg","context_page_description":"In der Liste der Kulturdenkmale von Prenzlauer Berg sind die Kulturdenkmale des Berliner Ortsteils Prenzlauer Berg im Bezirk Pankow aufgeführt."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%9F%D0%BB%D0%B0%D0%BD%D0%B8%D0%BD%D0%B0%D1%80%D1%81%D0%BA%D0%B8_%D0%B4%D0%BE%D0%BC_%D0%94%D0%BE%D1%98%D0%BA%D0%B8%D0%BD%D1%86%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/69/%D0%9F%D0%BB%D0%B0%D0%BD%D0%B8%D0%BD%D0%B0%D1%80%D1%81%D0%BA%D0%B8_%D0%B4%D0%BE%D0%BC_%D0%94%D0%BE%D1%98%D0%BA%D0%B8%D0%BD%D1%86%D0%B8_03.jpg","page_title":"Планинарски дом Дојкинци","context_page_description":"Планинарски дом Дојкинци се налази у селу Дојкинци на 40 км од Пирота.\\nДом је настао 2016. године реконструкцијом и проширивањем старе војне карауле, чиме је овај крај добио тренутно најмодернији и најопремљенији планинарски дом у Србији.\\nДом је дат на управљање Туристичкој организацији града Пирота."},{"page_url":"https://cy.wikipedia.org/wiki/Heflin,_Alabama","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/Paul_D._Adams_portrait.jpg","page_title":"Heflin, Alabama","context_page_description":"Dinas yn Cleburne County, yn nhalaith Alabama, Unol Daleithiau America yw Heflin, Alabama. ac fe'i sefydlwyd ym 1882.\\nCeir 9 cylchfa amser yn UDA, ac mae hon yn perthyn i'r cylchfa amser a elwir yn: UTC−06:00."},{"page_url":"https://ko.wikipedia.org/wiki/%EB%8B%88%EB%88%84%EC%8A%A4","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/30/Ninus.png","page_title":"니누스","context_page_description":"니누스는 일반적으로 니네베의 창건자로 여겨진다.\\n그는 벨루스의 아들로 사냥개 훈련과 말의 조련 등으로 알려져 있으며, 때로 그리스 신화의 켄타우로스로 표현되기도 한다. 니누스는 사르다나팔루스의 계승자였다고 기록되기도 하였다.\\n박트라 포위 중에 그는 세미라미스를 만났는데 그녀는 자신의 장교 오네스의 아내로, 박트라는 그녀를 빼앗아 자신의 아내로 삼는다. 둘은 결혼하여 니니야스를 갖게 된다.\\n고대의 비문들은 니누스 또는 니므롯은 다른 남자의 아내였던 세미라미스와 사랑에 빠졌다고 한다. 그녀는 앗시리아의 역사에 니므롯 즉 니누스의 아내로 언급되어 나오는데 니므롯과 마찬가지로 그녀도 또한 사냥꾼이었다. 어거스틴의 신국론神國論 니누스은 앗시리아의 초대 왕으로 그에게는 니니아스라는 아들이 있는데. 니누스가 죽은 후 니니아스가 직계를 이어야함에도 계모인 세미라미스가 제위를 차지하였다.\\n니누스는 때로 토라에서 쿠시의 아들인 사냥군 니므롯로 확인되는 인물과 관련있다고 생각되곤 하였다.\\n창세기에서 니네베를 창건한 이는 니므롯이다.\\n니네베는 그리스어로 '니누스의 도시'란 뜻이다.\\n니누스는 19세기 영국 목사 알렉산더 히슬롭의 '두 개의 바빌론'에서 탐무즈로 추정되기도했다.\\n니누스의 사후 세미라미스는 그것에 대해 고소되었는데 바빌론 근처에 사원 무덤을 세웠다. 그곳에서 피라무스와 티스베의 이야기의 배경이였다. 그의 치세는 52년간 지속되었다."},{"page_url":"https://de.wikipedia.org/wiki/Villa_L%C3%B6w-Beer","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a0/Vila_L%C3%B6w-Beer_interior_Brno_2016_7.jpg","page_title":"Villa Löw-Beer","context_page_description":"Die Villa Löw-Beer ist eine 1903/04 vom Architekten Alexander Neumann für den Unternehmer Moritz Fuhrmann erbaute Jugendstil-Villa im tschechischen Brünn. Von 1913 bis 1939 wurde sie von der Familie des wohlhabenden Tuchfabrikanten Alfred Löw-Beer bewohnt, dessen Tochter Grete und ihr Ehemann Fritz Tugendhat erbauten später im oberen Bereich des Grundstücks die Villa Tugendhat."},{"page_url":"https://eu.wikipedia.org/wiki/Newport_hiriko_erdigunea","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e6/Newport_City_Centre_-_geograph.org.uk_-_325157.jpg","page_title":"Newport hiriko erdigunea","context_page_description":"Newport hiriko erdigunea, ingelesez: Newport city centre, Galesko Newport hiriaren erdigunea da, nagusiki Stow Hill barrutiak osatzen du."},{"page_url":"https://en.wikipedia.org/wiki/Sarah_Holland","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d3/Sarah_Holland_100_3766e1.jpg","page_title":"Sarah Holland","context_page_description":"Sarah Holland is a writer, actress and singer best known for her 22 romantic novels for Harlequin which have been published in over 130 countries, selling millions of copies worldwide. She has also written for television, newspapers and the screen as well as appearing in films; most notably the multi-award-winning Texan movie Artois the Goat and a supporting role with Academy Award-winning American actor Jack Palance in Treasure Island. Holland wrote her first book, Too Hot To Handle at 18, and became one of the youngest romantic novelists in history when it was published in 1982."},{"page_url":"https://fr.wikipedia.org/wiki/Sergue%C3%AF_Malioutine","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3a/%D0%94%D0%BE%D0%BC_%D0%B4%D0%BE%D1%85%D0%BE%D0%B4%D0%BD%D1%8B%D0%B9_%D0%9F%D0%B5%D1%80%D1%86%D0%BE%D0%B2%D0%BE%D0%B9_%D0%97._%D0%90._%28around%29_08.jpg","page_title":"Sergueï Malioutine","context_page_description":"Sergueï Malioutine, né à Moscou le 4 octobre 1859 et mort dans cette ville le 6 décembre 1937, est un artiste russe, peintre et architecte. Fils d'un marchand, il est né et vécut à Moscou. Il serait l'auteur de la peinture des premières poupées russes gigognes, les matriochkas, réalisées au départ dans l'atelier de la propriété d'Abramtsevo, devenues et restées très populaires en Russie. L'artisan Vasily Zvyozdochkine en avait réalisé la sculpture."},{"page_url":"https://no.wikipedia.org/wiki/Otto_von_Guericke","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ec/Otto_von_Guericke_portrait.jpg","page_title":"Otto von Guericke","context_page_description":"Otto von Guericke var en tysk vitenskapsmann, oppfinner og politiker. Hans viktigste bidrag til vitenskapen var arbeide med vakuum. Guericke ble født i Magdeburg, Tyskland, og var borgermester i byen fra 1646 til 1676.\\nI 1650 oppfant han en vakuumpumpe som kunne pumpe luft ut fra ethvert hulrom den var forbundet til. Han brukte den til å undersøke egenskapene til vakuum i mange eksperimenter. Guericke demonstrerte kraften i lufttrykket med dramatiske eksperimenter. Han fikk laget to halvkuler av kopper med en diameter på 51 cm. – de ble senere kjent som Magdeburgske halvkuler – og pumpet luft ut av dem mens de dannet kuleform. Han lot så 8 hester dra fra hver sin halvkule, uten at det lyktes dem å dra halvkulene fra hverandre. Når han så lot luften slippe inn igjen, var det naturligvis ingen sak å skille halvkulene fra hverandre. Guericke gjentok denne demonstrasjonen i 1663 i Berlin, hos fyrst Fredrik Vilhelm av Brandenburg, da ble det brukt 24 hester.\\nGuericke brukte barometeret til å forutsi været, og banet derved veien til meteorologien. Han siste arbeider satte fokus på elektrisiteten, men lite er bevart av resultatene. Han regnes som oppfinneren av elektrostatisk generator."},{"page_url":"https://arz.wikipedia.org/wiki/%D8%A7%D9%86_%D8%AC%D9%89_%D8%B3%D9%89_2101_(%D9%85%D8%AC%D8%B1%D9%87)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/95/NGC_2101_DSS.jpg","page_title":"ان جى سى 2101 (مجره)","context_page_description":"ان جى سى 2101 هى مجره بتتبع كوكبه آله الرسام و اللى اكتشفها جون هيرشل و الاكتشاف كان بتاريخ 9 يناير 1837."},{"page_url":"https://es.wikipedia.org/wiki/Palazzo_Filomarino","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0c/PalazzoFilomarino2.jpg","page_title":"Palazzo Filomarino","context_page_description":"El Palazzo Filomarino es un palacio monumental situado en Spaccanapoli, en pleno centro histórico de Nápoles, Italia. A lo largo de los siglos, fue residencia de importantes familias nobles napolitanas; aquí vivieron los filósofos Giambattista Vico y Benedetto Croce. Actualmente, algunos locales del edificio albergan el Instituto Italiano de Estudios Históricos, fundado por el mismo Croce, y la Fundación Biblioteca Benedetto Croce."},{"page_url":"https://it.wikipedia.org/wiki/El_Raval","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/27/El_gato_de_Raval.jpg","page_title":"El Raval","context_page_description":"El Raval è uno dei quattro quartieri del distretto della Ciutat Vella di Barcellona.\\nNato in seguito all'ampliamento delle mura medievali della città, è uno dei quartieri di Barcellona più densamente popolati e nel 2010, contava circa 50.000 abitanti distribuiti su una superficie di 110 ettari."},{"page_url":"https://zh.wikipedia.org/wiki/%E7%B4%80%E4%BC%8A%E8%99%9F%E5%88%97%E8%BB%8A","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/35/EF5860-%E4%BA%AC%E9%83%BD%E9%A7%8501.jpg","page_title":"紀伊號列車","context_page_description":"「紀伊」是日本國有鐵道在1968年至1984年之間，行駛於東京至紀伊勝浦之間，途經東海道本線、關西本線、紀勢本線上行走的特急寢車。在1975年之前，紀伊號列車是以夜行急行列車運行。在本條目內，將會記載過往行走東京都與奈良縣、紀伊半島之間沿線城市之優等列車沿革。"},{"page_url":"https://fr.wikipedia.org/wiki/Robotech","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/59/U.N._Spacy_Roundel.svg","page_title":"Robotech","context_page_description":"Robotech est la fusion, réalisée en 1985 par Carl Macek et l'éditeur Harmony Gold, du premier dessin-animé Macross avec deux autres séries. Il se compose donc de trois séries :\\nRobotech: The Macross Saga ;\\nRobotech: The Masters ;\\nRobotech: New Generation.\\nRobotech a été adaptée en bande dessinée et dans deux longs-métrages de cinéma, ainsi que plusieurs longs-métrages vidéo, ce qui rend complexe la « structure » du produit. Un jeu de rôle a été édité par Palladium Books."},{"page_url":"https://es.wikipedia.org/wiki/Cine_expresionista_alem%C3%A1n","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/74/CABINETOFDRCALIGARI-poster.jpg","page_title":"Cine expresionista alemán","context_page_description":"El cine expresionista alemán es el nombre que se le da a un grupo de producciones cinematográficas con ciertos aspectos en común. Este estilo de hacer cine tiene su correspondencia con la corriente expresionista, llamada así por contraste con la corriente impresionista del siglo XIX en pintura, es decir, con aquel tipo de pintura en la que prima la «expresión subjetiva» sobre la representación de la objetividad. Esta pintura recurría a colores hirientes y ritmos lineales muy fuertes. Arraigó fundamentalmente en Alemania, de donde surgió el movimiento Die Brücke, fundado en 1905 por unos estudiantes de arquitectura."},{"page_url":"https://en.wikipedia.org/wiki/Listed_buildings_in_Onibury","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ce/Entrance_Gateway%2C_Stokesay_Court.jpg","page_title":"Listed buildings in Onibury","context_page_description":"Onibury is a civil parish in Shropshire, England. It contains 25 listed buildings that are recorded in the National Heritage List for England. Of these, two are at Grade II*, the middle of the three grades, and the others are at Grade II, the lowest grade. The parish contains the village of Onibury and the surrounding countryside. Most of the listed buildings are houses, cottages, farm houses and farm buildings, the earliest of which are timber framed. The oldest building is a church, which is listed together with items in the churchyard. In the parish are a country house and a mansion, both of which are listed, together with associated structures. The other listed buildings include a gazebo, a former railway station, a war memorial, and a telephone kiosk."},{"page_url":"https://it.wikipedia.org/wiki/M%C9%99%C5%9F%C9%99di_%C6%8Fzizb%C9%99yov","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cb/Mashadi_Azizbekov.png","page_title":"Məşədi Əzizbəyov","context_page_description":"Məşədi Əziz oğlu Əzizbəyov è stato un politico azero."},{"page_url":"https://nn.wikipedia.org/wiki/Presidenten_i_India","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/R_Venkataraman.jpg","page_title":"Presidenten i India","context_page_description":"Presidenten i India er statsoverhovud i Republikken India og øvstkommanderande for det indiske forsvaret. Medan artikkel 53 i Grunnloven seier at presidenten kan utøva myndigheit direkte, blir all myndigheit som tilhøyrer presidenten med visse unntak utøvd av den sitjande regjeringa med statsministeren i spissen.\\nDen noverande presidenten er Ram Nath Kovind, som blei svoren inn 25. juli 2017."},{"page_url":"https://cs.wikipedia.org/wiki/DJ_Premier","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/da/DJ_Premier.jpg","page_title":"DJ Premier","context_page_description":"DJ Premier, vlastním jménem Christopher Edward Martin, je americký diskžokej a hudební producent. Narodil se v Houston v Texasu a později žil v New Yorku. Studoval na Prairie View A&M University, kde vystupoval jako diskžokej, ale byl také členem hudební skupiny. Řadu let byl členem hiphopového dua Gang Starr. Rovněž vydal několik vlastních nahrávek. Jako producent spolupracoval s mnoha hudebníky, mezi které patří například The Game, Dr. Dre, Christina Aguilera, Jay-Z nebo M.O.P."},{"page_url":"https://ceb.wikipedia.org/wiki/Hacienda_Heights","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/56/Hsilai_surrounding.jpg","page_title":"Hacienda Heights","context_page_description":"Lungsod ang Hacienda Heights sa Tinipong Bansa. Ang Hacienda Heights nahimutang sa kondado sa Los Angeles County ug estado sa California, sa habagatan-kasadpang bahin sa nasod, 3,700 km sa kasadpan sa ulohang dakbayan Washington, D.C. 138 metros ibabaw sa dagat kahaboga ang nahimutangan sa Hacienda Heights, ug adunay 54,038 ka molupyo.\\nAng yuta palibot sa Hacienda Heights kay kabungtoran sa habagatang-kasadpan, apan sa amihang-sidlakan nga kini mao ang patag. Kinahabogang dapit sa palibot ang Workman Hill, 424 ka metros ni kahaboga ibabaw sa dagat, 3.2 km sa kasadpan sa Hacienda Heights. Dunay mga 2,431 ka tawo kada kilometro kwadrado sa palibot sa Hacienda Heights may kaayo hilabihan populasyon. Ang kinadul-ang mas dakong lungsod mao ang Anaheim, 18.2 km sa habagatan sa Hacienda Heights. Hapit nalukop sa kabalayan ang palibot sa Hacienda Heights. Sa rehiyon palibot sa Hacienda Heights, mga walog talagsaon komon.\\nAng klima mediteranyo. Ang kasarangang giiniton 21 °C. Ang kinainitan nga bulan Hulyo, sa 29 °C, ug ang kinabugnawan Disyembre, sa 12 °C. Ang kasarangang pag-ulan 211 milimetro matag tuig."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%BC%E3%83%B3%E3%83%B4%E3%82%A9%E3%83%BB%E3%82%AA%E3%83%BC%E3%83%88%E3%83%A2%E3%83%BC%E3%83%86%E3%82%A3%E3%83%96","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/53/2015-03-03_Geneva_Motor_Show_5800.JPG","page_title":"ゼンヴォ・オートモーティブ","context_page_description":"ゼンヴォ・オートモーティブは、デンマークの自動車会社。"},{"page_url":"https://it.wikipedia.org/wiki/Het_Gulden_Cabinet","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ef/Jacob_Adriaensz_Backer_-_het_gulden_cabinet.png","page_title":"Het Gulden Cabinet","context_page_description":"Het Gulden Cabinet vande Edel Vry Schilder-Const o Il libro d'oro della nobile e liberale arte della pittura è un libro del XVII secolo del notaio e retore Cornelis de Bie pubblicato ad Anversa. Scritto in lingua olandese, contiene biografie e panegirici, con incisione dei ritratti, di artisti del XVI e XVII secolo, per la maggior parte del sud dei Paesi Bassi. L'opera è una fonte molto importante di informazioni sugli artisti descritti. Ha costituito la principale fonte di informazioni per storici dell'arte come Arnold Houbraken e Jacob Campo Weyerman. Fu pubblicato nel 1662, anche se il lavoro menziona il 1661 come data di pubblicazione."},{"page_url":"https://en.wikipedia.org/wiki/Cell_group","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/69/US_Navy_040615-N-4190W-001_A_women%27s_Bible_study_is_held_in_the_ship%27s_chapel_aboard_the_conventionally_powered_aircraft_carrier_USS_John_F._Kennedy_%28CV_67%29.jpg","page_title":"Cell group","context_page_description":"The cell group is a form of church organization that is used in many Christian churches. Cell groups are generally intended to teach the Bible and personalize Christian fellowship. They are always used in cell churches, but also occur in parachurch organizations and other interdenominational settings, where they are usually referred to as such as Bible study groups. In Methodism, they are known as class meetings and are a means of grace.\\nThe cell group differs from the house church in that the group is part of an overall church congregation, whereas the house church is a self-contained congregation."},{"page_url":"https://ga.wikipedia.org/wiki/Liosta_speiceas_na_n-iasc_a_choinn%C3%ADtear_in_uiscead%C3%A1in_fhionnuisce","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/Cobaltblue1.jpg","page_title":"Liosta speiceas na n-iasc a choinnítear in uisceadáin fhionnuisce","context_page_description":"D'éirigh le líon mór speiceas uisceach oiriúnú go rathúil chun cónaí san uisceadán fionnuisce. Tugann an liosta seo roinnt samplaí de na speicis is coitianta atá le fáil in uisceadáin bhaile."},{"page_url":"https://en.wikipedia.org/wiki/Edipresse","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0f/Edipresse_Tower_%282079713671%29.jpg","page_title":"Edipresse","context_page_description":"Edipresse is a company headquartered in Switzerland. Its main activities are magazine publishing, real estate and digital ventures."},{"page_url":"https://en.wikipedia.org/wiki/Nicandra_physalodes","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ed/Die_Giftpflanzen_Deutschlands_%281910%29_%2820738516718%29.jpg","page_title":"Nicandra physalodes","context_page_description":"Nicandra physalodes is a species of flowering plant in subfamily Solanoideae of the nightshade family. It is known by the common names apple-of-Peru and shoo-fly plant. It is thought originally to have been native to western South America, including Peru, and is known elsewhere as an introduced and ruderal species – sometimes as a weed – in tropical, subtropical and, to a lesser extent, temperate areas all over the world. It has also long been cultivated as an ornamental plant for its attractive flowers and curious fruits and has been adopted into the traditional medicine of countries far-removed from its original home."},{"page_url":"https://en.wikipedia.org/wiki/Tom_Heinemann","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7b/Tom_Heinemann_MLS.jpg","page_title":"Tom Heinemann","context_page_description":"Tom Heinemann is an American retired soccer player who is currently an assistant coach for the Belmont Bruins men's soccer team."},{"page_url":"https://nl.wikipedia.org/wiki/Biarritz","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e6/Biarritz._Museo_del_Mar.JPG","page_title":"Biarritz","context_page_description":"Biarritz is een Franse gemeente aan de Golf van Biskaje en is de hoofdplaats van een kanton in het departement Pyrénées-Atlantiques en de streek Aquitanië. Het ligt in Frans-Baskenland.\\nDe stad telt ongeveer 30.000 inwoners, die Biarrots worden genoemd.\\nBiarritz is vooral bekend als badplaats en als luchtkuuroord.\\nIn de gemeente ligt spoorwegstation Biarritz."},{"page_url":"https://it.wikipedia.org/wiki/Mr._Potato","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/91/Mr_Ass_Face.jpg","page_title":"Mr. Potato","context_page_description":"Mr. Potato è un giocattolo per bambini piuttosto popolare negli Stati Uniti d'America; consiste in un modellino in plastica di una patata sulla quale possono essere applicati diversi componenti facciali, quali occhi, naso, orecchi, fino a trasformare la \\"patata\\" in un \\"viso\\"."},{"page_url":"https://es.wikipedia.org/wiki/R%C3%A9tonval","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e6/Map_commune_FR_insee_code_76523.png","page_title":"Rétonval","context_page_description":"Rétonval es una población y comuna francesa, en la región de Alta Normandía, departamento de Sena Marítimo, en el distrito de Dieppe y cantón de Blangy-sur-Bresle."},{"page_url":"https://pt.wikipedia.org/wiki/Thobias_da_Vai-Vai","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/85/Thobias_da_Vai-Vai_%282010%29.JPG","page_title":"Thobias da Vai-Vai","context_page_description":"Edimar Tobias da Silva, mais conhecido como Thobias da Vai-Vai, é um cantor, ator, radialista e ex-dirigente de carnaval brasileiro. Tornou-se célebre por ter sido intérprete oficial, e posteriormente presidente da escola de samba paulistana Vai-Vai. Já foi considerado um dos maiores intérpretes de samba-enredo do Brasil de todos os tempos."},{"page_url":"https://en.wikipedia.org/wiki/Bert_Lytell","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/35/Bert_Lytell.jpg","page_title":"Bert Lytell","context_page_description":"Bertram Lytell was an actor in theater and film during the silent film era and early talkies. He starred in romantic, melodrama, and adventure films.\\nBorn in New York City, Lytell was the son of actor, author, and producer William H. Lyttel and Blanche Mortimer. His mother was an actress before she married, and her father and grandfather were actors. Lytell left Upper Canada College at age 16 to become an actor.\\nLytell's acting debut came with the Columbia Stock Company in Newark, New Jersey, when he was 17 years old. He went on to appear with stock theater companies in Boston, Honolulu, Los Angeles, New Orleans, and Rochester, in addition to heading his own stock troupes in Albany, New York, and San Francisco. He appeared with Marie Dressler in her 1914 Broadway play, A MIX-UP. He also performed in vaudeville in the 1920s with the one-act play The Valiant.\\nIn 1917, Lytell made his film debut starring as Michael Lanyard in The Lone Wolf. He subsequently made four Lone Wolf sequels, ending with The Last of the Lone Wolf. He also starred as Boston Blackie in Boston Blackie's Little Pal and Blackie's Redemption."},{"page_url":"https://hu.wikipedia.org/wiki/Elbasan","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/15/Elbasan_-_Marienkirche_5b_L%C3%B6we.jpg","page_title":"Elbasan","context_page_description":"Elbasan város Albánia központi részén, a Shkumbin folyó kiterjedt, nyílt völgysíkságában, az Elbasani-sík északkeleti peremén, Tiranától légvonalban 33, közúton 40 kilométerre délkeleti irányban. Elbasan megye székhelye, ezen belül Elbasan község központja. A 2011-es népszámlálás alapján lakossága 78 703 fő, ezzel Albánia negyedik legnépesebb városa.\\nHelyén időszámításunk kezdetén a Via Egnatia egyik állomáshelye, Scampis állt. A 4. században a rómaiak katonai castrumot építettek Scampisban, amely az 5. században püspöki székhely volt. A 6. században I. Iusztinianosz bizánci császár még megerősítette a castrumot, a város azonban a külső támadások következményeként a 9. századra elnéptelenedett. Újraalapítására az Oszmán Birodalom Szkander bég elleni küzdelmei idején, 1466-ban került sor, amikor II. Mehmed parancsára ókori várát megerősítették. A város Ilbaszan néven fontos katonai támaszpontjuk, majd az Ilbaszani szandzsák székhelye lett. A török fennhatóság évszázadai alatt az albánok lakta vidékek egyik legfontosabb városa, hatalmas bazárral rendelkező kereskedelmi és kézműipari központja, az oszmán kultúra egyik fellegvára lett."},{"page_url":"https://de.wikipedia.org/wiki/Hariksee","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/2d/Ansicht_des_Hariksees_am_Niederrhein_II.png","page_title":"Hariksee","context_page_description":"Der Hariksee am Niederrhein, zwischen Schwalmtal und Niederkrüchten gelegen, ist ein Naherholungsgebiet der Region mittlerer Niederrhein.\\nDer Hariksee hat eine Wasserfläche von ca. 20 ha und hat ein Alter von ca. 8.000 bis 12.000 Jahren. Die heutige Form erhielt der von der Schwalm durchflossene See durch die Austorfungen im 17. Jahrhundert.\\nDas Ufer des Hariksees besteht aus Bruchwaldzonen und aus von Schwarzerlen bewachsenen Mooren."},{"page_url":"https://en.wikipedia.org/wiki/List_of_canonically_crowned_images","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6b/Virgen_de_la_Regla_church.JPG","page_title":"List of canonically crowned images","context_page_description":"The following list enumerates a selection of mainly Marian, and a few Josephian, and Christological images venerated in the Roman Catholic Church, authorised by a Pope who has officially issued a Papal bull of canonical coronation to be carried out either by the Pontiff, his Papal legate or a Papal nuncio.\\nThe very first Marian image crowned without direct papal approval was by Cardinal Francesco Sforza Pallavicino of the Black Virgin of Oropa, La Madonna della Oropa in Piedmont on 30 August 1620. The first Marian image Pontifically crowned was the painted image of La Madonna della Febbre on 27 May 1631 by Pope Urban VIII through the Vatican Chapter located at the Sacristy of Saint Peter's Basilica.\\nThe prescription of the solemn rite to crown venerated images is embedded in the Ordo Coronandi Imaginem Beatae Mariae Virginis published by the Holy Office on 25 May 1981. Prior to 1989, papal bulls concerning the authorization of canonical coronations were handwritten on parchment."},{"page_url":"https://no.wikipedia.org/wiki/Heron_av_Alexandria","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b8/Aeolipile_illustration.png","page_title":"Heron av Alexandria","context_page_description":"Heron fra Alexandria, kjent som Mekanikus, var en matematiker og ingeniør som levde i Alexandria i antikken.\\nDet er noe usikkert når Heron levde, men trolig var det etter Arkimedes og før Pappos, så det antas å ha vært i tidsrommet 200 til år 300. Skriftene hans kan tyde på at han levde i det 1. hundreåret. Det han skrev om måneformørkelsen den 23. mars 62 tyder på at Heron selv observerte den. I verket Dioptra benyttet han en måneformørkelse til å regne ut avstanden mellom Roma og Alexandria. Ut fra at han skrev at det var mørkt i Aleksandria i den 5. nattetimen, tyder på at det var måneformørkelsen i år 62 han hadde observert.\\nHeron underviste ved Aleksandria Museion, som hadde et stort bibliotek, kjent som Biblioteket i Aleksandria. Fragmenter av arbeidet hans, trolig forelesningsnotater, viser at han arbeidet med mange forskjellige emner innen matematikk, optikk og mekanikk. Han er kjent for å ha laget automatiske, og delvis programmerbare, innretninger og for at han arbeidet med å hente energi fra vann, vind og varme. Spesielt godt kjent er oppfinnelsene Eolipil og Heron-brønnen."},{"page_url":"https://sv.wikipedia.org/wiki/Rudolf_Lange_(arkitekt)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3a/Munkedal_Kvistr%C3%B6m_1-14_tingshuset_ID_21400000697019_IMG_0280.JPG","page_title":"Rudolf Lange (arkitekt)","context_page_description":"Rudolf Lange, född 4 oktober 1874 i Uddevalla, död 1 december 1927 i Göteborg, var en svensk ingenjör och arkitekt.\\nLange var son till Emil Georg Lange och dennes hustru Hedvig Erika Maria född Kafle. Han läste vid Uddevalla Allmänna Läroverk och tog en teknisk examen 1896. Han var anställd vid järnbruk fyra år, bland annat vid Surahammars Bruk. Mellan åren 1901 och 1907 praktiserade han vid olika arkitekt- och byggnadsfirmor i Göteborg och öppnade egen praktik där 1907."},{"page_url":"https://es.wikipedia.org/wiki/Presa_Naute","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/40/Naute-Damm_Namibia_anagoria.JPG","page_title":"Presa Naute","context_page_description":"La presa Naute es una presa en las afueras de Keetmanshoop, en la Región de Karas, una de las catorce regiones de Namibia. Es la región más meridional de Namibia. Fue construida por el Concor Holdings entre 1970 y 1972 y entró en servicio oficialmente en septiembre de 1972. Es la tercera presa más grande de Namibia después de la presa de Hardap, la más grande del Namibia y está situada al norte de Naute y tiene una capacidad de hasta 69 millones de metros cúbicos de agua. El nacimiento del río aque abastece a la presa es el río Löwen, un afluente del Visrivier.​"},{"page_url":"https://de.wikipedia.org/wiki/Frauenkirche_(Unterriexingen)","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/7d/Frauenkirche_Unterriexingen_Joseph_Cades.png","page_title":"Frauenkirche (Unterriexingen)","context_page_description":"Die Frauenkirche in Unterriexingen, einem Stadtteil von Markgröningen im baden-württembergischen Landkreis Ludwigsburg, steht südwestlich und oberhalb des Dorfes inmitten des Friedhofes. Im 14. Jahrhundert ausgebaut, verfiel sie im 19. Jahrhundert zur Ruine. Ab 1874 wurde sie durch den Freiherrn Gerhard Leutrum von Ertingen wieder in Stand gesetzt. Die erneute Restaurierung in den Jahren 1999 bis 2003 durch Karl Magnus Graf Leutrum von Ertingen wurde im Jahr 2004 mit dem Denkmalschutzpreis Baden-Württemberg ausgezeichnet."},{"page_url":"https://en.wikipedia.org/wiki/List_of_historic_properties_in_Clarkdale,_Arizona","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/be/Clarkdale-Tuzigoot_National_Monument-1499-1000_AD-5.jpg","page_title":"List of historic properties in Clarkdale, Arizona","context_page_description":"This is a list, which includes a photographic gallery, of some of the remaining structures and monuments, of historic significance in Clarkdale, a former mining town in Yavapai County, Arizona. Clarkdale was Arizona's first master-planned community. The town is located on the northwest boundary of the City of Cottonwood."},{"page_url":"https://sk.wikipedia.org/wiki/%C4%8Cimelice","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/%C4%8Cimelice-road.jpg","page_title":"Čimelice","context_page_description":"Čimelice je obec v Česku v okrese Písek v Juhočeskom kraji. 1. januára 2012 tu žilo 967 obyvateľov, z toho 484 mužov a 483 žien, pričom priemerný vek v obci bol 42,9 roka."},{"page_url":"https://eo.wikipedia.org/wiki/Pakistano","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7a/July_9_2005_-_The_Lahore_Fort-Another_sideview_of_Naulakha_pavillion.jpg","page_title":"Pakistano","context_page_description":"Pakistano, oficiale la Islama Respubliko de Pakistano, estas suverena ŝtato en Suda Azio. Ĝi estas laŭ areo la dua plej granda en Suda Azio, kaj la 36-a en la mondo. Ĝi havas 1 046 kilometrojn da marbordo ĉe la Araba Maro kaj la Golfo de Omano en la sudo, kaj ĝi najbaras Afganion kaj Iranon en la okcidento, Baraton en la oriento kaj Ĉinion en la plej fora nordoriento. Ĝi estas separata el Taĝikio pare de la mallarĝa Vaĥana Koridoro de Afganio en la nordo, kaj sude ankaŭ kunhavas malgradan marlimon kun Omano.\\nPakistano kun 180 milionoj da loĝantoj estas la sesa plej dense loĝata lando en la mondo kaj estas la dua plej dense loĝata lando kun Islama plimulto post Indonezio. Ĝia teritorio estis parto de Brita Hindio, kaj sendependiĝis de la nuna Barato en 1947. La teritorio kiu nune konstituas Pakistanon estis iam hejmo de kelkaj antikvaj kulturoj, kiaj tiuj de Mehrgarh de la Neolitiko, kaj de la Bronzepoko tui nome Induso-civilizacio, kaj estis poate hejmo de regnoj regataj de popoloj de diversajreligioj kaj kulturoj, kiaj hinduoj, hindo-grekoj, islamanoj, turko-mongoloj, afganoj kaj sikoj."},{"page_url":"https://es.wikipedia.org/wiki/Eclipse_lunar_de_septiembre_de_2015","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a8/Supermoon_Lunar_Eclipse.jpg","page_title":"Eclipse lunar de septiembre de 2015","context_page_description":"Un eclipse superlunar total fue el acontecimiento ocurrido entre la medianoche del 27 y la madrugada del 28 de septiembre de 2015, siendo el segundo de los dos eclipses​ lunares totales de 2015 y el último de los eclipses de las Lunas de Sangre o de la tétrada de. Transcurrió también acompañado en esa noche por el fenómeno lunar llamado «Superluna».​ El siguiente eclipse total no ocurrió hasta enero de 2018 y el siguiente eclipse superlunar total no ocurrirá hasta el 2029."},{"page_url":"https://en.wikipedia.org/wiki/Daud_Khan_Karrani","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fb/Daud_Khan_Karrani.jpg","page_title":"Daud Khan Karrani","context_page_description":"Daud Khan Karrani was the last ruler of Bengal's Karrani dynasty as well as the final Sultan of Bengal, reigning from 1572 to 1576. During the reign of his father Sulaiman Khan Karrani, Daud commanded a massive army of 40,000 cavalry, 3,600 elephants, 140,000 infantry and 200 cannons. He invaded the southwestern regions of present-day India."},{"page_url":"https://hi.wikipedia.org/wiki/%E0%A4%B6%E0%A4%BF%E0%A4%A8%E0%A4%BE%E0%A4%A8%E0%A5%8B_%E0%A4%A8%E0%A4%A6%E0%A5%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/49/Shinano_river_Route_cropped.png","page_title":"शिनानो नदी","context_page_description":"शिनानो नदी, जिसे इसके ऊपरी क्षेत्रों में चिकुमा नदी के नाम से जाना जाता हैं, जापान की सबसे लंबी और चौड़ी नदी, और बेसिन क्षेत्र में तीसरी सबसे बड़ी नदी हैं। यह पूर्वोत्तर होन्शु में स्थित हैं, जापानी एल्प्स से निकलकर, जापान सागर में मिलने से पूर्व यह नागानो और निगाता प्रांत के माध्यम से उत्तर पूर्व कि ओर बहती हैं।"},{"page_url":"https://zh.wikipedia.org/wiki/%E7%89%B9%E6%8B%89%E5%A1%94%E5%B0%BC%E4%BA%9E%E9%BE%8D%E5%B1%AC","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/79/Orkoraptor_drawing.jpg","page_title":"特拉塔尼亞龍屬","context_page_description":"特拉塔尼亚龙属是一属已灭绝的大盗龙科兽脚类恐龙，残骸发现于阿根廷布特德拉卡帕组，年代为桑托阶。模式种和唯一的物种是罗氏特拉塔尼亚龙，叙述于2018年3月。\\n特拉塔尼亚龙可根据每根背椎骨前部三个独有衍征以及骶骨的形状区别于其它大盗龙类。该属是大盗龙类中已知生存年代最年轻的一个属，仅为8300万年前。"},{"page_url":"https://uk.wikipedia.org/wiki/%D0%86%D0%BC%D0%BF%D0%BE%D1%80%D1%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/20/ImpUA5year.gif","page_title":"Імпорт","context_page_description":"І́мпорт — ввезення товарів, послуг.\\nТовари і послуги, що одна країна продає іншій для внутрішнього використання, обробки чи перепродажу.\\nІмпорт може бути видимим і невидимим.\\nВиділяють також реімпорт.\\nЯкщо країна, що імпортує, не має контрбалансу у вигляді експорту, це може призвести до балансових труднощів і відповідно до обмеження імпорту у вигляді якої-небудь форми протекціонізму.\\nІмпорт забезпечує для виробничих та індивідуальних споживачів, а також для країни, низку додаткових переваг. Зокрема:\\nдоступ до дешевих та якісніших товарів готових виробів, сировинних та інших матеріалів та комплектуючих деталей;\\nнаповнення ринку дефіцитними товарами або товарами, які взагалі не виробляються на національній території;\\nзростання конкуренції та стимулювання завдяки цьому оптимізації, підвищення виробництва на національній території;\\nналагодження сталих виробничих зв’язків щодо кооперування виробництва з інонаціональними партнерами;\\nрозвиток технологій завдяки поширенню ввезення науково-містких товарів.\\nВартість імпорту разом із вартістю експорту формує зовнішньоторгівельний оборот. Економіки зі значною питомою вагою зовнішньоторгівельного обороту відносять до відкритих економік."},{"page_url":"https://en.wikipedia.org/wiki/Pen_Dinas","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/39/Pen_Dinas.jpg","page_title":"Pen Dinas","context_page_description":"Pen Dinas is the name of a large hill within the boundary of the village of Penparcau, on the coast of Ceredigion, Wales, upon which an extensive Iron Age, Celtic hillfort of international significance is situated.\\nThe name is more correctly 'Dinas Maelor', this could be translated into English as 'Maelor's Fort' or 'Maelor's City'. Tradition refers to it as being the fort of the giant Maelor Gawr. Pen Dinas strictly speaking only refers to the highest point, 'Pen y Dinas' or 'Head of the Citadel'. The southern summit is also where, in the Bronze Age, a burial mound was erected.\\nFor the official Royal Commission for the Ancient and Historical Monuments of Wales record relating to Pen Dinas Hillfort see"},{"page_url":"https://zh.wikipedia.org/zh-my/2017%E5%B9%B4%E5%A5%A7%E5%9C%B0%E5%88%A9%E8%AD%B0%E6%9C%83%E9%81%B8%E8%88%89","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b9/Sebastian_Kurz_crop.jpg","page_title":"2017年奧地利議會選舉","context_page_description":"2017年奥地利议会选举于10月15日举行。奥地利人民党取得国民议会183个议席中的62席，上届选举第一大党奥地利社会民主党则取得52席居次位，奥地利自由党取得51席。奥地利人民党成为国民议会中最大的党派。NEOS－新奥地利和自由论坛名列第四，有10个席位，彼得·皮尔兹名单第一次进入议会，排在第五位，拥有8个席位。上届取得24个席位的绿党－绿色替代则未能跨越4％的门槛，没有得到席位。\\n选举前共有889,193人要求以邮寄方式投票，创下历届选举的新高，较2013年选举时668,810人要求邮寄投票大幅增加。邮寄投票的点票于2017年10月16日开始，最终点票结果于10月19日宣布。\\n自2013年上次选举以来，奥地利社会民主党一直是最大的党派，自2007年以来一直领导政府。\\n联盟中最强大的党的领导人，如果有的话，通常会成为总理。仅在选举前五个月就被任命为人民党领导人的塞巴斯蒂安·库尔茨在选举之夜宣称获得胜利，外界认为他将会成为欧洲最年轻的政府首脑。然而，时任总理、社民党领导人克里斯蒂安·科安表示愿意考虑与自由党组建联合政府——尽管他表示这样一个联盟的可能性非常小。\\n10月20日，库尔茨被正式邀请组建政府，并于4天后与奥地利自由党领导人海因茨-克里斯蒂安·斯特拉赫开始商谈。库尔茨计划在圣诞节之前建立一个新的政府，同时成为全球最年轻的总理。"},{"page_url":"https://ja.wikipedia.org/wiki/%E4%B8%89%E6%9C%AC%E7%8F%88%E7%90%B2","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/37/MMC%27s_vending_machine.jpg","page_title":"三本珈琲","context_page_description":"三本珈琲株式会社は、神奈川県横浜市神奈川区に本社を置く、コーヒーを中心とした飲料・食品メーカーである。ブランド名はM.M.C.三本コーヒー、M.M.C.コーヒー。"},{"page_url":"https://cs.wikipedia.org/wiki/G._%26_S._Merz","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8e/Antique_Telescope_at_the_Quito_Astronomical_Observatory_002.JPG","page_title":"G. & S. Merz","context_page_description":"G. & S. Merz byla německá optická firma se sídlem v Mnichově. Vyráběla dalekohledy, astronomické dalekohledy, mikroskopy a další optické přístroje. Jednalo se o jednoho z nejrenomovanějších výrobců těchto přístrojů v druhé polovině 19. století."},{"page_url":"https://lt.wikipedia.org/wiki/Girininkai_(Kaunas)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/57/Girininkai_%28Rok%C5%B3_seni%C5%ABnija%29%2C_%C5%ABkio_pastatai.JPG","page_title":"Girininkai (Kaunas)","context_page_description":"Girininkai – gyvenvietė Kauno rajono pietinėje dalyje. Yra Girininkų pagrindinė mokykla, molio karjeras. Per kaimą teka Girmuonio ir Moteros upeliai."},{"page_url":"https://es.wikipedia.org/wiki/Casa_consistorial_de_Alcira","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/77/Alcira_-_Ayuntamiento_1.jpg","page_title":"Casa consistorial de Alcira","context_page_description":"La Casa Consistorial del municipio de Alzira, en la provincia de Valencia, es un edificio administrativo que se sitúa en el eje de la antigua Villa, de estilo renacentista y construido entre los Siglos XVI y XVII.\\nFue declarada Monumento Histórico Artístico el 17.12.1930.\\nEl palacio alberga una importante colección artística, en la que destacan diversas obras pictóricas, como las de Teodoro Andreu."},{"page_url":"https://he.wikipedia.org/wiki/%D7%95%D7%9C%D7%A1_(%D7%9E%D7%A7%D7%93%D7%95%D7%A0%D7%99%D7%94_%D7%94%D7%A6%D7%A4%D7%95%D7%A0%D7%99%D7%AA)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/82/National_Museum_-_Veles_4.jpg","page_title":"ולס (מקדוניה הצפונית)","context_page_description":"וֶלֶס היא עיר במרכז מקדוניה הצפונית בשטח האזור הסטטיסטי וארדאר, השוכנת לגדות נהר וארדאר ו-54 קילומטרים דרומית לבירה סקופיה."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%85%D8%A7%D8%AC%D8%AF_%D8%A7%D9%84%D8%B9%D8%AF%D9%88%D8%A7%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7a/%D8%B5%D9%88%D8%B1%D8%A9_%D8%A7%D9%84%D8%B4%D9%8A%D8%AE_%D9%85%D8%A7%D8%AC%D8%AF_%D8%A7%D9%84%D8%B9%D8%AF%D9%88%D8%A7%D9%86.jpg","page_title":"ماجد العدوان","context_page_description":"الشيخ ماجد سلطان باشا العدوان أمير البلقاء، وشيخ مشايخ قبيلة العدوان. قاد انتفاضة العدوان عام 1923 ضد الانتداب البريطاني وحكومة مظهر أرسلان، ومؤسس حزب الشعب الأردني وحزب الإخاء الأردني فيما بعد، كما شغل منصب رئيس بلدية عمان عام 1934، ومثل المجلس النيابي في الدورة الأولى والثانية والثالثة والرابعة والخامسة، كان مقرباً من الملك عبدالله الأول، توفي في عام 1946 ودفن في المقابر الملكية بناءً على طلب الملك عبدالله الأول."},{"page_url":"https://sv.wikipedia.org/wiki/Frostbrunnsdalen","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b6/Frostbrunnsdalen%2C_trefaldighetsk%C3%A4llan.jpg","page_title":"Frostbrunnsdalen","context_page_description":"Frostbrunnsdalen är en cirka 20 meter djup ravin strax väster om Stora Tuna kyrka i Borlänge kommun, Dalarna. Dalen hette tidigare Frösbrunnsdalen, vilket antas ha med Frö att göra. I dalen finns även en trefaldighetskälla. Än idag hämtas vatten ifrån dalen genom att en av Borlänge kommuns tre viktigaste vattentäkter finns i dalen.\\nDalen ligger på Tunaslätten. Den är cirka 1 100 meter lång och cirka 20 m djup. Den har uppstått genom Tunaåns erosion av de lösa jordlagren i området. Dalen avsattes som naturreservat 1978 och omfattar cirka 31 hektar. Reservatet ger Frostbrunnsdalens rika flora och fauna möjligheter att överleva.\\nDalens vegetation är mycket artrik. Den domineras av lövträd som asp, hägg och gråal, men har även inslag av gran och tall. Dessutom finns arter som desmeknopp, strutbräken, korallrot och springkorn. Fågelfaunan omfattar ett 50-tal häckande arter, till exempel grå flugsnappare, härmsångare, stjärtmes, mindre hackspett och trädpiplärka.\\nTidigare låg här en hälsobrunn med badhus, men de byggnaderna är nu rivna. I dalgången finns även en varggrop och 1935 lät man uppföra en domarring i dalen för att markera platsen för Tuna gamla tingsplats."},{"page_url":"https://nl.wikipedia.org/wiki/Cindy_Oudshoorn","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/54/Night_of_the_Koemarkt_2018_%2841322209690%29_%28cropped%29.jpg","page_title":"Cindy Oudshoorn","context_page_description":"Cindy Oudshoorn is een Nederlandse zangeres. In 1996 haalde ze de de zeventiende plek van de Tipparade met het nummer Soms Als Ik Je Zie. Van 2004 tot 2014 was ze lid van de band Kayak. Als stemactrice werkte ze mee aan de nasynchronisatie van Harry Potter. In 2006 was ze onderdeel van de theatershow \\"Queen in Concert\\" van de Kapel van de Koninklijke Luchtmacht.\\nNa de breuk met Kayak in 2014 richtte Oudshoorn samen met Kayak-zanger Edward Reekers en Kayak-gitarist Joost Vergoossen Symfo Classics op. Samen met Jan van Olfen, Werner van Gool en Hubert Heeringa gaven ze concerten waarbij het repertoire van derden uit het genre symfonische rock werd uitgevoerd."},{"page_url":"https://sv.wikipedia.org/wiki/Lysande_skylt","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/03/Restaurang_Tennstopet%2C_2014.jpg","page_title":"Lysande skylt","context_page_description":"Lysande skylt var en årlig återkommande tävling om Stockholms vackraste klassiska ljusreklam som genomfördes första gången mellan 1997 och 1999, och som från 2011 arrangerades av Stadsmuseet i Stockholm. 2017 var sista året priset delades ut.\\nStadsmuseet i Stockholm ville med utmärkelsen Lysande skylt visa museets uppskattning och hylla dem som äger och vårdar klassisk ljusreklam. Priset utgjordes av en minnesskylt som är utformad som Stomatolskyltens tandborste och tandkrämstub med text \\"LYSANDE SKYLT\\" istället för \\"STOMATOL\\". Stadsmuseet beslöt att tävlingen skulle ställas in efter Lysande skylt 2017."},{"page_url":"https://it.wikipedia.org/wiki/Vacoas-Phoenix","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fc/Vacoas.jpg","page_title":"Vacoas-Phoenix","context_page_description":"Vacoas-Phoenix è una città della Repubblica di Mauritius.\\nLa città si trova nel Distretto di Plaines Wilhems, circa 20 km a sud di Port Louis, cui è collegata tramite una ferrovia. È la quinta città dell'isola per numero di abitanti ed è il più grande comune dell'isola Maurizio.\\nVacoas-Phoenix conseguì lo status di città nel 1963 e fu elevata a rango di comune nel 1968. In origine l'area comunale era di 13,22 km², ma con l'annessione nel 1991 di numerose località e territori limitrofi ha raggiunto un'estensione di 54 km²."},{"page_url":"https://ca.wikipedia.org/wiki/E-Tower","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/77/E-Tower2.JPG","page_title":"E-Tower","context_page_description":"L'E-Tower és un edifici gratacels de 37 plantes i 148 metres, ubicat a la Rua Funchal del veïnatge de Vila Olímpia, vora Marginal Pinheiros, a la ciutat brasilera de ciutat de São Paulo. Va ser inaugurat l'any 2005.\\nAmb 148 metres, és el novè gratacels més alt de la ciutat, amb una arquitectura postmoderna inspirada en la Torre Westend de Frankfurt. El seu projecte original era més alt, però a causa del intens tràfic d'helicòpters a la regió va haver de ser canviat. És el quart gratacel més modern de São Paulo."},{"page_url":"https://nl.wikipedia.org/wiki/S%C3%A1msonh%C3%A1za","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/84/S%C3%A1msonh%C3%A1za_l%C3%A9gifot%C3%B31.jpg","page_title":"Sámsonháza","context_page_description":"Sámsonháza is een plaats en gemeente in het Hongaarse comitaat Nógrád. Sámsonháza telt 286 inwoners."},{"page_url":"https://en.wikipedia.org/wiki/Pope_Honorius_IV","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/44/Bulle_honorius_IV_16990.jpg","page_title":"Pope Honorius IV","context_page_description":"Pope Honorius IV, born Giacomo Savelli, was head of the Catholic Church and ruler of the Papal States from 2 April 1285 to his death in 1287. During his pontificate he largely continued to pursue the pro-French political policy of his predecessor, Martin IV."},{"page_url":"https://fi.wikipedia.org/wiki/Kauttuan_linnavuori","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7c/Kauttuan_linnavuori.JPG","page_title":"Kauttuan linnavuori","context_page_description":"Kauttuan linnavuori on Eurassa Satakunnassa sijaitseva rautakautinen linnavuori. Kauttua on Euran vanhoja kyliä, jossa tiedetään olleen laaja ja rikas rautakauden asujaimisto. Linnavuoren toimintaan liittynee muun muassa Kauttualla oleva Luistari, joka on samalla Ala-Satakunnan ainoa ja eräs Suomen pienemmistä linnavuorista."},{"page_url":"https://af.wikipedia.org/wiki/Sint_Matth%C3%A9%C3%BCskerk","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d1/Sankt_Matth%C3%A6us_Kirke_Copenhagen.jpg","page_title":"Sint Matthéüskerk","context_page_description":"Die Sint Matthéüskerk is die oudste en grootste kerk in die Vesterbrodistrik van Kopenhagen, Denemarke."},{"page_url":"https://id.wikipedia.org/wiki/Daftar_misi_pesawat_ulang-alik","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/63/Sts-41-patch.png","page_title":"Daftar misi pesawat ulang-alik","context_page_description":"Pesawat ulang-alik adalah wahana antariksa bertujuan orbit Bumi rendah yang dapat digunakan kembali sebagian dan dioperasikan oleh Badan Penerbangan dan Antariksa Nasional AS. Nama resmi program ini adalah Space Transportation System, diambil dari rencana tahun 1969 untuk sistem wahana antariksa yang dapat digunakan kembali. Pada misi operasionalnya, pesawat ulang-alik meluncurkan banyak satelit, melakukan eksperimen sains di orbit, dan berpartisipasi dalam pembangunan dan perbaikan Stasiun Luar Angkasa Internasional. Empat penerbangan uji orbital pertama diluncurkan pada 1981 dan penerbangan operasionalnya dimulai pada 1982.\\nPada tahun 1981 hingga 2011, total 135 misi diterbangkan, seluruhnya dari Kennedy Space Center di Florida. Selama periode waktu itu armada pesawat ulang-alik mencatat 1.322 hari, 19 jam, 21 menit dan 23 detik waktu penerbangan. Penerbangan orbital terpanjang pada program ini adalah misi STS-80 dengan durasi 17 hari 15 jam, sedangkan penerbangan terpendek adalah STS-51-L ketika Pesawat Ulang-Alik Challenger mengalami disintegrasi satu menit 13 detik setelah peluncuran."},{"page_url":"https://de.wikipedia.org/wiki/Kimono","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/60/%E9%BB%92%E5%B9%B3%E7%B5%B9%E5%9C%B0%E5%AF%8C%E5%A3%AB%E5%9B%B3%E7%BE%BD%E7%B9%94_%E7%94%B7%E7%89%A9-Man%27s_Formal_Jacket_%28Haori%29_MET_DP330783.jpg","page_title":"Kimono","context_page_description":"Kimono ist ein traditionelles japanisches kaftanartiges Kleidungsstück, das durch einen breiten Gürtel zusammengehalten wird."},{"page_url":"https://en.wikipedia.org/wiki/Caerwys","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/93/Caerwys_Town_Square.jpg","page_title":"Caerwys","context_page_description":"Caerwys is a town in Flintshire, Wales. It is just under two miles from the A55 North Wales Expressway and one mile from the A541 Mold-Denbigh road. At the 2001 Census, the population of Caerwys community was 1,315, with a total ward population of 2,496. Following reorganisation the community population fell at the 2011 Census to 1,283 with the ward raising to 2,569. The community includes Afonwen."},{"page_url":"https://is.wikipedia.org/wiki/Devin_Townsend","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/11/Devin%40Tuska2010.jpg","page_title":"Devin Townsend","context_page_description":"Devin Garret Townsend er kanadískur tónlistarmaður og upptökustjóri.\\nTownsend er fæddur í Vancouver, Bresku Kólumbíu. Hann hóf feril sinn 19 ára þegar Steve Vai, gítarleikari heyrði demo spólu hans. Vai hreifst af efni Townsend og fékk hann til að syngja á plötunni sinni Sex and Religion og fara í tónleikaferðalag um heiminn. Platan gekk illa og Townsend hætti með Vai.\\nTownsend var óánægður með músíkiðnaðinn og stofnaði hann þungarokkshljómsveitina Strapping Young Lad árið 1994 og starfaði hún til 2007. Samhliða því hóf hann sólóferil undir eigin nafni og stofnaði eigin plötuútgáfu; HevyDevy Records. Sólóefni Townsend er fjölbreytt og blanda af ýmsu: Rokki, þungarokki, framsæknu rokki, framsæknu þungarokki, hughrifatónlist og nýjaldartónlist.\\nSólóferillinn hefur verið undir nokkrum nöfnum: Devin Townsend, Devin Townsend Band og Devin Townsend Project. Townsend er bæði alvörugefinn og gamansamur í tónlist sinni. Hefur hann meðal annars búið til þemaplötur af geimverunni Ziltoid hinum alvitra sem hefur það að markmiði að finna besta kaffið á jarðarkringlunni ellegar eyðir hann henni."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%99%E3%82%B9%E3%83%88%E3%83%B4%E3%82%A3%E3%83%92","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d4/Bestwig_Schulzentrum.JPG","page_title":"ベストヴィヒ","context_page_description":"ベストヴィヒ はドイツ連邦共和国ノルトライン＝ヴェストファーレン州アルンスベルク行政管区のホーホザウアーラント郡に属す町村である。町域の多くの部分が広大な自然・景観保護地区に指定されている。ノルトライン＝ヴェストファーレン州で最高の自然滝プレスターレッゲは、同名の自然保護地区内に位置している。\\nルール川沿い、アルンスベルクの森の辺縁部に位置するこの町は、14世紀にはメシェデ修道院の農園とグラーフシャフト修道院の農園がある小集落であった。オーベラー・ルールタール鉄道の駅建設後、19世紀後半にこの小集落は鉄道町に発展した。さらに当時隣村であったラムスベックの鉱業によって人口が増加した。ベストヴィヒは、1975年のノルトライン＝ヴェストファーレン州の市町村再編によって現在の姿となった。これにより、商業や工業を主体とする町村が農業を主体とする町と合併した。"},{"page_url":"https://hu.wikipedia.org/wiki/Japan_Expo","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4d/Japan_Expo_2010_-_Morning_Musume_-_Conf%C3%A9rence_Presse_-_Day1_-_P1440325.jpg","page_title":"Japan Expo","context_page_description":"A Japan Expo japán popkultúrával foglalkozó találkozó, Japánon kívül az egyik legnagyobb, melyet a franciaországi Párizsban szoktak megrendezni. Minden évben július elején rendezik meg az ország második legnagyobb konferenciaközpontjában, a Parc des Expositions de Villepinte-ben. A látogatottság az évek folyamán folyamatosan nőtt, a találkozó 1999-ben megrendezett első kiadására 3 200, míg a 2015-ös kiadásra körülbelül 248 000 látogató volt kíváncsi."},{"page_url":"https://pl.wikipedia.org/wiki/Zamek_w_%C5%BBwa%C5%84cu","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/29/ZwaniecZamek2.JPG","page_title":"Zamek w Żwańcu","context_page_description":"Zamek w Żwańcu – ruiny zamku położone na północ od miasteczka na skalnym stromym cyplu, który opada ku rzeczce Żwańczyk."},{"page_url":"https://lv.wikipedia.org/wiki/Loka_%C5%A1au%C5%A1ana_1900._gada_vasaras_olimpiskaj%C4%81s_sp%C4%93l%C4%93s","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/37/Paris_1900-Archery_-_a_competitor.jpg","page_title":"Loka šaušana 1900. gada vasaras olimpiskajās spēlēs","context_page_description":"Loka šaušana 1900. gada vasaras olimpiskajās spēlēs bija viens no 20 oficiālajiem olimpiskajiem sporta veidiem. Šī bija pirmā reize, kad loka šaušana bija iekāuta olimpisko spēļu programmā. Sacensības notika no 15. jūlija līdz 14. augustam, tās tika aizvadītas Vensāna mežā. Loka šaušanā startēja 153 sportisti no 3 valstīm. Lai gan no 153 loka šāvējiem, tikai 16 sportistiem ir zināma precīza identitāte. Sacensības tika aizvadītas 6 disciplīnās.\\nStarptautiskā Olimpiskā komiteja līdz šim nav izlēmusi, kuri notikumi bija \\"olimpiskie\\" un kuri ne. Taču SOK savā datubāzē atzīmē tika 6 disciplīnas no vairākām, kas bija iekļautas loka šaušanā. Ja visas disciplīnas tiktu iekļautas, loka loka dalībnieku skaits varētu pārsniegt 5000 sportistu. Lielākā daļa no izslēgtajām discipklīnām ir tādēļ, ka tie ir bijušas kā Francijas nacionālie čempionāti. Savukārt komandu pasākumi au berceau kalpoja kā kvalifikācija individuālajiem notikumiem. Astoņi labākie komandu sacensību auordon doré finišētāji bija tiesīgi sacensties par individuālajiem tituliem, savukārt seši labākie komandu sacensību au chapelet finišētāji bija tiesīgi sacensties par individuālajiem tituliem."},{"page_url":"https://pl.wikipedia.org/wiki/O%C5%BCar%C3%B3w_(wojew%C3%B3dztwo_%C5%82%C3%B3dzkie)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cf/Ozarow_dwor2%28pischmak%29.JPG","page_title":"Ożarów (województwo łódzkie)","context_page_description":"Ożarów – wieś w Polsce, położona w województwie łódzkim, w powiecie wieluńskim, w gminie Mokrsko. Znajduje się w odległości 12 km od Wielunia.\\nW latach 1975–1998 miejscowość należała do województwa sieradzkiego."},{"page_url":"https://hy.wikipedia.org/wiki/%D5%84%D5%AB%D5%BF%D5%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c2/Mito_Art_Tower.JPG","page_title":"Միտո","context_page_description":"Միտո, քաղաք Ճապոնիայում՝ Կանտո տարածաշրջանում, Իբարակի պրեֆեկտուրայի վարչական կենտրոնը:\\n2015 թվականի սեպտեմբերի տվյալների համաձայն՝ քաղաքի բնակչությունը կազմում է 270 953 մարդ, իսկ բնակչության խտությունը՝ 1 250 մարդ/կմ²։ Քաղաքը զբաղեցնում է 217,32 կմ² տարածք։"},{"page_url":"https://en.wikipedia.org/wiki/Sievert","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/96/Dose_quantities_and_units.png","page_title":"Sievert","context_page_description":"The sievert is a derived unit of ionizing radiation dose in the International System of Units and is a measure of the health effect of low levels of ionizing radiation on the human body. The sievert is important in dosimetry and radiation protection, and is named after Rolf Maximilian Sievert, a Swedish medical physicist renowned for work on radiation dose measurement and research into the biological effects of radiation.\\nThe sievert is used for radiation dose quantities such as equivalent dose and effective dose, which represent the risk of external radiation from sources outside the body, and committed dose which represents the risk of internal irradiation due to inhaled or ingested radioactive substances. The sievert is intended to represent the stochastic health risk, which for radiation dose assessment is defined as the probability of radiation-induced cancer and genetic damage. One sievert carries with it a 5.5% chance of eventually developing fatal cancer based on the linear no-threshold model."},{"page_url":"https://gl.wikipedia.org/wiki/Gaivota","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4d/Gull_ca_usa.jpg","page_title":"Gaivota","context_page_description":"A dos láridos é unha familia de aves acuáticas da orde dos caradriformes e suborde dos laros.\\nComprende numerosas especies coñecidas vulgarmente en galego como gaivotas ou gavotas,\\nSon aves mariñas de mediano a gran porte. Tipicamente a súa plumaxe é gris, negra ou branca, frecuentemente con marcas negras na cabeza ou nas ás, e teñen as patas palmadas. Distribuídas por todo o mundo, moitas delas son aves abundantes e moi coñecidas nas súas espectivas áreas de distribución.\\nEstreitamente relacionadas cos membros da familia dos estérnidos e, máis afastadamente, coas aves zancudas, a maioría das súas especies pertencen ao xénero Larus, que é o tipo da suborde e da familia."},{"page_url":"https://en.wikipedia.org/wiki/List_of_Bohol_flora_and_fauna","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e1/Bromeliad200.jpg","page_title":"List of Bohol flora and fauna","context_page_description":"The Philippines supports a rich and varied flora with close botanical connections to Indonesia and mainland Southeast Asia. Forests cover almost one-half of the land area and are typically tropical, with the dominant family, Dipterocarpaceae, representing 75% of the stands. The forest also has vines, epiphytes, and climbers. Open grasslands, ranging up to 2.4 m in height, occupy one-fourth of the land area; they are man- made, the aftermath of the slash-and-burn agricultural system, and most contain tropical savanna grasses that are nonnutritious and difficult to eradicate. The diverse flora includes 8,000 species of flowering plants, 1,000 kinds of ferns, and 800 species of orchids.\\nSeventy to eighty percent of non-flying mammals in the Philippines are found nowhere else in the world.\\nCommon mammals include the wild hog, deer, wild carabao, monkey, civet cat, and various rodents. There are about 196 breeding species of birds, among the more numerous being the megapodes, button quail, jungle fowl, peacock pheasant, dove, pigeon, parrot, and hornbill."},{"page_url":"https://it.wikipedia.org/wiki/Suvorov_(Oblast%27_di_Tula)","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/32/Flag_of_Suvorov_%28Tula_oblast%29.png","page_title":"Suvorov (Oblast' di Tula)","context_page_description":"Suvorov è una città della Russia europea centrale. Appartiene amministrativamente al rajon Suvorovskij, del quale è il capoluogo.\\nSi trova nella parte occidentale della oblast', una novantina di chilometri a ovest del capoluogo regionale Tula."},{"page_url":"https://kk.wikipedia.org/wiki/%D0%9A%D0%B5%D1%81%D0%BA%D1%96%D0%BD%D0%B4%D0%B5%D0%BC%D0%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4f/Colonel_thomas_tupper_carter-campbell_of_possil.JPG","page_title":"Кескіндеме","context_page_description":"Кескіндеме, кескіндеу өнері — бейнелеу өнерінің бір саласы, белгілі бір заттың бетіне бояу арқылы салынатын көркем шығармалар атауы.\\nКескіндеме заттың сыр-сипатын, нәрсе мен кеңістіктің қарым-қатынасын, сәуле мен көлеңкенің құлпырымын үндестіре бейнелейтін көркемдік және танымдық қуатымен ерекшеленеді. Ол көрерменнің сезіміне, ойына әсер ету арқылы эстетикалық ләззат береді. Кескіндеме туындылары жеке бір тұлғаны, дара көріністі бейнелеп қана қоймай, күрделі сюжетке, оқиғаларға құрылған шытырман соқтығыстарды да бейнелеп, олардың мәнін ашады. Кескіндеме дәуірдің рухани мазмұны мен әлеуметтік дамуын бейнелеп қана қоймай, көрерменнің сезіміне, ойына әсер ету арқылы бейнеленген шындықтан тәлім алып, өзінше қорытынды жасауына себепкер болады. Сондықтан да Кескіндеменің қоғамдық-тәрбиелік мәні зор және ол деректемелік мағлұматта береді.\\nКескіндеменің пайдаланатын құралы - сәуле, бояу, рең. Сәулені бояу реңдерімен нәзік астастыру арқылы өмір құбылыстарының айқын да шынайы көріністері жасалады. Суретші шеберлігінің көрінер жері де осында."},{"page_url":"https://fr.wikipedia.org/wiki/Liste_de_mosqu%C3%A9es_de_Chine","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c8/%E7%A6%8F%E5%BB%BA%E7%9C%81%E6%B3%89%E5%B7%9E%E5%B8%82%E6%B8%85%E5%87%80%E5%AF%BA1.jpg","page_title":"Liste de mosquées de Chine","context_page_description":"Vous trouverez ci-dessous une liste partielle des mosquées de République populaire de Chine."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_personen_uit_Minneapolis","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ea/Prince.jpg","page_title":"Lijst van personen uit Minneapolis","context_page_description":"Deze lijst van personen geeft een overzicht van personen uit de Amerikaanse stad Minneapolis. De lijst omvat personen die in de stad geboren zijn, wonen of gewoond hebben en/of overleden zijn en is gerangschikt naar geboortejaar."},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/Ris_(Hautes-Pyr%C3%A9n%C3%A9es)","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/1f/Map_commune_FR_insee_code_65379.png","page_title":"Ris (Hautes-Pyrénées)","context_page_description":"Ris sī ūi-tī Hoat-kok Midi-Pyrénées toā-khu Hautes-Pyrénées koān ê chi̍t ê commune."},{"page_url":"https://de.wikipedia.org/wiki/Harry_von_de_Gass","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c7/Harry_von_de_Gass_004.JPG","page_title":"Harry von de Gass","context_page_description":"Harry von de Gass war ein Idsteiner Original. Ihm zu Ehren wurde am 28. August 2008 ein lebensgroßes Bronzedenkmal in der Idsteiner Fußgängerzone eingeweiht. Die hierfür benötigten rund 24.000 Euro wurden über Spenden von der Idsteiner Bevölkerung aufgebracht. Unter anderem gaben jugendliche Musiker der katholischen Pfarrei St. Martin ein erfolgreiches Benefizkonzert.\\nHarry Seegebarth kam im Alter von neun Jahren in das Idsteiner sozialpädagogische Zentrum Kalmenhof. Hier wohnte er bis zu seinem Tod. Er war in verschiedenen Bereichen, wie der Schneiderei, dem Hausdienst, der Korbmacherei, der Küche und zuletzt in der Wäscherei an der Mangel beschäftigt. Trotz seiner geistigen Behinderung erlangte er in seiner Heimatstadt besondere Bekanntheit als singender Straßenkehrer, der durch seine originelle Bekleidung auffiel. Er engagierte sich über vierzig Jahre als Messdiener in der Gemeinde St. Martin. Beim festlichen Einzug in die Kirche und bei Prozessionen trug er das Vortragekreuz. Zudem war er Ehrenmitglied im Pfadfinderstamm der Kirchengemeinde und wirkte bei vielen Veranstaltungen in der Stadt, z."},{"page_url":"https://et.wikipedia.org/wiki/Vibreeriva_prooviga_magnetomeeter","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f2/VSM_en.svg","page_title":"Vibreeriva prooviga magnetomeeter","context_page_description":"Vibreeriva prooviga magnetomeeter on seade aine magnetiliste omaduste mõõtmiseks. VSM abil saab uurida väikseid, kuni 10 mm² suurusi objekte ning see on üks tavalisemaid magnetomeetreid nii uurimislaborites kui tehastes. VSM kuulub induktiivsete mõõtmistehnikate klassi, mõõtes muutuva magnetvoo poolt korjepoolides indutseeritud pinget. Tänapäevase VSM-i tundlikkus on kuni 10⁻⁶ emu ning väljalahutus kuni 1 mOe. Varustades VSM-i krüostaadi või kuumutusmooduliga, saab selle seadme abil mõõta proove temperatuurivahemikus 4–1000 K. Eestis kasutatakse VSM-i Keemilise ja Bioloogilise Füüsika Instituudis, ühendatuna füüsikaliste omaduste mõõtmise süsteemiga."},{"page_url":"https://sr.wikipedia.org/wiki/Cretoxyrhina","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6e/MenuhaCretoxyrhinaMantelli.jpg","page_title":"Cretoxyrhina","context_page_description":"Cretoxyrhina представља изумрли род Lamniformesа који је живео приближно пре 107 до 73 милиона година, од касног албија до касног кампана у периоду горње креде. Типска врста, C. mantelli, се најчешће назива Ginsu shark. Постала је популарна захваљујући Гинсу ножевима, јер се њихов теоријски механизам храњења често упоређује са сечењем када се користи нож. Cretoxyrhina је традиционално класификована као, вероватно, једини члан породице Cretoxyrhina, али су предложене друге таксономске породице, као што су Alopiidae и Lamnidae.\\nДужина износи осам метара, а тежина 3400 килограма, Cretoxyrhina је била једна од највећих морских паса свог времена. Имајући сличан изглед као модерна велика бела ајкула, био је врховни предатор у свом екосистему и плен великим морским животињама, укључујући мосасауре и плезиосауре, ајкуле и друге велике рибе, птеросауре и повремено диносаурусе. Зуби су величине осам центиметара и имали су густу глеђ која је служила за убадање и резање плена. Cretoxyrhina је и међу морским псима била она која најбрже плива, способна да прогони плен брзином и до 70 километара на сат."},{"page_url":"https://oc.wikipedia.org/wiki/Valognes","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0b/Valognes_-_Place_Vicq_d%27Azir.jpg","page_title":"Valognes","context_page_description":"Valognes es una comuna normanda, situada dins lo departament de la Marga e la region de la Bassa Normandia."},{"page_url":"https://fr.wikipedia.org/wiki/Serres_royales_de_Laeken","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/72/Laeken_Se1a.jpg","page_title":"Serres royales de Laeken","context_page_description":"Les serres royales de Laeken sont une construction architecturale composée de métal et de verre, réalisée par l'architecte Alphonse Balat dans le parc attenant au château royal de Laeken à l'initiative de Léopold II."},{"page_url":"https://de.wikipedia.org/wiki/St._Peter_(Klagenfurt_am_W%C3%B6rthersee)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a5/Welzenegg_Westseite_mit_Portal_01.jpg","page_title":"St. Peter (Klagenfurt am Wörthersee)","context_page_description":"St. Peter ist der 10. Bezirk der Kärntner Landeshauptstadt Klagenfurt am Wörthersee."},{"page_url":"https://nl.wikipedia.org/wiki/Saint-Stail","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e2/Saint-Stail-88210.jpg","page_title":"Saint-Stail","context_page_description":"Saint-Stail is een gemeente in het Franse departement Vosges en telt 74 inwoners. De plaats maakt deel uit van het arrondissement Saint-Dié-des-Vosges."},{"page_url":"https://de.wikipedia.org/wiki/Stefan_Laufer","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/58/ProfLaufer.jpg","page_title":"Stefan Laufer","context_page_description":"Stefan Laufer ist ein deutscher Apotheker und Professor für Pharmazeutische Chemie an der Eberhard Karls Universität Tübingen."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%9C%D0%BE%D1%81%D1%82%D0%B0%D1%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/be/Mostar_-_Stari_Most.jpg","page_title":"Мостар","context_page_description":"Мостар е град и община в Босна и Херцеговина. Той е най-голямото и сред най-важните селища в област Херцеговина, както и административен център на Херцеговско-неретванския кантон от Федерация Босна и Херцеговина.\\nРазположен на двата бряга на река Неретва, градът е 5-и по население в страната. Сред най-големите му забележителности е Стари мост, част от световното културно наследство на ЮНЕСКО. Според версия именно от построения през XVI век мост произлиза топонимът Мостар."},{"page_url":"https://pl.wikipedia.org/wiki/Joya_de_Cer%C3%A9n","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7e/Structure_12.jpg","page_title":"Joya de Cerén","context_page_description":"Joya de Cerén – stanowisko archeologiczne cywilizacji Majów położone w departamencie La Libertad w południowo-zachodnim Salwadorze. Zawiera dobrze zachowane pozostałości rolniczej osady, która w VII wieku została pokryta wulkanicznym popiołem.\\nW 1993 roku stanowisko zostało wpisane na listę światowego dziedzictwa UNESCO."},{"page_url":"https://sv.wikipedia.org/wiki/Solenopsis_globularia","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/33/Solenopsis_globularia_casent0104814_head_1.jpg","page_title":"Solenopsis globularia","context_page_description":"Solenopsis globularia är en myrart som först beskrevs av Smith 1858. Solenopsis globularia ingår i släktet eldmyror, och familjen myror."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%B7%D8%A7%D8%A6%D8%B1_%D9%86%D9%88%D8%A1_%D9%84%D9%8A%D8%AA%D8%B4","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2f/Oceanodroma_leucorhoa_MHNT_ZOO_2010_11_42_Fair_Isle_-_Naurois.jpg","page_title":"طائر نوء ليتش","context_page_description":"طائر نوء ليتش هو طائر ينتمي إلى طيور النوء."},{"page_url":"https://az.wikipedia.org/wiki/Banksia_littoralis","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/23/Banksia_littoralis_01_gnangarra.jpg","page_title":"Banksia littoralis","context_page_description":"Banksia littoralis – proteyakimilər fəsiləsinin banksiya cinsinə aid bitki növü."},{"page_url":"https://de.wikipedia.org/wiki/Okres_Hradec_Kr%C3%A1lov%C3%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4c/Map_CZ_-_district_Hradec_Kralove.PNG","page_title":"Okres Hradec Králové","context_page_description":"Der Okres Hradec Králové ist ein Bezirk im Královéhradecký kraj in Tschechien. Bezirksstadt ist Hradec Králové.\\nDer Okres Hradec Králové befindet sich inmitten Ostböhmens. Nördlich hat er gemeinsame Grenzen mit Okres Jičín, Trutnov und Náchod, im Osten mit Okres Rychnov nad Kněžnou, im Süden mit Okres Pardubice und im Westen mit der Mittelböhmischen Region und dessen Bezirken Okres Nymburk und Okres Kolín. Die Fläche beträgt rund 892 km². Er ist damit der drittkleinste Bezirk in der Region, nach der Einwohnerzahl allerdings der größte Bezirk mit etwa 163.671 Einwohnern. Die Bevölkerungsdichte beträgt 180 Einwohner/km². Der Bezirk besteht aus leichten Anhöhen mit etwa 132 bis 334 m ü. M. Das Klima ist angenehm, der Süden wärmer und trockener, der Norden leicht feucht."},{"page_url":"https://th.wikipedia.org/wiki/%E0%B9%80%E0%B8%94%E0%B8%A3%E0%B9%82%E0%B8%81_%E0%B8%A1%E0%B8%B1%E0%B8%A5%E0%B8%9F%E0%B8%AD%E0%B8%A2","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7b/Harry_Potter_studio_tour-_Life_size_Draco_Malfoy_dummy.jpg","page_title":"เดรโก มัลฟอย","context_page_description":"เดรโก มัลฟอย หนึ่งในตัวละครหลักของนวนิยายชุด \\"แฮร์รี่ พอตเตอร์\\" ของ เจ. เค. โรว์ลิง ซึ่งปรากฏตัวครั้งแรกใน \\"แฮร์รี่ พอตเตอร์กับศิลาอาถรรพ์\\" ตอนที่แฮร์รี พอตเตอร์ เข้าไปในร้านมาดามมัลกินส์ที่ตรอกไดอากอน ตอนที่เขามาที่โลกเวทมนตร์ครั้งแรก และได้พูดคุยกันเล็กน้อย โดยที่ โรงเรียนฮอกวอตส์นั้น เขาเป็นที่รู้จักในฐานะ คู่กัด ของ แฮร์รี่ พอตเตอร์ นับตั้งแต่ เขาถูกอีกฝ่ายปฏิเสธเป็นมิตรภาพในตอนปีหนึ่ง โดย เดรโก มัลฟอยนั้นมักจะมีผู้ติดตาม 2 คน คือ วินเซนต์ แครบ และ เกรกอรี่ กอยล์\\nในภาคภาพยนตร์นั้น เดรโก มัลฟอย นั้นรับบทโดย ทอม เฟลตัน"},{"page_url":"https://sk.wikipedia.org/wiki/Starovek%C3%A9_umenie","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0c/07Erechteion_Kore02.jpg","page_title":"Staroveké umenie","context_page_description":"Staroveké umenie je súčasť starovekej kultúry, dlhá epocha vo vývoji umenia, ktorá nasledovala po pravekom umení a predchádzala stredovekému umeniu, a ktorá je spätá so vznikom a rozvojom najstarších otrokárskych spoločností. Tieto civilizácie boli miestne neraz tak vzdialené, že sa ich kultúry vyvíjali nezávisle od seba. Teritoriálne časovo blízke civlizácie sa naopak ovplyvňovali, alebo dokonca vytvárali spoločné kultúrne oblasti."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%A4%E3%82%B9%E3%82%BF%E3%83%B3%E3%83%96%E3%83%BC%E3%83%AB%E5%A4%A7%E5%AD%A6","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/7f/Istanbul_University_campus_ruins_March_2008d.JPG","page_title":"イスタンブール大学","context_page_description":"イスタンブール大学はトルコのイスタンブールにある国立大学である。メインキャンパスは旧市街中心部のバヤズィト広場に面する。\\n現在、上海交通大学が発表している世界大学学術ランキングにはトルコの6大学がランクインしている。その中でイスタンブール大学は2006年より全世界の上位500大学に、アジア太平洋地域では100位以内にランクインしている。"},{"page_url":"https://de.wikipedia.org/wiki/Black_Ball_Line","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bb/Black_Ball_Jacobsen.jpg","page_title":"Black Ball Line","context_page_description":"Die Black Ball Line von C. H. Marshall & Co. war die erste Schifffahrtslinie, die regelmäßig Passagen über den Atlantik anbot. Die Flagge der Gesellschaft zeigte einen schwarzen Ball auf rotem Grund."},{"page_url":"https://fr.wikipedia.org/wiki/Architecture_r%C3%A9trospectiviste_en_Russie","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/08/Tolst7.JPG","page_title":"Architecture rétrospectiviste en Russie","context_page_description":"L'architecture rétrospectiviste ou architecture néo-classique en Russie s'est développée durant le dernier tiers du XIXᵉ siècle et le début du XXᵉ siècle. Elle a fait appel à la tradition artistique, soit de l'Antiquité classique, soit de l'époque de la Renaissance ou encore au classicisme. Dans l'histoire de l'art, dans les autres pays que la Russie, le terme néo-classicisme désigne les manifestations de l'architecture et des arts visuels qui sont apparues dans la seconde moitié du XVIIIᵉ siècle et le premier tiers du XIXᵉ siècle à la différence du classicisme proprement dit apparu plus précocement, c'est-à-dire au XVIIᵉ siècle."},{"page_url":"https://it.wikipedia.org/wiki/Bicaz-Chei","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bc/Chei_Bicaz_043.jpg","page_title":"Bicaz-Chei","context_page_description":"Bicaz-Chei è un comune della Romania di 4.798 abitanti, ubicato nel distretto di Neamț, nella regione storica della Moldavia.\\nIl comune è formato dall'unione di 4 villaggi: Bicaz-Chei, Bârnadu, Gherman, Ivaneș.\\nIl comune prende nome dalle Gole del Bicaz, un lungo orrido formato dal fiume Bicaz che costituisce uno stretto passaggio che unisce la Moldavia alla Transilvania."},{"page_url":"https://ca.wikipedia.org/wiki/Los_%C3%81ngeles_(Xile)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c3/Artturooh%21_032.JPG","page_title":"Los Ángeles (Xile)","context_page_description":"Los Ángeles és un municipi i ciutat de Xile. És la capital i la ciutat més poblada de la província de Biobío, situat a la regió del Biobío, en el centre-sud de Xile, a 510 km de Santiago de Xile, la capital del país.\\nÉs una de les ciutats amb major creixement a Xile en les últimes dècades; els resultats preliminars del cens de 2012 va mostrar que la comuna tenia 187.000 habitants, el que la converteix en la sisena ciutat més gran amb més població al sud de Santiago, després de la Concepció, Temuco, Rancagua, Puerto Montt i Talca."},{"page_url":"https://eo.wikipedia.org/wiki/Dekolta%C4%B5o","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d9/Happy_Dutch_beauty.jpg","page_title":"Dekoltaĵo","context_page_description":"Dekoltaĵo estas maniero, kiel vesto ĉirkaŭ kaj malsupre de la kolo estas tajlita aŭ dekoltita. La formo de dekoltaĵo dependas de la sekso de la vestanto kaj de la modo."},{"page_url":"https://en.wikipedia.org/wiki/Julius_von_Klever","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a3/Julius_von_Klever_Reisigsammler_1911.jpg","page_title":"Julius von Klever","context_page_description":"Julius Sergius von Klever was a Russian landscape painter of Baltic-German ancestry."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E8%81%94%E7%9B%9FTMA-4","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/eb/Soyuz_TMA-4_launch.jpg","page_title":"联盟TMA-4","context_page_description":"聯盟TMA-4是俄羅斯聯盟計劃的載人飛船任務。2004年4月19日，聯盟TMA-4飛船由聯盟-FG運載火箭在哈薩克斯坦拜科努爾發射場成功發射，為國際太空站送去2名遠征9任務隊員和1名短期考察的歐洲太空人。\\n飛船返回艙於2004年10月24日0時36分在哈薩克斯坦預定地點安全著陸。"},{"page_url":"https://lv.wikipedia.org/wiki/Ork%C4%81na_palma","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/29/Dictyosperma_album4.JPG","page_title":"Orkāna palma","context_page_description":"Orkāna palma ir palmu dzimtas suga, kas sastopama Maskarēnu salās Indijas okeāna rietumu daļā. Tā ir vienīgā Dictyosperma ģints pārstāve. Palmas savvaļas populācijas ir tuvu izmiršanai.\\nPieaugušas orkāna palmas lieliski un graciozi slejas gar piekrasti orkānu un vētru zonā. Savukārt mazus stādiņus iespējams audzēt arī iekštelpu apstākļos.\\nKoku serdi uzskata par delikatesi un izmanto salātos un marinādē."},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/Landerd","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6a/Overzicht_-_Reek_-_20362140_-_RCE.jpg","page_title":"Landerd","context_page_description":"Landerd sī Hô-lân Pak-Brabant Séng ê chi̍t-ê ki-chân chèng-koân. Choân siâⁿ jîn-kháu 15295 lâng."},{"page_url":"https://de.wikipedia.org/wiki/FamilienGesundheitsZentrum_Neuhofstra%C3%9Fe","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8e/Standort_des_Frauengesundheitszentrums_im_Hinterhaus_der_Neuhofstrasse_32_seit_1988.JPG","page_title":"FamilienGesundheitsZentrum Neuhofstraße","context_page_description":"Das FamilienGesundheitsZentrum Neuhofstraße wurde 1978 gegründet und war bis 1988 ein Arbeitsbereich des autonomen Feministischen Frauengesundheitszentrums in Frankfurt am Main. Gemeinsam kritisierten die Aktivistinnen der neuen Frauenbewegung die männlich geprägte und schulmedizinisch orientierte Gynäkologie. Die Gründerinnen des FGZN entwickelten in diesem Rahmen Alternativen zur vorherrschenden Schwangerschafts- und technisierten Geburtspraxis. Mit dem Ziel einer selbstbestimmten Geburtshilfe arbeiteten sie eng mit Hebammen zusammen, organisierten ambulante und Hausgeburten, bauten ein Geburtshaus auf und entwickelten einen neuen Ausbildungsweg für Geburtsvorbereiterinnen.\\nSeit 1988 arbeitet das Frauengesundheitszentrum als Familienzentrum: Kurse sowie Hilfs- und Beratungsangebote zu Schwangerschaft und Geburt, zu Elternschaft und anderen Gesundheitsthemen richten sich an Frauen, Männer und Familien."},{"page_url":"https://id.wikipedia.org/wiki/Pangkat_Angkatan_Udara_Tentara_Pembebasan_Rakyat","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d0/PLAAF-0710-CDT.png","page_title":"Pangkat Angkatan Udara Tentara Pembebasan Rakyat","context_page_description":"Pangkat Angkatan Udara Tentara Pembebasan Rakyat mirip dengan Pangkat Angkatan Darat Tentara Pembebasan Rakyat, hanya saja dalam Angkatan Udara diawali oleh kata 空军 yang berarti Angkatan Udara.\\nPada 1955, tanda pangkat yang digunakan mengikuti model Angkatan Udara Soviet hingga dihapus pada 1965, setelah itu dipulihkan pada 1988 dengan beberapa penyesuaian."},{"page_url":"https://de.wikipedia.org/wiki/Dreieinigkeitskirche_(Gr%C3%A4fenberg)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fe/Gr%C3%A4fenberg_Orgel_20190929-RM-9292828.jpg","page_title":"Dreieinigkeitskirche (Gräfenberg)","context_page_description":"Die Dreieinigkeitskirche in Gräfenberg ist Pfarrkirche der Stadt Gräfenberg und Sitz des evangelischen Dekanates Gräfenberg. Mit der Einführung der Reformation in Gräfenberg 1528 wurde die Kirche evangelisch."},{"page_url":"https://arz.wikipedia.org/wiki/%D8%B1%D8%A7%DA%86%D9%8A%DA%A4_%D8%AC%D8%A7%D9%86%D8%AF%D9%89","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5c/Rajiv_Gandhi_%28cropped%29.jpg","page_title":"راچيڤ جاندى","context_page_description":"راجيف غاندى - بالهندی: राजीव गांधी -، رئيس وزرا الهند التاسع من اكتوبر 1984 لغاية اغتياله فى 21 مايو 1991. ابن رئيسة وزرا الهند انديرا جاندى و حفيد جواهرلال نيهرو."},{"page_url":"https://bg.wikipedia.org/wiki/Myiodynastes_hemichrysus","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/10/Myiodynastes_hemichrysus_-Costa_Rica-8.jpg","page_title":"Myiodynastes hemichrysus","context_page_description":"Myiodynastes hemichrysus е вид птица от семейство Tyrannidae."},{"page_url":"https://id.wikipedia.org/wiki/Jennifer_Ehle","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/Jennifer_Ehle_%2830443863926%29.jpg","page_title":"Jennifer Ehle","context_page_description":"Jennifer Anne Ehle adalah seorang aktris Amerika. Ia memenangkan BAFTA TV Award untuk Aktris Terbaik atas perannya sebagai Elizabeth Bennet dalam miniseri BBC 1995 Pride and Prejudice."},{"page_url":"https://zh.wikipedia.org/wiki/%E9%8F%9E%E8%A8%98%E9%85%92%E5%AE%B6","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/dd/Yung_Kee_Restaurant_Interior_2008.jpg","page_title":"鏞記酒家","context_page_description":"鏞記是香港知名食肆，以炭燒燒鵝馳名，店址位於中環威靈頓街，其分店位於香港赤臘角國際機場。"},{"page_url":"https://fr.wikipedia.org/wiki/Mont-Bonvillers","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a0/Eglise_Mont_Bonvillers_Bonvillers.jpg","page_title":"Mont-Bonvillers","context_page_description":"Mont-Bonvillers est une commune française située dans le département de Meurthe-et-Moselle en région Grand Est."},{"page_url":"https://da.wikipedia.org/wiki/Skjold-dipelta","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/Dipelta_floribunda-Jardin_des_plantes_05.JPG","page_title":"Skjold-dipelta","context_page_description":"Skjold-dipelta er en løvfældende busk med en opret vækst og lyserøde, duftende blomster. Selv om arten er noget sart under danske forhold ses den dog af og til plantet i større haver og parker."},{"page_url":"https://sh.wikipedia.org/wiki/Adaprolol","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1d/Adaprolol.png","page_title":"Adaprolol","context_page_description":"Adaprolol je beta blokator."},{"page_url":"https://fy.wikipedia.org/wiki/Territoarium_Alaska","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a8/US_troops_at_the_Battle_of_Attu.jpg","page_title":"Territoarium Alaska","context_page_description":"It Territoarium Alaska wie de oantsjutting foar Alaska as bestjoerlike ienheid fan 1912, doe't it ta in organisearre territoarium omfoarme waard út it Distrikt Alaska, oant 1959, doe't it as folweardige steat opnommen waard yn 'e Feriene Steaten. As organisearre territoarium krige Alaska foar it earst in eigen regear dat oprjochte waard troch in wet fan it Amerikaanske Kongres. Foartiid waard it bestjoerd as in ûnorganisearre territoarium. Yn 'e 47 jier dat it Territoarium Alaska bestie, wie de Twadde Wrâldoarloch it meast yngripende barren, doe't in diel fan it territoarium beset waard troch Japan en befrijd wurde moast ûnder de Aleoetenkampanje."},{"page_url":"https://en.wikipedia.org/wiki/Thomas_S._Martin","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/58/Thomas_Staples_Martin.jpg","page_title":"Thomas S. Martin","context_page_description":"Thomas Staples Martin was an American lawyer and Democratic Party politician from Albemarle County, Virginia, who founded a political organization that held power in Virginia for decades and who personally became a U.S. Senator who served for nearly a quarter century and rose to become the Majority Leader before dying in office."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%85%D8%A7%D9%86%D9%81%D8%B1%D9%8A%D8%AF_%D8%B3%D8%A8%D8%A7%D9%8A%D8%B3","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/41/Manfred_spies_selbstportr%C3%A4t.jpg","page_title":"مانفريد سبايس","context_page_description":"مانفريد سبايس ‏ هو فنان، ومصمم، ومصور ألماني، ولد في دوسلدورف."},{"page_url":"https://azb.wikipedia.org/wiki/%D9%81%D8%B1%D8%A7%D9%86%DA%A9_%D8%B1%DB%8C%D8%B2%D9%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2b/Frank_Rizzo_1972.jpg","page_title":"فرانک ریزو","context_page_description":"فرانک ریزو آمریکالی سیاستچی و دموکرات حزبینین عوضوو."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkm%C3%A4ler_in_Treysa","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0e/Klostergasse_2%2C_3%2C_Treysa%2C_Schwalmstadt%2C_Schwalm-Eder-Kreis.jpg","page_title":"Liste der Kulturdenkmäler in Treysa","context_page_description":"Die folgende Liste enthält die in der Denkmaltopographie ausgewiesenen Kulturdenkmäler auf dem Gebiet des Ortsteils Treysa der Stadt Schwalmstadt, Schwalm-Eder-Kreis, Hessen.\\nHinweis: Die Reihenfolge der Denkmäler in dieser Liste orientiert sich an der Anschrift, alternativ ist sie auch nach der Bezeichnung oder der Bauzeit sortierbar.\\nGrundlage ist die Veröffentlichung der hessischen Denkmalliste, die auf Basis des Denkmalschutzgesetzes vom 5. September 1986 erstmals erstellt und seither laufend ergänzt wurde."},{"page_url":"https://fr.wikipedia.org/wiki/Alexander_Zverev","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6f/2017_Citi_Open_Tennis_Alexander_Zverev_%2835509214404%29.jpg","page_title":"Alexander Zverev","context_page_description":"Alexander Zverev, né le 20 avril 1997 à Hambourg, est un joueur de tennis professionnel allemand.\\nSur le circuit junior, il s'illustre en 2013 en étant finaliste des Internationaux de France de tennis 2013 et champion du monde la même année. En 2014, il remporte l'Open d'Australie en simple garçons.\\nIl intègre le circuit professionnel ATP en 2013 et remporte son premier titre en simple en 2016, à Saint-Pétersbourg. Il a remporté trois tournois Masters 1000 : à Rome et à Montréal en 2017 en battant respectivement en finale Novak Djokovic et Roger Federer, puis à Madrid en 2018 contre Dominic Thiem, ainsi que les Masters 2018, en battant Novak Djokovic, numéro 1 mondial, en finale après avoir sorti Roger Federer en demi-finale."},{"page_url":"https://ca.wikipedia.org/wiki/Castell_de_Santo_Ant%C3%B3n","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9a/Entrada_del_Castillo_de_San_Ant%C3%B3n.jpg","page_title":"Castell de Santo Antón","context_page_description":"El castell de Santo Antón és un castell del segle XVI que formava part, juntament amb els castells de Santa Cruz i San Diego, d'una xarxa estratègica de castells i bateries per a la defensa de la ciutat de la Corunya, a Galícia.\\nFou declarat Monument Històric Artístic el 1949 i des de 1994 té la consideració de Bé d'interès cultural en la categoria de monument. Des de la seva inauguració el 1968 alberga el Museu Arqueològic i Històric de la Corunya."},{"page_url":"https://nl.wikipedia.org/wiki/Kebun_Raya_Bogor","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6d/BogorTreubLaboratorium2018.jpg","page_title":"Kebun Raya Bogor","context_page_description":"De Kebun Raya Bogor, tot 1949 's Lands Plantentuin te Buitenzorg, is een hortus botanicus in de Indonesische stad Bogor, voorheen Buitenzorg."},{"page_url":"https://en.wikipedia.org/wiki/Monte_Vista_Elementary_School_(Albuquerque,_New_Mexico)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0e/Monte_Vista_Elementary_School%2C_rear%2C_Albuquerque_NM.jpg","page_title":"Monte Vista Elementary School (Albuquerque, New Mexico)","context_page_description":"Monte Vista Elementary School is a public elementary school in the Nob Hill neighborhood of Albuquerque, New Mexico, whose campus is listed in the New Mexico State Register of Cultural Properties and the National Register of Historic Places. It is notable as one of the city's best examples of Mediterranean Revival architecture and as the historical focal point of the surrounding neighborhood."},{"page_url":"https://en.wikipedia.org/wiki/Nicaragua","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e2/HuellasdeAcahualinca.jpg","page_title":"Nicaragua","context_page_description":"Nicaragua, officially the Republic of Nicaragua, is the largest country in the Central American isthmus, bordered by Honduras to the northwest, the Caribbean to the east, Costa Rica to the south, and the Pacific Ocean to the southwest. Managua is the country's capital and largest city and is also the third-largest city in Central America, behind Tegucigalpa and Guatemala City. The multi-ethnic population of six million includes people of indigenous, European, African, and Asian heritage. The main language is Spanish. Indigenous tribes on the Mosquito Coast speak their own languages and English.\\nOriginally inhabited by various indigenous cultures since ancient times, the region was conquered by the Spanish Empire in the 16th century. Nicaragua gained independence from Spain in 1821. The Mosquito Coast followed a different historical path, being colonized by the English in the 17th century and later coming under British rule. It became an autonomous territory of Nicaragua in 1860 and its northernmost part was transferred to Honduras in 1960."},{"page_url":"https://eu.wikipedia.org/wiki/Valea_Ia%C8%99ului","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9a/Biserica_de_lemn_din_B%C4%83rb%C4%83l%C4%83te%C5%9FtiAG01.jpg","page_title":"Valea Iașului","context_page_description":"Valea Iașului Errumaniako udalerri bat da, Argeș konderrian. 2.533 biztanle ditu, 27 kilometro koadroko azaleran banatuta."},{"page_url":"https://eo.wikipedia.org/wiki/Herkus_Mantas","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b1/HerkusMantas.jpg","page_title":"Herkus Mantas","context_page_description":"Herkus Mantas - jen litove; prapruse Erkus Mants, latine Henricus Montemin, germane Henrich Monte, pole duonlitove-duongermane Herkus Monte - estis komandanto de gento Natangoj dum la dua praprusa ribelo en 1260-1274. Dum juneco li estis donita kiel la sklavo al kavaliroj de la Germana Ordeno kaj estis edukita en Magdeburgo. Post la malvenko de la Germana Ordeno en la batalo ĉirkaŭ Durbe li startis estri la rebelion. La 22-an de januaro li venkis armee principe superan soldataron de la Germana Ordeno. En 1262 li estis vundita dum sieĝo de la germana fortikita urbo Königsberg, kiu nur fondiĝis en 1255, do dum la sieĝo ankoraŭ estis juna. En jaro 1263 li ĉirkaŭ la urbo Lubawa venkis germajajn trupojn estritaj de kavaliro Helemrich von Wirzeburch, kiu forpasis dum la batalo. Herkus mortis en 1273 perfidita de lia servisto. La lernejo en Kamińsk, vilaĝo nun apartenanta al la komunumo Górowo Iławeckie de Pollando, estas patronata de Herkus Mantas, kaj en la nun litova urbo Klaipėda pluraj monumentoj, stratoj kaj publikaj konstruaĵoj memorigas pri li."},{"page_url":"https://no.wikipedia.org/wiki/Sulitjelmavassdraget","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/Gikenelva_from_above.jpg","page_title":"Sulitjelmavassdraget","context_page_description":"Sulitjelmavassdraget er et vassdrag i Fauske kommune i Nordland. Hovedelva i vassdraget er Sjønståelva, men det omfatter også de nedenforliggende innsjøene Øvervatnet og Nervatnet, som munner ut i Skjerstadfjorden gjennom Finneidstraumen ved Finneid øst for Fauske.\\nVassdraget har utspring i fjellområdene rundt Sulitjelma og Balvatnet. Dets fjerneste kilde er nordøst for fjellet Bálldoajvve, og herfra renner Sølvbekkelva mot sør i retning Balvatnet. Fra Balvatnet renner Balvasselva og deretter Balmielva nordover til Langvatnet, hvor også flere andre elver munner ut. Fra Langvatnet renner Sjønståelva vestover til Øvervatnet. Vassdraget drenerer store deler av Sulitjelmafjellene inkludert vestlige deler av breene Blåmannsisen og Sulitjelmaisen, samt Balvatnet. Andre store innsjøer i tilknytning til vassdraget er Storelvvatnan, Låmivatnet, Eidevatnet, Fisklausvatnet, Stor-Rosnivatnet, Kjelvatnet og Stor-Dorro.\\nRegnet fra Finneidstraumen har vassdraget en lengde på 90,7 km, og et nedbørfelt på 1 029,95 km². Middelvannføringen ved munningen er 48,1 m³/s."},{"page_url":"https://hr.wikipedia.org/wiki/Bingadinsko_asfaltno_jezero","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/19/Skull_of_fossil_horse.JPG","page_title":"Bingadinsko asfaltno jezero","context_page_description":"Bingadinsko asfaltno jezero asfaltno je jezero u Azerbajdžanu koje se nalazi 7 km sjeverozapadno od Bakua i 0,5 kilometara jugoistočno od Bingadija, na području Bingadinskoga rajona Bakua. Bingadinsko asfaltno jezero poznato je po velikome broju iskopanih primjeraka biljaka i životinja iz kvartarskoga razdoblja. Nalazi iskopanih biljaka i životinja izloženi su u bakuanskome Prirodoslovnome muzeju „Hasan bej Zardabi“ Geološkog instituta Azerbajdžanske nacionalne akademije znanosti.\\nDana 30. rujna 1998. iskopani primjerci biljaka i životinja Bingadinskoga asfaltnoga jezera postali su kandidati za uvrštavanje na UNESCO-ov Popis svjetske baštine u Azerbajdžanu."},{"page_url":"https://ro.wikipedia.org/wiki/San_Giovanni_Rotondo","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/56/PIC_023.jpg","page_title":"San Giovanni Rotondo","context_page_description":"San Giovanni Rotondo este o comună din provincia Foggia, regiunea Puglia, Italia, cu o populație de 27.440 de locuitori și o suprafață de 261.88 km²."},{"page_url":"https://ca.wikipedia.org/wiki/Brian_Cox_(f%C3%ADsic)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f1/Professor_Brian_Cox_OBE_FRS.jpg","page_title":"Brian Cox (físic)","context_page_description":"Professor Brian Edward Cox OBE FRS és un físic anglès i professor de física de partícules a l'School of Physics and Astronomy de la Universitat de Manchester. És més conegut pel públic com a presentador de programes de televisió de divulgació científica, especialment la sèrie Wonders of... i per llibres de divulgació científica, com per exemple Why Does E=mc²? i The Quantum Universe. Ha estat autor i coautor de més de 950 publicacions científiques.\\nCox ha estat descrit com el successor natural dels programes científics de la BBC tant per David Attenborough com per Patrick Moore. Abans de la seva carrera acadèmica, Cox va ser teclista de les bandes britàniques D:Ream i Dare."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E5%8A%A0%E6%8B%BF%E5%A4%A7%E5%9B%BD%E5%AE%B6%E5%85%AC%E5%9B%AD%E5%88%97%E8%A1%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/Lake_O_Hara_from_Yukness_Ledge_Alpine_Route.jpg","page_title":"加拿大国家公园列表","context_page_description":"加拿大國家公園是依據加拿大國家公園法案設立保護區，由加拿大政府擁有。國家公園保留地是已經按照國家公園標準設立但尚未正式認定的國家公園，屬於國家公園系統的一部份。加拿大一共設立了39個國家公園和8個國家公園保留地，分布在10個省和3個地區，總面積達303,571平方公里，約占全國土地面積的3%。加拿大公園管理局負責管理加拿大國家公園和國家公園保留地，首要任務為保護這些地區的生態完整，其次為幫助人們探索研究和享受這些區域的自然空間 。廣義的國家公園還包括四個國家海洋保護區域和一個國家地標。"},{"page_url":"https://et.wikipedia.org/wiki/Vectil%C5%BEa_vald","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/81/Vectil%C5%BEas_pagasts_LocMap.png","page_title":"Vectilža vald","context_page_description":"Vectilža vald on vald Lätis Balvi piirkonnas. Enne 2009. aasta haldusreformi kuulus vald Balvi rajooni.\\nVald piirneb sama piirkonna Bērzkalne, Lazduleja ja Tilža vallaga, samuti ka Rugāji piirkonna Lazdukalnsi ning Rugāji vallaga.\\nValla pindala on 99 km². 2016. aasta seisuga elas seal 444 inimest. Aastal 2011 elas vallas 401 lätlast, 18 venelast, 4 valgevenelast ja 5 ukrainlast Valla keskus on Vectilža küla. Vallamaja asub aadressil Melderu iela 2, vallavanem on Genovefa Jermacāne."},{"page_url":"https://sw.wikipedia.org/wiki/Morioka,_Iwate","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/90/Morioka_and_Mount_Iwate_and_River_Kitakami_in_May_2019.jpg","page_title":"Morioka, Iwate","context_page_description":"Morioka ndiyo mji mkuu katika mkoa wa Iwate. Kwa mujibu wa sensa iliyofanyika mnamo mwaka wa 2009, mji una wakazi wapatao 300 000 wanaoishi katika mji huu."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%A1%E3%83%95%E3%83%AA%E3%83%BC%E3%82%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8e/Caravanserai_Zein-o_Din.jpg","page_title":"メフリーズ","context_page_description":"メフリーズとは、イランの都市で、ヤズド州メフリーズ郡の郡中心市に定められている。2012年の調査では人口28,263人。\\nメフリーズのパフラヴァーンプール庭園はガージャール朝時代に建設された庭園であり、2011年にUNESCOの世界遺産に登録された「ペルシャ式庭園」の一部を構成する。また、メフリーズ近郊にはイラン唯一の球状のキャラヴァンサライであるゼイノッディーン・キャラヴァンサライが建つ。ゼイノッディーン・キャラヴァンサライはサファヴィー朝のアッバース1世の治世に建てられたもので、現在はホテルとして使用されている。"},{"page_url":"https://es.wikipedia.org/wiki/Television_Infrared_Observation_Satellite","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8c/TIROS_IX_Spac0021-repair.jpg","page_title":"Television Infrared Observation Satellite","context_page_description":"Television Infrared Observation Satellite o TIROS, es una serie de los primeros satélites meteorológicos puestos en marcha por Estados Unidos, comenzando con el lanzamiento del TIROS-1 en 1960. TIROS fue el primer satélite que era capaz de teleobservar la Tierra, lo que permitió a los científicos verla en una nueva perspectiva desde el espacio.​\\nEl programa, impulsado por Harry Wexler, demostró la utilidad de la observación del tiempo atmosférico por satélite, a la vez que los satélites militares de reconocimiento fueron desarrollándose en secreto. TIROS demostró en ese momento que la clave del éxito es, a menudo, la sencillez​"},{"page_url":"https://fi.wikipedia.org/wiki/Opel_Vivaro","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/Opel_Vivaro_Combi_1.6_BiTurbo_CDTI_ecoFLEX_%28B%29_%E2%80%93_Frontansicht%2C_7._Oktober_2015%2C_D%C3%BCsseldorf.jpg","page_title":"Opel Vivaro","context_page_description":"Opel Vivaro on Opelin vuodesta 2001 lähtien valmistama keskikokoinen pakettiautomalli, joka korvasi Opel Arenan. Isossa-Britanniassa sitä myydään Vauxhall-merkkisenä."},{"page_url":"https://es.wikipedia.org/wiki/Vernix","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/76/Map_commune_FR_insee_code_50628.png","page_title":"Vernix","context_page_description":"Vernix es una población y comuna francesa, situada en la región de Baja Normandía, departamento de Mancha, en el distrito de Avranches y cantón de Brécey."},{"page_url":"https://cs.wikipedia.org/wiki/Moravskoslezsk%C3%BD_kraj","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0d/Ostrava%2C_katedr%C3%A1la_Bo%C5%BEsk%C3%A9ho_Spasitele.JPG","page_title":"Moravskoslezský kraj","context_page_description":"Moravskoslezský kraj je jedním ze 14 vyšších územních samosprávných celků v Česku. Žije zde přibližně 1,20 milionu obyvatel.\\nTento kraj se nachází na severovýchodě České republiky. Z větší části leží v Českém Slezsku, zbývající část zabírá severovýchod a malý kousek severu Moravy. Hranici mezi těmito historickými zeměmi v kraji v převážné většině tvoří řeky Odra a Ostravice. Na západě kraje je severní Morava zastoupena jihozápadní částí bývalého okresu Bruntál, což je zhruba okolí Rýmařova.\\nV kraji je celkem 6 statutárních měst. Ostrava a Frýdek-Místek leží v obou tzv. historických zemích, zbývající 4, Opava, Havířov, Karviná a Třinec, leží ve Slezsku.\\nNa jihu sousedí se Zlínským krajem, na západě s Olomouckým krajem, na severu s polskými vojvodstvími Opolským a Slezským, na jihovýchodě s Žilinským krajem na Slovensku. Na území kraje se nacházejí čtyři euroregiony – Beskydy, Jeseníky, Opavské Slezsko a Těšínské Slezsko.\\nSymboly kraje tvoří znak, vlajka a logo."},{"page_url":"https://de.wikipedia.org/wiki/Felix_B%C3%BCrgers","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/12/Felix_B%C3%BCrgers_Fr%C3%BCher_Morgen.jpg","page_title":"Felix Bürgers","context_page_description":"Felix Bürgers war ein deutscher Landschaftsmaler."},{"page_url":"https://en.wikipedia.org/wiki/Grade_I_listed_buildings_in_Berkshire","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/15/Gate_piers_near_Hamstead_Marshall_%282%29_%28geograph_2285756%29.jpg","page_title":"Grade I listed buildings in Berkshire","context_page_description":"There are approximately 372,905 listed buildings in England and 2.5% of these are Grade I. This page is a list of these buildings in the county of Berkshire, ordered by building name within place name within district."},{"page_url":"https://ml.wikipedia.org/wiki/%E0%B4%9F%E0%B4%BF.%E0%B4%B5%E0%B4%BF._%E0%B4%9F%E0%B5%8D%E0%B4%AF%E0%B5%82%E0%B4%A3%E0%B5%BC_%E0%B4%95%E0%B4%BE%E0%B5%BC%E0%B4%A1%E0%B5%8D","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/64/ATI-twin-wonder-tv-tuner.jpg","page_title":"ടി.വി. ട്യൂണർ കാർഡ്","context_page_description":"കമ്പ്യൂട്ടറിൽ ടെലിവിഷൻ തരംഗങ്ങൾ സ്വീകരിക്കുവാൻ പര്യാപ്തമാക്കുന്ന കമ്പ്യൂട്ടർ ഘടകമാണ് ടിവി ട്യൂണർ കാർഡ്. മിക്ക ട്യൂണറുകളും ടെലിവിഷൻ തരംഗങ്ങൾ ഹാർഡ് ഡിസ്കിലേക്ക് റെക്കോർഡ് ചെയ്യാൻ കഴിയുന്ന വിധത്തിൽ വീഡിയോ ക്യാപ്ചറിങ് കാർഡിന്റെ ഗുണങ്ങൾ കൂടിയുള്ളവയാണ്."},{"page_url":"https://it.wikipedia.org/wiki/Hohneck","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cf/Escalade-mixte-glace-dans-les-aretes-du-hohneck.jpg","page_title":"Hohneck","context_page_description":"Lo Hohneck è il terzo rilievo per altezza della catena montuosa dei Vosgi."},{"page_url":"https://he.wikipedia.org/wiki/%D7%92%27%D7%A8%D7%9C%D7%93_%D7%A4%D7%95%D7%A8%D7%93","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/ElectoralCollege1976.svg","page_title":"ג'רלד פורד","context_page_description":"ג'רלד רודולף \\"ג'רי\\" פורד הבן היה פוליטיקאי אמריקאי מהמפלגה הרפובליקנית, שכיהן כנשיאה ה-38 של ארצות הברית בין אוגוסט 1974 לינואר 1977. לפני כן כיהן כסגן נשיא ארצות הברית במשך שמונה חודשים, תפקיד שאליו מונה על ידי הנשיא ריצ'רד ניקסון לאחר שקודמו, ספירו אגניו, התפטר עקב פרשת שחיתות. פורד נתמנה לתפקיד נשיא ארצות הברית אחרי שהנשיא ריצ'רד ניקסון התפטר עקב פרשת ווטרגייט. פורד הוא סגן הנשיא היחיד שמונה לתפקידו מכוח התיקון ה-25 לחוקת ארצות הברית, והוא האדם היחיד שכיהן כסגן נשיא וכנשיא ללא שנבחר לתפקידים הללו. לפני מינויו לסגן הנשיא, כיהן פורד במשך עשרים וחמש שנים כנציג המחוז החמישי של מישיגן בבית הנבחרים של ארצות הברית. במשך תשע השנים האחרונות לכהונתו היה פורד מנהיג המיעוט בבית הנבחרים.\\nכנשיא, חתם פורד על הסכמי הלסינקי, שהמשיכו את מדיניות הדטאנט במהלך המלחמה הקרה. עם כיבוש דרום וייטנאם בידי צפון וייטנאם תשעה חודשים לאחר נשיאותו, הוא נאלץ לסיים את מעורבותה של ארצות הברית בווייטנאם. מבחינה פנימית, המצב הכלכלי במהלך כהונתו היה הגרוע ביותר מאז סוף השפל הגדול, כשכהונתו מאופיינת באינפלציה ובמיתון. אחת מפעולותיו השנויות במחלוקת של פורד הייתה הענקת חנינה נשיאותית לנשיא לשעבר ריצ'רד ניקסון על כל פעולותיו במהלך פרשת ווטרגייט. במהלך כהונתו, לא עסק רבות במדיניות חוץ, והקונגרס הכתיב לו את המדיניות."},{"page_url":"https://mk.wikipedia.org/wiki/%D0%95%D0%BA%D0%BE%D0%BD%D0%BE%D0%BC%D0%B8%D1%98%D0%B0_%D0%BD%D0%B0_%D0%93%D1%80%D1%83%D0%B7%D0%B8%D1%98%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/26/TBC_BANK.jpg","page_title":"Економија на Грузија","context_page_description":"Економијата на Грузија — новорастечки слободен пазар. Нејзиниот бруто домашен производ опаднал по падот на Советскиот Сојуз, но се повратил вонагорна линија во средината на 2000-тите, растејќи со двоцифрени бројки благодарение на економските и демократските реформи што ги донесела мирнородената Револуција на розите. Грузија го продолжила својот економски напредок бидејќи, „се движи од речиси неуспешна држава во 2003 година кон релативно добро функционална пазарна економија во 2014 година“. Во 2007 година, Светската банка ја прогласила Грузија за светски економски реформатор број еден, и постојано ја рангирал земјата на врвот за водење бизнис.\\nЕкономијата на Грузија е поддржана со релативно слободна и транспарентна атмосфера во земјата. Според извештајот на Транспаренси интернешнал во 2015 година, Грузија била најмалку корумпирана нација во регионот на Црното Море, надминувајќи ги сите свои непосредни соседи, како и блиските држави на Европската Унија. Со мешано медиумско опкружување, Грузија е исто така единствената земја во нејзиното непосредно соседство, каде што печатот не се смета за неслободен."},{"page_url":"https://en.wikipedia.org/wiki/St._Philomena%27s_Cathedral,_Mysore","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/St._Philomena%27s_Church%2C_Mysore_03.jpg","page_title":"St. Philomena's Cathedral, Mysore","context_page_description":"St. Philomena’s Cathedral is a Catholic church that is the cathedral of the Diocese of Mysore, India. The full name is the Cathedral of St. Joseph and St. Philomena. It is also known as St. Joseph's Cathedral. It was constructed in 1936 using a Neo Gothic style and its architecture was inspired by the Cologne Cathedral in Germany. This is one of the tallest churches in Asia."},{"page_url":"https://en.wikipedia.org/wiki/League_for_the_Fifth_International","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c9/L5I.png","page_title":"League for the Fifth International","context_page_description":"The League for the Fifth International is an international grouping of revolutionary Trotskyist organisations around a common programme and perspectives."},{"page_url":"https://es.wikipedia.org/wiki/Alexander_Wheelock_Thayer","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fa/Thayer%27s_copy_of_Joseph_Willibrord_M%C3%A4hler%27s_portrait_of_Beethoven.jpg","page_title":"Alexander Wheelock Thayer","context_page_description":"Alexander Wheelock Thayer, fue un bibliotecario y periodista que se convirtió en el autor de la primera biografía académica de Ludwig van Beethoven, aún considerada, tras muchas actualizaciones, como una obra básica de referencia sobre el compositor."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%A3%D8%B1%D9%8A%D8%BA%D8%A7%D8%B1%D9%88%D9%86_%D8%A3%D9%86%D8%BA%D9%84%D9%85%D8%A7%D9%86%D9%8A","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/32/2016.05.17_16.01.45_DSC04017_-_Flickr_-_andrey_zharkikh.jpg","page_title":"أريغارون أنغلماني","context_page_description":"أريغارون أنغلماني هو نوع من النباتات يتبع جنس الأريغارون من الفصيلة النجمية."},{"page_url":"https://fr.wikipedia.org/wiki/Gare_d%27Aberdeen","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/eb/Aberdeen_Station_Plaza.JPG","page_title":"Gare d'Aberdeen","context_page_description":"La gare d'Aberdeen est située dans le centre-ville d'Aberdeen en Écosse, tout près de Union Street. Elle est la gare terminus sur la East Coast Main Line entre Londres et Aberdeen, et le point de départ ou le terminus de nombreux services régionaux en Écosse. Virgin Trains East Coast dessert la principale route d’Aberdeen à Londres avec trois trains par jour ; la CrossCountry dessert la route d'Aberdeen au sud-ouest de l'Angleterre. ScotRail assure les liaisons en Écosse, tandis que la liaison nocturne en voitures-lits vers Londres Euston est assurée par Caledonian Sleeper."},{"page_url":"https://en.wikipedia.org/wiki/Insurance_Services_Office","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/Jersey-city-new-jersy-night.jpg","page_title":"Insurance Services Office","context_page_description":"Insurance Services Office, Inc., a subsidiary of Verisk Analytics, is a provider of statistical, actuarial, underwriting, and claims information and analytics; compliance and fraud identification tools; policy language; information about specific locations; and technical services. ISO serves insurers, reinsurers, agents and brokers, insurance regulators, risk managers, and other participants in the property/casualty insurance marketplace. Headquartered in Jersey City, New Jersey, United States, the organization serves clients with offices throughout the United States, along with international operations offices in the United Kingdom, Israel, Germany, India and China."},{"page_url":"https://sv.wikipedia.org/wiki/William_Cheselden","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f0/William_Cheselden.jpg","page_title":"William Cheselden","context_page_description":"William Cheselden, född den 19 oktober 1688 i Leicestershire, död den 10 april 1752 i Bath, var en engelsk läkare.\\nCheselden blev 1718 assistent surgeon och 1719 surgeon vid St Thomas' Hospital i London, utnämndes 1727 till kirurg hos drottning Karolina, utsågs 1733 till kirurg vid St. George's Hospital och 1737 till kirurg vid Chelsea Hospital. Cheselden var en av sin tids mest berömda engelska anatomer och kirurger. Hans Anatomy of human body utkom 1778 i 11:e upplagan. Synnerligt framstående var han såsom operatör för blåsstenar och skrev därom bland annat Treatise on the high operation of the stone. Vidare var han den förste, som gjorde en artificiell pupill i ögat, varigenom han inlade en mycket betydande förtjänst om ögonläkekonstens utveckling."},{"page_url":"https://az.wikipedia.org/wiki/Faz%C4%B1l_Ki%C3%A7ik","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/89/Bundesarchiv_B_145_Bild-F014934-0068%2C_Fazil_Kutschuk.jpg","page_title":"Fazıl Kiçik","context_page_description":"Kipr türkü siyasətçi jurnalist 1959 ilinin sonlarında qurulan Kipr Respublikasının vitse-prizenti Kipr türklərinin Rauf Denktaştan əvvəl öndəridir"},{"page_url":"https://da.wikipedia.org/wiki/Bikolibri","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bb/Mellisuga_helenae.jpg","page_title":"Bikolibri","context_page_description":"Bikolibrien er verdens mindste kolibri og formentlig også den mindste fugl. Hannen vejer blot 1,6 g, mens hunnen når helt op på 2 g. Kolibrien har en længde på 5-6 cm og lever kun i Cuba og på Isla de la Juventud."},{"page_url":"https://azb.wikipedia.org/wiki/%D9%82%D8%B1%D9%88%D9%86%D8%A7%D9%88%D8%8C_%D9%86%D9%88%D8%B1%D8%AF%D8%B1%D8%A7%DB%8C%D9%86-%D9%88%D8%B3%D8%AA%D9%81%D8%A7%D9%84%D9%86","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/3e/Gronau_Laga_4.jpg","page_title":"قروناو، نوردراین-وستفالن","context_page_description":"قروناو، نوردراین-وستفالن آلمانین نوردراین-وستفالن ایالتینده یئر آلان بیر شهردیر و ۲۷ متر دنیز سوییه‌سیندن اۇجالیقی وار. بۇ شهرین ۷۸٫۶۳ کیلومتر موربّع ساحه‌سی وار."},{"page_url":"https://pl.wikipedia.org/wiki/Chmielnik_(wojew%C3%B3dztwo_%C5%9Bwi%C4%99tokrzyskie)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e3/Synagoga_O%C5%9ARODEK_EDUKACYJNO-MUZEALNY_%C5%9AWI%C4%98TOKRZYSKI_SZTETL_1630_1942_Chmielnik_ulica_Wsp%C3%B3lna_14.JPG","page_title":"Chmielnik (województwo świętokrzyskie)","context_page_description":"Chmielnik – miasto w powiecie kieleckim, w województwie świętokrzyskim, położone na skrzyżowaniu drogi krajowej nr 73, nad rzeką Wschodnią (prawy dopływ Czarnej Staszowskiej), na pograniczu Niecki Połanieckiej i Pogórza Szydłowskiego. Jest siedzibą miejsko-wiejskiej gminy Chmielnik. Ośrodek handlowo-usługowy. Przemysł materiałów budowlanych i spożywczy. Stacja kolejowa. Zachowany szesnastowieczny układ urbanistyczny, wytyczony przez czworoboczny rynek i sieć prostopadłych ulic.\\nOd połowy XVI w. do 1689 był jednym z ważniejszych centrów polskiego kalwinizmu. Miasto prywatne Królestwa Kongresowego, położone było w 1827 roku w powiecie szydłowskim, obwodzie stopnickim województwa krakowskiego.\\nW latach 1956–1961 miasto było siedzibą powiatu chmielnickiego. W latach 1975–1998 miasto administracyjnie należało do woj. kieleckiego."},{"page_url":"https://vo.wikipedia.org/wiki/Kendall_West","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/41/Miami-Dade_County_Florida_Incorporated_and_Unincorporated_areas_Kendall_West_Highlighted.svg","page_title":"Kendall West","context_page_description":"Kendall West binon zif in komot: Miami-Dade, in tat: Florida, in Lamerikän."},{"page_url":"https://et.wikipedia.org/wiki/Klahvinuhk","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fb/USB_keylogger_01.JPG","page_title":"Klahvinuhk","context_page_description":"Klahvinuhk või klahviloger on tarkvara või seade, mis salvestab arvuti kasutaja klahvi- ja nupuvajutusi või muid sisestustoiminguid. Tavaliselt kasutatakse klahvinuhki kasutaja eest varjatult.\\nKlahvinuhki võidakse kasutada nii seaduslikel kui ka ebaseaduslikel eesmärkidel. Seaduslike eesmärkide alla kuulub näiteks klahvinuhi kasutamine IT-ettevõtetes arvutitega seotud tehniliste probleemide lahendamiseks ja kasutamine ettevõtte- või koduarvutis töötajate või pereliikmete võrguliikluse seaduslikuks jälgimiseks. Kurjategijad kasutavad klahvinuhki salajase info – paroolid, krediitkaardinumbrid jms – teadasaamiseks."},{"page_url":"https://de.wikipedia.org/wiki/Azienda_del_Consorzio_Trasporti_Veneziano","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/41/Tronchetto-F%C3%A4hranlegestelle.jpg","page_title":"Azienda del Consorzio Trasporti Veneziano","context_page_description":"Azienda del Consorzio Trasporti Veneziano ist ein kommunaler Verkehrsbetrieb, das seit dem 1. Oktober 1978 in der Gemeinde Venedig tätig ist. Er betreibt Buslinien, die Straßenbahnlinien und die Wasserbuslinien."},{"page_url":"https://nl.wikipedia.org/wiki/Kanton_L%27Ajoupa-Bouillon","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/ec/L-Ajoupa-Bouillon_972.PNG","page_title":"Kanton L'Ajoupa-Bouillon","context_page_description":"Kanton L'Ajoupa-Bouillon is een kanton van het Franse departement Martinique. Kanton L'Ajoupa-Bouillon maakt deel uit van het arrondissement La Trinité en telt 1.659 inwoners. Het kanton heeft een oppervlakte van 12,30 km² en een dichtheid van 135 inwoners per vierkante kilometer."},{"page_url":"https://it.wikipedia.org/wiki/Lori_(Armenia)","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/2d/Vanadzor-marzpan.jpg","page_title":"Lori (Armenia)","context_page_description":"Lori è una provincia dell'Armenia di circa 282.700 abitanti che ha come capoluogo Vanadzor. È la terza provincia per estensione e la seconda per popolazione dopo la capitale Erevan.\\nLa seconda città, dopo Vanadzor, è Stepanavan. Altra città rilevante è Alaverdi nei cui dintorni si trovano i villaggi di Haghpat e Sanahin, ritenuti dall'UNESCO patrimonio dell'umanità.\\nLori è il luogo di nascita di famosi armeni come il musicista Harutyun Sayatyan, il poeta Hovhannes Tumanjan, il progettista degli aerei MiG Artem Mikojan ed il fratello, lo statista sovietico Anastas Mikojan.\\nLa regione è stata gravemente danneggiata dal terremoto di Spitak nel 1988."},{"page_url":"https://de.wikipedia.org/wiki/Massaker_von_Guangdong","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dc/1963-05_%E5%BD%AD%E6%B9%83.jpg","page_title":"Massaker von Guangdong","context_page_description":"Das Massaker von Guangdong oder das Massaker an der Kulturrevolution von Guangdong war eine Reihe von Massakern, die während der Kulturrevolution in der chinesischen Provinz Guangdong stattfanden. Die meisten Massaker an der Kulturrevolution in Guangdong fanden von Juli bis Oktober 1968 statt und wurden von den provinziellen und lokalen „Revolutionskomitees“ geleitet und organisiert. Das Massaker von Guangdong war zu dieser Zeit eines der schwersten Massaker in China und stand im Zusammenhang mit dem Massaker von Guangxi.\\nIn Guangdong gab es zwei Haupttypen von Massakern: Ein Typ richtete sich gegen Mitglieder der „Fünf schwarze Kategorien“ sowie deren Verwandte, und der andere Typ bezog sich auf politische Verfolgungen. Während der Kulturrevolution gab es in Guangdong 80 Landkreise. Laut den 57 „Grafschafts-Annalen“, die während der „Boluan Fanzheng“ -Periode verfügbar wurden, kam es in 28 Landkreisen zu Massakern, wobei sechs Landkreise eine Zahl von über 1000 Todesopfern verzeichneten. Die durchschnittliche Zahl der Todesopfer in allen 28 Ländern betrug 278, und bei den Massakern starben insgesamt mindestens 7784 Menschen."},{"page_url":"https://it.wikipedia.org/wiki/Lepa_Radi%C4%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/76/Lepa_Radi%C4%87_hanged.jpg","page_title":"Lepa Radić","context_page_description":"Lepa Svetozara Radić in cirillico serbo: Лепа Светозара Радић è stata una partigiana e antifascista jugoslava di etnia serba bosniaca, membro dell'Esercito Popolare di Liberazione della Jugoslavia durante la seconda guerra mondiale insignita postuma dell'Ordine dell'Eroe popolare il 20 dicembre 1951, per il suo ruolo nel movimento di resistenza contro le potenze dell'Asse, diventando la persona più giovane a riceverlo all'epoca.\\nFu giustiziata nel febbraio 1943, all'età di 17 anni, per aver sparato alle truppe tedesche. Mentre i suoi aguzzini le legavano il cappio al collo, le offrirono una via d'uscita nel caso in cui avesse rivelato le identità dei suoi compagni e dei suoi capi, lei rispose che avrebbero conosciuto i nomi dei suoi compagni quando sarebbero arrivati a vendicare la sua morte."},{"page_url":"https://sv.wikipedia.org/wiki/Limonium_pectinatum","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d8/Limonium_pectinatum_%28Los_Cancajos%29_03_ies.jpg","page_title":"Limonium pectinatum","context_page_description":"Limonium pectinatum är en triftväxtart som först beskrevs av William Aiton, och fick sitt nu gällande namn av Carl Ernst Otto Kuntze. Limonium pectinatum ingår i släktet rispar, och familjen triftväxter. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%93%D0%A3%D0%9B%D0%90%D0%93","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3e/Butugycheg_mine.jpg","page_title":"ГУЛАГ","context_page_description":"ГУЛАГ или Главно управление на наказателните лагери е управление към НКВД и държавен орган в Съветския съюз, отговорен за администрацията на системата от основни съветски работнически лагери за изправителен труд от 30-те до 50-те години на 20 век. Макар в лагерите да са въдворявани голям брой осъдени – от дребни джебчии до политически затворници – голям брой от тях били намерени за виновни посредством опростени съдебни процедури, като НКВД тройките и други средства извън обсега на правосъдието. ГУЛАГ се разглежда като основен инструмент за политическа репресия в Съветския съюз."},{"page_url":"https://de.wikipedia.org/wiki/Gr%C3%A4berfeld_von_Hol","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/11/%28Hol_12-1%2C_Gravf%C3%A4lt%29_2013-10-19_17-51-27.jpg","page_title":"Gräberfeld von Hol","context_page_description":"Das Gräberfeld von Hol im Sävedalen bei Vårgårda in Västra Götaland in Schweden liegt nördlich von Hol und stammt aus der Eisenzeit.\\nEs besteht aus etwa 140 Relikten. Darunter sind ein Domarring von etwa 15 m Durchmesser mit neun Steinen und einem etwa 2,0 m hohen Bautastein, ein zweiter Bautastein, sowie viele kleine und zwei größere Grabhügel auf einer Fläche von 7 bis 8 Hektar. Im Süden ist die Höhe durch Kiesabbau erodiert.\\nAuf dem Hügel „Hols gärde“ befindet sich eine Konzentration von 135 gewölbten und mit Ringgräben versehenen kleinen Grabhügeln. Mit Ausnahme des Storehög mit etwa 18,0 m Durchmesser und 2,5 m Höhe, der sich auf dem Kamm befindet, liegen die meisten im lichten Wald.\\nEin paar 100 Meter südlich befinden sich in und an der Kirche zwei Runensteine."},{"page_url":"https://es.wikipedia.org/wiki/Chanteloup-en-Brie","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/92/Blason_Chanteloup-en-Brie.svg","page_title":"Chanteloup-en-Brie","context_page_description":"Chanteloup-en-Brie es una población y comuna francesa, en la región de Isla de Francia, departamento de Sena y Marne, en el distrito de Torcy y cantón de Thorigny-sur-Marne. La ciudad es conocida por ser el lugar de nacimiento de Henri Cartier-Bresson, uno de los fotógrafos más famosos del mundo."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%B9%D8%B5%D8%A8_%D9%82%D8%B7%D9%86%D9%8A","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b5/Slide1w.JPG","page_title":"عصب قطني","context_page_description":"الأعصاب القطنية ‏ هي خمسٌ أزواجٍ من الأعصاب الشوكية وتخرج من الفقرات القطنية، وتنقسم إلى قسمٍ أمامي وآخر خلفي."},{"page_url":"https://be-tarask.wikipedia.org/wiki/%D0%A3%D1%88%D0%B0%D1%87%D1%8B","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/df/U%C5%A1a%C4%8Dy._%D0%A3%D1%88%D0%B0%D1%87%D1%8B_%2816.07.1792%29.jpg","page_title":"Ушачы","context_page_description":"Уша́чы, Вуша́чы — мястэчка ў Беларусі, на рацэ Ўшачы. Адміністрацыйны цэнтар Ушацкага раёну Віцебскай вобласьці. Насельніцтва на 2018 год — 5974 чалавекі. Знаходзяцца за 150 км на захад ад Віцебску, за 36 км ад чыгуначнай станцыі Лепель. Вузел аўтамабільных дарог на Менск, Віцебск, Полацак, Лепель, Глыбокае, Докшыцы.\\nУшачы — даўняе магдэбурскае места гістарычнай Полаччыны, якое пэўны час было цэнтрам рэгіёну. Сярод мясцовых славутасьцяў вылучаўся збудаваны ў стылі барокавага клясыцызму комплекс кляштару дамініканаў з касьцёлам Сьвятога Гераніма, помнік архітэктуры XVIII ст., зруйнаваны супольнымі намаганьнямі расейскіх і савецкіх уладаў."},{"page_url":"https://es.wikipedia.org/wiki/Chapul%C3%ADn","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d1/Chapulines_de_Oaxaca.jpg","page_title":"Chapulín","context_page_description":"Chapulín es el nombre vulgar de algunos insectos ortópteros nativos de México y Estados Unidos. Se usa para las siguientes especies:\\nTodas las de la familia Pyrgomorphidae, los chapulines de los arbustos.​\\nEn particular Sphenarium purpurascens, el chapulín de la milpa.​\\nLa mayoría de las de la familia Acrididae.\\nMelanoplus differentialis, el chapulín diferencial.​\\nMelanoplus gladstoni, el chapulín carreta.​\\nMelanoplus femurrubrum, el chapulín de patas rojas.​\\nHesperotettix viridis, el chapulín de la hierba de víbora.​\\nArphia conspersa, el chapulín de alas rojas con espolón.​\\nArphia nietana, el chapulín de alas rojas.​\\nMachaerocera mexicana, el chapulín de alas azules.​\\nTrachyrhachys kiowa, el chapulín de alas amarillas​ o chapulín kiowa.​\\nTrimerotropis pallidipennis, el chapulín de alas pálidas.​\\nXanthippus corallipes, el chapulín de zancas rojas.​\\nBoopedon diabolicum, el chapulín negro de alas cortas.​\\nBoopedon rufipes, el chapulín rojo de alas cortas.​\\nOpeia obscura, el chapulín oscuro.​\\nAlgunas de la familia Romaleidae.\\nBrachystola magna, el chapulín gordiflón.​\\nTaeniopoda eques, el chapulín del desierto​ o chapulín gordiflón acaballado.​"},{"page_url":"https://lt.wikipedia.org/wiki/Bajus","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0d/Mohammed_Bey.jpg","page_title":"Bajus","context_page_description":"Bajus – Vidurinėje Azijoje, Kazachstane, Altajuje, Kaukaze – žemvaldys, turtingas gyvulių augintojas, pirklys, buožė. Tai tiurkų tautų tarpe nuo seno gyvuojantis titulas. Pradiniame etape tai buvo giminės karinių pajėgų vadas genties sudėtyje, kuriai savo ruožtu vadovavo chanas. Tarp senovės tiurkų bajaus pareigybė buvo antroji po chano. Vėlesniais amžiais bajaus titulo samprata įgavo daug platesnę prasmę, tame tarpe, administracinės pareigybės statusą kagano, sultono valdomose teritorijose. Pvz., Osmanų imperijos titulai pagal „rangą“ žemėjančia tvarka buvo tokie: paša, bajus, aga, efendi. Bajais galėjo save tituluoti ir kunigaikščiai Moldavijoje, Valakijoje, Samo saloje.\\nŠiuolaikinėje Turkijoje, Azerbaidžane, taip pat ir tarp Krymo totorių žodis „bajus“ yra įgavęs mandagaus kreipinio į gerbiamą asmenį prasmę. Šiaurės Kaukaze tarp kumykų, karačiajų, balkarų bajus – tai kunigaikštis, ulu-bajus – vyriausiasis kunigaikštis. Tarp stepių klajoklių Vidurinėje Azijoje – kazachų, kirgizų, karakalpakų, altajiečių, nogajų – praeityje šis žodis buvo pridedamas prie asmenvardžio. Tuniso Huseinidų dinastija ypač pasižymėjo naudodama šį žodį ir jo panašias formas savo titulams apibrėžti."},{"page_url":"https://he.wikipedia.org/wiki/%D7%92%D7%9C%D7%90%D7%A1_1700","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b7/Glas_1700_%281967%29%2C_Dutch_licence_registration_AL-90-04_pic2.JPG","page_title":"גלאס 1700","context_page_description":"גלאס 1700 היא מכונית משפחתית מתוצרת יצרנית הרכב הגרמנית Hans Glas GmbH אשר יוצרה בין השנים 1964–1967 בגרמניה המערבית."},{"page_url":"https://de.wikipedia.org/wiki/Emil_Goeldi","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/56/Emil_August_Goeldi%2C_Emilio_Goeldi_%281859%E2%80%931917%29_Naturforscher.jpg","page_title":"Emil Goeldi","context_page_description":"Emil August Goeldi war ein Schweizer Naturforscher und hauptsächlich in Brasilien tätig. Dort ist er unter dem Namen Emílio Goeldi bekannt."},{"page_url":"https://de.wikipedia.org/wiki/Holy_Island_(Clare)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2d/Holy_Island_Clare_St._Brigids_Church.jpg","page_title":"Holy Island (Clare)","context_page_description":"Holy Island ist eine rundovale Insel im See Lough Derg und gehört zum County Clare in Irland. Sein ursprünglicher Name Inis Cealtra bedeutet nach P. W. Joyce im Altirischen „Kircheninsel“. Sie wird auch \\"„Insel der Sieben Kirchen“ genannt. Obwohl Holzkirchen als die gängigste Form des frühen Kirchenbaus in Irland betrachtet werden, gab es auch Kirchen deren Wände aus Flechtwerk und Lehm bestanden. Eine solche entdeckte Liam de Paor hier. Die Überreste der 7,5 × 4,5 m großen Kirche bestätigen ähnliche Berichte von Tirechán, der als Biograph St. Patricks auf die Holzarmut Irlands verweist.\\nDer Name „Holy Island“ oder „Holy Isle“ ist auf den Britischen Inseln sehr verbreitet; u. a. Holy Isle im Firth of Clyde.\\nSt. Caimin, der Mitte des 7. Jahrhunderts starb, gründete hier eine Abtei der Iroschottischen Kirche. 836 unter Turgesius, und 922 n. Chr. unter Tomran wurde die Insel von Wikingern aus Limerick geplündert. Der aus Clare stammende Hochkönig Brian Boru baute die Kirche wieder auf, sein Bruder soll bis 1009 n. Chr. der Abt des Klosters gewesen sein, das die Benediktiner unterhielten. Holy Island wurde auf der Synode von Rathbreasail 1111 n."},{"page_url":"https://sv.wikipedia.org/wiki/Barry_Jenkins","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/df/Barry_Jenkins_%28cropped%29.jpg","page_title":"Barry Jenkins","context_page_description":"Barry Jenkins, född 19 november 1979 i Miami, Florida, är en amerikansk filmregissör och manusförfattare hemmahörande i Los Angeles. Han är känd för sina filmer Medicin for Melancholy och Moonlight, varav den senare har fått storslagen kritik samt dussintals utmärkelser, däribland Oscar för bästa film och Golden Globe Award för Bästa film – drama."},{"page_url":"https://eo.wikipedia.org/wiki/K%C3%A1roly_Flesch","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/92/Emil_Orlik_-_Portrait_of_Carl_Flesch_248.jpg","page_title":"Károly Flesch","context_page_description":"Károly Flesch [kAroj fleŝ], laŭ hungarlingve kutima sinsekvo Flesch Károly estis hungara violonisto, altlerneja instruisto.\\nKároly Flesch naskiĝis la 9-an de oktobro 1873 en Moson, li mortis la 15-an de novembro 1944 (laŭ alia informo la mortotago estas 14-a) en Lucerno (Svislando)."},{"page_url":"https://ms.wikipedia.org/wiki/Memorial_Keamanan_Hiroshima","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b0/Gambaku_Dome_of_Hiroshima.jpg","page_title":"Memorial Keamanan Hiroshima","context_page_description":"Memorial Keamanan Hiroshima terletak di bandar Hiroshima, selatan Jepun. Setiap tahun perhimpunan memperingati ledakan bom atom diadakan di sini. Pada 1996, UNESCO mengisytihar tapak ini sebagai Tapak Warisan Dunia."},{"page_url":"https://fi.wikipedia.org/wiki/Taistelupanssarivaunu","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/Leo2A5.JPG","page_title":"Taistelupanssarivaunu","context_page_description":"Taistelupanssarivaunu on panssarivaunutyyppi. Taistelupanssarivaunut on suunniteltu taistelemaan vihollisen panssarivaunuja vastaan. Vaunun pääaseena on suorasuuntaustulta ampuva kanuuna. Taistelupanssarivaunun panssarointi on yleensä suunniteltu kestämään sen oman kanuunan suoraa tulta. TAE-sopimus määrittelee taistelupanssarivaunun hyvin suojatuksi ja telaketjuilla liikkuvaksi asejärjestelmäksi, jota ei ole tarkoitettu joukkojen kuljetukseen. Taistelupanssarivaunun massa on vähintään 16,5 tonnia tyhjänä ja ne on aseistettu 360 astetta ympäri kääntyvällä tornilla, jossa on vähintään 75 mm:n korkean lähtönopeuden kanuuna.\\nNykyaikaiset taistelupanssarivaunut tulivat käyttöön toisen maailmansodan jälkeen. Ensimmäisenä tätä termiä käytettiin brittiläisestä Centurionista. Nimitys ”taistelupanssarivaunu” on lähtöisin englanninkielisestä maailmasta."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%85%D8%AA%D8%AD%D9%81_%D8%A7%D8%B3%D8%B7%D9%86%D8%A8%D9%88%D9%84_%D9%84%D8%AA%D8%A7%D8%B1%D9%8A%D8%AE_%D8%A7%D9%84%D8%B9%D9%84%D9%88%D9%85_%D9%88%D8%A7%D9%84%D8%AA%D9%83%D9%86%D9%88%D9%84%D9%88%D8%AC%D9%8A%D8%A7_%D9%81%D9%8A_%D8%A7%D9%84%D8%A5%D8%B3%D9%84%D8%A7%D9%85","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9a/Istanbul_Museum_of_The_History_of_Science_and_Technology_in_Islam.jpg","page_title":"متحف اسطنبول لتاريخ العلوم والتكنولوجيا في الإسلام","context_page_description":"متحف اسطنبول لتاريخ العلوم والتكنولوجيا في الإسلام ‏ يقع في مبنى إمبريال ستابلز السابق في حديقة كلخانة. افتتح المتحف في 25 مايو 2008 ويعرض نسخًا طبق الأصل من أدوات علمية من القرنين التاسع والسادس عشر لعلماء مسلمين. صنعت جميع النماذج في معهد تاريخ العلوم العربية الإسلامية بجامعة يوهان فولفغانغ غوته في فرانكفورت من الأوصاف والرسومات في النصوص المعاصرة - يوجد عدد قليل جدًا من العناصر الأصلية. العديد من العناصر \\"تخيلبة تمامًا\\"، بينما تستند العناصر الأخرى إلى رسومات لأجهزة متشابهة المظهر في المخطوطات، ولكن من غير المعروف ما إذا كانت هذه الأجهزة قد أنشأت فعلًا أو كانت بنية بنائها."},{"page_url":"https://nl.wikipedia.org/wiki/Reuzenrondbladneus","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9f/Commerson%27s_Roundleaf_Bat_%28Hipposideros_commersoni%29_%2810291616316%29.jpg","page_title":"Reuzenrondbladneus","context_page_description":"De reuzenrondbladneus is een zoogdier uit de familie van de bladneusvleermuizen van de Oude Wereld. De soort is endemisch in Madagaskar en is hier de grootste vertegenwoordiger van de onderorde Microchiroptera."},{"page_url":"https://ja.wikipedia.org/wiki/%E5%AF%BA%E5%86%85%E5%86%85%E9%96%A3","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7e/Ryohei_Okada_cropped.jpg","page_title":"寺内内閣","context_page_description":"寺内内閣は、元帥陸軍大将・軍事参議官の寺内正毅が第18代内閣総理大臣に任命され、1916年10月9日から1918年9月29日まで続いた日本の内閣である。"},{"page_url":"https://ja.wikipedia.org/wiki/%E5%AD%AB%E5%85%83%E4%B8%80_(%E8%BB%8D%E4%BA%BA)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8e/HN-SN-98-07202.JPEG","page_title":"孫元一 (軍人)","context_page_description":"孫 元一は、大韓民国の軍人、外交官、政治家。韓国海軍の父と呼ばれる。初代海軍参謀総長を務めた。後に潜水艦・孫元一の艦名となった。別名は孫元逸。"},{"page_url":"https://uk.wikipedia.org/wiki/%D0%90%D0%BB%D1%8C%D0%B1%D0%BE%D0%BD%D1%96_%D0%9C%D0%B0%D1%80%D1%96%D1%94%D1%82%D1%82%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7e/Marietta_Alboni_by_Charles_Vogt.jpg","page_title":"Альбоні Марієтта","context_page_description":"Альбоні Марієтта — італійська оперна співачка. Гастролювала в Росії 1844—1845, 1852.\\nУ повісті «Прогулка с удовольствием и не без морали» Тарас Шевченко порівняв з Альбоні одного з персонажів — Машу Прехтеля, вродливу дівчину, яка мала чудовий низький голос."},{"page_url":"https://nl.wikipedia.org/wiki/Museum_Klok_%26_Peel","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/69/Museum_Klok_en_Peel_-_03.JPG","page_title":"Museum Klok & Peel","context_page_description":"Museum Klok & Peel is een museum in Asten, een plaats in het oosten van de Nederlandse provincie Noord-Brabant. Het is gericht op twee thema's: het eerste is klokken en beiaards. Hiervan bezit het de grootste collectie ter wereld. Het tweede is de natuur- en cultuurhistorie van de Peel, de regio op de grens van Noord-Brabant en Limburg waar Asten zich bevindt.\\nBuiten het museum komen beide collecties in de kruidentuin en klankentuin als het ware samen. Nog voor de binnenkomst is een klokkenspel te horen vanuit de museumtuin.\\nIn 2014 werd het museum uitgeroepen tot Nederlands Museum van het Jaar en in 2015 door de ANWB tot Leukste uitje van Noord-Brabant."},{"page_url":"https://en.wikipedia.org/wiki/Glasgow_Police_Pipe_Band","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/ae/Cowal2007_strathclyde_police.jpg","page_title":"Glasgow Police Pipe Band","context_page_description":"Glasgow Police Pipe Band is a grade one pipe band from Glasgow, Scotland. Founded in 1883 as the Burgh of Govan Police Pipe Band, the band enjoyed its greatest competitive success as the Strathclyde Police Pipe Band."},{"page_url":"https://eo.wikipedia.org/wiki/Domb%C3%B3v%C3%A1r","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/72/%C3%9Ajdomb%C3%B3v%C3%A1r.png","page_title":"Dombóvár","context_page_description":"Dombóvár [dombOvAr] estas urbo kaj kuracbanloko en Hungario, en regiono Suda Transdanubio, en departemento Tolna, en Distrikto Dombóvár, kies centro. La loknomo devenas el la slava \\"dobov\\".\\nEn 2020 havas Dombóvár sian 50jaran datrevenon, ekde la 1an de aprilo de 1970 estas urbo. En la urbo naskintaj personoj, kiuj akiris internacian sukcesojn: Imre Mándi; Ferenc Pataki kaj Jenő Buzánszky kaj Miklós Ivanich kaj Norbert Rózsa kaj la granda sport-talento de hodiaŭ: Anna Lili Tóth. Ekde 1923 esperantistoj vivantaj en la urbo kulturas la tradicion kaj samideon de lingvo Esperanto."},{"page_url":"https://no.wikipedia.org/wiki/The_Amazing_Race_11","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f6/Dhow_in_sunset.jpg","page_title":"The Amazing Race 11","context_page_description":"The Amazing Race 11, også kjent som The Amazing Race: All-Stars, er den 11. sesongen av den amerikanske realityserien The Amazing Race. The Amazing Race: All-Stars fulgte 11 lag, 10 lag fra tidligere sesonger og et kjærestepar som møttes mens de konkurrerte i samme sesong, i et kappløp rundt i verden.\\nKjæresteparet Eric Sanchez og Danielle Turner, som konkurrerte på andre lag i sesong 9, vant denne sesongen av The Amazing Race. De ble også det første vinnerlaget til å kun vinne finaleetappen."},{"page_url":"https://it.wikipedia.org/wiki/Dialetto_tarantino","image_url":"https://upload.wikimedia.org/wikipedia/it/6/69/Pagina_tradizioni_tarantine_su_corriere_del_giorno.jpg","page_title":"Dialetto tarantino","context_page_description":"Il dialetto tarantino, o vernacolo cataldiano, è un dialetto parlato nella città di Taranto e, con significative differenze, in alcuni paesi della parte occidentale dell'omonima provincia. Esso possiede la particolarità di essere un idioma comunale, ovvero è parlato, nella sua forma più pura, esclusivamente entro i confini della città ed in provincia ha sviluppato alcune varianti, seppur abbastanza distaccate. Secondo lo studioso tarantino Domenico Ludovico de Vincentiis, procedendo a nord della città si avverte più influente l'inflessione del barese sui dialetti circostanti, mentre a sud si comincia a notare l'inflessione del salentino, in particolare del dialetto leccese; questa osservazione fu fatta in precedenza anche da Giovanni Battista Gagliardo, che già nel 1811, riferendosi alla grande discontinuità dialettale nel suo territorio, affermava che \\"il dialetto è tutto affatto diverso dal resto degli altri Tarentini, un miscuglio di corrotte voci greche e latine\\"."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%90%D0%B4%D0%BC%D0%B8%D0%BD%D0%B8%D1%81%D1%82%D1%80%D0%B0%D1%82%D0%B8%D0%B2%D0%BD%D0%BE-%D1%82%D0%B5%D1%80%D1%80%D0%B8%D1%82%D0%BE%D1%80%D0%B8%D0%B0%D0%BB%D1%8C%D0%BD%D0%BE%D0%B5_%D0%B4%D0%B5%D0%BB%D0%B5%D0%BD%D0%B8%D0%B5_%D0%9A%D1%80%D0%B0%D1%81%D0%BD%D0%BE%D1%8F%D1%80%D1%81%D0%BA%D0%BE%D0%B3%D0%BE_%D0%BA%D1%80%D0%B0%D1%8F","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/67/Coat_of_Arms_of_Nazarovsky_District_%28Krasnoyarsk_krai%29.png","page_title":"Административно-территориальное деление Красноярского края","context_page_description":"Согласно Закону «Об административно-территориальном устройстве Красноярского края», субъект РФ включает следующие административно-территориальные единицы:\\n13 краевых городов: Ачинск, Боготол, Бородино, Дивногорск, Енисейск, Канск, Красноярск, Лесосибирск, Минусинск, Назарово, Норильск, Сосновоборск, Шарыпово, в том числе\\n2 города включают районы в городе Красноярске и Норильске;\\n44 района края, в том числе\\n2 района, являющиеся административно-территориальными единицами с особым статусом;\\n8 районных городов: Иланский, Кодинск, Артёмовск, Заозёрный, Дудинка, Игарка, Ужур, Уяр;\\n19 посёлков городского типа: Балахта, Берёзовка, Большая Мурта, Емельяново, Кедровый, Подтёсово, Козулька, Курагино, Кошурниково, Краснокаменск, Большая Ирба, Мотыгино, Раздолинск, Нижний Ингаш, Нижняя Пойма, Ирша, Саянский, Диксон, Шушенское;\\n460 сельсоветов;\\n1 район, на территории которого не образованы внутренние административно-территориальные единицы;\\n3 закрытых административно-территориальных образования.\\nАдминистративно-территориальные единицы состоят из территориальных единиц, к которым относятся:"},{"page_url":"https://de.wikipedia.org/wiki/Kulintang","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d2/Kulintang_07.jpg","page_title":"Kulintang","context_page_description":"Kulintang, auch kolintang, bezeichnet eine Reihe horizontal gelagerter Buckelgongs, die auf der südphilippinischen Insel Mindanao als führendes Melodieinstrument gespielt wird. Das gesamte, durch große aufgehängte Gongs und Trommeln ergänzte Ensemble heißt ebenfalls kulintang. Es gehört zu der in Südostasien verbreiteten Gong- und Glockenspielkultur und war unter diesem Namen auch in der höfischen Musik der Nordmolukken weit verbreitet.\\nNamens- und formverwandt ist das kulintangan im malaysischen Bundesstaat Sabah auf Borneo. Es ist nicht zu verwechseln mit dem Kastenxylophon kolintang in der Region Minahasa in Nordsulawesi. In Tana Toraja in Südsulawesi kann kolintang ein Metallophon bedeuten."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%91%D0%B5%D1%82%D0%B0-%D0%BE%D0%BA%D0%B8%D1%81%D0%BB%D0%B5%D0%BD%D0%B8%D0%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f6/Carnitine_carrier_system.svg","page_title":"Бета-окисление","context_page_description":"Бе́та-окисле́ние, также цикл Кноопа — Линена, — метаболический процесс деградации жирных кислот. Своё название процесс получил по 2-му углеродному атому от карбоксильной группы жирной кислоты, который подвергается окислению и последовательному отделению от молекулы. Продуктами каждого цикла β-окисления являются ФАДH₂, НАДH и ацетил-КоА. Реакции β-окисления и последующего окисления ацетил-КоА в цикле Кребса служат одним из основных источников энергии для синтеза АТФ по механизму окислительного фосфорилирования.\\nВ эукариотических клетках β-окисление происходит исключительно в аэробных условиях в матриксе митохондрий или пероксисомах, у растений этот процесс осуществляется в глиоксисомах.\\nПроцесс β-окисления представляет собой специфический путь деградации жирных кислот. Он является одним из главных источников энергии, служащей для синтеза АТФ.\\nВсе реакции многостадийного окисления ускоряются специфическими ферментами. β-Окисление высших жирных кислот является универсальным биохимическим процессом, протекающим во всех живых организмах. У млекопитающих этот процесс происходит во многих тканях, в первую очередь в печени, почках и сердце."},{"page_url":"https://eu.wikipedia.org/wiki/Pomacanthus_xanthometopon","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/54/Pomacanthus_xanthometopon_2.jpg","page_title":"Pomacanthus xanthometopon","context_page_description":"Pomacanthus xanthometopon Pomacanthus generoko animalia da. Arrainen barruko Pomacanthidae familian sailkatzen da."},{"page_url":"https://it.wikipedia.org/wiki/Unione_Sportiva_Triestina_Calcio_1918","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8c/Coreografia_Curva_Furlan_nella_finale_play-off_.jpg","page_title":"Unione Sportiva Triestina Calcio 1918","context_page_description":"L'Unione Sportiva Triestina Calcio 1918 è una società calcistica italiana con sede nella città di Trieste, costituita nel 2016. Il club ha ripreso il titolo sportivo della US Triestina, nata il 2 febbraio 1919 dalla fusione dei club FC Trieste e CS Ponziana. Milita nel campionato di Serie C, il terzo livello del campionato italiano.\\nNell'agosto 2012, in forza dei 74 campionati professionistici a cui partecipò il sodalizio alabardato, e in applicazione dell'articolo 52 comma 10 delle NOIF, la FIGC permise l'iscrizione in Eccellenza alla nuova società, rilevando il titolo sportivo della vecchia. Al momento della nascita la società ha avuto in affitto dai tifosi lo stemma dello storico sodalizio, l'Unione Sportiva Triestina, che militava in Lega Pro Prima Divisione nella stagione 2011-2012 e che, fallita nel corso del 2012, non fu successivamente reiscritta ad alcun campionato. Nel 2014 i tifosi, proprietari del marchio, ne hanno revocato la concessione gratuita alla società, a causa della scarsa fiducia verso la proprietà. Tale significativo gesto è stato ripetuto l'anno seguente per la medesima motivazione."},{"page_url":"https://arz.wikipedia.org/wiki/%DA%A4%D9%88%D9%83_%D9%83%D8%A7%D8%B1%D8%A7%D8%AF%D8%B2%D9%8A%D9%83","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/41/VukKaradzic.jpg","page_title":"ڤوك كارادزيك","context_page_description":"ڤوك كارادزيك كان دبلوماسى من امبراطوريه عثمانيه."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%9E%D0%B1%D0%B8%D1%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ae/Smooches_%28baby_and_child_kiss%29.jpg","page_title":"Обич","context_page_description":"Обич е понятие, определящо чувство на привързаност на един индивид към друг. В общия случай тя няма сексуален оттенък за разлика от любовта.\\nПонятието се използва при формирането на глагола „обичам“ и изразява наличието на чувство на симпатия, предпочитание и/или привързаност към друг индивид или към всякакъв друг обект. Понятието е синоним на думата любов."},{"page_url":"https://de.wikipedia.org/wiki/Ali_Askar_Lali","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/76/%D8%B9%D9%84%DB%8C_%D8%B9%D8%B3%DA%A9%D8%B1_%D9%84%D8%B9%D9%84%DB%8C.jpg","page_title":"Ali Askar Lali","context_page_description":"Ali Askar Lali ist ein ehemaliger afghanischer Fußballnationalspieler und Trainer. 1981 kam er als Flüchtling über den Iran nach Deutschland und lebte viele Jahre in Paderborn. Inzwischen lebt er in Deutschland und Afghanistan.\\nAls Trainer beteiligt sich Lali zurzeit an einem Projekt des Auswärtigen Amtes zur Förderung des afghanischen Frauenfußballs und trainierte die afghanische Frauennationalmannschaft. Zudem assistiert er Slaven Skeledžić seit 2015 bei der Männernationalmannschaft."},{"page_url":"https://hu.wikipedia.org/wiki/Dimetil-poliszilox%C3%A1n","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/27/PDMS-cylindertje_onder_stereomicroscoop.jpg","page_title":"Dimetil-polisziloxán","context_page_description":"A dimetil-polisziloxán a legszélesebb körben használt szilícium alapú szerves polimer. Rendkívül sok területen alkalmazzák, a kontaktlencséktől kezdve orvosi műszereken, samponokon, síkosító olajokon keresztül egészen hőálló bevonatokig.\\nA dimetil-polisziloxán egy teljesen átlátszó, szobahőmérsékleten szilárd vegyület. Alig reakcióképes, nem mérgező, nem gyúlékony."},{"page_url":"https://es.wikipedia.org/wiki/Barjac_(Loz%C3%A8re)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/35/Map_commune_FR_insee_code_48018.png","page_title":"Barjac (Lozère)","context_page_description":"Barjac es una población y comuna francesa, situada en la región de Languedoc-Rosellón, departamento de Lozère, en el distrito de Mende y cantón de Chanac."},{"page_url":"https://en.wikipedia.org/wiki/Harold_Everett_Porter","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/50/Holworthy_Hall_%28Harold_Porter%29_%281917%29.png","page_title":"Harold Everett Porter","context_page_description":"Harold Everett Porter was an American writer. Under the pen name of Holworthy Hall he published plays, verse, novels and short stories. He took his pseudonym from the dormitory for first-year students where he stayed at Harvard University."},{"page_url":"https://en.wikipedia.org/wiki/List_of_monuments_of_Bishkek","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ad/%D0%9F%D0%B0%D0%BC%D1%8F%D1%82%D0%BD%D0%B8%D0%BA_%D0%B2_%D0%94%D1%83%D0%B1%D0%BE%D0%B2%D0%BE%D0%BC_%D0%9F%D0%B0%D1%80%D0%BA%D0%B5_%D0%9C%D1%83%D1%85%D1%82%D0%B0%D1%80%D1%83_%D0%90%D1%83%D1%8D%D0%B7%D0%BE%D0%B2%D1%83.jpg","page_title":"List of monuments of Bishkek","context_page_description":"The following is a list of public monuments in Bishkek, the capital of Kyrgyzstan."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%BE%D1%83%D0%BB","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d8/LionelRichie0995-1000.jpg","page_title":"Соул","context_page_description":"Со́ул — жанр популярной музыки афро-американского происхождения, возникший в южных штатах США в 1950-е годы на основе ритм-энд-блюза. Характерную эмоционально-прочувствованную, экстатическую, порой экзальтированную, «душевную» вокальную манеру соул-музыка восприняла из традиции духовных песнопений госпел и спиричуэлс, а также джазовой вокальной импровизации."},{"page_url":"https://pl.wikipedia.org/wiki/Jolanta_(opera)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7d/Iolanta_spb1.JPG","page_title":"Jolanta (opera)","context_page_description":"Jolanta – opera Piotra Czajkowskiego w jednym akcie z librettem Modesta Czajkowskiego, na podstawie dramatu duńskiego poety Henrika Herza Córka króla René."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A1%D0%B5%D1%80%D0%B6%D0%B5%D0%BD%D0%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d7/Chapelle_St_Roch_Sergenaux_2.jpg","page_title":"Сержено","context_page_description":"Сержено́ — муніципалітет у Франції, у регіоні Франш-Конте, департамент Жура. Населення — 67 осіб.\\nМуніципалітет розташований на відстані близько 320 км на південний схід від Парижа, 60 км на південний захід від Безансона, 25 км на північ від Лонс-ле-Соньє."},{"page_url":"https://cy.wikipedia.org/wiki/Pertyn_pot_blodau","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/94/Lepiota_aspera_2011-09-03.jpg","page_title":"Pertyn pot blodau","context_page_description":"Math a rhywogaeth o ffwng yn nheulu'r Agaricaceae yw'r Pertyn pot blodau. 'Y Pertynnod' yw'r enw ar lafar ar y grwp mae'r ffwng yma'n perthyn iddo, ond nid yw'n derm gwyddonol. 'Tlws' neu 'brydferth' yw 'pert', sy'n ddisgrifiad o liw a siap y ffyngau hyn. Mae'r teulu Agaricaceae yn gorwedd o fewn urdd yr Agaricales.\\nMae'r rhywogaeth hon o ffwng i'w chael yn Ewrop, Awstralia a Gogledd America.\\nLliw sborau'r fadarchen hon yw gwyn. O ran siâp, disgrifir y capan, neu gap y fadarchen fel un ovate mushroom cap. Gelwir y rhan oddi tan y capan yn hadbilen a cheir sawl math: arwyneb llyfn, tegyll, chwarennau, rhychau ayb; mae gan y fadarchen hon yr hyn a elwir yn: tegyll. O ran y broses o gymeryd maeth, fe'i disgrifir fel maethiad saproffytig."},{"page_url":"https://en.wikipedia.org/wiki/List_of_Russian_commanders_in_the_Patriotic_War_of_1812","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ca/Shuhanov_Daniil_Vasilyevich.jpg","page_title":"List of Russian commanders in the Patriotic War of 1812","context_page_description":"This is a list of commanders of the Russian Army in 1812 before the Patriotic War of 1812."},{"page_url":"https://pl.wikipedia.org/wiki/Mount_Steele","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ee/Mount_Steele.jpg","page_title":"Mount Steele","context_page_description":"Mount Steele – szczyt górski w Ameryce Północnej w Górach Świętego Eliasza o wysokości 5073 m n.p.m. Położony w kanadyjskim terytorium Jukon, jest piątym co do wysokości szczytem w Kanadzie i dziesiątym w całej Ameryce Północnej."},{"page_url":"https://fr.wikipedia.org/wiki/Vas_(Hongrie)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/00/HUN_K%C3%B6rmend_COA.jpg","page_title":"Vas (Hongrie)","context_page_description":"Vas est un comitat de l’ouest de la Hongrie."},{"page_url":"https://nn.wikipedia.org/wiki/Aleksej_Sjtjusev","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f5/Moscow_Kazansky_railway_station_asv2019-06.jpg","page_title":"Aleksej Sjtjusev","context_page_description":"Aleksej Viktorovitj Sjtjusev var ein russisk arkitekt. Han teikna mellom anna Leninmausoleet."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9F%D0%BE%D0%BB%D0%B8%D1%86%D0%B8%D1%8F_%D0%91%D0%BE%D1%81%D0%BD%D0%B8%D0%B8_%D0%B8_%D0%93%D0%B5%D1%80%D1%86%D0%B5%D0%B3%D0%BE%D0%B2%D0%B8%D0%BD%D1%8B","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4b/Police_car_of_Bosnia_and_Herzegovina_02.JPG","page_title":"Полиция Боснии и Герцеговины","context_page_description":"Поли́ция Бо́снии и Герцегови́ны — совокупность правоохранительных органов в Боснии и Герцеговине.\\nБосния и Герцеговина состоит из двух энтитетов — Республики Сербской и Федерации Боснии и Герцеговины, а также округа Брчко, фактически не являющимся частью ни одного из вышеназванных энтитетов.\\nКаждый энтитет имеет собственные полицейские силы. В Республике Сербской это полиция РС, подчинённая Министерству внутренних дел Республики Сербской. Федерация Боснии и Герцеговины разделена на десять кантонов, в каждом из которых имеется своя полиция. В округе Брчко также имеется собственная полиция.\\nЕдиным координирующим органом является Дирекция по координации полицейских органов БиГ. Также на общегосударственном уровне имеются специальные подразделения по борьбе с терроризмом и организованной преступностью, а также единые военная и пограничная полиции."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9C%D1%83%D0%B7%D0%B5%D0%B9_%D0%91%D0%BE%D0%B4%D0%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7d/Mosaikikon_Bode_Berlin_2.jpg","page_title":"Музей Боде","context_page_description":"Музей Боде — художній музей у складі ансамблю Музейного острова в Берліні, в якому розміщуються експозиції Скульптурного зібрання, Музею візантійського мистецтва та Монетного кабінету. 17 жовтня 2006 року музей відкрився після шестирічної реставрації."},{"page_url":"https://vi.wikipedia.org/wiki/T%E1%BB%95_ch%E1%BB%A9c_Hi%E1%BB%87p_%C6%B0%E1%BB%9Bc_%C4%90%C3%B4ng_Nam_%C3%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7b/Sabre_Mk32s_RAAF_in_Thailand_early_1960s.jpg","page_title":"Tổ chức Hiệp ước Đông Nam Á","context_page_description":"Tổ chức Hiệp ước Đông Nam Á, cũng còn gọi là Tổ chức Liên phòng Đông Nam Á hay Tổ chức Minh ước Đông Nam Á là một tổ chức quốc tế đã giải tán. Tổ chức phòng vệ này được thành lập căn cứ theo Hiệp ước phòng thủ tập thể Đông Nam Á hay Hiệp ước Manila được ký vào tháng 9 năm 1954, thể chế chính thức của SEATO được thiết lập vào ngày 19 tháng 2 năm 1955 tại Bangkok, Thái Lan, trụ sở cũng đặt tại Bangkok. Tổ chức từng có 8 quốc gia thành viên.\\nTổ chức Hiệp ước Đông Nam Á được thành lập với mục đích ngăn chặn sự lan tràn của chủ nghĩa cộng sản tại châu Á, tuy nhiên do chia rẽ nội bộ nên tổ chức này không có biện pháp thi hành hữu hiệu hành động phòng vệ, không thể can thiệp trong Nội chiến Lào và Chiến tranh Việt Nam, do đó sau khi tổ chức giải tán có học giả nhận định đây là một tổ chức quốc tế thất bại; tuy nhiên trên một phương diện khác, các kế hoạch văn hóa và giáo dục do tổ chức này tài trợ có ảnh hưởng sâu xa đối với khu vực Đông Nam Á. Do có nhiều quốc gia thành viên không còn muốn tham dự công tác của hội, lần lượt rút lui nên Tổ chức cuối cùng giải tán vào ngày 30 tháng 6 năm 1977."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%A1%D0%B0%D0%BD%D1%82%27%D0%90%D0%BB%D1%84%D0%B8%D0%BE","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/2d/Map_of_comune_of_Sant%27Alfio_%28province_of_Catania%2C_region_Sicily%2C_Italy%29.svg","page_title":"Сант'Алфио","context_page_description":"Сант'А̀лфио е малко градче и община в Южна Италия, провинция Катания, автономен регион и остров Сицилия. Разположено е на 531 m надморска височина. Населението на общината е 1663 души.\\nВ общинската територия се намира част от вулкана Етна. Главният център на общината се намира в подножието на планината."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_onroerend_erfgoed_in_Hasselt","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/07/Sint-Lambrechts-Herk_-_Hoeve_Kattendansstraat_49.jpg","page_title":"Lijst van onroerend erfgoed in Hasselt","context_page_description":"Een overzicht van het onroerend erfgoed in Hasselt. Het onroerend erfgoed maakt deel uit van het cultureel erfgoed in België."},{"page_url":"https://zh.wikipedia.org/wiki/%E6%8E%A5%E5%8F%97%E5%9C%A3%E7%97%95%E7%9A%84%E5%9C%A3%E5%BC%97%E6%9C%97%E8%A5%BF%E6%96%AF","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/42/Giotto_-_Sankt_Franciskus_stigmatisering.jpg","page_title":"接受圣痕的圣弗朗西斯","context_page_description":"“接受圣痕的圣弗朗西斯”同时指代两幅创作于1428至1432年间的无名画。艺术史学家一般将这两幅画归于弗兰德画家，扬·范·艾克之手。虽然尺寸有所不同，这两幅板面油画几乎完全相同。两幅画尺寸都不大，大幅作品约莫29.3厘米乘33.4厘米，现藏于意大利都灵市的萨包达美术馆，小幅作品尺寸为12.7厘米乘14.6厘米，现藏于美国宾夕法尼亚州的费城艺术博物馆。在1470年记录的Anselme Adornes的遗嘱中可以找到最早的相关文献记载。据记载，他有可能曾经拥有这两幅画。自19世纪至20世纪中，大多数学者倾向于将这两幅画看作扬·范·艾克的学徒或追随者根据扬·范·艾克的底稿设计绘成。\\n画作展示了亚西西的圣方济各一生中最著名的事件：双膝跪于石头边，于他自己的手掌与脚掌上接受钉于十字架上耶稣基督的圣痕。圣方济各身后是细节具备的岩石和风景，似乎将圣方济置于次要地位。而此种对圣方济的画面处理是第一次在北方文艺复兴艺术中出现。学者大多根据风格和质量确定此画是扬·范·艾克的手笔。另外，在西班牙马德里的普拉多博物馆还有一幅类似油画，但其明暗对比及整体设计都相较前两者逊色许多。\\n1983至1989年间，这两幅画都被技术检测过，并且经历较大的清理与修复工程。技术分析表明费城的圣方济各画作的木板本身与另两幅扬·范·艾克手笔来自同一棵树，而意大利的圣方济各画作表面颜料之下的底稿确是扬·范·艾克独特的风格。这两幅画最终于1998年在费城艺术博物馆的一次“认识扬·范·艾克”的展览中聚首。现在学界公认这两幅画均出自统一画家之手。"},{"page_url":"https://ar.wikipedia.org/wiki/%D9%81%D8%B3%D9%8A%D9%81%D8%B3%D8%A7%D8%A1_%D8%A7%D9%84%D8%B3%D9%8A%D8%AF_%D9%8A%D9%88%D9%84%D9%8A%D9%88%D8%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ce/Mosa%C3%AFque_du_seigneur_Julius_4%2C_Bardo.jpg","page_title":"فسيفساء السيد يوليوس","context_page_description":"تعود فسيفساء السيد يوليوس إلى نهاية القرن الرابع للميلاد، وقد عثر عليها بموقع قرطاج الأثري. وهي محفوظة حاليا بالمتحف الوطني بباردو.\\nوهي تشكل حاليا مصدرا للمعلومات عن العالم الريفي بمقاطعة أفريكا الرومانية في نهاية العصر القديم."},{"page_url":"https://arz.wikipedia.org/wiki/%D8%A7%D8%AF%D9%88%D9%8A%D9%86_%D9%84%D8%A7%D9%88%D8%B1%D9%8A%D9%86%D8%B3_%D8%AC%D9%88%D8%AF%D9%83%D9%8A%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/49/Edwin_L._Godkin.jpg","page_title":"ادوين لاورينس جودكين","context_page_description":"الصفحه دى يتيمه, حاول تضيفلها لينك فى صفحات تانيه متعلقه بيها.\\nادوين لاورينس جودكين كان صحفى من امريكا."},{"page_url":"https://ceb.wikipedia.org/wiki/Trautenfels","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/Trautenfels.jpg","page_title":"Trautenfels","context_page_description":"Kastilyo ang Trautenfels sa Ostriya. Nahimutang ni sa distrito sa Politischer Bezirk Liezen ug estado pederal sa Steiermark, sa sentro nga bahin sa nasod, 190 km sa kasadpan sa Vienna ang ulohan sa nasod. 666 metros ibabaw sa dagat kahaboga ang nahimutangan sa Trautenfels.\\nAng yuta palibot sa Trautenfels kay kabukiran sa habagatang-sidlakan, apan sa amihang-kasadpan nga kini mao ang kabungtoran. Trautenfels nahimutang sa usa ka walog. Kinahabogang dapit sa palibot ang Multereck, 2,176 ka metros ni kahaboga ibabaw sa dagat, 4.1 km sa kasadpan sa Trautenfels. Dunay mga 25 ka tawo kada kilometro kwadrado sa palibot sa Trautenfels medyo gamay nga populasyon. Ang kinadul-ang mas dakong lungsod mao ang Liezen, 12.6 km sa sidlakan sa Trautenfels. Sa rehiyon palibot sa Trautenfels, kabukiran talagsaon komon.\\nHapit nalukop sa lasang nga sagolsagol ang palibot sa Trautenfels. Ang klima hemiboreal. Ang kasarangang giiniton 4 °C. Ang kinainitan nga bulan Hulyo, sa 16 °C, ug ang kinabugnawan Enero, sa -8 °C. Ang kasarangang pag-ulan 1,759 milimetro matag tuig. Ang kinabasaan nga bulan Mayo, sa 190 milimetro nga ulan, ug ang kinaugahan Marso, sa 84 milimetro."},{"page_url":"https://en.wikipedia.org/wiki/List_of_historic_places_in_Dunedin","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7b/Bishopscourt_%28Columba_College%29.jpg","page_title":"List of historic places in Dunedin","context_page_description":"Māori settled in Otago relatively soon after reaching New Zealand, and the Dunedin area was a major whaling centre and site of early European colonisation. The building boom from the gold rush of the 1860s, coupled with the relative stagnation of the region's population in the 20th century, has led to the preservation of many old structures and sites. Dunedin City is 255 km² in area, covering Otago Harbour, the Taieri Plains and the tussock-covered mountains near Middlemarch. Some of the historical sites listed here are therefore rural in nature.\\nExceptional historical places are included in the national register in five groups: historic places, historic areas, Wāhi Tūpuna, Wāhi Tapu and Wahi Tapu areas. As of November 2018 there are 827 listings in Otago, of which 207 are Category 1 historic places. This list covers all historical areas, places and buildings on the New Zealand Heritage List that fall entirely or in part within Dunedin City. It also covers places of local importance or historical notability. The Huriawa Pā site and Toitu Tauraka Waka are designated as a Wāhi Tapu Area and Wāhi Tūpuna, respectively."},{"page_url":"https://eu.wikipedia.org/wiki/Ruth_(Nevada)","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f1/Company_Houses.JPG","page_title":"Ruth (Nevada)","context_page_description":"Ruth Ameriketako Estatu Batuetako erroldak esleitutako leku bat da. White Pine konderrian kokatuta dago, Nevada estatuan. 440 biztanle ditu, 0,895611 kilometro koadroko azaleran banatuta."},{"page_url":"https://ca.wikipedia.org/wiki/Jaciments_de_Skhul_i_Qafzeh","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/58/Skhul_Cave.JPG","page_title":"Jaciments de Skhul i Qafzeh","context_page_description":"Els jaciments de Skhul i Qafzeh són dues localitzacions amb fòssils humans situades al nord de Palestina, a les coves d'Es Skhül i Jabel Qafzeh respectivament. És Skhül es troba al Mont Carmel i Jabel Qafzeh a la Muntanya del Precipici a Natzaret.\\nLes restes tenen una antiguitat de 80.000-120.000 anys, suelen denominarse conjuntamente Skhul/Qafzeh, tenien cultura mosteriana i es caracteritzaven per trets d'humans arcaics i de moderns. Amb ells hi havia petxines marines perforades usades com a grans i aliment.\\nAquestes restes fòssils s'atribuïren inicialment a neandertals amb el nom Palaeoanthropus palaestinensis i després als primerencs Homo sapiens, tot i que la veritable relació d'aquests amb els humans moderns és discutible."},{"page_url":"https://sv.wikipedia.org/wiki/Enarmonia","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/96/Enarmonia_formosana_%2814279503142%29.jpg","page_title":"Enarmonia","context_page_description":"Enarmonia är ett släkte av fjärilar som beskrevs av Hübner 1826. Enarmonia ingår i familjen vecklare."},{"page_url":"https://fr.wikipedia.org/wiki/Michael_Berryman","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/92/Michael_Berryman_2007.png","page_title":"Michael Berryman","context_page_description":"Michael Berryman est un acteur américain, né le 4 septembre 1948 à Los Angeles. Il est surtout connu pour son physique atypique, qui lui a permis d'obtenir de nombreux rôles dans des films d'horreur."},{"page_url":"https://hi.wikipedia.org/wiki/%E0%A4%B5%E0%A5%88%E0%A4%82%E0%A4%95%E0%A5%82%E0%A4%B5%E0%A4%B0_%E0%A4%AA%E0%A4%AC%E0%A5%8D%E0%A4%B2%E0%A4%BF%E0%A4%95_%E0%A4%B2%E0%A4%BE%E0%A4%87%E0%A4%AC%E0%A5%8D%E0%A4%B0%E0%A5%87%E0%A4%B0%E0%A5%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/85/Vancouver_Carnegie.jpg","page_title":"वैंकूवर पब्लिक लाइब्रेरी","context_page_description":"वैंकूवर पब्लिक लाइब्रेरी कनाडा में दूसरी सबसे बड़ी सार्वजनिक पुस्तकालय प्रणाली है। इसके संग्रह में 2.8 मिलियन से अधिक वस्तुएँ है, प्रणाली की 22 शाखाएं और लगभग 375,000 कार्डधारक है, जो सलाना लगभग नौ लाख वस्तुएँ उधार लेते हैं। इसका प्रशासन केंद्र और साथ ही सबसे बड़ी शाखा, जिसे सेंट्रल ब्रांच के रूप में जाना जाता है, डाउनटाउन वैंकूवर में लाइब्रेरी स्क्वायर पर स्थित है।"},{"page_url":"https://sco.wikipedia.org/wiki/Fatih","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a9/LaleliMosqueView.jpg","page_title":"Fatih","context_page_description":"Fatih is a municipality an destrict in Istanbul, Turkey that encompasses maist o the peninsulae coincidin wi historic Constantinople. In 2009, the destrict o Eminönü, umwhile a separate municipality locatit at the tip o the peninsula, wis mergit intae Fatih. Fatih borders the Gowden Horn tae the north an the Sea o Marmara tae the sooth, while the Wastren mairch is demarkit bi the Theodosian waw. The mayor is Mustafa Demir."},{"page_url":"https://kk.wikipedia.org/wiki/%D0%9A%D0%B0%D0%BB%D0%B8%D1%84%D0%BE%D1%80%D0%BD%D0%B8%D1%8F_%D1%83%D0%BD%D0%B8%D0%B2%D0%B5%D1%80%D1%81%D0%B8%D1%82%D0%B5%D1%82%D1%96,_%D0%9C%D0%B5%D1%80%D1%81%D0%B5%D0%B4","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3d/UCM_library.jpg","page_title":"Калифорния университеті, Мерсед","context_page_description":"Калифорния университеті, Мерсед, оныншы және Калифорния университетінің ең жаңа кампусы. Ол Сан-Хоакин алқабында Мерсед окгругынде, Калифорния штатында, Мерсед қаласына жақын маңда Фреснодан солтүстікке қарай, Калифорния штатынада орналасқан. 2005 жылы КО Мерсед бірінші америкалық зерттеу университеті құрылған, ол 21-ші ғасырда салынды. КУ Мерсед студенттері көпшілігі Калифорниядан, Оңтүстік Калифорния, Орталық жазық, Солтүстік Калифорния арасында шамамен біркелкі бөлінген.\\nКУ Мерсед Америка Құрама Штаттарында кампус аумағында барлық ғимараттар leed стандарты бойынша сертификатталған бұл жалғыз институт. Оның Triple Net Zero міндеттемелері бойынша нөлдік қалдықтарды және нөлдік таза парниктік газдар шығарындыларын 2020 жылға қарай құру көзделіп отыр."},{"page_url":"https://fy.wikipedia.org/wiki/Putter","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bc/Stieglitzgelege.jpg","page_title":"Putter","context_page_description":"De putter is in moskeftige fûgel út de famylje fan de finkfûgels en it skaai fan de putters. It is in algemien foarkommende soarte, dy't lânseigen is yn Europa en fierders ek yn de Magreb fan Noard-Afrika, oan de iggen fan de Nyl yn Egypte, yn Lyts-Aazje, de Fruchtbere Healmoanne fan it Midden-Easten, Transkaukaazje en dielen fan Sintraal-Aazje. Putters binne lykwols ek op oare plakken yn de wrâld troch de minske yntrodusearre, te witten: dielen fan de Feriene Steaten, Kanada, Meksiko, Perû, Sily, Argentynje, Oerûguay, Brazylje, de Falklâneilannen, Súd-Afrika, Austraalje en Nij-Seelân. Oars as by in protte oare soarten moskeftigen is der by putters net folle seksuële dimorfy. Yn de Renêssânse waard de putter gauris, by wize fan foarútwizing, op skilderijen ôfbylde mei Madonna en Bern, om't er fanwegen de reade kleur fan syn kopke assosjearre waard mei it lijen fan Kristus."},{"page_url":"https://vi.wikipedia.org/wiki/Piranguinho","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7b/Igreja_de_Santa_Isabel_-_Piranguinho%2C_Minas_Gerais.jpg","page_title":"Piranguinho","context_page_description":"Piranguinho là một đô thị thuộc bang Minas Gerais, Brasil. Đô thị này có diện tích 130,334 km², dân số năm 2007 là 7849 người, mật độ 62,6 người/km²."},{"page_url":"https://en.wikipedia.org/wiki/Tabar_(axe)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/70/Indian_tabar_%28axe%29.jpg","page_title":"Tabar (axe)","context_page_description":"The tabar is a type of battle axe. The term tabar is used for axes originating from the Ottoman Empire, Persia, Armenia, India and surrounding countries and cultures. As a loanword taken through Iranian Scythian, the word tabar is also used in most Slavic languages as the word for axe."},{"page_url":"https://fr.wikipedia.org/wiki/%C3%81rmin_V%C3%A1mb%C3%A9ry","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ec/Carte_vambery-armin.png","page_title":"Ármin Vámbéry","context_page_description":"Ármin Vámbéry, ou Arminius Vambery, né Hermann Wamberger le 19 mars 1832 à Szentgyörgy, mort le 15 septembre 1913 à Budapest, est un géographe orientaliste hongrois, professeur des universités et membre de l'Académie hongroise des sciences."},{"page_url":"https://pl.wikipedia.org/wiki/Ko%C5%9Bci%C3%B3%C5%82_%C5%9Bw._Bernarda_przy_Termach","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/47/San_Bernardo_alle_Terme_%28Rome%29_-_Front.jpg","page_title":"Kościół św. Bernarda przy Termach","context_page_description":"Kościół św. Bernarda przy Termach – bazylika w Rzymie, zbudowana na terenie dawnych Term Dioklecjana.\\nŚwiątynia ta jest kościołem rektoralnym parafii Matki Bożej Anielskiej i Męczenników oraz kościołem tytularnym. Ponadto pełni rolę kościoła klasztornego bernardynów."},{"page_url":"https://id.wikipedia.org/wiki/Asam_asetat","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/45/Methanol_formylation.png","page_title":"Asam asetat","context_page_description":"Asam asetat, asam etanoat atau asam cuka adalah salah satu senyawa organik yang berada dalam golongan asam karboksilat. Asam cuka memiliki rumus empiris C₂H₄O₂. Rumus ini sering kali ditulis dalam bentuk CH₃–COOH, CH₃COOH, atau CH₃CO₂H. Asam asetat pekat adalah cairan higroskopis tak berwarna, dan memiliki titik beku 16,7°C. Asam asetat adalah komponen utama cuka selain air. Asam asetat berasa asam dan berbau menyengat. Selain diproduksi untuk cuka konsumsi rumah tangga, asam asetat juga diproduksi sebagai prekursor untuk senyawa lain seperti polivinil asetat dan selulosa asetat. Meskipun digolongkan sebagai asam lemah, asam asetat pekat bersifat korosif dan dapat menyebabkan iritasi pada kulit.\\nAsam asetat merupakan salah satu asam karboksilat paling sederhana, setelah asam format. Larutan asam asetat dalam air merupakan sebuah asam lemah, artinya hanya terdisosiasi sebagian menjadi ion H⁺ dan CH₃COO–. Asam asetat merupakan pereaksi kimia dan bahan baku industri yang penting. Asam asetat digunakan dalam produksi polimer seperti polietilena tereftalat, selulosa asetat, dan polivinil asetat, maupun berbagai macam serat dan kain."},{"page_url":"https://fr.wikipedia.org/wiki/Culture_du_Salvador","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/02/Ballet_folklorico_de_El_Salvador_by_Jesus_Sanchez.png","page_title":"Culture du Salvador","context_page_description":"La culture salvadorienne, ou culture du Salvador, pays d'Amérique centrale, façade pacifique, désigne d'abord les pratiques culturelles observables de ses habitants."},{"page_url":"https://es.wikipedia.org/wiki/Toma_de_raz%C3%B3n","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/62/DecretoGabrielaMistral.JPG","page_title":"Toma de razón","context_page_description":"La toma de razón es un control jurídico previo, general y obligatorio, propio del sistema chileno, que en materia de legalidad y constitucionalidad realiza la Contraloría General de la República de Chile, respecto de los decretos, decretos con fuerza de ley y resoluciones."},{"page_url":"https://sv.wikipedia.org/wiki/Floretteremit","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/Straight-billed_Hermit_%28Phaethornis_bourcieri%29.jpg","page_title":"Floretteremit","context_page_description":"Floretteremit är en fågel i familjen kolibrier."},{"page_url":"https://ur.wikipedia.org/wiki/%D9%82%D9%88%D9%85%DB%8C_%D8%A8%D8%A7%D8%BA%D8%B3%D8%AA%D8%A7%D9%86","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e7/Tunnel-View-Bridalveil9-075.JPG","page_title":"قومی باغستان","context_page_description":"قومی باغستان ایک متحفظ جنگلی پہاڑی علاقہ ہے جو حیاتی تنوع کا خزانہ ہو۔"},{"page_url":"https://hu.wikipedia.org/wiki/Vese","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/61/Gray1121.png","page_title":"Vese","context_page_description":"A vese a gerinceseknél a kiválasztás szerve: felelős a szervezet anyagcseréje közben keletkezett vízoldékony anyagcsere-végtermékek eltávolításáért, valamint alapvető szerepe van a só- és vízháztartás szabályozásában, a homeosztázis fenntartásában. Ezen kívül számos egyéb, kevésbé közismert működése van, mint például a vérnyomást szabályozó, vörösvértest termelést beindító és a kalciumanyagcserét szabályzó anyagok termelése. Emberben a hasüreg hátsó részén, a hashártya mögötti térben, a retroperitoneumban, az ágyéki gerinc két oldalán található, páros szerv."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%8D%8F%E6%A0%BC%E5%B0%94%E9%95%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/29/Shelkar-Kloster-02-Portal-2014-gje.jpg","page_title":"协格尔镇","context_page_description":"协格尔镇是中华人民共和国西藏自治区日喀则市定日县下辖的一个乡镇级行政单位，也是定日县县政府所在地，人口大约523人。该镇是攀登珠穆朗玛峰 和卓奥友峰的登山者的一个大本营。协格尔镇位于珠穆朗玛峰西北方向，距珠穆朗玛峰约60公里。距中尼边境约50公里。 海拔4300米。该镇是一个为攀登珠穆朗玛峰而设立的新镇。"},{"page_url":"https://en.wikipedia.org/wiki/Hangzhou_No._14_High_School","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b1/Hangzhou_No._14_High_School_02.jpg","page_title":"Hangzhou No. 14 High School","context_page_description":"Hangzhou No.14 High School is a provincial level key high school located at 580 Fengqi Road, Hangzhou, Zhejiang. The school is located at the center of the city. In front of Mituo Mountain and near West Lake, the school is energized by the atmosphere of Baochu Mountain and Baopu Monastery, as well as the luxurious shopping of Yan'an Road and Wulinmen. The building area is about thirty thousand square meters. Although its history goes back more than 100 years, it is not the oldest school in Hangzhou. Its objective is to make the campus modern and luxurious. Hangzhou Senior Middle School and Hangzhou No. 2 High School were founded in 1899, making them older than Hangzhou No. 14. Hangzhou Xuejun High School was set up in 1956 and Hangzhou Zhongce Vocational School in 1979.\\nIn the 30th year of Emperor Guangxu’s reign, a group of students including Shao Zhang, Sun Zhimin and Hu Huan came back to Hangzhou after graduating in Japan, and applied to establish “Hangzhou Girls’ School”, and wished this school to become the first girls’ school in China.\\nThe application was approved, and the school opened on May 2, 1904."},{"page_url":"https://en.wikipedia.org/wiki/Abbie_Hoffman","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/db/Abbie_Hoffman_visiting_the_University_of_Oklahoma_circa_1969.jpg","page_title":"Abbie Hoffman","context_page_description":"Abbot Howard Hoffman, better known as Abbie Hoffman, was an American political and social activist, anarchist, socialist, and revolutionary who co-founded the Youth International Party. He was also a leading proponent of the Flower Power movement.\\nHoffman was arrested and tried for conspiracy and inciting to riot as a result of his role in protests that led to violent confrontations with police during the 1968 Democratic National Convention, along with Jerry Rubin, David Dellinger, Tom Hayden, Rennie Davis, John Froines, Lee Weiner, and Bobby Seale. The group was known collectively as the \\"Chicago Eight\\"; when Seale's prosecution was separated from the others, they became known as the Chicago Seven. While the defendants were initially convicted of intent to incite a riot, the verdicts were overturned on appeal.\\nHoffman continued his activism into the 1970s, and remains an icon of the anti-war movement and the counterculture era. He died by suicide, via a phenobarbital overdose in 1989."},{"page_url":"https://fr.wikipedia.org/wiki/Exposition_universelle_de_1900","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/Exposition_universelle_1900_Ticket.jpg","page_title":"Exposition universelle de 1900","context_page_description":"L'Exposition universelle de 1900 ou L'Exposition de Paris 1900 est la cinquième exposition universelle organisée à Paris après celle de 1855, celle de 1867, celle de 1878 et celle de 1889.\\nAnnoncée le 13 juillet 1892, elle est inaugurée le 14 avril 1900 par le président Émile Loubet et ouvre au public le 15 avril. Elle se termine le 12 novembre, après 212 jours d'ouverture. Elle accueille 50,8 millions de visiteurs.\\nManifestation emblématique de la Belle Époque et de l'Art nouveau, elle lègue à Paris plusieurs bâtiments dont le Petit Palais et le Grand Palais. Le thème est « Bilan d'un siècle ». Par ailleurs, les IIᵉ Jeux olympiques de l'ère moderne se déroulent à Paris dans le cadre de cette exposition universelle."},{"page_url":"https://en.wikipedia.org/wiki/Lana_Petranovi%C4%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/61/2018_EC_Lana_Petranovi%C4%87_Antonio_Souza-Kordeiru_2018-01-18_19-26-07_%285%29.jpg","page_title":"Lana Petranović","context_page_description":"Lana Petranović is a Croatian pair skater. With her skating partner, Antonio Souza-Kordeiru, she has competed in the final segment at four European Championships."},{"page_url":"https://he.wikipedia.org/wiki/%D7%A8%D7%95%D7%96_%D7%A7%D7%95%D7%95%D7%A8%D7%A5","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/34/%D7%A8%D7%95%D7%96_%D7%A7%D7%95%D7%95%D7%A8%D7%A5.png","page_title":"רוז קוורץ","context_page_description":"רוז קוורץ הוא מינרל מסוג קוורץ בעל גוון הנע בין ורוד חיוור לאדום-ורד. המקור לצבע הוא בכמויות זעירות יחסית של טיטניום, ברזל, או מנגן. בכמה מקרים מכיל רוז קוורץ מחטי רוטיל זעירות המייצרות את תופעת האסטריזם, כאשר מאירים את האבן מאחוריה. מחקרים אחרונים בעקיפה של קרני רנטגן מלמדים שהסיבה לצבע הם סיבים מיקרוסקופים דקיקים של המינרל דיומורטיט בתוך מסת הקוורץ. את הרוז קוורץ מוצאים לעיתים רחוקות בצורה הגבישית. במצב זה מניחים כי מקור הצבע בכמויות זעירות של פוספט או אלומיניום. הצבע בגבישים כנראה רגיש לאור ונוטה לדהות בסופו של דבר.\\nהגבישים הראשונים של רוז קוורץ נמצאו בפגמטיט בסמוך לרמפורד במיין שבארצות הברית. כיום מוצאים רוז קוורץ גם במדגסקר, בהודו, בגרמניה ובכמה מקומות בארצות הברית, אבל רוב הגבישים הנמכרים בשוק כיום מקורם במדינת מינאס ז'ראיס שבברזיל.\\nהאבן אינה פופולרית לחיתוך כאבן חן בעלת פאות משום שהאבנים תמיד מעורפלות, צבען הוורוד בדרך כלל חיוור מדי, ובמרבית אבני החן מרוז קוורץ יש פגמים גדולים. ליטוש רוז קוורץ כקבושון, ככדורים עבור חרוזים למחרוזת או גילוף ברוז קורץ יעילים הרבה יותר.\\nבארצות הברית, באוסטרליה ובתאילנד רוז קוורץ היא אבן ההולדת התחליפית של חודש ינואר."},{"page_url":"https://eu.wikipedia.org/wiki/Trompe-l%27%C5%93il","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cc/Escaping_criticism-by_pere_borrel_del_caso.png","page_title":"Trompe-l'œil","context_page_description":"Trompe-l'œil ikusleari benetako gauzaki bat erliebean ikusten duelako irudipena sortzen dion margolanari, edo haren zati bati, ematen zaion izena da."},{"page_url":"https://vi.wikipedia.org/wiki/Camaridium_carinatum","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fa/Camaridium_carinatum_02.jpg","page_title":"Camaridium carinatum","context_page_description":"Camaridium carinatum là một loài thực vật có hoa trong họ Lan. Loài này được Hoehne mô tả khoa học đầu tiên năm 1947."},{"page_url":"https://fr.wikipedia.org/wiki/Trebi%C5%A1ov","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0d/Castle_Pari%C4%8D.jpg","page_title":"Trebišov","context_page_description":"Trebišov est une ville de région de Košice, en Slovaquie, dans l'ancien comitat hongrois de Zemplín."},{"page_url":"https://fr.wikipedia.org/wiki/Cornettes_de_Bise","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/18/Cornettes_de_Bise.jpg","page_title":"Cornettes de Bise","context_page_description":"Les Cornettes de Bise sont une montagne située à la limite du département de la Haute-Savoie et du canton du Valais, dans le massif du Chablais et qui culminent à 2 431 ou 2 432 mètres d'altitude. Elles partagent cette altitude avec le mont de Grange et constituent les seconds plus hauts sommets du massif du Chablais derrière les Hauts-Forts. Elles marquent la frontière franco-suisse entre le val d'Abondance et le vallon de Tanay."},{"page_url":"https://en.wikipedia.org/wiki/Hunterian_Museum_and_Art_Gallery","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3c/Hunterian_Museum%2C_main_hall.jpg","page_title":"Hunterian Museum and Art Gallery","context_page_description":"The University of Glasgow's museum dedicated to William Hunter is the oldest museum in Scotland. It covers the Hunterian Museum, the Hunterian Art Gallery, the Mackintosh House, the Zoology Museum and the Anatomy Museum, all located in various buildings on the main campus of the University in the west end of Glasgow."},{"page_url":"https://en.wikipedia.org/wiki/Mount_Manaia","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a2/Mt_Lion.JPG","page_title":"Mount Manaia","context_page_description":"Mount Manaia is a dominant landmark approximately 30 kilometres southeast of Whangarei city on the Whangarei Heads peninsula.\\nStanding 420 metres, the summit offers outstanding views of the Marsden Point Oil Refinery, Bream Bay and the Hauraki Gulf to the south, Whangarei Harbour to the west and the Poor Knights Islands and Northland coast to the north.\\nMt Manaia - along with Mt Lion, Bream Head and the Hen and Chicken Islands, are the scattered remnants of a large, 50 kilometer diameter volcano that erupted with force 20 million years ago during the early miocene period. Its jagged outline is similar to that of its neighbours and other volcanic outcrops in Northland that erupted in a similar period.\\nToday blanketed by native bush, Manaia's jagged peaks and steep bluffs are protected within a Department of Conservation reserve which features a well-maintained 1½ hour track to the summit."},{"page_url":"https://pl.wikipedia.org/wiki/RWD-8","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/41/Bundesarchiv_Bild_183-E11027%2C_Polen%2C_zerst%C3%B6rtes_polnisches_Flugzeug.jpg","page_title":"RWD-8","context_page_description":"RWD-8 – polski samolot szkolny, skonstruowany przez zespół konstrukcyjny RWD, używany w polskim lotnictwie wojskowym od 1934 do 1939 jako podstawowy samolot szkolny."},{"page_url":"https://fr.wikipedia.org/wiki/Saint-Gobain_(Aisne)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/01/%C3%89glise_Saint-Gobain_de_Saint-Gobain_%28DxO_copie%29.jpg","page_title":"Saint-Gobain (Aisne)","context_page_description":"Saint-Gobain est une commune française située dans le département de l'Aisne, en région Hauts-de-France."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_nationale_parken_in_Canada","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/28/Ainsworth_bay_and_Marinelli_Glacier.jpg","page_title":"Lijst van nationale parken in Canada","context_page_description":"Dit is een lijst van Canadese nationale parken. De nationale parken van Canada worden beheerd door het agentschap Parks Canada voor de Canadese overheid. Dit gebeurt conform de National Parks Act die door het Canadees parlement een eerste maal werd goedgekeurd in 1887 en vervolgens veelvuldig werd aangepast. Sinds 2015 telt Canada 39 nationale parken en acht National Park Reserves, dit is een aparte aanduiding die in 1972 in voege kwam voor beschermde natuurlandschappen die reeds onder het beheer van Parks Canada vallen en bestemd zijn om als Nationaal Park erkend te worden maar waar de rechten van de First people nog moeten geregeld worden en overeenkomsten moeten vastgelegd worden voor de mogelijke verdere voortzetting van traditioneel landgebruik in deze parken. In de Engelstalige naamgeving spreekt men expliciet over Park Reserve, in het hieronder opgenomen lijstje is de vermelding van reserve tussen haakjes aan de naam toegevoegd.\\nDe 47 parken en Park Reserves samen bestrijken een totale landoppervlakte van 328.198 km² wat overeenkomt met 3,3% van de totale landoppervlakte van Canada. Elk van de 13 provincies en territoria heeft minstens een nationaal park."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%91%D0%BE%D0%BB%D1%8C%D1%88%D0%B8%D0%B5_%D0%98%D0%B7%D0%BE%D1%80%D0%B8_(%D0%9B%D0%B5%D0%BD%D0%B8%D0%BD%D0%B3%D1%80%D0%B0%D0%B4%D1%81%D0%BA%D0%B0%D1%8F_%D0%BE%D0%B1%D0%BB%D0%B0%D1%81%D1%82%D1%8C)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/97/Zapishenje1863.jpg","page_title":"Большие Изори (Ленинградская область)","context_page_description":"Большие Изори — деревня в Заклинском сельском поселении Лужского района Ленинградской области."},{"page_url":"https://hi.wikipedia.org/wiki/%E0%A4%A8%E0%A5%8D%E0%A4%AF%E0%A5%82_%E0%A4%B9%E0%A5%8B%E0%A4%B0%E0%A4%BE%E0%A4%87%E0%A4%9C%E0%A4%BC%E0%A4%A8%E0%A5%8D%E0%A4%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c8/Pluto_by_LORRI%2C_1_July_2015_%28Composite%29.jpg","page_title":"न्यू होराइज़न्स","context_page_description":"न्यू होराइज़न्स अमेरिकी अंतरिक्ष अनुसन्धान संस्था नासा का एक अंतरिक्ष शोध यान है जो हमारे सौर मंडल के बाहरी बौने ग्रह यम के अध्ययन के लिये छोड़ा गया था। इस यान का प्रक्षेपण 19 जनवरी 2006 किया गया था जो नौ वर्षों के बाद 14 जुलाई 2015 को प्लूटो के सबसे नजदीक से होकर गुजरा। यह प्लूटो और उसके पांचों ज्ञात उपग्रहों - शैरन, निक्स, हाएड्रा, स्टायक्स और ऍस/२०११ पी १ के आँकड़े भेजेगा। इसके बाद अगर कोई अन्य काइपर घेरे की वस्तु देखने योग्य मिलती है तो संभव है की इस यान के द्वारा उसके पास से भी निकलकर जानकारी और तस्वीरें हासिल की जा सकें।\\nन्यू होराइजन्स यान को रॉकेट के ऊपर लगाकर १९ जनवरी २००६ को छोड़ा गया था। ७ अप्रैल २००६ को इसने मंगल ग्रह की कक्षा पार की, २८ फ़रवरी २००७ को बृहस्पति ग्रह की, ८ जून २००८ को शनि ग्रह की और १८ मार्च २०११ को अरुण ग्रह की। इसे छोड़ने की गति किसी भी मानव कृत वस्तु से अधिक रही थी - अपने आखरी रॉकेट के बंद होने तक इसकी रफ़्तार १६.२६ किलोमीटर प्रति सैकिंड पहुँच चुकी थी।"},{"page_url":"https://sv.wikipedia.org/wiki/Lista_%C3%B6ver_offentlig_konst_i_G%C3%B6teborg","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e5/Katt_med_liten_vulkan.jpg","page_title":"Lista över offentlig konst i Göteborg","context_page_description":"Detta är ett urval av offentlig konst, främst skulpturer, i Göteborgs Stad."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E8%BE%BE%E9%9B%B7%E5%B0%94%C2%B7%E8%8E%AB%E9%9B%B7","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/0a/Darylmorey01.jpg","page_title":"达雷尔·莫雷","context_page_description":"達雷爾·莫雷，美國體育行政主管，現為美國國家籃球協會休士頓火箭隊總經理。他是分析方法的強力支持者，創造了「真實投籃命中率」統計數據，並共同創立了年度麻省理工學院斯隆體育分析會議。莫雷的籃球理念，依賴大量分析，有利於中距離跳投的三分球命中率。"},{"page_url":"https://en.wikipedia.org/wiki/France%E2%80%93Germany_relations","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/37/DeGaulleAdenauer.jpg","page_title":"France–Germany relations","context_page_description":"The relations between France and Germany form an integral part of the wider politics of Europe with both countries being founder and leading Member states of the European Union and its predecessor the European Communities since its inception in 1958 with the signing of the Treaty of Rome.\\nGeneral relations between the two countries since 1871, according to Ulrich Krotz, have had three grand periods: 'hereditary enmity', 'reconciliation' and since 1963 the 'special relationship' embodied in a cooperation called Franco-German Friendship.\\nIn the context of the European Union, the cooperation between the two countries is immense and intimate. Even though France has at times been eurosceptical in outlook, especially under President Charles de Gaulle, Franco-German agreements and cooperations have always been key to furthering the ideals of European integration.\\nIn recent times, France and Germany are among the most enthusiastic proponents of the further integration of the EU. They are sometimes described as the \\"twin engine\\" or \\"core countries\\" pushing for moves."},{"page_url":"https://da.wikipedia.org/wiki/Joint_Direct_Attack_Munition","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/98/GBU-31_xxl.jpg","page_title":"Joint Direct Attack Munition","context_page_description":"Joint Direct Attack Munition er et styringssystem der kan konvertere en standard flybombe eller \\"dum bombe\\" til en præcisionsbombe, eller \\"smart bomb\\". Bomber påmonteret med JDAM bliver styret mod målet ved hjælp af et inertinavigationssystem integreret med et GPS-system som giver dem en rækkevidde på op til 28 kilometer. JDAM-udstyret kan monteres på bomber fra 227 kg til 907 kg. Når systemet bliver monteret på en bombe bliver bombens tekniske betegnelse ændret fra eksempelvis Mark 8x eller BLU til GBU. JDAM er i sig selv ikke et våben, men et system der bliver påmonteret en flybombe og gør den i stand til at styre mod en geografisk lokalitet med høj præcision. Nøglekomponenterne i systemet er halesektionen, hvor styrecomputeren er placeret sammen med GPS- og INS-systemerne, samt styrefinnerne. JDAM-systemet skulle forbedre præcisionen i forhold til den ældre laser- og infrarøde teknologi der blev benyttet i tidligere præcisionsbombesystemer og kunne risikere dårlig præcision grundet eventuelt dårligt vejr eller et infavorabelt terræn. Nogle JDAM-systemer er også udstyret med lasersystemer."},{"page_url":"https://de.wikipedia.org/wiki/Charles-F.-Adams-Klasse","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0c/USS_Claude_V._Ricketts_%28DDG-5%29_drydocked.jpg","page_title":"Charles-F.-Adams-Klasse","context_page_description":"Die Charles-F.-Adams-Klasse war eine Klasse von Lenkwaffenzerstörern, die für die United States Navy gebaut wurde. Jeweils drei Einheiten wurden auf US-Werften für die deutsche Marine und für die Royal Australian Navy gefertigt. Die ab 1960 in Dienst gestellten Einheiten wurden Anfang der 1990er respektive um die Jahrtausendwende außer Dienst gestellt."},{"page_url":"https://hsb.wikipedia.org/wiki/Maseru","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/Maseru_from_Parliament_Hill.jpg","page_title":"Maseru","context_page_description":"Maseru je stolica a z něhdźe 220.000 wobydlerjemi tež najwjetše město a scyła jeničke wulkoměsto Lesotha w južnej Africe. Nadeńdźe so na zapadźe kraja bjezposrědnje při južnoafriskej hranicy. Móst přez rěku Caledon, kotraž twori statnu hranicu, je najwažniši hraničny přechod mjez woběmaj krajomaj.\\nW měsće knježi subtropiska horinska klima z miłej zymu a ćopłym lěćom. Přerězne temperatury leža mjez 14 a 28° C w januarje a mjez 0 a 15° C w juniju. Suchi čas traje wot meje hač do septembra."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%93%D0%97%D0%9A_%C2%AB%D0%95%D1%80%D0%B4%D0%B5%D0%BD%D0%B5%D1%82%C2%BB","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/61/Erdenet_09.JPG","page_title":"ГЗК «Ерденет»","context_page_description":"Спільне монголо-російське підприємство гірничо-збагачувальний комбінат «Ерденет» Скор. СП ГЗК «Ерденет» — гірничо-збагачувальний комбінат у місті Ерденет в Монголії."},{"page_url":"https://ko.wikipedia.org/wiki/CETME","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/91/CETMEL.lateral.der.png","page_title":"CETME","context_page_description":"CETME는 스페인의 돌격소총으로, 제2차 세계 대전 독일의 기술자였던 루드윅 보그리밀러가 시제품만이 존재하는 StG45를 기초로 설계하였다. 1958년 스페인군에 정식 채용되기 시작해서 1982년 G36로 대체될 때까지 쓰였다.\\nCETME A 모델이 헤클러&코흐에서 G3를 설계할 당시에 참고 모델이 되어, G3의 탄창은 CETME와도 호환된다."},{"page_url":"https://en.wikipedia.org/wiki/Gda%C5%84ska_Street_in_Bydgoszcz","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/16/Bydgoszcz%2C_willa%2C_1904.JPG","page_title":"Gdańska Street in Bydgoszcz","context_page_description":"Gdańska Street is one of the main street of downtown Bydgoszcz, Poland. Initially, the street was a thoroughfare, but in the second half of the 19th century, it turned residential. It ran from the Brda river to Bydgoszcz northern part of town an has gradually become the city center of trade and entertainment. During the interwar period, Gdańska street was the third longest street in Bydgoszcz with a total length of 3.19 km.\\nThe street connects the Old Town with the northern areas of Bydgoszcz agglomeration. The southern part is the real \\"spinal column\\" of Bydgoszcz downtown and the most architecturally representative, while the northern part - from the Municipal Stadium to the northern boundaries of the city- is bordered by Forest Park of Culture and Leisure and the Gdańsk Forest. Rich architecturally, Gdańska Street has got many buildings listed on the Kuyavian-Pomeranian Voivodeship Heritage list."},{"page_url":"https://it.wikipedia.org/wiki/Ren%C3%A9_Le_Grev%C3%A8s","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/Ren%C3%A9_Le_Grev%C3%A8s.jpg","page_title":"René Le Grevès","context_page_description":"René Breton Le Grevès è stato un ciclista su strada e pistard francese.\\nProfessionista dal 1933 al 1941, conta sedici vittorie di tappa al Tour de France e affermazioni in numerose classiche francesi, fra cui la Parigi-Tours e il campionato nazionale in linea 1936. Il soprannome Breton è dovuto alle origi bretoni del ciclista che, pur essendo nato a Parigi, visse e si formò ciclisticamente in terra bretone."},{"page_url":"https://fr.wikipedia.org/wiki/R%C3%A9giment_de_La_Sarre","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/54/R%C3%A9giment_de_La_Sarre_1.jpg","page_title":"Régiment de La Sarre","context_page_description":"Le régiment de La Sarre est un régiment d’infanterie du Royaume de France créé en 1651."},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/Monassut-Audiracq","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/cb/Mairie_de_Monassut_-_Audirac.jpg","page_title":"Monassut-Audiracq","context_page_description":"Monassut-Audiracq sī ūi-tī Hoat-kok Aquitaine toā-khu Pyrénées-Atlantiques koān ê chi̍t ê commune."},{"page_url":"https://mn.wikipedia.org/wiki/%D0%97%D2%AF%D0%B9%D0%BB%D1%81%D0%B8%D0%B9%D0%BD_%D0%B8%D0%BD%D1%82%D0%B5%D1%80%D0%BD%D0%B5%D1%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ab/Internet_of_Things.jpg","page_title":"Зүйлсийн интернет","context_page_description":"Зүйлсийн интернет гэдэг бол физик төхөөрөмж, тээврийн хэрэгсэл, гэр ахуйн цахилгаан хэрэгсэл гэх мэт, дотроо электроник, програм хангамж, мэдрүүл, асаагуурыг шигтгэсэн юмсын сүлжээ юм. Энэ сүлжээний холболт нь тэдгээр объектуудыг хоорондоо холбогдож, өгөгдөл солилцох боломжоор хангадаг. Зүйл бүр нь өөртөө шигдсэн тооцоолох системээр цор ганц болон танигдах бөгөөд интернетийн дэд бүтцээр дамжуулан харилцан ажиллах боломжтой.\\n2020 он гэхэд ойролцоогоор 30 тэрбум объект зүйлсийн интернетэд хамаарч, зүйлсийн интернетийн дэлхийн зах зээл дээрх үнэлгээ 7,1 их наяд доллар хүрнэ гэж экспертүүд барагцаалж байна. Ойрын ирээдүйд ойролцоогоор 200 тэрбум төхөөрөмжтэй холбоотой тооцоо байдаг.\\nЗүйлсийн интернет нь сүлжээний дэд бүтцээр дамжуулан объектуудыг алсаас мэдрэх, удирдах, хянах боломжоор хангадаг. Ингэснээр бодит ертөнцийг компьютерт суурилсан системүүдтэй илүү шууд интеграцитай болгож үр нөлөө, оновчлол, эдийн засгийн үр ашгийг нэмэгдүүлж, хүний хөндлөнгийн оролцоог багасгадаг. Зүйлсийн интернет нь мэдрүүл, асаагуураар өргөжсөн үедээ кибер-физикийн систем гэдэг, илүү ерөнхий ангиллын нэг жишээ болдог."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E7%B4%A2%E7%88%BE%E9%A0%93%E6%B9%96","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/02/Salton_Sea_Reflection.jpg","page_title":"索爾頓湖","context_page_description":"索爾頓湖又譯索爾頓海，是美國的鹹水湖，位於加利福尼亞州，面積974平方公里，集水區面積21,700平方公里，處於海平面以下69米，最大水深16米，蓄水量9.25立方公里，鹽度為4.4%。\\n索爾頓湖原為乾涸的古老湖床，於1905年因科羅拉多河水位急漲，河水沖毀人工灌溉渠的河堤湧入盆地而形成。1907年人們築成新的水壩後，科羅拉多河的河水不再大量流入索爾頓湖。\\n索爾頓湖造就了新的鳥類棲息地。1930年，桑尼波諾索爾頓海國家野生動物保護區成立。\\n位於沙漠區的索爾頓湖因偶然而形成，其集水區降雨量偏低，在缺少水源補充和長年湖水蒸發下，水位逐漸下降，與此同時湖水鹽度上升。曾經興旺的漁業因湖水變得過鹹造成魚類消失而不再存在。如果不是有取自科羅拉多河的灌溉用水從上游農場流入索爾頓湖，湖水消失速度會更快，不過這些農業徑流也把農藥和肥料帶入湖中造成污染。加州當局計劃從2017年開始自科羅拉多河引入河水灌入索爾頓湖，以恢復湖區生態和減低沙塵造成的空氣污染。"},{"page_url":"https://es.wikipedia.org/wiki/Tamaj%C3%B3n","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/4d/Tamajon-Iglesia_romanica-XVI_s-02.jpg","page_title":"Tamajón","context_page_description":"Tamajón es un municipio y localidad española de la provincia de Guadalajara, en la comunidad autónoma de Castilla-La Mancha. Tiene una superficie de 116,28 km² con una población de 148 habitantes​ y una densidad de 1,37 hab./km². Además del propio núcleo de Tamajón, comprende las pedanías de Almiruete, Palancares y Muriel y el despoblado de Sacedoncillo.\\nA la entrada se encuentra la iglesia del siglo XVI dedicada a la Asunción de Nuestra Señora y en la calle Enmedio junto a la plaza, el palacio de los Mendoza actual ayuntamiento de la localidad. A dos kilómetros de distancia en dirección norte se encuentra la ermita de la Virgen de los Enebrales, patrona de la localidad. El edificio es del siglo XVI, aunque se amplió en el siglo XVIII. En esta zona se encuentra también la Ciudad Encantada de Tamajón, un entorno en el que las piedras calizas toman formas caprichosas debido a la erosión del viento y el agua.\\nEn la cueva de los Torrejones, situada en el término municipal se han encontrado restos de un leopardo del Pleistoceno, entre otros taxones.​"},{"page_url":"https://he.wikipedia.org/wiki/%D7%90%D7%95%D7%98%D7%95_%D7%A4%D7%A8%D7%93%D7%99%D7%A0%D7%A0%D7%93_%D7%A4%D7%95%D7%9F_%D7%90%D7%91%D7%A0%D7%A1%D7%A4%D7%A8%D7%92_%D7%90%D7%95%D7%A0%D7%93_%D7%98%D7%A8%D7%90%D7%95%D7%9F","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ad/AT_20136_Maria-Theresien-Denkmal_Kaiserforum%2C_Wien%2C_Otto_Ferdinand_Graf_Traun-9037.jpg","page_title":"אוטו פרדיננד פון אבנספרג אונד טראון","context_page_description":"אוטו פרדיננד פון אבנספרג אונד טראון היה גנרל-פלדמרשל אוסטרי אשר לחם במלחמות רבות בשירות האימפריה הרומית הקדושה במחצית הראשונה של המאה ה-18."},{"page_url":"https://lt.wikipedia.org/wiki/Brodai","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/eb/%D0%A6%D0%B5%D1%80%D0%BA%D0%B2%D0%B0_%D0%A1%D0%B2.%D0%AE%D1%80%D1%96%D1%8F_2.jpg","page_title":"Brodai","context_page_description":"Brodai – miestas Ukrainos vakaruose, Lvovo srityje, 100 km į šiaurės rytus nuo Lvovo, prie Bovdurkos upelio; rajono centras. Pro miestą eina Kijevo–Lvovo plentas ir geležinkelis. Mechaninių dirbinių gamybos, siuvimo, maisto pramonė.\\nVeikia istorinis–krašto muziejus, Dievo Motinos cerkvė, Šv. Trejybės cerkvė su varpine, Šv. Jurgio cerkvė su rokoko stiliaus ikonomis. Yra Brodų tvirtovės griuvėsiai, didžiosios sinagogos griuvėsiai, XIX a. pab. – XX a. pr. gyvenamieji ir visuomeniniai statiniai."},{"page_url":"https://ca.wikipedia.org/wiki/Geu","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a7/Geu_%C3%A9glise.JPG","page_title":"Geu","context_page_description":"Geu és un municipi francès, situat al departament dels Alts Pirineus i a la regió d'Occitània."},{"page_url":"https://azb.wikipedia.org/wiki/%D9%81%D8%B1%D8%A7%D9%86%DA%A9%D8%B2_%D9%BE%DB%8C._%D8%A8%D9%88%D9%84%D8%AA%D9%88%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b4/Frances_P._Bolton_1940-3_seated.jpg","page_title":"فرانکز پی. بولتون","context_page_description":"فرانکز پی. بولتون آمریکالی سیاستچی قادین، جومهوری حزبینین عوضوو ایدی. ۱۸۸۵ ایلینده دۆنیایا گؤز آچیب و ۱۹۷۷ میلادی ایلینده حیاتین دَییشدی."},{"page_url":"https://de.wikipedia.org/wiki/Hartmann_II._von_Gr%C3%BCningen","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/28/Bartholom%C3%A4uskirche_Westwerk_Web.jpg","page_title":"Hartmann II. von Grüningen","context_page_description":"Hartmann II. von Grüningen war ein Württemberger Graf, der als Reichssturmfähnrich mit Burggrafschaft und Stadt Grüningen, heute Markgröningen, belehnt war. Zusammen mit Ulrich I. von Württemberg hatte er sich in den Dienst des Papstes und der Gegenkönige gestellt, um den Staufern die schwäbische Herzogswürde und ihre Königsgüter im schwäbischen Unterland abzunehmen. Das von den Staufern zur Reichsstadt erhobene Grüningen wollte er zu seiner fürstlichen Residenzstadt ausbauen. Ulrich verfolgte dasselbe Ziel mit Stuttgart."},{"page_url":"https://it.wikipedia.org/wiki/Thomas_Francis_Bayard","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/19/Thomas_F._Bayard%2C_Brady-Handy_photo_portrait%2C_circa_1870-1880.jpg","page_title":"Thomas Francis Bayard","context_page_description":"Thomas Francis Bayard è stato un politico e avvocato statunitense."},{"page_url":"https://oc.wikipedia.org/wiki/Land%C3%A9vant","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/27/Gare-landevant-halle-marcha.jpg","page_title":"Landévant","context_page_description":"Landevant en breton es una comuna bretona, situada dins lo departament de Mor-Bihan e la region de Bretanha."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%92%D1%81%D0%B5%D0%BC%D0%B8%D1%80%D0%BD%D0%B0%D1%8F_%D0%B2%D1%8B%D1%81%D1%82%D0%B0%D0%B2%D0%BA%D0%B0_(1904)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8f/Louisiana_Purchase7_1903_Issue-10c-crop.jpg","page_title":"Всемирная выставка (1904)","context_page_description":"Всемирная выставка должна была пройти в городе Сент-Луисе в 1903 году — в год столетия Луизианской покупки. По разным причинам открытие выставки было перенесено на май 1904 года, а продлилась она до 1 декабря.\\nОтличительной чертой данной выставки был её размах. Один только сельскохозяйственный павильон занимал 324 тысячи м², а всего к выставке было построено 1500 зданий, соединённых дорожками общей длиной 120 км. Даже основные павильоны невозможно было обойти меньше чем за неделю. Почти все павильоны были из гипса и рассчитаны на непродолжительное использование, однако в двух из них до сих пор помещаются основные музеи города — художественный и исторический.\\nВ рамках выставки в Сент-Луисе были проведены Летние Олимпийские игры 1904 года. Кроме того, вниманию зрителей были представлены новые развлечения — «человеческий зоопарк» с представителями туземных племён Африки и Океании и многочасовые реконструкции сражений англо-бурской войны, в которых принимали участие ветераны войны, включая генералов с обеих сторон.\\nВ связи с проведением выставки получили популярность новые виды пищевых продуктов."},{"page_url":"https://az.wikipedia.org/wiki/Hyustonun_%C9%99n_y%C3%BCks%C9%99k_binalar%C4%B1n%C4%B1n_siyah%C4%B1s%C4%B1","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e7/Houston_Cityscape.jpg","page_title":"Hyustonun ən yüksək binalarının siyahısı","context_page_description":"Hyustonun ən yüksək binalarının siyahısı — ABŞ-ın Texas ştatında yerləşən Hyuston şəhərinin hündürlüyünə görə sıralanmış və 150 metrdən hündür olan binalarını ehtiva edir.\\nSiyahıya hündürlüyü 305 metr olan 75 mərtəbəli JPMorgan Chase Tower binası başçılıq edir. Bu binanın tikintisi 1982-ci ildə bitib. JPMorgan Chase həm də dünyada ən yüksək beşkünc binadır. Hyustonda hündürlüyünə görə ikinci və üçüncü yeri uyğun olaraq Wells Fargo Plaza və Williams Tower binaları tuturlar.\\nHyustonda hündür bina tikintisi tarixi 1904-cü ildən başlayır. Belə ki, öz hündürlüyü ilə digər azmərtəbəli binalardan seçilən Franklin Lofts binasının tikintisi məhz bu ildə başa çatmışdır. Hündürlüyü naməlum olan bu binanın cəmi 8 mərtəbəsi var. Siyahıda ən son tikilən bina tikintisi 2011-ci ildə başa çatmış BG Group Place binasıdır.\\nHyustonda hündür binaların daha çox tikintisi 1970-ci və 1980-ci illərə təsadüf edir. Şəhərdə tikilən 150 metrdən hündür olan və hal hazırda da mövcud olan binaların 24-ü bu müddətdə tikilmişdir. Hazırda Hyustonda hündürlüyü 150 metrdən yuxarı olan 29 bina vardır və bu cür yeni binaların tikintisi haqqında müzakirələrin aparılması məlum deyil."},{"page_url":"https://af.wikipedia.org/wiki/Oekra%C3%AFners","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e2/Portret_Mazepa.jpg","page_title":"Oekraïners","context_page_description":"Die Oekraïners is 'n Oos-Slawiese volk van sowat 45 miljoen mense inheems aan Oekraïne. Hulle is die sesde grootste volk in Europa. Die meeste Oekraïners is Oekraïens-Ortodokse of ongebonde. Oekraïners vorm die titulêre nasie van Oekraïne, waar hulle 77,5% van dié land se bevolking vorm. Naas Oekraïners leef nog sowat 8,3 miljoen Russe in Oekraïne, veral in die ooste en suide.\\nWêreldwyd leef omtrent 45 miljoen Oekraïners, waarvan sowat 37,5 miljoen in Oekraïne, 1,9 miljoen in Rusland, 1,3 miljoen in Kanada en 968 769 in die Verenigde State. Tydens die Russiese Ryk en die Sowjetunie het Oekraïners in destydse deelgebiede soos Moldowa, Kasakstan, Wit-Rusland en Oesbekistan gevestig. Daarbenewens het Oekraïners nog in Europese en Suid-Amerikaanse lande soos Brasilië, Argentinië, Italië, Duitsland, Tsjeggië en Slowakye gevestig.\\nVanaf die 17de eeu is die Oekraïners \\"Klein-Russe\\" genoem en as deel van die Drie-enige Russiese volk beskou, wat uit Groot-Russe, Klein-Russe asook Wit-Russe bestaan en uit die Oud-Russiese volk van die Kiëf-Roes ontwikkel het."},{"page_url":"https://pl.wikipedia.org/wiki/Siedlimowice","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/86/Pa%C5%82ac_i_park_w_Siedlimowicach.jpg","page_title":"Siedlimowice","context_page_description":"Siedlimowice – wieś w Polsce położona w województwie dolnośląskim, w powiecie świdnickim, w gminie Żarów."},{"page_url":"https://de.wikipedia.org/wiki/Railjet","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/12/%C3%96BB_Railjet_1116-236_on_Krauselklause-Viaduct.jpg","page_title":"Railjet","context_page_description":"Der Railjet ist eine Fernverkehrs-Reisezug-Gattung und gleichzeitig eine Fahrzeugbauart der Österreichischen Bundesbahnen und der Tschechischen Bahnen, welche in Wien gebaut wurde. Die Einheiten bestehen aus untereinander kurzgekuppelten Wagen vom Typ Siemens Viaggio Comfort, die auf den Modularwagen Bmpz70 von SGP basieren, und Lokomotiven des Typs Siemens ES64U2 oder Siemens ES64U4. Die Railjets gehören zu den schnellsten lokbespannten Zügen der Welt. Nach den technischen Spezifikationen für die Interoperabilität gehören sie zu den Hochgeschwindigkeitszügen der TSI-Klasse 2. Railjet ist eine gemeinsame Zuggattung der ÖBB, der tschechischen Staatsbahn České dráhy, der Deutschen Bahn, der Schweizerischen Bundesbahnen und der ungarischen Staatsbahn Magyar Államvasutak. In Deutschland ist sie tariflich den ICE gleichgestellt. Eigentümer von Railjet-Garnituren sind jedoch nur die ÖBB und die České dráhy, wobei auch die Railjet-Lokomotiven der ČD zum Bestand der ÖBB gehören, da die Garnituren für Tschechien nur aufgrund eines Vertrags mit den ÖBB beschafft wurden und diese ausschließlich auf der Relation Prag – Wien – Graz eingesetzt werden."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%B1%D8%A7%D9%84%D9%81_%D9%83._%D9%87%D9%88%D9%81%D8%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/Ralph_Hofer_29733.jpg","page_title":"رالف ك. هوفر","context_page_description":"رالف ك. هوفر ‏ هو طيار جوي أمريكي، ولد في 22 يونيو 1921 في Salem في الولايات المتحدة، وتوفي في 2 يوليو 1944 في موستار في البوسنة والهرسك بسبب قتل في المعركة."},{"page_url":"https://sv.wikipedia.org/wiki/Murgantia_histrionica","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8c/Flowers_SJWS_%2820140426-0831%29.JPG","page_title":"Murgantia histrionica","context_page_description":"Murgantia histrionica är en insektsart som först beskrevs av Carl Wilhelm Hahn 1834.\\nMurgantia histrionica ingår i släktet Murgantia och familjen bärfisar. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D0%BE%D0%BA_%D0%BD%D0%B0%D0%B9%D0%B1%D1%96%D0%BB%D1%8C%D1%88_%D0%B7%D0%B0%D0%B2%D0%B0%D0%BD%D1%82%D0%B0%D0%B6%D0%B5%D0%BD%D0%B8%D1%85_%D0%B0%D0%B5%D1%80%D0%BE%D0%BF%D0%BE%D1%80%D1%82%D1%96%D0%B2_%D0%84%D0%B2%D1%80%D0%BE%D0%BF%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/91/Helsinki-Vantaa_departure_hall2.jpg","page_title":"Список найбільш завантажених аеропортів Європи","context_page_description":"Це Список найбільш завантажених аеропортів Європи, ранжовані за кількістю пасажирів у 2012 році, включаючи транзитних пасажирів.\\nТаблиця також показує відсоткове зміну між пасажиропотоком аеропортів між 2011 та 2012 роками. Джерелами даних є національна статистична інформація або дані самих аеропортів.\\nЄвропейськими вважаються ті аеропорти, які знаходяться у державах- членах Ради Європи, або кандидатів у члени."},{"page_url":"https://cs.wikipedia.org/wiki/Hrbov_(Velk%C3%A9_Mezi%C5%99%C3%AD%C4%8D%C3%AD)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a1/Velk%C3%A9_Mezi%C5%99%C3%AD%C4%8D%C3%AD%2C_Hrbov%2C_common.jpg","page_title":"Hrbov (Velké Meziříčí)","context_page_description":"Hrbov je spolu se sousedním Svařenovem místní část města Velkého Meziříčí v okrese Žďár nad Sázavou, se kterým patří do Kraje Vysočina."},{"page_url":"https://sk.wikipedia.org/wiki/Unterfrauenhaid","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9b/Unterfrauenhaid_im_Bezirk_OP.png","page_title":"Unterfrauenhaid","context_page_description":"Unterfrauenhaid je obec v Rakúsku v spolkovej krajine Burgenland v okrese Oberpullendorf.\\nŽije tu 675 obyvateľov."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%9A%D0%BE%D0%BD%D0%B7%D1%98%D0%B5","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/8a/Les_Lacs_de_Conzieu_2.jpg","page_title":"Конзје","context_page_description":"Конзје је насељено место у Француској у региону Рона-Алпи, у департману Ен.\\nПо подацима из 2011. године у општини је живело 144 становника, а густина насељености је износила 20,0 становника/km²."},{"page_url":"https://zh.wikipedia.org/wiki/%E6%A5%9E%E6%AC%A1%E9%99%A8%E7%9F%B3%E5%9D%91","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a9/Lenz_crater_5015_h2.jpg","page_title":"楞次陨石坑","context_page_description":"楞次陨石坑是位于月球背面赤道区的一座小撞击坑，\\n其名称取自俄国物理学家海因里希·弗里德里希·埃米尔·楞次，1970年被国际天文学联合会正式接受。"},{"page_url":"https://sr.wikipedia.org/wiki/%D0%91%D0%B0%D0%BB%D0%B5%D1%98","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/84/Coat_of_arm_baley.jpg","page_title":"Балеј","context_page_description":"Балеј град је у Русији у Забајкалском крају. Према попису становништва из 2010. у граду је живело 12533 становника."},{"page_url":"https://de.wikipedia.org/wiki/Wahl_zum_Senat_der_Vereinigten_Staaten_2014","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2e/David_Domina.jpg","page_title":"Wahl zum Senat der Vereinigten Staaten 2014","context_page_description":"Die Senatswahlen in den Vereinigten Staaten fanden am 4. November 2014 statt. Insgesamt standen 36 Mandate des US-Senats, der 100 Mitglieder hat, zur Wahl: alle 33 Mandate der Klasse zwei sowie drei Mandate von Senatoren, die vorzeitig aus dem Amt geschieden waren. Gewählt wurden die Senatoren per Direktwahl auf sechs Jahre von den Bürgern jenes Bundesstaates, den sie im US-Senat repräsentieren. Die drei Nachrücker wurden nur für die verbleibende Amtszeit der vorigen Senatoren gewählt, bis zur nächsten turnusgemäßen Wahl für diesen Sitz. In seiner neuen Zusammensetzung trat der Senat erstmals am 3. Januar 2015 zusammen.\\nDie parteiinternen Vorwahlen zur Bestimmung der jeweiligen Kandidaten fanden je nach Bundesstaat zwischen März und September 2014 nach unterschiedlichen Verfahren, je nach Wahlrecht des Bundesstaates, statt. Bei der Hauptwahl am 4. November 2014 war der Kandidat mit den meisten Stimmen gewählt, in Louisiana und Georgia hätte es eine Stichwahl gegeben, falls bei der Hauptwahl kein Kandidat mehr als 50 % der Stimmen erreicht hätte."},{"page_url":"https://it.wikipedia.org/wiki/I_Conferenza_del_Partito_Operaio_Socialdemocratico_Russo","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b2/Lenin-museum_3.JPG","page_title":"I Conferenza del Partito Operaio Socialdemocratico Russo","context_page_description":"La I Conferenza del Partito Operaio Socialdemocratico Russo si tenne dal 25 al 30 dicembre 1905 a Tammerfors, oggi Tampere, allora parte dell'Impero russo."},{"page_url":"https://es.wikipedia.org/wiki/Almendra_(Zamora)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f2/Vasallos_feudales.png","page_title":"Almendra (Zamora)","context_page_description":"Almendra es una localidad zamorana cabecera de distrito del Ayuntamiento de San Pedro de la Nave-Almendra heredado de la antigua jurisdicción del desaparecido pueblo con el mismo nombre."},{"page_url":"https://ko.wikipedia.org/wiki/%EB%82%B4%ED%96%A5%EC%84%B1_%EB%B0%9C%ED%86%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/86/Ingrown_nail_002.jpg","page_title":"내향성 발톱","context_page_description":"내향성 발톱 은 발톱이 살 속으로 파고 들어 염증과 통증이 발생하는 질환이다. 흔히 보는 손발톱 질환 중 하나로 주로 엄지발톱에 발생한다."},{"page_url":"https://fr.wikipedia.org/wiki/Controverses_sur_le_sanctuaire_Yasukuni","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/16/Yasukuni_Jinja_7_032.jpg","page_title":"Controverses sur le sanctuaire Yasukuni","context_page_description":"Le Yasukuni-jinja est un sanctuaire shinto au centre de controverses internationales entre le Japon et ses voisins coréens et chinois. Il est dédié aux personnes mortes au combat en servant l'empereur du Japon au cours des différents conflits de 1867 à 1951. Cela inclut des civils en service et des fonctionnaires du gouvernement. Le sanctuaire est censé accueillir les âmes réelles des morts en tant que kami. Il est de plus, pour tradition, que tout acte mauvais ou immoral commis par le défunt est pardonné lors de l'entrée au sanctuaire. Ces cérémonies sont strictement religieuses depuis la séparation du shintoïsme d'État et du gouvernement japonais. Les prêtres du sanctuaire ont une indépendance religieuse totale pour décider du choix de l'entrée des défunts. La consécration est permanente et irréversible. En raison de la vénération de criminels de guerre condamnés par le tribunal militaire international pour l'Extrême-Orient et de l'approche nationaliste du musée militaire Yūshūkan, le Yasukuni-jinja et le gouvernement japonais sont critiqués par les deux Chines et Corées comme étant révisionnistes vis-à-vis des événements de la Seconde Guerre mondiale."},{"page_url":"https://id.wikipedia.org/wiki/Ben_Sahar","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e4/Ben_Sahar_2012.jpg","page_title":"Ben Sahar","context_page_description":"Ben Sahar adalah seorang pemain penyerang sepak bola asal Israel yang sekarang bermain untuk Hapoel Be'er Sheva dalam Liga Primer Israel.\\nPada usia 16 tahun, Sahar dimasukkan ke pelatihan tahun kedua di Chelsea. Ia mula-mula ditempatkan oleh Chelsea dalam sebuah tim Under-16 melawan Irlandia pada 2004 dan sejak itu bermain untuk tim nasional Under-21 Israel dan tim nasional Israel. Sebelum dipindahkan ke Chelsea, Sahar berada di tim Hapoel Tel Aviv, dan meskipun ia dipromosikan pada tim pertama oleh manajer Itzhak Shum, Sahar tak tampil dalam pertandingan apapun karena transfernya selesai sebelum dimulainya musim 2006–07.\\nSebelum pindah ke Chelsea, ia memegang kewarganegaraan Polandia, yang memberikannya hak otomatis untuk bermain di Inggris, karena Polandia adalah negara anggota Uni Eropa."},{"page_url":"https://ca.wikipedia.org/wiki/Arthur_Robinson","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5c/A._N._R._Robinson.jpg","page_title":"Arthur Robinson","context_page_description":"Arthur Napoleón Raymond Robinson va ser un advocat i polític trinitenc, va ser el tercer president de Trinitat i Tobago.\\nEn 1989, durant la 44a reunió de l'Assemblea General de les Nacions Unides, el president Robinson va proposar la creació d'un Tribunal Internacional Permanent per fer front al tràfic internacional de drogues, un assot del mar Carib.\\nPer 1990 va haver-hi un intent de cop d'estat en contra seu, perpetrat per la Jamaat al Muslimeen en els quals gran part del seu gabinet de govern van ser retinguts com a ostatges a la seu del parlament, el President Arthur Robinson, va ordenar a l'exèrcit capturar aquest edifici per la força, en aquest acte el mateix Robinson va rebre una bala en la cama."},{"page_url":"https://fr.wikipedia.org/wiki/Piazza_Libert%C3%A0_(Udine)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/70/Udine%2C_piazza_Libert%C3%A0.JPG","page_title":"Piazza Libertà (Udine)","context_page_description":"La Piazza Libertà est le nom de la plus ancienne place de la ville d'Udine, en Frioul-Vénétie Julienne.\\nDe style vénitien, elle est située au-dessous de la colline du château."},{"page_url":"https://de.wikipedia.org/wiki/HMS_Stanley_(I73)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7b/USS_McCalla_%28DD-253%29.jpg","page_title":"HMS Stanley (I73)","context_page_description":"HMS Stanley (I73) war ein Zerstörer der britischen Town-Klasse, der im Oktober 1940 von der Royal Navy im Rahmen des Zerstörer-für-Stützpunkte-Abkommens von der US-Navy übernommen wurde. Der 1919 für die United States Navy als USS McCalla fertiggestellte Zerstörer wurde am 19. Dezember 1941 etwa 330 Meilen westlich der portugiesischen Küste von U 574 torpediert und sank innerhalb von wenigen Minuten. Von 161 Mann an Bord konnten nur 25 gerettet werden."},{"page_url":"https://pnb.wikipedia.org/wiki/%D8%B3%D8%A7%DB%81%D8%AA_%D8%AF%D8%A7_%D9%86%D9%88%D8%A8%D9%84_%D8%A7%D9%86%D8%B9%D8%A7%D9%85_%D8%AC%DB%8C%D8%AA%D9%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ad/Romain_Rolland_1915.jpg","page_title":"ساہت دا نوبل انعام جیتو","context_page_description":"ساہت دا نوبل انعام ساہت دے میدان وچ شاندار یوگدان لئی لکھاریاں نوں سویڈش اکیڈمی ولوں سلانہ انعام دتا جاندا اے۔ ایہہ ایلفریڈ نویل دی 1895 دی وصیت نال قائم پنج نوبل انعاماں وچوں اک اے، جو کہ کیمسٹری، فزکس، ساہت، امن، اتے فزیؤلوجی جاں دوائیاں وچ شاندار یوگدان لئی دتے جاندے ہن۔ نوبل دی وصیت دے حکم مطابق اس انعام دا انتظام نوبل فاؤنڈیشن چلاؤندی، اے اتے سویڈش اکیڈمی ولوں چنی اک پنج میمبری کمیٹی اعزاز دندی اے۔ساہت وچ پہلا نوبل انعام 1901 وچ فرانس دے سلی پردھوم نوں دتا گیا سی۔ ہریک جیتو نوں اک تمغہ، اک ڈپلوما اتے اک رقم ایوارڈ انعام حاصل ہندا اے جو کہ ویلے ویلے مختلف رہی اے۔1901 وچ، پرودھم نوں 150،782 سویڈنی کرونا حاصل ہویا، جو کہ جنوری 2018 وچ 8،823،637.78 سویڈنی کرونا دے برابر اے۔ ایہہ انعام 10 دسمبر نوں نوبل دی موت دی برسی موقعے اک سالانہ تقریب وچ سٹاکہوم وچ دتا جاندا اے۔\\n2017 دے مطابق، ساہت وچ نوبل انعام 114 لوکاں نوں دتا گیا اے۔ 1958 وچ روس-جنمے بورس پاسترناک نوں سوویت یونین دی سرکار دے دباء ہیٹھ اوارڈ نوں ردّ کرن لئی مجبور کیتا گیا سی۔ 1964 وچ، ژاں پال سارتر نے کیہا سی کہ اوہ نوبل انعام ننیں لینا چاہندا، کیونکہ اسنے پچھلے لگاتار سارے سرکاری انغاماں نوں ردّ کر دتا سی۔"},{"page_url":"https://ceb.wikipedia.org/wiki/Wartenberg_(bahin_nga_lungsod)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/56/Dorfkirche_Wartenberg_neu_02.jpg","page_title":"Wartenberg (bahin nga lungsod)","context_page_description":"Bahin nga lungsod ang Wartenberg sa Alemanya. Nahimutang ni sa estado pederal sa Land Berlin, sa amihanan-sidlakang bahin sa nasod, 9 km sa amihanan-sidlakan sa Berlin ang ulohan sa nasod. 58 metros ibabaw sa dagat kahaboga ang nahimutangan sa Wartenberg, ug adunay 2,336 ka molupyo.\\nAng yuta palibot sa Wartenberg kay patag. Ang kinahabogang dapit sa palibot dunay gihabogon nga 76 ka metro ug 1.4 km sa habagatan-kasadpan sa Wartenberg. Dunay mga 3,134 ka tawo kada kilometro kwadrado sa palibot sa Wartenberg may kaayo hilabihan populasyon. Ang kinadul-ang mas dakong lungsod mao ang Berlin, 9.1 km sa habagatan-kasadpan sa Wartenberg. Sa rehiyon palibot sa Wartenberg, mga patag, ug mga lasang talagsaon komon.\\nHapit nalukop sa kabalayan ang palibot sa Wartenberg. Ang klima hemiboreal. Ang kasarangang giiniton 10 °C. Ang kinainitan nga bulan Hulyo, sa 24 °C, ug ang kinabugnawan Enero, sa -4 °C."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%82%D8%A7%D8%A6%D9%85%D8%A9_%D8%A5%D9%8A%D8%A7%D9%84%D8%A7%D8%AA_%D8%A7%D9%84%D8%AF%D9%88%D9%84%D8%A9_%D8%A7%D9%84%D8%B9%D8%AB%D9%85%D8%A7%D9%86%D9%8A%D8%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/aa/Habesh_Eyalet%2C_Ottoman_Empire_%281609%29-ar.png","page_title":"قائمة إيالات الدولة العثمانية","context_page_description":"اعتمدت الدولة العُثمانيَّة بدايةً من فتح القُسطنطينيَّة سنة 1453م تقسيمًا إداريًّا من خمس مُستويات، وجعلت التقسيم الإداري الأعلى فيها هو «الإيالة» وجمعُها «إيالات»، وقد اشتهرت هذه أيضًا خِلال فترةٍ من الفترات باسم «البكلربكيَّات» ومُفردها «بكلربكيَّة» أو «البشالك» ومُفردها «بشلك»، وكان الخطاب الرسمي العُثماني يُسمِّي إيالات الدولة «إيالات الممالك المحروسة» واختصارًا «الإيالات المحروسة» أو «الممالك المحروسة»، وعُرفت كذلك باسم «إيالات الدولة العليَّة». اقتبس العُثمانيُّون تسمية «الإيالة» من اللُغة الفارسيَّة، التي تأثَّر بها التُرك نتيجة احتكاكهم مع الفُرس مُنذ أن اعتنقوا الإسلام، وكتبوا بها أغلب مؤلفاتهم الأدبيَّة والشعريَّة، على أنَّ الكلمة نفسها مُشتقَّة من العربيَّة من مصدر «آلَ». قسَّم العُثمانيُّون كُل إيالة إلى أقسامٍ إداريَّةٍ أًصغر يُعرف كُلٌ منها بِالـ«سنجق» وعلى رأسه «سنجق بك» أو «أمير لواء» أو «أميرالآي»، وكُل سنجق قُسِّم إلى «أقضية» على رأس كُلٌ منها «قائممقام»، وكُل قضاء يُقسم إلى نواحٍ على رأس كُلٍ منها مُدير، والنواحي إلى قُرى وبلدات ومُدن."},{"page_url":"https://es.wikipedia.org/wiki/Alfredo_de_Sajonia-Coburgo-Gotha","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f4/Coat_of_Arms_of_Alfred%2C_Duke_of_Saxe-Coburg_and_Gotha.svg","page_title":"Alfredo de Sajonia-Coburgo-Gotha","context_page_description":"Alfredo, duque de Sajonia-Coburgo y Gotha fue un príncipe británico conocido como Alfredo, duque de Edimburgo, hasta su ascenso al trono del ducado germánico. Alfredo era el cuarto de los nueve hijos de la reina Victoria del Reino Unido y de su esposo, Alberto de Sajonia-Coburgo-Gotha."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%B0%D0%BB%D0%B8%D1%87%D0%B5%D1%81%D0%BA%D0%B0%D1%8F_%D0%BF%D1%80%D0%B0%D0%B2%D0%B4%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ed/Capitularia_Regum_Francorum_01.jpg","page_title":"Салическая правда","context_page_description":"Сали́ческая пра́вда, или Сали́ческий зако́н, — свод обычного права германского племени салических франков, одна из наиболее ранних и обширных варварских правд. Древнейший текст памятника, записанный на вульгарной латыни, был создан в начале VI века при короле Хлодвиге I и состоял из 65 глав, содержавших преимущественно перечисление штрафов за правонарушения и изложение различных процессуальных процедур; ряд правил регулирует семейные, вещные, обязательственные и наследственные отношения. В эпоху Меровингов Салическая правда была дополнена положениями ряда королевских капитуляриев; в начале IX века подверглась переработке, став основой для законодательных реформ Карла Великого. Несмотря на то, что первоначально основной целью составления Салической правды была фиксация исконных древнегерманских обычаев, наряду с архаичными нормами она содержала институты переходного характера, свидетельствующие об изменениях в жизни германцев периода Великого переселения народов."},{"page_url":"https://fi.wikipedia.org/wiki/Trindade_ja_Martim_Vaz","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c2/Simone_Marinho_-_Trindade_-_2010_05_08_edited.jpg","page_title":"Trindade ja Martim Vaz","context_page_description":"Trindade ja Maritim Vaz on saaristo, joka sijaitsee noin 1200 kilometriä, itään Vitoriasta eteläisellä Atlantin valtamerellä. Saaristo kuuluu Espírito Santoon, Kaakkois-Brasiliassa. Saariston kokonaispinta-ala on 10,4 neliökilometriä ja asukasluku 32. Saaristo koostuu viidestä saaresta ja useista karikoista; Trindade on suurin saari, jonka pinta-ala 10,1 neliökilometriä; noin 49 km siitä itään on pieni Maritim Vaz -niminen luoto, jonka kokonaispinta-ala on 0,3 neliökilometriä.\\nSaaret ovat vulkaanista alkuperää ja niillä on vaikeakulkuista maastoa. Ne ovat suurelta osin karuja, lukuun ottamatta etelä-Trindadea. Ne löysi vuonna 1502 portugalilainen tutkimusmatkailija Estevan da Gama. Saaret kuuluivat Portugalille, kunnes niistä tuli osa itsenäistä Brasiliaa. Vuosina 1895–1896 Trindade oli Iso-Britannian miehittämä."},{"page_url":"https://he.wikipedia.org/wiki/%D7%95%D7%95%D7%A9%D7%99%D7%A0%D7%92%D7%98%D7%95%D7%9F_%D7%93%D7%99._%D7%A1%D7%99.","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/13/WashMonument_WhiteHouse.jpg","page_title":"וושינגטון די. סי.","context_page_description":"וָושִׁינְגְטוֹן דִי. סִי. היא עיר הבירה של ארצות הברית. העיר הוקמה ב-16 ביולי 1790, כעירייה נפרדת בתוך מחוז קולומביה. חקיקת הקונגרס ב-1871 יצרה ממשל יחיד לטריטוריה הפדרלית כולה, ובפועל איחדה את העיר עם המחוז לישות פדרלית אחת, שכפופה ישירות לשלטון המרכזי ואינה חלק מאחת ממדינות ארצות הברית. וושינגטון די. סי. נקראת על שמו של נשיאה הראשון של ארצות הברית, ג'ורג' וושינגטון, וצמד האותיות די.סי. מקצרות את שם המחוז השיפוטי אותו היא מייצגת.\\nהעיר ממוקמת על גדתו הצפונית של נהר הפוטומק. היא גובלת במדינת וירג'יניה בדרום-מערב, ובמדינת מרילנד מצדדיה האחרים. בעיר מתגוררים כ-646 אלף תושבים; אך במהלך שבוע העבודה עולה אוכלוסייתה על מיליון תושבים, המגיעים אליה מהפרוורים שמסביבה. באזור המטרופוליטני של וושינגטון מתגוררים כ-5.4 מיליון תושבים, מה שהופך אותו לאזור המטרופוליטני השמיני בגודלו בארצות הברית.\\nהפרק הראשון בחוקת ארצות הברית קובע כי מחוז פדרלי, המופרד מן המדינות, יכול לשמש כבירה הקבועה של ארצות הברית. מרכזן של כל שלוש רשויות הממשל הפדרלי של ארצות הברית ממוקמים בוושינגטון: הרשות המחוקקת, הרשות המבצעת, והרשות השופטת, וכן מוזיאונים ומונומנטים לאומיים רבים, בהם מוזיאוני הסמית'סוניאן ומוזיאון השואה בוושינגטון. וושינגטון די. סי."},{"page_url":"https://sco.wikipedia.org/wiki/John_MacWhirter","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5b/John_MacWhirter09.jpg","page_title":"John MacWhirter","context_page_description":"John MacWhirter RA wis a Scots laundscape penter."},{"page_url":"https://fr.wikipedia.org/wiki/Ris_(Hautes-Pyr%C3%A9n%C3%A9es)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ca/Mairie_de_Ris_%28Hautes-Pyr%C3%A9n%C3%A9es%29_1.jpg","page_title":"Ris (Hautes-Pyrénées)","context_page_description":"Ris est une commune française située dans le département des Hautes-Pyrénées, en région Occitanie.\\nSes habitants sont appelés les Rissois."},{"page_url":"https://eo.wikipedia.org/wiki/Antilopo","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ae/Impala.JPG","page_title":"Antilopo","context_page_description":"Antilopo estas membro de polifilia grupo de herbovoraj afrikaj kaj aziaj bestoj de la boveda familio kun paro de kavaj kornoj surkape. Ĉi tiuj bestoj estas pli-malpli egale disvastigitaj inter la diversaj bovedaj subfamilioj; iuj antilopoj estas pli parencaj al bovoj aŭ kaproj ol al aliaj antilopoj. Estas multaj diversaj antilopo-specioj, kiuj diferencas en grandeco de la etaj reĝaj antilopoj ĝis la giganta elando. Ili kutime havas malpezan, elegantan strukturon, malgrandajn parhufojn, kaj mallongan voston. Antilopoj havas fortajn postaĵmuskolojn kaj suprizite ili kuras kun ŝaltaj kurpaŝoj kiuj ŝajnigas kvazaŭ ili saltus laŭ la tereno kiel kuniklegoj. Iuj antilopo-specioj povas kuri tre rapide, ĝis 100 kilometrojn hore, kaj tiel estas inter la plej rapidaj bestoj."},{"page_url":"https://ca.wikipedia.org/wiki/Tes%C3%A1re","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3d/Kastiel_tesare.jpg","page_title":"Tesáre","context_page_description":"Tesáre és un poble d'Eslovàquia que es troba a la regió de Nitra."},{"page_url":"https://en.wikipedia.org/wiki/Blue-ringed_octopus","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d6/Variable_ring_patterns_on_mantles_of_the_blue-ringed_octopus_Hapalochlaena_lunulata.png","page_title":"Blue-ringed octopus","context_page_description":"Blue-ringed octopuses, comprising the genus Hapalochlaena, are four highly venomous species of octopus that are found in tide pools and coral reefs in the Pacific and Indian oceans, from Japan to Australia. They can be identified by their yellowish skin and characteristic blue and black rings that change color dramatically when the animal is threatened. They eat small crustaceans, including crabs, hermit crabs, shrimp, and other small animals.\\nThey are recognized as one of the world's most venomous marine animals. Despite their small size—12 to 20 cm —and relatively docile nature, they are dangerous to humans if provoked when handled because their venom contains the powerful neurotoxin tetrodotoxin.\\nThe species tend to have a lifespan of approximately two years. This can vary depending on factors such as nutrition, temperature and the intensity of light in its habitat."},{"page_url":"https://es.wikipedia.org/wiki/Athens_(Pensilvania)","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d2/Map_of_Athens%2C_Bradford_County%2C_Pennsylvania_Highlighted.png","page_title":"Athens (Pensilvania)","context_page_description":"Athens es un borough ubicado en el condado de Bradford en el estado estadounidense de Pensilvania. En el año 2000 tenía una población de 3.415 habitantes y una densidad poblacional de 749 personas por km².​"},{"page_url":"https://ar.wikipedia.org/wiki/%D8%A3%D9%84%D8%B3%D8%A7%D9%86%D8%AF%D8%B1%D9%88_%D8%AF%D9%8A_%D9%85%D9%8A%D8%AF%D9%8A%D8%B4%D9%8A","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/ac/Allessandro-the-moor.jpg","page_title":"ألساندرو دي ميديشي","context_page_description":"ألساندرو دي لورينزو دي ميديشي الملقب بالأسمر دوق بيني ثم دوق فلورنسا، وحاكم فلورنسا من 1530 حتي 1537، وإن كان غير شرعي فهو آخر أفراد الفرع الأميري لسلالة ميديشي من حكام فلورنسا وكان أول من نـُصب دوقاً وراثياً على المدينة.\\nاعتـُرف به ابناً غير شرعي للورينزو الثاني دي ميديشي حفيد لورنزو الرائع، ولكن الكثير يظنون أنه ابن غير شرعي للكاردينال جوليو دي ميديشي. من غير الواضح ما إذا كان من أم سوداء، ربما ولد من علاقة جمعت جوليو بخادمة سمراء بمنزل آل ميديشي، حددت هويتها في الوثائق باسم سيمونيتا دا كوليفيكيو، وتشير مصادر أخرى بأن والدته كانت فلاحة من الريف الروماني. على أي حال بسبب لون بشرته لـُقـّب بالأسمر.\\nبمجرد توليه السلطة في فلورنسا، وبدأ بتحويل مؤسسات الجمهورية الذي أنهه كوزيمو الأول، ابن عمه البعيد وخليفته. لعيشه الطويل ببلاط شارل الخامس الامبراطورى جلب معه المستخدمين إلى فلورنسا، كؤلئك حراس اللاندسكنيشت المسلحين بالمطارد والمحيطين به والذين صدموا أرعبوا الفلورنسيين.\\nبدأت لإعطاء طابع \\"أميري\\" حكومته، وبقضاءه على رموز المؤسسات البلدية العزيزة على الفلورنسيين. من بين أهم تلك المبادرات من دون شك تكليف بنفينوتو تشيليني بإعداد عملات بقطع مختلفة عن الفيورين عليها صورته."},{"page_url":"https://es.wikipedia.org/wiki/Auguste_Cain","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/70/Mairie_d_oran.JPG","page_title":"Auguste Cain","context_page_description":"Auguste Cain, nacido el 10 de noviembre de 1821 en París y fallecido el 25 de agosto de 1894 en la misma ciudad, fue un escultor francés especializado en el retrato de animales. Es el padre del pintor y escritor Georges Cain, y del hombre de letras y pintor Henri Cain."},{"page_url":"https://ja.wikipedia.org/wiki/%E6%BA%9D%E5%8F%A3%E5%81%A5%E4%BA%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d7/Kenji_Mizoguchi_1.jpg","page_title":"溝口健二","context_page_description":"溝口 健二は、日本の映画監督。\\n女性映画の巨匠と呼ばれ、一貫して虐げられた女性の姿を冷徹なリアリズムで描いている。サイレント期は下町情緒を下敷きとした作品で声価を高め、戦中・戦後は芸道ものや文芸映画でも独自の境地を作り出した。完璧主義ゆえの妥協を許さない演出と、長回しの手法を用いた撮影が特徴的である。黒澤明、小津安二郎、成瀬巳喜男らと共に国際的に高い評価を受けた監督であり、ヴェネツィア国際映画祭では作品が3年連続で受賞している。また、ジャン=リュック・ゴダールを始めヌーベルバーグの若い映画作家を中心に、国内外の映画人に多大な影響を与えた。代表作に『祇園の姉妹』『西鶴一代女』『雨月物語』など。日本映画監督協会会員。"},{"page_url":"https://da.wikipedia.org/wiki/Pr%C3%A6sidentklosteret","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/db/Pr%C3%A6sidentkloster.jpg","page_title":"Præsidentklosteret","context_page_description":"Præsidentklosteret i Slesvig-Lolfod blev opført i 1656 af den gottorpske kansler og senere regeringspræsident Kielmann af Kielmannsegg og fungerede i mange år som byens fattighus. Ifølge stiftelsesdokumentet fra 1663 var klosterets tolv kamre tiltænkt fem mænd og fem kvinder samt tjenestefolk fra Gottorp Slot. I midten af bygningen blev der opbygget et kapel med sengotisk alter og barok skab-orgel.\\nI 1931/32 kom præsidentklosteret i kommunens hænder. Østfløjen huser siden 1975 et museum til minde om de tyske fordrevne. I den 1995 nyrenoverede vestfløj blev der indrettet et enestående artotek med outsiderkunst."},{"page_url":"https://ro.wikipedia.org/wiki/Goreljek","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/57/Goreljek_2-gw20100522.jpg","page_title":"Goreljek","context_page_description":"Goreljek este o localitate din comuna Bohinj, Slovenia."},{"page_url":"https://de.wikipedia.org/wiki/Weichsel","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/cf/Zalew_Koronowski_2.jpg","page_title":"Weichsel","context_page_description":"Die Weichsel ist ein 1048 Kilometer langer und für europäische Verhältnisse weitgehend unregulierter und naturbelassener Strom und der längste Fluss in Polen.\\nDas Einzugsgebiet umfasst auch Teile der Slowakei, Weißrusslands und der Ukraine. Der längste Gewässerlauf in ihrem Flusssystem sind die 1213 Flusskilometer von der Quelle des Westlichen Bug bis zur Ostsee.\\nAuf alten Landkarten findet man auch die Schreibweisen Wixel oder Wissel."},{"page_url":"https://fr.wikipedia.org/wiki/Huile_d%27olive_d%27Aix-en-Provence","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5f/StandHuileAix.JPG","page_title":"Huile d'olive d'Aix-en-Provence","context_page_description":"L'huile d'olive d'Aix-en-Provence est une huile d'olive dont l'appellation d'origine est préservée par une AOC depuis le 13 décembre 1999, puis par une AOP depuis le 7 octobre 2014."},{"page_url":"https://it.wikipedia.org/wiki/Ragusa","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/13/Lago_Santa_Rosalia_e_campagna_ragusana.JPG","page_title":"Ragusa","context_page_description":"Ragusa è un comune italiano di 73 492 abitanti, capoluogo del libero consorzio comunale di Ragusa in Sicilia.\\nÈ chiamata la \\"città dei ponti\\", per la presenza di tre strutture molto pittoresche e di valore storico.\\nNel 1693 un devastante terremoto causò la distruzione quasi totale dell'intera città, mietendo più di cinquemila vittime. La ricostruzione, avvenuta nel XVIII secolo, la divise in due grandi quartieri: da una parte Ragusa superiore, situata sull'altopiano, dall'altra Ragusa Ibla, sorta dalle rovine dell'antica città e ricostruita secondo l'antico impianto medioevale.\\nI capolavori architettonici costruiti dopo il terremoto, insieme a tutti quelli presenti nel Val di Noto, sono stati dichiarati nel 2002 Patrimonio dell'Umanità dall'UNESCO. Ragusa è uno dei luoghi più importanti per la presenza di testimonianze d'arte barocca, come le sue chiese ed i suoi palazzi settecenteschi."},{"page_url":"https://en.wikipedia.org/wiki/Roman_Catholic_Diocese_of_Baton_Rouge","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2f/St._Joseph_Cathedral_-_Baton_Rouge%2C_Louisiana.JPG","page_title":"Roman Catholic Diocese of Baton Rouge","context_page_description":"The Roman Catholic Diocese of Baton Rouge, officially in Latin Dioecesis Rubribaculensis, in French Diocèse de Bâton-Rouge, in Spanish: Diócesis de Baton Rouge, is a Latin Rite diocese of the Roman Catholic Church in Baton Rouge, Louisiana. It is a suffragan of the Archdiocese of New Orleans.\\nThe diocese consists of 68 parishes, 2 ethnic apostolates, and 2 University chaplaincies. Its territory comprises an area of 5,513 square miles, being composed of twelve civil parishes in south central Louisiana: Ascension, Assumption, East Baton Rouge, East Feliciana, Iberville, Livingston, Pointe Coupée, Tangipahoa, St. Helena, St. James, West Baton Rouge and West Feliciana.\\nThe current bishop is Michael Duca. There are 106 total priests in the Diocese, 70 permanent deacons, 3 transitional deacons, 16 lay male religious, 90 female religious, and 17 seminarians. The Catholic population is 215,298 out of a total population of 884,650."},{"page_url":"https://nl.wikipedia.org/wiki/Health_Mate-Cyclelive","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/2019_Fleche_Wallonne_012.jpg","page_title":"Health Mate-Cyclelive","context_page_description":"Health Mate-Cyclelive was een Belgische wielerploeg voor vrouwen, die in 2018 en 2019 deel uitmaakte van het peloton.\\nIn juni 2019 kwam de ploeg negatief in het nieuws doordat meerdere rensters manager Patrick Van Gansen beschuldigden van ongewenst gedrag. Hierdoor verlieten Sara Mustonen, Esther Meisels en Chloë Turblin de ploeg gedurende het jaar, trokken sponsoren zich terug en hield de ploeg na 2019 op te bestaan."},{"page_url":"https://ko.wikipedia.org/wiki/%EB%A6%AC%EC%84%BC%EC%BD%94%EC%A3%BC%EC%9D%98","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5a/Lysenko_with_Stalin.gif","page_title":"리센코주의","context_page_description":"리센코주의 또는 리센코학설은 유전학에 반대하는 소비에트 연방의 운동으로 생물학자 트로핌 리센코를 중심으로 1920년대 말부터 1964년까지 계속되었다. 넓은 의미로는 정치에 의한 과학의 전복을 이야기한다. 식물학자 이반 블라디미로비치 미추린의 이름을 따서 미추린주의 또는 리센코-미추린주의라고도 한다."},{"page_url":"https://en.wikipedia.org/wiki/2020_in_Switzerland","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/23/Urs_Egger_02_%2823137317429%29.jpg","page_title":"2020 in Switzerland","context_page_description":"Events in the year 2020 in Switzerland."},{"page_url":"https://tr.wikipedia.org/wiki/Nikolay_Kibal%C3%A7i%C3%A7","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/79/Kibalchich.jpg","page_title":"Nikolay Kibalçiç","context_page_description":"Nikolay İvanoviç Kibalçiç, Narodnaya Volya'nın ana patlayıcı uzmanı olan Kibalçiç Çar II. Aleksandr suikastına katılan ve Ukraynalı-Sırp kökenli bir Rus devrimciydi.Devrimci Victor Serge'in uzaktan bir akrabasıydı."},{"page_url":"https://sv.wikipedia.org/wiki/Badge_engineering","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/3e/97-00_Oldsmobile_Silhouette.jpg","page_title":"Badge engineering","context_page_description":"Badge engineering är en term för när man byter märke på en produkt. Uttrycket använts bland annat inom bilindustrin när en bilmodell finns under olika namn. I andra branscher benämns detta ibland flermärkesstrategi.\\nBadge engineering har en lång tradition inom bilindustrin. Koncerner som brittiska BMC och Rootes och amerikanska som GM, Chrysler och Ford tillverkade tidigt modeller som i grunden var samma modeller där man gjorde mindre justeringar. Exempel är Jaguar och Daimler, Rolls-Royce och Bentley. Rootes genomdrev hårdhänta rationaliseringar bland sina märken och var pionjärer inom badge engineering. Under femtiotalet suddades koncernens märkesidentiteter ut och det enda som skiljde bilarna åt var kylarmaskeringen och detaljer i utrustningsnivå. General Motors har sedan 1970-talet gjort samma sak med sina utomamerikanska bilmärken Vauxhall, Opel och Holden.\\nI Sverige har Saab under senare år gjort flera modeller för den amerikanska marknaden utifrån bilar inom GM-koncernen."},{"page_url":"https://eo.wikipedia.org/wiki/Victor_Segalen","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c5/Univsegalen.JPG","page_title":"Victor Segalen","context_page_description":"Victor Segalen estis franca poeto, kaj ankaŭ marŝipa kuracisto, etnografo kaj arkeologo."},{"page_url":"https://en.wikipedia.org/wiki/Louise_Brooks","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/The_Canary_Murder_Case_%281929%29_1.jpg","page_title":"Louise Brooks","context_page_description":"Mary Louise Brooks, known professionally as Louise Brooks, was an American film actress and dancer during the 1920s and 1930s. She is regarded today as a Jazz Age icon and as a flapper sex symbol due to her bob hairstyle that she helped popularize during the prime of her career.\\nAt the age of fifteen, Brooks began her career as a dancer and toured with the Denishawn School of Dancing and Related Arts where she performed opposite Ted Shawn. After being fired, she found employment as a chorus girl in George White's Scandals and as a semi-nude dancer in the Ziegfeld Follies in New York City. While dancing in the Follies, Brooks came to the attention of Walter Wanger, a producer at Paramount Pictures, and was signed to a five-year contract with the studio. She appeared in supporting roles in various Paramount films before progressing to the role of heroine in Beggars of Life. During this time, she became an intimate friend of actress Marion Davies and joined the elite social circle of press baron William Randolph Hearst at Hearst Castle in San Simeon."},{"page_url":"https://ca.wikipedia.org/wiki/Jos%C3%A9_Luis_Gioja","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/33/9_de_julio_2008_%2815%29.jpg","page_title":"José Luis Gioja","context_page_description":"José Luis Gioja és un enginyer i polític argentí, escollit en tres ocasions com a governador de la província de San Juan. Ha estat diputat nacional i senador, arribant a ocupar la vicepresidència primera de la Cambra de Senadors. Pertany al Partit Justicialista."},{"page_url":"https://fr.wikipedia.org/wiki/Auzouville-sur-Ry","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/55/Map_commune_FR_insee_code_76046.png","page_title":"Auzouville-sur-Ry","context_page_description":"Auzouville-sur-Ry est une commune française située dans le département de la Seine-Maritime en région Normandie."},{"page_url":"https://nl.wikipedia.org/wiki/San_Remo","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/70/Sanremo0002.jpg","page_title":"San Remo","context_page_description":"San Remo is een badplaats met circa 50.000 inwoners in de Italiaanse provincie Imperia, regio Ligurië. De stad ligt aan de Rivièra del Ponente."},{"page_url":"https://sh.wikipedia.org/wiki/Ledenjak","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/12/Grosser_Aletschgletscher_3178.JPG","page_title":"Ledenjak","context_page_description":"Ledenjak ili glečer je pokretna ledena masa, koja nastaje od debelih naslaga snijega pod utjecajem tlaka gornjih ledenih slojeva. Najprije se formira fin led, a zatim pravi ledenjački led. Zbog laganog kretanja prema dolini ledenjak razara podlogu po kojoj se kreće i tako oblikuje ledenjačku dolinu i akumulira morenski materijal.\\nKada težina nagomilanog leda izazove pritisak u donjim dijelovima ledenjaka dolazi do topljenja leda na samom dnu, i cjelokupna masa ledenjaka počinje se pomjerati preko otopljenog dijela, klizeći prema podnožju padine. Na svom putu, masa leda drobi sve pred sobom i potiskuje komade odlomljenih stijena, ostavljajući za sobom udubljenje u tlu u obliku oluka ili slova U. Ovakvo udubljenje se naziva cirk. Po svom razornom utjecaju na tlo, ledenjak se smatra najvećom erozijskom silom prirode. Jedna od najpoznatijih glacijalnih dolina je Dolina Yosemite, koja je danas centralni dio Nacionalnog parka Yosemite u Kaliforniji."},{"page_url":"https://et.wikipedia.org/wiki/Viimsi_raamatukogu","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bc/Viimsi_Raamatukogu_laste-_ja_noorteteenindus_teisel_korrusel.jpg","page_title":"Viimsi raamatukogu","context_page_description":"Viimsi avalik raamatukogu on raamatukogu Viimsi vallas Haabneemes. Viimsi raamatukogul on kaks harukogu Prangli raamatukogu ja Randvere raamatukogu.\\nViimsi raamatukogu asutas 1920. aastal Viimsi Haridusselts. Viimsi raamatukogu, selle fond ja lugejaskond on muutunud vastavalt ajale ja ühiskonnas toimunud muudatustele, olulised murdepunktid raamatukogu ajaloos on seotud ruumide vahetusega.\\nKõik teavikud on sisestatud e-kataloogi RIKSWEB.\\nRaamatukogu direktor on alates 2014. aastast Tiiu Valm."},{"page_url":"https://fr.wikipedia.org/wiki/Famille_de_Waldner_de_Freundstein","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/91/Armes_Waldner_de_Freundstein.png","page_title":"Famille de Waldner de Freundstein","context_page_description":"La famille von Waldner de Freundstein est une famille noble alsacienne d'extraction chevaleresque."},{"page_url":"https://eo.wikipedia.org/wiki/Johannes_Sturm","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b8/Zentralbibliothek_Z%C3%BCrich_-_Tobias_Stimmer_-_000008095.jpg","page_title":"Johannes Sturm","context_page_description":"Johannes STURMIUS aŭ Jean STURM estis humanisto, erudiciulo, pedagogo, reformisto, protestanto, fondinto de la Universitato de Strasburgo, kies origino antaŭas al la kreado de la Gimnazio Jean Sturm, de li fondita en la 22-a de marto 1538. Influita de la ideoj kaj manuskriptoj de Marteno Bucero li adoptis la principojn de la Protestanta Reformo."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_personen_geboren_in_1848","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fd/1848_Frederica_of_Hanover.jpg","page_title":"Lijst van personen geboren in 1848","context_page_description":"Dit is een lijst van personen die geboren zijn in 1848.\\nDe inhoud van deze pagina is gebaseerd op gegevens in Wikidata. Als er onvolkomenheden in deze lijst zitten, gelieve dan aldaar de gegevens aan te passen. Achter iedere persoon is hiervoor een link aanwezig met de aanduiding bewerken.\\nWijzigingen in Wikidata worden met enige regelmatigheid geautomatiseerd overgenomen naar deze pagina."},{"page_url":"https://fr.wikipedia.org/wiki/Liste_des_mus%C3%A9es_de_l%27H%C3%A9rault","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/83/Mus%C3%A9e_Fabre_-_Galerie_des_Colonnes.JPG","page_title":"Liste des musées de l'Hérault","context_page_description":"Cette page liste les musées de l'Hérault."},{"page_url":"https://en.wikipedia.org/wiki/Derecho","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/22/V%C3%A4ike-Maarja_kirik_august2010-1.JPG","page_title":"Derecho","context_page_description":"A derecho is a widespread, long-lived, straight-line wind storm that is associated with a fast-moving group of severe thunderstorms known as a mesoscale convective system and potentially rivaling hurricanic and tornadic forces.\\nDerechos can cause hurricane-force winds, tornadoes, heavy rains, and flash floods. In many cases, convection-induced winds take on a bow echo form of squall line, often forming beneath an area of diverging upper tropospheric winds, and in a region of both rich low-level moisture and warm-air advection. Derechos move rapidly in the direction of movement of their associated storms, similar to an outflow boundary, except that the wind remains sustained for a greater period of time, and may exceed hurricane-force. A derecho-producing convective system may remain active for many hours and, occasionally, over multiple days.\\nA warm-weather phenomenon, derechos occur mostly in summer, especially during June, July, and August in the Northern Hemisphere, within areas of moderately strong instability and moderately strong vertical wind shear. However, derechos may occur at any time of the year, and can occur as frequently at night as during the day."},{"page_url":"https://nl.wikipedia.org/wiki/Sports_Authority_Field_at_Mile_High","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fc/Denver_Colorado_Invesco_Field_at_Mile_High.jpg","page_title":"Sports Authority Field at Mile High","context_page_description":"Sports Authority Field at Mile High is een American football stadion in Denver. Het stadion opende zijn deuren in 2001. Vaste bespelers zijn de Denver Broncos en de Lacrosse club de Denver Outlaws. Openingswedstrijd was een wedstrijd van de Titans tegen de Atlanta Falcons.\\nHet stadion stond tot 2011 bekend als het Invesco Field at Mile High."},{"page_url":"https://sk.wikipedia.org/wiki/Jan_Amos_Komensk%C3%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c2/Orbis_sensualium_pictus_trilinguis.jpg","page_title":"Jan Amos Komenský","context_page_description":"Jan Amos Komenský bol moravský pedagóg, jazykovedec, prírodovedec, humanista, filozof, politik. Mal slovenských predkov. Jeho priezvisko je pravdepodobne odvodené od obce Komňa v okrese Uherské Hradiště.\\nVyštudoval teológiu a bol vysvätený za kňaza Jednoty bratskej. Táto cirkev patrila k protestantským cirkvám v Čechách a hlásila sa k husitským tradíciám.\\nPo porážke českých stavov v bitke na Bielej hore sa Komenský musel skrývať pred cisárskymi vojskami. V tom čase mu na mor zomrela manželka i dve deti. Východisko z trpkej situácie hľadal v práci. Vtedy začal pracovať na svojej knihe Labyrint světa a ráj srdce.\\nV roku 1628 opustil Moravu a pustil sa putovať po Európe. Finančne ho pri tom podporovali bohatí mecenáši, ktorí si vážili jeho prácu. Zavádzal úplne nové spôsoby v školskej dochádzke. Hlásal, že školská dochádzka musí byť povinná pre každé dieťa, či je bystré alebo hlúpe, bohaté alebo chudobné. Preslávil sa na svoju dobu revolučnými pojmami „opakovanie je matkou múdrosti“ a „škola hrou“.\\nJeho filozofia sa nazýva pansofia. Ústrednou filozofickou ideou J. A. Komenského je myšlienka jednej harmónie ovládajúcej celý kozmos."},{"page_url":"https://zh.wikipedia.org/zh-my/%E9%A6%99%E6%B8%AF%E7%A7%81%E4%BA%BA%E5%B1%8B%E8%8B%91%E5%88%97%E8%A1%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/02/Bohemian_House.jpg","page_title":"香港私人屋苑列表","context_page_description":"香港私人屋苑列表主要收录香港私人住宅；本列表只列出较具知名度的住宅楼宇组群。"},{"page_url":"https://he.wikipedia.org/wiki/%D7%93%D7%91%D7%95%D7%A8%D7%99%D7%9D","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e3/Ceratina_nest_in_fennel_1.jpg","page_title":"דבורים","context_page_description":"הדבורים הן קבוצה מונופילטית של חרקים מעופפים, השייכת לעל-המשפחה Apoidea שבסדרת הדבוראים. הדבורים התפתחו מקרובותיהן הצרעות; בניגוד לאבותיהן הקדמוניים שצדו טרף עבור זחליהם, הדבורים ניזונות מצוף ואבקת פרחים בלבד בכל שלבי חייהן. התלות של הדבורים במשאבי מזון אלו, שמקורם בעיקר בפרחים, יוצרת מערכת מורכבת של יחסי גומלין בין דבורים לצמחים. הדבורים נחשבות לווקטור הגדול, המפותח והחשוב ביותר של האבקה ביוטית; למינים רבים של דבורים יש ערך רב עבור החקלאות, הנאמד לעיתים בסכומי עתק.\\nקיימים כ-20,000 מינים של דבורים, והן נפוצות בכל היבשות למעט אנטארקטיקה. בישראל קיימים למעלה מאלף מינים של דבורים, שחלק גדול מהם ככל הנראה עדיין לא תואר למדע. רוב המינים הם של דבורים יחידאיות; בין המינים החברתיים בולטים דבורת הדבש ובומבוס האדמה."},{"page_url":"https://ast.wikipedia.org/wiki/Tour_de_Francia_2012","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/86/Tejay_van_Garderen%2C_22_July_2012.jpg","page_title":"Tour de Francia 2012","context_page_description":"La 99ª edición del Tour de Francia apostar del 30 de xunu al 22 de xunetu de 2012. Constó de 21 etapes pa completar un percorríu total de 3.479,1 km, incluyendo 101,4 km contrarreló partíos en tres etapes, dende Liexa hasta'l clásicu final de los Campos Elíseos en París.\\nLiexa foi per segunda vegada empecipio del Tour, dempués de faelo en 2004. Como naquella ocasión, empezó con un prólogu d'unos 6 km pel centru de la ciudá. Nesta ocasión, la ronda gala percorrió tres etapes per suelos belgues nun travesando nengún otru país hasta la etapa 8º qu'acabó en Suiza. Como interés el percorríu d'esta edición penerar a principios d'ochobre de 2011 por cuenta de un error informáticu na so páxina web.\\nParticiparon 198 ciclistes, partíos en 22 equipos, de los que llograron terminar 153.\\nEl ganador de la carrera foi Bradley Wiggins. Acompañáron-y nel podiu'l so compañeru d'equipu Chris Froome y Vincenzo Nibali, respeutivamente.\\nNes clasificaciones y premios secundarios impunxéronse Peter Sagan, Thomas Voeckler, Tejay van Garderen, RadioShack-Nissan y Chris Anker Sørensen. Los corredores con más victories fueron el mentáu Peter Sagan, André Greipel y Mark Cavendish con tres victories cada unu."},{"page_url":"https://pl.wikipedia.org/wiki/Linia_M2_metra_w_Warszawie","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fb/Stacja_metra_Trocka_w_Warszawie_2019.jpg","page_title":"Linia M2 metra w Warszawie","context_page_description":"Linia M2 metra w Warszawie – druga linia metra w Warszawie. Jej obecnie wykorzystywany odcinek liczy trzynaście stacji i 12,6 kilometra. Łączy dzielnicę Wola na lewym brzegu z Targówkiem na prawym brzegu Wisły. Cała linia ma zostać ukończona do 2023, przebiegać z Bemowa na Targówek oraz liczyć 21 stacji.\\nW 2006 został ustalony przebieg linii, a rok później ogłoszono przetarg na realizację odcinka centralnego, biegnącego z Woli na Pragę. W 2008 został on unieważniony ze względu na zbyt wysokie oferty i rozpoczęto drugi konkurs. W 2009 rozstrzygnięto przetarg i podpisano umowę na realizację z konsorcjum AGP Metro Polska. 30 września 2014 zakończyła się budowa odcinka centralnego, a po niej przystąpiono do odbiorów inwestycji. Otwarcie linii miało miejsce 8 marca 2015.\\nW 2014 ogłoszono przetarg na pierwszą rozbudowę „3+3”, polegającą na realizacji 3 stacji na zachód i 3 stacji na wschód od istniejącego wówczas odcinka centralnego. Został on rozstrzygnięty pod koniec 2015 i na początku 2016 podpisano umowę na rozbudowę w kierunku wschodnim, a we wrześniu w kierunku zachodnim. Otwarcie odcinka wschodniego nastąpiło 15 września 2019, a zachodniego 4 kwietnia 2020 roku."},{"page_url":"https://arz.wikipedia.org/wiki/%D8%AC%D8%A8%D9%84_%D9%BE%D9%8A%D8%B2_%D8%B3%D9%8A%D8%B2%D9%86%D9%8A%D8%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/67/Sezner.jpg","page_title":"جبل پيز سيزنير","context_page_description":"پيز سيزنير هوا جبل فى سويسرا."},{"page_url":"https://hy.wikipedia.org/wiki/%D4%B3%D5%AB%D5%BF%D5%A5%D5%AC%D5%AB%D6%84","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/eb/Los_portadores_de_la_antorcha.jpg","page_title":"Գիտելիք","context_page_description":"Անվան այլ կիրառումների համար տե՛ս՝ Գիտելիք\\nԳիտելիք, ծանոթություն, իրազեկում, կամ հասկանալ ինչ-որ մեկին կամ ինչ որ մի բան՝ փաստեր, տեղեկատվություն, նկարագրություններ, կամ փորձի միջոցով ձեռք բերված ունակություններ, կամ ընկալման, բացահայտման կամ սովորելու միջոցով՝ կրթություն։\\nԳիտելիքը կարող է վերաբերել առարկայի հասկանալուն՝ տեսական կամ պրակտիկ։ Այն կարող է լինել անուղղակի; այն կարող է լինել քիչ կամ շատ ձևական կամ համակարգված։ Փիլիսոփայության մեջ, գիտելիքի ուսումնասիրությունը կոչվում է Իմացաբանություն; փիլիսոփա Պլատոնի հայտնի գիտելիքի հայտնի սահմանումն է՝ \\"արդարացված ճշմարիտ հավատք\\"։\\nԳիտելիքի ձեռքբերումը պայմանավորված է բարդ ճանաչողական գործընթացներով՝ ընկալում, Հաղորդակցություն և հիմնավորում; գիտելիքը նաև վերաբերվում է մարդկանց ճանաչողության ունակությանը։"},{"page_url":"https://pl.wikipedia.org/wiki/Canouville","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d2/Canouville_Carte_postale_13.jpg","page_title":"Canouville","context_page_description":"Canouville – miejscowość i gmina we Francji, w regionie Normandia, w departamencie Sekwana Nadmorska.\\nWedług danych na rok 1990 gminę zamieszkiwało 236 osób, a gęstość zaludnienia wynosiła 53 osoby/km²."},{"page_url":"https://en.wikipedia.org/wiki/Boron_porphyrins","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/40/Zn_PB.png","page_title":"Boron porphyrins","context_page_description":"Boron porphyrins are a variety of porphyrin, a common macrocycle used for photosensitization and metal trapping applications, that incorporate boron. The central four nitrogen atoms in a porphyrin macrocycle form a unique molecular pocket which is known to accommodate transition metals of various sizes and oxidation states. Due to the diversity of binding modes available to porphyrin, there is a growing interest in introducing other elements into this pocket.\\nBoron in particular has been shown to prefer binding to porphyrin in a 2:1 stoichiometry, primarily due to its small atomic radius, but the Group XIII element will bind in a 1:1 ratio with corrole, a macromolecule with a structure similar to porphyrin but with a smaller N₄ pocket.\\nBoron porphyrins are of interest because of the unique geometric environment to which both boron and porphyrin are subjected upon B-N₍₎ bond formation. These new geometric motifs lead to novel reactivity, one of the most surprising examples being sterically-induced reductive coupling. Possible applications for boron porphyrins include BNCT delivery agents and OLED devices."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%90%D0%BD%D0%B4%D1%85%D1%80%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6c/Telengana.PNG","page_title":"Андхра","context_page_description":"Андхра — историческая область на юго-востоке полуострова Индостан, в 1953—1956 годах бывшая самостоятельным штатом Индии."},{"page_url":"https://ceb.wikipedia.org/wiki/Zgornja_Draga","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0b/Postcard_of_Zgornja_Draga%2C_Spodnja_Draga_and_Stranska_vas_ob_Vi%C5%A1njici.jpg","page_title":"Zgornja Draga","context_page_description":"Lungsod ang Zgornja Draga sa Esklobeniya. Nahimutang ni sa munisipyo sa Občina Ivančna Gorica, sa sentro nga bahin sa nasod, 24 km sa habagatan-sidlakan sa Ljubljana ang ulohan sa nasod. 385 metros ibabaw sa dagat kahaboga ang nahimutangan sa Zgornja Draga, ug adunay 132 ka molupyo.\\nAng yuta palibot sa Zgornja Draga kay kabungtoran sa amihang-kasadpan, apan sa habagatang-sidlakan nga kini mao ang patag. Ang kinahabogang dapit sa palibot dunay gihabogon nga 600 ka metro ug 1.7 km sa habagatan-kasadpan sa Zgornja Draga. Dunay mga 47 ka tawo kada kilometro kwadrado sa palibot sa Zgornja Draga medyo gamay nga populasyon. Ang kinadul-ang mas dakong lungsod mao ang Grosuplje, 8.7 km sa kasadpan sa Zgornja Draga. Hapit nalukop sa lasang nga sagolsagol ang palibot sa Zgornja Draga.\\nAng klima boreal. Ang kasarangang giiniton 10 °C. Ang kinainitan nga bulan Hulyo, sa 21 °C, ug ang kinabugnawan Disyembre, sa -4 °C. Ang kasarangang pag-ulan 2,204 milimetro matag tuig. Ang kinabasaan nga bulan Nobiyembre, sa 300 milimetro nga ulan, ug ang kinaugahan Hulyo, sa 111 milimetro."},{"page_url":"https://mk.wikipedia.org/wiki/%D0%9F%D0%B0%D1%80%D1%82%D0%B8%D1%98%D0%B0_%D0%BD%D0%B0_%D0%BE%D0%B1%D0%B5%D0%B4%D0%B8%D0%BD%D0%B5%D1%82%D0%B8_%D0%B4%D0%B5%D0%BC%D0%BE%D0%BA%D1%80%D0%B0%D1%82%D0%B8_%D0%BD%D0%B0_%D0%9C%D0%B0%D0%BA%D0%B5%D0%B4%D0%BE%D0%BD%D0%B8%D1%98%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c8/Podem_logo.jpg","page_title":"Партија на обединети демократи на Македонија","context_page_description":"Партија на обединети демократи на Македонија — македонска политичка партија."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D0%BE%D0%BA_%D0%B2%D0%B8%D0%B4%D1%96%D0%B2_%D1%80%D0%BE%D0%B4%D1%83_%D0%B7%D0%BB%D0%B8%D0%BD%D0%BA%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/26/Erigeron_eriocephalus_%287833272564%29.jpg","page_title":"Список видів роду злинка","context_page_description":"Список видів роду злинка:\\nСписок, який містить 476 визнаних видів роду злинка з родини Айстрових, або Складноцвітих, складений на основі даних сайту «The Plant List».\\nУкраїнські назви видів, які містять посилання на авторитетні джерела, є прийнятими українськими назвами."},{"page_url":"https://en.wikipedia.org/wiki/Tor-Arne_Moen","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b0/Tor-Arne_Moen_African_time.jpg","page_title":"Tor-Arne Moen","context_page_description":"Tor-Arne Moen is a Norwegian painter and author. He lives in Notodden with atelier in Hydroparken. He's a member of Norske Billedkunstnere, Norwegian Authors' Union and Norske Grafikere.\\nMoen debuted at Høstutstillingen in 1994. He made the front covers for a re-release of Knut Hamsun's complete works from 1992 to 1994. These paintings are displayed at Tranøy gallery in Hamarøy.\\nIn 1998 he released a collection of short stories, called Høst i sommerfuglhagen, and in 2008 he authored the novel Brønnørreten."},{"page_url":"https://en.wikipedia.org/wiki/1974_Austrian_presidential_election","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d7/B%C3%BCste_DDr._Alois_Lugger.jpg","page_title":"1974 Austrian presidential election","context_page_description":"Presidential elections were held in Austria on 23 June 1974 after incumbent President Franz Jonas died on 24 April. The Socialist Party nominated Foreign Minister Rudolf Kirchschläger, who won the election with 51.7% of the vote. The only other candidate was the mayor of Innsbruck, Alois Lugger, of the Austrian People's Party."},{"page_url":"https://gl.wikipedia.org/wiki/Monta%C3%B1a","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8b/Denali_Mt_McKinley.jpg","page_title":"Montaña","context_page_description":"Unha montaña é un accidente xeográfico, unha elevación sobre o terreo lindeiro formada normalmente a partir de sinclinais e erosión. A unha secuencia de montañas chámase cordilleira. Unha montaña ten unha altitude bastante superior a un outeiro, aínda que non exista unha altitude específica para esa diferenciación. Así, cada autoridade no asunto asume valores convenientes, aínda que a montaña sexa tipicamente escarpada, de grande inclinación e con superposición de relevos.\\nA superficie do planeta Terra é nun 24% montañosa; o 10% da poboación mundial vive en terreo montañoso. Todos os ríos nacen en montañas, o que torna máis de metade da humanidade dependente das montañas por seren responsábeis da auga fluvial."},{"page_url":"https://sk.wikipedia.org/wiki/Zjavenie_P%C3%A1na","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ad/1_Sanok%2C_Blessing_of_the_holy_water_at_San_River.JPG","page_title":"Zjavenie Pána","context_page_description":"Zjavenie Pána alebo Bohozjavenie alebo Epifánia je kresťanský sviatok, ktorý väčšina kresťanov slávi 6. januára."},{"page_url":"https://de.wikipedia.org/wiki/KW_%E2%80%93_Das_Heizkraftwerk","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b4/KW_%E2%80%93_Das_Heizkraftwerk_Nightclub_Munich_3.jpg","page_title":"KW – Das Heizkraftwerk","context_page_description":"KW – Das Heizkraftwerk war ein Techno-Club in München, der vom Oktober 1996 bis zum 31. Januar 2003 existierte."},{"page_url":"https://cs.wikipedia.org/wiki/Cestovn%C3%AD_ruch_v_Pa%C5%99%C3%AD%C5%BEi","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5c/Notre-Dame-night.jpg","page_title":"Cestovní ruch v Paříži","context_page_description":"Cestovní ruch v Paříži je významnou součástí ekonomiky města, které patří díky své velmi rozmanité a obsáhlé turistické nabídce. V roce 2017 Paříž navštívilo 23 miliónů turistů. Nejvíce turistů pocházelo z USA, Japonska a z Číny. Z Evropy nejvíce turistů přijíždí z Německa a Velké Británie. Paříž se tak každoročně pyšní prvenstvím, nejnavštěvovanějších měst na světě."},{"page_url":"https://es.wikipedia.org/wiki/Puente_de_Crimea","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f7/Kerch_Strait_Bridge%2C_2018-04-14.jpg","page_title":"Puente de Crimea","context_page_description":"El puente de Crimea o puente sobre el estrecho de Kerch ​​ es un puente sobre el estrecho de Kerch entre la punta Chushka en la península de Tamán, Rusia y la península de Kerch, Crimea, el territorio en disputa entre Rusia y Ucrania desde el 18 de marzo de 2014. La conexión por carretera está completa desde el 16 de mayo de 2018​ y la ferroviaria desde el 23 de diciembre de 2019. Con sus casi 19 kilómetros de longitud, se trata del puente más largo de Europa en la actualidad.​"},{"page_url":"https://cy.wikipedia.org/wiki/Orangeburg_County,_De_Carolina","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b0/Old_Orangeburg_Co_SC_jail_from_SW_1.JPG","page_title":"Orangeburg County, De Carolina","context_page_description":"Sir yn nhalaith De Carolina, Unol Daleithiau America yw Orangeburg County. Cafodd ei henwi ar ôl William V, Tywysog Orange. Sefydlwyd Orangeburg County, De Carolina ym 1769 a sedd weinyddol y sir yw Orangeburg, De Carolina.\\nMae ganddi arwynebedd o 2,922 cilometr sgwâr. Allan o'r arwynebedd hwn, y canran o ffurfiau dyfrol, megis llynnoedd ac afonydd, yw 1.9%. Yn ôl cyfrifiad y wlad, poblogaeth y sir yw: 90,942. Mewn cymhariaeth, yn 2016 roedd poblogaeth Caerdydd yn 361,462 a Rhyl tua 26,000.\\nMae'n ffinio gyda Calhoun County, Bamberg County, Clarendon County, Dorchester County, Colleton County, Aiken County, Barnwell County, Lexington County, Berkeley County. Cedwir rhestr swyddogol o henebion ac adeiladau cofrestredig y sir yn: National Register of Historic Places listings in Orangeburg County, South Carolina.\\nCeir sawl sir o’r un enw gan gynnwys:\\nOrange County, Califfornia\\nOrange County, Efrog Newydd\\nOrange County, Florida\\nOrange County, Gogledd Carolina\\nOrange County, Indiana\\nOrange County, Texas\\nOrange County, Vermont\\nOrange County, Virginia\\nOrangeburg County, De Carolina"},{"page_url":"https://en.wikipedia.org/wiki/Antirrhea_philoctetes","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7a/Macrolepidoptera15seit_0095.jpg","page_title":"Antirrhea philoctetes","context_page_description":"Antirrhea philoctetes, the common brown morpho or northern antirrhea, is a butterfly of the family Nymphalidae. It was described by Carl Linnaeus in 1758. It is found in Costa Rica, Panama, Guatemala, Colombia, Venezuela, the Guianas, Peru, Brazil and Bolivia.\\nThe larvae feed on Geonoma longivaginata."},{"page_url":"https://pt.wikipedia.org/wiki/Parque_Nacional_da_Lagoa_do_Peixe","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f4/Andorinha_Polar_-_Parque_Nacional_da_Lagoa_do_Peixe.jpg","page_title":"Parque Nacional da Lagoa do Peixe","context_page_description":"O Parque Nacional da Lagoa do Peixe está localizado no litoral sul do estado do RS, abrangendo os municípios de Tavares, Mostardas e São José do Norte. A unidade foi criada através Decreto nº 93.546, emitido em 06 de novembro de 1986. Com uma área de 36 722 ha e perímetro de 138,84 km. Atualmente é administrado pelo Instituto Chico Mendes de Conservação da Biodiversidade.\\nO acesso pelo norte é feito a partir de Porto Alegre, através da RS-040 até Capivari; de Capivari do Sul, pela RST-101 até Mostardas, onde se localiza a sede administrativa do Parque, na Praça Prefeito Luiz Martins, nº 30. Daí aos limites da unidade são mais 25 km. As cidades mais próximas do PARNA são Tavares e Mostardas, que distam da capital do estado, Porto Alegre, 230 e 200 km, respectivamente."},{"page_url":"https://pl.wikipedia.org/wiki/Gielas_czternastoplamek","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fb/Calvia_quatuordecimguttata_nymph.jpg","page_title":"Gielas czternastoplamek","context_page_description":"Gielas czternastoplamek, biedronka czternastokropka – gatunek chrząszcza z rodziny biedronkowatych. Występuje w Holarktyce."},{"page_url":"https://af.wikipedia.org/wiki/Suid-Afrikaanse_konsentrasiekampe","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/54/Konsentrasiekamp_Krugersdorp.jpg","page_title":"Suid-Afrikaanse konsentrasiekampe","context_page_description":"Die afbrand van opstalle as deel van die Britse verskroeideaardebeleid tydens die Anglo-Boereoorlog van 1899 tot 1902 het ŉ groot probleem geskep in die vorm van ŉ groeiende getal hawelose Boerevroue en -kinders. Die presiese aanvangsdatum van die konsentrasiekampstelsel om aan hulle ŉ heenkome te bied is onbekend, maar dit blyk ŉ kamp vir hawelose burgerlikes is reeds aan die begin van die oorlog by Mafeking opgerig. In hierdie stadium was dit egter nog nie die amptelike beleid of stelsel nie, maar sou teen omstreeks Julie 1900 amptelik word.\\nTeen daardie tyd was Lord Roberts verplig om wapenneerlêers teen heropkommandering deur die Boeremagte te beskerm. Die enigste uitweg was om hulle en hul gesinne in beskermingskampe te plaas, en gevolglik is sulke kampe in September 1900 in Bloemfontein en Pretoria opgerig. Daar was egter uit die staanspoor ook hawelose Boerevroue met hul kinders in die kampe, asook grysaards wie se huise afgebrand is en wat hulself nie vrywillig onder Britse beskerming geplaas het nie – die sogenaamde “ongewenstes”. Spoedig het hulle die “refugees” in getalle oortref."},{"page_url":"https://en.wikipedia.org/wiki/The_Last_Communion_of_Saint_Jerome_(Carracci)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0d/LastCommunion.jpg","page_title":"The Last Communion of Saint Jerome (Carracci)","context_page_description":"The Last Communion of Saint Jerome or The Communion of Saint Jerome is a 1592-1597 oil on canvas painting by Agostino Carracci, produced for San Girolamo alla Certosa church in Bologna and now in the Pinacoteca Nazionale di Bologna."},{"page_url":"https://ja.wikipedia.org/wiki/%E8%88%AC%E8%8B%A5%E5%BF%83%E7%B5%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/64/Hannya_shingyo.png","page_title":"般若心経","context_page_description":"『般若心経』、正式名称『般若波羅蜜多心経』は、大乗仏教の空・般若思想を説いた経典で、般若経の1つともされる。\\n僅か300字足らずの本文に大乗仏教の心髄が説かれているとされ、複数の宗派において読誦経典の一つとして広く用いられている。"},{"page_url":"https://sk.wikipedia.org/wiki/NGC_1572","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2d/NGC_1572_DSS.jpg","page_title":"NGC 1572","context_page_description":"NGC 1572 je galaxia v súhvezdí Rydlo, ktorú objavil anglický astronóm John Herschel 23. októbra 1835.\\nJej zdanlivá hviezdna veľkosť je 12,5."},{"page_url":"https://en.wikipedia.org/wiki/Jane_Cowl","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/37/Jane_Cowl_2.jpg","page_title":"Jane Cowl","context_page_description":"Jane Cowl was an American film and stage actress and playwright \\"notorious for playing lachrymose parts\\". Actress Jane Russell was named in Cowl's honor."},{"page_url":"https://de.wikipedia.org/wiki/Lift-off-Verfahren","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7c/Lift-off-Verfahren_%28Halbleitertechnik%29.svg","page_title":"Lift-off-Verfahren","context_page_description":"Das Lift-off-Verfahren ist in der Halbleiter- und Mikrosystemtechnik eine Prozessfolge zur Herstellung einer meist metallischen Mikrostruktur. In einem ersten Prozessschritt werden dabei strukturierte dünne Schichten auf der Oberfläche von Substraten wie beispielsweise Wafern erzeugt. Auf diese strukturierte Opferschicht wird dann das Zielmaterial ganzflächig abgeschieden. Jene Bereiche, in denen sich das Zielmaterial auf der Opferschicht befindet, werden anschließend durch einen weiteren Prozessschritt entfernt, und die verbliebenen Strukturen bilden die gewünschte Mikrostruktur. Die Größe der mit dem Lift-off-Verfahren herstellbaren Strukturen reicht von einigen zehn Nanometern bis zu Zentimetern, wobei die typischen Strukturgrößen im Mikrometerbereich liegen. Eingesetzt wird das Verfahren unter anderem zur Herstellung von Leiterbahnebenen oder Kontaktflächen bei der Fertigung von integrierten Schaltungen und Mikrosystemen. Im Gegensatz zu diesem additiven bzw. aufbauenden Verfahren stehen die subtraktiven Verfahren, bei denen zuerst ganzflächig eine homogene Schicht des Zielmaterials auf dem Substrat abgeschieden wird und die spätere Struktur durch Ätzen dieser Schicht entsteht."},{"page_url":"https://sv.wikipedia.org/wiki/V%C3%A5gbrytare","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6a/V%C3%A5gbrytare.jpg","page_title":"Vågbrytare","context_page_description":"Vågbrytare är en utfyllnad som byggts upp för att skydda hamnar, broar eller del av kusten från havsvågor. Vågbrytare finns vanligtvis som en yttre barriär vid inloppet till hamnar. En annan form av vågbrytare är en pir.\\nVågbrytare byggs genom utfyllnad av sjöbotten med sand, grus och sten på vilket det placeras en stadig och kraftig konstruktion av trä, stensättning eller betong som ska motstå påfrestningarna av vågor och is."},{"page_url":"https://en.wikipedia.org/wiki/List_of_smoked_foods","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/84/Mettwurst_with_sauerkraut_and_potatoes.jpg","page_title":"List of smoked foods","context_page_description":"This is a list of smoked foods. Smoking is the process of flavoring, cooking, or preserving food by exposing it to smoke from burning or smoldering material, most often wood. Foods have been smoked by humans throughout history. Meats and fish are the most common smoked foods, though cheeses, vegetables, and ingredients used to make beverages such as whisky, smoked beer, and lapsang souchong tea are also smoked. Smoked beverages are also included in this list."},{"page_url":"https://en.wikipedia.org/wiki/The_Jungle","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d0/Chicago_stockyards_cattle_pens_men_1909.jpg","page_title":"The Jungle","context_page_description":"The Jungle is a 1906 novel by the American journalist and novelist Upton Sinclair. The novel portrays the harsh conditions and exploited lives of immigrants in the United States in Chicago and similar industrialized cities. Sinclair's primary purpose in describing the meat industry and its working conditions was to advance socialism in the United States. However, most readers were more concerned with several passages exposing health violations and unsanitary practices in the American meat packing industry during the early 20th century, which greatly contributed to a public outcry which led to reforms including the Meat Inspection Act. Sinclair said of the public reaction, \\"I aimed at the public's heart, and by accident I hit it in the stomach.\\"\\nThe book depicts working-class poverty, lack of social supports, harsh and unpleasant living and working conditions, and hopelessness among many workers. These elements are contrasted with the deeply rooted corruption of people in power. A review by the writer Jack London called it \\"the Uncle Tom's Cabin of wage slavery.\\"\\nSinclair was considered a muckraker, a journalist who exposed corruption in government and business."},{"page_url":"https://sw.wikipedia.org/wiki/HMS_Birkenhead","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/42/The_Wreck_of_the_Birkenhead.jpg","page_title":"HMS Birkenhead","context_page_description":"HMS Birkenhead ilukuwa meli ya Uingereza iliyotengenezwa mwaka 1845 kwa teknolojia mpya."},{"page_url":"https://en.wikipedia.org/wiki/Richard_Garrett_%26_Sons","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/83/Garrett_Six-Wheeled_Undertype_Steam_Wagon_No_35464_of_1931.JPG","page_title":"Richard Garrett & Sons","context_page_description":"Richard Garrett & Sons was a manufacturer of agricultural machinery, steam engines and trolleybuses. Their factory was Leiston Works, in Leiston, Suffolk, England. The company was founded by Richard Garrett in 1778.\\nThe company was active under its original ownership between 1778 and 1932.\\nIn the late 1840s, after cultivating a successful agricultural machine and implement business, the company began producing portable steam engines. The company grew to a major business employing around 2,500 people. Richard Garrett III, grandson of the company's founder, visited The Great Exhibition of 1851 in London, where he saw some new American manufacturing ideas. Richard Garrett III introduced flow line production – a very early assembly line - and constructed a new workshop for the purpose in 1852. This was known as 'The Long Shop' on account of its length. A machine would start at one end of the Long Shop and as it progressed through the building it would stop at various stages where new parts would be added. There was also an upper level where other parts were made; they would be lowered over a balcony and then fixed onto the machine on the ground level."},{"page_url":"https://no.wikipedia.org/wiki/Juncker-kommisjonen","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4d/Cecilia_Malmstr%C3%B6m_%28cropped%29.jpg","page_title":"Juncker-kommisjonen","context_page_description":"Juncker-kommisjonen var den 14. europakommisjon siden 1967. Kommisjonen var i tjeneste fra 1. november 2014 til 31. oktober 2019 og ble ledet av president Jean-Claude Juncker. Den etterfulgte José Manuel Barrosos andre kommisjon."},{"page_url":"https://fr.wikipedia.org/wiki/Santa_Ana_(Pamp%C3%A1n)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/46/Abrazo_de_Bol%C3%ADvar_y_Morillo%2C_Trujillo_-_Venezuela.jpg","page_title":"Santa Ana (Pampán)","context_page_description":"Santa Ana est l'une des quatre paroisses civiles de la municipalité de Pampán dans l'État de Trujillo au Venezuela."},{"page_url":"https://hi.wikipedia.org/wiki/%E0%A4%B8%E0%A5%8D%E0%A4%AA%E0%A4%BE%E0%A4%87%E0%A4%A1%E0%A4%B0-%E0%A4%AE%E0%A5%88%E0%A4%A8:_%E0%A4%B9%E0%A5%8B%E0%A4%AE%E0%A4%95%E0%A4%AE%E0%A4%BF%E0%A4%82%E0%A4%97","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c2/Spider_Man_Homecoming_Logo.jpeg","page_title":"स्पाइडर-मैन: होमकमिंग","context_page_description":"स्पाइडर-मैन: होमकमिंग एक अमेरिकी सुपर हीरो फिल्म है, जो मार्वल कॉमिक्स के चरित्र स्पाइडर मैन पर आधारित है। यह फिल्म मार्वल स्टूडियो और कोलम्बिया पिक्चर्स द्वारा बनाया गई है, और सोनी पिक्चर्स एंटरटेनमेंट द्वारा वितरित की गई है। यह स्पाइडर मैन फिल्म श्रंखला का दूसरा रीबूट और मार्वेल सिनेमेटीक युनिवर्स की सोलहवीं फिल्म है। फिल्म की पटकथा जोनाथन एम गोल्डस्टीन, जॉन फ्रांसिस डाले, वाट्स, क्रिस्टोफर फोर्ड, क्रिस मैक्केना और एरिक सोमर्स द्वारा लिखी गई है, और यह फिल्म जॉन वाट्स द्वारा निर्देशित है। टॉम हॉलैंड, माइकल कीटन, जेंडाया, डोनाल्ड ग्लोवर, याकूब बेटालॉन, लौरा हैरियर, टोनी रेवोलोरि, न्यूकैसल डेली, बुकिम वुडबाइन, मरिसा टॉमी, और रॉबर्ट डॉनी जूनियर फिल्म में मुख्य भूमिकाओं में है। स्पाइडर-मैन: होमकमिंग मे, पीटर पार्कर अपने उच्च विद्यालय के जीवन के साथ नायक स्पाइडर मैन को भी संतुलित करने के लिए कोशिश करता है।\\nस्पाइडर-मैन: होमकिंग उत्तरी अमेरिका मे 7 जुलाई, 2017 को, 3 डी, आईमैक्स और आईमैक्स 3 डी मे रीलीज हुई।"},{"page_url":"https://en.wikipedia.org/wiki/Nevada%27s_3rd_congressional_district","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/93/Jon_Porter%2C_official_photo_portrait_color.jpg","page_title":"Nevada's 3rd congressional district","context_page_description":"Nevada's 3rd congressional district is a congressional district occupying the area south of Las Vegas, including Henderson, Boulder City and much of unincorporated Clark County. The district was initially created after the 2000 census.\\nIt was intended to be a \\"fair fight\\" district, and as originally drawn had a relatively equal balance of registered Republicans and registered Democrats. It is currently represented by Democrat Susie Lee."},{"page_url":"https://sq.wikipedia.org/wiki/Udh%C3%ABheq%C3%ABs_t%C3%AB_shteteve_n%C3%AB_vitin_1999","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/Ehud_Barak_official.jpg","page_title":"Udhëheqës të shteteve në vitin 1999","context_page_description":"Udhëheqës të shteteve në vitin 1999 janë të radhitur sipas kontinenteve dhe pastaj në kontinente janë të radhitura shtetet sipas shkronjës."},{"page_url":"https://en.wikipedia.org/wiki/House_of_Lusignan","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/Map_Crusader_states_1165-en.svg","page_title":"House of Lusignan","context_page_description":"The House of Lusignan was a royal house of French origin, which at various times ruled several principalities in Europe and the Levant, including the kingdoms of Jerusalem, Cyprus, and Armenia, from the 12th through the 15th centuries during the Middle Ages. It also had great influence in England and France.\\nThe family originated in Poitou, near Lusignan in western France, in the early 10th century. By the end of the 11th century, the family had risen to become the most prominent petty lords in the region from their castle at Lusignan. In the late 12th century, through marriages and inheritance, a cadet branch of the family came to control the kingdoms of Jerusalem and Cyprus. In the early 13th century, the main branch succeeded in the Counties of La Marche and Angoulême.\\nAs Crusader kings in the Latin East, they soon had connections with the Hethumid rulers of the Kingdom of Cilicia, which they inherited through marriage in the mid-14th century. The Armenian branch fled to France, and eventually Russia, after the Mamluk conquest of their kingdom.\\nThe claim was taken by the Cypriot branch, until their line failed."},{"page_url":"https://ja.wikipedia.org/wiki/%E6%9E%97%E6%9F%8F%E7%94%9F","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d4/Lin_Bosheng.JPG","page_title":"林柏生","context_page_description":"林 柏生は中華民国の政治家・ジャーナリスト。南京国民政府の要人で、汪兆銘本人にとっても側近的存在である。号は石泉。"},{"page_url":"https://hy.wikipedia.org/wiki/%D5%8C%D5%B8%D5%A2%D5%A5%D6%80%D5%BF_%D4%B2%D5%B8%D6%80%D5%A4%D5%A5%D5%B6","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/91/James_Guthrie_-_Sir_Robert_Laird_Borden.jpg","page_title":"Ռոբերտ Բորդեն","context_page_description":"Սըր Ռոբերտ Լերդ Բորդեն, կանադացի քաղաքական գործիչ, իրավաբան, Կանադայի պահպանողական կուսակցության առաջնորդ, Կանադայի 8-րդ վարչապետ, պաշտոնական ընդդիմության առաջնորդ ։ Նա այդ պաշտոնը զբաղեցրած երրորդ նորշոտլանդացին էր։ Եղել է քաղաքացիական իրավունքի դոկտոր: Նրա կառավարման ընթացքում Կանադան մասնակցել է Առաջին համաշխարհային պատերազմին:"},{"page_url":"https://fr.wikipedia.org/wiki/Histoire_de_Kyoto","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ef/1696_Genroku_9_%28early_Edo%29_Japanese_Map_of_Kyoto%2C_Japan_-_Geographicus_-_Kyoto-genroku9-1696.jpg","page_title":"Histoire de Kyoto","context_page_description":"L'Histoire de Kyōto a commencé dans une vallée pas si loin de Nara à côté de la rivière Kamo-gawa.\\nAvant que l'empereur Jimmu décide de quitter son ancienne capitale, il avait déjà prévu la création d'un plan ad hoc de la ville nouvelle. Heian-kyo ou Kyoto deviendra la conséquence de cet aménagement géométrique."},{"page_url":"https://fr.wikipedia.org/wiki/Vieux_Thomas","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bc/Tallinn_Rathausspitzen_%282009%29.JPG","page_title":"Vieux Thomas","context_page_description":"Le Vieux Thomas est un symbole et gardien de la ville de Tallinn. Il se trouve sur l'Hôtel de ville de Tallinn"},{"page_url":"https://zh.wikipedia.org/zh-tw/%E5%A1%94%E9%BA%97%E7%81%B0%E8%9D%B6","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/58/Redpierror_cat2.jpg","page_title":"塔麗灰蝶","context_page_description":"塔麗灰蝶是屬於灰蝶科藍灰蝶亞科的一種蝴蝶，是塔麗灰蝶屬的一種。分布於印度至海南島及泰國一帶。幼蟲的寄主為景天科落地生根屬和伽藍菜屬植物。"},{"page_url":"https://de.wikipedia.org/wiki/Nibelungenlied","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a6/Siegfried.jpg","page_title":"Nibelungenlied","context_page_description":"Das Nibelungenlied ist ein mittelalterliches Heldenepos. Der heute bekannte Text wurde zu Beginn des 13. Jahrhunderts auf Mittelhochdeutsch niedergeschrieben. Der Stoff ist jedoch bedeutend älter.\\nAn das Nibelungenlied angehängt ist in den mittelalterlichen Handschriften die Nibelungenklage, eine formal eigenständige Erzählung, die das Geschehen interpretiert und bewertet, teilweise fortsetzt und eine vermutlich fiktive Entstehungsgeschichte des Werks vorträgt.\\nDas Nibelungenlied wurde Mitte des 18. Jahrhunderts wiederentdeckt und galt im 19. und 20. Jahrhundert als Nationalepos der Deutschen, wobei Siegfried der Drachentöter zu einem deutschen Nationalhelden umgedeutet wurde."},{"page_url":"https://la.wikipedia.org/wiki/Chemilli","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/99/Map_commune_FR_insee_code_61105.png","page_title":"Chemilli","context_page_description":"Chemilli est commune Francicum 225 incolarum praefecturae Olinae in provincia Normannia Inferiori"},{"page_url":"https://lt.wikipedia.org/wiki/Edward_Sapir","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/75/Edward_Sapir.jpg","page_title":"Edward Sapir","context_page_description":"Eduardas Sapyras – Jungtinių Amerikos Valstijų kalbininkas, antropologas. Vienas iš etnopsichologijos krypties atstovų ir etnolingvistikos pradininkų, žymus indėnistas."},{"page_url":"https://be.wikipedia.org/wiki/%D0%94%D0%B6%D0%BE%D0%B7%D0%B5%D1%84_%D0%AD%D1%81%D1%82%D1%80%D0%B0%D0%B4%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bc/Estrada_Sig.png","page_title":"Джозеф Эстрада","context_page_description":"Хасэ́ Марсэ́ла Эхерсі́та, больш вядомы як Джо́зеф Эхерсі́та Эстра́да — філіпінскі кінаакцёр, віцэ-прэзідэнт, 13-ы прэзідэнт Філіпін. Зрынуты ў выніку мірнай рэвалюцыі пасля таго, як шэраг сенатараў — прыхільнікаў Эстрады блакавалі працэдуру яго імпічмента па абвінавачванні ў карупцыі."},{"page_url":"https://en.wikipedia.org/wiki/Greenwood/Memory_Lawn_Mortuary_%26_Cemetery","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/Phoenix-House-Lincoln_Ragsdale_House-1941.jpg","page_title":"Greenwood/Memory Lawn Mortuary & Cemetery","context_page_description":"Greenwood/Memory Lawn Mortuary & Cemetery is the official name given to a cemetery located at 2300 West Van Buren Street in Phoenix, Arizona owned by Dignity Memorial. The cemetery, which resulted as a merger of two historical cemeteries, Greenwood Memorial Park and Memory Lawn Memorial Park, is the final resting place of various notable citizens of Arizona. Pioneers, governors, congressman, government officials, journalists, race car drivers, soldiers, actors and actresses are among the many notable citizens who are interred in the cemetery."},{"page_url":"https://lmo.wikipedia.org/wiki/Agde","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fc/Agde_joutes_%C3%A9t%C3%A9_2007_434.jpg","page_title":"Agde","context_page_description":"Agde l'è 'n cümü fransés de la regiù Languedoc-Roussillon, endèla Frància meridiunàla. El fa part del cantù de Agde, del circondàre de Béziers e del dipartimènt de l'Hérault.\\nEl g'ha 'na popolasiù de 23 999 abitàncc, dato agiurnàt al ginee 2011.\\nEl sò teretóre el g'ha 'na superfìce de 50,90 km² e 'l và de 'na altèsa mìnima de 0 méter a 'na altèsa màsima de 110 méter söl leèl del mar."},{"page_url":"https://en.wikipedia.org/wiki/86th_Aeromedical_Evacuation_Squadron","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5d/86_Aeromedical_Evacuation_Sq.jpg","page_title":"86th Aeromedical Evacuation Squadron","context_page_description":"The 86th Aeromedical Evacuation Squadron is a unit of the United States Air Force. It is part of the 86th Operations Group, 86th Airlift Wing at Ramstein Air Base, Germany. It is a component of Third Air Force and United States Air Forces Europe.\\nThe 86 AES provides operational aeromedical evacuation for U.S. troops in the United States European Command and United States Africa Command areas of responsibility using, primarily, Boeing C-17 Globemaster III, Boeing KC-135 Stratotanker, Gates Learjet C-21A and Lockheed Martin C-130J Super Hercules aircraft.\\nThe squadron was constituted as the 86 Aeromedical Evacuation Squadron on 27 May 1994, and activated on 16 August 1994.\\nThe unit is manned by Flight Nurses, Medical Service Corps officers and Aeromedical Evacuation Technicians; as well as medical administration and logistics technicians."},{"page_url":"https://cs.wikipedia.org/wiki/Katedr%C3%A1la_svat%C3%A9_Al%C5%BEb%C4%9Bty","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/35/Reli%C3%A9fSv.Al%C5%BEbety.jpg","page_title":"Katedrála svaté Alžběty","context_page_description":"Katedrála svaté Alžběty Durynské je největší kostel na Slovensku s celkovou plochou 1200 m² a kapacitou více než 5000 lidí a zároveň gotická katedrála. Nachází se ve středu Hlavní ulice v Košicích, přičemž ji formuje do tvaru čočky. Je hlavním chrámem Košické arcidiecéze a farním kostelem farnosti svaté Alžběty v Košicích. Vnější délka chrámu je 60 m, šířka 36 m, výška severní věže 59 m, hlavní lodě 24 m a bočných lodí 12 m. Stavba měla značný vliv na stavitelskou činnost v okolních městech Prešov, Bardejov, Sabinov, Rožňava a ovlivnila i výstavbu dalších chrámů v Polsku a Sedmihradsku.\\nKošickou gotickou katedrálu tvoří svatyně s pětidílným uzávěrem, dvě věže, poschoďová sakristie na severní straně a dvě kaple a předsíň na jižní straně. Jedinečná je vnitřní disposice chrámu, kde hlavní loď a čtyři boční lodě kříži v polovici jejich délky jedna příčná loď stejné výšky a šířky jako hlavní loď, se kterou vytváří řecký kříž. Tím ve středu katedrály vzniká objemný centrální prostor a v exteriéru tři rovnocenné štíty s bohatě dekorovanými portály, které patří k vrcholům středověkého kamenického umění ve střední Evropě."},{"page_url":"https://de.wikipedia.org/wiki/Schlacht_am_Cedar_Mountain","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/ba/Sketch_of_the_Battle_of_Cedar_Run.jpg","page_title":"Schlacht am Cedar Mountain","context_page_description":"Die Schlacht am Cedar Mountain oder auch Schlacht am Slaughter's Mountain oder Schlacht am Cedar Run war eine Schlacht im Sezessionskrieg, die am 9. August 1862 bei Culpeper, Virginia stattfand. Der Sieg ermöglichte es General Robert E. Lee, die Initiative zu ergreifen und die Kampfhandlungen vom Piedmont in den Norden Virginias zu verlagern."},{"page_url":"https://pt.wikipedia.org/wiki/Dellach_im_Drautal","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/05/Kapelle_zur_Schmerzhaften_Mutter_in_Supersberg1.JPG","page_title":"Dellach im Drautal","context_page_description":"Dellach im Drautal é um município da Áustria localizado no distrito de Spittal an der Drau, no estado de Caríntia."},{"page_url":"https://en.wikipedia.org/wiki/Love_Finds_Andy_Hardy","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ca/Rooney-Garland-ebay-1938.jpg","page_title":"Love Finds Andy Hardy","context_page_description":"Love Finds Andy Hardy is a 1938 American romantic comedy film that tells the story of a teenage boy who becomes entangled with three different girls all at the same time. It stars Mickey Rooney, Lewis Stone, Fay Holden, Cecilia Parker, Judy Garland, Lana Turner, Ann Rutherford, Mary Howard and Gene Reynolds.\\nThe screenplay was written by William Ludwig, from stories by Vivien R. Bretherton, and based upon characters created by Aurania Rouverol. It was directed by George B. Seitz. In 2000, Love Finds Andy Hardy was selected for preservation in the United States National Film Registry by the Library of Congress as being \\"culturally, historically, or aesthetically significant\\".\\nThis was the first film in which Metro-Goldwyn-Mayer recorded at least part of the soundtrack in stereophonic sound, a practice which was used for a number of MGM musical comedies beginning the late 1930s. The film was presented in standard monaural sound."},{"page_url":"https://en.wikipedia.org/wiki/William_Colenso","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9e/William_Colenso_%281811-1899%29.png","page_title":"William Colenso","context_page_description":"William Colenso was a Cornish Christian missionary to New Zealand, and also a printer, botanist, explorer and politician. He attended the signing of the Treaty of Waitangi and later wrote an account of the events at Waitangi."},{"page_url":"https://pl.wikipedia.org/wiki/David_C.H._Austin","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e7/Rosa_%27Munstead_Wood%27_David_Austin.jpg","page_title":"David C.H. Austin","context_page_description":"David Charles Henshaw Austin – angielski ogrodnik, pisarz, twórca wielu odmian róż, znanych jako róże angielskie.\\nPochodził ze Shropshire. Już od wczesnej młodości interesował się uprawą roślin. W wyniku krzyżowania starych odmian róż z nowoczesnymi różami wielkokwiatowymi i wielokwiatowymi wyhodował nowe odmiany tworzące nową grupę – róże angielskie, łączące kształt i zapach kwiatów starych róż z różnorodnością kolorów i długim okresem kwitnienia charakterystycznymi dla róż nowoczesnych. Pierwszą swoją nową odmianę, 'Constance Spry’, wprowadził na rynek w 1961. Stworzył ponad 240 nowych odmian róż. Był także autorem kilku książek o różach i tomika poezji The Breathing Earth, wydanego w 2014. W 2007 roku został odznaczony Orderem Imperium Brytyjskiego."},{"page_url":"https://en.wikipedia.org/wiki/Yvette_Troispoux","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fd/Yvette_Troispoux.JPG","page_title":"Yvette Troispoux","context_page_description":"Yvette Troispoux was a French photographer known as the \\"photographer of photographers\\" for her pictures taken unobtrusively at photography exhibitions and social events. Her extensive body of work, built up over seventy years, also includes photographs of people in everyday settings in the \\"humanist” tradition. After her death, the French National Library acquired her archives for its collections."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9C%D0%BE%D1%80%D0%B7%D0%B5,_%D0%A1%D1%8D%D0%BC%D1%8E%D1%8D%D0%BB","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ef/Samuel_Morse.jpg","page_title":"Морзе, Сэмюэл","context_page_description":"Сэ́мюэл Фи́нли Бриз Мо́рзе — американский изобретатель и художник. Наиболее известные изобретения — электромагнитный пишущий телеграф и код Морзе.\\n24 мая 1844 года была послана первая депеша между Вашингтоном и Балтимором по способу Морзе с текстом «Чудны дела Твои, Господи».\\nСэмюэл Морзе был одним из основателей и первым президентом Национальной академии дизайна в Нью-Йорке."},{"page_url":"https://hu.wikipedia.org/wiki/Eml%C3%A9kt%C3%A1bl%C3%A1k_Budapest_XI._ker%C3%BClet%C3%A9ben","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/76/Kos%C3%A1ry_Domokos_portr%C3%A9domborm%C5%B1ve.JPG","page_title":"Emléktáblák Budapest XI. kerületében","context_page_description":"Budapest XI. kerülete szócikkhez kapcsolódó képgaléria, mely helyi, országos vagy nemzetközi hírű személyekkel, valamint épületekkel, műtárgyakkal, helynevekkel és eseményekkel összefüggő emléktáblákat tartalmaz."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9C%D0%B8%D0%B4%D0%B4%D0%B5%D0%BB%D0%B1%D1%83%D1%80%D0%B3_(%D0%BE%D0%B1%D1%89%D0%B8%D0%BD%D0%B0)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2f/LocatieMiddelburg.png","page_title":"Мидделбург (община)","context_page_description":"Мидделбург — община в провинции Зеландия. Административный центр — город Мидделбург. По данным на 1 апреля 2011 года население общины составляло 48.076 человек."},{"page_url":"https://de.wikipedia.org/wiki/KZ_Ro%C3%9Flau","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f2/Ro%C3%9Flau%2CGedenkstein.JPG","page_title":"KZ Roßlau","context_page_description":"Das Konzentrationslager Roßlau existierte vom 12. September 1933 bis zum 31. Juli 1934. Es war das einzige frühe staatliche KZ im Land Anhalt. Es befand sich in dem früheren Volkshaus der Gewerkschaften, Hauptstraße 51, in Roßlau, heute Dessau-Roßlau, Sachsen-Anhalt. Bevor die SPD dort nach dem Ersten Weltkrieg ein Volkshaus einrichtete, befand sich auf dem Grundstück der Gasthof „Zur Goldenen Krone“. Das Volkshaus war 1933 vom Anhaltischen Fiskus beschlagnahmt und enteignet worden."},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/Camps-sur-l'Isle","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/61/Map_commune_FR_insee_code_33088.png","page_title":"Camps-sur-l'Isle","context_page_description":"Camps-sur-l'Isle sī ūi-tī Hoat-kok Aquitaine tōa-khu Gironde séng ê chi̍t ê commune."},{"page_url":"https://en.wikipedia.org/wiki/Wisconsin","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/92/Bluff.jpg","page_title":"Wisconsin","context_page_description":"Wisconsin is a U.S. state located in the north-central, Midwest and Great Lakes regions of the country. It is bordered by Minnesota to the west, Iowa to the southwest, Illinois to the south, Lake Michigan to the east, Michigan to the northeast, and Lake Superior to the north. Wisconsin is the 23rd largest state by total area and the 20th most populous. The state capital is Madison, and its largest city is Milwaukee, which is located on the western shore of Lake Michigan. The state is divided into 72 counties.\\nWisconsin's geography is diverse, having been greatly impacted by glaciers during the Ice Age with the exception of the Driftless Area. The Northern Highland and Western Upland along with a part of the Central Plain occupies the western part of the state, with lowlands stretching to the shore of Lake Michigan. Wisconsin is third to Ontario and Michigan in the length of its Great Lakes coastline.\\nDuring the 19th and early 20th centuries, many European settlers entered the state, many of whom emigrated from Germany and Scandinavia. Like neighboring Minnesota, the state remains a center of German American and Scandinavian American culture."},{"page_url":"https://en.wikipedia.org/wiki/National_Register_of_Historic_Places_listings_in_Rock_County,_Wisconsin","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/97/John_H._Jones_House_1.JPG","page_title":"National Register of Historic Places listings in Rock County, Wisconsin","context_page_description":"This is a list of the National Register of Historic Places listings in Rock County, Wisconsin. It is intended to provide a comprehensive listing of entries in the National Register of Historic Places that are located in Rock County, Wisconsin. The locations of National Register properties for which the latitude and longitude coordinates are included below may be seen in a map.\\nThere are 139 properties and districts listed on the National Register in the county. Another seven properties were once listed but have been removed.\\nThis National Park Service list is complete through NPS recent listings posted July 17, 2020."},{"page_url":"https://en.wikipedia.org/wiki/Hurricane_Catarina","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/77/Cyclone_Catarina_landfall2004.jpg","page_title":"Hurricane Catarina","context_page_description":"Hurricane Catarina was an extremely rare South Atlantic tropical cyclone, the only recorded hurricane strength storm on record in the South Atlantic Ocean. It struck South Brazil at near peak intensity with the equivalent of Category 2 hurricane-force winds.\\nThe storm developed out of a stationary cold-core upper-level trough on March 12. Almost a week later, on March 19, a disturbance developed along the trough and traveled towards the east-southeast until March 22 when a ridge stopped the forward motion of the disturbance. The disturbance was in an unusually favorable environment with a slightly below-average wind shear and above-average sea surface temperatures. The combination of the two led to a slow transition from an extratropical cyclone to a subtropical cyclone by March 24. The storm continued to obtain tropical characteristics and became a tropical storm the next day while the winds steadily increased. The storm attained wind speeds of 121 km/h —equivalent to a low-end Category 1 hurricane on the Saffir–Simpson scale—on March 26."},{"page_url":"https://ro.wikipedia.org/wiki/British_Shorthair","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2d/Mystica_from_British_Empire_Cattery.jpg","page_title":"British Shorthair","context_page_description":"British Shorthair este numele unei rase de pisici domestice ale cărei caracteristici o fac populară în showurile de pisici. Principala caracteristică este părul scurt și faptul ca nu lasă păr-această caracteristică este pe jumătate reală, pisica lăsând jumătate din parul pe care l-ar lăsa o pisică normală, daca este întreținută. Aceasta este cea mai populară rasă de pisici înregistrată de UK's Governing Council of the Cat Fancy din 2001, de când a învins pisica persană."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%B1%D9%8A%D8%A8%D9%8A%D9%83%D8%A7_%D9%83%D8%A7%D8%A8%D9%88%D8%BA%D9%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b6/Rebecca_Kabugho_IWOC_2.jpg","page_title":"ريبيكا كابوغو","context_page_description":"ريبيكا كابوغو ‏ ولدت في 4 سبتمبر / أيلول 1994، وهي ناشطة كونغولية اعتقلتها الحكومة. وقيل إنها واحدة من أصغر سجناء الرأي وحصلت على جائزة نساء الشجاعة الدولية في عام 2017."},{"page_url":"https://vi.wikipedia.org/wiki/Parentucellia_latifolia","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7a/Parentucellia_latifolia.jpeg","page_title":"Parentucellia latifolia","context_page_description":"Parentucellia latifolia là loài thực vật có hoa thuộc họ Cỏ chổi. Loài này được Caruel mô tả khoa học đầu tiên năm 1885."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%BD%E3%83%AB%E3%82%BF%E3%83%A0L33_155mm%E8%87%AA%E8%B5%B0%E6%A6%B4%E5%BC%BE%E7%A0%B2","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/Latrun_-_Armored_Corps_Museum_P1100608_%285151769019%29.jpg","page_title":"ソルタムL33 155mm自走榴弾砲","context_page_description":"ソルタムL33 155mm自走榴弾砲は、イスラエルで1970年代に開発された155mm砲装備の自走榴弾砲である。スーパーシャーマンの車体にソルタム・システムズ製のM68 155mm榴弾砲を搭載した車両で、1973年の第四次中東戦争で運用された。\\n名称のL33は、ソルタムM68榴弾砲が33口径であることに因る。"},{"page_url":"https://no.wikipedia.org/wiki/Den_s%C3%B8ramerikanske_diplomatiske_krisen_2008","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/24/%C3%81lvaro_Uribe_%28cropped%29.jpg","page_title":"Den søramerikanske diplomatiske krisen 2008","context_page_description":"Den søramerikanske diplomatiske krisen 2008 begynte etter et angrep av colombianske soldater inn på ecuadoriansk territorium over Putumayo-elven tidlig 1. mars 2008. Angrepet endte med at Raúl Reyes og 16 andre medlemmer av FARC-geriljaen ble drept. Denne hendelsen resulterte i økt spenning mellom Colombia og Ecuador, samt bevegelsen av ytterligere militære tropper fra Venezuela og Ecuador mot grensene til Colombia."},{"page_url":"https://de.wikipedia.org/wiki/Jerusalemer_Altstadt","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/81/Jerusalem_Jaffa_Gate_BW_1.JPG","page_title":"Jerusalemer Altstadt","context_page_description":"Die Altstadt von Jerusalem erstreckt sich auf einer Fläche von knapp 1 km². Sie ist definiert als das Areal, das von der Stadtmauer Süleymans des Prächtigen aus dem 16. Jahrhundert umschlossen wird. Außerhalb dieser Mauern befinden sich zwei Gebiete, die historisch zur Stadt Jerusalem gehören: der Berg Zion im Südwesten, an dem die Traditionen des Davidsgrabs und des Abendmahlssaals haften, und die sogenannte Davidsstadt im Südosten, ein Felssporn, auf dem sich das Urusalim oder Uruschalimum der mittleren Bronzezeit, beziehungsweise das Jerusalem der Eisenzeit befand. Die durch die Mauern Süleymans definierte Altstadt ist also gegenüber früheren Perioden der Stadtgeschichte ein Stück nordwärts versetzt."},{"page_url":"https://en.wikipedia.org/wiki/Harmanli","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/89/Harmanli-Gurbav_most.jpg","page_title":"Harmanli","context_page_description":"Harmanli is a town in Haskovo Province, south-central Bulgaria. It is the administrative centre of the eponymous Harmanli Municipality. As of December 2009, the town has a population of 19,734 inhabitants.\\nHarmanli was founded 1510 along the road connecting Central Europe and Anatolia."},{"page_url":"https://el.wikipedia.org/wiki/%CE%A0%CE%BF%CF%81%CF%84_%CE%A3%CE%B1%CE%B9%CE%BD-%CE%9D%CF%84%CE%B5%CE%BD%CE%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b4/Porte_Saint-Denis_01.jpg","page_title":"Πορτ Σαιν-Ντενί","context_page_description":"Η Πύλη Σαιν-Ντενί είναι μία θριαμβική αψίδα που βρίσκεται στο 10ο διαμέρισμα του Παρισιού, στη θέση μιας από τις πύλες του Τείχους του Καρόλου Ε', που ήταν ένα από τα παλιά τείχη της πόλης του Παρισιού. Το μνημείο κατασκευάστηκε το 1672 σε ανάμνηση των στρατιωτικών νικών του Λουδοβίκου ΙΔ'.\\nΕίναι ένα από τα πιο αντιπροσωπευτικά μνημεία της τέχνης της εποχής του, που παρουσιάζεται σε όλες τις ανθολογίες."},{"page_url":"https://ro.wikipedia.org/wiki/Sneferu","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e6/GD-EG-Saqqara004.JPG","page_title":"Sneferu","context_page_description":"Sneferu, scris și Snefru sau Snofru, a fost fondatorul celei de a IV-a dinastii, domnind din 2613 î.Hr. până în 2589 î.Hr. Numele său înseamnă in egipteană \\"A face frumos\\". În funcție de ordinea de citire semnelor, numele faraonului se mai putea citi si SFURNU, facilitînd identificarea origini titlului de 'Faraon', indicînd totodata si aria de expertiza a vestitului mînuitor precum Ș·FURN sau Furnal, cel mai probabil indicator al iscusinței in ale metalurgiei. El poate fi lesne asociat cu maistrul \\"Hefaistos\\" sau \\"Vulcan\\".\\nA fost căsătorit cu Hetepheres care se pare că a fost fiica predecesorului său Huni. Conform unelor teorii socrul său e posibil să fi fost și tatăl său"},{"page_url":"https://fr.wikipedia.org/wiki/Gare_d%27Oss%C3%A9ja","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/2e/Estaci%C3%B3_d%27Oceja.jpg","page_title":"Gare d'Osséja","context_page_description":"La gare d'Osséja est une gare ferroviaire française de la ligne de Cerdagne, située sur le territoire de la commune d'Osséja, dans le département des Pyrénées-Orientales en région Occitanie.\\nC'est une halte voyageurs de la Société nationale des chemins de fer français desservie par le Train Jaune, train TER Occitanie spécifique pour la ligne de Cerdagne."},{"page_url":"https://en.wikipedia.org/wiki/United_States_congressional_delegations_from_Indiana","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/57/Trey_hollingsworth.jpg","page_title":"United States congressional delegations from Indiana","context_page_description":"These are tables of congressional delegations from Indiana to the United States House of Representatives and the United States Senate.\\nSince its statehood in 1816, the U.S. state of Indiana has sent congressional delegations to the United States Senate and United States House of Representatives. Each state elects two Senators statewide to serve for six years, and their elections are staggered to be held in two of every three even-numbered years—Indiana's Senate election years are to Classes I and III. Before the Seventeenth Amendment in 1913, Senators were elected by the Indiana General Assembly. Members of the House of Representatives are elected to two-year terms, one from each of Indiana's nine congressional districts. Before becoming a state, the Indiana Territory elected delegates at-large and sent three to Congress, but the territorial delegates were restricted from voting on legislation.\\nThe longest-serving of any of Indiana's Congressmen is Senator Richard Lugar, serving from 1977 to 2013. The longest-serving House member is Lee H. Hamilton, who served from 1965 to 1999."},{"page_url":"https://sv.wikipedia.org/wiki/Br%C3%A4nda_tomten_(restaurang)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/be/Br%C3%A4nda_Tomten%2C_Stureplan%2C_interi%C3%B6r%2C_1950-tal_%281%29.jpg","page_title":"Brända tomten (restaurang)","context_page_description":"Brända tomten var en anrik restaurang vid Stureplan 13–15 på Norrmalm i Stockholm. Restaurangen öppnade 1922 och stängde 1987. Idag finns den asiatiska restaurangen East på platsen."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%A7%D9%84%D8%B1%D8%A7%D9%85%D8%A9_(%D8%B9%D9%83%D8%A7)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9b/Har_Ari_panorama.jpg","page_title":"الرامة (عكا)","context_page_description":"الرامة هي بلدة عربية تقع في الجليل الأعلى شمالي مدينة عكا، وتقع إداريًا في المنطقة الشمالية شمال إسرائيل. وتبعد عنها نحو 25 كم، على سفح جبل حيدر، ويبلغ ارتفاعها عن سطح البحر في أعلى نقطة حوالي 600 مترا عن سطح البحر. تشتهر بلدة الرامة بأشجار الزيتون وبزيتها الصافي، حيث تنتشر حولها كروم الزيتون الذي يعود إلى أكثر من ألفي عام."},{"page_url":"https://en.wikipedia.org/wiki/Battle_of_Empel","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b6/Empel_1585_Braun_%26_Hogenberg.png","page_title":"Battle of Empel","context_page_description":"The Miracle of Empel was an unexpected Spanish victory on 8 December 1585 near Empel, in the Netherlands, as part of the Eighty Years' War, in which a surrounded Spanish force miraculously won against an enemy who exceeded them in number."},{"page_url":"https://id.wikipedia.org/wiki/Daftar_orang_Arab_dan_Timur_Tengah_Amerika_dalam_Kongres_Amerika_Serikat","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/83/Richard_Hanna%2C_Official_Portrait%2C_112th_Congress.jpg","page_title":"Daftar orang Arab dan Timur Tengah Amerika dalam Kongres Amerika Serikat","context_page_description":"Catatan\\nReferensi"},{"page_url":"https://uk.wikipedia.org/wiki/%D0%93%D0%B5%D0%BD%D1%80%D1%96_%D0%90%D0%B9%D1%80%D1%82%D0%BE%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1b/Henry_Ireton.jpg","page_title":"Генрі Айртон","context_page_description":"Ге́нрі А́йртон — діяч англійської буржуазної революції XVII століття, один з організаторів нової армії. Належав до поміркованих індепендентів, мав великий вплив на Олівера Кромвеля."},{"page_url":"https://he.wikipedia.org/wiki/%D7%A0%D7%99%D7%A7%D7%95%D7%93_%D7%94%D7%A2%D7%91%D7%A8%D7%99%D7%AA_%D7%91%D7%AA_%D7%99%D7%9E%D7%99%D7%A0%D7%95","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/80/Hirik.jpg","page_title":"ניקוד העברית בת ימינו","context_page_description":"ניקוד העברית בת ימינו הוא הניקוד המשמש בתמלילים של העברית בת ימינו. הוא מבוסס על הניקוד הטברני שבו מנוקד התנ\\"ך, אבל כלליו פשוטים ואחידים יותר.\\nהניקוד משמש בעברית בת ימינו לשתי מטרות עיקריות: הראשונה – לסייע למי שמתקשה בשפה העברית, כגון ילדים ועולים חדשים; והשנייה – כאשר לכותב המילה יש חשש שהקורא לא יֵדַע לקרוא נכון את המילה, בין אם משום שהמילה אינה מוכרת ובין אם משום שללא ניקוד, המילה נכתבת באופן זהה למילה אחרת. במקרה זה הניקוד יהיה לעיתים קרובות חלקי. בהתאם לכך הניקוד נפוץ בספרי ילדים, בעיתונים שמיועדים לעולים חדשים, וכן בספרי שירה, שבהם הטקסט יכול להיות רב־משמעי."},{"page_url":"https://en.wikipedia.org/wiki/Antelope","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3c/Blue_Duiker_skeleton.jpg","page_title":"Antelope","context_page_description":"The term antelope is used to refer to many species of even-toed ruminant indigenous to various regions in Africa and Eurasia.\\nAntelopes comprise a wastebasket taxon within the family Bovidae, encompassing all Old World ruminants that are not bovines, sheep, or goats. Antelopes are considered the sister group to deer within the infraorder Pecora. A group of antelope is called a herd.\\nUnlike deer antlers, which are shed and grown annually, antelope horns grow continuously."},{"page_url":"https://de.wikipedia.org/wiki/Christian_Scriver","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/ba/Der_lieben_Sonne_Licht_und_Pracht_%28BWV_446%29.jpg","page_title":"Christian Scriver","context_page_description":"Christian Scriver war ein deutscher lutherischer Geistlicher, Erbauungsschriftsteller des frühen Pietismus und Kirchenlieddichter."},{"page_url":"https://cs.wikipedia.org/wiki/Aparan","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/68/Aparan.jpg","page_title":"Aparan","context_page_description":"Aparan je město v provincii Aragacotnu v Arménii. K roku 2011 v něm žilo přes šest tisíc obyvatel."},{"page_url":"https://simple.wikipedia.org/wiki/China","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d2/Chinaimg.png","page_title":"China","context_page_description":"China is a cultural region, an ancient civilization, and a nation in East Asia.\\nThe last Chinese Civil War resulted in two different political powers today:\\nThe Republic of China, commonly known as China since 1 Jan.,1911 to 25 Oct.,1971. Now commonly known as Taiwan, has controlled over the islands of Taiwan, Penghu, Kinmen, and Matsu.\\nThe People's Republic of China, commonly known as China, has control over mainland China and the largely self-governing territories of Hong Kong and Macau.\\nChina is one of the world's oldest civilizations: it has the oldest continuous civilization. There is archaeological evidence over 5,000 years old. China also has one of the world's oldest writing systems. China has been the source of many major inventions."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%AF%D9%8A%D9%81%D9%8A%D8%AF_%D8%B1%D9%8A%D9%81%D9%8A%D8%B1%D8%A7","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/28/David_Rivera%2C_Official_Portrait%2C_112th_Congress.jpg","page_title":"ديفيد ريفيرا","context_page_description":"ديفيد ريفيرا ‏ هو سياسي أمريكي، ولد في 16 سبتمبر 1965 ببروكلين في الولايات المتحدة. حزبياً، نشط في الحزب الجمهوري."},{"page_url":"https://pt.wikipedia.org/wiki/Hist%C3%B3ria_da_arte","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4c/Ecstasy_St_Theresa_SM_della_Vittoria.jpg","page_title":"História da arte","context_page_description":"História da arte é a história de qualquer atividade ou produto realizado com propósito estético ou comunicativo, enquanto expressão de ideias, emoções ou formas de ver o mundo. Ao longo do tempo, as artes visuais têm sido classificadas de várias formas diferentes, desde a distinção medieval entre as artes liberais e as artes mecânicas, até à distinção moderna entre belas artes e artes aplicadas, ou às várias definições contemporâneas, que definem arte como a manifestação da criatividade humana. O alargamento da lista das principais artes durante o século XX definiu nove: arquitetura, dança, escultura, música, pintura, poesia, o cinema, a fotografia e a banda desenhada. Quando considerada a sobreposição de termos entre as artes plásticas e as artes visuais, inclui-se também o design e as artes gráficas. Para além das formas tradicionais de expressão artística, como a moda ou a gastronomia, estão a ser considerados como arte novos meios de expressão, como o vídeo, arte digital, performance, a publicidade, a animação, a televisão e os jogos de computador."},{"page_url":"https://fi.wikipedia.org/wiki/Loona","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/7c/Loona_Westside_Bern_2009_-_07.jpg","page_title":"Loona","context_page_description":"Marie-Jose van der Kolk, tunnetaan myös nimillä Loona ja Carisma on hollantilainen pop-laulaja.\\nMarie aloitti uransa DJ Sammyn kanssa duona. He esiintyivät yhdessä nimellä DJ Sammy featuring Carisma. Ensimmäisen hittinsä \\"Life is Just a Game\\", he julkaisivat vuonna 1996. Kappaletta seurasivat singlet \\"You Are My Angel\\", \\"Prince of Love\\" ja \\"Golden Child\\". Kaikki nämä kappaleet julkaistiin heidän debyyttialbumillaan Life Is Just A Game.\\nKesällä 1998 Marie aloitti uuden projektin nimeltä Loona, jonka tuottajana toimi DJ Sammy. Ensimmäinen single oli cover Paradision kappaleesta \\"Bailando\\", ja siitä tuli kesähitti Saksassa, saavuttaen singlelistan ykkössijan. Syksyllä kappaletta seurasi single \\"Hijo de la Luna\\", joka oli myös singlelistan ykkösenä Saksassa. Vuonna 1999 hän julkaisi ensimmäisen studioalbuminsa, nimeltään Lunita, joka oli kokonaan espanjankielinen."},{"page_url":"https://ka.wikipedia.org/wiki/%E1%83%91%E1%83%90%E1%83%A0%E1%83%91%E1%83%90%E1%83%A0%E1%83%90_%E1%83%98%E1%83%90%E1%83%92%E1%83%94%E1%83%9A%E1%83%9D%E1%83%9C%E1%83%98","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d5/Lucas_Cranach_d.%C3%84._-_Bildnis_Barbara_von_Sachsen_%28Gem%C3%A4ldegalerie%2C_Berlin%29.jpg","page_title":"ბარბარა იაგელონი","context_page_description":"ბარბარა იაგელონი — იაგელონთა დინასტიის წარმომადგენელი. პოლონეთის მეფე კაზიმირ IV-ისა და დედოფალ ელიზაბეთ ავსტრიელის ასული. საქსონიისა და მეიზენის ჰერცოგინია 1500-34 წლებში როგორც გეორგ საქსონელის მეუღლე."},{"page_url":"https://en.wikipedia.org/wiki/Anne_Hutchinson","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e9/Stephen_A_Douglas_-_headshot.jpg","page_title":"Anne Hutchinson","context_page_description":"Anne Hutchinson was a Puritan spiritual advisor, religious reformer, and an important participant in the Antinomian Controversy which shook the infant Massachusetts Bay Colony from 1636 to 1638. Her strong religious convictions were at odds with the established Puritan clergy in the Boston area and her popularity and charisma helped create a theological schism that threatened to destroy the Puritans' religious community in New England. She was eventually tried and convicted, then banished from the colony with many of her supporters.\\nHutchinson was born in Alford, Lincolnshire, England, the daughter of Francis Marbury, an Anglican cleric and school teacher who gave her a far better education than most other girls received. She lived in London as a young adult, and there married a friend from home, William Hutchinson. The couple moved back to Alford where they began following preacher John Cotton in the nearby port of Boston, Lincolnshire. Cotton was compelled to emigrate in 1633, and the Hutchinsons followed a year later with their 11 children and soon became well established in the growing settlement of Boston in New England."},{"page_url":"https://es.wikipedia.org/wiki/Margaret_Bondfield","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2b/Ruskin_College_Academic_building.jpg","page_title":"Margaret Bondfield","context_page_description":"Margaret Grace Bondfield CH PC fue una política laborista británica, sindicalista y activista de los derechos de la mujer. Se convirtió en la primera mujer ministra del gabinete, y la primera mujer en ser consejera privada en el Reino Unido, cuando fue nombrada ministra de Trabajo en el gobierno laborista de 1929-31. Anteriormente se había convertido en la primera mujer en presidir el Consejo General del Congreso de Sindicatos.\\nBondfield nació en circunstancias humildes y recibió una educación formal limitada. Después de servir como aprendiz de bordadora, trabajó como asistente de tienda en Brighton y Londres. Se sorprendió por las condiciones de trabajo del personal de la tienda, particularmente dentro del sistema de «vivir en», y se convirtió en miembro activo del sindicato de trabajadores de la tienda. Comenzó a moverse en círculos socialistas, y en 1898 fue nombrada secretaria adjunta de la National Amalgamated Union of Shop Assistants, Warehousemen and Clerks. Más tarde, se destacó en varios movimientos socialistas de mujeres: ayudó a fundar la Liga de Mujeres Laboristas en 1906 y fue presidenta de la Sociedad del Sufragio de Adultos."},{"page_url":"https://hi.wikipedia.org/wiki/%E0%A4%AD%E0%A4%BE%E0%A4%B0%E0%A4%A4_%E0%A4%AE%E0%A5%87%E0%A4%82_%E0%A4%AA%E0%A4%B0%E0%A5%8D%E0%A4%AF%E0%A4%9F%E0%A4%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5f/Auroville_puducherry.jpg","page_title":"भारत में पर्यटन","context_page_description":"भारत में पर्यटन सबसे बड़ा सेवा उद्योग है, जहां इसका राष्ट्रीय सकल घरेलू उत्पाद में 6.23% और भारत के कुल रोज़गार में 8.78% योगदान है। भारत में वार्षिक तौर पर ५० लाख विदेशी पर्यटकों का आगमन और ५६.२ करोड़ घरेलू पर्यटकों द्वारा भ्रमण परिलक्षित होता है। 2008 में भारत के पर्यटन उद्योग ने लगभग US$100 बिलियन जनित किया और 2018 तक 9.4% की वार्षिक वृद्धि दर के साथ, इसके US$275.5 बिलियन तक बढ़ने की उम्मीद है।\\nभारत में पर्यटन के विकास और उसे बढ़ावा देने के लिए पर्यटन मंत्रालय नोडल एजेंसी है और \\"अतुल्य भारत\\" अभियान की देख-रेख करता है।\\nविश्व यात्रा और पर्यटन परिषद के अनुसार, भारत, सर्वाधिक 10 वर्षीय विकास क्षमता के साथ, 2009-2018 से पर्यटन का आकर्षण केंद्र बन जाएगा. यात्रा एवं पर्यटन प्रतिस्पर्धा रिपोर्ट 2007 ने भारत में पर्यटन को प्रतियोगी क़ीमतों के संदर्भ में 6वां तथा सुरक्षा व निरापदता की दृष्टि से 39वां दर्जा दिया है। होटल के कमरों की कमी के रूप में, लघु और मध्यमावधि रुकावट के बावजूद, 2007 से 2017 तक पर्यटन राजस्व में 42% उछाल की उम्मीद है।\\nभारत में विकासशील चिकित्सा पर्यटन क्षेत्र मौजूद है।\\nनिस्संदेह, इस महान देश की सांस्कृतिक समृद्धि और परिदृश्य सुंदरता इसे एक ऐसा गंतव्य बनाती है जिसे जीवन में कभी न कभी अवश्य जाना चाहिए।"},{"page_url":"https://vec.wikipedia.org/wiki/Chavagne","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/17/Mairie_de_Chavagne.jpg","page_title":"Chavagne","context_page_description":"Chavagne el xé on comun de 4 015 abitanti del departemento de Ille-et-Vilaine che el fa parte del rejon Bretagna in Fransa."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkm%C3%A4ler_in_Paderborn-Schlo%C3%9F_Neuhaus","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/Schlo%C3%9F_Neuhaus_-_Rochus-Kapelle.jpg","page_title":"Liste der Baudenkmäler in Paderborn-Schloß Neuhaus","context_page_description":"Die Liste der Baudenkmäler in Paderborn-Schloß Neuhaus enthält die denkmalgeschützten Bauwerke auf dem Gebiet von Paderborn-Schloß Neuhaus in Nordrhein-Westfalen. Diese Baudenkmäler sind in der Denkmalliste der Stadt Paderborn eingetragen; Grundlage für die Aufnahme ist das Denkmalschutzgesetz Nordrhein-Westfalen."},{"page_url":"https://hi.wikipedia.org/wiki/%E0%A4%AE%E0%A4%82%E0%A4%97%E0%A4%B2%E0%A4%AF%E0%A4%BE%E0%A4%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/05/Mars_Orbiter_Mission_ISRO_English.svg","page_title":"मंगलयान","context_page_description":"मंगलयान, भारत का प्रथम मंगल अभियान है। यह भारत की प्रथम ग्रहों के बीच का मिशन है। वस्तुत: यह भारतीय अंतरिक्ष अनुसंधान संगठन की एक महत्वाकांक्षी अन्तरिक्ष परियोजना है। इस परियोजना के अन्तर्गत 5 नवम्बर 2013 को 2 बजकर 38 मिनट पर मंगल ग्रह की परिक्रमा करने हेतु छोड़ा गया एक उपग्रह आंध्र प्रदेश के श्रीहरिकोटा स्थित सतीश धवन अंतरिक्ष केंद्र से ध्रुवीय उपग्रह प्रक्षेपण यान सी-25 के द्वारा सफलतापूर्वक छोड़ा गया।\\nइसके साथ ही भारत भी अब उन देशों में शामिल हो गया है जिन्होंने मंगल पर अपने यान भेजे हैं। वैसे अब तक मंगल को जानने के लिये शुरू किये गये दो तिहाई अभियान असफल भी रहे हैं परन्तु 24 सितंबर 2014 को मंगल पर पहुँचने के साथ ही भारत विश्व में अपने प्रथम प्रयास में ही सफल होने वाला पहला देश तथा सोवियत रूस, नासा और यूरोपीय अंतरिक्ष एजेंसी के बाद दुनिया का चौथा देश बन गया है। इसके अतिरिक्त ये मंगल पर भेजा गया सबसे सस्ता मिशन भी है। भारत एशिया का भी ऐसा करने वाला प्रथम पहला देश बन गया। क्योंकि इससे पहले चीन और जापान अपने मंगल अभियान में असफल रहे थे।\\nवस्तुतः यह एक प्रौद्योगिकी प्रदर्शन परियोजना है जिसका लक्ष्य अन्तरग्रहीय अन्तरिक्ष मिशनों के लिये आवश्यक डिजाइन, नियोजन, प्रबन्धन तथा क्रियान्वयन का विकास करना है।"},{"page_url":"https://eo.wikipedia.org/wiki/Nov%C3%A9_Dvory_(Mo%C4%8Derady)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/26/Mo%C4%8Derady%2C_Nov%C3%A9_Dvory%2C_house_No._8.jpg","page_title":"Nové Dvory (Močerady)","context_page_description":"Nové Dvory estas vilaĝo en Ĉeĥio, parto de municipo Močerady, en distrikto Domažlice. Ĝi troviĝas proksimume 1 km oriente de Močerady. Estas ĉi tie registritaj 13 adresoj. En la jaro 2011 ĉi tie daŭre vivis naŭ loĝantoj.\\nNové Dvory situas en katastra teritorio Nové Dvory u Močerad kun areo 2,2 km ²."},{"page_url":"https://en.wikipedia.org/wiki/Structural_Awards","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/ff/Crystal_Bridges_Museum_of_American_Art--2012-04-12.jpg","page_title":"Structural Awards","context_page_description":"The Institution of Structural Engineers' Structural Awards have been awarded for the structural design of buildings and infrastructure since 1968. The awards were re-organised in 2006 to include ten categories and the Supreme Award for structural engineering excellence, the highest award a structural project can win.\\nThe David Alsop Sustainability Award, in memory of David Alsop, who died on 18 October 1996 while a vice president and president elect of the Institution of Structural Engineers, is made for \\"an outstanding structure which demonstrates excellent coordination of all aspects of the engineering elements and services combined with elegance, life-time economy and respect for the environment in which the structure is built.\\" It was first awarded in 2000."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%AD%E3%83%B3%E3%83%89%E3%83%B3%E5%9C%B0%E4%B8%8B%E9%89%841973%E5%BD%A2%E9%9B%BB%E8%BB%8A","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/76/1973_stock_Manufactures_name_plate.JPG","page_title":"ロンドン地下鉄1973形電車","context_page_description":"ロンドン地下鉄1973形電車は1975年7月19日に営業運転を開始したロンドン地下鉄ピカデリー線用の電車。ロンドン地下鉄の2種類ある車両サイズのうち、小さいほうのサイズの車両群に属する。"},{"page_url":"https://sk.wikipedia.org/wiki/Kambrick%C3%A1_expl%C3%B3zia","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/24/Radiodonta.PNG","page_title":"Kambrická explózia","context_page_description":"Kambrická explózia je označenie rapídneho rozšírenia rozmanitých a komplexných mnohobunkových živočíchov v období kambria. To sa udialo približne pred 530 miliónmi rokov. Dôkazom tohto rozšírenia sú nálezy veľkého množstva fosílií dovtedy nevyskytujúcich sa typov živočíchov na mnohých miestach sveta. Sú to napríklad červy, ramenonožce, mäkkýše, článkonožce, ostnatokožce a dokonca aj najstaršie stavovce. Veľký počet známych živočíšnych kmeňov má svojich prvých reprezentantov už v kambrických vrstvách, pričom niektoré z nich neskôr úplne vyhynuli.\\nObjavili sa živočíchy, ktoré sa dokázali voľne pohybovať, vyvinuli si oči, zuby a exoskelet. Najznámejšími živočíchmi z tohto obdobia sú trilobity, rané článkonožce podobne ako Marrella. Objavili sa druhy ako Pikaia – raný chordát a hojne sa vyskytovali červy ako napr. mnohoštetinatec Canadia a Ottoia. Medzi ďalšie rody patria Hallucigenia a Aysheia podobajúce sa na dnešné stonôžky. Najväčším predátorom bol rod Anomalocaris. Objavili sa „prvé ryby“ ako napr. Myllokunmingia a Haikouichthys."},{"page_url":"https://fr.wikipedia.org/wiki/Microbiote_intestinal_humain","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3f/Microbiota_roles.png","page_title":"Microbiote intestinal humain","context_page_description":"Le microbiote intestinal humain, anciennement appelé flore intestinale humaine, est l'ensemble des micro-organismes du tractus digestif humain, c'est-à-dire le microbiome intestinal et de tout le système gastro-intestinal. Il constitue le plus grand réservoir du microbiote de l'organisme humain et un réservoir d’activités enzymatiques essentiel pour la digestion et la physiologie humaines. À ce titre, il influe sur la santé.\\nCe microbiote et son hôte humain sont un exemple de symbiose mutualiste et de commensalisme. Il peut réguler l’expression de certains gènes de l'hôte, ce qui fait évoquer des relations symbiotiques avancées.\\nChez un individu en bonne santé, l'activité métabolique de ce microbiote en fait l'équivalent d'un organe à part entière dans la physiologie humaine. Il est impliqué dans la maturation du système immunitaire de l'hôte et la maturation de son épithélium intestinal. Il intervient dans de nombreuses voies métaboliques fondamentales comme la fermentation des sucres et des protéines ainsi que le métabolisme des acides biliaires et des xénobiotiques."},{"page_url":"https://it.wikipedia.org/wiki/P%C3%A2t%C3%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6c/Terrine_de_saumon_p1040323.jpg","page_title":"Pâté","context_page_description":"Il pâté, francesismo, adattato come patè, e detto a volte anche pasticcio, è un impasto di carne o pesce tritati e grassi alimentari ridotti al mortaio, in un composto di pasta spalmabile. Il pâté classico francese si chiama foie gras; ne è stata limitata la vendita. Esistono anche patè a base di vegetali."},{"page_url":"https://de.wikipedia.org/wiki/Tempel_Somnath","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/75/Somnath_temple-View2.jpg","page_title":"Tempel Somnath","context_page_description":"Der Tempel Somnath in dem gleichnamigen Ort nahe Veraval in Saurashtra, an der Westküste von Gujarat, Indien, gilt als der heiligste der zwölf Jyotirlinga-Schreine des Gottes Shiva. Somnath heißt: „Schützer des Mondgottes“. Der Tempel wurde sechs Mal zerstört und ebenso oft wieder errichtet, zuletzt 1950 bis 1953 nach Erlangung der indischen Unabhängigkeit."},{"page_url":"https://fr.wikipedia.org/wiki/Imsouane","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9d/Imsouane-vue_du_village-avoulot.jpg","page_title":"Imsouane","context_page_description":"Immesouane, ou Imsouane, est une commune rurale de la préfecture d'Agadir Ida-Outanane, dans la région de Souss-Massa, au Maroc. Elle ne dispose pas de centre urbain mais son chef-lieu est un village du même nom."},{"page_url":"https://ja.wikipedia.org/wiki/%E6%B8%85%E6%B0%B4%E7%BE%8E%E5%92%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/16/Shimizuyoshikazu.jpg","page_title":"清水美和","context_page_description":"清水 美和は、日本のジャーナリスト。東京新聞・中日新聞論説主幹。愛知県名古屋市出身。"},{"page_url":"https://bs.wikipedia.org/wiki/Zapadnopomeransko_vojvodstvo","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/26/09_Police_ZPL.jpg","page_title":"Zapadnopomeransko vojvodstvo","context_page_description":"Zapadnopomeransko vojvodstvo je vojvodstvo u zapadnom dijelu Poljske. Vojvodstvo je osnovano 1. januara 1999. godine od bivših vojvodstva Szczecin i Koszalin i dijelova susjednih vojvodstva.\\nSredište vojvodstva je grad Szczecin sa 408.105 stanovnika.\\nVojvodstvo se prostire na 22.892 km² a prema podacima iz 2014. godine živjelo je 1.715.431 stanovnika."},{"page_url":"https://hu.wikipedia.org/wiki/Erdei_pacsirta","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4a/Lullula_arborea_distribution_map.png","page_title":"Erdei pacsirta","context_page_description":"Az erdei pacsirta a madarak osztályának verébalakúak rendjébe és a pacsirtafélék családjába tartozó Lullula nem egyetlen faja."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%A0%D1%8F%D1%85%D0%BE%D0%B2%D0%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/60/BASA-3K-14-158-2-Ryahovo.jpeg","page_title":"Ряхово","context_page_description":"Ря̀хово е село в Северна България. То се намира в община Сливо поле, област Русе."},{"page_url":"https://si.wikipedia.org/wiki/%E0%B6%9A%E0%B6%BA%E0%B7%92%E0%B6%A7%E0%B7%8A%E0%B7%83%E0%B7%8A","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/89/St._James_Church%2C_Kayts.jpg","page_title":"කයිට්ස්","context_page_description":"කයිට්ස් යනු, උතුරු ශ්‍රී ලංකාවෙහි, යාපනය අර්ධද්වීපයෙහි, වෙරළ අසබඩ පිහිටි කුඩා දිවයිනක් වන, වේලනෙයි දිවයිනෙහි පිහිටි වැදගත් ගම්මාන අතරින් එකකි. අල්ලෙයිපිඩ්ඩි, මාන්කුම්පන්, වේලනෙයි, සරවනෙයි, පුලියන්කූඩල්, සුරුවිල්, නරන්තනෙයි සහ කරම්පන් වැනි වෙනත් ගම්මාන ගණනක්ද වේලනෙයි දිවයින් තුල පිහිටා ඇත.\\nජනතාවගෙන් බහුතරය හින්දු භක්තිකයන් වන අතර, සුළුතරයක් දෙනා, මුස්ලිම් සහ ක්‍රිස්තියානි භක්තිකයෝ වෙති. හින්දු දේවාල ගණනාවක් මෙන්ම, ක්‍රිස්තියානි දේවස්ථානයක් සහ මුස්ලිම් පල්ලියක්ද මෙහි ඇත. පාසල් දුසිමක් පමණ දිවයින තුල අධ්‍යාපනය සැපයීමට දායක වෙයි.මෙහි ප්‍රධාන පිවිසුම් මාර්ග ලෙස පංකුඩුතිව් පිවිසුම, කරම්පන් ජැටිය, පෙන්වා දිය හැක\\n1983 වසරෙහිදී සිට, අලෙයිපිඩ්ඩි සංහාරය ඇතුළු, ශ්‍රී ලාංකික සිවිල් යුද්ධයේ කොටසක් වශයෙන් ඇතිවූ ප්‍රචණ්ඩත්වය කයිට්ස් දිවයින තුල දක්නට ලැබුණි."},{"page_url":"https://id.wikipedia.org/wiki/Demetrias","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f6/Thessaly.jpg","page_title":"Demetrias","context_page_description":"Demetrias adalah sebuah kota Yunani di Magnesia, Thessaly kuno. Kota tersebut terletak di hulu Teluk Pagasaean, dekat kota modern Volos."},{"page_url":"https://pt.wikipedia.org/wiki/IBM_601","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/91/IBM_601_-_MfK_Bern.jpg","page_title":"IBM 601","context_page_description":"A IBM dispunha de uma faixa de registadoras de cartões perfurados capazes de somar e subtrair números. A IBM 601 Multiplying Punch foi uma máquina registadora mecânica que se apresentou em 1931 e era a primeira máquina comercial da IBM que poderia realizar uma multiplicação. Poderia ler dois números escritos num único cartão perfurado e mostrar o seu produto perfurando o resultado num espaço reservado no mesmo cartão. Os números poderiam ser de até oito dígitos decimais.\\nEm 1933 entregou-se ao laboratório de Wallace Eckert um modelo especial \\"capaz de fazer a interpolação directa, uma característica muito incomum, desenhada especialmente para Eckert por um dos engenheiros superiores de IBM em Endicott [NY]\\". W. J. Eckert ligou a 601 modificada a uma tabuladora 285 e uma duplicadora de cartões perfurados 016 através de uns interruptores manipuláveis de seu próprio desenho, formando a primeira máquina capaz de realizar cálculos científicos complexos automaticamente."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%90%D0%BB%D0%B8%D1%81%D0%B0_%D0%BD%D0%B0_%D0%BC%D0%BE%D1%80%D0%B5_(%D1%84%D0%B8%D0%BB%D1%8C%D0%BC,_1924)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/19/Alicesdayatsea1.jpg","page_title":"Алиса на море (фильм, 1924)","context_page_description":"«Али́са на мóре» — короткометражный чёрно-белый немой фильм Уолта Диснея, выпущенный 1 марта 1924 года. Вторая серия «Комедий Алисы»."},{"page_url":"https://it.wikipedia.org/wiki/Neritopsidae","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/NMR993000052179A.jpg","page_title":"Neritopsidae","context_page_description":"Neritopsidae Gray, 1847 è una famiglia di molluschi gasteropodi della sottoclasse Neritimorpha."},{"page_url":"https://eo.wikipedia.org/wiki/Piedsigno","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b1/I_piedi_del_quo_vadis.jpg","page_title":"Piedsigno","context_page_description":"Piedsigno estas signo postlasita de piedo de homo aŭ alia besto sur la tero. Ĝi konsistas aŭ el premo de malmola objekto lasita en pli mola grundo aŭ en forlaso sur la grundo de io, kio gluis al la plandumo.\\nOni povas ankaŭ paroli laŭkaze pri ŝusignoj aŭ hufsignoj.\\nOni povas sekvi piedsignojn, ekzemple dum ĉasado aŭ danke al ili evidentigi agadojn.\\nKelkaj piedsignoj restis neklarigitaj kun famaj historioj mitaj aŭ legendaj. Aliaj atestis pri prahistoria vivo aŭ vivmaniero."},{"page_url":"https://ca.wikipedia.org/wiki/Adina_Masjid","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3c/Adina_Mosque_at_Malda_district_of_West_Bengal_08.jpg","page_title":"Adina Masjid","context_page_description":"Adina Masjid és una mesquita en ruïnes de la ciutat de Pandua, al districte de Malda a Bengala occidental. Es considera que és la tomba de Jalal-ad-Din fill del rei hindú Ghanesh, convertit a l'islam. Està propera a la Qutb Xahid Màsjid i la dargah de Nur Qutb Alam. A les parets exteriors hi ha nínxols i estàtues d'elaboració delicada i pilars als quatre cantons. La tomba és octogonal amb arcs a cada costat; es conserven els tres mausoleus, del rei, la reina i un fill. Fou construïda entre 1364 i 1374."},{"page_url":"https://ta.wikipedia.org/wiki/%E0%AE%8F%E0%AE%B0%E0%AF%8D%E0%AE%AA%E0%AF%81%E0%AE%B3%E0%AF%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2b/AirBlueA320Karachi00128.JPG","page_title":"ஏர்புளூ","context_page_description":"ஏர்புளூ எனப் பொதுவாக அழைக்கப்படும் ஏர்புளூ லிமிடெட் நிறுவனம், ஒரு தனியார் விமானச்சேவையாகும். இதன் தலைமையகம் பாகிஸ்தானின் இஸ்லமாபாத்தில் அமைந்துள்ளது. இஸ்லமாபாத், லாகூர், கராச்சி மற்றும் பெஷாவர் போன்ற உள்ளூர் விமான நிலையங்களுடன், சர்வதேச விமானநிலையங்களான துபாய், அபுதாபி, சார்ஜா மற்றும் மஸ்கட் போன்ற நாடுகளை இணைப்பதில் இந்த விமானச்சேவை முக்கியப்பங்கு வகிக்கிறது. இதன் முக்கியத் தலைமையிடமாக கராச்சியில் உள்ள ஜின்னாஹ் சர்வதேச விமான நிலையம் செயல்படுகிறது."},{"page_url":"https://hr.wikipedia.org/wiki/Temerin","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/Temerin1.jpg","page_title":"Temerin","context_page_description":"Temerin je grad i središte istoimene općine u Južnobačkom okrugu u Vojvodini."},{"page_url":"https://arz.wikipedia.org/wiki/%D8%A7%D9%84%D9%8A%D9%86%D8%A7_%D8%A8%D8%A7%D9%83%D8%A7%D9%84%D9%88%D8%AC%D9%84%D9%88","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/de/Helene_Bacaloglu_1914.jpg","page_title":"الينا باكالوجلو","context_page_description":"الصفحه دى يتيمه, حاول تضيفلها لينك فى صفحات تانيه متعلقه بيها.\\nالينا باكالوجلو كانت صحفيه من رومانيا."},{"page_url":"https://en.wikipedia.org/wiki/Fairy_lorikeet","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/TrichoglossusPulchellusKeulemans.jpg","page_title":"Fairy lorikeet","context_page_description":"The fairy lorikeet is a species of parrot in the family Psittaculidae. Other common names include the little red lorikeet and the little red lory. Found in New Guinea, its natural habitats are subtropical or tropical moist lowland forests and subtropical or tropical moist montane forests. Its colouration is mainly red with some yellow on the throat and green on the wings. Two subspecies are recognised, C. p. pulchella and C. p. rothschildi."},{"page_url":"https://hy.wikipedia.org/wiki/%D4%B5%D5%BE%D5%A3%D5%A5%D5%B6%D5%B5%D5%A1_%D5%95%D5%AC%D5%A5%D5%B6%D5%BD%D5%AF%D5%A1%D5%B5%D5%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5d/Yeva_Olenskaya.png","page_title":"Եվգենյա Օլենսկայա","context_page_description":"Եվգենյա Նիկիտիչնա Օլենսկայա, խորհրդային ադրբեջանցի դերասանուհի, Աշխատանքի հերոս, Ադրբեջանական ԽՍՀ ժողովրդական արտիստ ։"},{"page_url":"https://fr.wikipedia.org/wiki/Sinojackia_xylocarpa","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6e/Sinojackia_xylocarpa_port.jpg","page_title":"Sinojackia xylocarpa","context_page_description":"Sinojackia xylocarpa est un arbuste de la famille des Styracacées, originaire et endémique de Chine.\\nNom chinois : 秤锤树"},{"page_url":"https://el.wikipedia.org/wiki/%CE%A3%CF%84%CF%81%CE%B1%CF%84%CF%8C%CF%82_%CF%84%CE%B7%CF%82_%CE%9A%CE%B9%CF%81%CE%B3%CE%B9%CE%B6%CE%AF%CE%B1%CF%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b4/Patch_of_Kyrgyz_Armed_Forces.svg","page_title":"Στρατός της Κιργιζίας","context_page_description":"Οι Χερσαίες Δυνάμεις της Κιργιζίας, επίσης γνωστό ως η Στρατός της Κιργιζίας είναι ο κλάδος πεζικού των Ενόπλων Δυνάμεων της Δημοκρατίας της Κιργιζίας. Ο σημερινός διοικητής του Κιργιζικού Στρατού είναι ο Συνταγματάρχης Νουρλάν Κιρεσέγιεφ."},{"page_url":"https://cy.wikipedia.org/wiki/Rhestr_o_Safleoedd_Treftadaeth_y_Byd_yn_Sbaen","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cf/Dom%C3%A8nech.i.Montaner.Palau.Musica.Catalana.8.Barcelona.JPG","page_title":"Rhestr o Safleoedd Treftadaeth y Byd yn Sbaen","context_page_description":"Y Pyreneau: Mont Perdu — rhennir gyda Ffrainc"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%AD%D1%81%D0%BF%D0%B5%D0%BB%D1%83%D0%B9","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/39/Almac%C3%A9n_regulador_de_la_estaci%C3%B3n_de_espeluy.JPG","page_title":"Эспелуй","context_page_description":"Эспелуй — муниципалитет в Испании, входит в провинцию Хаэн в составе автономного сообщества Андалусия. Муниципалитет находится в составе района Кампиния-де-Хаэн. Занимает площадь 25,63 км². Население — 753 человека. Расстояние — 34 км до административного центра провинции."},{"page_url":"https://he.wikipedia.org/wiki/%D7%A7%D7%A8%D7%9C%D7%95%D7%9E%D7%9F_%D7%94%D7%A8%D7%90%D7%A9%D7%95%D7%9F,_%D7%9E%D7%9C%D7%9A_%D7%A6%D7%A8%D7%A4%D7%AA","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/88/Denier_sous_Carloman_Ier.jpg","page_title":"קרלומן הראשון, מלך צרפת","context_page_description":"קרלומן היה מלך צרפת מ-768 עד 771. הוא היה בנו של פפין השלישי.\\nיחד עם אחיו, קרל, קרלומן נמשח למלך על ידי האפיפיור סטפנוס השני ב-754. אחרי מותו של פפין ב-768, קרלומן וקרל חילקו את הממלכה ביניהם, כאשר קרלומן מלך בחלק המזרחי, אוסטרזיה. בין האחים שרר מתח ניכר, וייתכן שזו הייתה הסיבה לכך, שאחרי מותו של קרלומן, אשתו גרברז' ברחה עם בניו לארמונו של דסידריוס, המלך האחרון של הממלכה הלומברדית. מפני שחלק מהמקורות מציינים כי דסידריוס היה בכלל אביה של גרברז', קשה לשפוט את טיב המתח בין האחים. סיפורים אחרים טוענים כי קרל הגדול נדהם מבריחתה של גרברז' ולא הבין למה עשתה זאת. בעת מותו של קרלומן, ממלכתו סופחה לזו של אחיו, שחילק חלקים ממנה לבניו."},{"page_url":"https://it.wikipedia.org/wiki/Adin_Vrabac","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/BCL_KK_Partizan_-_Szolnoki_Olaj_KK_%282%29.jpg","page_title":"Adin Vrabac","context_page_description":"Adin Vrabac è un cestista bosniaco con cittadinanza serba."},{"page_url":"https://en.wikipedia.org/wiki/Structuralism_(architecture)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a7/Stgo_Abril.jpg","page_title":"Structuralism (architecture)","context_page_description":"Structuralism is a movement in architecture and urban planning evolved around the middle of the 20th century. It was a reaction to Rationalism's perceived lifeless expression of urban planning that ignored the identity of the inhabitants and urban forms.\\nStructuralism in a general sense is a mode of thought of the 20th century, which originated in linguistics. Other disciplines like anthropology, psychology, economy, philosophy and also art took on structuralist ideas and developed them further. An important role in the development of structuralism played Russian Formalism, also the School of Prague. Roland Barthes, a key figure of structuralist thought, argued that there was no complete structuralist philosophy but only a structuralist method.\\nDutch architects of structuralism did studies in a similar way as Claude Lévi-Strauss and were interested in the principle \\"langue et parole\\" by Ferdinand de Saussure, especially for the theme participation."},{"page_url":"https://en.wikipedia.org/wiki/Treetops_Hotel","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4e/Treetops_Plaque.jpg","page_title":"Treetops Hotel","context_page_description":"Treetops Hotel is a hotel in Aberdare National Park in Kenya near the township of Nyeri, 1,966 m above sea level on the Aberdare Range and in sight of Mount Kenya. First opened in 1932 by Eric Sherbrooke Walker, it was built into the tops of the trees of Aberdare National Park as a treehouse, offering the guests a close view of the local wildlife. The idea was to provide a machan experience in relative safety and comfort. From the original modest two-room tree house, it has grown into a 35-room hotel. The original structure was burned down by African guerrillas during the 1954 Mau Mau Uprising, but the hotel was rebuilt near the same waterhole and has become fashionable for many of the rich and famous. It includes observation lounges and ground-level photographic hides from which guests can observe the local wildlife which comes to the nearby waterholes.\\nThe hotel is the location where Princess Elizabeth was staying in 1952 when she acceded to the thrones of the United Kingdom, and the other Commonwealth realms, upon the death of her father, King George VI."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Stolpersteine_in_Bremen","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/41/Stolperstein_HB_veen_goldine.jpg","page_title":"Liste der Stolpersteine in Bremen","context_page_description":"Die Liste der Stolpersteine in Bremen gibt eine Übersicht über die vom Künstler Gunter Demnig verlegten Stolpersteine in der Stadt Bremen. Grundlage dieser Liste sind die von einem Kooperationsprojekt der Landeszentrale für politische Bildung Bremen und dem Bremer Verein Erinnern für die Zukunft e. V. veröffentlichten Daten.\\nDie 10 × 10 × 10 cm großen Betonquader mit Messingtafel sind in den Bürgersteig vor jenen Häusern eingelassen, in denen die Opfer einmal zu Hause waren. Die Inschrift der Tafel gibt Auskunft über ihren Namen, ihr Alter und ihr Schicksal. Die Stolpersteine sollen dem Vergessen der Opfer der nationalsozialistischen Gewaltherrschaft entgegenwirken. 2007 wurde auch für Graf von Sponeck vor seiner ehemaligen Dienstwohnung in Bremen Horn-Lehe ein Stolperstein verlegt. Nach der Entscheidung, den Stein zu entfernen, wurde er von Unbekannten entwendet.\\nSeit 2004 wurden in Bremen 664 Stolpersteine verlegt, ab 2005 auch von Berufsschülern des Schulzentrums an der Alwin-Lonke-Straße.\\nSiehe auch Liste der Stolpersteine in Bremerhaven"},{"page_url":"https://simple.wikipedia.org/wiki/St._Anthony-Chapel","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9a/Antoniuskapelle_in_Kornelim%C3%BCnster.JPG","page_title":"St. Anthony-Chapel","context_page_description":"The St. Anthony-Chapel is a chapel in the district Kornelimünster of the German city of Aachen.\\nIt was built in 1718 but destroyed by an earthquake a short time later. The abbot of the abbey at Kornelimünster ordered to rebuild the damaged building. It was completed in 1781.\\nThe St. Anthony-Chapel belongs to a group of five chapels of Kornelimünster."},{"page_url":"https://en.wikipedia.org/wiki/Prince_of_Wales%27s_Leinster_Regiment_(Royal_Canadians)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/78/St_Peters_Plaque_Leinster_1888.jpg","page_title":"Prince of Wales's Leinster Regiment (Royal Canadians)","context_page_description":"The Prince of Wales's Leinster Regiment (Royal Canadians) was an infantry regiment of the line in the British Army, formed in 1881 by the amalgamation of the 100th Regiment of Foot and the 109th Regiment of Foot. The 100th Foot was first raised in 1858 and the 109th was first raised in 1853. Between the time of its formation and Irish independence, it was one of eight Irish regiments raised largely in Ireland, its home depot in Birr. It was disbanded with the Partition of Ireland following establishment of the independent Irish Free State in 1922 when the five regiments that had their traditional recruiting grounds in the counties of the new state were disbanded."},{"page_url":"https://cs.wikipedia.org/wiki/Seznam_kulturn%C3%ADch_pam%C3%A1tek_v_okrese_%C4%8Cesk%C3%A9_Bud%C4%9Bjovice","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/11/Adamov_%28%C4%8C.Bud%C4%9Bjovice%29_-_Nejsv%C4%9Bt%C4%9Bj%C5%A1%C3%AD_Trojice.jpg","page_title":"Seznam kulturních památek v okrese České Budějovice","context_page_description":"Tento seznam nemovitých kulturních památek v okrese České Budějovice vychází z Ústředního seznamu kulturních památek ČR, který na základě zákona č. 20/1987 Sb., o státní památkové péči, vede Národní památkový ústav jako ústřední organizace státní památkové péče. Údaje jsou průběžně upřesňovány, přesto mohou obsahovat i řadu věcných a formálních chyb a nepřesností či být neaktuální.\\nPokud byly některé části dotčeného území vyčleněny do samostatných seznamů, měly by být odkazy na tyto dílčí seznamy uvedeny v úvodu tohoto seznamu nebo v úvodu příslušné sekce seznamu.\\nSeznam kulturních památek v Borovanech včetně částí obce Dvorec, Trocnov a Vrcov\\nSeznam kulturních památek v Boršově nad Vltavou včetně částí obce Poříčí a Jamné\\nSeznam kulturních památek v Českých Budějovicích včetně částí obce Čtyři Dvory, České Vrbné, Rožnov a Suché Vrbné\\nSeznam kulturních památek v Českých Budějovicích\\nSeznam kulturních památek v Českých Budějovicích\\nSeznam kulturních památek v Dolním Bukovsku včetně částí obce Bzí, Horní Bukovsko, Hvozdno, Pelejovice, Radonice a Sedlíkovice\\nSeznam kulturních památek v Doudlebech"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A2%D0%B8%D1%81%D0%BC%D0%B8%D0%B5%D0%B2%D1%8B%D0%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d6/Thismia_neptunis_Phytotaxa_340_2018_B.jpg","page_title":"Тисмиевые","context_page_description":"Тисмиевые — семейство цветковых растений порядка Диоскореецветные."},{"page_url":"https://eu.wikipedia.org/wiki/Marrita","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2b/Galena-Marrite-rar09-mf04b.jpg","page_title":"Marrita","context_page_description":"Marrita sulfuro motako minerala da eta freieslebenita taldearen kidea da."},{"page_url":"https://nv.wikipedia.org/wiki/D%C3%A1%CA%BC%C3%A1k%CA%BCehtah_ch%CA%BCa%C5%82_biz%C3%A9%C3%A9ts%CA%BC%C3%B3s%C3%AD_yisht%C5%82izhgo_diniltsoo%C3%ADg%C3%AD%C3%AD","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/41/Micryletta_steinegeri.jpg","page_title":"Dáʼákʼehtah chʼał bizéétsʼósí yishtłizhgo diniltsooígíí","context_page_description":"Dáʼákʼehtah chʼał bizéétsʼósí yishtłizhgo diniltsooígíí éí chʼał íiyisígíí dah yikahjí atah yisdzoh, áádóó éí Tsiiʼyishbizhí Dineʼé Bikéyah Yázhí bikááʼgóó hólǫ́. Ndaʼałkaahí dóó ééʼdeetįįhii éí \\"Micryletta steinegeri\\" deiłníigo dayózhí."},{"page_url":"https://fr.wikipedia.org/wiki/Bureau_du_repr%C3%A9sentant_am%C3%A9ricain_au_commerce","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/85/RobertStrauss.jpg","page_title":"Bureau du représentant américain au commerce","context_page_description":"Le Bureau du représentant américain au commerce est un bras de la branche exécutive du gouvernement fédéral des États-Unis et fait partie du Bureau exécutif du président des États-Unis."},{"page_url":"https://fr.wikipedia.org/wiki/Rue_de_Fontenay","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/91/Vincennes.Hameau_de_la_Pissotte.Cartes_des_Chasses_du_Roi.1849.jpg","page_title":"Rue de Fontenay","context_page_description":"La rue de Fontenay est un des axes importants de Vincennes. Elle suit la tracé de la route départementale 143."},{"page_url":"https://es.wikipedia.org/wiki/Lampyridae","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/17/%E3%83%92%E3%83%A1%E3%83%9C%E3%82%BF%E3%83%AB.jpg","page_title":"Lampyridae","context_page_description":"Los lampíridos son una familia de coleópteros polífagos que incluye los insectos conocidos como luciérnagas, bichos de luz, curucusíes​, isondúes, ​ cucuyos y gusanos de luz, caracterizados por su capacidad de emitir luz. Muchas se pueden encontrar en pantanos o en las áreas húmedas y boscosas, donde sus larvas tienen una fuente de alimento abundante. Son coleópteros de cuerpo blando relacionados con las familias Lycidae, Phengodidae y Cantharidae, con una distribución mundial de al menos 1900 especies conocidas."},{"page_url":"https://fr.wikipedia.org/wiki/Ballad_of_Sir_Frankie_Crisp_(Let_It_Roll)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6e/FrankCrisp.JPG","page_title":"Ballad of Sir Frankie Crisp (Let It Roll)","context_page_description":"Ballad of Sir Frankie Crisp (Let It Roll) est une chanson écrite, composée, interprétée et co-produite par George Harrison, publiée sur son triple album All Things Must Pass en 1970.\\nElle rend hommage à Sir Frank Crisp, excentrique homme de loi britannique du XIXᵉ siècle, bâtisseur et premier propriétaire de Friar Park, un manoir situé à Henley-on-Thames dans l'Oxfordshire, que George Harrison acquiert dans un état délabré au début de 1970. La chanson évoque une promenade dans cette propriété étonnante.\\nSur ce morceau, l'ex-Beatles est entouré, entre autres musiciens, de Pete Drake, Billy Preston, Gary Wright, Klaus Voormann et Alan White. Co-produit par Phil Spector, il est décrit par le critique musical Scott Janovitz comme « offrant un aperçu du véritable George Harrison — à la fois mystique, plein d'humour, solitaire, malicieux et sérieux ».\\nAvec la photographie illustrant la pochette de All Things Must Pass, prise dans les jardins de Friar Park, Ballad of Sir Frankie Crisp identifie Harrison à sa propriété d'Henley-on-Thames, identification confirmée par d'autres titres comme Crackerbox Palace et qui perdure après son décès en novembre 2001."},{"page_url":"https://es.wikipedia.org/wiki/El_tesoro_de_los_incas","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cf/Il_tesoro_misterioso_1907_Emilio_Salgari.jpg","page_title":"El tesoro de los incas","context_page_description":"El tesoro de los incas o Dos mil leguas por debajo de América es una novela de aventuras del escritor italiano Emilio Salgari. Fue publicada en 1888.​"},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Denkm%C3%A4ler_in_Coburg/G","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8a/Coburg-Gemuesemarkt1.jpg","page_title":"Liste der Denkmäler in Coburg/G","context_page_description":"Dieser Teil der Liste der Denkmäler in Coburg beschreibt die denkmalgeschützten Objekte in folgenden Coburger Straßen und Plätzen:\\nGartenstraße\\nGemüsemarkt\\nGerbergasse\\nGlockenberg\\nGoethestraße\\nGrafengasse\\nGroße Johannisgasse\\nGustav-Freytag-Weg\\nGymnasiumsgasse"},{"page_url":"https://en.wikipedia.org/wiki/Samuel_Taylor_(stenographer)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1d/Signature_of_Samuel_Taylor_%28stenographer%29.jpg","page_title":"Samuel Taylor (stenographer)","context_page_description":"Samuel Taylor was the British inventor of a widely used system of stenography.\\nHe began working on his own method of stenography in 1773, based on earlier efforts. In 1786, he published An Essay Intended to Establish a Standard for an Universal System of Stenography, or Short Hand Writing..., the first shorthand system to be used all over the English-speaking world. His stenographic method consisted in cutting out the superfluous consonants as well as the vowels in polysyllabic words. It used an alphabet composed of 19 letters of simplified shapes.\\nHe taught stenography at Oxford as well as the universities of Scotland and Ireland for many years.\\nHis system was adopted for several other languages, including French, German, Spanish, Italian, and Swedish. His book was translated and published in France by Théodore-Pierre Bertin in 1792 under the title Système universel et complet de Stenographie ou Manière abrégée d'écrire applicable à tous les idiomes.\\nHe also published a book on angling in 1800, titled Angling in All Its Branches."},{"page_url":"https://it.wikipedia.org/wiki/Settimana_rossa","image_url":"https://upload.wikimedia.org/wikipedia/it/e/eb/Settimana_Rossa_-_Fabriano%2C_la_piazza_del_Podest%C3%A0_durante_lo_sciopero_generale.jpg","page_title":"Settimana rossa","context_page_description":"La Settimana rossa fu un'insurrezione popolare sviluppatasi ad Ancona e propagatasi dalle Marche alla Romagna, alla Toscana e ad altre parti d'Italia, tra il 7 e il 14 giugno 1914, come reazione all'eccidio di tre manifestanti avvenuto ad Ancona ad opera della forza pubblica.\\nDopo un'iniziale fiammata rivoluzionaria, con la proclamazione dello sciopero generale in tutta Italia, la Confederazione Generale del Lavoro decise, dopo solo due giorni, la cessazione dello sciopero ed il ritorno al lavoro, il che, assieme ad una politica oculata da parte del governo Salandra, che evitò l'intervento massiccio dei militari, come pure richiesto dalle forze più conservatrici, consentì il rientro dell'insurrezione nella normalità."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%94%D0%BC%D0%B8%D1%82%D1%80%D0%B0%D1%88%D0%BA%D0%BE%D0%B2%D0%BA%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cc/Dmytrashkivka_church.JPG","page_title":"Дмитрашковка","context_page_description":"Дмитра́шковка — село на Украине, находится в Песчанском районе Винницкой области.\\nКод КОАТУУ — 0523281401. Население по переписи 2001 года составляет 1810 человек. Почтовый индекс — 24714. Телефонный код — 4349."},{"page_url":"https://eu.wikipedia.org/wiki/Abitibi","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7b/Sainte-gertrude-manneville_002.jpg","page_title":"Abitibi","context_page_description":"Abitibi Quebeceko konderriko eskualde-udalerria da, Kanadan. Abitibi-Témiscamingue administrazio-eskualdean kokatuta dago eta hiriburua Amos da."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%99%D0%B5%D1%80%D1%83%D0%BF","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/15/Jakriborg.jpg","page_title":"Йеруп","context_page_description":"Йеруп е град в южна Швеция, лен Сконе, община Стафансторп. Разположен е на 10 km от брега на протока Йоресун. Намира се на около 500 km на югозапад от столицата Стокхолм, на 15 km на североизток от Малмьо и на 5 km на юг от Лунд. Има жп гара. Между Йеруп и Лунд се намира летището на Лунд. Кварталът Якрибори е с характерно самобитно ново строителство. Населението на града е 5001 жители, по приблизителна оценка от декември 2017 г."},{"page_url":"https://sl.wikipedia.org/wiki/Kuvasz","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6d/Kuvasz_Prince_Juninho_Poster.jpg","page_title":"Kuvasz","context_page_description":"Kuvasz je pasma psov, ki ima starodavne madžarske korenine. Omembo te pasme je mogoče najti v starih madžarskih besedilih. V preteklosti so jih uporabljali za zaščito pašnih živali, vendar jih v zadnjih sedemdesetih letih najdemo kot hišne ljubljenčeke. Nekaj časa so ga uporabljali tudi za lov na volkove in divje prašiče."},{"page_url":"https://en.wikipedia.org/wiki/Sebastopol,_California","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/01/Sebastopol%2C_California_%281908%29.jpg","page_title":"Sebastopol, California","context_page_description":"Sebastopol is a city in Sonoma County, in California. The population was 7,379 at the 2010 U.S. Census. Sonoma County has a population of up to 50,000 residents.\\nIt is about a 20-minute drive from the Pacific Ocean, between Santa Rosa and Bodega Bay, and is known for its liberal politics and small-town charm. It was once primarily a plum- and apple-growing region; wine grapes, however, are now predominant, and nearly all lands once used for orchards are now vineyards. Famous horticulturist Luther Burbank had gardens in this region. The city hosts an annual Apple Blossom Festival and Gravenstein Apple Fair."},{"page_url":"https://de.wikipedia.org/wiki/Armstrong_Siddeley_Mongoose","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4b/Tomtit_Old_Warden.jpg","page_title":"Armstrong Siddeley Mongoose","context_page_description":"Der Armstrong Siddeley Mongoose ist ein Flugmotor, den der britische Hersteller Armstrong Siddeley ab 1926 baute. Der 5-Zylinder-Sternmotor hat einen Hubraum von 8849 cm³ und leistet maximal 155 bhp. Unter anderem wurde der Motor im Schulflugzeug Hawker Tomtit und im Wasserflugzeug Parnall Peto eingesetzt."},{"page_url":"https://en.wikipedia.org/wiki/Non-binary_gender","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d6/Bigender.jpg","page_title":"Non-binary gender","context_page_description":"Non-binary or genderqueer is a spectrum of gender identities that are not exclusively masculine or feminine‍—‌identities that are outside the gender binary. Non-binary identities can fall under the transgender umbrella, since many non-binary people identify with a gender that is different from their assigned sex.\\nNon-binary people may identify as having two or more genders; having no gender; moving between genders or having a fluctuating gender identity; being third gender or other-gendered.\\nGender identity is separate from sexual or romantic orientation, and non-binary people have a variety of sexual orientations, just as cisgender people do.\\nNon-binary gender identities are not associated with a specific gender expression, such as androgyny. Non-binary people as a group have a wide variety of gender expressions, and some may reject gender \\"identities\\" altogether. Some non-binary people are medically treated for gender dysphoria with surgery or hormones, as trans men and women are."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%AF%D9%8A%D9%84%D9%88%D8%B1%D9%8A%D9%86_%D9%85%D9%88%D8%AA%D9%88%D8%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/63/DeLorean_DMC-12_%2815704582713%29.jpg","page_title":"ديلورين موتور","context_page_description":"شركة ديلورين موتور ‏، هي شركة أمريكية لصناعة السيارات سابقاً، تأسست سنة 1975 على يد مؤسسها جون ديلورين، وأعلنت الشركة إفلاسها رسمياً سنة 1982، وكان ديلورين اشتهر باختراع سيارة ديلوريان دي إم سي-12، والتي روجها في فيلم العودة إلى المستقبل."},{"page_url":"https://de.wikipedia.org/wiki/Maxwell_Motor_Company","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5e/Maxwell_Mascotte_Touring_1911.jpg","page_title":"Maxwell Motor Company","context_page_description":"Die Maxwell Motor Company war ein US-amerikanischer Kraftfahrzeughersteller, der von 1904 bis 1925 Autos herstellte."},{"page_url":"https://lb.wikipedia.org/wiki/Observatoire_St._Margarethen","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4c/Sternwarte_02092008357.jpg","page_title":"Observatoire St. Margarethen","context_page_description":"Den Observatoire St. Margarethen ass en Observatoire an meteorologesch Observatiounsstatioun zu Binningen bei Basel an der Schwäiz.\\nDen Observatoire steet um Bruderholz iwwer der Baseler Konschtäisbunn. E gouf 1929 als Suite vum Observatoire um Bernoullianum opgemaach an huet bis 2007 der Universitéit Basel gehéiert. No der Opléisung vum Astronomeschen Institut Enn 2007 gëtt den Observatoire vum Astronomesche Veräi vu Basel weiderbedriwwen.\\nOp der Standplaz gëtt och d'Baseler Klimarei gemooss, déi zanter 1755 onënnerbrach kontrolléiert gëtt.\\nAm Observatoire si Miessstatioune vun den Netzer NADAM, NABEL an dem Schwäizer Äerdbiewendéngscht."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%B3%D9%81%D8%A7%D8%B1%D8%AA_%D8%B3%D8%A7%D8%A8%D9%82_%D8%A7%DB%8C%D8%A7%D9%84%D8%A7%D8%AA_%D9%85%D8%AA%D8%AD%D8%AF%D9%87_%D8%A2%D9%85%D8%B1%DB%8C%DA%A9%D8%A7_%D8%AF%D8%B1_%D8%AA%D9%87%D8%B1%D8%A7%D9%86","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/98/Ex_embassy_US_tehran.jpg","page_title":"سفارت سابق ایالات متحده آمریکا در تهران","context_page_description":"سفارت آمریکا در تهران تنها نمایندگی سیاسی ایالات متحده آمریکا در ایران تا قبل از ماجرای اشغال سفارت آمریکا بود. لانهٔ جاسوسی نامیست که بعد از انقلاب ۱۳۵۷ و اشغال سفارت آمریکا در تهران بر روی این سفارت قرار داده‌شد. امروزه این بنا با نام «موزهٔ ۱۳ آبان» برای تماشای علاقه‌مندان در دسترس عموم است.\\nهم‌اکنون سفارت سوئیس در تهران، مسئولیت حفاظت منافع آمریکا در ایران را بر عهده دارد."},{"page_url":"https://cs.wikipedia.org/wiki/Operace_Bin_Nun","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/50/Latroun_%2824_mai%29.png","page_title":"Operace Bin Nun","context_page_description":"Operace Bin Nun byla vojenská akce izraelské armády provedená v květnu 1948 během první arabsko-izraelské války, v době krátce po konci britského mandátu nad Palestinou a vzniku státu Izrael. Byla součástí bitev o Latrun vedených s cílem ovládnutí přístupového koridoru z pobřežní planiny do Jeruzaléma a výšiny Latrun. Skončila izraelským neúspěchem."},{"page_url":"https://sv.wikipedia.org/wiki/Kolerakyrkog%C3%A5rden,_Skanstull","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d3/Kolerakyrkog%C3%A5rden_2009g.jpg","page_title":"Kolerakyrkogården, Skanstull","context_page_description":"Kolerakyrkogården var en kolerakyrkogård i närheten av Skanstull i Stockholm som användes under åren 1809 till 1901. Här begravdes många offer från Stockholms båda koleraepidemier 1834 och 1853, därav namnet. Kolerakyrkogården är numera en av Stockholms parker med läge öster om Gullmarsplan i Johanneshov."},{"page_url":"https://en.wikipedia.org/wiki/Bigson,_West_Virginia","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c3/Bigson_overview.jpg","page_title":"Bigson, West Virginia","context_page_description":"Bigson is an unincorporated community in Boone County, West Virginia, United States."},{"page_url":"https://zh.wikipedia.org/wiki/%E4%B8%8B%E4%BB%8A%E5%B8%82%E7%AB%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/67/170824_Shimo-Imaichi_Station_Nikko_Japan02s.jpg","page_title":"下今市站","context_page_description":"下今市車站位於日本栃木縣日光市今市，是屬於東武鐵道的鐵路車站。車站編號是TN 23。\\n此站有日光線與鬼怒川線停靠。鬼怒川線以此站為起點。"},{"page_url":"https://et.wikipedia.org/wiki/Pytheas","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/83/Pyth%C3%A9as.jpg","page_title":"Pytheas","context_page_description":"Pytheas Massaliast oli 4. sajandil eKr elanud Kreeka geograaf ja maadeuurija. Umbes aastal 325 eKr reisis ta Põhja-Euroopasse, kus uuris osa Suurbritanniast, jõudis Läänemerele ja kirjeldas esimesena maad, mida kutsuti Thuleks."},{"page_url":"https://de.wikipedia.org/wiki/Tennengebirge","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2e/Luftaufnahme_Tennengebirge.jpg","page_title":"Tennengebirge","context_page_description":"Das Tennengebirge ist eine Gebirgsgruppe der Nördlichen Kalkalpen in den Ostalpen. Es ist ein stark verkarstetes und höhlenreiches etwa 60 km² großes Plateaugebirge. Es befindet sich in Österreich im Bundesland Salzburg bei Bischofshofen.\\n3 km² des Tennengebirgsplateaus befinden sich oberhalb 2000 Meter Seehöhe. Das vollständig im Salzburger Land gelegene Tennengebirge steht unter Naturschutz."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%9A%D0%B8%D1%80%D1%8F%D0%BA_%D0%A6%D0%B0%D0%BD%D0%BA%D0%BE%D0%B2","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/06/Kiryak-Tsankov.jpg","page_title":"Киряк Цанков","context_page_description":"Киряк Антонов Цанков е български революционер, политик и дипломат.\\nТой е сред ръководителите на Българския революционен централен комитет, а непосредствено след Освобождението е участник в Либералната партия. По-късно заема разни дипломатически постове, като през 1880 става първият дипломатически агент на България в Букурещ."},{"page_url":"https://nn.wikipedia.org/wiki/Tarjei_Vesaas%27_debutantpris","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8d/Sissel_Lie_2.jpg","page_title":"Tarjei Vesaas' debutantpris","context_page_description":"Tarjei Vesaas debutantpris er ein litteraturpris for norske skjønnlitterære debutantar. Han blei stifta av Tarjei Vesaas i 1964 med prispengane han fekk av Nordisk Råd då han fekk Nordisk råds litteraturpris for Is-slottet same året. Prisen blir gjeven til ein debutant innan skjønnlitteratur etter ei innstilling frå Den norske Forfatterforening."},{"page_url":"https://en.wikipedia.org/wiki/1996_Baden-W%C3%BCrttemberg_state_election","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/eb/Walter_D%C3%B6ring.jpg","page_title":"1996 Baden-Württemberg state election","context_page_description":"The 1996 Baden-Württemberg state election was held on 24 March 1996 to elect the members of the 11th Landtag of Baden-Württemberg. The incumbent grand coalition government of the Christian Democratic Union and Social Democratic Party under Minister-President Erwin Teufel retained its majority. However, the CDU chose not to renew the coalition, instead forming a new government with the Free Democratic Party. Teufel was subsequently re-elected as Minister-President.\\nThe Republicans unexpectedly retained their seats with a small swing against them, despite polling indicating they would fall out of the Landtag."},{"page_url":"https://ko.wikipedia.org/wiki/%EB%B0%A9%EC%B9%B4%EC%84%AC_%EB%8C%80%ED%95%99%EC%82%B4","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6d/Vivian_Bullwinkel_in_Tokyo%2C_1946.jpg","page_title":"방카섬 대학살","context_page_description":"방카섬 대학살은 1942년 2월 16일, 네덜란드령 동인도 수마트라섬 동쪽에 위치한 방카섬에서 일어난 일본군에 의한 대량 학살 사건으로, 수십여명의 영국군과 오스트레일리아군 포로, 민간인이 학살당하고 21명의 오스트레일리아 육군 간호사들이 방카섬 라지 해안에서 일본군에 의해 강간 당한 후 학살된 사건이다."},{"page_url":"https://en.wikipedia.org/wiki/List_of_historic_properties_in_Glendale,_Arizona","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/67/G-Sahuaro_Ranch_Adobe_House-1887.jpg","page_title":"List of historic properties in Glendale, Arizona","context_page_description":"This is a list of historic properties in Glendale, Arizona, which includes a photographic gallery, of some of the city's remaining historic structures and monuments."},{"page_url":"https://vi.wikipedia.org/wiki/Ph%C3%A2n_lo%E1%BA%A1i_h%E1%BB%8D_X%C6%B0%C6%A1ng_r%E1%BB%93ng","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7f/Cactaceae_serre_massey.jpg","page_title":"Phân loại họ Xương rồng","context_page_description":"Danh sách liệt kê các cấp phân loại dưới họ của họ Xương rồng Cactaceae"},{"page_url":"https://pl.wikipedia.org/wiki/Hrabstwo_DeWitt_(Teksas)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ef/Dewitt_courthouse.jpg","page_title":"Hrabstwo DeWitt (Teksas)","context_page_description":"Hrabstwo DeWitt – hrabstwo położone w USA w stanie Teksas. Utworzone w 1846 r. Siedzibą hrabstwa jest miasto Cuero."},{"page_url":"https://en.wikipedia.org/wiki/Mashhad_of_Sayyida_Ruqayya","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/88/Ruqayya_mashhad_wooden_mihrab_in_MIA.jpg","page_title":"Mashhad of Sayyida Ruqayya","context_page_description":"The Mashhad of Sayyidah Ruqayyah, also referred to as the Mausoleum or Tomb of Sayyida Ruqayya, is a 12th-century Islamic religious shrine and mosque in Cairo, Egypt. It was erected in 1133 CE as a memorial to as-Sayyidah Ruqayyah, a member of the Prophet Muhammad's family. It is also notable as one of the few and most important Fatimid-era mausoleums preserved in Cairo today."},{"page_url":"https://pt.wikipedia.org/wiki/Fronteira_dos_Vales","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/14/Fronteira_dos_Valesmgbandeira.png","page_title":"Fronteira dos Vales","context_page_description":"Fronteira dos Vales é um município brasileiro do estado de Minas Gerais. Sua população estimada em 2009 era de 4.977 habitantes. A economia gira em torno da pecuária e de empregos públicos. Os principais ramos políticos se denominam de 'Pé Rachado' e 'Pé Liso', os quais representam os trabalhos e representantes da elite agropecuária da cidade. Para as novas eleições haverá mais dois ramos políticos. Suas principais comunidades são: Monte Castelo, Andaraí, Ventania, Santa Rosa, Nunes, Córrego do Prejuízo, Pedras e Barragem. O pico está a 1.186 m, denominado pedra da Velha Manoela, que era moradora do local. Seu principal rio, o Pampã, fornece água para toda a cidade. Seu principal ponto natural de lazer é a Cachoeira do Córrego Novo. No entanto, a cidade tem mais de 100 cachoeiras, dentre privadas e públicas. A principal época atrativa é o São João, quando diversos conterrâneos voltam à cidade para reencontrar familiares e trazem visitantes.\\nAinda a cidade destaca-se pela existência de três comunidades quilombolas\\nSeus principais rios são: Pampã e Alcobaça."},{"page_url":"https://de.wikipedia.org/wiki/Goguette","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/Jean-Fran%C3%A7ois_Panard_4.jpg","page_title":"Goguette","context_page_description":"Ein Goguette war ein Gesangsverein in Frankreich und Belgien und ihre Mitglieder nannte man Goguettiers. Neben der Bereitstellung der Räumlichkeiten für Solo- und Ensembleauftritte dienten Goguettes als Orte der Geselligkeit, Erholung und zum Trinken."},{"page_url":"https://fr.wikipedia.org/wiki/C%C3%A9rons","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/4b/C%C3%A9rons_%C3%89glise_Saint-Martin_01.jpg","page_title":"Cérons","context_page_description":"Cérons est une commune du Sud-Ouest de la France, située dans le département de la Gironde, en région Nouvelle-Aquitaine."},{"page_url":"https://nn.wikipedia.org/wiki/Pubertet","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/83/Mouse-19-Dec-2004.jpg","page_title":"Pubertet","context_page_description":"Pubertet er prosessen som finn stad når kroppen til ein unge utviklar seg til ein vaksen som er istand til å forplanta seg. I denne tida utviklar ein sekundære kjønnskjenneteikn, kroppen veks, og ein produserer nye kjønnshormon. Ofte byrjar også seksualisert åtferd ved puberteten.\\nTida då menneske går gjennom puberteten blir gjerne kalla ungdomstid. og kan vera prega av forvirring på grunn av hormona og dei mange endringane som skjer. Men også andre dyr opplever pubertet som\\nkan påverka både utsjånad og oppførsel."},{"page_url":"https://de.wikipedia.org/wiki/Von-Ruhr-zur-Ruhr-Radweg","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d6/Von_Ruhr_zur_Ruhr.jpg","page_title":"Von-Ruhr-zur-Ruhr-Radweg","context_page_description":"Der Von-Ruhr-zur-Ruhr-Radweg ist ein Radrundweg in Nordrhein-Westfalen. Er befindet sich in den Städten Hattingen, Sprockhövel, Gevelsberg, Wetter und Witten. Er ist etwa 55 km lang und beschildert. Der Radweg verläuft zum großen Teil auf ehemaligen Bahntrassen. Ein rund 2 km langes Teilstück zwischen Silschede und Albringhausen ist noch nicht ausgebaut.\\nDer höchste Punkt befindet sich bei Schee, der tiefste an der Ruhr bei Hattingen."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Truppenteile_der_Panzeraufkl%C3%A4rungstruppe_des_Heeres_der_Bundeswehr","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c5/PzAufklBtl_12_%28B%29.png","page_title":"Liste der Truppenteile der Panzeraufklärungstruppe des Heeres der Bundeswehr","context_page_description":"Die Liste der Truppenteile der Panzeraufklärungstruppe des Heeres der Bundeswehr enthält alle Verbände und Großverbände der Panzeraufklärungstruppe der Bundeswehr sowie eine kurze Übersicht über ihren Aufstellungszeitpunkt, Stationierungsorte, Unterstellung und über ihre Auflösung oder Umbenennung.\\nNicht aufgenommen wurden die Beobachtungs- und Artillerieaufklärungsverbände der Artillerietruppe sowie die Aufklärungsverbände der aus den Panzeraufklärern und weiteren Truppengattungen hervorgegangenen Heeresaufklärungstruppe. Siehe dazu Liste der Artillerieverbände der Bundeswehr und Liste der Heeresaufklärungsverbände der Bundeswehr."},{"page_url":"https://sh.wikipedia.org/wiki/Olof_Mellberg","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c1/Olof_Mellberg_2006.jpg","page_title":"Olof Mellberg","context_page_description":"Erik Olof Mellberg je švedski nogometaš i bivši reprezentativac koji trenutno igra za danski F.C. København. Uglavnom igra ili kao središnji ili kao desni branič. Za reprezentaciju je nastupao na dva svjetska i tri europska prvenstva."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%AF%D8%B1%DB%8C%D9%86%D9%88%D9%81_(%D9%86%D8%A7%D8%AD%DB%8C%D9%87_%DA%A9%D8%B1%D9%88%D9%85%DB%8C%D8%B1%DB%8C%DA%98)","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/76/D%C5%99%C3%ADnov_%28Krom%C4%9B%C5%99%C3%AD%C5%BE_District%29_CoA.PNG","page_title":"درینوف (ناحیه کرومیریژ)","context_page_description":"درینوف یک منطقهٔ مسکونی در جمهوری چک است که در ناحیه کرومیریژ واقع شده‌است. درینوف ۵٫۴۳ کیلومتر مربع مساحت و ۴۴۶ نفر جمعیت دارد و ۲۹۶ متر بالاتر از سطح دریا واقع شده‌است."},{"page_url":"https://ba.wikipedia.org/wiki/%D0%90%D0%BB%D0%B6%D0%B8%D1%80%D2%99%D0%B0_%D1%88%D0%B0%D1%80%D0%B0%D0%BF_%D0%B5%D1%82%D0%B5%D1%88%D1%82%D0%B5%D1%80%D0%B5%D2%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/72/Vendanges_en_Oranais_1909.jpg","page_title":"Алжирҙа шарап етештереү","context_page_description":"Алжи́рҙа шарап етештереү Антиклыҡҡа — атап әйткәндә, Карфаген һәм Боронғо Рим хакимлығы осорона барып тоташа. ХХ быуаттың беренсе яртыһында виноград ағасы биләгән майҙан 396 000 гектарға, ә йыллыҡ шарап етештереү 18 000 000 гектолитрға етә, һәм был осор Француз Алжиры дәүерендә илдә шарапты иң күп эшләгән мәл тип иҫәпләнелә. Икенсе донъя һуғышынан һуңғы йылдарҙа Алжир шарабы хаҡы дөйөм донъя хаҡтарынан юғарыраҡ була, әммә шуға ҡарамаҫтан, ул Франция колониаль биләмәләренән сыҡҡан импорттың 22 процентын ғына тәшкил итә. 1962 йылда Алжир, бойондороҡһоҙлоҡ алып, шарап һатыуҙағы төп баҙарҙы юғалтҡандан һуң шарап етештереү ҡырҡа кәмей, ләкин ил элеккесә шарап етештереү буйынса икенсе һәм Африка континентының бөтә илдәре араһында шарап экспортлау буйынса бишенсе урынды биләй."},{"page_url":"https://de.wikipedia.org/wiki/Chemins_de_fer_du_Morbihan","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fb/CM15_-_stGildas.jpg","page_title":"Chemins de fer du Morbihan","context_page_description":"Die Compagnie des Chemins de fer du Morbihan ist eine ehemalige französische Eisenbahngesellschaft. Sie wurde 1892 vom Generalrat des Départements Morbihan mit dem Aufbau eines meterspurigen Bahnnetzes zur Erschließung des bretonischen Départements beauftragt. Der Hersteller von Eisenbahnfahrzeugen und Betreiber von Nebenbahnstrecken SCF Verney war an der Gesellschaft beteiligt.\\n1921 hatte die CM 402 km Bahnstrecken im Département Morbihan und 120 km im angrenzenden Département Loire-inférieure in Betrieb. Ab dem Ersten Weltkrieg litt sie zunehmend unter der Konkurrenz der Straße und unter veraltendem Material. 1939 beschloss der Generalrat, sein Netz an Nebenstrecken zu schließen und die CM mit Busverkehren zu beauftragen. Noch 1939 wurden der Schienenpersonenverkehr und ein Teil des Netzes aufgegeben, bis 1948 der restliche Schienenverkehr.\\nDas Unternehmen bestand als Betreiber von Linienbussen fort. Es wurde 1968 vollständig von SCF Verney übernommen, in Compagnie de Transports du Morbihan umbenannt und ist seit 2015 eine Tochter der Transdev."},{"page_url":"https://hy.wikipedia.org/wiki/%D5%8F%D5%A5%D5%BA%D5%A5%D6%80%D5%B8%D5%BE%D5%AF%D5%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/78/%D0%A2%D0%B5%D0%BF%D0%B5%D1%80%D0%BE%D0%B2%D0%BA%D0%B0.JPG","page_title":"Տեպերովկա","context_page_description":"Տեպերովկա, գյուղ Ուկրաինայի Խմելնիցկիի մարզի Դերաժնյայի շրջանում։\\n2001 թվականի տվյալներով Տեպերովկա գյուղում բնակվում էր 540 մարդ։ Բնակավայրը զբաղեցնում է 1455 կմ² տարածք։ Բնակչության խտությունը կազմում էր 371,13 մարդ/կմ²։"},{"page_url":"https://fr.wikipedia.org/wiki/Charnay-l%C3%A8s-M%C3%A2con","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/07/Puits_Domaine_Champgrenon_1.jpg","page_title":"Charnay-lès-Mâcon","context_page_description":"Charnay-lès-Mâcon est une commune française située dans le département de Saône-et-Loire en région Bourgogne-Franche-Comté."},{"page_url":"https://es.wikipedia.org/wiki/Beats_Electronics","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/16/Whitesolobeatsbydreheadphones.jpg","page_title":"Beats Electronics","context_page_description":"Beats Electronics es una división de Apple, que produce productos de audio. Con sede en 1 Infinite Loop Cupertino, California, la compañía fue fundada por el cantante de rap y hip-hop productor, Andre \\"Dr. Dre\\" Young, y el presidente de Interscope-Geffen-A&M, Jimmy Iovine. Produce principalmente productos bajo la marca Beats by Dr. Dre. La compañía también ha licenciado la tecnología de audio a otras empresas para su uso en sus propios productos.\\nDe 2008 a 2012, sus productos fueron fabricados exclusivamente por la electrónica de consumo compañía Monster Cable. Tras la cancelación de su contrato, iniciaron su propia fabricación de productos."},{"page_url":"https://bn.wikipedia.org/wiki/%E0%A6%B6%E0%A7%8D%E0%A6%B0%E0%A7%80%E0%A6%B2%E0%A6%99%E0%A7%8D%E0%A6%95%E0%A6%BE%E0%A6%B0_%E0%A6%AA%E0%A6%B0%E0%A6%BF%E0%A6%AC%E0%A6%B9%E0%A6%A8_%E0%A6%AC%E0%A7%8D%E0%A6%AF%E0%A6%AC%E0%A6%B8%E0%A7%8D%E0%A6%A5%E0%A6%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/ColomboHarbour-SriLanka02.jpg","page_title":"শ্রীলঙ্কার পরিবহন ব্যবস্থা","context_page_description":"শ্রীলঙ্কার পরিবহন ব্যবস্থা এটির সড়ক নেটওয়ার্কের উপর ভিত্তি করে গড়ে উঠেছে, যা দেশের রাজধানী কলম্বো কেন্দ্রিক। একটি রেল নেটওয়ার্ক শ্রীলঙ্কার পরিবহন প্রয়োজনীয়তার একটি অংশ পরিচালনা করে। নৌবাহি জলপথ, পোতাশ্রয় এবং দুটি আন্তর্জাতিক বিমানবন্দর রয়েছে: কলম্বো থেকে ২২ মাইল উত্তরে কাতুনায়াকে, এবং হাম্বানটোটাতে।"},{"page_url":"https://de.wikipedia.org/wiki/Papiermesser","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ad/Uncut_book_p1190369.jpg","page_title":"Papiermesser","context_page_description":"Ein Papiermesser ist ein messerförmiger Gegenstand zum Schneiden von Papier.\\nPapiermesser dienten früher unter anderem zum Aufschneiden von Buchseiten unbeschnittener Bücher, die oft mit acht Blatte umfassenden bedruckten Bögen gefalzt und gebunden waren. Um die Innenseiten lesen zu können, mussten die Bögen aufgeschnitten werden.\\nDie Klinge des Papiermessers ist im Gegensatz zum Brieföffner an der Spitze abgerundet und besteht meist aus Horn, Bein, früher aus Elfenbein, selten aus Metall."},{"page_url":"https://es.wikipedia.org/wiki/El_hechizado","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/74/1848_ILN_The_Haunted_Man.jpg","page_title":"El hechizado","context_page_description":"El hechizado, también conocido como El hechizado y el trato con el fantasma, El hombre embrujado y El poseído, es una novela corta de Charles Dickens publicada en 1848, la quinta y última de sus novelas de tema navideño. El cuento trata más sobre el espíritu de la Navidad que sobre la propia Navidad, lo que recuerda al primer libro de la serie, Cuento de Navidad. El relato nos cuenta las andanzas del profesor Redlaw y los que le rodean."},{"page_url":"https://he.wikipedia.org/wiki/%D7%9E%D7%93%D7%92%D7%A1%D7%A7%D7%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bc/Flag_of_Madagascar.svg","page_title":"מדגסקר","context_page_description":"רפובליקת מדגסקר, בשמה הקודם הרפובליקה המלגשית, היא מדינת איים השוכנת באוקיינוס ההודי, מול מוזמביק שבדרום מזרח אפריקה. המדינה כוללת את האי מדגסקר, שהוא האי הרביעי בגודלו בעולם, וכן מספר רב של איים פריפריים קטנים יותר.\\nעל פי תאוריית טקטוניקת הלוחות, האי מדגסקר היה שייך ליבשת גונדוונה, שנפרדה מהודו לפני כ-88 מיליון שנה, מה שגרם לצמחים ולבעלי החיים המקומיים להתפתח בבידוד. כתוצאה מכך, מדגסקר היא בעלת מגוון ביולוגי עשיר ביותר; מעל 90% מחיות הבר במדגסקר לא נמצאות בשום מקום אחר על פני כדור הארץ. המערכות האקולוגיות המגוונות של האי וחיות הבר הייחודיות מאוימות על ידי חדירתה של האוכלוסייה האנושית הגדלה במהירות וכן על ידי איומים סביבתיים אחרים.\\nהראיות הארכאולוגיות הראשונות על התיישבות של בני אדם על מדגסקר היא בערך לשנת 2000 לפני הספירה. ההתיישבות האנושית של מדגסקר התרחשה בין 350 לפנה\\"ס עד 550 לספירה על ידי עמים אוסטרונזים שהגיעו על סירת קנים מבורניאו.\\nמדגסקר שייכת לקבוצת המדינות הפחות מפותחות, על פי האו\\"ם. מלגשית וצרפתית הן השפות הרשמיות של המדינה. רוב האוכלוסייה שומרת על אמונות מסורתיות של הנצרות. הכלכלה מתבססת על תיירות אקולוגית וחקלאות, בשילוב עם השקעות גבוהות יותר בחינוך ובריאות, הם מרכיבים מרכזיים של אסטרטגיית הפיתוח של מדגסקר."},{"page_url":"https://ms.wikipedia.org/wiki/Masjid_Finsbury_Park","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/56/Finsbury_Park_Mosque_Dome.jpg","page_title":"Masjid Finsbury Park","context_page_description":"Masjid Finsbury Park, juga digelar Masjid North London Central, adalah sebuah masjid 5 tingkat terletak sebelah stesen Finsbury Park berhampiran dengan Emirates Stadium Arsenal Football Club, di London Borough of Islington. Masjid Finsbury Park didaftarkan sebagai kebajikan di UK, berkhidmat kepada masyarakat tempatan di Islington dan Boroughs di London Utara.\\nMasjid ini mendapat perhatian apabila Abu Hamza al-Masri, seorang pendakwah radikal, menjadi imam pada tahun 1997. Pada tahun 2003, masjid ditutup oleh para pemegang amanahnya berikutan serangan anti-pengganas, Dibuka pada tahun 2005 di bawah kepimpinan baru."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%92%D0%BE%D0%BB%D1%87%D0%BA%D0%BE%D0%B2%D0%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9d/Wolczkowo_St._Mary%27s_Scapular_Church_2006-03_back.jpg","page_title":"Волчково","context_page_description":"Волчково — село в Польщі, у гміні Добра Полицького повіту Західнопоморського воєводства.\\nНаселення — 1428 осіб."},{"page_url":"https://ca.wikipedia.org/wiki/Bourgtheroulde-Infreville","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/4e/Map_commune_FR_insee_code_27105.png","page_title":"Bourgtheroulde-Infreville","context_page_description":"Bourgtheroulde-Infreville és un municipi francès, situat al departament de l'Eure i a la regió de Normandia. L'any 2007 tenia 2.948 habitants."},{"page_url":"https://pt.wikipedia.org/wiki/Miros%C5%82awiec","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f3/Miroslawiec_center.JPG","page_title":"Mirosławiec","context_page_description":"Mirosławiec é um município da Polônia, na voivodia da Pomerânia Ocidental e no condado de Wałcz. Estende-se por uma área de 2,17 km², com 3 064 habitantes, segundo os censos de 2016, com uma densidade de 1412,0 hab/km²."},{"page_url":"https://sk.wikipedia.org/wiki/Premi%C3%A8res","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/cc/Map_commune_FR_insee_code_21507.png","page_title":"Premières","context_page_description":"Premières je francúzska obec, ktorá sa nachádza v departemente Côte-d’Or, v regióne Burgundsko."},{"page_url":"https://sl.wikipedia.org/wiki/Sveti_Jurij,_Roga%C5%A1ovci","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/01/Sveti_Jurij_Roga%C5%A1ovci.jpg","page_title":"Sveti Jurij, Rogašovci","context_page_description":"Sveti Jurij je naselje v občine Rogašovci v Prekmurju in sedež župnije Sveti Jurij. V naselju stoji tudi župnijska cerkev Sv. Jurija."},{"page_url":"https://ca.wikipedia.org/wiki/Hans_Gude","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b7/Hans_Gude_Portrait_2.jpg","page_title":"Hans Gude","context_page_description":"Hans Fredrik Gude fou un pintor noruec, un dels màxims representants del nacionalisme romàntic d'aquest estat. Entre les seues obres mestres hi ha paisatges com Muntanyes altes i La processó nupcial a Hardanger, aquesta darrera en conjunt amb Adolph Tidemand."},{"page_url":"https://it.wikipedia.org/wiki/Adela","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/Gilia_tricolor_067.jpg","page_title":"Adela","context_page_description":"Adela Latreille, 1796 è un genere di lepidotteri appartenente alla famiglia Adelidae, diffuso in Eurasia, Africa e America settentrionale e centrale."},{"page_url":"https://pl.wikipedia.org/wiki/Lista_zabytk%C3%B3w_Los_Angeles_w_rejonie_Downtown_Los_Angeles","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/04/315_W._9th_St.%2C_Los_Angeles.jpg","page_title":"Lista zabytków Los Angeles w rejonie Downtown Los Angeles","context_page_description":"W Downtown Los Angeles i jego okolicach mieści się przeszło 120 zabytków mających charakter historyczno-kulturalny. Zaliczają się do nich:Old Plaza Historic District, Little Tokyo, Chinatown, Broadway Theater District, Spring Street Financial District i Fashion District."},{"page_url":"https://de.wikipedia.org/wiki/St._Johannis_(Neukirchen)","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/1d/Bad_Malente_-_Neukirchen_-_Vicelinkirche.JPG","page_title":"St. Johannis (Neukirchen)","context_page_description":"Die St.-Johannis-Kirche in Neukirchen in Neukirchen, Ortsteil der Gemeinde Malente im Kreis Ostholstein in Schleswig-Holstein, ist eine der ostholsteinischen Feldsteinkirchen/Rundturmkirchen aus dem 12. Jahrhundert."},{"page_url":"https://fr.wikipedia.org/wiki/Gndevank","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f7/%D4%B3%D5%B6%D5%A4%D5%A5%D5%BE%D5%A1%D5%B6%D6%84%D5%A81.jpg","page_title":"Gndevank","context_page_description":"Gndevank est un monastère arménien situé dans le marz de Vayots Dzor, communauté rurale de Gndevaz, non loin de la ville de Djermouk. Le complexe monastique a principalement été construit au Xᵉ siècle. Le bâtiment le plus imposant est l'église, avec son gavit. Il reste quelques khatchkars à côté de l'église."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E4%B8%AD%E8%8F%AF%E6%B0%91%E5%9C%8B%E6%B2%BB%E8%97%8F%E6%AD%B7%E5%8F%B2","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/38/Younghusband-team-1904.jpg","page_title":"中華民國治藏歷史","context_page_description":"中华民国对西藏的主权地位一直是西藏独立运动中争论的焦点。西方学术界普遍认为在中华民国的大陆统治时期，西藏并不受北洋政府和国民政府管辖或支配，甚至达成事实上的独立，不过中华民国大陆时期也被视为中国秩序解体的时期，全国处于事实上的分裂状态。"},{"page_url":"https://ru.wikipedia.org/wiki/SMS_Kronprinz_(1914)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f3/%D0%9F%D0%BE%D0%B2%D1%80%D0%B5%D0%B6%D0%B4%D0%B5%D0%BD%D0%B8%D1%8F_%D0%B3%D0%B5%D1%80%D0%BC%D0%B0%D0%BD%D1%81%D0%BA%D0%BE%D0%B3%D0%BE_%D0%BB%D0%B8%D0%BD%D0%BA%D0%BE%D1%80%D0%B0_%D0%9A%D1%80%D0%BE%D0%BD%D0%BF%D1%80%D0%B8%D0%BD%D1%86_%D0%BE%D1%82_%D1%82%D0%BE%D1%80%D0%BF%D0%B5%D0%B4%D1%8B_%D0%B1%D1%80%D0%B8%D1%82%D0%B0%D0%BD%D1%81%D0%BA%D0%BE%D0%B9_%D0%BF%D0%BE%D0%B4%D0%B2%D0%BE%D0%B4%D0%BD%D0%BE%D0%B9_%D0%BB%D0%BE%D0%B4%D0%BA%D0%B8_HMS_J1_%D1%81%D0%BD%D1%8F%D1%82%D0%BE_6_%D0%BD%D0%BE%D1%8F%D0%B1%D1%80%D1%8F_1916_%D0%92%D0%B8%D0%BB%D1%8C%D0%B3%D0%B5%D0%BB%D1%8C%D0%BC%D1%81%D1%85%D0%B0%D1%84%D0%B5%D0%BD.jpg","page_title":"SMS Kronprinz (1914)","context_page_description":"«Кронпринц Вильгельм» — немецкий дредноут, последний из четырёх линейных кораблей типа «Кёниг» германских имперских ВМС, участвовавших в Первой мировой войне. Назван в честь наследника Германского престола Вильгельма, кронпринца Прусского."},{"page_url":"https://en.wikipedia.org/wiki/Shin_Nemi","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ed/Shin_Nemi_Nat.jpg","page_title":"Shin Nemi","context_page_description":"Shin Nemi, also known as Ma Hne Galay or Shin Mihne, is the 37th Burmese nat in the official pantheon of nats. She is the daughter of Thonbanhla and died of grief from her mother's death."},{"page_url":"https://cy.wikipedia.org/wiki/Donalds,_De_Carolina","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b6/SCMap-doton-Donalds.PNG","page_title":"Donalds, De Carolina","context_page_description":"Tref yn Abbeville County, yn nhalaith De Carolina, Unol Daleithiau America yw Donalds, De Carolina."},{"page_url":"https://tr.wikipedia.org/wiki/Antisemitizm","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fd/Nazi_Anti-Semitic_Propaganda_by_David_Shankbone.jpg","page_title":"Antisemitizm","context_page_description":"Antisemitizm, Yahudi ulusuna, kültürüne ve dinine karşı duyulan düşmanlık, önyargı veya ayrımcılıktır. Her ne kadar etimolojisi antisemitizmin tüm Sami halklarına yönelik olabileceğini ima etse de, terim ortaya çıkışından itibaren sadece Yahudilere yönelik saldırganlığı belirtmek için kullanılmıştır.\\nAntisemitizm Yahudi bireylere karşı gösterilen münferit nefret ve ayrımcılıktan kalabalık grupların, hatta polis ve askerin tüm bir Yahudi cemaatine yönelik örgütlü saldırılarına kadar geniş bir yelpazede meydana gelebilir. Bu baskının en aşırı örnekleri arasında, 1096'daki Birinci Haçlı Seferi, İspanyol Engizisyonu, Yahudilerin 1290'da İngiltere'den, 1492'de İspanya'dan ve 1497'de Portekiz'den kovulmaları, çeşitli pogromlar ve Nazi Almanyası'nın gerçekleştirdiği Holokost gösterilebilir."},{"page_url":"https://es.wikipedia.org/wiki/Batman_Returns","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/60/Pat_Hingle_%284443330082_724d5a94a0_z%29.jpg","page_title":"Batman Returns","context_page_description":"Batman Returns es una película estadounidense dirigida por Tim Burton. La película está basada en el personaje de DC Comics Batman, es una secuela de la exitosa película de 1989, con Michael Keaton repitiendo el papel de Bruce Wayne/Batman. El elenco cuenta con el regreso de Michael Gough como Alfred Pennyworth, y Pat Hingle como Comisionado Gordon. La película presenta a los personajes de Max Shreck, un magnate corrupto de negocios que se une al deformado y trastornado Pingüino para hacerse cargo de Gotham City, ​ así como el personaje de Catwoman, quien busca derrotar al Caballero de la Noche.\\nOriginalmente Burton no quería dirigir una secuela a causa de los sentimientos encontrados en la película anterior. Daniel Waters fue el encargado de hacer el guion; Wesley Strick hizo una reescritura aunque nunca fue acreditado, borrando a personajes como Harvey Dent y Dick Grayson. Antes de que Michelle Pfeiffer fuera elegida para interpretar a Catwoman, Demi Moore y Nicole Kidman fueron candidatas al papel, pero ambas lo rechazaron aunque Kidman interpretaría el rol de la doctora Chase Meridian en Batman Forever."},{"page_url":"https://es.wikipedia.org/wiki/Archivo_Municipal_de_Toledo","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/71/Detalle_Archivo_Secreto_2.jpg","page_title":"Archivo Municipal de Toledo","context_page_description":"El Archivo Municipal de Toledo es un servicio público de carácter administrativo especializado en la gestión y tratamiento de los documentos producidos y recibidos por el Ayuntamiento de la ciudad en el ejercicio de sus funciones, a lo largo de su historia, y que han sido conservados para su utilización en la gestión administrativa, la información ciudadana, la proyección cultural y la investigación científica. Junto con el fondo documental municipal conserva otros de origen público y privado y algunas colecciones."},{"page_url":"https://en.wikipedia.org/wiki/National_Register_of_Historic_Places_listings_in_New_London_County,_Connecticut","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b4/Norwich_Hospital_District_-_Admin_Building_%285804251174%29.jpg","page_title":"National Register of Historic Places listings in New London County, Connecticut","context_page_description":"This is a list of the National Register of Historic Places listings in New London County, Connecticut.\\nThis is intended to be a complete list of the properties and districts on the National Register of Historic Places in New London County, Connecticut, United States. The locations of National Register properties and districts for which the latitude and longitude coordinates are included below, may be seen in an online map.\\nThere are 198 properties and districts listed on the National Register in the county, including 13 National Historic Landmarks. One property was once listed, but has since been delisted.\\nThis National Park Service list is complete through NPS recent listings posted April 17, 2020."},{"page_url":"https://pl.wikipedia.org/wiki/Smart_EQ_Fortwo","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7e/Smart_EQ_forfour_at_IAA_2019_IMG_0653.jpg","page_title":"Smart EQ Fortwo","context_page_description":"Smart EQ Fortwo – samochód elektryczny klasy aut najmniejszych produkowany pod niemiecką marką Smart od 2020 roku."},{"page_url":"https://ja.wikipedia.org/wiki/%E5%AE%87%E7%94%B0%E6%81%B5%E8%8F%9C","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/72/%E5%AE%87%E7%94%B0%E6%81%B5%E8%8F%9C.jpg","page_title":"宇田恵菜","context_page_description":"宇田 恵菜は、日本の俳優、タレント。愛媛県松山市出身。セントラル所属。"},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_personen_geboren_op_24_april","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/84/Jules_Levy_by_Jose_Maria_Mora%2C_1880s.jpg","page_title":"Lijst van personen geboren op 24 april","context_page_description":"Dit is een lijst van personen die geboren zijn op 24 april.\\nDe inhoud van deze pagina is gebaseerd op gegevens in Wikidata. Als er onvolkomenheden in deze lijst zitten, gelieve dan aldaar de gegevens aan te passen. Achter iedere persoon is hiervoor een link aanwezig met de aanduiding bewerken.\\nWijzigingen in Wikidata worden met enige regelmatigheid geautomatiseerd overgenomen naar deze pagina.\\n1086 - Ramiro II van Aragón, Spaanse Monarch van Aragon, monnik bewerken\\n1533 - Willem van Oranje, Nederlandse Prins van Oranje, politicus en militair bewerken\\n1538 - Guglielmo I Gonzaga, lijst van heersers van Mantua, politicus bewerken\\n1575 - Jakob Böhme, Duitse filosoof en theoloog bewerken\\n1581 - Vincentius a Paulo, Franse kapelaan, rooms-katholiek priester bewerken\\n1620 - John Graunt, wiskundige, statisticus en demograaf uit het Koninkrijk Engeland bewerken\\n1633 - Paolo Boccone, botanicus bewerken\\n1644 - Luytien Nijsingh, politicus bewerken\\n1660 - Cornelis Dusart, Nederlandse kunstschilder bewerken\\n1671 - Gian Gastone de' Medici, hertog bewerken\\n1706 - Padre Martini, componist, musicoloog, muziektheoreticus, muziekpedagoog, pianist en historicus bewerken"},{"page_url":"https://de.wikipedia.org/wiki/Bezirk_Schwaz","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/36/Stans_%28Tyrol%29_from_N%2C_%27Herz_Jesu%27_church.jpg","page_title":"Bezirk Schwaz","context_page_description":"Der Bezirk Schwaz ist ein politischer Bezirk des österreichischen Bundeslandes Tirol.\\nIm Westen grenzt er an den Bezirk Innsbruck-Land, im Osten an die Bezirke Kufstein, Kitzbühel und Zell am See, im Norden an Bayern und im Süden an Südtirol."},{"page_url":"https://pt.wikipedia.org/wiki/Wietmarschen","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/0b/Wappen_Wietmarschen.png","page_title":"Wietmarschen","context_page_description":"Wietmarschen é um município da Alemanha localizada no distrito de Grafschaft Bentheim, estado de Baixa Saxônia."},{"page_url":"https://id.wikipedia.org/wiki/Jawa_Timur","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/11/Locator_kota_madiun.png","page_title":"Jawa Timur","context_page_description":"Jawa Timur adalah sebuah provinsi di bagian timur Pulau Jawa, Indonesia. Ibu kotanya terletak di Surabaya. Luas wilayahnya 47.922 km², dan jumlah penduduknya 39.698.631 jiwa.\\nJawa Timur memiliki wilayah terluas di antara 6 provinsi di Pulau Jawa, dan memiliki jumlah penduduk terbanyak kedua di Indonesia setelah Jawa Barat. Jawa Timur berbatasan dengan Laut Jawa di utara, Selat Bali di timur, Samudra Hindia di selatan, serta Provinsi Jawa Tengah di barat. Wilayah Jawa Timur juga meliputi Pulau Madura, Pulau Bawean, Pulau Kangean serta sejumlah pulau-pulau kecil di Laut Jawa, dan Samudera Hindia.\\nProvinsi ini didiami oleh kelompok etnis yang beragam, seperti suku Jawa, suku Madura, dan orang Tionghoa-Indonesia. Sebagian besar masyarakat di Jawa Timur menganut agama Islam, sekitar 96% dari total populasi. Agama lain seperti Kristen, yang sebagian besar dianut oleh orang Tionghoa-Indonesia dan imigran dari Indonesia Timur dan Sumatra Utara, dan juga agama Hindu yang kebanyakan dianut oleh suku Tengger di Taman Nasional Bromo Tengger Semeru dan suku Bali yang mendiami bagian paling timur provinsi yang berbatasan dengan Bali."},{"page_url":"https://fr.wikipedia.org/wiki/Powiat_de_Czarnk%C3%B3w-Trzcianka","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f1/Powiat_czarnkowsko-trzcianecki_location_map.png","page_title":"Powiat de Czarnków-Trzcianka","context_page_description":"Le powiat de Czarnków-Trzcianka est un powiat de la voïvodie de Grande-Pologne, dans le centre-ouest de la Pologne.\\nElle est née le 1ᵉʳ janvier 1999, à la suite des réformes polonaises de gouvernement local passées en 1998.\\nLe siège administratif du powiat est la ville de Czarnków, qui se trouve à 61 kilomètres au nord-ouest de Poznań, capitale de la voïvodie de Grande-Pologne. Le powiat possède trois autres villes : Trzcianka, située à 18 kilomètres au nord de Czarnków, Krzyż Wielkopolski, à 38 kilomètres à l'ouest de Czarnków, et Wieleń, à 27 kilomètres à l'ouest de Czarnków.\\nLe district couvre une superficie de 1808,19 kilomètres carrés. En 2010, sa population totale est de 87 086 habitants, avec une population pour la ville de Czarnków de 11 356 habitants, pour la ville de Trzcianka de 16 756 habitants, pour la ville de Krzyż Wielkopolski de 6 283 habitants, pour la ville de Wieleń de 5 940 habitants et une population rurale de 45 799 habitants."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%90%D1%81%D0%B8%D1%9A%D0%B8_(%D0%9F%D1%80%D0%B8%D0%BC%D0%BE%D1%80%D1%81%D0%BA%D0%B0_%D0%A1%D0%B5%D0%BD%D0%B0)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/07/Assigny%2C_Seine-Maritime%2C_France_%282%29.JPG","page_title":"Асињи (Приморска Сена)","context_page_description":"Асињи насеље је и општина у северној Француској у региону Горња Нормандија, у департману Приморска Сена која припада префектури Дјеп.\\nПо подацима из 2011. године у општини је живело 373 становника, а густина насељености је износила 61,65 становника/km². Општина се простире на површини од 6,05 km². Налази се на средњој надморској висини од 100 метара."},{"page_url":"https://fr.wikipedia.org/wiki/Palais_Galliera,_mus%C3%A9e_de_la_Mode_de_la_ville_de_Paris","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a5/P1030819_Paris_XVI_square_Brignole-Galliera_mus%C3%A9e_Galliera_rwk.JPG","page_title":"Palais Galliera, musée de la Mode de la ville de Paris","context_page_description":"Le palais Galliera, musée de la Mode de la ville de Paris, est un musée français situé dans le 16ᵉ arrondissement de Paris consacré à l'art et l'histoire du vêtement et de la haute couture.\\nLe musée est ouvert au public lors d'expositions temporaires — deux fois par an en moyenne — d'une durée d'environ quatre à six mois chacune. Il n'y a pas de présentation permanente des collections pour des raisons de conservation.\\nIl s'agit d'un des quatorze musées de la ville de Paris gérés depuis le 1ᵉʳ janvier 2013 par l'établissement public administratif Paris Musées."},{"page_url":"https://nl.wikipedia.org/wiki/Nervieux","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/45/Map_commune_FR_insee_code_42155.png","page_title":"Nervieux","context_page_description":"Nervieux is een gemeente in het Franse departement Loire en telt 856 inwoners. De plaats maakt deel uit van het arrondissement Montbrison."},{"page_url":"https://fi.wikipedia.org/wiki/Luettelo_Ilomantsin_julkisista_taideteoksista_ja_muistomerkeist%C3%A4","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/59/Ilomantsi_Uudenmaan_Rakuunarykmentti_memorial.jpg","page_title":"Luettelo Ilomantsin julkisista taideteoksista ja muistomerkeistä","context_page_description":"Luettelo Ilomantsin julkisista taideteoksista ja muistomerkeistä sisältää Ilomantsin kunnassa olevat pysyvät patsaat, muistomerkit ja muistolaatat.\\nLuettelossa on pysyvästi julkisilla paikoilla olevia taideteoksia, muistomerkkejä ja muistolaattoja sekä hautausmailla olevia yleisiä muistomerkkejä ja patsaita. Luettelossa ei mainita rakennusten sisällä ja suljetuilla sisäpihoilla olevia julkisia teoksia eikä yksittäisten hautojen veistoksia. Teokset ovat luettelossa nimensä mukaisessa aakkosjärjestyksessä. Sijaintipaikka on puiston, aukion, rakennuksen tai muun vastaavan nimi ja/tai katuosoite. Alue tarkoittaa kaupunginosaa/kunnanosaa, taajamaa, kylää, osa-aluetta tai asuinaluetta. Karttalinkki osoittaa teoksen sijaintipaikan kymmenien metrien tarkkuudella. Paljastusvuosi on teoksen julkistuksen tai paljastuksen vuosi sijaintipaikalla."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A3%D0%BA%D1%80%D0%B0%D1%97%D0%BD%D1%86%D1%96","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/84/Ukrainian_traditional_clothing_stamps_2004.jpg","page_title":"Українці","context_page_description":"Украї́нці — східнослов'янський етнос, основне і корінне населення України. Як етнос сформувався на землях сучасної України та частин суміжних земель сучасних: Польщі, Білорусі, Молдови, Румунії, Угорщини, Словаччини та Росії. За межами України проживають в Росії, Казахстані, Молдові, Білорусі, Киргизстані, Узбекистані, Польщі, Канаді, США, Аргентині та багатьох інших країнах. Загальна чисельність перевищує 46 мільйонів осіб. З них 37 мільйонів мешкає в Україні. Більшість українців розмовляють українською мовою, що належить до східнослов'янської мовної групи. За релігійною приналежністю — православні та греко-католицькі християни. До XX століття вживали самоназву русь, русини, козаки. Також українців називали рутенами, черкасами, малоросами."},{"page_url":"https://fr.wikipedia.org/wiki/Sarasota","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0b/Edgar%2C_a_blind_green_sea_turtle_at_Mote_Marine_Laboratory.jpg","page_title":"Sarasota","context_page_description":"La ville de Sarasota est le siège du comté de Sarasota en Floride, aux États-Unis. Située sur la côte ouest de la Floride, à environ 85 km au sud de Tampa et à une cinquantaine de kilomètres au sud de St. Petersburg, elle comptait 52 578 habitants en 2007."},{"page_url":"https://it.wikipedia.org/wiki/Dautphetal","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/df/Town_Hall_Buchenau_%28Lahn%29.jpg","page_title":"Dautphetal","context_page_description":"Dautphetal è un comune tedesco di 12.008 abitanti, situato nel land dell'Assia."},{"page_url":"https://en.wikipedia.org/wiki/Drosera_aberrans","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/02/Drosera_aberransDistMap1.png","page_title":"Drosera aberrans","context_page_description":"Drosera aberrans is a perennial tuberous species in the genus Drosera that is native to New South Wales, South Australia, and Victoria. It grows in a rosette 3 to 5 cm in diameter with green, orange-yellow, or red leaves. It is native to southern inland South Australia, southern and central Victoria, and one single collection from New South Wales. It grows in a variety of soils from sand to laterite gravel and limestone clay in mallee woodland, heathland, and open forests. It flowers from July to September.\\nIt was perhaps first illustrated by Ferdinand von Mueller in 1879, which he identified as Drosera whitackeri [sic], though Allen Lowrie and John Godfrey Conran note that this could represent artistic license and may not have been drawn from an actual specimen. Lowrie and Sherwin Carlquist first formally described this taxon in 1992 as a subspecies of Drosera whittakeri. Lowrie and Conran reviewed the specimens of D. whittakeri in 2008 and elevated subsp. aberrans to species rank based on the colony-forming morphology of this species."},{"page_url":"https://pl.wikipedia.org/wiki/Mamut_kolumbijski","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/52/A_Mammoth_Hunt.jpg","page_title":"Mamut kolumbijski","context_page_description":"Mamut kolumbijski – wymarły gatunek trąbowca, mamut zamieszkujący Amerykę Północną od obszarów dzisiejszych północnych stanów USA aż do Kostaryki w epoce plejstocenu. Należał do ostatnich gatunków mamutów, linii zapoczątkowanej przez Mammutus subplanifrons we wczesnym pliocenie. Wyewoluował z mamuta stepowego, który dostał się na kontynent północnoamerykański z Azji około półtora miliona lat temu. Mamut karłowaty z kalifornijskich Channel Islands wyewoluował właśnie z mamuta kolumbijskiego. Natomiast najbliższym współczesnym krewnym tego zwierzęcia jest słoń indyjski.\\nOsiągając 4 m wysokości w kłębie i ważąc od 10 ton, mamut kolumbijski należał do największych gatunków mamutów. Miał długie, zakrzywione ciosy i cztery trzonowce, zastępowane sześciokrotnie w ciągu życia osobnika. Najprawdopodobniej ciosów i trąby używał jak dzisiejsze słonie – do manipulacji przedmiotami, walki i żerowania. Odkrywano kości, włosy, łajno i zawartość żołądków, jednak nieznane są zwłoki. Mamut kolumbijski preferował tereny otwarte, jak prerie. Żywił się roślinami, takimi jak trawy i turzyce. Nie zapuszczał się w rejony arktyczne Kanady, zamieszkiwane przez mamuta włochatego."},{"page_url":"https://it.wikipedia.org/wiki/TT290","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/61/TT290_291.jpg","page_title":"TT290","context_page_description":"TT290 è la sigla che identifica una delle Tombe dei Nobili ubicate nell'area della cosiddetta Necropoli Tebana, sulla sponda occidentale del Nilo dinanzi alla città di Luxor, in Egitto. Destinata a sepolture di nobili e funzionari connessi alle case regnanti, specie del Nuovo Regno, l'area venne sfruttata, come necropoli, fin dall'Antico Regno e, successivamente, sino al periodo Saitico e Tolemaico."},{"page_url":"https://de.wikipedia.org/wiki/Carl_Oscar_Troilius","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/Carl_Oscar_Troilius.jpg","page_title":"Carl Oscar Troilius","context_page_description":"Carl Oscar Troilius war ein schwedischer Generaldirektor und Reichstagsabgeordneter."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_deutschen_Botschafter","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fa/Diplomatic_missions_of_Germany.png","page_title":"Liste der deutschen Botschafter","context_page_description":"Die Liste der deutschen Botschafter enthält die amtierenden Botschafter der Bundesrepublik Deutschland sowie die Ständigen Vertreter bei internationalen Organisationen.\\nSollte der Botschafter abwesend, krank oder nicht vorhanden sein, ist sein Ständiger Vertreter höchster Diplomat im Gastland. Jener ist für gewöhnlich der ranghöchste Mitarbeiter im Stab der jeweiligen Botschaft unterhalb des Missionschefs. Dieser Ständige Vertreter ist für die entsprechende Zeit Geschäftsträger der diplomatischen Angelegenheiten zwischen Gast- und Herkunftsland. Gesandte sind Diplomaten, die vom Rang her mit einem Botschafter ähnlich stehen, allerdings keine Botschaft mit Amtsbezirk verwalten und für gewöhnlich keine Konsulartätigkeiten erledigen.\\nDen Amtsbezirken eines Botschafters sind bei Notwendigkeit Konsulate untergeordnet. Die Bundesrepublik Deutschland unterscheidet hierbei zwischen Generalkonsuln, Konsuln und Honorarkonsuln. Generalkonsuln und Konsuln sind deutsche Beamte, die einem Generalkonsulat bzw. einem Konsulat vorstehen. Honorarkonsuln sind Ehrenbeamte, besitzen meist die Nationalität des Gastlandes und sind befugt, konsularische Amtshandlungen auszuüben."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%92%D0%B8%D0%BB%D0%B5%D0%BD%D0%B4%D0%BE%D1%80%D1%84","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6b/AUT_Willendorf_COA.png","page_title":"Вилендорф","context_page_description":"Вилендорф општина је у округу Нојенкихен у Аустрији, држава Доња Аустрија. Ову општину не треба мешати са чувеном статуетом Вилендорфска Венера, која се налази у Агсбаху, такође у Аустрији. На попису становништва 2011. године, општина Земеринг имала је 897 становника."},{"page_url":"https://it.wikipedia.org/wiki/Giorgio_II_di_Sassonia-Meiningen","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c5/Georg_II._Sachsen-Meiningen.jpg","page_title":"Giorgio II di Sassonia-Meiningen","context_page_description":"Giorgio II, Duca di Sassonia-Meiningen, fu il penultimo Duca di Sassonia-Meiningen, regnando dal 1866 sino alla sua morte.\\nRiformatore del suo stato e notevole politico della sua epoca, divenne noto in particolare come promotore delle arti teatrali, regista, direttore, disegnatore di set e mecenate della musica, al punto da guadagnarsi il soprannome di Theaterherzog."},{"page_url":"https://he.wikipedia.org/wiki/%D7%9C%D7%95%D7%97%D7%9E%D7%AA_%D7%A8%D7%A9%D7%AA","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/1f/S7300.JPG","page_title":"לוחמת רשת","context_page_description":"לוחמת רשת, לוחמה קיברנטית או לוחמת סייבר היא פעולה מלחמתית התקפית הננקטת על ידי ארגון על מנת לחדור למרחב הקיברנטי של היעד במטרה לגנוב ממנו מידע, לרוב בעזרת שימוש ברוגלה ובסוס טרויאני, וכן במטרה לשבש את הפעילות במרחב הקיברנטי ולהסב לו נזק או למערכות אחרות המסתמכות עליו, לרוב באמצעות נוזקה.\\nלוחמת סייבר מכילה בהגדרתה את תחום הטרור הקיברנטי, ושכיחה ככלי לאיסוף מודיעין עבור גופי ביון, ארגוני טרור, חברות מודיעין עסקי וכדומה.\\nהגנת סייבר היא הגנה על נכסים במרחב הקיברנטי מפני זליגת מידע מתוך המרחב או מפני תקיפות סייבר המכוונות לגנוב מידע, לשבש אותו או לפגוע בו. הגנת סייבר כוללת לעיתים איסוף מודיעין על יריבים פוטנציאליים, שימוש בכלי ניטור לפיקוח על הפעילות בנכס ואיתור חולשות ארגוניות, אבטחתיות וקבצים מזיקים, לרבות באופן אקטיבי. כמו כן, התחום כולל פעילות שתכליתה זיהוי מקור התקיפה וייעודה. חקירות מסוג יכולות להתבצע באמצעות פעילות אקטיבית ושימוש בכלים מחוץ למרחב עליו מגנים.\\nהשפעה בסייבר היא שימוש במרחב האינטרנטי הציבורי להשפעה פסיכולוגית על התנהגותם של אנשים באמצעות התחזות, חשיפת נושא מסוים למודעות בחשיפה רחבה, גיוס כוח אדם, הטיית תגובות, שימוש בפרסומות, הנדסה חברתית ועוד.\\nהשבועון הבריטי \\"אקונומיסט\\" הגדיר את הזירה הקיברנטית כ\\"זירת הלחימה החמישית הנוספת על ארבע הזירות המסורתיות\\"."},{"page_url":"https://fa.wikipedia.org/wiki/%D9%86%DB%8C%D9%88%D8%AA%D9%88%D9%86_%D8%A7%D8%B3%D8%AA%DB%8C%D9%88%D8%A7%D8%B1%D8%AA","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/Cree_Bridge.jpg","page_title":"نیوتون استیوارت","context_page_description":"نیوتون استیوارت یک شهرک در اسکاتلند است که در دامفریس و گالووی واقع شده‌است. نیوتون استیوارت ۴٬۰۹۲ نفر جمعیت دارد."},{"page_url":"https://ceb.wikipedia.org/wiki/Schmiedeberg_(kapital_sa_munisipyo)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e7/Panorama_Schmiedeberg.jpg","page_title":"Schmiedeberg (kapital sa munisipyo)","context_page_description":"Kapital sa munisipyo ang Schmiedeberg sa Alemanya. Nahimutang ni sa estado pederal sa Saxony, sa sidlakang bahin sa nasod, 190 km sa habagatan sa Berlin ang ulohan sa nasod. 436 metros ibabaw sa dagat kahaboga ang nahimutangan sa Schmiedeberg, ug adunay 4,806 ka molupyo.\\nAng yuta palibot sa Schmiedeberg kay kabungtoran sa habagatang-sidlakan, apan sa amihang-kasadpan nga kini mao ang patag. Ang kinahabogang dapit sa palibot dunay gihabogon nga 614 ka metro ug 1.0 km sa sidlakan sa Schmiedeberg. Dunay mga 185 ka tawo kada kilometro kwadrado sa palibot sa Schmiedeberg medyo hilabihan populasyon. Ang kinadul-ang mas dakong lungsod mao ang Freital, 18.4 km sa amihanan sa Schmiedeberg. Sa rehiyon palibot sa Schmiedeberg, mga bungtod, ug mga lasang talagsaon komon.\\nHapit nalukop sa lasang nga dagomkahoy ang palibot sa Schmiedeberg. Ang klima hemiboreal. Ang kasarangang giiniton 5 °C. Ang kinainitan nga bulan Hulyo, sa 16 °C, ug ang kinabugnawan Disyembre, sa -7 °C."},{"page_url":"https://en.wikipedia.org/wiki/Greeks_in_Austria","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/73/Rigas_Velestinlis_memorial_%2812007921173%29.jpg","page_title":"Greeks in Austria","context_page_description":"The Greek community in Austria numbers between 5,000 and 18,000 people. They are located all around the country but the main community is located in Vienna."},{"page_url":"https://de.wikipedia.org/wiki/Opernhaus_Odessa","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c7/%D0%9E%D0%B4%D0%B5%D1%81%D1%81%D0%BA%D0%B8%D0%B9_%D1%82%D0%B5%D0%B0%D1%82%D1%80_%D0%BE%D0%BF%D0%B5%D1%80%D1%8B_%D0%B8_%D0%B1%D0%B0%D0%BB%D0%B5%D1%82%D0%B0.jpg","page_title":"Opernhaus Odessa","context_page_description":"Das Opernhaus Odessa ist eines der Wahrzeichen des ukrainischen Schwarzmeerhafens Odessa. 1926 erhielt es den Ehrentitel Akademisches Theater."},{"page_url":"https://en.wikipedia.org/wiki/Dirk_Orlishausen","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/9b/Orlishausen.JPG","page_title":"Dirk Orlishausen","context_page_description":"Dirk Orlishausen is a German retired football goalkeeper, and currently the goalkeeper coach of Hansa Rostock."},{"page_url":"https://fr.wikipedia.org/wiki/Jean-Fran%C3%A7ois_Beaupr%C3%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/19/Jean-Fran%C3%A7ois_Beaupr%C3%A9_chez_l%27Aquarium_Caf%C3%A9-Bar.jpg","page_title":"Jean-François Beaupré","context_page_description":"Jean-François Beaupré est un acteur et auteur-compositeur-interprète québécois né à Joliette le 25 avril 1970.\\nActif dans le doublage, il est notamment la voix québécoise régulière de Adam Scott, Chris Pine, Ethan Hawke, 50 Cent et Eric Bana."},{"page_url":"https://en.wikipedia.org/wiki/Gramzda_Parish","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/96/Gramzda_parish.gif","page_title":"Gramzda Parish","context_page_description":"Gramzda Parish is an administrative unit of Priekule Municipality, Latvia. The parish has a population of 732 and covers an area of 84.69 km²."},{"page_url":"https://he.wikipedia.org/wiki/%D7%93%D7%A8%D7%90%D7%92%D7%95%D7%9E%D7%99%D7%A8_%D7%99%D7%95%D7%91%D7%90%D7%A0%D7%95%D7%91%D7%99%D7%A5%27","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6d/Dragi_Jovanovi%C4%87.jpg","page_title":"דראגומיר יובאנוביץ'","context_page_description":"דְרָאגוֹמִיר יוֹבָאנוֹבִיץ' היה פוליטיקאי סרבי, משתף פעולה עם הנאצים, אשר כיהן כמפקד משטרת ביטחון הפנים, ובהמשך כראש עיריית בלגרד הממונה מטעם ממשלת הבובות של מילאן נדיץ'. לאחר מלחמת העולם השנייה, נשפט, הורשע והוצא להורג."},{"page_url":"https://ko.wikipedia.org/wiki/%EC%BD%94%EB%A1%9C%EB%82%98%EA%B7%B8%EB%9E%98%ED%94%84","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/18/Cp22liberationdaytransient.png","page_title":"코로나그래프","context_page_description":"코로나그래프는 빛이 강한 천체의 강한 빛을 막아 빛이 강한 천체 주변의 흐린 물체를 볼 수 있게 하는 특수한 망원경이다. 원래는 태양의 코로나를 개기 일식이 아닌 평소에도 관측하기 위해 개발했다. 여기에는 오컬팅 마스크가 이용되며, 이것으로 외계 행성을 발견하고 별주위 원반을 발견한 사례도 있다."},{"page_url":"https://azb.wikipedia.org/wiki/%D9%86%D9%88%DB%8C%D9%85%D8%A7%D8%B1%DA%A9%D8%AA_%D8%A7%DB%8C%D9%86_%D8%AF%D8%B1_%D8%A7%D9%88%D8%A8%D8%B1%D9%81%D8%A7%D9%84%D8%AA%D8%B2","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/33/Ludwigskanal_Wandertafel-Zeugenbergrunde.jpg","page_title":"نویمارکت این در اوبرفالتز","context_page_description":"نویمارکت این در اوبرفالتز آلمانین بایرن ایالتینده یئر آلان بیر شهردیر و ۴۲۴ متر دنیز سوییه‌سیندن اۇجالیقی وار. ۲۰۱۵-جی ایلین نۆفوس ساییمی اساسیندا ۳۹۴۶۳ نفر دیر. بۇ شهرین ۷۹٫۰۳ کیلومتر موربّع ساحه‌سی وار."},{"page_url":"https://it.wikipedia.org/wiki/Franco_Gozzi","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/22/Ferrari_-_Scaglietti%2C_Swater%2C_Gozzi_and_Amadesi.jpg","page_title":"Franco Gozzi","context_page_description":"Franco Gozzi è stato un dirigente sportivo italiano."},{"page_url":"https://ca.wikipedia.org/wiki/Papil%C2%B7ledema","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a6/Fundal_photograph_showing_severe_papilloedema_in_the_right_eye.jpg","page_title":"Papil·ledema","context_page_description":"El papil·ledema o edema de papil·la és la inflamació de la papil·la òptica que és causada per l'increment de la pressió intracranial. La inflamació és generalment bilateral, però pot ser unilateral, que és extremadament rara i pot ocórrer en un període d'hores o setmanes.\\nEl papil·ledema per hipertensió intracranial pot passar en un sol ull o pot ser més greu en un ull que en l'altre o no passar en absolut malgrat l'evidència d'hipertensió intracranial. Quan es presenta un edema de papil·la, en ser un estat patològic, requereix una recerca per evitar la pèrdua de la visió. El papil·ledema sovint pot ser un signe de la dita història d'hipertensió intracranial. Quan hi ha edema de papil·la en un ull també s'ha d'assegurar que no hi ha cap problema local en l'òrbita que està causant l'edema de papil·la unilateral. Per exemple, un tumor del nervi òptic darrere del globus ocular també pot causar inflor o bloqueig de la circulació a la conca de l'ull. És important comptar amb estudis d'ecografia i ressonància magnètica per estar segur."},{"page_url":"https://fr.wikipedia.org/wiki/Zbigniew_Boniek","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6e/Euro_2012_qualifying_play-offs_draw_%282%29.jpg","page_title":"Zbigniew Boniek","context_page_description":"Zbigniew Kazimierz Boniek, né le 3 mars 1956 à Bydgoszcz, est un ancien joueur international et entraîneur polonais de football. Il est depuis le 26 octobre 2012, le président de la fédération polonaise de football.\\nFormé dès le plus jeune âge au Zawisza Bydgoszcz, Zbigniew Boniek devient international polonais grâce à son parcours avec le Widzew Łódź, l'un des meilleurs clubs de Pologne à cette époque. Brillant lors des Coupes du monde 1978 et 1982, durant lesquelles il atteint respectivement le second tour et les demi-finales, il est repéré par le club italien de la Juventus, qui est l'un des plus grands d'Europe et avec lequel il va prendre une dimension mondiale et remporter de nombreux trophées. Après trois saisons passées chez les Bianconeri, il s'engage avec l'AS Rome, qui sera son dernier club.\\nAprès avoir pris sa retraite en 1988, Zbigniew Boniek décide de rester en Italie et de commencer une formation d'entraîneur. Mais des expériences infructueuses à Lecce ou Bari l'incitent à ne pas aller plus loin, malgré un passage par le poste de sélectionneur de l'équipe de Pologne en 2002."},{"page_url":"https://he.wikipedia.org/wiki/%D7%96%D7%A0%D7%91%D7%95%D7%AA_%D7%97%D7%A8%D7%91","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cf/Tachypleus_gigas.JPG","page_title":"זנבות חרב","context_page_description":"זנבות חרב היא סדרה של פרוקי-רגליים ימיים בעלי קרבה רחוקה לעכבישנים, בתוכה שרדה כיום משפחה יחידה - סרטני פרסה. הסדרה הקרובה לה ביותר היא של עקרבי הים הטורפניים הענקיים מעידן הפלאוזואיקון.\\nבני סדרה זו התקיימו מתקופת הסילור שבפלאוזואיקון ועד ימינו. מינים אלה לא השתנו כלל במשך מיליוני שנים, אך רוב המינים בסדרה נכחדו. הם יצורים שטוחים בעלי שריון חיצוני גדול המגן על הבטן והרגליים הקטנים ומאחורי הגוף ישנו זנב מחודד שהקנה להם את שמם. מינים אלה יכולים להגיע לעיתים לאורך 60 ס\\"מ.\\nבני הסדרה חיים בעיקר בימים הרדודים, אך הם מטילים ביצים בחופים חוליים ומתכנסים בהם בהמוניהם."},{"page_url":"https://simple.wikipedia.org/wiki/Makgeolli","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/71/Makgeolri.jpg","page_title":"Makgeolli","context_page_description":"Makgeolli is a Korean traditional rice wine. Made from rice, it is a milky brew with an alcohol content of 6 to 7 percent. Rice, the main ingredient of it, is not sweet in itself, so Nuruk is also used to make it. Once boiled rice and Nuruk are mixed, the enzymes in Nuruk break down carbohydrates in rice into sugar. Then the sugar meets yeasts in Nuruk and there begins fermentation. Because the fermentation keeps on going, Makgeolli should be drunk as soon as possible once it is opened.\\nIt has a long history. Ancient people made liquor with grains such as wheat and rice after they found the way to grow them. That is the beginning of it. There are some records about it. For example, a book written in Three Kingdoms of Korea, it says many people drank ‘grain liquor.’ Moreover, in a document about the brewing of Joesun Dynasty, there says Makgeolli had had long history and been considered as liquor of the folk. Made from newly harvested rice, it was regarded as sacred gift from God. In addition, it played an important role in religious event like praying ceremony for a year of abundance.\\nCompared to other liquor, it is good for health."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%95%D0%BA%D0%BE%D1%81%D0%B8%D1%81%D1%82%D0%B5%D0%BC%D0%B8_%D0%BA%D0%BE%D0%BF%D0%BD%D0%B5%D0%BD%D0%B8%D1%85_%D0%B2%D0%BE%D0%B4%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/54/Oiseaux_sur_le_Gange_%C3%A0_B%C3%A9nar%C3%A8s_%287%29.jpg","page_title":"Екосистеми копнених вода","context_page_description":"Екосистеми копнених слатких вода су подскуп Земљиних водених екосистема. Они обухватају језера и баре, реке, потоке, изворе и мочваре. Они су супротност морских екосистема који имају већи садржај соли. Слатководна станишта могу се класификовати по различитим факторима, укључујући температуру, продор светлости, хранљиве материје и вегетацију.\\nСлатководни екосистеми могу се поделити на екосистеме стајаћих вода и екосистеме текућих вода.\\nЛимнологија проучава слатководне екосистеме. Она је део хидробиологије.\\nПрвобитни покушаји разумевања и праћења слатководних екосистема били су подстакнути претњама по здравље људи. Рани мониторинг фокусиран је на хемијске показатеље, затим на бактерије, и на крају на алге, гљивице и протозое. Нова врста мониторинга укључује квантификацију различитих група организама и мерење услова који су повезани са њима."},{"page_url":"https://en.wikipedia.org/wiki/Lari_Constituency","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2c/Tourist_at_Lari_View_Point.jpg","page_title":"Lari Constituency","context_page_description":"Lari Constituency is an electoral constituency in Kenya, located forty kilometers from Nairobi along the Nairobi-Nakuru highway. Lari is located in the Western part of Kiambu County. The constituency was established in 1966. Lari borders Kinangop to the North, Limuru to the South, Githunguri and Gatundu North constituencies to the east and Naivasha Constituency to the west. Lari is one of the 12 sub-counties in Kiambu County, and is further divided to five wards each electing a representative to the Kiambu County Assembly.\\nAccording to the 2009 Census Lari has a population of 123,895 people. The constituency is predominantly rural. The main towns in the area are Kijabe, Kinale, Kimende and Nyambari."},{"page_url":"https://ja.wikipedia.org/wiki/AmiinA","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/04/AmiinA-s_20180506%281%29.jpg","page_title":"AmiinA","context_page_description":"amiinAは日本の女性アイドルユニット。"},{"page_url":"https://it.wikipedia.org/wiki/Specie_di_Orobanche","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/52/Orobanche_variegata_1b.jpg","page_title":"Specie di Orobanche","context_page_description":"Elenco delle specie di Orobanche.\\nLa seguente lista è tratta principalmente dalla checklist \\"The Plant List\\"; altre specie sono tratte dalla checklist \\"The Euro+Med PlantBase\\"."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9C%D0%BE%D1%81%D1%8C%D0%BF%D0%B0%D0%BD%D0%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/48/Szlachecka_korona.jpg","page_title":"Мосьпане","context_page_description":"Мосьпане або Мілорде — форма звертання або титул ґречності. Походить від звертання «милостивий пане» або «мій пане».\\nФорма «мілорд» запозичена у середньофранцузькій мові від слів «millourt» або «milor», що означають шляхетну чи багату людину."},{"page_url":"https://fr.wikipedia.org/wiki/Jean_Thienpont","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cd/Jean_Thienpont.jpg","page_title":"Jean Thienpont","context_page_description":"Jean-Ignace Thienpont, né le 7 octobre 1774 à Etikhove et mort le 26 septembre 1863 à Audenarde, est un magistrat et homme politique belge."},{"page_url":"https://eu.wikipedia.org/wiki/Heimweiler","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/58/Heimweiler1.jpg","page_title":"Heimweiler","context_page_description":"Heimweiler Alemaniako udalerria da. Renania-Palatinatua estatuan kokatuta dago, Bad Kreuznach barrutian. 2014an 401 biztanle zituen 9,07 kilometro koadrotan banatuta."},{"page_url":"https://de.wikipedia.org/wiki/Josep_Renau","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3b/Josep_Renau_Erfurt.jpg","page_title":"Josep Renau","context_page_description":"Josep Renau war ein spanischer Maler, Grafiker und Fotomontagekünstler. Sein vollständiger Name war Josep Renau Berenguer."},{"page_url":"https://ms.wikipedia.org/wiki/Garis-garis_Fraunhofer","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b5/Spectrum_of_blue_sky.svg","page_title":"Garis-garis Fraunhofer","context_page_description":"Dalam bidang fizik dan optik, garis-garis Fraunhofer adalah sekumpulan garis spektrum yang dinamakan sempena ahli fizik Jerman, Joseph von Fraunhofer. Garis-garis ini asalnya dilihat sebagai ciri-ciri gelap di dalam spektrum optik Matahari."},{"page_url":"https://fr.wikipedia.org/wiki/Carcharodontosaurinae","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/Giganotosaurus_carolinii_DSC_2950.jpg","page_title":"Carcharodontosaurinae","context_page_description":"Les Carcharodontosaurinae forment une sous-famille éteinte de dinosaures théropodes, classés parmi les Carcharodontosauridae. Ils vivaient en Amérique du Sud et en Afrique du Nord au Crétacé, de l'Aptien au Turonien, soit il y a environ entre ≃125,0 et 89,8 millions d'années.\\nCette sous-famille a d'abord été nommée Giganotosaurinae par Coria & Currie en 2006, mais dès l'année suivante Steve Brusatte et Paul Sereno érigent la sous-famille des Carcharodontosaurinae en reléguant le clade ne regroupant que les trois espèces argentines au rang de tribu sous le nom de Giganotosaurini. Ce changement est repris dans les publications ultérieures sur le sujet."},{"page_url":"https://azb.wikipedia.org/wiki/%D9%86%D8%A7%D9%BE%D9%88%D9%84%D8%A6%D9%88%D9%86%D8%8C_%D8%A7%D9%88%D9%87%D8%A7%DB%8C%D9%88","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/bf/OHMap-doton-Napoleon.png","page_title":"ناپولئون، اوهایو","context_page_description":"ناپولئون، اوهایو آمریکانین اوهایو ایالتیندا یئر آلان بیر شهردیر و ۱۷٫۰۷ کیلومتر موربّع ساحه سی وار. ۲۰۱۰-جی ایلين نۆفوس ساییمی اساسیندا ۸۷۴۹ نفر و اها‌لی سیخلیغی ۵۴۵٫۷ اینسان کیلومتر موربّع دیر. بۇ شهر ۲۰۷ متر دنیز سئوییه‌سیندن اۇجالیقیدا یئرلشیر."},{"page_url":"https://fr.wikipedia.org/wiki/Scandale_des_d%C3%A9corations_de_1887","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/Caran_d%27ache_ferblanterie_632.jpg","page_title":"Scandale des décorations de 1887","context_page_description":"Le scandale des décorations de 1887, aussi appelé l'affaire des décorations par la presse de l'époque, est un scandale politico-financier français de trafic de décorations, qui éclabousse le président de la République, Jules Grévy, et le contraint à la démission le 2 décembre 1887. Il ne faut pas confondre cette affaire avec celle du trafic des décorations de 1926 impliquant un fonctionnaire, Marcel Ruotte."},{"page_url":"https://pt.wikipedia.org/wiki/Hydra_(Arg%C3%A9lia)","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/ae/Val_d%27Hydra.jpg","page_title":"Hydra (Argélia)","context_page_description":"Hydra é um município localizado na província de Argel, no norte da Argélia. Sua população era de 31 133 habitantes, em 2008."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%9D%D0%B0%D1%82%D0%B0%D0%BB%D0%B8%D1%8F_%D0%9F%D1%83%D1%88%D0%BA%D0%B8%D0%BD%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/53/%D0%90%D0%BB%D0%B5%D0%BA%D1%81%D0%B0%D0%BD%D0%B4%D1%80_%D0%90%D0%BB%D0%B5%D0%BA%D1%81%D0%B0%D0%BD%D0%B4%D1%80%D0%BE%D0%B2%D0%B8%D1%87_%D0%9F%D1%83%D1%88%D0%BA%D0%B8%D0%BD_1851.jpg","page_title":"Наталия Пушкина","context_page_description":"Наталия Пушкина, известна също като Наталия Пушкина-Ланская е съпруга на руския поет Александър Пушкин. След смъртта на Пушкин се омъжва за генерал Пьотър Ланской. Нейната роля в събитията около дуела на Пушкин продължава и днес да бъде предмет на дискусии, въпреки че новооткритите документи и писма променят в значителна степен представата за нейната личност."},{"page_url":"https://fr.wikipedia.org/wiki/M%C3%A9thode_cangjie","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2e/Cjrk-t10.png","page_title":"Méthode cangjie","context_page_description":"La méthode cangjie est une méthode d'entrée informatique permettant de saisir des sinogrammes, fondée sur leur composition graphique et étymologique. Les touches du clavier représentent 24 « radicaux » du chinois ; néanmoins, la décomposition n'est fondée ni sur les radicaux ou clefs traditionnelles de Kangxi, ni sur l'ordre standard des traits. Il s'agit d'une décomposition géométrique. Les 214 clés du chinois n'étant pas toutes représentées, il faut donc parfois parer une des formes utilisées, en s'appuyant sur le ou les premiers traits.\\nInventée en 1976 par Chu Bong-Foo, elle tire son nom du légendaire Cang Jie, ministre de l'empereur qui aurait inventé les caractères chinois. Ce nom a été suggéré par Chiang Wei-kuo, alors ministre de la Défense de Taïwan. Bien que la méthode soit conçue à l'origine pour les caractères traditionnels, elle a depuis été repensée pour inclure les caractères simplifiés."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%9D%D0%B5%D1%84%D1%82%D0%BE%D0%BF%D1%80%D0%BE%D0%B4%D1%83%D0%BA%D1%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/44/Asphalt_Concrete.jpg","page_title":"Нефтопродукт","context_page_description":"Нефтопродуктите са материали, произведени от суров нефт. Обикновено това става в нефтени рафинерии. За разлика от петролните дестилати, които са точно определени чисти химични съединения, нефтопродуктите са сложни смеси. По-голямата част от нефта се превръща в нефтени продукти, които включват няколко класа горива.\\nСпоред състава на суровия нефт и в зависимост от търсенето на пазара, рафинериите могат да произвеждат различни нефтопродукти. Най-големият дял на нефтопродукти се използва като „преносители на енергия“, например различни видове мазут и бензин. Тези горива включват или могат да бъдат смесени, за да се получи керосин, дизел и други тежки горива. По-тежките частици също могат да бъдат използвани за производство на асфалт, катран, парафин, смазки и други тежки масла. Рафинериите, също така, произвеждат други химикали, някои от които се използват в химични процеси за получаването на пластмаси и други полезни материали. Тъй като петролът често съдържа няколко процента молекули, съдържащи сяра, последната често се произвежда като вторичен продукт. Въглерод, под формата на петролен кокс, и водород също могат да се произвеждат като нефтени продукти."},{"page_url":"https://mk.wikipedia.org/wiki/%D0%98%D1%81%D1%82%D0%BE%D1%80%D0%B8%D1%98%D0%B0_%D0%BD%D0%B0_%D0%B8%D1%81%D0%BB%D0%B0%D0%BC%D0%BE%D1%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/19/Cairo%28js%29.jpg","page_title":"Историја на исламот","context_page_description":"Историја на исламот — историјата на исламот како религија и општествена установа. Според исламот, погрешно е да се каже дека историјата на Исламот во Арабија започнала со муслиманскиот пророк Мухамед во VII век. Според исламската вера и Светиот текст, исламската историја започнува со Адам и Ева. Тие се сметаат за први апостоли на Бог. Подоцна, многу пророци како Аврам, Мојсеј, Исус, се предавале на истата вера, макар и во различни региони или во различни точки на времето.\\nКако и повеќето светски религии, историската еволуцијата на исламот има значително влијание врз политичките, економските и воените географски области. Исламскиот историски развој има влијание и надвор од исламскиот свет. Еден век по смртта на Мухамед, исламска империја се простирала од Атлантскиот Океан на запад до Средна Азија на исток. Последователните империи како Омејадската империја, Абасидската, Фатимидската, Могулската, Сефидската, и Османлиската биле меѓу најголемите и најмоќните во светот. Исламската цивилизација создала безброј центри нс полето на културата и науката преку голем број на истакнати научници, астрономи, математичари, лекари, медицински сестри и филозофи во текот на Златниот век на исламот."},{"page_url":"https://pl.wikipedia.org/wiki/Zbiorniki_wodne_w_Radzanowie","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/Radzanow_Pond_%281%29.jpg","page_title":"Zbiorniki wodne w Radzanowie","context_page_description":"Zbiorniki wodne w Radzanowie – zespół czterech sztucznych zbiorników wodnych zlokalizowanych na północ od Radzanowa, w odległości około trzech kilometrów na południe od Parku Zdrojowego w Busku Zdroju.\\nNa zespół składają się, począwszy od zachodu: Staw Rogowy, Staw Duży Ogrodowy, Staw Piaskowy i zbiornik rekreacyjny Radzanów.\\nZbiornik Radzanów o powierzchni 11 hektarów powstał w 2010. Obecnie mogą z niego korzystać jedynie wędkarze, gdyż kąpiel w nim jest zabroniona z uwagi na zły stan wód. Akwen jest zarybiany i pozostaje w zarządzie Koła Wędkarskiego z Buska-Zdroju, stanowiąc jego wodę wewnętrzną. Na zbiorniku rozgrywane są zawody wędkarskie. Wolno tu uprawiać wędkarstwo spławikowo-gruntowe, spinningowe, podlodowe, muchowe. Dominującymi rybami są karp, karaś i leszcz. W wodach zbiornika żyją też płocie, okonie, szczupaki, sandacze, sumy, amury, liny i tołpygi. Do terenu zbiornika przylega obszar rekreacyjny z boiskiem do piłki plażowej i wypożyczalnią sprzętu wodno-rekreacyjnego. Znajduje się tu także mała gastronomia, toalety i pomieszczenia socjalne."},{"page_url":"https://es.wikipedia.org/wiki/San_Luis_de_Palenque","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1c/El_Llanerazo.jpg","page_title":"San Luis de Palenque","context_page_description":"San Luis de Palenque es uno de los 19 municipios del departamento de Casanare, en el oriente de Colombia. Su área urbana está ubicado en el centro del departamento, a 95 km de Yopal, la capital del departamento, y a 446 km de Bogotá, la capital del país.\\nSu jurisdicción tiene una extensión de 3.052 km², equivalente a un 6,82% de la superficie total de Casanare, y su población es de 6.982 habitantes, distribuidos en los 7 barrios que conforman el área urbana y en las 45 veredas que conforman su jurisdicción, de las cuales la más importante es San Rafael de Guanapalo.\\nLa ganadería es la actividad principal que se desarrolla; sin embargo, el municipio también ve reflejado su potencial en el sector minero energético dada la explotación de hidrocarburos que allí se realiza.\\nLas condiciones biofísicas del municipio de clima cálido, en sabanas inundables de la Orinoquía, ricas en diversas especies de flora y fauna y recursos hidrobiológicos, son parte del patrimonio y riqueza natural del municipio."},{"page_url":"https://sr.wikipedia.org/wiki/Spisak_hidroaviona,_lete%C4%87ih_%C4%8Damaca_i_amfibija","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/5a/Donnet-Denhaut_DD.8.jpg","page_title":"Spisak hidroaviona, letećih čamaca i amfibija","context_page_description":"Spisak hidroaviona, letećih čamaca i letećih amfibija, je sistematizovani prikaz najpoznatijih vazduhoplova ove vrste. Pregled je sistematizovan po zemljama i proizvođačima."},{"page_url":"https://en.wikipedia.org/wiki/Historical_Left","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1b/Agostino_Depretis.jpg","page_title":"Historical Left","context_page_description":"The Left group, later called Historical Left by historians to distinguish it from the left-wing groups of the 20th century, was a liberal and reformist parliamentary group in Italy during the second half of the 19th century. The members of the Left were also known as Democrats or Ministerials. Different to its Right counterpart, the Left was the result of coalition who represented Northern and Southern middle class, urban bourgeoisie, small businessmen, journalists and academics. It also supported a right to vote and the public school for all children. Moreover, the party was against the high tax policies promoted by the Right. After the 1890s, the Left began to show more conservative tendencies, including advocating breaking strikes and protests and promoting a colonialist policy in Africa."},{"page_url":"https://en.wikipedia.org/wiki/Cranves-Sales","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/16/Cranves-sales.JPG","page_title":"Cranves-Sales","context_page_description":"Cranves-Sales is a commune in the Haute-Savoie department in the Auvergne-Rhône-Alpes region in south-eastern France."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A0%D0%B5%D0%B9%D0%BD%D0%BE%D0%BB%D1%8C%D0%B4%D1%81,_%D0%9A%D0%B5%D0%B2%D0%B8%D0%BD_(%D1%84%D0%B8%D0%B3%D1%83%D1%80%D0%B8%D1%81%D1%82)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/Four_Continents_Championships_2013_%E2%80%93_Men.jpg","page_title":"Рейнольдс, Кевин (фигурист)","context_page_description":"Кевин Рейнольдс — канадский фигурист, выступавший в мужском одиночном катании. Чемпион четырёх континентов, серебряный призёр Олимпийских игр 2014 в командных соревнованиях, многократный серебряный и бронзовый призёр чемпионатов Канады, бронзовый призёр чемпионата четырёх континентов 2010 года. Известен за владение сложными прыжками и исполнением двух четверных прыжков в короткой программе.\\nРейнольдс первый фигурист, исполнивший два четверных прыжка в короткой программе. Первый фигурист, который исполнил пять четверных прыжков в одном соревновании.\\nПо состоянию на 20 апреля 2017 года занимал 30-е место в рейтинге Международного союза конькобежцев."},{"page_url":"https://en.wikipedia.org/wiki/List_of_public_art_in_Fort_Wayne,_Indiana","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a8/Anthony_Wayne_Bldg.jpg","page_title":"List of public art in Fort Wayne, Indiana","context_page_description":"This is a list of public art in Fort Wayne, Indiana.\\nThis list applies only to works of public art accessible in an outdoor public space. For example, this does not include artwork visible inside a museum.\\nMost of the works mentioned are sculptures. When this is not the case it is stated next to the title."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkmale_in_Zerbst/Anhalt","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f2/Zerbst%28Anhalt%29Tr%C3%BCben%2Cev.Dorfkirche.jpg","page_title":"Liste der Kulturdenkmale in Zerbst/Anhalt","context_page_description":"In der Liste der Kulturdenkmale in Zerbst/Anhalt sind alle Kulturdenkmale der Gemeinde Zerbst/Anhalt und ihrer Ortsteile aufgelistet. Grundlage ist das Denkmalverzeichnis des Landes Sachsen-Anhalt, das auf Basis des Denkmalschutzgesetzes vom 21. Oktober 1991 durch das Landesamt für Denkmalpflege und Archäologie Sachsen-Anhalt erstellt und seither laufend ergänzt wurde."},{"page_url":"https://ca.wikipedia.org/wiki/Joan_Romagosa_i_Pros","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3f/Juan_Romagosa.jpg","page_title":"Joan Romagosa i Pros","context_page_description":"Joan Romagosa i Pros va ser un militar carlí.\\nVa iniciar la seva carrera militar durant la Guerra del Francès. El 1822 va ser el cap de la insurrecció absolutista contra el règim liberal. El 1825 va ser designat governador del corregiment de Mataró i va ser ascendit a mariscal de camp. Durant la revolta de 1827 es va mantenir fidel al govern malgrat haver-hi sospites que podria haver estat un dels impulsors de la revolta. El 1831 va ser ascendit a general i quan va morir Ferran VII va marxar cap a França.\\nEl mes de setembre del 1834 va sortir en vaixell de Gènova i va desembarcar a les platges de Sant Salvador i Barà, com a comandant general de les tropes carlines del Principat en la Guerra dels Matiners. Sembla que mantenia contactes amb l'infant Sebastià, el qual ja conspirava contra Isabel II. Però Romagosa fou detingut malgrat haver-se refugiat a casa el capellà de Selma i afusellat a Igualada, juntament amb el seu secretari, pocs dies després."},{"page_url":"https://pl.wikipedia.org/wiki/Landwar%C3%B3w_(gmina)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ad/Lentvaris._Seni%C5%ABnija.JPG","page_title":"Landwarów (gmina)","context_page_description":"Gmina Landwarów – gmina w rejonie trockim okręgu wileńskiego na Litwie, położona w rejonie etnograficznym Dzukija. Ośrodkiem administracji jest miasto Landwarów."},{"page_url":"https://en.wikipedia.org/wiki/Sonny_Bill_Williams","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/36/Sonny_Bill_Williams%2C_Roosters_V_Warriors_2014.JPG","page_title":"Sonny Bill Williams","context_page_description":"Sonny William \\"Bill\\" Williams is a New Zealand professional rugby league footballer of Samoan descent who plays as a second-row forward for the Sydney Roosters in the National Rugby League, and New Zealand Kiwis at international level.\\nHe is a former professional rugby union footballer and heavyweight boxer. He is only the second person to represent New Zealand in rugby union after first playing for the country in rugby league, and is one of only 21 players to have won multiple Rugby World Cups.\\nWilliams began his career in rugby league, and played as a second-row forward over seven seasons in two spells in the National Rugby League, with the Canterbury Bulldogs and Sydney Roosters. He has won 12 caps for New Zealand and won the RLIF Awards for Rookie of the Year in 2004 and International Player of the Year in 2013.\\nHe first moved to rugby union in 2010 and had spells playing for Toulon in France, Canterbury, Counties Manukau, the Crusaders, Chiefs and Blues in New Zealand and Panasonic Wild Knights in Japan. He won 58 caps for New Zealand, and was part of the teams that won the 2011 and 2015 World Cups."},{"page_url":"https://it.wikipedia.org/wiki/Napoleone_Bonaparte","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/Montfort_-_Adieux_de_Napoleon_a_la_Garde_imperiale.jpg","page_title":"Napoleone Bonaparte","context_page_description":"Napoleone Bonaparte è stato un politico e generale francese, fondatore del Primo Impero francese e protagonista della prima fase della storia contemporanea europea detta età napoleonica.\\nNato in Corsica da una famiglia della piccola nobiltà italiana, studiò in Francia dove divenne ufficiale d'artiglieria e quindi generale durante la rivoluzione francese. Famoso grazie alle vittorie ottenute nel corso della prima campagna d'Italia, dopo il colpo di Stato del 18 brumaio assunse il potere in Francia: fu Primo Console dal novembre di quell'anno al 18 maggio 1804, e Imperatore dei francesi, con il nome di Napoleone I dal 2 dicembre 1804 al 14 aprile 1814 e nuovamente dal 20 marzo al 22 giugno 1815. Fu anche presidente della Repubblica Italiana dal 1802 al 1805, re d'Italia dal 1805 al 1814, «mediatore» della Confederazione svizzera dal 1803 al 1813 e «protettore» della Confederazione del Reno dal 1806 al 1813."},{"page_url":"https://en.wikipedia.org/wiki/Early_works_of_Vincent_van_Gogh","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4f/Sien_Nursing_Baby.jpg","page_title":"Early works of Vincent van Gogh","context_page_description":"The early works of Vincent van Gogh comprise a group of paintings and drawings that Vincent van Gogh made when he was 27 and 28, in 1881 and 1882, his first two years of serious artistic exploration. Over the course of the two-year period Van Gogh lived in several places. He left Brussels, where he had studied for about a year in 1881, to return to his parents’ home in Etten, where he made studies of some of the residents of the town. In January 1882 Van Gogh went to The Hague where he studied with his cousin-in-law Anton Mauve and set up a studio, funded by Mauve. During the ten years of Van Gogh's artistic career from 1881 to 1890 Vincent's brother Theo would be a continuing source of inspiration and financial support; his first financial support began in 1880 funding Vincent while he lived in Brussels.\\nIn 1882 Van Gogh had an offer for a commission of paintings of The Hague however the paintings, now considered masterpieces, were not acceptable. Van Gogh started out primarily drawing and painting with watercolor. Under Mauve's tutelage Van Gogh began painting with oils in 1882."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%97%D0%B0%D0%BF%D0%B8%D1%81_%D0%BB%D0%B8%D0%BF%D0%B0_%D1%83_%D0%9A%D0%BE%D1%80%D0%B8%D1%9B%D0%B0%D0%BD%D1%86%D0%B8%D0%BC%D0%B0_(%D0%91%D0%BE%D0%B3%D1%83%D1%82%D0%BE%D0%B2%D0%B0%D1%86)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/11/Zapis-0584-Bogutovac-Koricane-lipa_20160319_2283.jpg","page_title":"Запис липа у Корићанцима (Богутовац)","context_page_description":"Запис липа у Корићанцима (Богутовац) се налази на парцели чији је власник Јавно предузеће \\"Србијашуме\\"."},{"page_url":"https://simple.wikipedia.org/wiki/Sigournais","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/10/Blason_Sigournais.svg","page_title":"Sigournais","context_page_description":"Sigournais is a commune. It is found in the region Pays de la Loire in the Vendée department in the west of France."},{"page_url":"https://en.wikipedia.org/wiki/Geography_of_North_Macedonia","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/37/Macedonia_ethnic2002_03.png","page_title":"Geography of North Macedonia","context_page_description":"North Macedonia is a country situated in southeastern Europe with geographic coordinates 41°50′N 22°00′E, bordering Kosovo and Serbia to the north, Bulgaria to the east, Greece to the south and Albania to the west. The country is part of the wider region of Macedonia and makes up most of Vardar Macedonia. The country is a major transportation corridor from Western and Central Europe to Southern Europe and the Aegean Sea. North Macedonia is a landlocked country but has three major natural lakes: Lake Ohrid, Lake Prespa and Lake Dojran. It has a water area of 857 km², while its land area is 24,856 km².\\nPhytogeographically, Macedonia belongs to the Illyrian province of the Circumboreal Region within the Boreal Kingdom. According to the WWF and Digital Map of European Ecological Regions by the European Environment Agency, North Macedonia's territory can be subdivided into four ecoregions: the Pindus Mountains mixed forests, Balkan mixed forests, Rhodopes mixed forests and Aegean sclerophyllous and mixed forests."},{"page_url":"https://pl.wikipedia.org/wiki/Kuba%C5%84_(kraina)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fc/Kuban_River.png","page_title":"Kubań (kraina)","context_page_description":"Kubań – historyczno-geograficzna kraina w Rosji, leżąca w dorzeczu rzeki Kubań.\\nTerytorium Kubania obejmuje Kraj Krasnodarski, Adygeję oraz części obwodu rostowskiego, Kraju Stawropolskiego i Karaczajewo-Czerkiesji.\\nGłówne miasta to Krasnodar, Jejsk, Noworosyjsk, Soczi, Tiemriuk, Sławiańsk nad Kubaniem, Armawir, Kropotkin, Tuapse, Anapa.\\nKraina była zasiedlona pod koniec XVIII wieku przez Kozaków czarnomorskich i do 1918 stanowiła administracyjnie obwód kubański Imperium Rosyjskiego."},{"page_url":"https://da.wikipedia.org/wiki/Rubiks_terning","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/74/Rubics_cube_OLL.gif","page_title":"Rubiks terning","context_page_description":"Rubiks terning er en mekanisk pusle-opgave, som blev opfundet af den ungarske billedhugger og arkitektur-professor Ernő Rubik i 1974. Det skønnes, at der på verdensplan er solgt over 300 mio. eksemplarer af Rubiks terning eller efterligninger af den."},{"page_url":"https://ko.wikipedia.org/wiki/%EB%A1%9C%EB%9F%B0_%ED%8C%8C%EC%9A%B0%EC%8A%A4%ED%8A%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fb/LaurenFaustSPFF.png","page_title":"로런 파우스트","context_page_description":"로런 파우스트는 미국의 애니메이터, 각본가, 영화 프로듀서이다. 해즈브로의 텔레비전 애니메이션 시리즈 《마이 리틀 포니: 우정은 마법》의 기획자로 가장 잘 알려져 있다. 파우스트는 텔레비전 시리즈 《파워퍼프걸》과 《상상 속 친구들의 모험》에서 애니메이터로 일했다. 그녀는 카툰 네트워크, 워너 브로스, 해즈브로, 디즈니, 그리고 드림웍스 애니메이션에서 일했다. 남편 크레이그 맥크라켄과 자주 함께 작업한다."},{"page_url":"https://tr.wikipedia.org/wiki/%C4%B0ran%27daki_otoyollar_listesi","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8a/Iran_First_Level_Road_36.png","page_title":"İran'daki otoyollar listesi","context_page_description":"Hemmat Otoyolu\\nResalat Otoyolu\\nIranpars Otoyolu\\nNavvab Otoyolu\\nHakim Otoyolu\\nAzadegan Otoyolu\\nNiayesh Otoyolu\\nShahid Gomnam Otoyolu\\nKordestan Otoyolu\\nSheikh Fazl-allah Nouri Otoyolu\\nChamran Otoyolu\\nYadegar-e-Emam Otoyolu\\nModarres Otoyolu\\nJalal-e-Ale Ahmad Otoyolu\\nSadr Otoyolu\\nAshrafi Esfahani Otoyolu\\nTahran-Şimal Otoyolu\\nTahran-Kerec Otoyolu\\nTahran-Kum Karayolu\\nTahran-Kum Otoyolu\\nTahran-Saveh Karayolu\\nTahran-Saveh Otoyolu"},{"page_url":"https://cy.wikipedia.org/wiki/Creulys-y-llewpart_Przewalskii","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9f/Ligularia_przewalskii.jpg","page_title":"Creulys-y-llewpart Przewalskii","context_page_description":"Planhigyn blodeuol o deulu llygad y dydd a blodyn haul ydy Creulys-y-llewpart Przewalskii sy'n enw benywaidd. Mae'n perthyn i'r teulu Asteraceae. Yr enw gwyddonol yw Ligularia przewalskii a'r enw Saesneg yw Przewalskii's leopard-plant.\\nDaw'r gair \\"Asteraceae\\", sef yr enw ar y teulu hwn, o'r gair 'Aster', y genws mwyaf lluosog o'r teulu - ac sy'n tarddu o'r gair Groeg ἀστήρ, sef 'seren'."},{"page_url":"https://fr.wikipedia.org/wiki/Ostpark","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/05/Ostpark_2017052590.jpg","page_title":"Ostpark","context_page_description":"L'Ostpark est un parc public de Munich, en Allemagne. Il était prévu depuis les années 1960 et a ouvert en 1973. Il couvre une superficie de 56 hectares.\\nEn juin 2015, un terrain de jeu rénové a été ouvert dans l'Ostpark, à proximité du café en plein air Michaeligarten. Il possède des toboggans, des balançoires, des installations d'escalade, un espace de jeux aquatiques. L'aire de jeux est accessible aux enfants en fauteuil roulant."},{"page_url":"https://sv.wikipedia.org/wiki/Tim_Kaine","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a3/Tim_Kaine_116th_official_portrait.jpg","page_title":"Tim Kaine","context_page_description":"Timothy Michael \\"Tim\\" Kaine, född 26 februari 1958 i Saint Paul, Minnesota, är en amerikansk jurist och demokratisk politiker.\\nKaine är ledamot av USA:s senat från delstaten Virginia sedan 2013. Mellan åren 2006 och 2010 var han Virginias guvernör samt ordförande i demokraternas federala partistyrelse Democratic National Committee 2009–2011. Under presidentvalet 2016 var han vicepresidentkandidat till demokraternas presidentkandidat Hillary Clinton. Clinton och Kaine förlorade senare valet till republikanernas presidentkandidat Donald Trump."},{"page_url":"https://fi.wikipedia.org/wiki/Lotnicze_Warsztaty_Do%C5%9Bwiadczalne","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/38/LWD_SZPAK.JPG","page_title":"Lotnicze Warsztaty Doświadczalne","context_page_description":"Lotnicze Warsztaty Doświadczalne oli vuodesta 1945 vuoteen 1950 toiminut puolalainen lentokoneiden suunnittelutoimisto. Se toimi Łódźissa. Nimi tarkoittaa \\"Lentokoneiden kokeellinen työpaja\\".\\nToisen maailmansodan vuoksi Puolan lentokoneteollisuuskin tuhoutui kokonaan. Kun Neuvostoliitto oli vapauttanut Puolan, se järjesti lokakuussa 1944 puolalaisten lentokonesuunnittelijoiden tiimin syntymisen Lublinissa Puolan tietoliikenneministeriön alaisuudessa. Tiimiä johti Aleksander Sułkowski. Sen pääsuunnittelijaksi tuli Tadeusz Sołtyk. Tiimi suunnitteli heti urheilulentokoneen, Szpak-1:n. Vuoden 1945 alussa tiimi siirtyi Łódźiin ja 1.4.1945 tiimistä muodostui LWD. Se sai sotaa edellisen tehtaan Doświadczalne Warsztaty Lotnicze nimen hieman muunnetussa muodossa.\\nSzpak-1-konetta ei valmistettu, mutta sen jatkokehitelmä LWD Szpak-2 kone valmistettiin. Se lensi 28.10.1945. Szpak-2 ja Szpak-3 koneita tehtiin vain yksi kappale kumpaakin. Vuonna 1947 LWD Szpak-4 koneesta tehtiin kymmenen koneen sarja PZL-Mielecin tehtaalla.\\nSeuraava kone oli LWD Żak, joka oli 2-paikkainen urheilu- ja koulukone, vuodelta 1947."},{"page_url":"https://hsb.wikipedia.org/wiki/B%C4%9B%C5%82y_porstnik","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f3/Potentilla_alba_Sturm22.jpg","page_title":"Běły porstnik","context_page_description":"Běły porstnik je rostlina ze swójby róžowych rostlinow."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9B%D0%B0-%D0%A0%D1%83%D1%81%D1%8C%D1%94%D1%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ae/La_Roussiere-Eglise.JPG","page_title":"Ла-Русьєр","context_page_description":"Ла-Русьє́р — муніципалітет у Франції, у регіоні Верхня Нормандія, департамент Ер. Населення — 219 осіб.\\nМуніципалітет розташований на відстані близько 130 км на захід від Парижа, 70 км на південний захід від Руана, 45 км на захід від Евре."},{"page_url":"https://en.wikipedia.org/wiki/1964_Summer_Olympics","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e4/1964_Summer_Olympics_%28Tokyo%29_boycotting_countries_%28red%29.png","page_title":"1964 Summer Olympics","context_page_description":"The 1964 Summer Olympics, officially known as the Games of the XVIII Olympiad, was an international multi-sport event held in Tokyo, Japan, from 10 to 24 October 1964. Tokyo had been awarded the organization of the 1940 Summer Olympics, but this honour was subsequently passed to Helsinki because of Japan's invasion of China, before ultimately being cancelled because of World War II.\\nThe 1964 Summer Games were the first Olympics held in Asia, and the first time South Africa was barred from taking part due to its apartheid system in sports. Tokyo was chosen as the host city during the 55th IOC Session in West Germany, on 26 May 1959.\\nThese games were also the first to be telecast internationally without the need for tapes to be flown overseas, as they had been for the 1960 Olympics four years earlier. The games were telecast to the United States using Syncom 3, the first geostationary communication satellite, and from there to Europe using Relay 1. These were also the first Olympic Games to have color telecasts, albeit partially."},{"page_url":"https://it.wikipedia.org/wiki/Abbazia_di_Novalesa","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/65/Novalesa_Sant_Eldrado-2.jpg","page_title":"Abbazia di Novalesa","context_page_description":"L'abbazia dei Santi Pietro e Andrea, anche conosciuta come abbazia di Novalesa, è un'antica abbazia benedettina fondata nell'VIII secolo e situata nel comune di Novalesa, in valle di Susa, Città Metropolitana di Torino. Una delle cappelle del complesso ospita due importanti cicli di affreschi dell'XI secolo, dedicati uno al titolare Sant'Eldrado e l'altro, fra i primi conosciuti in Occidente, a San Nicola di Bari."},{"page_url":"https://zh.wikipedia.org/wiki/%E9%99%B8%E4%B8%8A%E8%87%AA%E8%A1%9B%E9%9A%8A%E7%AC%AC1%E7%A9%BA%E9%99%8D%E5%9C%98","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/JGSDF_Light_Armored_vehicle_20120108-01.JPG","page_title":"陸上自衛隊第1空降團","context_page_description":"第1空降團，又稱習志野空降團，是日本陸上自衛隊唯一的空降部隊，因其駐紮於千葉縣船橋市習志野市內的陸上自衛隊基地而得名。\\n第1空降團是自衛隊中的精銳傘兵單位，主要任務是反制敵軍的游擊作戰、特種部隊。自1999年起，該團中新編了一支引導隊，主要功能為撤離非戰鬥人員。該團目前隸屬於負責執行國際維和任務的中央即應集團。\\n該團經常被拿來與西部方面普通科連隊做比較，因為這兩支部隊是日本唯二擁有主動發起攻擊作戰能力的特殊單位；日本國內其它的特種部隊不是奉命執行反恐任務，就是負有守衛國土的責任。因此，第1空降團及西普連的存在對自衛隊成員來說有提升士氣的作用。"},{"page_url":"https://fi.wikipedia.org/wiki/Serbian_dinaari","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c1/1000RSD_reverse.jpg","page_title":"Serbian dinaari","context_page_description":"Serbian dinaari on Serbian virallinen rahayksikkö. Rahayksikön lyhenne on RSD ja se jakaantuu 100 paraan, joita ei enää ole käteiskäytössä. 120 dinaaria on noin 1 euro."},{"page_url":"https://it.wikipedia.org/wiki/Storia_degli_apparecchi_acustici","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/14/Traditional_hearing_aids.jpg","page_title":"Storia degli apparecchi acustici","context_page_description":"Il primo apparecchio acustico fu creato nel XVII secolo. Il passaggio agli apparecchi acustici moderni iniziò con la creazione del telefono e il primo apparecchio acustico elettrico fu creato nel 1898. Verso la fine del XX secolo fu distribuito commercialmente al pubblico l'apparecchio acustico digitale. Alcuni dei primi apparecchi acustici erano apparecchi esterni. Gli apparecchi acustici esterni dirigevano i suoni davanti all'orecchio e bloccavano tutti gli altri rumori. L'apparecchio si sarebbe dovuto inserire dietro l'orecchio o al suo interno.\\nL'invenzione del microfono a carbone, dei trasmettitori, del chip di elaborazione del segnale digitale o DSP e lo sviluppo della tecnologia dei computer hanno contribuito a trasformare l'apparecchio acustico nella sua forma attuale."},{"page_url":"https://en.wikipedia.org/wiki/Spain","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5c/Barcelona._Pla%C3%A7a_del_Rei_%2814742902172%29.jpg","page_title":"Spain","context_page_description":"Spain, officially the Kingdom of Spain, is a country in Southwestern Europe with some pockets of territory across the Strait of Gibraltar and the Atlantic Ocean. Its continental European territory is situated on the Iberian Peninsula. Its territory also includes two archipelagos: the Canary Islands off the coast of North Africa, and the Balearic Islands in the Mediterranean Sea. The African enclaves of Ceuta, Melilla, and Peñón de Vélez de la Gomera, makes Spain the only European country to have a physical border with an African country. Several small islands in the Alboran Sea are also part of Spanish territory. The country's mainland is bordered to the south and east by the Mediterranean Sea except for a small land boundary with Gibraltar; to the north and northeast by France, Andorra, and the Bay of Biscay; and to the west and northwest by Portugal and the Atlantic Ocean respectively.\\nWith an area of 505,990 km², Spain is the largest country in Southern Europe, the second-largest country in Western Europe and the European Union, and the fourth-largest country by area on the European continent."},{"page_url":"https://de.wikipedia.org/wiki/Metal_(Kultur)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/30/Sandra_Nasic.jpg","page_title":"Metal (Kultur)","context_page_description":"Als Metal, Metal-Szene, -Kultur, -Community oder -Gemeinschaft wird eine um den gleichnamigen Musikstil entstandene Szene bezeichnet. Aus der anfänglich jugendkulturellen Gemeinschaft entwickelte sich in den späten 1980er Jahren ein altersunabhängiges heterogenes soziales Netzwerk, dessen gemeinsamer Bezugspunkt die Metal-Musik, die häufig den Urstil überhöhend als Heavy Metal benannt wird, und ihre fortwährend weiterentwickelten Substilrichtungen darstellt.\\nDie sich entlang der Beschäftigung mit der Musik konstituierende Metal-Szene gilt als eine Gemeinschaft, welche sich über szeneinterne und Metal-spezifische Symbole, Modeelemente, Medien und Treffpunkte definiert und identifiziert. So ist die Beschäftigung mit der Musik der zentrale Aspekt der Vergemeinschaftung der Szene. Weitere vergemeinschaftende und damit identitätsstiftende Bezüge zu Themen wie Kunst, Weltanschauung oder Mode sind zumeist mit Verweisen auf Musik, Tonträger, Veranstaltungen, Liedtexte oder Interpreten, versehen.\\nZu den stereotypen modischen Erkennungszeichen, die so kommunikativ Gemeinsamkeit in der Gruppe erzeugen, gehören mit Bandnamen oder Albummotiven bedruckte Kleidungsstücke, insbesondere T-Shirts."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%95%E3%82%BF%E3%83%9B%E3%82%B7%E3%82%AA%E3%82%AA%E3%83%8E%E3%83%9F%E3%83%8F%E3%83%A0%E3%82%B7","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/92/Pseudodera_xanthospila_hutahosioonmhms01.jpg","page_title":"フタホシオオノミハムシ","context_page_description":"フタホシオオノミハムシ Pseudodera xanthospila Baly はハムシ科の昆虫の1つ。サルトリイバラを食べ、全身が黄色くて前翅先端近くの外側に黄褐色の大きな斑紋がある。"},{"page_url":"https://el.wikipedia.org/wiki/%CE%93%CE%B5%CF%89%CE%B3%CF%81%CE%B1%CF%86%CE%AF%CE%B1_%CF%84%CE%BF%CF%85_%CE%9B%CE%B9%CE%B2%CE%AC%CE%BD%CE%BF%CF%85","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/6c/Lebanon_Topography.png","page_title":"Γεωγραφία του Λιβάνου","context_page_description":"Ο Λίβανος είναι μέρος της Μέσης Ανατολής και βρίσκεται χονδρικά σε βόρειο πλάτος και ανατολικό μήκος 35˚N. Απλώνεται κατά μήκος της ανατολικής ακτής της Μεσογείου Θάλασσας. Η ιστορία του Λιβάνου καθορίστηκε από το ορεινό του έδαφος και τη γεωγραφική του θέση, με διάφορα οικονομικά και θρησκευτικά ρεύματα, που προήλθαν από την περιοχή ή πέρασαν από αυτή, να αφήνουν το αποτύπωμά τους πάνω στην κοινωνία του Λιβάνου.\\nΟ ρόλος της χώρας στην περιοχή, αλλά και στον κόσμο γενικότερα, διαμορφώθηκε από το εμπόριο. Ο Λίβανος αποτελεί πέρασμα μεταξύ των μεσογειακού χωρών και της Ινδίας ή της Ανατολικής Ασίας. Οι έμποροι της περιοχής εξήγαγαν σιτηρά, υφάσματα, κεραμικά, μεταλλικά αντικείμενα, και αργότερα πετρέλαιο, δια των λιμανιών του Λιβάνου προς τις αγορές του δυτικού κόσμου. Ο Λίβανος, του οποίου η λοφώδης και μεσογειακή γεωγραφία έχει επηρεάσει, εκτός από την ιστορία, τον πολιτισμό του, ακόμα και την κουζίνα του, ονομάσθηκε «το μαργαριτάρι της Μέσης Ανατολής»."},{"page_url":"https://ceb.wikipedia.org/wiki/Bischofswiesen_(munisipyo)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/56/Stanggass.JPG","page_title":"Bischofswiesen (munisipyo)","context_page_description":"Munisipyo ang Bischofswiesen sa Alemanya. Nahimutang ni sa distrito nga gobyerno sa Upper Bavaria ug estado pederal sa Bavaria, sa habagatang bahin sa nasod, 500 km sa habagatan sa Berlin ang ulohan sa nasod. Adunay 7,510 ka molupyo.\\nHapit nalukop sa lasang nga sagolsagol ang palibot sa Bischofswiesen. Dunay mga 86 ka tawo kada kilometro kwadrado sa palibot sa Bischofswiesen medyo hilabihan populasyon. Ang klima klima sa kontinente. Ang kasarangang giiniton 1 °C. Ang kinainitan nga bulan Hulyo, sa 13 °C, ug ang kinabugnawan Pebrero, sa -10 °C. Ang kasarangang pag-ulan 1,894 milimetro matag tuig. Ang kinabasaan nga bulan Agosto, sa 234 milimetro nga ulan, ug ang kinaugahan Marso, sa 91 milimetro."},{"page_url":"https://en.wikipedia.org/wiki/Student_activism","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/03/Vietnamdem.jpg","page_title":"Student activism","context_page_description":"Student activism or campus activism is work by students to cause political, environmental, economic, or social change. Although often focused on schools, curriculum, and educational funding, student groups have influenced greater political events.\\nModern student activist movements vary widely in subject, size, and success, with all kinds of students in all kinds of educational settings participating, including public and private school students; elementary, middle, senior, undergraduate, and graduate students; and all races, socio-economic backgrounds, and political perspectives. Some student protests focus on the internal affairs of a specific institution; others focus on broader issues such as a war or dictatorship. Likewise, some student protests focus on an institution's impact on the world, such as a disinvestment campaign, while others may focus on a regional or national policy's impact on the institution, such as a campaign against government education policy."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%94%D0%BE%D0%BD%D0%B5%D0%B3%D0%BE_(%D0%92%D0%B5%D1%80%D0%B1%D0%B0%D0%BD%D0%BE-%D0%9A%D1%83%D0%B7%D0%B8%D0%BE-%D0%9E%D1%81%D0%BE%D0%BB%D0%B0)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5c/Donego-panoramica.jpg","page_title":"Донего (Вербано-Кузио-Осола)","context_page_description":"Донего је насеље у Италији у округу Вербано-Кузио-Осола, региону Пијемонт.\\nПрема процени из 2011. у насељу је живело 35 становника. Насеље се налази на надморској висини од 433 м."},{"page_url":"https://pl.wikipedia.org/wiki/Mr%C4%85gowo","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/98/Olszty%C5%84ska_Ko%C5%9Bci%C3%B3%C5%82.JPG","page_title":"Mrągowo","context_page_description":"Mrągowo – miasto w województwie warmińsko-mazurskim, siedziba władz powiatu mrągowskiego oraz wiejskiej gminy Mrągowo.\\nW latach 1975–1998 miasto administracyjnie należało do województwa olsztyńskiego.\\nMiasto jest znane głównie z organizowanego od 1982 r. dorocznego Pikniku Country. Mrągowo jest również popularnym ośrodkiem turystycznym i wypoczynkowym na Mazurach."},{"page_url":"https://hu.wikipedia.org/wiki/K%C3%BCllstedt","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2f/2008_12_09_k%C3%BCllst_013.JPG","page_title":"Küllstedt","context_page_description":"Küllstedt település Németországban, azon belül Türingiában. Lakosainak száma 1332 fő. +/-"},{"page_url":"https://fr.wikipedia.org/wiki/Architecture_de_la_p%C3%A9riode_post-Goupta","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bd/Pallava_Pillar_Mahendravadi.png","page_title":"Architecture de la période post-Goupta","context_page_description":"L'expression architecture de la période post-goupta regroupe toute la production architecturale de l'Inde aux VIIᵉ et VIIIᵉ siècles."},{"page_url":"https://fi.wikipedia.org/wiki/Tadji","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/73/26JUNE2006_Camp_Taji_sign.jpg","page_title":"Tadji","context_page_description":"Tadji eli Taji on lentotukikohta ja taajama Keski-Irakin Bagdadin maakunnassa, linnuntietä noin 25 kilometriä pääkaupunki Bagdadista pohjoisluoteeseen.\\nPersianlahden sodan aikana Yhdysvaltojen johtama liittouma pommitti lentotukikohdan bunkkereita. Tukikohdan alueella korjattiin ja huollettiin Irakin armeijan Scud-ohjuksia, silloisia T-54, T-55, ja T-62 tankkeja ja varauduttiin rakentamaan T-72 tankkeja. Tukikohdassa myös valmistettiin tykistöammuksia. Irakin sodan aikana se oli eräs suurimmista Yhdysvaltojen johtamien miehittäjäjoukkojen lentotukikohdista Irakissa. Joukkojen poistuttua vuonna 2011, sotilastukikohta jäi Irakin armeijan käyttöön. Alkuvuonna 2015 pieni, noin 300 hengen, puolittain kouluttajista koostuva joukko amerikkalaissotilaita palasi jälleen tukikohtaan.\\nKesäkuussa 2014 Tadjin tukikohtaa pidettiin mahdollisena ääri-islamistisen Isisin taistelijoiden kohteena sen pohjoispuolella sijaitsevan Baladin tukikohdan tapaan. Helmikuussa noin 25 Isisin taistelijaa tai itsemurhapommittajaa yritti hyökätä tukikohtaa vastaan. Osa jihadistitaistelijoista pyrki tukikohtaan irakilaiseen sotilaspukuun naamioituneena. Isisiä vastaan on taisteltu Tadjin seudulla myös ilmaiskuin."},{"page_url":"https://pt.wikipedia.org/wiki/Thor_Vilhj%C3%A1lmsson","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/13/Thor_Vilhjalmsson_in_2008.jpg","page_title":"Thor Vilhjálmsson","context_page_description":"Thor Vilhjálmsson foi um escritor, poeta e tradutor islandês.\\nNasceu em Edimburgo, na Escócia, de pais islandeses. Sua mãe chamava-se Krist­ín Thors hús­móðir e seu pai Guðmund­ur Vil­hjálms­son\\n.\\nEstudou literatura nórdica na Universidade da Islândia. Nos anos do pós-guerra, estudou também na Universidade de Nottingham e na Sorbonne. Entre 1953 e 1955, trabalhou na biblioteca nacional da Islândia. No período de 1956–1959, trabalhou para o Þjóðleikhúsið.\\nFoi um dos fundadores da revista cultural Birtingur em 1955, tendo integrado a sua redação até 1968. Foi também presidente da Associação de Artistas da Islândia, entre 1975 e 1981. Esteve também envolvido nas artes visuais, tendo realizado exposições de pintura e escrito sobre artistas islandeses, tais como Jóhannes Kjarval e Svavar Guðnason.\\nO seu primeiro livro foi publicado em 1950, intitulado Maðurinn er alltaf einn. Em 1988, recebeu o Prémio Literário do Conselho Nórdico, pelo romance Grámosinn glóir.\\nEm conjunto com Guðbergur Bergsson e Svöva Jakobsdóttir, é considerado como tendo dado origem ao novo estilo de romance modernista que surgiu na Islândia, por volta de 1965."},{"page_url":"https://fa.wikipedia.org/wiki/%D9%84%DB%8C%D8%B4%D9%86%D8%A7_(%D9%86%D8%A7%D8%AD%DB%8C%D9%87_%D8%B1%D9%88%DA%A9%DB%8C%D8%AA%D8%B3%D8%A7%D9%86%DB%8C)","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/ef/Lisna_RO_CZ.png","page_title":"لیشنا (ناحیه روکیتسانی)","context_page_description":"لیشنا یک منطقهٔ مسکونی در جمهوری چک است که در ناحیه روکیتسانی واقع شده‌است. لیشنا ۱۸٫۸۳ کیلومتر مربع مساحت و ۱۸۷ نفر جمعیت دارد و ۵۲۷ متر بالاتر از سطح دریا واقع شده‌است."},{"page_url":"https://fi.wikipedia.org/wiki/Justus_Bier","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c0/Justus_Bier_F%C3%BCrtherstra%C3%9Fe_10_N%C3%BCrnberg.JPG","page_title":"Justus Bier","context_page_description":"Justus Bier oli saksalais-yhdysvaltalainen taidehistorioitsija.\\nEnsimmäisen maailmansodan jälkeen Bier opiskeli useissa yliopistoissa taidehistoriaa, arkeologiaa sekä keskiajan ja modernin ajan historiaa. Hänen merkittävimmät opettajansa olivat Paul Clemen ja Heinrich Wölfflin. Bier kirjoitti 1920-luvulla modernista taiteesta, ja vuodet 1930–1936 hän oli hannoverilaisen Kestnergesellschaft-taidemuseon kuraattori. Bier keräsi myös Bauhaus-taiteilijoiden, kuten Paul Kleen, Oskar Schlemmerin ja Lyonel Feiningerin, töitä. Kansallissosialistisen puolueen noustua valtaan juutalainen Bier pakeni Saksasta ja muutti Yhdysvaltoihin 1937.\\nBierin entinen luokkatoveri Richard Krautheimer suositteli hänelle paikkaa Louisvillen yliopistosta, Kentuckystä. Hän opetti Louisvillessä taidehistoriaa 1937–1960. Bier kirjoitti myös yli 200 taidearvostelua louisvilleläiseen The Courier-Journal -sanomalehteen. Vuodet 1960–1970 Bier oli Pohjois-Carolinan taidemuseon johtaja. Louisvillen yliopistossa on nykyään Bierin nimeä kantava professuuri."},{"page_url":"https://es.wikipedia.org/wiki/Limosna","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7d/Smart_Hymn21_Generosity.jpg","page_title":"Limosna","context_page_description":"La limosna es una ayuda voluntaria que se da a alguna institución o persona, sin esperar nada a cambio."},{"page_url":"https://en.wikipedia.org/wiki/Treasure_Lake,_Pennsylvania","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/3c/Map_of_Treasure_Lake%2C_Clearfield_County%2C_Pennsylvania_Highlighted.png","page_title":"Treasure Lake, Pennsylvania","context_page_description":"Treasure Lake is a census-designated place in Clearfield County, Pennsylvania, United States. The population was 3,861 at the 2010 census. Treasure Lake is a semi-private, gated community."},{"page_url":"https://en.wikipedia.org/wiki/Olimpia_Maidalchini","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0f/Donna_olimpia_maidalchini.jpg","page_title":"Olimpia Maidalchini","context_page_description":"Olimpia Maidalchini Pamphilj, was the sister-in-law of Pope Innocent X. She was perceived by her contemporaries as having influence regarding papal appointments.\\nShe is not to be confused with her daughter-in-law Olimpia Aldobrandini, who married her son Camillo."},{"page_url":"https://eo.wikipedia.org/wiki/Frederiko_la_3-a_de_Saarwerden","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/64/Blason_Sarrewerden_France_Bas-Rhin.svg","page_title":"Frederiko la 3-a de Saarwerden","context_page_description":"Frederiko de Saarwerden estis kiel Frederiko la 3-a de 1370 ĝis 1414 ĉefepiskopo de Kolonjo. Per protekto de sia praonklo, la ĉefepiskopo de Treviro Kuno la 2-a de Falkenstein, Frederiko de Saarwerden estis elektata en la aĝo de 20 jaroj al ĉefepiskopo de Kolonjo, kion la papo en Avinjono post kelkaj skrupuloj ankaŭ konfirmis du jarojn poste. Frederiko trovis la ĉefepiskopujon plene disrabita de siaj du markaj antaŭuloj Adolfo kaj Engelberto kaj estis mem promesinta okaze de sia elektiĝo altajn pagojn al la kurio. Tamen li sukcesis per helpo de sia riĉega praonklo Kuno, senŝuldigi la ĉefepiskopujon ene de malmultaj jaroj.\\nFrederiko de Saarwerden subtenis Imperiestron Karolo la 4-a kaj estis rekompencata de li pro tio per privilegioj, kiuj subtenis la regopolitikon de Frederiko. Heredokonfliktojn en la kampara nobelaro kiel ankaŭ streboj al aŭtonomeco en la urboj de la ĉefepiskopujo li sukcese subpremis tuj komence de sia regotempo kaj firmigis tiel sian landestran hegemonion, kiu ĝis la fino de lia regotempo ne plu estis kontestata."},{"page_url":"https://hr.wikipedia.org/wiki/Brlo%C5%A1ka_Dubrava","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/0a/Brloska_Dubrava2.JPG","page_title":"Brloška Dubrava","context_page_description":"Brloška Dubrava je naselje u Hrvatskoj, u Ličko-senjskoj županiji."},{"page_url":"https://zh.wikipedia.org/wiki/%E8%B5%A4%E5%9D%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/State_Guest_House_Akasaka_Palace_main_entrance.jpg","page_title":"赤坂","context_page_description":"赤坂是日本東京都港區一個町名。2013年7月1日的人口為16,968人。郵遞區號107-0052。赤坂以住宅及商業為主，同時也是許多古董品店及旅館聚集之地，地名源自「紀伊國坂」。赤坂的位置在六本木以北，位居皇居西南角。"},{"page_url":"https://fy.wikipedia.org/wiki/Chrissy_Teigen","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/56/Christine_Teigen_2012_Shankbone.JPG","page_title":"Chrissy Teigen","context_page_description":"Chrissy Teigen is in Amerikaansk model, presintatrise en blochster fan mingd Noarsk-Taisk etnysk komôf. Hja briek yn 'e Feriene Steaten troch mei har wurk foar it tydskrift Sports Illustrated. Ynternasjonaal waard Teigen bekend as sjuerylid by it itensiedersprogramma Snack-Off en as ko-presintatrise fan 'e playbackshow Lip Sync Battle."},{"page_url":"https://fi.wikipedia.org/wiki/G%C3%B6tenen_kunta","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/48/V%C3%A4sterplana_kyrka.jpg","page_title":"Götenen kunta","context_page_description":"Götenen kunta on Länsi-Götanmaan läänissä sijaitseva Ruotsin kunta. Maakuntajaossa se kuuluu Länsi-Götanmaahan. Kunnan keskustaajama on Götene.\\nKunnan maapinta-ala on 404,51 neliökilometriä ja asukasluku 13 160 henkeä.\\nVuonna 2007 kunnassa oli 177,27 km² peltoa, joten saman ajankohdan maapinta-alaan vertaamalla saadaan peltojen osuudeksi 43,6 prosenttia kunnan maapinta-alasta."},{"page_url":"https://cs.wikipedia.org/wiki/Jan_K%C5%99%C3%AD%C5%BE_(sportovn%C3%AD_lezec)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/33/Shanghai_2016_Jan_Kriz_02.jpg","page_title":"Jan Kříž (sportovní lezec)","context_page_description":"Jan Kříž je český reprezentant ve sportovním lezení, v roce 2010 začínal na mezinárodních závodech v lezení na obtížnost a rychlost, u rychlosti poté zůstal. Vicemistr světa, akademický mistr světa, juniorský mistr světa, vítěz Evropského poháru juniorů a několikanásobný mistr ČR a juniorský mistr a vicemistr ČR v lezení na rychlost, ve kterém závodí také jeho dvě sestry Eva a Hana Křížová."},{"page_url":"https://it.wikipedia.org/wiki/Felipe_Dal_Bello","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bc/Felipe_Dal_Bello%2C_Bartosz_Salamon_e_Filippo_Costa.jpg","page_title":"Felipe Dal Bello","context_page_description":"Felipe Dal Bello, all'anagrafe Felipe Dias da Silva Dalbelo, è un calciatore brasiliano, difensore della SPAL."},{"page_url":"https://fi.wikipedia.org/wiki/Punasuomuseitikki","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e8/Cortinarius_bolaris_-_Havr%C3%A9_%281%29.jpg","page_title":"Punasuomuseitikki","context_page_description":"Punasuomuseitikki on kellanvalkea ja myöhemmin kellanpunainen ja punasuomuinen seitikkilaji. Heltat ovat aluksi vaaleanruskeat ja muuttuvat sienen vanhetessa kanelinruskeiksi. Jalka on nuijamainen ja kellanvalkea, ja siinä on punaisia suomuja tai säikeitä. Sieni kasvaa havu- ja sekametsissä myös koivun seuralaisena kohtalaisen harvinaisena Keski- ja Etelä-Suomessa. Tämä seitikki ei ole ruokasieni. Sitä voidaan kuitenkin käyttää värjäämiseen. Saatava väri ei kuitenkaan ole kovin voimakasta."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9F%D0%B8%D0%BB%D0%B8%D0%BF%D1%96%D0%B2_%D0%9F%D0%BE%D1%82%D1%96%D0%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d4/Pylypiv_Potik_Teply_stan_20190804.jpg","page_title":"Пилипів Потік","context_page_description":"Пили́пів Поті́к — 1 урочище з однойменним струмком, яке тягнеться уздовж яру між Забуччям та Ірпенем і повертає на схід уздовж правого берега річки Буча в межах Ірпеня; 2 хутір в урочищі; 3 історичний кут на північному заході Ірпеня."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkmale_in_Flensburg-Friesischer_Berg","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/55/Ecke_Klaus-Groth-Stra%C3%9Fe_26_%28Flensburg_August_2015%29.jpg","page_title":"Liste der Kulturdenkmale in Flensburg-Friesischer Berg","context_page_description":"In der Liste der Kulturdenkmale in Flensburg-Friesischer Berg sind alle Kulturdenkmale des Stadtteils Friesischer Berg der schleswig-holsteinischen Stadt Flensburg aufgelistet. Der Erstellung diente insbesondere die im Hauptartikel gelistete Literatur."},{"page_url":"https://es.wikipedia.org/wiki/Stefan_Edberg","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/20/Stefan_Edberg_B%C3%A5stad_sweden_20070708.jpg","page_title":"Stefan Edberg","context_page_description":"Stefan Edberg es un extenista sueco. Durante los inicios de la década de 1990 se ubicó como tenista número 1 del ranking ATP durante 72 semanas.\\nConsiguió seis títulos individuales de Grand Slam: el Campeonato de Wimbledon 1988 y 1990, el Abierto de Estados Unidos 1991 y 1992, y el Abierto de Australia 1985 y 1987. También alcanzó un total de 11 finales, una de ellas en el Torneo de Roland Garros, y 19 semifinales.\\nEl sueco triunfó en el Masters Grand Prix 1989 y logró ocho títulos de Grand Prix Championship / ATP Masters Series en todas las superficies. Además, logró la medalla de oro individual en los Juegos Olímpicos de Los Ángeles 1984, y el bronce en los Juegos Olímpicos de Seúl 1988.\\nEn dobles, Edberg ganó el Abierto de Estados Unidos de 1987, el Abierto de Australia de 1987 y 1996 y el Masters de Montecarlo de 1993, y fue finalista en el Abierto de Estados Unidos de 1984, el Abierto de Roland Garros de 1986 y el Masters de Cincinnati de 1993.\\nEs el representante que más veces jugó para Suecia en la Copa Davis con 70 presentaciones en 13 ediciones, desde el año 1984 hasta 1996 ininterrumpidamente."},{"page_url":"https://de.wikipedia.org/wiki/Bistum_Lule%C3%A5","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/89/Lule%C3%A5_stift_vapen.svg","page_title":"Bistum Luleå","context_page_description":"Das Bistum Luleå ist eine der dreizehn Diözesen innerhalb der Schwedischen Kirche. Es besteht aus 57 Kirchengemeinden, die zu acht Kirchenkreisen zusammengefasst sind.\\nGeografisch erstreckt sich das Bistum über die Provinzen Västerbottens län und Norrbottens län und damit über ein Drittel des schwedischen Staatsgebietes. Damit ist es nach Fläche das größte lutherische Bistum des Landes. Es wurde erst 1904 durch Abtrennung des nördlichen Teils des Bistums Härnösand gebildet. Seit der Gründung hat sich die Mitgliederzahl stark erhöht; 2013 betrug sie 391000, was 76,6 % der Wohnbevölkerung entspricht. Die kirchliche Arbeit findet auch in Samisch, Finnisch und Meänkieli statt.\\nBischofssitz ist die Stadt Luleå mit dem Dom zu Luleå als Bischofskirche. Seit 2002 ist Hans Stiglund Bischof von Luleå."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%AA%D9%88%D8%B1%D8%AA%D9%8A%D9%84%D9%8A","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/32/Tortelli.jpg","page_title":"تورتيلي","context_page_description":"تورتيلي هي نوع من المعكرونة التقليدية في مناطق لومبارديا وإميليا-رومانيا وتوسكانا الإيطالية. وتوجد على عدة أشكال بما في ذلك المربع وشبه دائرة أو الملفوفة على شكل قبعة مدورة. يمكن تقديمها مع الزبدة السائلة أو صلصة البولونيز أو المرق أو صلصات أخرى. تستخدم كلمة تورتيلي أيضا لوصف المعجنات المقلية الصغيرة المحشوة بالمربى أو كريم."},{"page_url":"https://el.wikipedia.org/wiki/%CE%9C%CE%BF%CE%BD%CF%83%CE%BF%CF%81%CF%8E","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/32/%C2%A9_Dominique_Drouet-Montsoreau_.jpg","page_title":"Μονσορώ","context_page_description":"Η Μονσορώ είναι κοινότητα και πόλη στη Χώρα του Λίγηρα, στην κεντρική δυτική Γαλλία και μία από τις κύριες πόλεις τουριστών στο νομό Μαιν-ε-Λίγηρα. Η κοινότητα της Μονσορώ στην απογραφή του 2015 είχε 447 κατοίκους. Η μητροπολιτική περιοχή της πόλης έχει περίπου 100.000 κατοίκους. Η πόλη βρίσκεται στη συμβολή των ποταμών Βιέννη και Λίγηρα επί της όχθης του δεύτερου.\\nΤο 2000, η UNESCO πρόσθεσε το κεντρικό τμήμα της Κοιλάδας του Λίγηρα στον κατάλογο με Μνημεία Παγκόσμιας Πολιτιστικής Κληρονομιάς."},{"page_url":"https://lb.wikipedia.org/wiki/Terry_Jones","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c0/Terry_Jones_Monty_Python_O2_Arena_%28cropped%29.jpg","page_title":"Terry Jones","context_page_description":"Den Terry Jones, gebuer als Terence Graham Parry Jones den 1. Februar 1942 zu Colwyn Bay a Wales a gestuerwen den 21. Januar 2020 zu London, war en englesche Komiker, Filmregisseur, Historiker a Schrëftsteller. Hie gouf als Member vun der Grupp Monty Python bekannt.\\nNieft senger Aarbecht mat Monty Python war den Jones virun allem als Regisseur vun Documentairen awer och als Kannerbuch-Auteur erfollegräich. Absënns fir d'BBC huet hien Documentairen iwwer d' Kräizzich an iwwer d'Liewen am Mëttelalter realiséiert."},{"page_url":"https://zh.wikipedia.org/zh-sg/%E5%90%8C%E6%84%8F%E6%8A%95%E7%A5%A8","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/9d/Approval_ballot_zh.PNG","page_title":"同意投票","context_page_description":"同意投票，又称为“认可投票”或“赞成投票”，是一种在选举中可以多选的投票制度。 一般使用在单一竞选名额上。同意投票也可以使用在多竞选名额上，但多竞选名额的同意投票有着下述的、迥然不同的特性：同意投票是一种只能对选项选择同意与否的计分投票，而且不像多数制将选择两个以上选项的选票视为废票。同意投票因为不要求选民将选项按喜好次序排列，所以它可以避免阿罗悖论。\\n这种投票方法首见于天文学家纪‧欧特威尔于1968年著、1977年发表的论文The Arithmetic of Voting。“同意投票”一词为Robert J. Weber于1976年首创，但在1977年由政治科学家Steven Brams和数学家Peter Fishburn完全采用。历史上，13世纪的威尼斯共和国和19世纪的英国都曾采用近似于同意投票的选举方法，而今天联合国也用类似的方法选出秘书长。中华人民共和国县级以上人民代表大会代表和人大常委会委员的选举也采取这种方式。在美国和许多国家都有人提倡同意投票，但现今没有采用于任何公职选举。"},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkm%C3%A4ler_in_Pleinfeld","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3c/Marienkapelle_%28Walkerszell%29.jpg","page_title":"Liste der Baudenkmäler in Pleinfeld","context_page_description":"Auf dieser Seite sind die Baudenkmäler des mittelfränkischen Marktes Pleinfeld zusammengestellt. Diese Tabelle ist eine Teilliste der Liste der Baudenkmäler in Bayern. Grundlage ist die Bayerische Denkmalliste, die auf Basis des Bayerischen Denkmalschutzgesetzes vom 1. Oktober 1973 erstmals erstellt wurde und seither durch das Bayerische Landesamt für Denkmalpflege geführt wird. Die folgenden Angaben ersetzen nicht die rechtsverbindliche Auskunft der Denkmalschutzbehörde.\\nDiese Liste gibt den Fortschreibungsstand vom 1. April 2015 und enthält 130 Baudenkmäler."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A0%D1%83%D1%81%D1%81%D0%BA%D0%B0%D1%8F_%D0%B8%D0%BA%D0%BE%D0%BD%D0%BE%D0%BF%D0%B8%D1%81%D1%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7d/BorisGleb.jpg","page_title":"Русская иконопись","context_page_description":"Русская иконопись — развивавшееся в недрах православной церкви изобразительное искусство Древней Руси, начало которому было положено в конце X века крещением Руси. Иконопись оставалась ядром древнерусской культуры вплоть до конца XVII века, когда в петровскую эпоху была потеснена светскими видами изобразительного искусства."},{"page_url":"https://th.wikipedia.org/wiki/%E0%B8%88%E0%B8%B1%E0%B8%87%E0%B8%AB%E0%B8%A7%E0%B8%B1%E0%B8%94%E0%B8%8A%E0%B8%B8%E0%B8%A1%E0%B8%9E%E0%B8%A3","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c7/Nationalmuseum_Chumphon.jpg","page_title":"จังหวัดชุมพร","context_page_description":"ชุมพร มีชื่อปรากฏมาตั้งแต่ปี พ.ศ. 1098 โดยมีฐานะเป็นเมืองสิบสองนักษัตรของราชอาณาจักรนครศรีธรรมราช ใช้รูปแพะเป็นตราเมือง และเป็นเมืองหน้าด่านฝ่ายเหนือ เพราะอยู่ตอนบนของภาคใต้\\nใน พ.ศ. 1997 รัชสมัยแผ่นดินสมเด็จพระบรมไตรโลกนาถ ปรากฏในกฎหมายตราสามดวงว่า เมืองชุมพรเป็นเมืองตรี อาณาจักรฝ่ายใต้ของราชอาณาจักรกรุงศรีอยุธยา ในช่วงนี้ชนชาติจาม แห่งราชอาณาจักรจามปา ถูกชาวเวียดนามรุกราน ชาวจามกลุ่มนี้อพยพเข้าสู่กรุงศรีอยุธยาครั้งแรก ปรากฏว่ามี \\"อาสาจาม\\" ในแผ่นดินนี้ เพื่อการขยายอาณานิคมของกรุงศรีอยุธยา ส่วนหนึ่งต้องมารักษาด่านเมืองชุมพร ซึ่งเป็นเมืองตรี และตั้งชาวจาม เป็นเจ้าเมืองชุมพร และดินแดนแถบนี้ขึ้นตรงต่อกรุงศรีอยุธยา เนื่องด้วย ชาวจาม มีความสามารถในการรบ ที่มีชื่อเสียง เช่น กองอาสาจาม เป็นทหารชั้นดี มีวินัย เชี่ยวชาญการเดินเรือ รับใช้ราชสำนักมานาน และเก่งการค้ามาหลายพันปี\\nและต่อมาระหว่าง ปี พ.ศ. 2173 - 2199 ในแผ่นดิน พระเจ้าปราสาททองแห่งราชอาณาจักกรุงศรีอยุธยา ได้กวาดต้อนชาวเมืองแถง หรือ อยู่ในประเทศเวียดนาม และชาวเมืองพงสาลี อยู่ในประเทศลาว มาเป็นพลเมือง เมืองชุมพร เมืองปะทิว เพื่อทำการเกษตรกรรม และเมืองท่าการค้าสำคัญ ตั้งแต่นั้นมา\\nเดิมชาวจามนับถือศาสนาพราหมณ์-ฮินดู พ.ศ."},{"page_url":"https://kk.wikipedia.org/wiki/%D0%90%D2%9B%D2%9B%D0%B0%D0%B1%D0%B0%D2%9B_%D1%81%D0%B0%D0%B9%D1%80%D0%B0%D2%9B","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c1/Redwing_Turdus_iliacus.jpg","page_title":"Аққабақ сайрақ","context_page_description":"Аққабақ — торғайлар отрядына, шымшықтар тұқымдастарына жататын құстардың бірі."},{"page_url":"https://es.wikipedia.org/wiki/Lebetain","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c0/Lebetain%2C_Mairie-%C3%A9cole.jpg","page_title":"Lebetain","context_page_description":"Lebetain es una comuna francesa situada en el departamento del Territorio de Belfort, de la región de Borgoña-Franco Condado.\\nLos habitantes se llaman Lebetinois.​"},{"page_url":"https://zh.wikipedia.org/zh-tw/%E5%9B%BD%E9%99%85%E7%A8%8E%E5%8A%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c3/Individual_taxation_systems.png","page_title":"国际税务","context_page_description":"國際稅務根據具體情形，既可以指根據多個不同國家的稅法，向某一筆收入徵稅；亦可指根據某一國家稅法徵收涉外稅。一國政府可能只對發生在本國領土的收入徵稅，也可能在此基礎上對發生在本國領土外的收入也徵稅。不過，若要對域外收入徵稅，該國政府與納稅人之間的關係，必須使政府具有域外管轄權。縱觀世界各國，對域外收入的徵稅，主要有三類制度：「屬土主義」「居民主義」和「國籍主義」。屬土主義國家不對域外收入徵稅。居民主義國家只對本國的稅務居民的域外收入徵稅。國籍主義國家在居民主義的基礎上，對具有本國國籍的納稅人，不論是否具有本國稅務居民身份，其域外收入一律徵稅。也有些國家根據不同情況，分別適用以上三種制度。\\n對個人或企業的收入所徵收的稅，稱為「所得稅」。各國的所得稅制度一般不一致，所以域外收入可能會造成雙重徵稅乃至多重徵稅。相應地，也有可能造成零徵稅。稅盾制度和外稅抵免制度都有助於避免雙重徵稅。但上述制度一般都附有條件，因而並非所有涉外收入都能適用相關制度，以獲得稅款減免。跨國公司大多聘請國際稅務師進行稅務規劃，以實現合理避稅。\\n跨國公司可能在世界各地設有多個公司，而由同一人實際控制。上述情況中的多個公司互為「關聯方」。在居民主義國家，因為域外註冊的企業不是本國稅務居民，所以把利潤從域內企業轉移到域外的關聯方企業，可以減少納稅額。這一「轉移」一般是通過修改價格來進行的，所以這一策略被稱為轉移定價。許多國家的稅務部門都制定了反制轉移定價的稅務規則。關聯方產生的另一問題是遞延納稅，即將利潤留在外域公司而不分紅，母公司即可避免納稅。\\n目前，許多國家都聯合一致，通過建立爭端解決機制、暢通信息交換，來打擊利用跨國公司、關聯方等方式避稅逃稅的行為。美國作為為數不多的國籍主義國家，率先通過國內法來強化其對域外收入的徵稅。FACTA法案的理念影響了其他國家。世界各國基於同一標準、自動交換涉稅居民信息的共同申報準則在經濟合作與發展組織的努力下被推動。在2014年9月的G20峰會上，CRS的方案被正式提出。"},{"page_url":"https://fr.wikipedia.org/wiki/Lambruisse","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/46/Monument_aux_morts_de_Lambruisse.JPG","page_title":"Lambruisse","context_page_description":"Lambruisse est une commune française située dans le département des Alpes-de-Haute-Provence en région Provence-Alpes-Côte d'Azur.\\nLe nom de ses habitants est Lambruissiens."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9A%D1%80%D0%B0%D1%81%D0%BE%D1%82%D0%BA%D0%B8_(%D1%81%D0%B5%D0%BC%D0%B5%D0%B9%D1%81%D1%82%D0%B2%D0%BE)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/96/Hetaerina_americana.jpg","page_title":"Красотки (семейство)","context_page_description":"Красотки, — семейство стрекоз из подотряда равнокрылых."},{"page_url":"https://zh.wikipedia.org/zh-sg/%E5%A1%94%E9%96%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ad/TapMun3.JPG","page_title":"塔門","context_page_description":"塔门，是香港一座位于大滩海、大赤门及大鹏湾之间的岛屿，地理上几乎全被郊野公园包围的，行政区划上属于大埔区，邻近西贡半岛西贡北，面积达1.69平方公里。塔门东面是以狮子滚球为著名的弓洲；南端是塔门口和高流湾；北端是赤洲口和赤洲；西端是大滩海和湾仔半岛。\\n岛上设有一个天后庙，在大节日时会有很多渔民到塔门上香祈求平安，香火鼎盛。此外环境保护署也在塔门设立一个空气污染指数监测站，以观测市区的污染对郊外的影响，也可以作一个对比。"},{"page_url":"https://vi.wikipedia.org/wiki/Thelypteris_dentata","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3c/Starr_020925-0135_Christella_dentata.jpg","page_title":"Thelypteris dentata","context_page_description":"Christella dentata là một loài thực vật có mạch trong họ Thelypteridaceae. Loài này được E.P. St. John miêu tả khoa học đầu tiên năm 1936."},{"page_url":"https://de.wikipedia.org/wiki/Mazda_MX-5","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/46/2006-2007_galaxy_gray.jpg","page_title":"Mazda MX-5","context_page_description":"Der Mazda MX-5 ist ein Pkw-Modell des japanischen Autoherstellers Mazda. In den USA wird der MX-5 als Mazda Miata und in Japan als Mazda Roadster verkauft. Nachdem er auf den Markt kam, begann in den 1990er Jahren in vielen Ländern eine Renaissance der Roadster.\\nMit 1.000.000 verkauften Exemplaren zwischen Februar 1989 und April 2016 ist der MX-5 der meistverkaufte Roadster weltweit."},{"page_url":"https://de.wikipedia.org/wiki/Zhuang_(Sprache)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1a/Zhuang_survey_sites.svg","page_title":"Zhuang (Sprache)","context_page_description":"Zhuang ist ein Überbegriff für verschiedene Dialekte, die vom Volk der Zhuang in der Volksrepublik China gesprochen werden. Die meisten Sprecher leben in der autonomen Region Guangxi, in der Zhuang eine Amtssprache ist. Die Zhuang-Sprache ist eine anerkannte Regionalsprache im südlichen China, wo sie auch an staatlichen Schulen gelehrt wird."},{"page_url":"https://nl.wikipedia.org/wiki/Regering-Ayrault_I","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9d/Montebourg_Arnaud_%282%29.jpg","page_title":"Regering-Ayrault I","context_page_description":"De regering-Ayrault I is de vijfendertigste regering van Frankrijk onder de Vijfde Republiek. De centrumlinkse regering, die onder leiding van premier Jean-Marc Ayrault vanaf 15 mei 2012 stond, trad af in verband met de ontbinding van de Nationale Vergadering door president François Hollande.\\nMet deze verkiezingen trachtte hij een socialistische meerderheid in de Assemblée te krijgen en cohabitation te voorkomen. De Parti socialiste kreeg inderdaad een meerderheid en op 18 juni 2012 trad de regering-Ayrault II aan."},{"page_url":"https://en.wikipedia.org/wiki/Alloue","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c8/Alloue_lavoir.JPG","page_title":"Alloue","context_page_description":"Alloue is a commune in the Charente department in the Nouvelle-Aquitaine region of southwestern France.\\nAlloue was part of the province of Limousin. Its inhabitants speak the Occitan form of the Limousin dialect.\\nThe inhabitants of the commune are known as Allousiens or Allousiennes"},{"page_url":"https://en.wikipedia.org/wiki/Maya_calendar","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/01/MAYA-g-log-cal-D17-Kaban.png","page_title":"Maya calendar","context_page_description":"The Maya calendar is a system of calendars used in pre-Columbian Mesoamerica and in many modern communities in the Guatemalan highlands, Veracruz, Oaxaca and Chiapas, Mexico.\\nThe essentials of the Maya calendar are based upon a system which had been in common use throughout the region, dating back to at least the 5th century BCE. It shares many aspects with calendars employed by other earlier Mesoamerican civilizations, such as the Zapotec and Olmec and contemporary or later ones such as the Mixtec and Aztec calendars.\\nBy the Maya mythological tradition, as documented in Colonial Yucatec accounts and reconstructed from Late Classic and Postclassic inscriptions, the deity Itzamna is frequently credited with bringing the knowledge of the calendar system to the ancestral Maya, along with writing in general and other foundational aspects of Maya culture."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%8F%B0%E7%81%A3%E9%90%B5%E8%B7%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/14/TRA_TED1008_at_Qidu_Station_20130704.jpg","page_title":"台灣鐵路","context_page_description":"臺灣鐵路是臺灣鐵路管理局直營的鐵路線之總稱，為臺灣主要的鐵路運輸系統。1891年通車營運，採用1067mm軌距。目前由西部幹線、東部幹線、南迴線等3條幹線，以及10條客貨運支線所組成。"},{"page_url":"https://sv.wikipedia.org/wiki/Mogaogrottorna","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3f/Dunhuang_Mogao_Ku_2013.12.31_12-30-18.jpg","page_title":"Mogaogrottorna","context_page_description":"Mogaogrottorna, även kallad De tusen buddhastatyernas grottor eller Dunhuanggrottorna, består av fler än 700 grottor uthuggna i en bergssida utanför Dunhuang i Gansuprovinsen i Kina. De flesta grottorna är rikt utsmyckade tempel med målade statyer och väggmålningar huvudsakligen i buddhistisk stil. Grottorna byggdes med början på 300-talet e.Kr. fram till 1300-talet. På grund av grottornas placering längs Sidenvägen och den långa byggnadstiden uppvisar utsmyckningarna i grottorna influenser från många kulturer och epoker. Grottorna utgör världens största samling av buddhistisk konst. År 1900 hittades Dunhuangmanuskripten, en stor mängd historiskt mycket värdefulla dokument i en dold och förseglad grotta. I dag är grottorna en välbesökt turistattraktion. Sedan 1987 är Mogaogrottorna listade av Unesco som världsarv."},{"page_url":"https://fr.wikipedia.org/wiki/%C3%9Cmit_Karan","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/27/%C3%9Cmit_Karan_in_my_friend%27s_birthday.png","page_title":"Ümit Karan","context_page_description":"Ümit Karan est footballeur turc qui évolue au poste d'attaquant à Eskişehirspor."},{"page_url":"https://ca.wikipedia.org/wiki/Grega_Bole","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8c/Leuven_-_Brabantse_Pijl%2C_15_april_2015%2C_vertrek_%28B129%29.JPG","page_title":"Grega Bole","context_page_description":"Grega Bole és un ciclista eslovè, professional des del 2005. Actualment corre a l'equip Bahrain-Merida.\\nCom a amateur i en els seus primers anys com a professional ha aconseguit nombroses victòries, destacant una etapa al Critèrium del Dauphiné 2010 i el Campionat d'Eslovènia en ruta de 2011."},{"page_url":"https://de.wikipedia.org/wiki/Leif_Geiges","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/87/Ruhest%C3%A4tte_Fritz_Geiges_-_Ehrenb%C3%BCrger_Stadt_Freiburg_-_Hauptfriedhof_Freiburg_Breisgau.jpg","page_title":"Leif Geiges","context_page_description":"Leif Geiges war ein deutscher Fotograf und Reporter."},{"page_url":"https://de.wikipedia.org/wiki/Slobodan_Milo%C5%A1evi%C4%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/14/Slobodan_Milosevic_Dayton_Agreement.jpg","page_title":"Slobodan Milošević","context_page_description":"Slobodan Milošević war ein kommunistischer und später sozialistischer jugoslawischer und serbischer Politiker.\\nInnerhalb verschiedener politischer Funktionen galt er von 1987 bis 2000 als die bestimmende politische Führungsfigur Serbiens und später der Bundesrepublik Jugoslawien.\\nMilošević war Parteivorsitzender des Bundes der Kommunisten Serbiens und außerdem Gründer und langjähriger Vorsitzender der Sozialistischen Partei Serbiens.\\nMilošević fungierte als Präsident der Sozialistischen Republik Serbien, Präsident der Republik Serbien und Präsident der Bundesrepublik Jugoslawien.\\nIm Zusammenhang mit dem Kosovokrieg wurde er 1999 als erstes Staatsoberhaupt noch während seiner Amtsausübung von einem Kriegsverbrechertribunal wegen Völkermordes angeklagt. Nachdem Milošević am 5. Oktober 2000 aufgrund von Massendemonstrationen als jugoslawischer Staatspräsident zurückgetreten war, wurde er auf Betreiben des serbischen Ministerpräsidenten Zoran Đinđić im Jahr 2001 verhaftet und an das UN-Kriegsverbrechertribunal in Den Haag ausgeliefert. Der Prozess begann im Jahr 2002, jedoch starb Milošević im Jahr 2006 vor dem Abschluss des Verfahrens, so dass es zu keinem Urteil kam."},{"page_url":"https://cs.wikipedia.org/wiki/Indon%C3%A9sk%C3%A1_kuchyn%C4%9B","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/ba/Tapai_peuyeum_Pasar_Baru.JPG","page_title":"Indonéská kuchyně","context_page_description":"Indonéská kuchyně je národní kuchyní Indonésie. Je to jedna z nejrozmanitějších národních kuchyní světa, protože v Indonésii žije na 17 508 ostrovech přes 300 různých etnických skupin.\\nV Indonésii se mísí několik gastronomických vlivů, například kuchyně Sumatry byla ovlivněna indickou kuchyní a kuchyní Středního východu, kuchyně Jávy je převážně tradiční, s malým vlivem čínské kuchyně, zatímco kuchyně východní Indonésii je podobná kuchyni Polynésie a Melanésie. Indonéská kuchyně byla též ovlivněna nizozemskou kuchyní.\\nVětšina indonéských jídel je pikantní, ale indonéské kuchyně pracuje i se základními chutěmi. Základním pilířem je pálivá krevetová pasta sambal.\\nIndonéská kuchyně používá sedm základních postupů přípravy jídla: smažení, grilování, pečení, pražení, sauté, vaření a příprava na páře."},{"page_url":"https://es.wikipedia.org/wiki/Cedar_Glen_Lakes","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/36/Ocean_County_New_Jersey_Incorporated_and_Unincorporated_areas_Cedar_Glen_Lakes_Highlighted.svg","page_title":"Cedar Glen Lakes","context_page_description":"Cedar Glen Lakes es un lugar designado por el censo ubicado en el condado de Ocean en el estado estadounidense de Nueva Jersey. En el año 2010 tenía una población de 1421 habitantes y una densidad poblacional de 835.8 personas por km².​"},{"page_url":"https://zh.wikipedia.org/zh-my/%E5%BE%A1%E6%89%80%E5%B8%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0f/Gose_city_office.jpg","page_title":"御所市","context_page_description":"御所市是位于日本奈良县西部的城市，目前是奈良县内人口最少的城市。\\n辖区位于奈良盆地的西南端，西边有大和葛城山、金刚山耸立，向南越过“风之森鞍部”即为五条市。"},{"page_url":"https://fr.wikipedia.org/wiki/Synagogue_de_Tachau_(1912-1938)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d6/Tachau_synagogue-_architect_drawing_-2.jpg","page_title":"Synagogue de Tachau (1912-1938)","context_page_description":"La synagogue de Tachau, ou synagogue de Tachov, inaugurée en 1912, a été détruite en 1938 lors de la nuit de Cristal comme la plupart des autres lieux de culte juif en Allemagne et dans les territoires alors annexés par le Troisième Reich.\\nJusqu'en 1918, Tachau, capitale du district de Tachau, en Bohême, fait partie de l'Empire d'Autriche. Après la Première Guerre mondiale, la Bohême est intégrée à la Tchécoslovaquie et la ville prend le nom tchèque de Tachov. À la suite des accords de Munich, la ville fait partie de la région des Sudètes, majoritairement peuplée de germanophones, annexée par l'Allemagne nazie et réunie au Reich allemand le 21 octobre 1938. Tachov reprend son ancien nom de Tachau. Après la Seconde Guerre mondiale, Tachov redevient une ville tchécoslovaque d'où est expulsée la majorité des habitants germanophones. Actuellement la ville qui fait partie de la République tchèque, compte un peu plus de 12 500 habitants."},{"page_url":"https://az.wikipedia.org/wiki/Yaponiya_m%C9%99tb%C9%99xi","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/Tempura.JPG","page_title":"Yaponiya mətbəxi","context_page_description":"Yaponiya mətbəxi — Yaponiyanın milli, məşhur mətbəxi. Dadların cürbəcürlüyü ilə boldur. Təbii və ahəngdar olan bu mətbəx dünyanın ən sağlam mətbəxi sayılır. Tərkibində kalori miqdarı azdır. Yapon mətbəxi dəmir və proteinlə zəngindir, tərkibindəki xolesterin və piylərin müxtəlif növlərinin miqdarı isə aşağıdır. Çox insan razılaşır ki, yapon qidası daha çox sağlamdır və yaponların uzunömürlülüyü bunun tam sübutudur."},{"page_url":"https://en.wikipedia.org/wiki/Boto","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/72/Inia.jpg","page_title":"Boto","context_page_description":"Boto is a Portuguese name given to several types of dolphins and river dolphins native to the Amazon and the Orinoco River tributaries. A few botos exist exclusively in fresh water, and these are often considered primitive dolphins."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E5%9F%8E%E5%A2%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/76/Taishan_from_Tai%27an_01.jpg","page_title":"城墙","context_page_description":"城牆，古代軍事防禦設施，由牆體和其他輔助軍事設施構成的軍事防線。城牆的含義，根據的其功能有廣義和狹義之分。\\n廣義的城牆分為二類，即一類構成長城的主體，另一類屬於城市防禦建築，由牆體和附屬設施構成封閉區域。\\n狹義的城牆指由牆體和附屬設施構成的城市封閉型區域。封閉區域內為城內，封閉區域外為城外。城牆作為城市、城池和城堡的抵禦外侵防禦性建築。\\n城牆從結構和功能分，主要由牆體、垛口、城樓、角樓、城門等部分構成。絕大多數城牆外圍還有護城河。從建築的原材料分，分為版築夯土牆、土坯壘砌牆、青磚砌牆、石砌牆和磚石混合砌築多種類型。\\n右圖是岱廟北城牆，可從城牆上看見泰山。"},{"page_url":"https://ta.wikipedia.org/wiki/%E0%AE%AE%E0%AE%B2%E0%AF%8D%E0%AE%B2%E0%AE%BF%E0%AE%95%E0%AE%BE_%E0%AE%9A%E0%AE%BE%E0%AE%B0%E0%AE%BE%E0%AE%AA%E0%AE%BE%E0%AE%AF%E0%AF%8D","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7e/Mallika-sarabhai-before-performance-saarang-2011-iit-madras.jpg","page_title":"மல்லிகா சாராபாய்","context_page_description":"மல்லிகா சாராபாய் ஒரு இந்திய சமூக ஆர்வலரும் மற்றும் பிரபல நடனக் கலைஞருமாவர். இவர் மறைந்த இந்திய விண்வெளி ஆராய்ச்சி நிபுணர் விக்ரம் சாராபாய் - பிரபல நடனக் கலைஞர் மிருணாளினி சாராபாய் தம்பதியினரின் மகளான இவர் ஒரு திறமையான குச்சிபுடி மற்றும் பரதநாட்டிய நடனக் கலைஞராவார். மேலும், சமூக மாற்றம் மற்றும் மாற்றத்திற்காக கலைகளைப் பயன்படுத்துவதில் நிபுணத்துவம் பெற்றவராவார். 2009ஆம் ஆண்டு நாடாளுமன்றத் தேர்தலில் பாரதிய ஜனதா கட்சியின் மூத்த தலைவர் லால் கிருட்டிண அத்வானியை எதிர்த்துப் போட்டியிட்டார். இதனால் நாடு முழுவதும் பிரபலம் அடைந்த மல்லிகா சாராபாய் அந்தத் தேர்தலில் வெற்றி பெறவில்லை."},{"page_url":"https://sv.wikipedia.org/wiki/Caccobius_meridionalis","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f6/Caccobius_%28Caccophilus%29_meridionalis_Boucomont%2C_1914_%289676886289%29.png","page_title":"Caccobius meridionalis","context_page_description":"Caccobius meridionalis är en skalbaggsart som beskrevs av Antoine Boucomont 1914. Caccobius meridionalis ingår i släktet Caccobius och familjen bladhorningar. Inga underarter finns listade."},{"page_url":"https://fi.wikipedia.org/wiki/Ven%C3%A4j%C3%A4n_keisarikunta","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/16/Reading_of_the_Manifest_%28Liberation_of_peasants%29_-_Kustodiev%2C_1907.jpg","page_title":"Venäjän keisarikunta","context_page_description":"Venäjän keisarikunta oli Euroopan itäosista Beringinmerelle ulottunut keisarikunta, joka oli olemassa vuosina 1721–1917. Se sai alkunsa Pietari Suuren aikana, jolloin Venäjä laajeni Baltiasta Tyynellemerelle, ja kesti aina vuoden 1917 helmikuun vallankumoukseen asti, jolloin keisari Nikolai II syrjäytettiin. Keisarikuntaa edelsi Moskovan Venäjä ja seurasi lyhytaikainen Venäjän tasavalta."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%B8%D1%81%D1%81%D0%B5,_%D0%94%D0%B6%D0%B8%D0%B1%D1%80%D0%B8%D0%BB%D1%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b4/Djibril_Ciss%C3%A9_2013.jpg","page_title":"Сиссе, Джибриль","context_page_description":"Джибри́ль Сиссе́ — французский футболист ивуарийского происхождения, нападающий. Участник чемпионатов мира 2002 и 2010 годов в составе сборной Франции.\\nСиссе родился в мусульманской семье выходцев из Кот-д’Ивуара. Он был седьмым и самым младшим ребёнком в семье. Его покойный отец Манге Сиссе был профессиональным футболистом. На Кубке Африки 1970 года он был капитаном сборной Кот-д’Ивуара. В 1974 году вся семья переехала во Францию, где уже и родился Джибриль."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%A8%D8%A7%D9%86%D8%AF%D8%A7%DB%8C_%D9%86%D8%A7%D9%85%DA%A9%D9%88_%D8%A7%D9%86%D8%AA%D8%B1%D8%AA%DB%8C%D9%86%D9%85%D9%86%D8%AA","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7b/Sumitomo-rd_Mita_Build._IMG_3594r_20160116.JPG","page_title":"باندای نامکو انترتینمنت","context_page_description":"باندای نامکو انترتینمنت یک شرکت چندملیتی سازنده و توسعه‌دهنده بازی‌های رایانه‌ای خانگی، بازی‌های آرکید و موبایل واقع در میناتو-کو، توکیو، کشور ژاپن است. این شرکت متشکل از دو شرکت ژاپنی عروسک‌سازی باندای و نامکو است."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A4%D0%BB%D0%B0%D0%B3%D0%B8_%D0%9A%D0%B8%D1%80%D0%BE%D0%B2%D1%81%D0%BA%D0%BE%D0%B9_%D0%BE%D0%B1%D0%BB%D0%B0%D1%81%D1%82%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/00/Flag_of_Kirovo-Chepetsky_rayon_%28Kirov_oblast%29.png","page_title":"Флаги Кировской области","context_page_description":"Список флагов муниципальных образований Кировской области Российской Федерации.\\nНа 1 января 2018 года в Кировской области насчитывалось 364 муниципальных образования — 6 городских округов, 39 муниципальных районов, 52 городских и 267 сельских поселений."},{"page_url":"https://pt.wikipedia.org/wiki/Fr%C3%B6lunda-H%C3%B6gsbo","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/21/Fr%C3%B6lunda_torg.jpg","page_title":"Frölunda-Högsbo","context_page_description":"Frölunda-Högsbo foi uma freguesia administrativa da cidade sueca de Gotemburgo em 2010, quando as freguesias de Frölunda e de Högsbo foram fundidas numa só freguesia. No ano seguinte, uma nova reforma juntou Frölunda-Högsbo a Askim, formando assim a nova freguesia de Askim-Frölunda-Högsbo."},{"page_url":"https://mk.wikipedia.org/wiki/%D0%9D%D0%B0%D0%B4%D0%B2%D0%BE%D1%98%D0%B2%D0%BE%D0%B4%D1%81%D1%82%D0%B2%D0%BE_%D0%90%D0%B2%D1%81%D1%82%D1%80%D0%B8%D1%98%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/64/Oostr1477.png","page_title":"Надвојводство Австрија","context_page_description":"Надвојводство Австрија — едно од главните надвојводства на Светото Римско Царство и јадрото на Хабсбуршката монархија. Со главен град Виена, надвојводството претставувало центар во југоисточниот дел на царството.\\nНадвојводството било основано на територијата на Маркгрофство Австрија и Војводство Австрија. Хабсуршката династија на австрискиот престол дошле во 1282 година и во 1453 година царот Фридрих III како австриски владетел официјално ја додал титулата надвојвода, основајќи го Надвојводство Австрија. Од 15 век сите свети римски цареви ја користиле титулата надвојвода.\\nИсторијата на ова надвојводство завршила со распаѓањето на Светото Римско Царство во 1806 година. Таа била наследена од Долна Австрија и Горна Австрија како дел од Австриско Царство.\\nАвстрија се наоѓа по долината на река Дунав. Граничела со Кралство Унгарија на исток, на југ со Војводство Штаерска, на север со Бохемија и Моравија и на запад со Војводство Баварија."},{"page_url":"https://sv.wikipedia.org/wiki/Baraeus_aurisecator","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/53/Baraeus_aurisecator_-_Flickr_-_Bennyboymothman.jpg","page_title":"Baraeus aurisecator","context_page_description":"Baraeus aurisecator är en skalbaggsart som beskrevs av Thomson 1858. Baraeus aurisecator ingår i släktet Baraeus och familjen långhorningar.\\nArtens utbredningsområde är Gabon. Inga underarter finns listade."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%A7%D9%84%D8%B3%D9%8A%D8%AF%D8%A9_%D8%A7%D9%84%D8%B9%D8%B0%D8%B1%D8%A7%D8%A1_(%D8%AA%D8%B5%D9%88%D9%8A%D8%B1)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/Raphael_Madonna_dell_Granduca.jpg","page_title":"السيدة العذراء (تصوير)","context_page_description":"مادونا هي أي تجسيد مرئي لمريم العذراء، إما وحدها أو مع طفلها يسوع. الكلمة أصلها في الإيطالية القديمة ma donna. لا توجد صورة تتخلل في الفن المسيحي مثل صورة السيدة العذراء والطفل. قد يتم الإشارة إلى مريم العذراء باسم \\"مادونا\\" في صيغ مختلفة، أما في الفن فهذا المصطلح ينطبق تحديدًا على أي عمل فني تكون فيه مريم العذراء هي المحور والشخصية الرئيسية للصورة سواءً كانت مع الطفل يسوع أو دونه. قد تكون مريم والطفل يسوع محاطين بملائكة مغرمين أو قديسين يتعبدون. لا يُشار بهذا المصطلح إلى الصور التي يكون لها مضمون سردي، بما في ذلك تلك المشاهد العديدة التي تتضمنها حياة العذراء، ويتم إعطاء مثل هذه الأعمال العنوان الذي يعكس المشهد مثل البشارة."},{"page_url":"https://bs.wikipedia.org/wiki/Dutovlje","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/Dutovlje_Slovenia_-_cistern.JPG","page_title":"Dutovlje","context_page_description":"Dutovlje su naseljeno mjesto u sastavu općine Sežana, regija Obalno-kraška, Slovenija."},{"page_url":"https://pt.wikipedia.org/wiki/Saint-Pierre-de-Bat","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/Saint-Pierre-de-Bat_Mairie.jpg","page_title":"Saint-Pierre-de-Bat","context_page_description":"Saint-Pierre-de-Bat é uma comuna francesa na região administrativa da Nova Aquitânia, no departamento da Gironda. Estende-se por uma área de 8,96 km². Em 2010 a comuna tinha 314 habitantes."},{"page_url":"https://sl.wikipedia.org/wiki/Vpliv_kajenja_tobaka_na_zdravje","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/81/Cancer_smoking_lung_cancer_correlation_from_NIH.png","page_title":"Vpliv kajenja tobaka na zdravje","context_page_description":"Že dolgo časa so znane škodljive posledice kajenja tobaka za zdravje. Kajenje je odgovorno za nastanek srčnih bolezni, cerebrovaskularnih bolezni, kronične pljučne bolezni in pljučnega raka. Le-te so najpogostejše bolezni v evropski regiji. V evropski regiji je tobak na drugem mestu dejavnikov tveganja za nastanek bolezni.\\nV svetovnem merilu je kajenje tobaka drugi največji vzrok za smrtnost v svetu. Trenutno je kajenje odgovorno za smrt enega od desetih odraslih."},{"page_url":"https://nn.wikipedia.org/wiki/Det_aserbajdsjanske_riksv%C3%A5penet","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6b/Emblem_of_Azerbaijan.svg","page_title":"Det aserbajdsjanske riksvåpenet","context_page_description":"Det aserbajdsjanske riksvåpenet vart godkjent i si noverande form 1992. Den demokratiske republikken Aserbaijdsjan hadde eit liknande riksvåpen frå 1918 til oppløysinga i 1920. Våpenet er sirkulært og har ein raud flamme som sentralmotiv over eit stort sylv oktagram Rub el Hizb med gull ramme. Mellom kvar av spissane i den store stjerna er det mindre gull oktagrammar.\\nFlammesymbolet spelar på tydinga av namnet til landet: «Landet åt den evige elden». Bakgrunnsfargane er dei same som i nasjonalflagget. Under våpenet ligg ei eikegrein og eit kveiteaks."},{"page_url":"https://fr.wikipedia.org/wiki/Dodge_Colt","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/86/1978_Dodge_Colt_wagon.jpg","page_title":"Dodge Colt","context_page_description":"La Dodge Colt et les Plymouth Champ et Plymouth Colt, sont des automobiles de Dodge et Plymouth entre 1970 et 1994."},{"page_url":"https://de.wikipedia.org/wiki/Isla_de_Luzon","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/6f/Isla_de_Luzon.jpg","page_title":"Isla de Luzon","context_page_description":"Die Isla de Luzón war das Typschiff einer Klasse kleiner Geschützter Kreuzer der Spanischen Marine. In der Schlacht in der Bucht von Manila versenkte die Besatzung das Schiff selbst. Die amerikanischen Eroberer hoben das Schiff und setzten es wieder instand.\\nAls Kanonenboot USS Isla de Luzon kam der ehemals spanische Kreuzer 1900 in den Dienst der US Navy. Zuerst wurde sie im Kampf mit den philippinischen Rebellen eingesetzt. Ab 1903 war sie Ausbildungsschiff für Reservekräfte und von 1914 bis zum Herbst 1918 an den Großen Seen stationiert.\\n1920 wurde die ehemals spanische Isla de Luzón an die Bahama & West Indies Trading Co. verkauft und in Reviver umbenannt. 1931 wurde der ehemalige spanische Kreuzer abgebrochen."},{"page_url":"https://de.wikipedia.org/wiki/Industriemuseum_Howaldtsche_Metallgie%C3%9Ferei","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6b/Alte_Metallgiesserei%2C_2016.jpg","page_title":"Industriemuseum Howaldtsche Metallgießerei","context_page_description":"Das Industriemuseum Howaldtsche Metallgießerei befindet sich an der Grenzstraße 1 am Nordufer der Schwentine in Kiel. Das Museum wurde im Mai 2007 eröffnet. Das historische Gebäude von 1884 steht seit 1992 unter Denkmalschutz."},{"page_url":"https://en.wikipedia.org/wiki/Giuseppe_Giusti","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9e/Giuseppe_Giusti.jpg","page_title":"Giuseppe Giusti","context_page_description":"Giuseppe Giusti was an Italian poet and satirist."},{"page_url":"https://en.wikipedia.org/wiki/1948_Sabena_DC-4_Crash","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fe/KLM_PH-TAR_Douglas_DC-4.jpg","page_title":"1948 Sabena DC-4 Crash","context_page_description":"The 1948 Sabena DC-4 Crash was the crash of a Douglas DC-4-1009 of the Belgian airline Sabena, 27 km south of Libenge, Belgian Congo, on 12 May 1948. It was the deadliest accident for Sabena at the time and the second of three deadly Sabena crashes in 1948. It was also the deadliest in Belgian Congo before the country's independence as the Democratic Republic of the Congo in 1960. Of the 32 people on board 31 were killed, leaving only one survivor."},{"page_url":"https://en.wikipedia.org/wiki/Blue_Earth_County_Courthouse","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6a/Blue_Earth_County_Courthouse.jpg","page_title":"Blue Earth County Courthouse","context_page_description":"The Blue Earth County Courthouse is the courthouse of Blue Earth County, Minnesota, United States, in the city of Mankato, the county seat. It is listed on the National Register of Historic Places."},{"page_url":"https://de.wikipedia.org/wiki/Bahnstrecke_Bramming%E2%80%93T%C3%B8nder","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/14/1978_MO_1849_Skaerbaek.jpg","page_title":"Bahnstrecke Bramming–Tønder","context_page_description":"Die Bahnstrecke Bramming–Tønder ist eine Strecke zwischen Bramming und Tønder nördlich der heutigen deutsch-dänischen Grenze in Nordschleswig bzw. in Sønderjylland. Sie ist aus historischer Sicht Teil der Marschbahn.\\nAlle Züge fahren heute über den ehemaligen Endbahnhof hinaus und beginnen bzw. enden in Esbjerg. Seit 2003 wird der Verkehr von Arriva durchgeführt."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%B0%D1%80%D0%B0%D0%B5%D0%B2%D1%81%D0%BA%D0%B8%D0%B9_%D0%BA%D0%B0%D0%BD%D1%82%D0%BE%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9b/Flag_of_Sarajevo_Canton.png","page_title":"Сараевский кантон","context_page_description":"Сараевский кантон — один из десяти кантонов Федерации Боснии и Герцеговины, входящей в Боснию и Герцеговину."},{"page_url":"https://zh.wikipedia.org/zh-tw/5-%E8%84%B1%E6%B0%A2%E8%A1%A8%E7%94%BE%E9%86%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/00/5-Dehydroepisterol_molecule_ball.png","page_title":"5-脱氢表甾醇","context_page_description":"5-脫氫表甾醇是油菜素類固醇等物質生物合成過程中的中間產物，由C-5甾醇去飽和酶催化表甾醇生成，再通過7-脫氫膽固醇還原酶轉化為24-亞甲基膽固醇。\\n表甾醇和5-脫氫表甾醇在利什曼原蟲中也有發現。"},{"page_url":"https://it.wikipedia.org/wiki/Settimana_santa_di_Piana_degli_Albanesi","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d7/Pasqua_a_Piana_degli_Albanesi.jpg","page_title":"Settimana santa di Piana degli Albanesi","context_page_description":"La Settimana Santa di Piana degli Albanesi, anche Java e Madhe dhe e Shejte, ovvero la Grande e Santa Settimana, comprende una serie di celebrazioni che si svolgono nella cittadina omonima - in modo particolare nella cattedrale di San Demetrio Megalomartire - durante la Settimana Santa, secondo il rito bizantino degli italo-albanesi.\\nLa Pasqua Albanese di Sicilia e i Riti della Grande e Santa Settimana di Piana degli Albanesi, per la complessità dei riti, la sontuosità e la raffinatezza dei paramenti sacri e degli abiti femminili, le manifestazioni folcloristiche, costituisce la ricorrenza centrale della comunità albanese dell'isola, dalla cui data dipendono le altre feste; occasione in cui ogni arbëreshë ritrova le proprie radici, consapevole del valore del patrimonio religioso e culturale della comunità d'appartenenza. Rappresenta la festa delle feste, i quali riti della Passione, della morte e della Resurrezione di Gesù vengono vissuti secondo la ricca simbologia orientale."},{"page_url":"https://fi.wikipedia.org/wiki/Morning_Glory_Pool","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c2/Morning_Glory_Pool2.jpg","page_title":"Morning Glory Pool","context_page_description":"Morning Glory Pool on kuuma lähde ja geysir Yellowstonen kansallispuistossa, Wyomingin osavaltiossa. Se on värikas lähde, joka on yksi puiston suosituimmista nähtävyyksistä.\\nMorning Glory Pool sai nimensä 1880-luvulla kiertokasvien heimon kasveilta. Monia niistä kutsutaan englanniksi nimellä morning glory, ja lähde muistutti kasveja. Lammen halkaisija on noin 4 metriä, ja veden lämpötila 69,8 °C. Morning Glory Pool on myös geysir, mutta sen ei tiedetä purkautuneen luonnollisesti kuin 1944. Siitä on kuitenkin valumakanavat Fireholejokeen.\\nMorning Glory Pool oli alkujaan vaalean sininen, mutta se on menettänyt osan väristään. Syynä tähän on turistien heittämät kolikot ja roskat, jotka ovat tukkineet osittain suonet, joista lämmin vesi on päässyt altaaseen. Aiemmin veden lämpötila oli niin korkea, ettei syanobakteerit pystyneet elämään siellä. Veden lämpötila on kuitenkin laskenut vesisuonien tukkeuduttua. Vuonna 1950 Morning Glory Pool pakotettiin purkautumaan geysirinä. Se syöksi veden lisäksi ulos muun muassa lähes 100 dollarin arvosta kolikoita, pulloja, nenäliinoja, sukkia, paitoja ja alusvaatteita."},{"page_url":"https://cy.wikipedia.org/wiki/Etna","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/Etna_from_Taormina_2006.jpg","page_title":"Etna","context_page_description":"Llosgfynydd yn nwyrain Ynys Sisili yn yr Eidal yw Etna. Mae ganddo un crater canolog a tua 200 o grateri llai o'i gwmpas. Uchder y llosgfynydd yw 3263m.\\nCofnodiwyd y ffrwydriad hanesyddol cyntaf yn y flwyddyn 476 CC. Ffrwydrodd yn 1693 pan fu nifer o gofnodion ffrwydrol yn ardal Harlech yn ogystal trwy gyd-ddigwyddiad Yn yr 20g cafwyd ffrwydriadau sylweddol yn 1928, 1949 a 1971."},{"page_url":"https://de.wikipedia.org/wiki/Schwarzeck_(Ramsau)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/97/Ramsau-Zum_Guten_Hirten-Front1.JPG","page_title":"Schwarzeck (Ramsau)","context_page_description":"Schwarzeck ist eine der vier Gnotschaften der Gemeinde Ramsau bei Berchtesgaden."},{"page_url":"https://it.wikipedia.org/wiki/Montaimont","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1b/Montaimont_-_2012-07-13_-_IMG_5411.jpg","page_title":"Montaimont","context_page_description":"Montaimont è un comune francese di 158 abitanti situato nel dipartimento della Savoia della regione dell'Alvernia-Rodano-Alpi."},{"page_url":"https://sco.wikipedia.org/wiki/Murrayfield_Ice_Rink","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/97/Murrayfield_Ice_Rink_-_geograph.org.uk_-_902146.jpg","page_title":"Murrayfield Ice Rink","context_page_description":"Murrayfield Ice Rink is a 3,800-seat multi-purpose arena in the Murrayfield aurie o Edinburgh, Scotland, richt next duir tae Murrayfield Stadium."},{"page_url":"https://en.wikipedia.org/wiki/White_River_City,_Colorado","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9d/Ambrose_Oldman_-_White_River_City_-_1888-1895.jpg","page_title":"White River City, Colorado","context_page_description":"White River City is a populated place in Rio Blanco County, Colorado, located along the White River.\\nThe settlement was incorporated in 1888 by brothers Reuben and Ambrose Oldman, in hope that a railroad would come through the area along White River. Ambrose was involved in oil speculation in the area and ran a store on Piceance Creek until 1895, when he moved to Meeker. There was a schoolhouse in 1902."},{"page_url":"https://en.wikipedia.org/wiki/Nassarius","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/82/Nassarius_semistriatus_02.JPG","page_title":"Nassarius","context_page_description":"Nassarius, common name nassa mud snails or dog whelks, is a genus of minute to medium-sized sea snails, marine gastropod molluscs in the family Nassariidae. They are scavengers."},{"page_url":"https://de.wikipedia.org/wiki/Aue_(Sachsen)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/Aue_Weihnachtsmarkt.jpg","page_title":"Aue (Sachsen)","context_page_description":"Aue ist seit Januar 2019 ein Ortsteil der Großen Kreisstadt Aue-Bad Schlema im sächsischen Erzgebirgskreis und gehört zum Städtebund Silberberg.\\nDie Stadt liegt in einem tiefen Talkessel der Zwickauer Mulde und galt bis zum Ende des 20. Jahrhunderts als bedeutende Bergbau- und Industriestadt. Im 16. und 17. Jahrhundert erlebte sie durch den Abbau und die Verarbeitung von Eisen-, Silber- und Zinnerzen sowie von Kaolinerde eine erste Blüte. Durch die Gewinnung von Nickel aus den in der Umgebung vorkommenden Erzen und die Erzeugung von Argentan sowie die Industrialisierung im 19. Jahrhundert siedelten sich bedeutende Betriebe der Metallverarbeitung, des Maschinenbaus und der Textilverarbeitung an und trugen zu einem neuen Aufschwung bei. Eine dritte Blütezeit begann nach dem Zweiten Weltkrieg, als durch die SDAG Wismut der Abbau von Uran vorangetrieben wurde. Aue ist vor allem durch den Fußballverein FC Erzgebirge Aue und den Handballverein EHV Aue überregional bekannt."},{"page_url":"https://ja.wikipedia.org/wiki/%E4%BD%90%E5%A5%88%E7%94%B0%E9%9C%8A%E7%A4%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/da/Sanada-reisya_01.jpg","page_title":"佐奈田霊社","context_page_description":"佐奈田霊社は、源頼朝旗揚げの地「石橋山古戦場」にある神仏習合の霊社である。\\n1180年より日本唯一の「のど・声、喘息、気管支炎 等」の祈願所とともに戦の先駆け=魁の神様を奉る。\\n護摩の祈祷あり。\\n石王山宝寿寺が管理している。"},{"page_url":"https://en.wikipedia.org/wiki/List_of_regular_polytopes_and_compounds","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/14/Hyperbolic_honeycomb_3-4-5_poincare_cc.png","page_title":"List of regular polytopes and compounds","context_page_description":"This page lists the regular polytopes and regular polytope compounds in Euclidean, spherical and hyperbolic spaces.\\nThe Schläfli symbol describes every regular tessellation of an n-sphere, Euclidean and hyperbolic spaces. A Schläfli symbol describing an n-polytope equivalently describes a tessellation of an-sphere. In addition, the symmetry of a regular polytope or tessellation is expressed as a Coxeter group, which Coxeter expressed identically to the Schläfli symbol, except delimiting by square brackets, a notation that is called Coxeter notation. Another related symbol is the Coxeter-Dynkin diagram which represents a symmetry group with no rings, and the represents regular polytope or tessellation with a ring on the first node. For example, the cube has Schläfli symbol {4,3}, and with its octahedral symmetry, [4,3] or, it is represented by Coxeter diagram.\\nThe regular polytopes are grouped by dimension and subgrouped by convex, nonconvex and infinite forms. Nonconvex forms use the same vertices as the convex forms, but have intersecting facets. Infinite forms tessellate a one-lower-dimensional Euclidean space.\\nInfinite forms can be extended to tessellate a hyperbolic space."},{"page_url":"https://en.wikipedia.org/wiki/Saint-Robert-Bellarmin,_Quebec","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c7/SaintRobertBellarmain.jpg","page_title":"Saint-Robert-Bellarmin, Quebec","context_page_description":"Saint-Robert-Bellarmin is a municipality in the Municipalité régionale de comté du Granit in Estrie, Quebec, Canada, located on the Canada–United States border. Population is 645 as of 2006.\\nIt is also the location of the Saint-Robert-Bellarmin Wind Project, an 80 MW project located 3 km East-South-East of the town.\\nThe area had already been settled in 1907. The local economy revolves mostly around lumber, sugar bushes and the seasonal deer hunt. Many Bellarminois work in neighbouring Saint-Gédéon-de-Beauce.\\nThe municipality was named after Robert Bellarmine, an Italian Jesuit who participated actively in the Counter-Reformation."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_beelden_in_Midden-Groningen","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/fd/Hoogezand_HS_01.JPG","page_title":"Lijst van beelden in Midden-Groningen","context_page_description":"Dit is een chronologische lijst van beelden in Midden-Groningen.\\nOnder een beeld wordt hier verstaan elk driedimensionaal kunstwerk in de openbare ruimte van de Nederlandse gemeente Midden-Groningen, waarbij beeld wordt gebruikt als verzamelbegrip voor sculpturen, standbeelden, installaties, gedenktekens en overige beeldhouwwerken.\\nHet oudste beeld in Midden-Groningen was ongetwijfeld de zonnewijzer van borg Welgelegen in Sappemeer uit 1634; deze is in 2008 ontvreemd.\\nMeerdere beelden in de gemeente hebben een directe link met de lokale geschiedenis, zoals de Boeg van Bulder/Piek, de Veengravers van Mes en de Scheepsjager van Piek."},{"page_url":"https://es.wikipedia.org/wiki/Georges_Dumas","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/92/Georges_Dumas.jpg","page_title":"Georges Dumas","context_page_description":"Georges-Alphonse Dumas fue un médico y psicólogo francés.\\nJorge Dumas se presentó como el fiel discípulo de Théodule Ribot a quien dedica todos sus libros. Es un \\"contrabandista de una nueva generación de psicólogos entre las dos guerras \\". Su campo favorito es el de las emociones.\\nSus lecciones en el Hospital Sainte-Anne tuvieron una gran audiencia. Muchos estudiantes y oyentes se harán famosos: Georges Poyer, André Ombredane, Jean Delay, Claude Lévi-Strauss, Jacques Lacan, Daniel Lagache, Paul Nizan, Raymond Aron, Jean-Paul Sartre, George Canguilhem, entre otros.\\nSu gran trabajo es el Tratado de Psicología. Asume la redacción de numerosos artículos y la dirección del Tratado apareció en 2 volúmenes en los que participan los principales psicólogos franceses de la época. Una nueva edición revisada y ampliada, el Nuevo Tratado de Psicología, aparecerá a partir de 1930 en 10 volúmenes.\\nSus misiones y fundaciones en América del Sur para dar a conocer el pensamiento y la ciencia franceses, crear escuelas secundarias e institutos de investigación y organizar intercambios de profesores y estudiantes fueron numerosos."},{"page_url":"https://en.wikipedia.org/wiki/Kloten_Balsberg_railway_station","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/41/Bahnhof_Balsberg.jpg","page_title":"Kloten Balsberg railway station","context_page_description":"Kloten Balsberg is a railway station in the Swiss canton of Zürich and municipality of Kloten. The station is located on a variant of the multi-stranded Zürich–Winterthur railway line and is served by S-Bahn line S7. It is an interchange point between the Zürich S-Bahn and the Stadtbahn Glattal light rail system, which serves an elevated tram stop, adjacent to the station and connected directly to the station platform by an elevated walkway. The tram stop, which is named Bahnhof Balsberg, is served by Zürich tram routes 10 and 12, operating on behalf of the Stadtbahn Glattal.\\nLine S7 runs every half-hour throughout the day, with services extending to Winterthur in one direction, and to Rapperswil via Zürich in the other direction. Tram route 10 runs between four and eight times per hour, depending on the time of day, with services extending to Zurich Airport in one direction, and to Zürich in the other direction. Tram route 12 runs four times per hour, with services extending to the airport in one direction, and to Stettbach in the other direction. Journey time to Zürich Hauptbahnhof is 15 minutes by train, and 33 minutes by tram."},{"page_url":"https://ca.wikipedia.org/wiki/Cal_Caliss%C3%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/98/Calissosud_03.jpg","page_title":"Cal Calissó","context_page_description":"Cal Calissó o Antics Safareigs de la Baixada de Cal Verge és un edifici històric de Castellar del Vallès construït durant la segona meitat del segle xvii, i que posteriorment fou ampliat al segle xviii. La casa va viure una reforma entre 1802 i 1807 fins que l'any 1897 es convertí en safareigs públics per l'arquitecte Emili Sala Cortés i del qual en fou la promotora la marquesa de Castellar Emília Carles-Tolrà. En l'actualitat l'edifici es troba dins de l'inventari del patrimoni històric, arquitectònic i ambiental de Castellar del Vallès."},{"page_url":"https://ca.wikipedia.org/wiki/Llista_de_monuments_de_Palau-solit%C3%A0_i_Plegamans","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/53/PCSors4080045.jpg","page_title":"Llista de monuments de Palau-solità i Plegamans","context_page_description":"Llista de monuments de Palau-solità i Plegamans inclosos en l'Inventari del Patrimoni Arquitectònic Català per al municipi de Palau-solità i Plegamans. Inclou els inscrits en el Registre de Béns Culturals d'Interès Nacional amb la classificació de monuments històrics i els Béns Culturals d'Interès Local de caràcter arquitectònic."},{"page_url":"https://en.wikipedia.org/wiki/Grade_II*_listed_buildings_in_Harborough","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5e/St_Helen_Saddington_-_geograph.org.uk_-_220274.jpg","page_title":"Grade II* listed buildings in Harborough","context_page_description":"There are over 20,000 Grade II* listed buildings in England. This page is a list of these buildings in Harborough, to the southeast of Leicester."},{"page_url":"https://de.wikipedia.org/wiki/Elizabeth_Comyn","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/Goodrich_Castle_04.jpg","page_title":"Elizabeth Comyn","context_page_description":"Elizabeth Comyn war eine englische Adlige."},{"page_url":"https://ja.wikipedia.org/wiki/%E7%83%8F%E5%8F%A3%E8%85%95%E7%AD%8B","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8c/Coracobrachialis.png","page_title":"烏口腕筋","context_page_description":"烏口腕筋は人間の上肢の筋肉。名の通り起始部が烏口突起から起こり、内下方に向かっては上腕骨の内側前面中部に停止する。支配神経は腕神経叢の外側神経束の枝である筋皮神経である。\\n作用としては上腕の屈曲と内転を行う。屈曲時には上腕筋、上腕二頭筋などと共に協調して働く。"},{"page_url":"https://ast.wikipedia.org/wiki/Renault_Clio","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7f/Renault_Clio_IV_RS_%28rear%29.JPG","page_title":"Renault Clio","context_page_description":"El Renault Clio ye un automóvil perteneciente al segmentu B producíu pol fabricante francés d'automóviles Renault. Empezar a comercializar en 1990 como socesor del Renault Supercinco.\\nEl Clio nun se comercializa con esti nome en tolos países. En Xapón ye conocíu pol de Lutecia, nome qu'alude al orixe romanu de la ciudá de París.\\nEl Renault Clio foi escoyíu Coche del Añu n'Europa en 1991 y 2006, Coche del Añu n'España en 1991, \\"Meyor Automóvil Subcompacto\\" Automóvil Panamericanu magacín en 2002, 2003 y 2004 en Méxicu."},{"page_url":"https://en.wikipedia.org/wiki/List_of_Ilyushin_aircraft","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6a/IL-18-700px.jpg","page_title":"List of Ilyushin aircraft","context_page_description":"This is a list of aircraft produced by Ilyushin, a Russian aircraft manufacturer."},{"page_url":"https://fr.wikipedia.org/wiki/Histoire_de_l%27Union_%C3%A9conomique_et_mon%C3%A9taire_europ%C3%A9enne","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/76/Bundesarchiv_B_145_Bild-F074462-0012%2C_Bonn%2C_Pressekonferenz_Koalitionsverhandlungen.jpg","page_title":"Histoire de l'Union économique et monétaire européenne","context_page_description":"L'histoire de l'Union économique et monétaire européenne a été envisagée depuis le XIXᵉ siècle et mise en place progressivement à partir de la fin du XXᵉ siècle, au sein de l 'Union européenne : la zone euro et le mécanisme de taux de change européen."},{"page_url":"https://id.wikipedia.org/wiki/Decauville","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8c/Decauville_track.JPG","page_title":"Decauville","context_page_description":"Decauville dulunya adalah sebuah perusahaan manufaktur yang didirikan oleh Paul Decauville, seorang pelopor perkeretaapian industri asal Prancis. Inovasi besar Decauville antara lain penggunaan serangkaian rel bersepur sempit yang telah diikat ke bantalan baja, sehingga rangkaian rel tersebut dapat dibongkar pasang dan diangkut dengan mudah. Jalur kereta api pertama buatan Decauville menggunakan lebar sepur 400 mm. Decauville kemudian menyempurnakan inovasinya dan beralih ke lebar sepur 500 mm dan 600 mm."},{"page_url":"https://fr.wikipedia.org/wiki/Paroisse_de_Woodstock","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d2/3rd_Duke_of_Portland_1804.jpg","page_title":"Paroisse de Woodstock","context_page_description":"La paroisse de Woodstock est à la fois une paroisse civile et un district de services locaux canadien du Comté de Carleton, située à l'ouest du Nouveau-Brunswick."},{"page_url":"https://zh.wikipedia.org/zh-my/%E5%A4%A7%E6%97%A5%E6%9C%AC%E5%B8%9D%E5%9C%8B%E6%B5%B7%E8%BB%8D%E8%89%A6%E8%89%87%E5%88%97%E8%A1%A8","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/46/Japanese_submarine_depot_ship_Taigei_in_1935.jpg","page_title":"大日本帝國海軍艦艇列表","context_page_description":"大日本帝国海军舰艇列表是明治维新至太平洋战争终结之前期间，大日本帝国海军拥有、或计划拥有的舰艇一览。\\n另外，属于陆军船舶兵拥有的船舶请参考大日本帝国陆军兵器列表\\n再者，关于舰种类别及等级，基本上为竣工时。于终战时被废除的类别则不在此限。另外曾作变更的除特别记述外均会以较最要的作为类别的分类，而航空母舰改造等的重要情况下将会在舰种变更前后都作分类。关于日本海军舰种类别变迁、大日本帝国海军舰艇条目说明，将会在另一条目记述。"},{"page_url":"https://pl.wikipedia.org/wiki/Diecezja_farerska","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/91/Kirkjub%C3%B8ur.6.jpg","page_title":"Diecezja farerska","context_page_description":"Diecezja farerska – historyczna diecezja rzymskokatolicka na Wyspach Owczych ze stolicą w Kirkjubøur."},{"page_url":"https://ckb.wikipedia.org/wiki/%D9%86%DB%95%D8%AC%DB%8C%D8%A8_%DA%95%DB%95%D8%B2%D8%A7%D9%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/70/Dato_Sri_Mohd_Najib_Tun_Razak.JPG","page_title":"نەجیب ڕەزاق","context_page_description":"نەجیب ڕەزاق لەدایکبووی ٢٣ی تەمموزی ١٩٥٣، سیاسەتمەداری مالیزییە وە ئەو شەشەمین سەرۆک وەزیرانی ووڵاتی مالیزیا یە لەوەتەی ساڵی ٢٠٠٩،نەجیب ئەندامی حیزبی ڕێکخراوی نەتەوەی یەکگرتووی مالیزییە.\\nدەروازەی ژیاننامە"},{"page_url":"https://pl.wikipedia.org/wiki/Laranjal_do_Jari","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/df/Simbolo_laranjal_do_jari_Brasao.jpg","page_title":"Laranjal do Jari","context_page_description":"Laranjal do Jari – miasto w Brazylii, w stanie Amapá. W 2010 roku liczyło 37 904 mieszkańców."},{"page_url":"https://it.wikipedia.org/wiki/Montevideo","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d0/Cerro_de_Montevideo_desde_la_ciudad._A%C3%B1o_1865.jpg","page_title":"Montevideo","context_page_description":"Montevideo è la capitale, il porto principale e la città più popolosa dell'Uruguay.\\nSituata nella parte meridionale del paese, si affaccia sulla riva settentrionale del Río de la Plata ed è la capitale situata più a sud di tutta l'America, precisamente a 34°54'21.06\\" di latitudine sud e 56°11'29.04\\" di longitudine ovest. Infatti la vicina capitale argentina, Buenos Aires, sulla sponda opposta del Rio de la Plata, si trova su di un parallelo situato solo 30 km più a nord di quello della capitale uruguaiana. La città si sviluppa tutta sulla sponda destra del fiume Santa Lucia.\\nÈ anche la capitale del dipartimento di Montevideo, ha la più piccola estensione dei diciannove dipartimenti in cui si suddivide primariamente il paese. Considerando la sua area metropolitana, sempre nel 2009, Montevideo raggiungeva 1.973.380 abitanti, corrispondenti al 58,8% del totale nazionale della popolazione.\\nNell'area dell'America Meridionale, la città di Montevideo occupa il primo posto nella classifica delle città con una maggiore qualità della vita. Montevideo è inoltre la sede amministrativa del Mercosur e ha ospitato il primo campionato mondiale di calcio svolto nel 1930."},{"page_url":"https://vi.wikipedia.org/wiki/Ph%C3%A2n_ph%E1%BB%91i_x%C3%A1c_su%E1%BA%A5t","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fc/Gamma_distribution_pdf.png","page_title":"Phân phối xác suất","context_page_description":"Trong toán học và thống kê, một phân phối xác suất hay thường gọi hơn là một hàm phân phối xác suất là quy luật cho biết cách gán mỗi xác suất cho mỗi khoảng giá trị của tập số thực, sao cho các tiên đề xác suất được thỏa mãn. Theo thuật ngữ kỹ thuật, một phân phối xác suất là một độ đo xác suất mà miền xác định là đại số Borel trên tập số thực.\\nMột phân phối xác suất là một trường hợp đặc biệt của một khái niệm tổng quát hơn về độ đo xác suất, đó là một hàm thỏa mãn các tiên đề xác suất của Kolmogorov cho các tập đo được của một không gian đo được."},{"page_url":"https://fr.wikipedia.org/wiki/Pr%C3%A9vention_et_s%C3%A9curit%C3%A9_routi%C3%A8res","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ac/Utrecht-IMG_7242.JPG","page_title":"Prévention et sécurité routières","context_page_description":"La prévention routière, ou sécurité routière, est l'ensemble des mesures mises en place pour empêcher les usagers de la route d'être tués ou gravement blessés dans les accidents de la route, ou en atténuer les conséquences. Les usagers de la route sont les piétons, les cyclistes, les automobilistes et leurs passagers, les chauffeurs de poids-lourd, et les passagers des transports publics routiers, etc. Il s'agit d'un enjeux sociétal majeur.\\nD'après un rapport de synthèse de l'OCDE daté de 2008 : « La stratégie fondamentale de l'approche pour un système sûr est de garantir, en cas d’accident, que les énergies d'impact resteront au-dessous du seuil susceptible d'occasionner la mort ou une blessure grave. Ce seuil varie selon le scénario de l'accident, en fonction du niveau de protection offert aux usagers impliqués. Ainsi, les chances de survie d'un piéton non protégé, heurté par un véhicule, diminue rapidement à des vitesses d'impact supérieures à 30 km/h. Dans le cas d'un occupant d'un véhicule à moteur, correctement attaché, la vitesse d'impact critique est de 50 km/h et de 70 km/h ».\\nLa prévention routière est un domaine étudié depuis plus de 75 ans."},{"page_url":"https://en.wikipedia.org/wiki/West_Lancashire_Light_Railway","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/Montalban_WLLR_19.05.12R_edited-2.jpg","page_title":"West Lancashire Light Railway","context_page_description":"The West Lancashire Light Railway is a 2 ft narrow gauge railway that operates at Hesketh Bank, situated between Preston and Southport in North West England. The distance between the stations on the railway is 430 yards, though track extends eastwards beyond Delph station on ledge above the old clay pit which is too narrow to contain a run round loop. An extension of up to 435 metres, running along the north bank of the fishing lake has been proposed. The railway has eight steam locomotives, four of which are in operating condition; one is currently being restored and another is on static display. There are also two electric locomotives and many IC locomotives."},{"page_url":"https://lb.wikipedia.org/wiki/Jos%C3%A9_Ensch","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/37/Jos%C3%A9-Ensch-w.jpg","page_title":"José Ensch","context_page_description":"D'José Ensch, gebuer de 27. Oktober 1942 zu Lëtzebuerg-Hollerech, gestuerwen de 4. Februar 2008 zu Lëtzebuerg, war eng lëtzebuergesch Dichterin.\\nNo der Première, déi si 1961 am Lycée de jeunes filles de Luxembourg gemaach hat, huet si Däitsch, Franséisch a Latäin op den Universitéite vu Bonn, Nanzeg a Paräis studéiert.\\nSi war Sproocheprofessesch am Lycée de jeunes filles de Luxembourg, wou si Franséisch enséignéiert huet.\\nD'José Ensch war Member vum Lëtzebuerger Schrëftstellerverband, vun der Sektioun Arts et lettres vum Institut grand-ducal an zanter 2000 vun der Sektioun Luxembourg, enger Extensioun vun der Université libre de Bruxelles.\\nD'José Ensch war Vizepresidentin vun den Amis de la maison de Victor Hugo zu Veianen."},{"page_url":"https://zh.wikipedia.org/wiki/%E4%B8%AD%E8%8F%AF%E6%B0%91%E5%9C%8B%E5%85%AC%E5%85%B1%E5%9C%96%E6%9B%B8%E9%A4%A8%E7%B3%BB%E7%B5%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4c/Taipei_Main_Public_Library_2019-04-25_%282%29.jpg","page_title":"中華民國公共圖書館系統","context_page_description":"中華民國的公共圖書館劃分為4個層級，分別是國立、直轄市立、縣立、鄉立。國家圖書館則因任務特殊，非名列公共圖書館。\\n國立公共圖書館有國立公共資訊圖書館、國立臺灣圖書館等2間，為教育部所屬；直轄市立公共圖書館有6間，其中除高雄市立圖書館為獨立的行政法人營運外，餘皆由各直轄市文化局或教育局管轄；縣級圖書館有16間，由縣政府文化處或教育處管理；鄉立圖書館339所、分館115所。全國公立公共圖書館總共562間。2006年館藏總數2771萬冊，其中包括：圖書2645萬冊、期刊4.7萬種、報紙4,352種、非書資料96.7萬件、電子資源2.6萬種、其他21.7萬種，圖書館工作人員總數為1萬餘人。"},{"page_url":"https://mk.wikipedia.org/wiki/%D0%97%D0%B0%D1%98%D0%B4%D0%B8%D1%81%D0%BE%D0%BD%D1%86%D0%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/84/Sun_at_Observatory_Kokino%2C_Republic_of_Macedonia.jpg","page_title":"Зајдисонце","context_page_description":"Зајдисонце, залез или заод – заоѓање на Сонцето зад хоризонтот заради Земјината ротација. Гледано од Екваторот, при рамнодневица Сонцето зајдува точно на запад и во пролет и во есен. Гледано од средни географски ширини, локалното летно Сонце зајдува на северозапад во Северната Полутопка, но на југозапад во Јужната Полутопка.\\nВремето на зајдисонце е дефинирано во астрономијата како момент кога горниот крај на Сонцето исчезнува под хоризонтот. Во близина на хоризонтот, рефлексијата на атмосферата предизвикува зраците од сончевата светлина зраци да бидат искривени до тој степен што геометриски сончевиот диск е веќе околу еден дијаметар под хоризонтот кога се забележува зајдисонце.\\nЗајдисонцето се разликува од самракот, кој е поделен во три етапи, првиот се нарекува граѓански самрак, започнува откако Сонцето ќе исчезне под хоризонтот и продолжува додека не се спушти до 6 степени под хоризонтот; втората фаза е наутички самрак, помеѓу 6 и 12 степени под хоризонтот, а третиот е астрономски самрак, кој е период кога Сонцето е помеѓу 12 и 18 степени под хоризонтот. \\"Примрак\\" е на самиот крај на астрономскиот самрак, и е најтемниот момент на самракот пред ноќта."},{"page_url":"https://cs.wikipedia.org/wiki/Paskov","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/00/Paskov_vlajka.jpg","page_title":"Paskov","context_page_description":"Město Paskov se nachází v okrese Frýdek-Místek v Moravskoslezském kraji. Žije zde přibližně 3 900 obyvatel. Téměř celé katastrální území Paskova se rozkládá na Moravě, ale malé okrajové části území Paskova zasahují do Slezska."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%AC%D9%88%D8%B1%D8%AC_%D8%AF%D8%A7%D8%B1%D9%88%D9%8A%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ab/George_Darwin_SI.jpg","page_title":"جورج داروين","context_page_description":"السير جورج هوارد داروين ‏ هو عالم فلك ورياضياتي إنجليزي."},{"page_url":"https://sk.wikipedia.org/wiki/Clermont-le-Fort","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/Map_commune_FR_insee_code_31148.png","page_title":"Clermont-le-Fort","context_page_description":"Clermont-le-Fort je francúzska obec, ktorá sa nachádza v departemente Haute-Garonne, v regióne Midi-Pyrénées."},{"page_url":"https://simple.wikipedia.org/wiki/Salto_Grande","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1b/Bandeira_Salto_Grande.jpg","page_title":"Salto Grande","context_page_description":"Salto Grande is a Brazilian city in the state of São Paulo. Its population, in 2014, was 9.190 inhabitants and its area is 211,10 km². Its name means Great Falls in Portuguese."},{"page_url":"https://en.wikipedia.org/wiki/Divisiones_Regionales_de_F%C3%BAtbol_in_Balearic_Islands","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/10/Location_map_Ibiza.png","page_title":"Divisiones Regionales de Fútbol in Balearic Islands","context_page_description":"The Divisiones Regionales de Fútbol in the Balearic Islands, are organized by Balearic Football Federation:\\nPrimera Regional Preferente de Mallorca\\nRegional Preferente de Menorca\\nRegional de Ibiza y Formentera\\nPrimera Regional de las Islas Baleares\\nSegunda Regional de las Islas Baleares\\nTercera Regional de las Islas Baleares"},{"page_url":"https://fy.wikipedia.org/wiki/Greidwrotm%C3%BBs","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/28/Microtus_pennsylvanicus_range_map.png","page_title":"Greidwrotmûs","context_page_description":"De greidwrotmûs of gerslânwrotmûs is in sûchdier út it skift fan 'e kjifdieren, de famylje fan 'e wrotmûseftigen, it skaai fan 'e fjildmûzen en it ûnderskaai fan 'e Amerikaanske gerslânwrotmûzen. Dizze soarte komt foar yn it grutste part fan Noard-Amearika. Yn dat wrâlddiel hat de greidwrotmûs de grutste fersprieding fan alle soarten wrotmûzen."},{"page_url":"https://en.wikipedia.org/wiki/Grade_I_and_II*_listed_buildings_in_the_London_Borough_of_Havering","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ed/Hare_Hall%2C_Upper_Brentwood_Road_-_geograph.org.uk_-_1517442.jpg","page_title":"Grade I and II* listed buildings in the London Borough of Havering","context_page_description":"There are over 9,000 Grade I listed buildings and 20,000 Grade II* listed buildings in England. This page is a list of these buildings in the London Borough of Havering."},{"page_url":"https://de.wikipedia.org/wiki/%C3%96BB_4023/4024/4124","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bd/4124_013_Cityjet_Goe.jpg","page_title":"ÖBB 4023/4024/4124","context_page_description":"Die Reihen 4023, 4024 und 4124 der österreichischen Bundesbahnen sind elektrische TALENT-Triebwagen, die zwischen 2004 und 2008 vom Hersteller Bombardier Transportation ausgeliefert wurden."},{"page_url":"https://pl.wikipedia.org/wiki/Arcybiskup_Joaqu%C3%ADn_Company","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/70/Joaquin_Company_%28busto%29_por_Goya.jpg","page_title":"Arcybiskup Joaquín Company","context_page_description":"Arcybiskup Joaquín Company – obraz olejny hiszpańskiego malarza Francisca Goi. Portret przedstawiający arcybiskupa Joaquína Company’ego jest eksponowany w diecezjalnym Alma Mater Museum w Saragossie."},{"page_url":"https://fr.wikipedia.org/wiki/Tour_romane_de_Puissalicon","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/06/Ancienne_%C3%A9glise_de_Puissalicon_-_Tour_romane_-_13.JPG","page_title":"Tour romane de Puissalicon","context_page_description":"La tour romane de Puissalicon est un clocher de style roman lombard situé près de Puissalicon dans le département français de l'Hérault en région Occitanie."},{"page_url":"https://da.wikipedia.org/wiki/Guln%C3%A6bbet_toko","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/28/Tockus_flavirostris_-Discovery_Cove_-Orlando-8.jpg","page_title":"Gulnæbbet toko","context_page_description":"Gulnæbbet toko er en næsehornsfugl, der lever i det østlige Afrika."},{"page_url":"https://es.wikipedia.org/wiki/Oenanthe_hispanica","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/50/Black-eared_Wheatear%2C_Punta_del_Sabinar%2C_Spain.jpg","page_title":"Oenanthe hispanica","context_page_description":"La collalba rubia ​​ es una especie de ave paseriforme de la familia Muscicapidae propia de Eurasia y África. Es un pájaro migratorio que cría en el sur de Europa, Oriente Próximo y el noroeste de África, y pasa el invierno en el Sahel.\\nEste pájaro de 13,5 a 15,5 cm de longitud es insectívoro."},{"page_url":"https://it.wikipedia.org/wiki/Rig_e_furrow","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ac/Buchansrigs.jpg","page_title":"Rig e furrow","context_page_description":"Il Rig e furrow era un tipo coltivazione praticato nelle aree dell'altopiano delle Isole Britanniche, differendo leggermente dal più comune ridge e furrow dal quale esso sembra essere stato modellato, attraverso lo scavo per mezzo della vanga o badile piuttosto che dall'aratro.\\nLa tecnica migliorò il drenaggio creando l'innalzamento delle aree di coltivazione e i furrows per portare via l'acqua. Il sistema dei campi a strisce medievali determinò che i rigs fossero lunghi e sottili.\\nIl sistema venne applicato durante i periodi medievali e post-medievali specialmente nella Scozia dove gli esempi di paesaggi corrugati sopravvivono oggi in alcune aree dovuti ai rigs innalzati e ai profondi furrows."},{"page_url":"https://es.wikipedia.org/wiki/Catedral_de_San_Gervasio_y_San_Protasio_(Soissons)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/73/PM_103305_F_Soissons.jpg","page_title":"Catedral de San Gervasio y San Protasio (Soissons)","context_page_description":"La basílica-catedral [de] San Gervasio y San Protasio es una catedral católica francesa de estilo gótico clásico. Fue erigida en basílica menor el 10 de marzo de 1857.​ Se encuentra en la pequeña ciudad de Soissons, en el departamento de Aisne. Soissons era probablemente la capital Noviodunum de los suesiones en tiempos de la Guerra de las Galias de Julio César, y fue luego la primera capital de Francia, capital de los francos de Clodoveo, recordada por el famoso incidente del jarrón de Soissons. En los siglos XII y XIII gozaba de una cierta prosperidad que le permitió abordar la construcción de numerosos edificios góticos, algunos conservados, entre ellos la catedral.\\nLa catedral fue objeto de una clasificación al título de monumento histórico de Francia, ​ parte de la segunda lista de monumentos históricos del país, la lista de monumentos históricos de 1862."},{"page_url":"https://ca.wikipedia.org/wiki/Saint-Claude_(Guadalupe)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3b/Mairie_de_Saint-Claude.JPG","page_title":"Saint-Claude (Guadalupe)","context_page_description":"Saint-Claude és un municipi francès, situat a Guadalupe, una regió i departament d'ultramar de França situat a les Petites Antilles. L'any 2006 tenia 10.502 habitants. Limita al sud amb Gourbeyre i a l'oest amb Baillif i Basse-Terre."},{"page_url":"https://vi.wikipedia.org/wiki/Fischbach,_Steiermark","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/73/Fischbach_in_WZ.png","page_title":"Fischbach, Steiermark","context_page_description":"Fischbach là một đô thị thuộc huyện Weiz thuộc bang Steiermark, nước Áo. Đô thị Fischbach, Steiermark có diện tích 61,65 km², dân số thời điểm cuối năm 2005 là 1651 người. Fischbach nằm ở Fischbacher Alpen cách có cự ly 12 km về phía tây bắc Birkfeld."},{"page_url":"https://sk.wikipedia.org/wiki/Zoznam_kult%C3%BArnych_pamiatok_v_Kremnici","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/80/Kremnica_-_stredovek%C3%BD_most_na_Banskej_ceste.JPG","page_title":"Zoznam kultúrnych pamiatok v Kremnici","context_page_description":"Toto je zoznam kultúrnych pamiatok v meste Kremnica v okrese Žiar nad Hronom.\\nZoznam bol vytvorený na základe zoznamu, ktorý bol zverejnený na webe Pamiatkového úradu Slovenskej republiky.\\nV súčasnosti je na webovej stránke PÚSR dostupné vyhľadávanie podľa jednotlivých obcí."},{"page_url":"https://it.wikipedia.org/wiki/Battaglia_di_Helgoland_(1914)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/df/Sinking_of_Mainz.jpg","page_title":"Battaglia di Helgoland (1914)","context_page_description":"La prima battaglia della baia di Helgoland fu il primo scontro navale della prima guerra mondiale avvenuto il mattino del 28 agosto 1914, quando gli incrociatori britannici della squadra di stanza a Harwich attaccarono i cacciatorpediniere tedeschi che pattugliavano la baia di Helgoland.\\nSei incrociatori tedeschi risposero all'incursione, tuttavia, l'arrivo della 1ª squadra di incrociatori da battaglia, al comando del viceammiraglio David Beatty, rovesciò le sorti dello scontro a favore degli inglesi."},{"page_url":"https://sl.wikipedia.org/wiki/Devetinpetdeset_ikozaedrov","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/61/Sixth_stellation_of_icosahedron_facets.png","page_title":"Devetinpetdeset ikozaedrov","context_page_description":"Devetinpetdeset ikozaedrov je knjiga, ki so je napisali in ilustrirali Coxeter in Du Val, V. T. Flather in Petrie. Oštevilčili so večje število stelacij pravilnih konveksnih ali platonskih ikozaedrov v skladu s pravili, ki jih je postavil Miller.\\nNajprej je bila izdana na Univerzi v Torontu v letu 1938, drugo izdajo je pripravil Springer-Verlag v letu 1982. K. In D. Crennell sta obnovila besedilo in ponovno narisala diagrame za Tarqiunovo tretjo izdajo v letu 1999. Dodala sta še nekaj snovi in fotografij."},{"page_url":"https://ca.wikipedia.org/wiki/Temple_d%27Apol%C2%B7lo_(Pompeia)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/68/Pompei_5058.jpg","page_title":"Temple d'Apol·lo (Pompeia)","context_page_description":"El temple d'Apol·lo és un temple d'època romana, sepultat durant l'erupció del Vesuvi del 79 i redescobert després de les excavacions arqueològiques de l'antiga Pompeia. Era l'edifici religiós més important de la ciutat i un dels més antics, així com el més visitat durant molts anys."},{"page_url":"https://pt.wikipedia.org/wiki/Au_clair_de_la_lune","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/82/Ly_au_clair_de_la_lune_accords_melodie_paroles.png","page_title":"Au clair de la lune","context_page_description":"\\"Au clair de la lune\\" é uma canção tradicional francesa do séc. XVIII. Seu compositor e letrista são desconhecidos. Sua melodia simples é frequentemente ensinada a iniciantes no começo do estudo de um instrumento musical."},{"page_url":"https://la.wikipedia.org/wiki/Reticulum_computatrale","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/49/Fibreoptic.jpg","page_title":"Reticulum computatrale","context_page_description":"Reticulum computatrale sive reticulum datorum est digitale reticulum telecommunicationum, quod sinit ut nodi opes inter se partiant. In reticulis computatralibus, artificia computandi data inter se permutant per coniunctiones inter nodos. Qui nexus datorum constituuntur per rudentes reticulorum sicut fila ferrea vel rudentes opticos, vel media sine filibus ferreis sicut Wi-Fi."},{"page_url":"https://no.wikipedia.org/wiki/Skotsk_terrier","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/ad/ScottishTerrier.jpg","page_title":"Skotsk terrier","context_page_description":"Skotsk terrier er en lavbent terrier med opprinnelse fra Skottland. Skotsk terrier er Skottlands nasjonalrase. Den regnes som en av de eldste høylandsterrierene, som også omfatter west highland white terrier og cairn terrier. Skotsk terrier var opprinnelig en jakt- og brukshund, men regnes i dag kun som å være en familiehund. Rasestandarden ble godkjent av The Kennel Club i 1883 i England. Rasen er beskrevet slik på Norsk terrier klubs hjemmeside:\\nRasens egenskaper:\\nFull av energi. Aktiv, hengiven og lojal. Filosofisk ro, majestetisk holdning og ikke påtrengende. Sta, men lærevillig og med stor tilpassingsevne når den blir rett behandlet. God venn, tur- og lekekamerat. Glad i barn og ideell familiehund. Vennlig og ikke provoserende mot andre hunder, men viker ikke. Stor, sporty og stilfull hund i lite format.\\nLitt historikk om rasen:\\nFra området rundt Aberdeen. Første rasestandard ca. 1880. Første norskeide utstilt i 1904. Opprinnelig farge brindle. Sort er i dag dominerende farge. Opprinnelig brukt til småviltjakt og mot skadedyr. I dag en ren selskapshund. Med årene blitt kortere, tyngre og med betydelig skjegg, benhår og skjørt slik den fremstår i all sin prakt i dag."},{"page_url":"https://en.wikipedia.org/wiki/Main_Street_Historic_District_(Roslyn,_New_York)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fc/Roslyn_clock_tower_jeh.jpg","page_title":"Main Street Historic District (Roslyn, New York)","context_page_description":"The Main Street Historic District is one of two such districts in the village of Roslyn, New York. It is, as its name suggests, located along Main Street between North Hempstead Turnpike and East Broadway, incorporating Tower Street and portions of Glen Avenue and Paper Mill Road.\\nIt is mostly residential, with some commercial development at its northern end. The 50 buildings within it are mostly houses, many built during the 19th century before the Civil War, in the Federal and Greek Revival styles. Main Street has changed very little despite the heavy growth of surrounding areas of Nassau County. The district was created in the early 1970s and added to the National Register of Historic Places in 1974."},{"page_url":"https://en.wikipedia.org/wiki/List_of_works_by_Kahlil_Gibran","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/59/Charlotte_Teller_by_Kahlil_Gibran.jpg","page_title":"List of works by Kahlil Gibran","context_page_description":"This is a list of works by Kahlil Gibran, including writings and the visual arts."},{"page_url":"https://cs.wikipedia.org/wiki/Marietta_Robusti","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/82/Robusti%2C_Marietta_-_Portrait_of_Ottavio_Strada_-_1567-68.jpg","page_title":"Marietta Robusti","context_page_description":"Marietta Robusti, nazývaná též La Tintoretta, byla nejstarší a nejoblíbenější dcerou benátského malíře Jacopa Robisti, zvaného Tintoretto. Byla vzdělána v hudbě a zpěvu, ale především ji otec naučil technice kresby a použití barev, takže se stala malířkou - portrétistkou. Byla tak jednou z nemnoha žen 16. století, které lze s velkou jistotou připsat autorství několika obrazů, jež zdobí současné světové obrazárny."},{"page_url":"https://es.wikipedia.org/wiki/Quitman_(Misisipi)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/50/Clarke_County_Mississippi_Courthouse.jpg","page_title":"Quitman (Misisipi)","context_page_description":"Quitman es una ciudad del Condado de Clarke, Misisipi, Estados Unidos. Según el censo de 2000 tenía una población de 2.463 habitantes y una densidad de población de 183.6 hab/km².​"},{"page_url":"https://fr.wikipedia.org/wiki/Ar%C3%A8nes_du_Pluma%C3%A7on","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/71/Faena_pendant_les_f%C3%AAtes_de_la_Madeleine.jpg","page_title":"Arènes du Plumaçon","context_page_description":"Les arènes du Plumaçon sont des arènes de première catégorie situées à Mont-de-Marsan, chef-lieu du département français des Landes et membre de l'Union des villes taurines françaises. D'une capacité de 7 100 places, elles accueillent chaque année en juillet cinq corridas lors des fêtes de la Madeleine."},{"page_url":"https://en.wikipedia.org/wiki/Virginity","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9e/Chastity_%28a_virgin_and_a_unicorn%29._Oil_painting_by_a_followe_Wellcome_V0017113.jpg","page_title":"Virginity","context_page_description":"Virginity is the state of a person who has never engaged in sexual intercourse. There are cultural and religious traditions that place special value and significance on this state, predominantly towards unmarried females, associated with notions of personal purity, honor and worth.\\nLike chastity, the concept of virginity has traditionally involved sexual abstinence. The concept of virginity usually involves moral or religious issues and can have consequences in terms of social status and in interpersonal relationships. Although virginity has social implications and had significant legal implications in some societies in the past, it has no legal consequences in most societies today.\\nThe term virgin originally only referred to sexually inexperienced women, but has evolved to encompass a range of definitions, as found in traditional, modern and ethical concepts. Heterosexual individuals may or may not consider loss of virginity to occur only through penile-vaginal penetration, while people of other sexual orientations often include oral sex, anal sex or mutual masturbation in their definitions of losing one's virginity."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A6%D0%B5%D1%80%D0%BA%D0%B2%D0%B0_%D1%81%D0%B2%D1%8F%D1%82%D0%BE%D0%B3%D0%BE_%D0%92%D0%B0%D1%80%D1%84%D0%BE%D0%BB%D0%BE%D0%BC%D1%96%D1%8F_(%D0%A1%D0%BE%D0%BB%D1%8C%D1%94%D1%80)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6c/Iglesia_de_San_Bartolom%C3%A9._S%C3%B3ller._Fachada.jpg","page_title":"Церква святого Варфоломія (Сольєр)","context_page_description":"Церква святого Варфоломія або Церква Сант-Бартомеу — римо-католицька парафіяльна церква у м. Сольєр на о. Мальорка в Іспанії. Знаходиться на площі Конституції.\\nЦерква була зведена у 1236 році, однак декілька разів зазнавала перебудов. В даний час основний стиль церкви — бароко, вежа церкви виконана в стилі неоготики. Фасад церкви збудований у 1904 році у стилі каталонського модерну за проектом архітектора Жуана Рубіо, послідовника Антоніо Гауді. Зберігся портик і вікна в романському стилі, а також фортечні стіни XVI століття.\\nБіля церкви розташовується будівля банку Сольєра, також збудована Рубіо."},{"page_url":"https://hy.wikipedia.org/wiki/%D4%B4%D5%A1%D5%BE%D5%AB%D5%A9_%D5%8D%D5%A1%D6%80%D5%A3%D5%BD%D5%B5%D5%A1%D5%B6_(%D6%84%D5%A1%D5%B6%D5%A4%D5%A1%D5%AF%D5%A1%D5%A3%D5%B8%D6%80%D5%AE)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/01/%D5%94%D5%A1%D5%B6%D5%A4%D5%A1%D5%AF%2C_%D5%B0%D5%A5%D5%B2%E2%80%A4_%D4%B4%D5%A1%D5%BE%D5%AB%D5%A9_%D5%8D%D5%A1%D6%80%D5%A3%D5%BD%D5%B5%D5%A1%D5%B6_2.jpg","page_title":"Դավիթ Սարգսյան (քանդակագործ)","context_page_description":"Անվան այլ կիրառումների համար տե՛ս՝ Դավիթ Սարգսյան\\nԴավիթ Ալբերտի Սարգսյան, հայ քանդակագործ։\\nՔանդակագործ Ալբերտ Սարգսյանի որդին է։"},{"page_url":"https://no.wikipedia.org/wiki/Jerome_Thomas","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2d/Jerome_Thomas.jpg","page_title":"Jerome Thomas","context_page_description":"Jerome William Thomas født 23. mars 1983 i Wembley) er en engelsk fotballspiller som for øyeblikket er kontraktløs. Thomas har tidligere spilt for blant andre Arsenal FC, Queens Park Rangers FC, Charlton Athletic FC, Portsmouth FC, West Bromwich Albion FC og Crystal Palace FC.\\nThomas ble frigitt av Crystal Palace sommeren 2015 sammen med Lewis Price, Owen Garvan, Peter Ramage og Stephen Dobbie."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9A%D1%83%D1%8D%D0%BD%D0%BA%D0%B0-%D0%B4%D0%B5-%D0%9A%D0%B0%D0%BC%D0%BF%D0%BE%D1%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/13/Fundaci%C3%B3n_Joaqu%C3%ADn_D%C3%ADaz_-_Plaza_-_Cuenca_de_Campos_%28Valladolid%29.jpg","page_title":"Куэнка-де-Кампос","context_page_description":"Куэнка-де-Кампос — город и муниципалитет в Испании, входит в провинцию Вальядолид в составе автономного сообщества Кастилия и Леон. Занимает площадь 47,93 км². Население — 254 человека. Расстояние до административного центра провинции — 64 км."},{"page_url":"https://ceb.wikipedia.org/wiki/Isla_San_Marcos","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3c/Iles_de_Basse-Californie_Nord.jpg","page_title":"Isla San Marcos","context_page_description":"Pulo ang Isla San Marcos sa Mehiko. Nahimutang ni sa estado sa Estado de Baja California Sur, sa kasadpang bahin sa nasod, 1,600 km sa amihanan-kasadpan sa Mexico City ang ulohan sa nasod. Naglangkob kin og 28.7 ka kilometro kwadrado.\\nAng yuta sa Isla San Marcos kay medyo bungtoron. Ang labing taas nga punto sa pulo mao ang 255 metros ibabaw sa dagat nga lebel. Naglukop ni og 9.1 km gikan sa amihanan ngadto sa habagatan ug 6.3 km gikan sa sidlakan ngadto sa kasadpan.\\nSa mosunod nga mga natural nga mga bahin makita sa Isla San Marcos:\\nMga suba:\\nEl Burro\\nLa Teneria\\nTepetates\\nMga bungtod:\\nCerro El Yeso\\nCerro Las Chivas\\nCerro Manganesio\\nCerro Punta Arena\\nCerro Teneria\\nCerro Tijera\\nCerro Tinajas\\nMga lawis:\\nPunta Bufechero\\nPunta Islote\\nPunta Piedra Blanca\\nMga walog:\\nCañada Gachupin\\nCañada Las Chivas\\nCañada Tinajas\\nKabukiran:\\nCerro Chabela\\nAng klima uga. Ang kasarangang giiniton 25 °C. Ang kinainitan nga bulan Septiyembre, sa 31 °C, ug ang kinabugnawan Enero, sa 18 °C. Ang kasarangang pag-ulan 233 milimetro matag tuig. Ang kinabasaan nga bulan Agosto, sa 86 milimetro nga ulan, ug ang kinaugahan Mayo, sa 1 milimetro."},{"page_url":"https://en.wikipedia.org/wiki/List_of_football_stadiums_in_Saudi_Arabia","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/66/Prince_Abdullah_bin_Jalawi_Stadium_15_April_2011.JPG","page_title":"List of football stadiums in Saudi Arabia","context_page_description":"This is a list of football stadiums in Saudi Arabia."},{"page_url":"https://nl.wikipedia.org/wiki/Wonderboom","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b9/Ricinus_communis_DSC_0022.JPG","page_title":"Wonderboom","context_page_description":"De wonderboom of wonderolieboom is een snelgroeiende tropische plant, die buiten de tropen kruidachtig is.\\nIn de tropen kan de plant na enkele jaren een hoogte tot 13 meter bereiken en heeft dan een verhoute stengel die op een stam lijkt. De vrucht wordt wonderboon genoemd hoewel de plant niet tot de vlinderbloemenfamilie behoort maar tot de wolfsmelkfamilie. Uit wonderbonen wordt wonderolie geperst. De overblijvende pulp wordt wel als veevoeder gebruikt maar bevat het zeer sterke gif ricine dat eerst door een langdurige hittebehandeling onschadelijk moet worden gemaakt. Uit de overgebleven resten worden ook wel meststoffen gemaakt die in biologische teeltwijzen gebruikt worden.\\nWonderbonen zijn erg giftig. Voor kinderen kan de consumptie van vijf à zes zaden al dodelijk zijn terwijl de dodelijke dosis voor volwassenen 15 à 20 bonen is.\\nDe naam Ricinus is het Latijnse woord voor teek; dit waarschijnlijk omdat de bonen een patroon hebben en aan een kant een bobbeltje vertonen waardoor zij op bepaalde teken lijken. Het is onbekend waarom in de middeleeuwen Ricinus communis de naam christuspalm heeft gekregen."},{"page_url":"https://en.wikipedia.org/wiki/Carlism_in_literature","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e5/Joseph_Conrad%2C_Fotografie_von_George_Charles_Beresford%2C_1904.jpg","page_title":"Carlism in literature","context_page_description":"On March 21, 1890, at a conference dedicated to the siege of Bilbao during the last civil war, Miguel de Unamuno delivered a lecture titled La última guerra carlista como materia poética. It was probably the first ever attempt to examine the Carlist motive in literature, as for the previous 57 years the subject had been increasingly present in poetry, drama and novel. However, it remains paradoxical that when Unamuno was offering his analysis, the period of great Carlist role in letters was just about to begin. It lasted for some quarter of a century, as until the late 1910s Carlism remained a key theme of numerous monumental works of Spanish literature. Afterwards it lost its appeal as a literary motive, still later reduced to instrumental role during Francoism. Today it enjoys some popularity, though no longer as catalyst of paramount cultural or political discourse; its role is mostly to provide exotic, historical, romantic and sometimes mysterious setting."},{"page_url":"https://ru.wikipedia.org/wiki/315-%D1%8F_%D1%81%D1%82%D1%80%D0%B5%D0%BB%D0%BA%D0%BE%D0%B2%D0%B0%D1%8F_%D0%B4%D0%B8%D0%B2%D0%B8%D0%B7%D0%B8%D1%8F","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/12/%D0%92%D0%B5%D1%87%D0%BD%D1%8B%D0%B9_%D0%BE%D0%B3%D0%BE%D0%BD%D1%8C_%D0%A1%D0%B0%D0%BF%D1%83%D0%BD-%D0%B3%D0%BE%D1%80%D0%B0.jpg","page_title":"315-я стрелковая дивизия","context_page_description":"315-я стрелковая Мелитопольская Краснознамённая дивизия — воинское соединение РККА, принимавшее участие в Великой Отечественной войне.\\nУсловное наименование — войсковая часть полевая почта № 41678.\\nСокращённое наименование — 315 сд."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%91%D0%B5%D1%80%D0%BD%D0%B0%D0%B4%D0%B5%D1%82%D1%81","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b1/Ecole_de_Bernadets.jpg","page_title":"Бернадетс","context_page_description":"Бернаде́тс — коммуна во Франции, находится в регионе Аквитания. Департамент — Атлантические Пиренеи. Входит в состав кантона Пе-де-Морлаас и дю Монтанерес. Округ коммуны — По.\\nКод INSEE коммуны — 64114."},{"page_url":"https://fr.wikipedia.org/wiki/Festival_international_du_film_de_Karlovy_Vary","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/36/Sharon_Stone_KV.jpg","page_title":"Festival international du film de Karlovy Vary","context_page_description":"Le festival international du film de Karlovy Vary ou festival international du film de Carlsbad est un festival de cinéma tchèque créé en 1946 et qui se déroule chaque année à Karlovy Vary."},{"page_url":"https://en.wikipedia.org/wiki/Lake_Shore,_Utah","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/80/Utah_County_Utah_incorporated_and_unincorporated_areas_Lake_Shore_highlighted.svg","page_title":"Lake Shore, Utah","context_page_description":"Lake Shore is a census-designated place in Utah County, Utah, United States. It is part of the Provo–Orem Metropolitan Statistical Area. The population was 817 at the 2010 census."},{"page_url":"https://et.wikipedia.org/wiki/Ihaste_sild","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/83/Kraana_ja_sillasambad_Ihaste_silla_ehitusel_Tartu_Idaringteel%2C_28._mai_2013.JPG","page_title":"Ihaste sild","context_page_description":"Ihaste sild on raudbetoonsild Tartu linna kagupiiril. See viib üle Emajõe, ühendades Ihaste ja Ropka tööstusrajooni. Sild on üks osa Tartu Idaringteest, mille valmimistähtaeg oli 2015. aasta aprill, kuid sild avati liikluseks ennetähtaegselt 2. veebruaril 2015.\\n2014. aasta algul korraldasid Tartu linnavolikogu ja Tartu Postimees sillale nimekonkursi. Algselt pakkus linna geodeesiateenistus silla nimeks Ringtee sild, kuid konkursi järel otsustas linn eelistada nime Ihaste sild. Ihaste nime toetas 83 konkursil osalejast 32.\\nSilla kogupikkus on 400 meetrit, millest Emajõe kohale jääb 90-meetrise avaga lõik. Ülejäänud sillaosa rajati kahele poole jõge Ropka-Ihaste luha kohale. Emajõe kohal on silla kogulaius 15,5 meetrit. Sillal on 1+1 sõidurajaga sõidutee, sellest ühel pool nelja meetri laiune kergliiklustee. Ihaste sillale paigaldati 1,4 m kõrgused läbipaistvast materjalist müratõkked, kahe keskmise samba juurde ehitati vaateplatvormid. Silla ehitas Eesti ettevõte K-Most.\\nEmajõe keskmise veetaseme juures saavad silla alt läbi sõita kuni 10,5 meetri kõrgused laevad.\\nRahvahääletusel valiti Ihaste sild Tartu aasta teoks 2015."},{"page_url":"https://tr.wikipedia.org/wiki/Ak_da%C4%9F_ke%C3%A7isi","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b5/Mountain_Goat_USFWS.jpg","page_title":"Ak dağ keçisi","context_page_description":"Ak dağ keçisi ya da Kayalık Dağlar keçisi veya Kayalık Dağlar dağ keçisi, boynuzlugiller familyasından Kuzey Amerika'da, özellikle de Kayalık Dağlarda yaşayan, bembeyaz memeli hayvan türü. Yırtıcıların erişemediği yüksek rakımlı kayalıklar üzerinde rahatça hareket edebilen toynak yapısı vardır. Cinsinin yaşayan tek türüdür ve Capra cinsinden dağ keçileri ile karıştırmamak gerekir."},{"page_url":"https://pt.wikipedia.org/wiki/Villa_Villoresi","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3f/Villa_villoresi_di_sesto%2C_affreschi_di_Bartolomeo_Pinelli_01.JPG","page_title":"Villa Villoresi","context_page_description":"A Villa Villoresi, antiga Villa Prato Della Tosa, é um palácio italiano que se encontra na localidade de Colonnata, no nº2 da Via Ciampi, comuna de Sesto Fiorentino, Província de Florença."},{"page_url":"https://it.wikipedia.org/wiki/Scaphopoda","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5a/Entalis_laevis_01.JPG","page_title":"Scaphopoda","context_page_description":"Gli Scafopodi sono una piccola classe di molluschi marini affini ai Gasteropodi."},{"page_url":"https://nds.wikipedia.org/wiki/Swartsuur","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7c/Schwarzsauer-3.jpg","page_title":"Swartsuur","context_page_description":"Swartsuur is en tyypsch Eten ut Noorddüütschland. Vör allen is dor Blood in.\\nBi’t Slachten warrt dat, wat an Fleesch nableven is, in Soltwater kaakt. Denn kummt dor dat Blood to, wat se bi’t Slachten opfungen hebbt. Dat Blood warrt fast un ganz swart. Dorto kaamt denn Eddig, dat dat Ganze suur warrt, un so Saken as Lorbeer, Peperköörn, Nelkenköpp, Zippeln, en beten Sucker un Wuddeln.\\nDat Swartsuur warrt denn inmaakt oder kummt so op’n Disch. To dat Swartsuur kaamt Kartuffeln oder Klüten mit op’n Disch.\\nSwartsuur hebbt se fröher överall in Noorddüütschland maakt, wenn se en Swien slacht hebbt. In Oostfreesland un in’n Oosten, in Pommern un Preußen, hebbt se dat ok vun Aanten un Göös maakt. Dat Blood un wat an Fleeschresten nableven is, dat weer to schaad to’n Wegdoon. Dat weer dorvun denn ok en Eten för de eenfachen Lüüd. Hüüt warrt dat nich mehr faken eten."},{"page_url":"https://en.wikipedia.org/wiki/List_of_badges_of_the_South_African_Army","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cb/SANDF_Rank_Insignia_Brigadier_General_embossed_badge.png","page_title":"List of badges of the South African Army","context_page_description":"The South African National Defence Force, like most around the world, has various insignia. The army badges authorised for wear are listed here. If members from other arms of service qualify for these badges, they are also permitted to wear them, The criteria are, in most cases, current but there is some historical information included."},{"page_url":"https://es.wikipedia.org/wiki/Rotores_de_Portugal","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/04/Rotores_de_Portugal-AirExpo2009.JPG","page_title":"Rotores de Portugal","context_page_description":"Los Rotores de Portugal son el grupo de helicópteros de vuelo acrobático de la Fuerza Aérea Portuguesa creado en abril de 1976 y que se encuentra integrado en el Escuadrón 552, ​ con sede en la Base Aérea de Beja.\\nOperan en sus exhibiciones aéreas tres helicópteros Aérospatiale Alouette III de fabricación francesa, ​ aunque en los próximos años la Fuerza Aérea Portuguesa los renovará por AgustaWestland AW109 o Eurocopter EC 120 Colibri, y todavía no se sabe si este cambio también se realizará en los Rotores de Portugal, o supondrá su desaparición.​"},{"page_url":"https://de.wikipedia.org/wiki/Audi_Avus_quattro","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2c/Audi_Avus_at_Audi_Forum_Beijing.JPG","page_title":"Audi Avus quattro","context_page_description":"Der Audi Avus quattro ist eine Designstudie des Automobilherstellers Audi. Das Fahrzeug wurde 1991 auf der Tokyo Motor Show vorgestellt. Die Karosserieform mit einem NACA-Lufteinlass im Dach wurde von dem US-Amerikaner J Mays entworfen, nach anderer Quelle beim Advanced Design Studio in München unter der Leitung von Martin Smith."},{"page_url":"https://lt.wikipedia.org/wiki/Daniel_Gibson","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/Daniel_Gibson_2.jpg","page_title":"Daniel Gibson","context_page_description":"Daniel Gibson – JAV krepšininkas, Klyvlendo „Cavaliers“ komandos įžaidėjas."},{"page_url":"https://et.wikipedia.org/wiki/Salm-Salm","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/00/Salm-map.png","page_title":"Salm-Salm","context_page_description":"Salm-Salmi vürstkond oli Saksa-Rooma riigi osariik. See paiknes tänapäeva Prantsuse Bas-Rhini ja Vosges'i departemangud ning oli üks paljudest Salmi jaotustest."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%8A%D0%B8%D1%82%D1%80%D0%B0%D0%BD%D1%81%D0%BA%D0%B0_%D0%A1%D1%82%D1%80%D0%B5%D0%B4%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ed/Nitrianska_Streda1.JPG","page_title":"Њитранска Стреда","context_page_description":"Њитранска Стреда насељено је мјесто са административним статусом сеоске општине у округу Топољчани, у Њитранском крају, Словачка Република."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%9A%D0%B8%D0%BD%D0%B5%D1%81%D0%BA%D0%BE_%D0%B8%D0%B7%D1%80%D0%B0%D0%B6%D0%B0%D0%B2%D0%B0%D1%9A%D0%B5_%D0%B1%D1%80%D0%BE%D1%98%D0%B5%D0%B2%D0%B0_%D0%BF%D0%BE%D0%BA%D1%80%D0%B5%D1%82%D0%B8%D0%BC%D0%B0_%D1%80%D1%83%D0%BA%D0%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/72/Chinesische.Zahl.Neun.jpg","page_title":"Кинеско изражавање бројева покретима руке","context_page_description":"Кинеско изражавање бројева покретима руке је назив за скуп гестова, који се изводе једном шаком, како би се приказали природни бројеви од један до десет, а општеприсутни су на кинеском културном простору. Ова метода је вјероватно развијена како би био мост многих дијалеката у говорном кинеском - на пример, број 4 и 10 се тешко разликује у неким дијалектима. Такође их користе пословни људи током преговарања, када постоји потреба за више приватности на јавном месту. Приватност се обезбеђује приказивањем геста у рукаву, што ограничава скуп људи, који могу да га виде."},{"page_url":"https://es.wikipedia.org/wiki/Campeonato_Uruguayo_de_Primera_Divisi%C3%B3n_1901","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0e/Deutscher.jpg","page_title":"Campeonato Uruguayo de Primera División 1901","context_page_description":"El Campeonato Uruguayo 1901, constituyó el segundo torneo de primera división del fútbol uruguayo organizado por la AUF.\\nEl torneo consistió en un campeonato a dos ruedas de todos contra todos. En él participaron cinco equipos, al permitir el ingreso del Club Nacional de Football a la competencia. El campeón fue el CURCC por segunda vez consecutiva.\\nEsta vez no se celebró la consecución del campeonato porque los dirigentes del CURCC estaban de luto por la muerte de la Reina Victoria. En esta temporada se dio inicio al gran choque entre el CURCC y Nacional, en los principios del Clásico del fútbol uruguayo. Ambos equipos terminaron en primeras posiciones y pelearon el título hasta la última fecha."},{"page_url":"https://fr.wikipedia.org/wiki/%C3%89glise_Notre-Dame-de-l%27Assomption_de_Puget-Th%C3%A9niers","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/ba/Puget-Th%C3%A9niers_-_Eglise_Notre-Dame-de-l%27Assomption_-_Mobilier_-3.JPG","page_title":"Église Notre-Dame-de-l'Assomption de Puget-Théniers","context_page_description":"L'église Notre-Dame-de-l'Assomption est une église catholique située à Puget-Théniers, en France."},{"page_url":"https://nl.wikipedia.org/wiki/Station_Esbjerg","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/64/Arriva_trein_4212.jpg","page_title":"Station Esbjerg","context_page_description":"Station Esbjerg is een spoorwegstation in het Deense Esbjerg. Het station ligt aan de lijn Esbjerg - Struer en aan de lijn Lunderskov - Esbjerg. Het station is een onderdeel van de boottrein verbinding naar Engeland. Het gebouw uit 1904 werd ontworpen door de architect Heinrich Wenck."},{"page_url":"https://br.wikipedia.org/wiki/Krag-ha%C3%B1v","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d1/Anas_querquedula%2C_Viladecans%2C_Catalunya%2C_Spain_1.jpg","page_title":"Krag-hañv","context_page_description":"Ar c'hrag-hañv a zo ur spesad evned palvezek, Spatula querquedula an anv skiantel anezhañ.\\nAnvet e voe Anas Querquedula da gentañ-penn gant an naturour svedat Carl von Linné."},{"page_url":"https://fr.wikipedia.org/wiki/Pr%C3%A9sident_de_la_R%C3%A9publique_tunisienne","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7f/Nouira_bourguiba_1974.jpg","page_title":"Président de la République tunisienne","context_page_description":"Le président de la République tunisienne est le chef d'État en Tunisie depuis l'instauration de la fonction le 25 juillet 1957. À ce titre, il dirige le pouvoir exécutif avec un gouvernement présidé par le chef du gouvernement. Selon l'article 77 de la Constitution républicaine du 10 février 2014, il assure également le haut commandement des forces armées. Il est élu au suffrage universel direct pour un mandat de cinq ans, renouvelable une seule fois.\\nDepuis le 23 octobre 2019, Kaïs Saïed exerce la présidence."},{"page_url":"https://nl.wikipedia.org/wiki/NGC_1866","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8b/NGC_1866_hst_08151_02_51_R814_G_B555.png","page_title":"NGC 1866","context_page_description":"NGC 1866 is een open sterrenhoop in het sterrenbeeld Goudvis. Het hemelobject werd op 3 augustus 1826 ontdekt door de Schotse astronoom James Dunlop."},{"page_url":"https://ca.wikipedia.org/wiki/Flavona","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/28/Flavon_num.svg","page_title":"Flavona","context_page_description":"Les flavones, són una classe de flavonoides basats en l'estructura del 2-fenilcromé-4-ona com es veu en la imatge.\\nLes flavones naturals inclouen l'Apigenina, la Luteolina i la Tangeritina entre altres. Entre les flavones sintètiques hi ha la Diosmina i el Flavoxat."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D1%82%D0%BE_%D0%B7%D0%BD%D0%B0%D0%BC%D0%B5%D0%BD%D0%B8%D1%82%D1%8B%D1%85_%D0%B2%D0%B8%D0%B4%D0%BE%D0%B2_%D0%AD%D0%B4%D0%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7c/Hiroshige%2C_Table_of_contents.jpg","page_title":"Сто знаменитых видов Эдо","context_page_description":"«Сто знаменитых видов Эдо» — серия гравюр японского художника Хиросигэ, созданная им в период 1856—1858 гг. Состоит из 118 листов плюс 1 титульный."},{"page_url":"https://pt.wikipedia.org/wiki/Pygostylia","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3a/Confuciusornis_sanctus_fossil.jpg","page_title":"Pygostylia","context_page_description":"Pygostylia é um grupo de aves que contém a família Confuciusornithidae e todas as aves mais derivadas. Seu nome provêm da presença do pigóstilo, uma característica compartilhada por todos os seus membros. Chatterjee definiu a Pygostylia como \\"o ancestral comum do Iberomesornis romerali e dos Neornithes\\", sendo assim sinônimo do Ornithothoraces \\"sensu\\" Chiappe. Logo, a definição de Chatterjee foi efetivamente abandonada. Chiappe definiu a Pygostylia como \\"o ancestral comum da Confuciusornithidae e Neornithes mais todos seus descendentes\\". Esta é uma definição \\"node-based\\"\\nChiappe reuniu os Pygostylia por possuirem quatro sinapomorfias: presença do pigóstilo, ausência do hiposfeno-hipantro; púbis retrovertido e separado do eixo principal do sacro por um ângulo de 45 a 65 graus; e presença de um côndilo bulbar medial no tibiotarso."},{"page_url":"https://es.wikipedia.org/wiki/Visitaci%C3%B3n_(Rogier_van_der_Weyden)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f8/Rogier_van_der_Weyden_-_Annunciation_Triptych_-_WGA25590.jpg","page_title":"Visitación (Rogier van der Weyden)","context_page_description":"La Visitación es una pintura al óleo sobre lienzo del maestro flamenco Rogier van der Weyden realizada en 1445 y que se encuentra expuesta en el Museo de Bellas Artes de Leipzig, aunque pertenece a la Fundación Maximilian Speck von Sternburg.\\nLa obra muestra el episodio bíblico de la visita de María, embarazada de Jesús, a su prima Isabel, que era mucho más mayor y que estaba igualmente cerca de dar a luz a Juan el Bautista."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D0%BE%D0%BA_%D1%84%D1%80%D0%B5%D0%B9%D0%BB%D0%B8%D0%BD_%D1%80%D0%BE%D1%81%D1%81%D0%B8%D0%B9%D1%81%D0%BA%D0%BE%D0%B3%D0%BE_%D0%B8%D0%BC%D0%BF%D0%B5%D1%80%D0%B0%D1%82%D0%BE%D1%80%D1%81%D0%BA%D0%BE%D0%B3%D0%BE_%D0%B4%D0%B2%D0%BE%D1%80%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/78/Olga_Pavl._Stakhovich_by_I._Makarov_%281860s%2C_Orlovskiy_museum%29.jpg","page_title":"Список фрейлин российского императорского двора","context_page_description":"Список фрейлин российского императорского двора ежегодно публиковался в адрес-календаре Российской империи. Список строился по старшинству пребывания во фрейлинском звании.\\nВ 1870 и 1871 годах журнал «Русская старина» опубликовал наиболее известный, но изобилующий погрешностями список фрейлин XVIII века, составленный П. Ф. Карабановым.\\nНесмотря на то, что замужество автоматически вело к потере должности фрейлины, многие из них более известны под фамилией мужа. В списке приведены оба варианта — сначала девичья фамилия, фигурировавшая во фрейлинских списках, в скобках — фамилия в браке."},{"page_url":"https://nl.wikipedia.org/wiki/Kat_Hoog_Frankrijk","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/19/Sloop_walmuur_Maastricht_bij_Kat_Hoog_Frankrijk_%28J_Brabant%2C_ca_1870%29.jpg","page_title":"Kat Hoog Frankrijk","context_page_description":"De kat Hoog Frankrijk, ook wel kat Oranje genoemd, was een 16e of 17e-eeuwse kat of cavalier in het westelijk deel van de Nederlandse vestingstad Maastricht. Het verdedigingswerk was onderdeel van de tweede middeleeuwse stadsmuur en lag bij de Sint-Joristoren. De walmuur, de torens en de kat zijn kort na 1867 gesloopt. Alleen ondergronds resteren nog enkele overblijfselen."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9A%D1%83%D0%B7%D0%BD%D0%B5%D1%87%D0%BD%D1%8B%D0%B9_%D1%82%D1%83%D0%BF%D0%B8%D0%BA_(%D0%9C%D0%BE%D1%81%D0%BA%D0%B2%D0%B0)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/37/%D0%9A%D1%83%D0%B7%D0%BD%D0%B5%D1%87%D0%BD%D1%8B%D0%B9_%D1%82%D1%83%D0%BF%D0%B8%D0%BA_%28%D0%9C%D0%BE%D1%81%D0%BA%D0%B2%D0%B0%29.jpg","page_title":"Кузнечный тупик (Москва)","context_page_description":"Кузне́чный тупи́к — тупик, расположенный в Юго-Восточном административном округе города Москвы на территории района Люблино."},{"page_url":"https://en.wikipedia.org/wiki/Transputer","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4a/KL_inmos_IMST212_ES.jpg","page_title":"Transputer","context_page_description":"The transputer is a series of pioneering microprocessors from the 1980s, featuring integrated memory and serial communication links, intended for parallel computing. They were designed and produced by Inmos, a semiconductor company based in Bristol, United Kingdom.\\nFor some time in the late 1980s, many considered the transputer to be the next great design for the future of computing. While Inmos and the transputer did not achieve this expectation, the transputer architecture was highly influential in provoking new ideas in computer architecture, several of which have re-emerged in different forms in modern systems."},{"page_url":"https://de.wikipedia.org/wiki/Sri_Lanka","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b6/Topography_Sri_Lanka.jpg","page_title":"Sri Lanka","context_page_description":"Sri Lanka, bis 1972 Ceylon, ist ein Inselstaat im Indischen Ozean, 237 km östlich der Südspitze des Indischen Subkontinents, und zählt 21,7 Millionen Einwohner. Die kürzeste Entfernung zwischen Indien und Sri Lanka beträgt 54,8 km.\\nDurch ihre Lage bildete die Insel von der Antike bis zur Moderne einen strategischen Knotenpunkt für die Seefahrt zwischen Vorder- und Südostasien. Der Süden und die Gebiete um Anuradhapura waren Zentren des antiken Buddhismus, wohingegen im Norden und Osten hinduistische Tempelkomplexe existierten. Heute ist das Land eine multireligiöse und multiethnische Nation, in der neben dem Buddhismus und dem Hinduismus das Christentum und der Islam bedeutende Religionen sind. Die Singhalesen machen den größten Teil der Bevölkerung aus. Die Tamilen stellen die größte Minderheit. Andere ethnische Minderheiten sind die Moors, Malaien, Burgher und die indigene Bevölkerung Sri Lankas, die Veddas.\\nSri Lanka ist bekannt für die Produktion und den Export von Tee, Kaffee, Kautschuk und Kokosnüssen. Die Insel ist aufgrund ihrer landschaftlichen Schönheit und ihres reichen Kulturerbes ein beliebtes Touristenziel."},{"page_url":"https://de.wikipedia.org/wiki/J%C3%BCdische_Gemeinde_Luttange","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a9/Synagogue_Luttange_%283%29.JPG","page_title":"Jüdische Gemeinde Luttange","context_page_description":"Eine Jüdische Gemeinde in Luttange im Département Moselle in der französischen Region Lothringen entstand spätestens im 18. Jahrhundert."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%A4%A7%E8%A7%80%E9%9F%B3%E4%BA%AD%E8%88%88%E6%BF%9F%E5%AE%AE","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a6/%E8%87%BA%E5%8D%97%E8%88%88%E6%BF%9F%E5%AE%AE.JPG","page_title":"大觀音亭興濟宮","context_page_description":"大觀音亭興濟宮是位在臺灣臺南市北區的著名廟宇，於民國七十四年11月27日公告為三級古蹟。該寺廟是由主奉觀音菩薩的「大觀音亭」與主奉保生大帝的「興濟宮」所組成，雖分屬佛教、道教，但自創建以來即兩廟相連，關係密切，同屬一組織管理。現稱「財團法人大觀音亭興濟宮」。"},{"page_url":"https://fi.wikipedia.org/wiki/Minna_Canthin_patsaat_ja_muistomerkit","image_url":"https://upload.wikimedia.org/wikipedia/fi/4/41/Pauli_Koskinen_Nuori_Minna_Canth_1962.jpg","page_title":"Minna Canthin patsaat ja muistomerkit","context_page_description":"Minna Canthin patsaita ja muistomerkkejä on useilla paikkakunnilla. Tampereella vuonna 1844 syntynyt kirjailija Minna Canth opiskeli ja perusti perheen Jyväskylässä ja muutti leskeksi jäätyään Kuopioon, jossa hän kuoli vuonna 1897."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%A1%D0%BB%D0%B0%D1%82%D0%B8%D0%BD%D0%B0_(%D0%A0%D1%83%D0%BC%D1%83%D0%BD%D0%B8%D1%98%D0%B0)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ef/RO_OT_Slatina_center_from_Gradiste_hill_1.jpg","page_title":"Слатина (Румунија)","context_page_description":"Слатина град је у Румунији у средишњем делу земље, у историјској покрајини Влашка. Слатина је управно средиште округа Олт.\\nСлатина према последњем попису из 2002. године има 79.171 становника."},{"page_url":"https://ro.wikipedia.org/wiki/Valentin_Ursache","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/65/Valentin_Ursache_-_US_Oyonnax_vs._Rugby_club_toulonnais%2C_28th_September_2013_%283%29.jpg","page_title":"Valentin Ursache","context_page_description":"Valentin Niculae Ursache este un jucător de rugby în XV profesionist român. Evoluează ca linia a II sau ca aripa de grămadă în linia III-a. Este fratele cel mai mic lui Andrei Ursache, și el un jucător de rugby."},{"page_url":"https://pl.wikipedia.org/wiki/Parti_d%C3%A9vot","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8c/Marie_Leszczy%C5%84ska%2C_reine_de_France%2C_lisant_la_Bible_by_Jean-Marc_Nattier%2C_002.jpg","page_title":"Parti dévot","context_page_description":"Parti des dévots - nazwa ta odnosi się do kilku stronnictw prokościelnych w historii Francji:\\n1. Parti des dévots w XVII wieku - stronnictwo skupione wokół Marii Medycejskiej pomagał jej Gaston Orleański, a skierowane przeciw kardynałowi Richelieu. Z kolejną partią dewotów walczył Ludwik XIV.\\n2. Parti des dévots („partia dewotów') - konserwatywno-chrześcijańska frakcja na dworze francuskim w XVIII wieku, opozycyjna wobec filozofów (les philosophes Parti philosophique - Voltaire, Diderot) i ich protektorki Madame de Pompadour. Walka stronnictw rozpoczęła się po przybyciu na dwór tej ostatniej (1745), a przybrała na sile w latach pięćdziesiątych, gdy powstawała Wielka Encyklopedia Francuska. Szefem parti devot była de facto pobożna królowa Maria Leszczyńska, a należeli do niej m. in. Emmanuel de Vignerot du Plessis i dramaturg Charles Palissot de Montenoy."},{"page_url":"https://es.wikipedia.org/wiki/F%C3%BAtbol_total","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/Bundesarchiv_Bild_183-N0716-0311%2C_Fu%C3%9Fball-WM%2C_BRD_-_Niederlande_2-1.jpg","page_title":"Fútbol total","context_page_description":"El fútbol total es un sistema de juego usado en el fútbol, en el que un jugador que se mueve fuera de su posición es sustituido por un compañero de equipo, lo que permite que el conjunto conserve su estructura táctica.​ En este fluido sistema ningún futbolista tiene un papel asignado, con lo cual, sucesivamente, cualquiera puede ser delantero, centrocampista y defensa.\\nEste estilo de juego fue perfeccionado por Rinus Michels durante su estancia en el Ajax de Ámsterdam, y alcanzó su apogeo definitivo durante la estancia de Johan Cruyff como jugador en el club y en la selección de fútbol de los Países Bajos.​ Se señala que sus orígenes provienen de los fundamentos del inglés Jack Reynolds, ​ quien fuera entrenador del club de principio a mitad de siglo.\\nEs considerado como la evolución y estilo heredero de la selección de fútbol de Hungría de los años 1950 dirigida por Gusztáv Sebes y más conocida como el «equipo de oro».​ Bajo su desarrollo fue campeona olímpica en los Juegos Olímpicos de Helsinki 1952 y subcampeona del mundo en el Mundial de Suiza 1954, periodo en el que contabilizó un récord de treinta partidos imbatida.​"},{"page_url":"https://de.wikipedia.org/wiki/Brienzergrat","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c5/Brienzergrat_mit_Tannhorn.jpg","page_title":"Brienzergrat","context_page_description":"Der steile Brienzergrat ist ein markanter Teil einer Bergkette in den Emmentaler Alpen, der zur Gemeinde Brienz gehört, und welcher – im engeren Sinne – zwischen dem Brienzer Rothorn und der Allgäuwlicka sich insbesondere von der südlichen Seite her prominent präsentiert."},{"page_url":"https://sv.wikipedia.org/wiki/Gomalia","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/18/African_Marbled_Skipper1_%28UP%29.JPG","page_title":"Gomalia","context_page_description":"Gomalia är ett släkte av fjärilar. Gomalia ingår i familjen tjockhuvuden.\\nKladogram enligt Catalogue of Life:"},{"page_url":"https://de.wikipedia.org/wiki/Jim_Ochowicz","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ec/Jim_Ochowicz_TDF_2010.JPG","page_title":"Jim Ochowicz","context_page_description":"James Lionel „Jim“ Ochowicz ist ein ehemaliger US-amerikanischer Radrennfahrer und heutiger Radsportfunktionär.\\n1972 startete Jim Ochowicz bei den Olympischen Spielen in München in der Mannschaftsverfolgung; das US-amerikanische Team belegte in der Besetzung David Chauner, John Vande Velde, David Mulica und Ochowicz Platz 17.\\n1981 gründete Ochowicz das erste UC-amerikanische Profi-Team 7-Eleven. 1985 startete das Team beim Giro d’Italia und 1986 bei der Tour de France und ebnete damit weiteren US-amerikanischen Profi-Radrennfahrern den Weg in Europa. Ochowicz leitete das Team, das später seinen Namen in Motorola änderte, bis zu seiner Auflösung im Jahre 1996.\\nVon 2002 bis 2006 war Jim Ochowicz Präsident des US-amerikanischen Radsportverbandes USA Cycling und betreute das nationale Straßenteam bei drei Olympischen Spielen. Seit 2007 ist er General Manager des BMC Racing Teams.\\n1997 wurde Jim Ochowicz in die United States Bicycling Hall of Fame aufgenommen."},{"page_url":"https://ro.wikipedia.org/wiki/Berka/Werra","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/19/Wappen_Berka-Werra.png","page_title":"Berka/Werra","context_page_description":"Berka/Werra este un oraș din landul Turingia, Germania."},{"page_url":"https://fi.wikipedia.org/wiki/Juha_Numminen","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d4/Juha_Numminen.jpg","page_title":"Juha Numminen","context_page_description":"Juha Erkki Numminen on suomalainen toimittaja ja kirjailija.\\nHelsingissä syntynyt, mutta Raumalla asuva Numminen on työskennellyt toimittajana useiden eri lehtien palveluksessa, kuten Ilta-Sanomissa, Seurassa ja Suomen kuvalehdessä. Kirjallisuuden puolella hän on kirjoittanut etupäässä dekkareita, mutta myös elämäntapakirjoja, ihmissuhdekirjoja ja pakinoita. Eero J. Tikan kanssa hän muodosti 1980-luvun alussa kirjailijanimen Sulevi Manner. Kaksikko julkaisi yhteensä neljä dekkaria. Numminen on toiminut myös toisena käsikirjoittajana Timo Koivusalon elokuvassa Kulkuri ja joutsen sekä ollut mukana Erkko Kivikosken elokuvan Yö meren rannalla käsikirjoittajatiimissä. Hän on osuuskuntamuotoisen kustantamo Crime Timen perustajajäsen.\\nJuha Nummisen isä oli oikeusneuvos Vilho Numminen ja äiti Aino Sofia Turja. Hänen veljensä on kansliapäällikkö ja ministeri Jaakko Numminen."},{"page_url":"https://it.wikipedia.org/wiki/Razza_bovina_Piemontese","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/28/Piemonteser_Bulle.jpg","page_title":"Razza bovina Piemontese","context_page_description":"La Piemontese è una razza bovina autoctona del Piemonte originariamente a triplice attitudine. Viene utilizzata oggi principalmente per la carne, in particolare per la presenza di una ipertrofia muscolare della coscia, e rappresenta tuttora un elemento caratterizzante del territorio piemontese."},{"page_url":"https://nl.wikipedia.org/wiki/Witborststeltral","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/89/Madagaskar-mesites-06.jpg","page_title":"Witborststeltral","context_page_description":"De witborststeltral is een vogel uit de familie steltrallen. De vogel werd in 1838 door de Franse vogelkundige Isidore Geoffroy Saint-Hilaire geldig beschreven. Het is een kwetsbare, endemische vogelsoort in Madagaskar."},{"page_url":"https://en.wikipedia.org/wiki/Paul_Sawyier","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/71/Paul_Sawyier_walking-in-the-rain.jpg","page_title":"Paul Sawyier","context_page_description":"Paul Sawyier, one of Kentucky's most renowned artists, was an American impressionist painter."},{"page_url":"https://ka.wikipedia.org/wiki/%E1%83%A5%E1%83%90%E1%83%9C%E1%83%90%E1%83%A5%E1%83%94%E1%83%A0-%E1%83%96%E1%83%94%E1%83%98%E1%83%97%E1%83%A3%E1%83%9C%E1%83%98%E1%83%A1_%E1%83%A0%E1%83%90%E1%83%98%E1%83%9D%E1%83%9C%E1%83%98","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/41/The_Holy_Mother_of_God_Church%2C_Kanaker%2C_Yerevan1.JPG","page_title":"ქანაქერ-ზეითუნის რაიონი","context_page_description":"კანაკერ-ზეითუნი — სომხეთის დედაქალაქის, ერევნის 12 რაიონიდან ერთ-ერთი. მდებარეობს ქვეყნის ჩრდილოეთ ნაწილში.\\nრაიონს ესაზღვრება ავანის, არაბკირის, კენტრონისა და ნორ-ნორკის რაიონები.\\nკანაკერ-ზეითუნი არაოფიციალურად იყოფა პატარა კვარტლებად. როგორიცაა კანაკერი, ნორ ზეითუნი და მონუმენტი."},{"page_url":"https://is.wikipedia.org/wiki/%C3%9Ambra","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ef/Terra_ombra_naturale.JPG","page_title":"Úmbra","context_page_description":"Úmbra er náttúrulegt leirlitaduft sem inniheldur járn- og manganoxíð. Liturinn verður sterkari þegar hún er hituð og er þá kölluð brennd úmbra. Nafnið er úr latínu, umbra, sem merkir „skuggi“ og er dregið af nafni ítalska héraðsins Úmbríu þar sem litarefnið var fyrst unnið í stórum stíl. Úmbra finnst víða um heim og hefur verið notuð sem litarefni frá því á forsögulegum tíma.\\nÚmbra kemur fyrir í þremur litatónum: hrá úmbra, úmbra og brennd úmbra. Hrá úmbra er óunninn leir eins og hann kemur fyrir í náttúrunni. Úmbra er hreinsað litarefni. Brennd úmbra er hituð úmbra.\\nBrennd úmbra\\nHrá úmbra\\nÚmbra"},{"page_url":"https://en.wikipedia.org/wiki/Alexander_Column_(Rostov-on-Don)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a4/%D0%90%D0%BB%D0%B5%D0%BA%D1%81%D0%B0%D0%BD%D0%B4%D1%80%D0%B8%D0%B9%D1%81%D0%BA%D0%B0%D1%8F_%D0%BA%D0%BE%D0%BB%D0%BE%D0%BD%D0%BD%D0%B0_%28%D0%B2%D0%B8%D0%B4_%D1%81_%D0%B7%D0%B0%D0%BF%D0%B0%D0%B4%D0%B0%29.JPG","page_title":"Alexander Column (Rostov-on-Don)","context_page_description":"The Alexander Column is a monument erected 1894 in Nakhichevan-on-Don in Alexandrovsky park.\\nThe column was inaugurated on 18 September 1894 to celebrate the 25 years reign of emperor Alexander II of Russia. On the occasion the park in which the column stands was also renamed after the sovereign.\\nThe column consists of a granite monolith upon which sits a double-headed eagle perched on a globe. On the pedestal two commemorative plaques read: ″In memory of 25 glorious year of reign of Emperor Alexander II″ and ″the Armenian community of Nakhichevan-on-Don 25·IX·1894″\\nAfter the Russian revolution the column was the only tsarist monument not to be torn down by the new authorities. They only removed the crowning double-headed eagle and the commemorative plaques on the pedestal. In 1994 the column was returned to its original state."},{"page_url":"https://en.wikipedia.org/wiki/Atari_2600_hardware","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/50/Atari-2600-Keyboard-Controller-FL.jpg","page_title":"Atari 2600 hardware","context_page_description":"The Atari 2600 hardware design experienced many makeovers and revisions during its 14-year production history. The system also has many controllers and third-party peripherals."},{"page_url":"https://de.wikipedia.org/wiki/Notre-Dame_de_Bellaigue","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/83/Bellaigue1.JPG","page_title":"Notre-Dame de Bellaigue","context_page_description":"Das Kloster Notre-Dame de Bellaigue ist ein Benediktinerpriorat in Frankreich. Es liegt in der Gemeinde Virlet im Département Puy-de-Dôme, Region Auvergne, 10 Kilometer westlich von Montaigut und 25 Kilometer südlich von Montluçon. Die ehemalige Zisterzienserabtei ist dem Patronat Unserer lieben Frau geweiht."},{"page_url":"https://en.wikipedia.org/wiki/List_of_rectores_magnifici_of_Leiden_University","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d0/TZaayer.jpg","page_title":"List of rectores magnifici of Leiden University","context_page_description":"This is a list of chancellors of Leiden University, as from 1575. Three Nobel laureates are among these chancellors: Hendrik Lorentz, Heike Kamerlingh Onnes and Willem Einthoven."},{"page_url":"https://nl.wikipedia.org/wiki/Knooppunt_Ridderkerk","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e4/Knooppunt_Ridderkerk_kaart.png","page_title":"Knooppunt Ridderkerk","context_page_description":"Het Knooppunt Ridderkerk is een verkeersknooppunt in Ridderkerk en voor een gedeelte in Rotterdam, in de Nederlandse provincie Zuid-Holland. Het ligt aan de zuidoostpunt van de Ring Rotterdam. De A15 voegt zich hier bij de A16, loopt twee kilometer gelijk op, en splitst zich dan weer af. Hierdoor zijn er twee knooppuntconstructies nodig. Deze vormen echter één samengesteld knooppunt. Het verkeer moet vóór het knooppunt kiezen voor snelweg en richting. De officiële naam van het knooppunt is Ridderster."},{"page_url":"https://ko.wikipedia.org/wiki/%EC%A6%89%EC%84%9D%EC%82%AC%EC%A7%84%EA%B8%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/69/Polaroid_SX-70.jpg","page_title":"즉석사진기","context_page_description":"즉석사진기 또는 즉석카메라는 카메라의 한 종류로, 사진을 찍으면 바로 사진이 나오는 카메라를 말한다. 1923년에 발명되었다."},{"page_url":"https://lv.wikipedia.org/wiki/Juris_K%C4%BCavi%C5%86%C5%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d0/Conductor_Juris_K%C4%BCavi%C5%86%C5%A1_2005.jpg","page_title":"Juris Kļaviņš","context_page_description":"Juris Kļaviņš ir latviešu diriģents, pedagogs. 1962. gadā absolvējis Emīla Dārziņa speciālās mūzikas vidusskolas kordiriģentu klasi. Studējis Jāzepa Vītola Latvijas Valsts konservatorijā, kur 1967. gadā Ludmilas Pismennajas vadībā absolvējis Kordiriģēšanas nodaļu.\\nKopš 1971. gada strādā par profesoru Jāzepa Vītola Latvijas Mūzikas akadēmijas kordiriģēšanas nodaļā.\\nNo 1987. gada līdz 1992. gadam strādājis par Valsts Radio un televīzijas Teodora Kalniņa kora māksliniecisko vadītāju un galveno diriģentu.\\nNo 1988. gada līdz 2009. gadam bijis Latvijas Universitātes jauktā kora \\"Juventus\\" mākslinieciskais vadītājs."},{"page_url":"https://en.wikipedia.org/wiki/Roll%C3%A1n","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f4/T%C3%A9rmino_municipal_de_Roll%C3%A1n.svg","page_title":"Rollán","context_page_description":"Rollán is a municipality located in the province of Salamanca, Castile and León, Spain. As of 2016 the municipality has a population of 388 inhabitants."},{"page_url":"https://sh.wikipedia.org/wiki/Kanosh,_Utah","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6b/Kanosh_Utah_town_hall.jpeg","page_title":"Kanosh, Utah","context_page_description":"Kanosh, Utah je grad u američkoj saveznoj državi Juta."},{"page_url":"https://ko.wikipedia.org/wiki/%EC%88%98%EC%9B%90%EC%8B%9C%EC%9D%98_%EB%A7%88%EC%B2%9C%EB%A3%A8_%EB%AA%A9%EB%A1%9D","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1c/Samsung_HQ_in_suwon.jpg","page_title":"수원시의 마천루 목록","context_page_description":"대한민국 경기도 수원시의 마천루 목록이다. 수원시의 마천루가 대부분 광교신도시에 위치하고 있다. 2000년대에 삼성디지털시티가 완공되어 수원 최고층 마천루의 자리를 지키고있다. 2010년대 중반 이후로 광교신도시에 수많은 마천루가 건설되어 광교SK뷰레이크타워 오피스동가 2019년에 완공되어 경기도에서 가장 높은 오피스 빌딩이 되었다.\\n대한민국의 「초고층 및 지하연계 복합건축물 재난관리에 관한 특별법」에 따르면 '초고층 건축물' 이란 층수가 50층 이상 또는 높이가 200m 이상인 건축물을 말한다."},{"page_url":"https://no.wikipedia.org/wiki/Fatehpur_Sikri","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cf/Audienzhalle.jpg","page_title":"Fatehpur Sikri","context_page_description":"Fatehpur Sikri er en by med omkring 30 000 innbyggere i den indiske delstaten Uttar Pradesh. Byen ligger ca. 40 km fra Agra. Den var den politiske hovedstaden i det indiske Mogulriket under Akbar den store fra 1571 til 1585. De historiske bygningene fra den tiden står på UNESCOs liste over verdensarven."},{"page_url":"https://en.wikipedia.org/wiki/District_Court_of_Queensland","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/13/Cairns_Court_House%2C_2015.jpg","page_title":"District Court of Queensland","context_page_description":"The District Court of Queensland is the second tier in the court hierarchy of Queensland, Australia. The Court deals with serious criminal offences such as rape, armed robbery and fraud. Juries are used to decide if defendants are guilty or not guilty.\\nThe original court was established in 1866 to ease the workload of the Supreme Court of Queensland. However, in 1921 the Queensland Parliament decided District Courts were no longer necessary and the courts were abolished. They were re-established by Parliament in 1958, again to relieve the workload in the Supreme Court. The present court is constituted under the District Court of Queensland Act 1967. That Act amalgamated the previous District Court in existence prior to 1967 into the new District Court.\\nThe District Court sits in 32 locations across Queensland. Judges also travel throughout the state to hear matters in regional and remote areas.\\nDecisions made by the District Court may be heard on appeal to the Supreme Court; and the District Court may sit as an appellate court for decisions made in the Magistrates Court of Queensland."},{"page_url":"https://be-tarask.wikipedia.org/wiki/%D0%A1%D1%8C%D0%BF%D1%96%D1%81_%D1%81%D1%83%D0%B4%D0%B7%D1%96%D0%BD%D0%BA%D0%B0%D0%B2%D1%8B%D1%85_%D1%80%D0%B0%D1%81%D1%8C%D0%BB%D1%96%D0%BD_%D0%91%D0%B5%D0%BB%D0%B0%D1%80%D1%83%D1%81%D1%96","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b3/20150510Potentilla_argentea1.jpg","page_title":"Сьпіс судзінкавых расьлін Беларусі","context_page_description":"Сьпіс судзінкавых расьлін Беларусі зьмяшчае пералік з 1358 відаў, зарэгістраваных на тэрыторыі Беларусі. Табліцы не зьмяшчаюць культурныя і выпадковыя іншародныя віды расьлін. Сьпіс налічвае 43 віды судзінкавых споравых, 4 віды голанасенных і 1311 відаў кветкавых расьлін. Від Alisma praecox, адкрыты ў 2013 годзе, можа быць адзіным эндэмікам для Беларусі, аднак неабходны пошук расьліны ў Украіне."},{"page_url":"https://fa.wikipedia.org/wiki/%D9%85%D8%AD%D9%85%D8%AF_%D8%A7%D8%B5%D9%81%D9%87%D8%A7%D9%86%DB%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f0/Dr_Mohammad_Esfahni_%2856%29.jpg","page_title":"محمد اصفهانی","context_page_description":"محمدمهدی واعظی معروف به محمد اصفهانی، پزشک، خواننده و آهنگساز پاپ و سنتی ایرانی است. او از خانواده‌ای اصالتاً اصفهانی در تهران به دنیا آمد. محمد اصفهانی از دانشگاه علوم پزشکی ایران به سال ۱۳۷۶ فارغ‌التحصیل شد. او با بهره‌مندی از مکتب محمدرضا شجریان و علی جهاندار موسیقی ایرانی آموخت. اصفهانی ابتدا با اجرای آثاری روی اشعار شعرای معاصر مانند فریدون مشیری و همچنین اجرای تیتراژ سریال، پا به عرصه خوانندگی گذاشت.\\nاو در سال ۱۳۷۳ به عنوان اولین تجربه کاری خود تیتراژ سریال آوای فاخته با ترانه‌سرایی ساعد باقری و کارگردانی بهمن زرین‌پور را به عنوان اولین تیتراژ اجرا کرد که از شبکه ۱ پخش شد. او تا به امروز بیش از ۱۵ تیتراژ سریال‌های تلویزیونی و فیلم‌های سینمایی را اجرای نموده که از این مجموعه می‌توان به تیتراژ سریال‌های یه تیکه زمین، ارمغان تاریکی، ولایت عشق، زیر هشت، تا ثریا، معصومیت از دست رفته، آخرین دعوت، پهلوانان نمی‌میرند، وفا و فیلم سینمایی بوسیدن روی ماه و اخراجی‌ها اشاره کرد.\\nاصفهانی تا به امروز ۱۴ آلبوم منتشر کرده‌است. او در آلبوم‌های خود با استادان بزرگ موسیقی چون همایون خرم، بابک بیات، فریدون شهبازیان کار کرده‌است."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%A7%D9%84%D8%AC%D9%8A%D8%B4_%D8%A7%D9%84%D8%B3%D9%84%D8%B7%D8%A7%D9%86%D9%8A_%D8%A7%D9%84%D8%B9%D9%85%D8%A7%D9%86%D9%8A","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/Swiss_rapier_missile.jpg","page_title":"الجيش السلطاني العماني","context_page_description":"يعد الجيش السلطاني العُماني قوة حديثة متطورة ومتكاملة البناء والتسليح والتنظيم ويضم في صفوفه أسلحة المشاه والمدرعات والمدفعية ومنظومة الدفاع الجوي والإشارة والأسلحة الإدارية الأخرى، متسلحاً بالقدرة والكفاءة على خوض المعارك بفضل العناية المستمرة بالتدريب والتحديث وتطوير مستوى الأفراد والمعدات، حيث تأسس في عام 1907م ممثلاً في قوة مشاة صغيرة يطلق عليها حامية مسقط آنذاك لم يكن لها مهام أكثر من كونها حامية منطقة مسقط، ثم تطورت وتوسعت وسميت في عام 1921م بمشاة مسقط، ظلت القوة العسكرية الوحيدة في عُمان إلى أن أدت التطورات التي حدثت في أوائل الخمسينات إلى تشكيل بعض الوحدات الأخرى ثم أستمر في التطور تدريجياً من حيث التنظيم والتسليح وفي مطلع عام 1976م أعيد تنظيم القوات المسلحة بصفة عامة فأصبح سلاحاً مستقلاً أطلق عليه قوات سلطان عُمان البرية حتى عام 1990م عندما صدرت الأوامر السامية بتسميته الجيش السلطاني العُماني."},{"page_url":"https://en.wikipedia.org/wiki/North_Sulawesi_babirusa","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/04/Suidae_-_Babyrousa_celebensis_%28North_Sulawesi_babirusa%29.jpg","page_title":"North Sulawesi babirusa","context_page_description":"The North Sulawesi babirusa is a pig-like animal native to Sulawesi and some nearby islands in Indonesia. It has two pairs of large tusks composed of enlarged canine teeth. The upper canines penetrate the top of the snout, curving back toward the forehead. The North Sulawesi babirusa is threatened from hunting and deforestation.\\nThe common and scientific names are various transcriptions of its local name, which literally translated means \\"pig-deer\\" in reference to the huge tusks of the male suggestive of a deer's antlers."},{"page_url":"https://de.wikipedia.org/wiki/NGC_5158","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/46/NGC5158_-_SDSS_DR14.jpg","page_title":"NGC 5158","context_page_description":"NGC 5158 ist eine 12,9 mag helle Balken-Spiralgalaxie mit aktivem Galaxienkern vom Hubble-Typ SBab im Sternbild Haar der Berenike am Nordsternhimmel. Sie ist schätzungsweise 295 Millionen Lichtjahre von der Milchstraße entfernt und hat einen Durchmesser von etwa 110.000 Lichtjahren.\\nIm selben Himmelsareal befinden sich u. a. die Galaxien NGC 5151, NGC 5172, NGC 5190.\\nDas Objekt wurde am 7. Mai 1826 von John Herschel entdeckt."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%B0%8F%E8%B2%BB","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1c/Restaurant_Tipping_Gratuity_World_Map.svg","page_title":"小費","context_page_description":"小费，指给予服务生消费额以外的赏钱，以作表扬个人之用。小费在某些国家被视为陋习或歧视，有的成为一种社交礼仪。但所有国家，小费都不是法定要给，数目也没有明码标定，在不同地区的行业都有各种不成文的规定。在某些国家的历史上，只有上等阶级的人给予下等阶级的人，例如主人、富人给予下人、奴仆、妓女、戏子等。在现代，尤其东亚国家，收小费或许被视为自贬身份，例如韩国服务员不会收日本客人的小费，美国也开始有经营者认为应该以较高薪资取代小费。\\n通常人们准备一些零钱；或超额付款而不取回零钱，零钱便当作小费。\\n在不同地区，要付小费的行业都不同。一般来说，旅游、餐饮、交通、旅馆等的服务生都要给小费，有些地方用洗手间、理发、送报员、洗洁工也应给。\\n有些地方，给某些职员小费是禁忌，甚至在法律上禁止，认为等同贿赂，例如给政府公务人员、医护人员、或采访记者等小费，即使以节日红包为名，也是犯罪的。当临近重要节庆如圣诞节，在德国、美国等西方国家，小费习惯上给得较多。\\n有些国家的服务员所得的小费为其主要收入，例如餐厅酒吧的侍应。但通常亚洲的一些餐厅会把一定比率的“小费”，通常是餐费的10%，直接加入当次消费的总金额，但这种并不是给予个体服务员。"},{"page_url":"https://ca.wikipedia.org/wiki/Margny-l%C3%A8s-Compi%C3%A8gne","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/8c/Mairiemargnylescompiegne.jpg","page_title":"Margny-lès-Compiègne","context_page_description":"Margny-lès-Compiègne és un municipi francès, situat al departament de l'Oise i a la regió dels Alts de França. L'any 2007 tenia 7.736 habitants."},{"page_url":"https://mn.wikipedia.org/wiki/%D0%AF%D0%BF%D0%BE%D0%BD%D1%8B_%D1%85%D0%BE%D1%82%D1%8B%D0%BD_%D0%B6%D0%B0%D0%B3%D1%81%D0%B0%D0%B0%D0%BB%D1%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2c/Kyoto_city1.jpg","page_title":"Японы хотын жагсаалт","context_page_description":null},{"page_url":"https://ar.wikipedia.org/wiki/%D8%B7%D8%A8%D9%82_%D8%A7%D9%84%D9%82%D9%85%D8%B1_%D8%A7%D9%84%D8%B5%D9%86%D8%A7%D8%B9%D9%8A","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f0/Parabolic_antenna_types2.svg","page_title":"طبق القمر الصناعي","context_page_description":"طبق القمر الصناعي، ترجمة حرفية 'Satellite Dish'‏ هو نوع من أطباق الهوائي المكافئ المصمم لاستقبال أو نقل المعلومات عن طريق موجات الراديو من وإلى القمر الصناعي. ولكن المعنى الأكثر شيوعًا للمصطلح يعني طبقًا يستخدمه المستهلكون في منازلهم لتلقي البث التلفزيوني عبر الأقمار الصناعية مباشرة من القمر الصناعي في مدار ثابت بالنسبة للأرض."},{"page_url":"https://en.wikipedia.org/wiki/Noah_Hathaway","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f0/Noah_Hathaway.jpg","page_title":"Noah Hathaway","context_page_description":"Noah Leslie Hathaway is an American actor and a former teen idol. He is best known for his roles as Atreyu in the 1984 film The NeverEnding Story and for portraying Boxey on the original television series Battlestar Galactica. His work in The Neverending Story made him particularly popular as a teenage celebrity in Europe."},{"page_url":"https://hi.wikipedia.org/wiki/%E0%A4%B9%E0%A4%82%E0%A4%97%E0%A4%B2","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/12/Hangal_Tarakeshwara_photo2.jpg","page_title":"हंगल","context_page_description":"हंगल कर्नाटक के हवेरी जिला स्थित एक कस्बा है। यह हुबली-धारवाड़ से ७५ कि.मी दूर धर्मा नदी के तट पर स्थित एक ऐतिहासिक अवशेष वाला स्थल है। यहां अनेक मंदिर हैं। इसे महाभारत काल में विराटनगर कह जाता था।"},{"page_url":"https://zh.wikipedia.org/wiki/%E5%A4%A9%E4%B8%BB%E6%95%99%E5%AE%97%E5%BA%A7%E5%9C%A3%E6%AE%BF%E5%88%97%E8%A1%A8/N-Z","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/94/Lviv-centre_Latin_Cathedral.jpg","page_title":"天主教宗座圣殿列表/N-Z","context_page_description":"天主教宗座圣殿列表\\n天主教宗座圣殿列表/A-E | 天主教宗座圣殿列表/F-M | 天主教宗座圣殿列表/N-Z"},{"page_url":"https://en.wikipedia.org/wiki/Culture_of_the_United_Kingdom","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/50/Bodiam-castle-10My8-1197.jpg","page_title":"Culture of the United Kingdom","context_page_description":"British culture is influenced by the combined nations' history; its historically Christian religious life, its interaction with the cultures of Europe, the traditions of England, Wales and Scotland, and the impact of the British Empire. Although British culture is a distinct entity, the individual cultures of England, Scotland, Wales and Northern Ireland are diverse and have varying degrees of overlap and distinctiveness.\\nBritish literature is particularly esteemed. The novel was invented in Britain, and playwrights, poets, and authors are among its most prominent cultural figures. Britain has also made notable contributions to music, cinema, art, architecture and television. The UK is also the home of the Church of England, the state church and mother church of the Anglican Communion, the third-largest Christian denomination. Britain contains some of the world's oldest universities, has made many contributions to philosophy, science and technology, and is the birthplace of many prominent scientists and inventions. The Industrial Revolution began in the UK and had a profound effect on the family socio-economic and cultural conditions of the world."},{"page_url":"https://hu.wikipedia.org/wiki/Lipsheim","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/69/Lipsheim_028.JPG","page_title":"Lipsheim","context_page_description":"Lipsheim település Franciaországban, Bas-Rhin megyében. Lakosainak száma 2493 fő. Lipsheim Fegersheim, Geispolsheim, Hindisheim és Ichtratzheim községekkel határos."},{"page_url":"https://gl.wikipedia.org/wiki/Galadriel","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/2b/Lindon.jpg","page_title":"Galadriel","context_page_description":"Galadriel é un personaxe ficticio creado por J. R. R. Tolkien e que figura no seu legendarium. Aparece n'O Señor dos Aneis, O Silmarillion e mais en Unfinished Tales of Númenor and Middle-earth.\\nEra unha elfa da realeza de tanto os Noldor como os Teleri, ao ser neta dos reis Finwë e Olwë, e mantiña tamén un estreito parentesco co rei Ingwë dos Vanyar por medio da súa avoa Indis. Cara á fin da súa estadía na Terra Media foi a co-gobernante de Lothlórien xunto co seu esposo, o Señor Celeborn, e era coñecida polos diversos nomes de A Dama de Lórien, A Dama dos Galadhrim, Dama da Luz e A Dama do Bosque."},{"page_url":"https://id.wikipedia.org/wiki/Gertrude_Atherton","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/24/Gertrude_Atherton_-_Project_Gutenberg_eText_14256.jpg","page_title":"Gertrude Atherton","context_page_description":"Gertrude Franklin Horn Atherton adalah seorang penulis asal Amerika Serikat. Banyak novelnya berlatar daerah asalnya California. Novel bestsellernya Black Oxen telah diadaptasi kedalam film bisu berjudul sama. Selain novel, ia menulis cerita pendek, esai, dan artikel untuk majalah dan surat kabar tentang isu-isu seperti feminisme, politik, dan perang. Dia berkemauan keras, mandiri, dan terkadang kontroversial, terutama untuknya antikomunisme dan pandangan supremasi kulit putihnya."},{"page_url":"https://no.wikipedia.org/wiki/Stavangers_historie","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7b/Stavanger_kart_1889.jpg","page_title":"Stavangers historie","context_page_description":"Stavangers historie går så langt tilbake som de første bosetningene av mennesker i Norge, mens den nyere historien går fra tusentallet da grunnlaget for byen Stavanger ble lagt og den første kirken ble oppført der Stavanger domkirke nå står."},{"page_url":"https://cs.wikipedia.org/wiki/Bazilika_San_Vitale","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/Ravenna_-_Basilica_of_San_Vitale_-_capitel2.jpg","page_title":"Bazilika San Vitale","context_page_description":"Bazilika San Vitale, italsky Basilica di San Vitale, je kostel v italském městě Ravenna. Jde o jeden z nejvzácnějších příkladů byzantské architektury v západní Evropě, s typickým oktagonálním půdorysem. Spolu s dalšími osmi ravennskými památkami byl zapsán na seznam Světového dědictví UNESCO, v rámci položky Raně křesťanské památky Ravenny. Kostel užívá katolická církev a její papež mu přidělil čestný titul bazilika. Kostel byl postaven již roku 547, za vlády Ostrogótů, nicméně předznamenal zvýšený zájem Byzance o tuto oblast, jež vyvrcholil krátce na to zřízením tzv. Ravennského exarchátu, panství Byzance v Itálii, jež chtělo bránit rozpínavosti Langobardů. Slavné jsou tamní mozaiky, největší mozaiky byzantského typu mimo Konstantinopol. Fresky uvnitř chrámu pocházejí až z barokní éry, vytvořeny byly v letech 1778 až 1782."},{"page_url":"https://en.wikipedia.org/wiki/Southern_toad","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1e/Bufo_terrestris_0.jpg","page_title":"Southern toad","context_page_description":"The southern toad is a true toad native to the southeastern United States, from eastern Louisiana and southeastern Virginia south to Florida. It often lives in areas with sandy soils. It is nocturnal and spends the day in a burrow. Its coloring is usually brown but can be red, gray, or black. It is approximately 8 cm long."},{"page_url":"https://vi.wikipedia.org/wiki/Sabrina_Seara","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0f/Sabrina_Seara_in_2012.jpg","page_title":"Sabrina Seara","context_page_description":"Sabrina Seara Parra là một nữ diễn viên telenovela của Venezuela."},{"page_url":"https://en.wikipedia.org/wiki/Iraqi_Turkmen","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/20/Iraqi_Turkmen_protest_in_Amsterdam.jpg","page_title":"Iraqi Turkmen","context_page_description":"The Iraqi Turkmen, also referred to as Iraqi Turks or Turks of Iraq, are Iraqis of Turkic origin who mostly adhere to a Turkish heritage and identity. Most Iraqi Turkmen are the descendants of the Ottoman soldiers, traders and civil servants who were brought into Iraq from Anatolia during the rule of the Ottoman Empire. Despite the popular reference to the Turks of Iraq as \\"Turkmen\\", they are not directly related to the Turkmen people of Turkmenistan and do not identify as such.\\nToday, the Iraqi Turkmen form the third largest ethnic group in Iraq, after the Arabs and Kurds. According to the Iraqi Ministry of Planning, in 2013, the Iraqi Turkmen population numbered 3 million out of Iraq's 34.7 million inhabitants. The minority mainly reside in northern and central Iraq and share close cultural and linguistic ties with Turkey, particularly the Anatolian region."},{"page_url":"https://ceb.wikipedia.org/wiki/Vipera_pontica","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a7/Vipera_pontica_GNM7373-001.jpg","page_title":"Vipera pontica","context_page_description":"Espesye sa bitin ang Vipera pontica. Una ning gihulagway ni Billing, Nilson ug Sattler 1990. Ang Vipera pontica sakop sa kahenera nga Vipera sa kabanay nga Viperidae. Giklaseklase sa IUCN ang espesye sa nagtikapuo. Pagka karon wala pay siak nga nalista ubos niini niya."},{"page_url":"https://vi.wikipedia.org/wiki/%C4%90%C6%B0%E1%BB%9Dng_hoa_Nguy%E1%BB%85n_Hu%E1%BB%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fc/%C4%90HNH_2012_-_C%C3%A2y_tre.JPG","page_title":"Đường hoa Nguyễn Huệ","context_page_description":"Đường hoa Nguyễn Huệ là tên gọi của đường Nguyễn Huệ, Thành phố Hồ Chí Minh khi được trang hoàng vào mỗi dịp Tết Nguyên Đán, dành cho khách đi bộ thưởng ngoạn, bắt đầu từ tết Giáp Thân năm 2004, trước đó nó thường được gọi là Chợ hoa Nguyễn Huệ. Đường Nguyễn Huệ là một trong những con đường đẹp nhất của Thành phố Hồ Chí Minh tại phường Bến Nghé, Quận 1, nằm trải dài hơn 700 mét từ trước trụ sở Ủy ban Nhân dân thành phố và tượng đài Hồ Chí Minh đến bến Bạch Đằng, với nhiều tòa nhà cao tầng và những trung tâm thương mại mua bán sầm uất, biến thành một đường hoa rực rỡ, thu hút rất nhiều khách viếng thăm, và trở thành một địa chỉ quen thuộc cho những vị khách du xuân.\\nHiện nay, hàng năm triển lãm Đường hoa Nguyễn Huệ thường được tổ chức từ ngày 28 tháng chạp đến hết mùng 4 tháng Giêng âm lịch. Bên cạnh Đường hoa là Lễ hội Đường sách cùng thời gian và địa điểm trên, trưng bày các phương tiện sách, ấn phẩm, với sự tham gia của nhiều nhà phát hành sách.\\nNgoài Đường hoa Nguyễn Huệ, thành phố Hồ Chí Minh còn có các hội hoa Xuân triển lãm hàng năm, như tại Công viên Tao Đàn, công viên Gia Định và phố Ông Đồ..."},{"page_url":"https://vi.wikipedia.org/wiki/Geophila_repens","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/0c/Geophila_repens1.JPG","page_title":"Geophila repens","context_page_description":"Geophila repens là một loài thực vật có hoa trong họ Thiến thảo. Loài này được I.M.Johnst. mô tả khoa học đầu tiên năm 1949."},{"page_url":"https://da.wikipedia.org/wiki/Adrian_Erlandsson","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fc/DanijaAdrianJyrkissa.jpg","page_title":"Adrian Erlandsson","context_page_description":"Adrian Erlandsson er en svensk trommeslager fra Göteborg. Han begyndte sin karriere i At the Gates og siden på The Haunteds selvbetitlede debutalbum. Erlandsson spillede frem til november 2006 i Cradle of Filth. Han spiller nu i bandet Nemhain med sin hustru Morrigan Hel. Han er også begyndt at spille med Paradise Lost samt Netherbird. Hans bror Daniel Erlandsson spiller trommer i bandet Arch Enemy.\\nAdrian Erlandsson spillede også i Skitsystem 1994 – 1997. Et samarbejde med Deathstars førte til at Erlandsson spiller trommer i en version af titelsangen på albummet Night Electric Night, udgivet 2009. Sangen er et bonusspor på den begrænsede udgave, \\"Gold Edition\\", af albummet."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E7%99%BD%E9%A0%AD%E9%B5%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/69/Chinese_Bubul.JPG","page_title":"白頭鵯","context_page_description":"白頭翁，又名黑頭翁丶白頭鵠仔，是鵯屬小型鳴禽，冬季北方鳥南遷為候鳥，台灣亞種於台灣為留鳥，平均壽命約10到15年。白頭翁常見於東亞，臺灣西半部與東北部低海拔地區，中國大陸則是在長江南部的大多地區，以及香港、琉球群島，性活潑，不甚畏人。食昆蟲，種子和水果，屬雜食性，雄鳥胸部灰色較深，雌鳥淺淡，雄鳥枕部白色極為清晰醒目。"},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A0%D1%83%D1%81%D1%8C%D0%BA%D0%B8%D0%B9_%D0%BB%D0%B5%D0%B2","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/71/HerbRus%27_Gr%C3%BCnenberg_%281602-1604%29.jpg","page_title":"Руський лев","context_page_description":"Руський лев — золотий лев на лазуровому тлі. Герб Руського королівства, Руського воєводства й Західно-Української Народної Республіки. Зазвичай, зображався здибленим, рідше — крокуючим, коронованим, зі срібним чи червоним озброєнням; таким, що спинається на золоту або срібну скелю. Найдавніші зображення фігурують на печатках руських правителів від ХIV ст. — Юрія І, Лева ІІ, Юрія ІІ, Володислава. У XV—XVI ст. лев був присутній на великих печатках польських королів Ягайла, Олександра, Сигізмунда II як символ Русі, поруч із польським орлом, литовською погонею і прусським орлом. Як регіональний герб Львівської землі у вигляді лева на скелі відомий з XV ст. Починаючи з Революції в Австрійській імперії 1848 року став одним із політичних символів русинів і українського національно-визвольного руху. У новітню добу сприймався як герб західноукраїнських земель з центром у Львові, переважно Галичини. Зображувався емблемах українських військових формувань ХХ століття — Українських січових стрільців та дивізії «Галичина». З 2009 року є одним із щитотримачів проекту великого герба України."},{"page_url":"https://de.wikipedia.org/wiki/Robert_Kloos","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/42/Robert-Kloos.jpg","page_title":"Robert Kloos","context_page_description":"Robert Kloos ist ein deutscher Agrarpolitiker. Er ist verheiratet und hat ein Kind."},{"page_url":"https://it.wikipedia.org/wiki/Rodolfo_Fierro","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/11/Fierro_y_villa.jpg","page_title":"Rodolfo Fierro","context_page_description":"Rodolfo Fierro è stato un generale, rivoluzionario e ferroviere messicano, combattente della rivoluzione messicana nella División del Norte, l'esercito di Pancho Villa."},{"page_url":"https://ms.wikipedia.org/wiki/Cooktown,_Queensland","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e9/Cooktownia_robertsii.JPG","page_title":"Cooktown, Queensland","context_page_description":"Cooktown adalah sebuah bandar dan kawasan di Shire of Cook, Queensland, Australia. Cooktown terletak kira-kira 2,000 kilometer di utara Brisbane dan 328 kilometer di utara Cairns, dengan jalan. Pada masa banci banci 2016, Cooktown mempunyai jumlah penduduk 2,631.\\nCooktown berada di muara Sungai Endeavour, di Semenanjung Cape York di Hujung Jauh Queensland di mana James Cook memasuki kapalnya, Endeavour, untuk pembaikan pada tahun 1770. Kedua-dua bandar dan Gunung Cook yang naik di belakang bandar itu dinamakan sempena James Cook.\\nCooktown adalah salah satu daripada beberapa bandar besar di Semenanjung Cape York dan ditubuhkan pada 25 Oktober 1873 sebagai pelabuhan bekalan untuk medan emas di sepanjang Sungai Palmer. Ia digelar \\"Cook's Town\\" hingga 1 June 1874."},{"page_url":"https://en.wikipedia.org/wiki/Rubus_coreanus","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/35/Chinese_brambles.jpg","page_title":"Rubus coreanus","context_page_description":"Rubus coreanus, known as bokbunja, Korean blackberry, or Korean bramble, is a species of raspberry native to Korea, Japan, and China. It produces edible berries that are fermented into bokbunja ju, a Korean fruit wine.\\nThe wine made of bokbunja is called bokbunjaju."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%B7%9D%E8%94%A1%E9%80%9A%E8%A9%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5e/%E5%9C%8B%E6%B0%91%E9%BB%A8%E7%B8%BD%E7%B5%B1%E5%80%99%E9%81%B8%E4%BA%BA%E6%B4%AA%E7%A7%80%E6%9F%B1.jpg","page_title":"川蔡通話","context_page_description":"川蔡通話是指2016年12月2日，中華民國總統蔡英文自臺灣致電美國總統當選人唐納·川普，祝賀其當選新任總統。通話歷時10多分鐘，雙方針對政治、經濟、安全及亞洲印太區域情勢交換意見，川普並多次於網站及推特發表看法。這是史上首次美國候任總統與中華民國總統直接進行通話，在國際上引發熱議，華文傳媒亦見「川菜夠辣」等討論。\\n中華人民共和國外交部表示，此行為不可能改變國際社會已經形成「一個中國」格局，也認為不會改變美國政府多年來奉行的一個中國政策。美國白宮亦重申「一個中國」政策，並表示此政策承諾沒有發生變化。中華民國總統府強調海峽兩岸關係與臺美關係之間並無衝突。時任美國總統歐巴馬表示此舉可能造成中美關係的全面破裂並引起衝突，建議川普在執行全面性的外交政策時應更有系統、更經思慮及更符合國際慣例。川普則在2016年12月11日接受專訪時表示，除非美國與中國大陸在包含貿易的議題達成協議，不然「為什麼要被一中政策綁死？」\\n2017年2月9日，川普在與中華人民共和國主席習近平的通話中，表示會遵守美國的「一中政策」。4月27日蔡英文接受路透社專訪，表明「不排除有機會跟川普總統本人能夠再次通電話」，對此川普在次日對《路透》表示，美國與中國大陸正在合力遏阻北韓核武野心，他無意在此時為習近平「製造難題」。6月30日，川普政府向美國國會提出任內首批對臺軍售。\\n2018年3月16日，川普簽署參、眾兩院通過的《臺灣旅行法》。"},{"page_url":"https://en.wikipedia.org/wiki/Frank_W._Wood","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5b/Mordingtonhouse.jpg","page_title":"Frank W. Wood","context_page_description":"Frank Watson Wood commenced his career as a Royal Navy officer, and was described in 1907 as \\"naval artist, Portsmouth\\". He went on to become an internationally regarded watercolorist.\\nThe son of parents who resided in the High Street of Berwick-upon-Tweed, in August 1906 he sold King Edward VII a watercolour which he hung in the Royal Yacht. Queen Alexandra purchased at the same time a further three pictures, all associated with views taken during Cowes Regatta week. In November 1907 the Queen again purchased from him two large watercolours.\\nWood was in Bermuda in 1929 and 1931, and painted Admiralty House and Admiralty Cove, in those days the Headquarters of the America & West Indies Squadron.\\nOther works include:\\nCowes\\nEdinburgh from The Braids\\nLinlithgow Palace\\nSpringtime on the River Tweed\\nMordington House\\nA View of Berwick-upon-Tweed\\nTopography of Berwick\\nGullane"},{"page_url":"https://zh.wikipedia.org/zh-tw/%E5%9F%83%E5%BC%97%E5%90%95%E8%A5%BF%E5%AE%AB","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/Palais_Ephrussi_Vienna_June_2006_126.jpg","page_title":"埃弗吕西宫","context_page_description":"埃弗呂西宮是維也納的一座歷史建築，原業主為埃弗呂西家族，由奧地利國會大廈的建築師特奧費爾·翰森設計。它位於戒指路上，沃蒂夫教堂對面。\\n與維也納傳統的巴洛克貴族宮殿不同，埃弗呂西宮建於19世紀末，高五層，採用了當時流行的新文藝復興風格。\\n1938年德奧合併後 奧地利與納粹德國合併，該建築的主人埃弗呂西父子被蓋世太保逮捕，威脅要送進達豪集中營。78歲的維克托·埃弗呂西簽字放棄對建築及所有內部藝術品和珍稀古版書的所有權後獲釋。家族成員被關押在兩個房間，在同意放棄剩餘的財產，包括埃弗呂西銀行後，才獲准離開奧地利。\\n第二次世界大戰期間，宮殿遭到嚴重損壞。1950年，經過長時間的訴訟，分布在世界各地的倖存的埃弗呂西家族成員收回建築物以及許多書籍和藝術品的合法所有權，但有沒有回到給他們帶來痛苦和創傷記憶的維也納，而是將其以5萬美元的低價出售。\\n從1969年到2009年，翻修過的宮殿成為奧地利賭場總部。"},{"page_url":"https://ro.wikipedia.org/wiki/Neaua,_Mure%C8%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0c/RO_MS_Biserica_reformata_din_Neaua_%281%29.jpg","page_title":"Neaua, Mureș","context_page_description":"Neaua este satul de reședință al comunei cu același nume din județul Mureș, Transilvania, România."},{"page_url":"https://zh.wikipedia.org/zh-mo/%E5%AF%A6%E9%BE%8D%E5%B4%97%E8%B7%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a5/Nilgiri%27s%2C_Serangoon_Road%2C_Singapore_-_19960707.jpg","page_title":"實龍崗路","context_page_description":"實龍崗路是一條新加坡的道路，是當地最古老的道路之一，從南至北沿實龍崗河而行。"},{"page_url":"https://vi.wikipedia.org/wiki/Acis_autumnalis","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b9/31-08-2010_Leucojum-autumnale-habitus.JPG","page_title":"Acis autumnalis","context_page_description":"Acis autumnalis là một loài thực vật có hoa trong họ Amaryllidaceae. Loài này được Sweet mô tả khoa học đầu tiên năm 1829."},{"page_url":"https://da.wikipedia.org/wiki/Jelena_Slesarenko","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a4/Yelena_Slesarenko_2007.jpg","page_title":"Jelena Slesarenko","context_page_description":"Jelena Vladimirovna Slesarenko er en russisk højdespringer. Hendes bedste konkurrenceresultater omfatter guldmedaljen fra OL 2004 i Athen samt to indendørs-VM-guldmedalje fra 2004 i Budapest og 2006 i Moskva samt en indendørs-VM-bronzemedalje fra 2008 i Valencia. Hendes personlige rekord lyder på 2,06 m, sat under OL i Athen. Indendørs er rekorden 2,04 m."},{"page_url":"https://uk.wikipedia.org/wiki/Allard","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5d/1950_Allard_J2_no1578.jpg","page_title":"Allard","context_page_description":"Allard — з 1946 року англійський виробник автомобілів. Штаб-квартира розташована в місті Лондон. У 1959 році компанія припинила виробництво автомобілів."},{"page_url":"https://fi.wikipedia.org/wiki/Atum","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b8/Atum%2C_Nordisk_familjebok.png","page_title":"Atum","context_page_description":"Atum oli yksi vanhimmista muinaisessa Egyptissä palvotuista luojajumalista. Atumin kultti keskittyi Heliopoliksen temppeliin, mutta häntä palvottiin myös muuallakin maassa. Atum yhdistettiin usein Ra-jumalaan, jolloin hänen katsottiin edustavan laskevaa aurinkoa Kheprin ollessa nouseva ja Ran ollessa keskipäivän aurinko. Myöhemmin Atum yhdistettiin myös Ptahiin ja Osirikseen.\\nAtum kuvattiin useimmiten miehenä, jolla oli päässään Ylä- ja Ala-Egyptin yhdistetty kruunu ja käsissään was-sauva ja ankh-amuletti. Hänet sotketaan usein faraota esittäviin kuviin lähes identtisen kuvaamistavan vuoksi. Atum oli ensimmäisiä ellei jopa ensimmäinen täysin ihmisenä kuvattu jumala.\\nAtumin katsottiin olevan Heliopoliksen enneadin ensimmäinen jumala, jonka lapsia kaikki muut jumalat olivat. Hänen uskottiin nousseen alkumerestä, jota edusti Nun, ja luoneen Shun ja Tefnutin sylkemällä. Atumin katsottiin edustavan molempia sukupuolia yhtä aikaa eli hän oli intersukupuolinen. Myöhempinä aikoina hänen katsottiin pariutuneen varjonsa kanssa.\\nAtumin uskottiin olevan faraon isä, jonka luokse farao palasi kuolemansa jälkeen. Atum myös suojeli vainajia manalassa vaanivilta demoneilta."},{"page_url":"https://de.wikipedia.org/wiki/Gerhard_Schaffran","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/Lehmann%2C_Schaffran%2C_Ratzinger%2C_Meisner_1987_in_Dresden.jpg","page_title":"Gerhard Schaffran","context_page_description":"Gerhard Schaffran war Kapitelsvikar des Erzbistums Breslau für das Erzbischöfliche Amt Görlitz und Bischof von Dresden-Meißen."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%95%D0%BA%D0%BE%D0%BD%D0%BE%D0%BC%D1%96%D0%BA%D0%B0_%D0%9D%D1%96%D0%BC%D0%B5%D1%87%D1%87%D0%B8%D0%BD%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d7/Skyline_Frankfurt_am_Main_2015.jpg","page_title":"Економіка Німеччини","context_page_description":"Німеччина — провідна економічна держава Європи. Провідне місце в економіці займає гірнича, металургійна, хімічна, машинобудівна, харчова, суднобудівна, текстильна, нафтопереробна промисловість. Розвинені всі види сучасного транспорту. Мережа залізниць, автобанів, трубопровідного тр-ту. Гол. морські порти — Гамбург, Бремен, Вільгельмсгафен, Бремергафен, Любек, Росток, Варнемюнде, Вісмар, Штральзунд. Головний західнонімецький аеропорт, найбільший у всій континентальній Європі, знаходиться у Франкфурті-на-Майні. Всі міста і міські агломерації понад 1 млн чол. мають власні аеропорти з регулярним авіаційним сполученням. Провідна авіаційна компанія Німеччини — «Люфтганза».\\nЗа даними Index of Economic Freedom, The Heritage Foundation, U.S.A., 2006: ВВП — $ 2500 млрд. Темп зростання ВВП — 2,7 %. ВВП на душу населення — $ 31 141. Прямі закордонні інвестиції — $ 67 млрд. Імпорт — $ 572,7 млрд. Експорт — $ 607,8 млрд. Велика частина експорту ФРН в 1997 припадала на транспортні засоби, продукцію машинобудування, електротехніки, хімії, товари широкого споживання. У структурі імпорту на ці категорії товарів припадало відповідно 10,8 %; 5,6 %; 11,4 %; 9,2 % і 14,9 %."},{"page_url":"https://zh.wikipedia.org/wiki/%E4%B8%8A%E5%A4%A7%E4%BA%BA%E7%89%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/eb/%E4%B8%8A%E5%A4%A7%E4%BA%BA%E7%89%8C3.png","page_title":"上大人牌","context_page_description":"上大人牌，又称楚牌，是流传于中国湖北的传统牌具，印有过去儿童习字帖《上大人》。"},{"page_url":"https://zh.wikipedia.org/zh-tw/%E9%AB%98%E5%A4%A9%E9%B9%A4","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dd/181231_%E6%B9%96%E5%8D%97%E5%8D%AB%E8%A7%86%E8%B7%A8%E5%B9%B4%E6%BC%94%E5%94%B1%E4%BC%9A_%E9%AB%98%E5%A4%A9%E9%B9%A4_%EF%BC%881%EF%BC%89.jpg","page_title":"高天鹤","context_page_description":"高天鶴，中國大陸假聲男高音歌手、歌劇演員、綜藝節目主持人。2018年以假聲男高音演唱成員身份參加湖南衛視美聲綜藝節目《聲入人心》第一季，並成為年度首席成員。2019年加入湖南衛視《天天向上》主持團，並以聲入人心男團成員身份出道。次年6月，因考證作弊事件而離開湖南衛視及聲入人心男團。"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%93%D0%B5%D0%BD%D0%B5%D1%80%D0%B0%D0%BB%D1%8C%D1%81%D0%BA%D0%BE%D0%B5_(%D0%A1%D0%B0%D1%80%D0%B0%D1%82%D0%BE%D0%B2%D1%81%D0%BA%D0%B0%D1%8F_%D0%BE%D0%B1%D0%BB%D0%B0%D1%81%D1%82%D1%8C)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fa/%D0%94%D0%B5%D1%82%D1%81%D0%BA%D0%B0%D1%8F_%D1%88%D0%BA%D0%BE%D0%BB%D0%B0_%D0%B8%D1%81%D0%BA%D1%83%D1%81%D1%81%D1%82%D0%B2_%D0%93%D0%B5%D0%BD%D0%B5%D1%80%D0%B0%D0%BB%D1%8C%D1%81%D0%BA%D0%BE%D0%B5.jpg","page_title":"Генеральское (Саратовская область)","context_page_description":"Генера́льское — село в Красноярском муниципальном образовании Энгельсского муниципального района Саратовской области."},{"page_url":"https://ms.wikipedia.org/wiki/8_RRD_(Para)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/20/SAYAP_JPT.png","page_title":"8 RRD (Para)","context_page_description":"Tujuan penubuhan adalah seimbang dengan dasar kerajaan untuk membesarkan Angkatan Tentera Darat Khasnya. Pada masa itu juga, kerajaan Negeri Sarawak berkehendakkan sebuah Batalion Infantri yang mana anggota-anggota terdiri daripada rakyat Sarawak sendiri. Kehendak itu tidak dapat dilaksanakan oleh Kementerian Pertahanan tetapi sebaliknya menubuhkan pasukan 8 Renjer dengan anggota-anggota campuran dari semua Pasukan Renjer pada masa itu."},{"page_url":"https://en.wikipedia.org/wiki/Mokokchung_Village","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d1/MokokchungVillageSkyline.jpg","page_title":"Mokokchung Village","context_page_description":"Mokokchung Village, a village in Mokokchung district is an ancient village in the former Naga Hills, Nagaland, India. According to the folklores, the Ao Nagas emerged from ‘six stones’. These stones symbolise their forefathers and that location is named as ‘Longterok’ which means six stones. These stones are still intact at Chungliyimti in Tuensang district. From this village, the Ao tribe moved towards northern region crossing a river named Tzüla and settled at Soyim, also known as Ungma today. This was the first Ao Village ever known. After a few centuries, a group of people moved further to the north-east of Soyim and settled at a place named as Mokokchung, or today’s Mokokchung village. Many other Ao Naga villages came into being when people migrated out from this village including Ungma in the later part."},{"page_url":"https://en.wikipedia.org/wiki/11th_Airborne_Division_(United_States)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/41/Ph_locator_cagayan_aparri.png","page_title":"11th Airborne Division (United States)","context_page_description":"The 11th Airborne Division was a United States Army airborne formation, first activated on 25 February 1943, during World War II. Consisting of one parachute and two glider infantry regiments, with supporting troops, the division underwent rigorous training throughout 1943. It played a vital role in the successful Knollwood Maneuver, which was organized to determine the viability of large-scale American airborne formations after their utility had been called into question following a disappointing performance during the Allied invasion of Sicily.\\nHeld in reserve in the United States for the first half of 1944, in June the division was transferred to the Pacific Theater of Operations. Upon arrival it entered a period of intense training and acclimatization, and by November was judged combat-ready. The 11th Airborne saw its first action on the island of Leyte in the Philippines, but in a traditional infantry role. In January 1945 the division took part in the invasion of Luzon. The two glider infantry regiments again operated as conventional infantry, securing a beachhead before fighting their way inland."},{"page_url":"https://vi.wikipedia.org/wiki/Marley_Shelton","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e7/Marley_Shelton.jpg","page_title":"Marley Shelton","context_page_description":"Marley Eve Shelton là một diễn viên người Mỹ."},{"page_url":"https://ja.wikipedia.org/wiki/%E5%86%99%E7%9C%9F%E6%B9%BF%E6%9D%BF","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/21/Theodore_Roosevelt_on_broken_glass.jpg","page_title":"写真湿板","context_page_description":"写真湿板とは、写真術で用いられた感光材料の一種である。"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A3%D1%87%D0%B8%D1%82%D0%B5%D0%BB%D1%8C,_%D0%9A%D0%BE%D0%BD%D1%81%D1%82%D0%B0%D0%BD%D1%82%D0%B8%D0%BD_%D0%90%D0%BB%D0%B5%D0%BA%D1%81%D0%B0%D0%BD%D0%B4%D1%80%D0%BE%D0%B2%D0%B8%D1%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/01/%D0%9A%D0%BE%D0%BD%D1%81%D1%82%D0%B0%D0%BD%D1%82%D0%B8%D0%BD_%D0%A3%D1%87%D0%B8%D1%82%D0%B5%D0%BB%D1%8C.jpg","page_title":"Учитель, Константин Александрович","context_page_description":"Константин Александрович Учитель — российский историк театра, педагог, продюсер."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A4%D0%B5%D1%81%D1%82%D0%B8%D0%B2%D0%B0%D0%BB-%D0%A1%D0%B8%D1%82%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ca/Festival_City_Overview_201106.jpg","page_title":"Фестивал-Сити","context_page_description":"Фестивал-Сити — крупнейший частный жилой комплекс, расположенный в гонконгском округе Сатхинь, в районе Тайвай. Состоит из 12 высотных башен, построен в 2008—2011 годах, стоимость проекта составила 20 млрд гонконгских долларов. Владельцами и девелоперами Фестивал-Сити являются гонконгские компании Cheung Kong Group и MTR Corporation. Дизайн комплекса разработали канадская компания WSP Global и американская компания Parsons Brinckerhoff.\\nС северо-востока к комплексу примыкает станция метро Тайвай, с юго-востока — парк с детскими игровыми площадками, с юга — электродепо метрополитена Тайвай. Ранее на месте Фестивал-Сити располагались футбольное поле и велопарк. Однако, из-за необходимости строительства депо, власти снесли эти объекты и заключили соглашение на совместное использование земли под жилой комплекс и объекты транспортной инфраструктуры."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E5%8F%98%E9%9B%80%E9%BA%A6","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0b/Panicle_of_Bromus_commutatus.JPG","page_title":"变雀麦","context_page_description":"變雀麥為禾本科雀麥屬下的一個種。"},{"page_url":"https://cs.wikipedia.org/wiki/Ramena_Oh%C5%99e","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/83/Oh%C5%99e_u_Dasnic_%281%29.jpg","page_title":"Ramena Ohře","context_page_description":"Ramena Ohře je Evropsky významná lokalita vyhlášená v roce 2009. Lokalita je zahrnuta do soustavy Natura 2000. Jedná se o nejzachovalejší část nivy Ohře nížinného charakteru v Karlovarském kraji s množstvím mrtvých ramen a tůní.\\nPředmětem ochrany jsou smíšené jasanovo-olšové lužní lesy temperátní a boreální Evropy, přirozené vodní nádrže s bohatou vegetací a bahnité břehy řek s bohatou vegetací."},{"page_url":"https://en.wikipedia.org/wiki/List_of_recipients_of_the_Order_of_Industrial_Heroism","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b1/OIH-Gill-Thomas.jpg","page_title":"List of recipients of the Order of Industrial Heroism","context_page_description":"The list of recipients of the Order of Industrial Heroism contains 440 recipients, who received awards between its inception in 1923 and dissolution in 1964.\\nSometimes there were multiple awards relating to one event; six of the awards were to miners' union lodges, rather than individuals, where a large number of members had been involved in mine rescues. Only one of the solo awardees was a woman; another received one alongside three men."},{"page_url":"https://cs.wikipedia.org/wiki/T-lymfocyt","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/62/Healthy_Human_T_Cell.jpg","page_title":"T-lymfocyt","context_page_description":"T-lymfocyt je druh bílých krvinek ze skupiny lymfocytů. Při růstu opouštějí kostní dřeň a migrují do brzlíku, ve kterém dozrávají. Existuje více typů T-lymfocytů. Obecně se však dá říci, že jsou podstatou specifické buněčné imunity, při níž potírají např. nádorové buňky či buňky napadené viry. Dále jsou některé T-lymfocyty schopné účinně regulovat imunitní systém – zejména díky tomu, že vylučují do krve cytokiny. Na povrchu T-buněk se nachází mimo jiné tzv. T-buněčný receptor a další markery."},{"page_url":"https://ca.wikipedia.org/wiki/Rodalies_de_Catalunya","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/16/Estaci%C3%B3_de_Molins_de_Rei.jpg","page_title":"Rodalies de Catalunya","context_page_description":"Rodalies de Catalunya és una marca comercial —utilitzada per la Generalitat de Catalunya i Renfe Operadora— per als serveis ferroviaris de trens de rodalia i els serveis ferroviaris de regionals operats per Renfe Operadora; i que circulen per la xarxa ferroviària d'ample ibèric d'ADIF. Mayte Castillo n'és l'actual directora, des de l'any 2018.\\nActualment la xarxa compta amb sis línies de regionals no integrades a la xarxa de transport públic, set línies de rodalia integrades dins el sistema tarifari de l'ATM Àrea de Barcelona, dues línies de rodalia al Camp de Tarragona integrades a l'ATM Camp de Tarragona i una altra de rodalia a Girona també integrada actualment dins l'ATM Àrea de Girona."},{"page_url":"https://fr.wikipedia.org/wiki/Grotte_de_Royston","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/0d/Royston_Cave_Beldam_Plate_II.jpg","page_title":"Grotte de Royston","context_page_description":"La grotte de Royston est une cavité artificielle située à Royston, dans l'Hertfordshire, en Angleterre. Selon les spéculations, elle aurait été utilisée par les templiers, sans qu'aucune preuve ne puisse confirmer cette hypothèse locale. Une autre théorie fait remonter la première utilisation de la grotte au Néolithique, époque à laquelle elle aurait servi de mine de silex."},{"page_url":"https://pt.wikipedia.org/wiki/U.S._Route_59","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a5/US_59_map.png","page_title":"U.S. Route 59","context_page_description":"U.S. Route 59 é uma autoestrada dos Estados Unidos.\\nFaz a ligação do Sul para o Norte. A U.S. Route 59 foi construída em 1934 e tem 1 911 milhas."},{"page_url":"https://id.wikipedia.org/wiki/Jake_Short","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4d/Jake_Short_%28cropped%29.jpg","page_title":"Jake Short","context_page_description":"Jake Short adalah seorang pemeran asal Amerika Serikat. Ia memainkan peran Fletcher Quimby dalam seri komedi Disney Channel A.N.T. Farm dan Oliver dalam seri asli Disney XD Mighty Med dan Lab Rats: Elite Force."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%9D%E3%83%BC%E3%83%A9%E3%83%B3%E3%83%89%E3%81%AE%E7%B5%8C%E6%B8%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f2/Bydgostia.JPG","page_title":"ポーランドの経済","context_page_description":"ポーランドの経済では、ポーランドの国民経済について記述する。"},{"page_url":"https://uk.wikipedia.org/wiki/%D0%93%D0%BB%D0%B8%D0%BD%D0%B8_%D0%94%D0%BE%D0%BD%D0%B1%D0%B0%D1%81%D1%83_(Sibelco)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ae/Sibelco_logo.png","page_title":"Глини Донбасу (Sibelco)","context_page_description":"ПрАТ «Глини Донбасу» — українське підприємство, яке з 1995-го року спеціалізується на видобутку високоякiсних глин, що залягають у Донецькiй областi, а також піску, гравію і каоліну. Продукцiя пiдприємства реалiзується як на територiї України, так i за її межами. Власником підприємства є бельгійський концерн Sibelco Group."},{"page_url":"https://sv.wikipedia.org/wiki/Datnioides","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8b/Datnioides_campbelli.jpg","page_title":"Datnioides","context_page_description":"Datnioides, på svenska ibland kallade tigerfiskar, är det enda släktet i den monotypiska familjen Datnioididae. De fem arterna i detta släkte lever i sött- oct bräckt vatten i floddeltan och andra kustnära områden i Syd- oct Sydostasien. Som vuxna blir tigerfiskarna 30–45 cm långa och kan väga upp till och med 10 kg.\\nNyligen genomförda studier har visat att tigerfiskarna är nära besläktade med släktet Lobotes i familjen Lobotidae. Flera av arterna återfinns ibland i zoohandeln, och hålls i fångenskap i akvarier."},{"page_url":"https://eo.wikipedia.org/wiki/Havaja_lingvo","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f3/Hawaii_Islands_-_Ni_ihau.PNG","page_title":"Havaja lingvo","context_page_description":"La havaja lingvo, propranome ʻŌlelo Hawaiʻi, estas aŭstronezia lingvo parolata sur la Pacifika insularo Havajo. Ĝi estas la lingvo de la praaj havajaj indiĝenoj. Ĝi estas unu el la du oficialaj lingvoj de la usona ŝtato de Havajo, kaj la alia estas la angla lingvo. La havaja estas grava parto de la havajaj kulturo, muziko, kaj tiel plu, sed nur la loĝantoj de la privata insulo Niʻihau uzas la havajan lingvon ĉiutage.\\nLa vorto \\"Wiki\\" aŭ \\"Viki\\" en Esperanto estas havaja vorto, kiu signifas \\"rapida\\". Uzante ĝin dufoje, vi havos la vorton \\"wiki-wiki\\", kiu signifas \\"tre rapide\\".\\nEn la moderna tempo, la lingvo miksiĝis kun la angla kaj aliaj lingvoj kaj estiĝis kreolo, la havaja kreolo. Oni ne konfuzu ĝin kun la havaja."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%AE%D0%B6%D0%BD%D0%BE%D0%B0%D1%84%D1%80%D0%B8%D0%BA%D0%B0%D0%BD%D1%81%D0%BA%D0%B8%D0%B5_%D0%B7%D0%B2%D1%91%D0%B7%D0%B4%D1%87%D0%B0%D1%82%D1%8B%D0%B5_%D1%87%D0%B5%D1%80%D0%B5%D0%BF%D0%B0%D1%85%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0b/Psammobates_geometricus.png","page_title":"Южноафриканские звёздчатые черепахи","context_page_description":"Южноафриканские звёздчатые черепахи — род сухопутных черепах.\\nВ роде три редких вида, населяющих южные районы Африки.\\nВсе они занесены в Красную книгу МСОП."},{"page_url":"https://id.wikipedia.org/wiki/Michel_de_Montaigne","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6d/Unterschrift_des_Michel_de_Montaigne.png","page_title":"Michel de Montaigne","context_page_description":"Michel Eyquem de Montaigne adalah salah satu filsuf yang paling signifikan dari Renaisans Prancis, yang dikenal untuk mempopulerkan esai sebagai genre sastra. Karyanya terkenal karena penggabungan anekdot kasual dan otobiografi dengan wawasan intelektual yang serius; volume besarnya Essais berisi beberapa esai paling berpengaruh yang pernah ditulis. Montaigne memiliki pengaruh langsung pada penulis di seluruh dunia, termasuk Francis Bacon, René Descartes, Blaise Pascal, Jean-Jacques Rousseau, Albert Hirschman, William Hazlitt, Ralph Waldo Emerson, Friedrich Nietzsche, Stefan Zweig, Eric Hoffer, Isaac Asimov, dan mungkin pada karya-karya akhir dari William Shakespeare.\\nDalam masa hidupnya sendiri, Montaigne dikagumi lebih sebagai negarawan daripada sebagai seorang penulis. Kecenderungan di esainya untuk menyimpang ke anekdot dan perenungan pribadi dipandang merugikan terhadap gaya yang tepat bukan sebagai sebuah inovasi, dan deklarasi bahwa, \\"Saya sendiri adalah persoalan dari buku saya\\", dipandang oleh orang sezamannya sebagai memanjakan diri sendiri."},{"page_url":"https://th.wikipedia.org/wiki/%E0%B8%81%E0%B8%87%E0%B8%AA%E0%B9%8C%E0%B8%95%E0%B9%87%E0%B8%AD%E0%B8%87%E0%B8%AA%E0%B9%8C%E0%B9%81%E0%B8%AB%E0%B9%88%E0%B8%87%E0%B8%AD%E0%B8%B2%E0%B8%A3%E0%B9%8C%E0%B8%A5","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e7/Robert_Konstancie.jpg","page_title":"กงส์ต็องส์แห่งอาร์ล","context_page_description":"กงส์ต็องส์แห่งอาร์ล หรือ กงส์ต็องส์แห่งพรอว็องส์ เป็นธิดาของกีโยม เคานต์แห่งตูลูส ทรงเป็นพระมเหสีคนที่สามของพระเจ้ารอแบร์ที่ 2 ผู้ศรัทธาแห่งฝรั่งเศส และเป็นพระมารดาของพระเจ้าอ็องรีที่ 1 แห่งฝรั่งเศส, รอแบร์ที่ 1 ดยุคแห่งบูร์กอญ และอาแดล กาแป เคานเตสแห่งแฟลนเดอส์"},{"page_url":"https://tr.wikipedia.org/wiki/Santa_Mar%C3%ADa_de_Quintanilla_de_las_Vi%C3%B1as","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1d/Wisig_Quintanilla_de_las_Vignas_b.jpg","page_title":"Santa María de Quintanilla de las Viñas","context_page_description":"Santa María de Quintanilla de las Viñas, ya da Santa María de Lara, İspanya'da Vizigotlar döneminden kısmen günümüze ulaşmış bir kilisedir. Yapının esasen eskiden bir manastıra ait olduğu ancak manastırın sonraki dönemlerde yıkıldığı düşünülmektedir. Kilise, 1929 yılından itibaren Bien de Interés Cultural listesindedir."},{"page_url":"https://bs.wikipedia.org/wiki/D%C5%BEudo","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/83/Ishii_vs_Suzuki_2008.jpg","page_title":"Džudo","context_page_description":"Judo 柔 道 je borilačka vještina porijeklom iz Japana. U bukvalnom prevodu sa japanskog jezika na bosanski znači JU - nježni, DO - put, tj. kako se odbraniti od napadača na najjednostavniji način. Utemenitelj je Japanski profesor borenja Džigoro Kano."},{"page_url":"https://ru.wikipedia.org/wiki/NGC_3300","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/32/NGC3300_-_SDSS_DR14.jpg","page_title":"NGC 3300","context_page_description":"NGC 3300 — линзообразная галактика в созвездии Лев.\\nЭтот объект входит в число перечисленных в оригинальной редакции «Нового общего каталога».\\nГалактика NGC 3300 входит в состав группы галактик NGC 3306. Помимо NGC 3300 в группу также входят NGC 3306, UGC 5695, UGC 5739, UGC 5758, UGC 5760 и UGC 5781."},{"page_url":"https://zh.wikipedia.org/wiki/%E8%89%BE%E5%A5%B3%E6%98%9F","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a7/Asteroid_size_comparison.jpg","page_title":"艾女星","context_page_description":"艾女星是一顆位於主小行星帶的鴉女星族小行星，由約翰·帕利扎於1884年9月29日發現。其名來源於希臘神話中的一位寧芙。通過天文望遠鏡的觀測，艾達星被歸類於S-型小行星，內小行星帶中成員最多的一類。1993年8月28日，前往觀測木星的伽利略號探測器接近艾達星。它是第二顆有太空探測器接近的小行星，也是第一顆人們發現擁有衛星的小行星。\\n就如其他主帶小行星，艾達星的軌道位於火星及木星的軌道之間。其公轉周期為4.84年，自轉周期為4.63小時。艾達星的平均直徑為31.4 km。它不規則、橢長形的形狀，明顯由兩個大物體連接而成，形如牛角麵包。它是太陽系中表面隕石坑最多的星體之一，擁有不同大小及年齡的隕石坑。\\n艾達星的衛星「艾衛」，是由任務成員從伽利略號發回的圖片中發現的，其名取自希臘神話中居住在伊達山上的達克堤利。艾衛的直徑只有1.4公里，是艾女星的20分之一。人們不能準確定出它圍繞艾女星的軌道數據。不過，我們可以根據幾條軌道粗略計算出艾女星的密度，其結果表明艾女星沒有金屬礦物。艾女星和其衛星有許多共同點，這意味它們有著共同的來源。\\n根據伽利略號發回的照片，加上之後對艾女星質量的測量，人們對S-型小行星的地質有了更深的認識。在伽利略號掠過艾女星之前，有著許多不同的理論來解釋這些小行星的礦物成分。知道了它們的成分，我們就能找出掉落地球的隕石與小行星帶天體的關係。傳回的數據顯示，S-型小行星是普通球粒隕石的源頭。普通球粒隕石是地球表面最常見的一種隕石。"},{"page_url":"https://fr.wikipedia.org/wiki/Michael_Stipe","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c2/ICON_marzo_2018_copertina_Mondadori.jpg","page_title":"Michael Stipe","context_page_description":"John Michael Stipe, né le 4 janvier 1960 à Decatur, Géorgie, plus connu sous le nom de Michael Stipe, est le chanteur et parolier du groupe de rock américain R.E.M.. Il en est, avec Peter Buck, Mike Mills et Bill Berry, un des fondateurs.\\nIl est également producteur de cinéma. Ses productions les plus notables sont Velvet Goldmine en 1998 et Dans la peau de John Malkovich l'année suivante. Sensible à la cause animale, Michael Stipe est végétarien et s'est engagé aux côtés de la PETA."},{"page_url":"https://fr.wikipedia.org/wiki/%C3%82ge_d%27or_de_la_peinture_n%C3%A9erlandaise","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a8/Vermeer_-_The_Milkmaid.jpg","page_title":"Âge d'or de la peinture néerlandaise","context_page_description":"L'âge d'or de la peinture néerlandaise est le nom donné à la peinture des Pays-Bas durant le siècle d'or néerlandais, une période de l'histoire de ce pays qui correspond à peu près au XVIIᵉ siècle. Les Provinces-Unies forment alors la nation la plus prospère d'Europe et dominent le commerce, l'art et la science du continent. Les provinces ayant constitué ce nouvel État sont des centres artistiques moins importants que les villes de Flandre, mais les bouleversements et les migrations de populations dus à la guerre de Quatre-Vingts Ans, ainsi que la rupture avec les traditions culturelles monarchiste et catholique, font que l'art néerlandais a besoin de se réinventer entièrement, une tâche qu'il accomplit avec succès.\\nBien que la peinture néerlandaise de l'âge d'or soit contemporaine de la peinture baroque flamande, et partage plusieurs de ses caractéristiques, elle est en grande partie dépourvue de l'idéalisation et de l'amour de la splendeur typiques de l'art baroque, qui inclut la peinture flamande de Pierre Paul Rubens, Antoine van Dyck et Jacob Jordaens."},{"page_url":"https://fr.wikipedia.org/wiki/Reconquista","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/10/Batalla_de_las_Navas_de_Tolosa%2C_por_Francisco_van_Halen.jpg","page_title":"Reconquista","context_page_description":"La Reconquista est le nom donné à la période du Moyen Âge durant laquelle s'est produite la reconquête, par les royaumes chrétiens, des territoires de la péninsule Ibérique et des îles Baléares occupés par les musulmans. Il est communément admis que la Reconquista commence lors de la première moitié du VIIIᵉ siècle ; néanmoins, l'année exacte de son début reste sujette à débat. La victoire asturienne lors de la bataille de Covadonga en 722 est une des dates admises comme le point de départ de la reconquête. Elle s'achève le 2 janvier 1492 dans l'actuelle Espagne, lorsque les « Rois catholiques » prennent le dernier bastion musulman à Grenade."},{"page_url":"https://en.wikipedia.org/wiki/Derby_Parish,_New_Brunswick","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/79/Northumberland_County_NB_-_Derby_Parish.PNG","page_title":"Derby Parish, New Brunswick","context_page_description":"Derby is a civil parish in Northumberland County, New Brunswick, Canada.\\nFor governance purposes it is divided between the local service districts of Renous-Quarryville and the parish of Derby."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9A%D0%BE%D0%BB%D1%8C%D1%88%D0%B2%D0%B0%D1%80%D1%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fa/AUT_Kohlschwarz_COA.jpg","page_title":"Кольшварц","context_page_description":"Кольшварц — коммуна в Австрии, в федеральной земле Штирия.\\nВходит в состав округа Фойтсберг. Население составляет 754 человека. Занимает площадь 15,95 км². Официальный код — 6 16 10."},{"page_url":"https://de.wikipedia.org/wiki/Geschichte_der_Zahnmedizin","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3b/Equine_Dentistry.jpg","page_title":"Geschichte der Zahnmedizin","context_page_description":"Die Geschichte der Zahnmedizin oder Geschichte der Zahnheilkunde umfasst die Entwicklungen in der Zahnheilkunde einschließlich der Beiträge von Personen, die die Zahnmedizin ihrer Zeit beeinflussten. Sie ist ein Teil der Medizingeschichte und reicht bis in die Urgeschichte zurück. Die konservierende Behandlung von Zähnen wurde bei einem 14.000 Jahre alten männlichen Individuum aus der Felshöhle von Riparo Villabruna bei Sovramonte in Norditalien festgestellt, ferner für die Zeit um 5500 bis 7000 v. Chr. bei Bauern in Pakistan. Kariöse Zähne wurden präzise aufgebohrt, möglicherweise verbunden mit einer anschließenden Füllung des Hohlraums. Ebenfalls aus der Jungsteinzeit stammt ein Backenzahn aus Dänemark, an dem eine Trepanation vorgenommen wurde. Die ersten zahntechnischen Arbeiten wurden Mitte des 1. Jahrtausends v. Chr. von Etruskern und Phöniziern angefertigt. Der Einfluss römischer und griechischer Gelehrter war im Mittelalter im christlichen wie im arabischen Raum bestimmend."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D0%BE%D0%BA_%D0%BF%D1%82%D0%B0%D1%85%D1%96%D0%B2_%D0%93%D1%80%D0%B5%D1%86%D1%96%D1%97","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bd/Oenanthe_leucura_Martien_Brand.jpg","page_title":"Список птахів Греції","context_page_description":"Цей список є списком видів птахів, записаних на території Греції.\\nСписок включє близько 442 види, з яких 13 перебувають під загрозою зникнення, а 2 були інтродуковані людиною.\\n4 види птахів не спостерігались у Греції після 1950 року.\\nТеги, що використовуються для виділення охоронного статусу кожного виду за оцінками МСОП:"},{"page_url":"https://cs.wikipedia.org/wiki/B%C5%99ezsko","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f5/K%C5%99%C3%AD%C5%BE_u_silnice_na_Konici_%28u_h%C5%99i%C5%A1t%C4%9B%29%2C_B%C5%99ezsko%2C_okres_Prost%C4%9Bjov.jpg","page_title":"Březsko","context_page_description":"Obec Březsko se nachází v okrese Prostějov v Olomouckém kraji. Žije zde 215 obyvatel. Vedle vlastní dědiny Březsko zahrnuje obec také místní část Michnov, která se dříve členila na dvě osady."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%88%D9%8A%D9%84%D9%8A%D8%A7%D9%85_%D9%84%D8%A7%D8%AF","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/bc/William_Ladd_c1830.jpg","page_title":"ويليام لاد","context_page_description":"ويليام لاد ‏ كان أحد أوائل النشطاء المناهضين للحرب، وأول رئيس لجمعية السلام الأمريكية."},{"page_url":"https://en.wikipedia.org/wiki/Antibody","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/19/Immunoglobulin_basic_unit.svg","page_title":"Antibody","context_page_description":"An antibody, also known as an immunoglobulin, is a large, Y-shaped protein produced mainly by plasma cells that is used by the immune system to neutralize pathogens such as pathogenic bacteria and viruses. The antibody recognizes a unique molecule of the pathogen, called an antigen, via the fragment antigen-binding variable region. Each tip of the \\"Y\\" of an antibody contains a paratope that is specific for one particular epitope on an antigen, allowing these two structures to bind together with precision. Using this binding mechanism, an antibody can tag a microbe or an infected cell for attack by other parts of the immune system, or can neutralize its target directly. Depending on the antigen, the binding may impede the biological process causing the disease or may activate macrophages to destroy the foreign substance. The ability of an antibody to communicate with the other components of the immune system is mediated via its Fc region, which contains a conserved glycosylation site involved in these interactions. The production of antibodies is the main function of the humoral immune system."},{"page_url":"https://fr.wikipedia.org/wiki/Zarube","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2a/Zarube_-_op%C5%A1tina_Valjevo_-_zapadna_Srbija_-_panorama_18.jpg","page_title":"Zarube","context_page_description":"Zarube est un village de Serbie situé sur le territoire de la Ville de Valjevo, district de Kolubara. Au recensement de 2011, il comptait 143 habitants."},{"page_url":"https://es.wikipedia.org/wiki/Moon_Geun_Young","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/30/191021_Moon_Geun-young.png","page_title":"Moon Geun Young","context_page_description":"Moon Geun Young, nació el 6 de mayo de 1987 en Gwangju, es una actriz de Corea del Sur de cine y televisión. Comenzó a modelar a los 12 años y apareció en la película documental On the Way del año siguiente. Llamó la atención a través de su papel como la joven Eun-suh en la popular serie dramática de televisión Autumm Tale. Su gran avance fue como una estrella de la película de terror A Tale of Two Sisters como Su-Yeong dirigida por Kim Ji-woon. Más tarde, protagonizó exitosas películas como My Little Bride en 2004 y Innocent Steps en 2005."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Gef%C3%A4%C3%9Fpflanzen_in_Bosnien_und_Herzegowina","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/81/Picea_abies.jpg","page_title":"Liste der Gefäßpflanzen in Bosnien und Herzegowina","context_page_description":"Diese Liste der Gefäßpflanzen in Bosnien und Herzegowina enthält zusammen mit den eingeführten und endemischen Arten in Bosnien und Herzegowina einen unvollständigen Überblick über Gefäßmoose, Farne und angiosperme Pflanzenarten, die in der verfügbaren Literatur in bosnischer, kroatischer, serbischer und serbokroatischer Sprache zitiert werden.\\nBemerkung:\\nAufgrund wiederholter Änderungen der biologischen Klassifikation und/oder der taxonomischen Ränge und Namen der eingeschlossenen Taxa erscheinen einige von ihnen zweimal in der beigefügten Liste. Dies gilt insbesondere für diese Namen der binären Nomenklatur, die heute noch weithin benutzt werden.\\nDer Name der Gattung und der Familie werden am häufigsten geändert und manchmal auch die Namen der dazugehörigen Arten."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%BA%D1%8C%D1%8F%D0%B2%D0%BE%D0%BD%D0%B0","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a3/Schiavona-Morges.jpg","page_title":"Скьявона","context_page_description":"Скьявона — разновидность холодного оружия, является одной из трёх наиболее распространённых форм мечей с корзинчатой гардой, вместе с шотландским корзинчатым мечом и хаудегеном.\\nИзначально, в XV веке, словом gli schiavoni обозначали мечи, которыми была вооружена гвардия венецианских дожей; они имели длинные прямые клинки, их отличительной особенностью были горизонтально изогнутые в форме буквы «S» парирующие дужки.\\nС 1570 года под итальянским влиянием в немецкой императорской армии сформировался тип меча с вытянувшимся клинком и ажурным корзинчатым эфесом. «Спада скьявона» очевидно является прямым наследником gli schiavoni. Позднее скьявоной стали называть все корзинчатые мечи венецианского стиля.\\nДля скьявоны характерен прямой обоюдоострый клинок шириной около четырёх и длиной около 90 сантиметров. Скьявона с длинным клинком была принята конницей, при Фердинанде II — кирасирами."},{"page_url":"https://vec.wikipedia.org/wiki/Sainte-Eulalie-de-Cernon","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1b/Sainte_Eulalie_La_Tour_Templi%C3%A8re.jpg","page_title":"Sainte-Eulalie-de-Cernon","context_page_description":"Sainte-Eulalie-de-Cernon el xé on comun de 286 abitanti del departemento de Aveyron che el fa parte del rejon Ositània in Fransa."},{"page_url":"https://la.wikipedia.org/wiki/Genga","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/Genga.jpg","page_title":"Genga","context_page_description":"Genga seu Ginga est oppidum Italiae et municipium, in Regione Marchia Anconitana et in Provincia Anconitana situm. Incolae Gengarini appellantur."},{"page_url":"https://id.wikipedia.org/wiki/Jalur_Sutra","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cb/Silkroutes.jpg","page_title":"Jalur Sutra","context_page_description":"Jalur Sutra adalah sebuah jalur perdagangan melalui Asia yang menghubungkan antara Timur dan Barat dengan dihubungkan oleh pedagang, pengelana, biarawan, prajurit, nomaden dengan menggunakan karavan dan kapal laut, dan menghubungkan Chang'an, Republik Rakyat Tiongkok, dengan Antiokhia, Suriah, dan juga tempat lainnya pada waktu yang bervariasi. Pengaruh jalur ini terbawa sampai ke Korea dan Jepang.\\nPertukaran ini sangat penting tak hanya untuk pengembangan kebudayaan Cina, India dan Roma namun juga merupakan dasar dari dunia modern. Istilah 'jalur sutra' pertama kali digunakan oleh geografer Jerman Ferdinand von Richthofen pada abad ke-19 karena komoditas perdagangan dari Cina yang banyak berupa sutra.\\nJalur Sutra benua membagi menjadi jalur utara dan selatan begitu dia meluas dari pusat perdagangan Cina Utara dan Cina Selatan, rute utara melewati Bulgar-Kipchak ke Eropa Timur dan Semenanjung Crimea, dan dari sana menuju ke Laut Hitam, Laut Marmara, dan Balkan ke Venezia; rute selatan melewati Turkestan-Khorasan menuju Mesopotamia dan Anatolia, dan kemudian ke Antiokia di Selatan Anatolia menuju ke Laut Tengah atau melalui Levant ke Mesir dan Afrika Utara."},{"page_url":"https://sv.wikipedia.org/wiki/Pierre-Louis_Prieur","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dd/Prieur_de_la_Marne.png","page_title":"Pierre-Louis Prieur","context_page_description":"Pierre-Louis Prieur, född den 1 augusti 1756 i Sommesous, död den 31 maj 1827 i Bryssel, var en fransk revolutionspolitiker.\\nPrieur, kallad Prieur de la Marne på grund av att han var advokat i Châlons-sur-Marne, var medlem av konstituerande nationalförsamlingen och av nationalkonventet samt hörde alltid till yttersta vänstern. Hans deklamatoriska talförhet skaffade honom det ordlekande öknamnet le crieur de la Marne. I mars 1793 fick han en plats i säkerhetsutskottet och därefter i välfärdsutskottet, där han fick på sin lott att sörja för arméns och landets proviantering. Misstänkt för att ha haft sin hand med i det anarkistiska upproret mot konventet 1 prairial år III, ställdes han inför krigsrätt, men lyckades hålla sig undan ända till amnestin 4 brumaire år IV. Därefter var han advokat i Paris; han landsförvisades 1816 som \\"kungamördare\\"."},{"page_url":"https://sv.wikipedia.org/wiki/David_Weir","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/67/David_Weir_2014.jpg","page_title":"David Weir","context_page_description":"David Weir, född 10 maj 1970, är en skotsk före detta fotbollsspelare som numera arbetar som tränare. Under sin spelarkarriär spelade han mittback för bland annat Everton och Rangers. Han gjorde även 69 matcher för Skottlands landslag. Han har även spelat för Falkirk FC och Heart of Midlothian FC."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%B5%E3%83%B3%E3%83%9C%E3%83%BC%E3%83%89%E3%83%AD%E3%83%A2%E3%83%BB%E3%83%80%E3%83%BB%E3%83%9E%E3%83%AB%E3%82%B1%E3%82%B9%E3%83%BB%E3%82%B8%E3%83%BB%E3%82%B5%E3%83%97%E3%82%AB%E3%82%A4","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/16/Setor_do_Tiro_com_arco.jpg","page_title":"サンボードロモ・ダ・マルケス・ジ・サプカイ","context_page_description":"サンボードロモ・ダ・マルケス・ジ・サプカイは、ブラジルのリオデジャネイロ中心市街地にあるサンボードロモ。隣接する広場の名から、アポテオセ広場とも称される。毎年リオのカーニバルの際に、サンバ学校がパレードをコンテストで競う会場として、パレードできる長い空間をもつ形で建設された。このパレードは、毎年何万人もの観衆をブラジル内外から集めている。"},{"page_url":"https://de.wikipedia.org/wiki/Auckland_Island","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/26/Cape_Lovitt.JPG","page_title":"Auckland Island","context_page_description":"Auckland Island ist die größte Insel der zu Neuseeland gehörenden Inselgruppe der Aucklandinseln, amtlich Auckland Islands genannt. Als Hauptinsel trägt sie den gleichen Namen wie die Inselgruppe, die 1806 von Kapitän Abraham Bristow bei ihrer Entdeckung zu Ehren William Eden, 1. Baron Auckland Lord Auckland's genannt wurde. Sie ist überdies die größte unbewohnte Insel außerhalb der Polargebiete."},{"page_url":"https://et.wikipedia.org/wiki/Horsti_linnus","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0f/Horst_kasteel_R03.jpg","page_title":"Horsti linnus","context_page_description":"Horsti linnus on keskaegne linnus Belgias Flaami Brabandi provintsis Holsbeeki vallas.\\nSint-Pieters-Rodes asuvat veega ümbritsetud linnust peetakse üheks kaunimaks keskaegseks lossiks Belgias, kõrvuti Bouilloni, Beerseli, Corroy', Genti, Lavaux' ja Vêves'i linnusega.\\n1263. aastal omandas linnuse Jean de Horst. Hiljem on see osaliselt ehitatud ümber lossiks.\\nLinnus on arhitektuurimälestisena kaitse all alates 1971. aastast."},{"page_url":"https://it.wikipedia.org/wiki/Sindaci_di_Genova","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0b/Marco_Doria.jpg","page_title":"Sindaci di Genova","context_page_description":"Elenco dei sindaci, podestà e commissari della città di Genova a partire dall'annessione al Regno di Sardegna del 1815."},{"page_url":"https://en.wikipedia.org/wiki/William_S._Harley","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/83/William_Sylvester_Harley.jpg","page_title":"William S. Harley","context_page_description":"William Sylvester Harley was an American mechanical engineer and businessman. He was one of the co-founders of the Harley-Davidson Motor Company."},{"page_url":"https://fr.wikipedia.org/wiki/Walter_John_Montagu-Douglas-Scott","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2f/Walter_John_Montagu_Douglas_Scott%2C_8th_Duke_of_Buccleuch.jpg","page_title":"Walter John Montagu-Douglas-Scott","context_page_description":"Walter John Montagu-Douglas-Scott, 8ᵉ duc de Buccleuch et 10ᵉ duc de Queensberry, est un homme politique et un pair conservateur britannique."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%86%D1%81%D0%BA%D1%96%D1%8F","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/98/Castello_Aragonese_da_lontano.JPG","page_title":"Іскія","context_page_description":"Іскія — муніципалітет в Італії, у регіоні Кампанія, метрополійне місто Неаполь.\\nІскія розташована на відстані близько 180 км на південний схід від Рима, 27 км на захід від Неаполя.\\nНаселення — 19 877 осіб.\\nЩорічний фестиваль відбувається 5 березня. Покровитель — San Giovan Giuseppe della Croce."},{"page_url":"https://pt.wikipedia.org/wiki/The_Mystery_of_13","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/72/The_Mystery_of_13_%281919%29_-_Ford.JPG","page_title":"The Mystery of 13","context_page_description":"The Mystery of 13 é um seriado estadunidense de 1919, no gênero drama e ação, dirigido por Francis Ford, em 15 capítulos. Foi estrelado por Francis Ford e Rosemary Theby e produzido pela Burston Films Inc, estreando em agosto de 1919."},{"page_url":"https://en.wikipedia.org/wiki/Kin_On_stop","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2c/HK_Tuen_Mun_LR_Kin_On_Stop_Pui_To_Road.JPG","page_title":"Kin On stop","context_page_description":"Kin On is an at-grade MTR Light Rail stop located at the junction of Pui To Road and Kin On Street in Tuen Mun District. It began service on 18 September 1988 and belongs to Zone 2. It serves nearby industrial buildings."},{"page_url":"https://en.wikipedia.org/wiki/St._John_the_Baptist_Catholic_Church_(Menominee,_Michigan)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/06/St._John_the_Baptist_Catholic_Church_Menominee_Michigan.jpg","page_title":"St. John the Baptist Catholic Church (Menominee, Michigan)","context_page_description":"St. John the Baptist Catholic Church, now used as the Menominee County Historical Museum, is a historic church at 904 11th Avenue in Menominee, Michigan. It was added to the National Register of Historic Places in 1995 and designated a Michigan State Historic Site in 1981."},{"page_url":"https://en.wikipedia.org/wiki/Ivan_Sylvester_Rodrigues","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a0/URI_The_Surgical_Strike01.jpg","page_title":"Ivan Sylvester Rodrigues","context_page_description":"Ivan Rodrigues is a polyglot film and theatre actor based in Mumbai, India."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9B%D0%B5%D0%B2%D0%B8%D1%86%D0%BA%D0%B8%D0%B9,_%D0%AF%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e2/Jan_Nepomucen_Lewicki%2C_Ubiory_szlachty.jpg","page_title":"Левицкий, Ян","context_page_description":"Ян Непомуцен Леви́цкий — польский живописец XIX века, участник восстания 1830 года."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%9A%D0%B0%D0%BA%D1%82%D0%BE%D0%B2%D0%B8%D0%BA_(%D0%90%D1%99%D0%B0%D1%81%D0%BA%D0%B0)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/Kaktovik%2C_Alaska%2C_DEW_Line_Site.jpg","page_title":"Кактовик (Аљаска)","context_page_description":"Кактовик град је у америчкој савезној држави Аљаска."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9D%D0%B8%D0%B7%D1%8C%D0%BA%D0%B8%D0%B9_%D0%A2%D0%B0%D1%83%D0%B5%D1%80%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/55/Niedere_Tauern.png","page_title":"Низький Тауерн","context_page_description":"Низький Тауерн, гірський хребет в Альпах, в Австрії.\\nДовжина близько 100 км.\\nВисота до 2863 м.\\nСкладений гранітами, гнейсами, сланцями, вапняками. Альпійський рельєф.\\nДо висоти 2000 м — ліси з ялиці, модрини."},{"page_url":"https://eu.wikipedia.org/wiki/Doln%C3%AD_Rychnov","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c0/Dolni_Rychnov_SO_CZ.png","page_title":"Dolní Rychnov","context_page_description":"Dolní Rychnov Txekiar Errepublikako udalerri bat da. 1.337 biztanle ditu eta 5,09 kilometro koadroko azalera. Sokoloveko barrutian dago."},{"page_url":"https://nl.wikipedia.org/wiki/Lembeke","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a5/Westermolen_lembeke.jpg","page_title":"Lembeke","context_page_description":"Lembeke is een dorp in de Belgische provincie Oost-Vlaanderen en is sinds 1977 een deelgemeente van Kaprijke. Het dorp telt iets meer dan 3500 inwoners, waarmee het de grootste kern van de gemeente Kaprijke is."},{"page_url":"https://es.wikipedia.org/wiki/Marcela_Isabel_Jabbaz_Churba","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a6/Marcela_Entrevista.png","page_title":"Marcela Isabel Jabbaz Churba","context_page_description":"Marcela Isabel Jabbaz Churba es una socióloga argentina. Ha sido profesora en la Universidad Nacional de Buenos Aires e investigadora del Consejo Nacional de Investigaciones Científicas y Tecnológicas de Argentina, es experta en estudios de género, en área de mujeres y políticas de igualdad. En los últimos años, combina la investigación con el trabajo de profesora de Metodología e Investigación en la Universidad de Valencia, ​ así como de coordinadora en distintos grados en la Facultad de Ciencias Sociales.​ Además de las cuestiones académicas es activista feminista, participando en organizaciones como la Federació de Dones Progressistes​ de la Comunidad Valenciana."},{"page_url":"https://zh.wikipedia.org/wiki/%E6%B1%BD%E8%BB%8A%E7%A8%AE%E9%A1%9E","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fa/Ford_Escape_P4220633.jpg","page_title":"汽車種類","context_page_description":"汽車種類即自從進入多種類汽車的時代後，依據車輛底盤、大小、功用、性能、售價、特性、排氣量，所給予汽車相當主觀的區分名稱。但是，並非代表所有的汽車種類皆有在各個國家出售或使用相同的名稱。因為，即使是相同的汽車也不一定被分類至該區域內。\\n例如在日本的「乘用車」字面意思相當於中國所說的「載客車」，但日本的乘用車其實只是轎車，中國的載客車是同時指轎車和客車的。"},{"page_url":"https://de.wikipedia.org/wiki/L%C3%A1szl%C3%B3_T%C5%91k%C3%A9s","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c8/T%C5%91k%C3%A9s_L%C3%A1szl%C3%B3.JPG","page_title":"László Tőkés","context_page_description":"László Tőkés ist ein Angehöriger der ungarischen Minderheit in Rumänien und evangelisch-reformierter Geistlicher, der als Auslöser für die rumänische Revolution gilt. Er ist emeritierter Bischof der Ungarischen Reformierten Kirche und Präsident des Ungarischen Nationalrates in Siebenbürgen. Derzeit ist er Mitglied des Europäischen Parlaments für die Demokratische Union der Ungarn in Rumänien."},{"page_url":"https://fr.wikipedia.org/wiki/Vincennes_(Indiana)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/Flag_of_Vincennes%2C_Indiana.png","page_title":"Vincennes (Indiana)","context_page_description":"Vincennes est une ville de l'Indiana aux États-Unis et le siège du comté de Knox, dont la population était de 18 423 habitants lors du recensement de 2010."},{"page_url":"https://ca.wikipedia.org/wiki/Mahabad","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d7/Mahabad-Dec_2006.JPG","page_title":"Mahabad","context_page_description":"Mahabad és una ciutat de l'Iran al nord-oest del país, capital d'un comtat de la província de l'Azerbaidjan Occidental. La seva població era de 133.324 habitants al cens del 2006. Està situada al sud del llac Urmia en una vall estreta. Es pensa que el nom podria ser una derivació d'un nom antic hurrita adaptat al persa i voldria dir originalment \\"Vila de la lluna\\"; la paraula persa Mah, emparentada també al kurd mang, vol dir Mèdia i el nom doncs equivaldria a Vila de Mèdia. El seu nom turc és Sawadj o Sawadj-bulak, que vol dir \\"font d'aigua fresca\\". La seva regió és agrícola i fèrtil però la ciutat està poc desenvolupada en relació a altres ciutats. La població és de majoria kurda. Hi te seu la universitat islàmica Azad de Mahabad. Abans de 1935 portava el nom turc que li fou canviat sota Rida Shah."},{"page_url":"https://azb.wikipedia.org/wiki/%DA%A9%D9%84%DB%8C%D9%86%D8%AA_%D8%B1%D9%88%D8%A8%D8%B1%D8%AA%D8%B3_(%D8%B3%DB%8C%D8%A7%D8%B3%D8%AA%DA%86%DB%8C)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f3/Clint_Roberts.png","page_title":"کلینت روبرتس (سیاستچی)","context_page_description":"کلینت روبرتس آمریکالی سیاستچی، جومهوری حزبینین عوضوو و جنوب داکوتا ایالتین سناتور ایدی. ۱۹۳۵ ایلینده دۆنیایا گؤز آچیب و ۲۰۱۷ میلادی ایلینده حیاتین دَییشدی."},{"page_url":"https://pt.wikipedia.org/wiki/G%C3%AAnesis_4","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0d/Book_of_Genesis_Chapter_4-5_%28Bible_Illustrations_by_Sweet_Media%29.jpg","page_title":"Gênesis 4","context_page_description":"Gênesis 4 é o quarto capítulo de Gênesis na Bíblia Hebraica e no Antigo Testamento da Bíblia cristã. Incluído na coleção dos livros da Torá compilados por Moisés."},{"page_url":"https://sh.wikipedia.org/wiki/Krvavi_Bo%C5%BEi%C4%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a7/Foto_Fiume.jpg","page_title":"Krvavi Božić","context_page_description":"Krvavi Božić, tzv. Pet riječkih dana, naziv je rata u Rijeci za uspostavu Slobodne Države Rijeka koji je trajao od 24. do 29. XII. 1920. godine."},{"page_url":"https://vi.wikipedia.org/wiki/Airbus_A340","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/59/Lufthansa_Technik_Hamburg_-_Airbus_A340.jpg","page_title":"Airbus A340","context_page_description":"Airbus A340 là loại máy bay chở khách thân rộng,4 động cơ, tầm xa, hai lối đi, một tầng đầu tiên của Châu Âu và cũng là đầu tiên trên thế giới được hãng Airbus chế tạo, công ty con của EADS.A340 có thể mang từ 261 đến 380 hành khách, với quãng đường bay được từ 6.700 đến 9.000 hải lý.Nó có thiết kế tương tự như loại máy bay A330 hai động cơ nhưng lần này lại sử dụng đến bốn động cơ.Phiên bản A340 ban đầu sử dụng chung phần thân và cánh của A330, trong khi các mẫu sau đó dài hơn và có cánh lớn hơn."},{"page_url":"https://arz.wikipedia.org/wiki/%D8%A7%D9%84%D9%8A%D8%B3%D8%A7_%D8%AC%D8%A7%D9%84%D9%8A%D8%A7%D9%85%D9%88%DA%A4%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d6/Alisa_Galliamova_Satka_2018.jpg","page_title":"اليسا جالياموڤا","context_page_description":"اليسا جالياموڤا لاعبه شطرنج من روسيا."},{"page_url":"https://gl.wikipedia.org/wiki/The_Patriot","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/The_patriot.svg","page_title":"The Patriot","context_page_description":"The Patriot é un filme estadounidense dirixido por Roland Emmerich que foi estreado no 2000."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%A2%D0%B0%D1%82%D1%98%D0%B0%D0%BD%D0%B0_%D0%9D%D0%B8%D0%BA%D0%BE%D0%BB%D0%B0%D1%98%D0%B5%D0%B2%D0%BD%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9b/GrandDuchessTatianaformal1914.jpg","page_title":"Татјана Николајевна","context_page_description":"Татјана Николајевна била је руска велика кнегиња, друга кћерка императора Николаја II и његове жене Александре Фјодоровне."},{"page_url":"https://fr.wikipedia.org/wiki/Saint-Paul-en-Chablais","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2d/Coll%C3%A8ge_du_Gavot_%C3%A0_Saint-Paul-en-Chablais.JPG","page_title":"Saint-Paul-en-Chablais","context_page_description":"Saint-Paul-en-Chablais est une commune française située dans le département de la Haute-Savoie, en région Auvergne-Rhône-Alpes.\\nSaint-Paul se situe approximativement au centre du « pays de Gavot », plateau dominant la rive sud du lac Léman, dont il est également la commune la plus peuplée. Après un long déclin démographique amorcé au milieu du XIXᵉ siècle, la tendance s'est inversée à partir des années 1960, notamment grâce au développement du tourisme et à la prospérité de la région lémanique. Au début du XXIᵉ siècle, Saint-Paul reste un village rural, mais est également devenu une commune périurbaine, proche des villes d'Évian-les-Bains et de Thonon-les-Bains. La croissance démographique est forte, et la plus grande partie de la population active travaille en dehors de la commune."},{"page_url":"https://eo.wikipedia.org/wiki/Spi%C5%A1sk%C3%A1_Star%C3%A1_Ves","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/53/SpisskaStaraVes11Slovakia4.JPG","page_title":"Spišská Stará Ves","context_page_description":"Spišská Stará Ves, hungare Szepesófalu, germane Altendorf pole Spiska Wies) estas urbo en Slovakio, en Regiono Prešov, en Distrikto Kežmarok."},{"page_url":"https://fa.wikipedia.org/wiki/%D9%85%D8%A7%D8%AA%D8%A7%D9%BE%D9%88%DB%8C%D8%B3%D8%AA_%D8%B3%D9%86%D8%AA%D8%B1%D8%8C_%D9%85%D8%A7%D8%B3%D8%A7%DA%86%D9%88%D8%B3%D8%AA","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d9/Center_School%2C_Mattapoisett_MA.jpg","page_title":"ماتاپویست سنتر، ماساچوست","context_page_description":"ماتاپویست سنتر یک منطقهٔ مسکونی در ایالات متحده آمریکا است که در شهرستان پلیموث، ماساچوست واقع شده‌است. ماتاپویست سنتر ۱۱٫۵ کیلومتر مربع مساحت و ۲٬۹۱۵ نفر جمعیت دارد."},{"page_url":"https://ca.wikipedia.org/wiki/Testimonis_del_Llibre_de_Morm%C3%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/58/John_Whitmer.jpg","page_title":"Testimonis del Llibre de Mormó","context_page_description":"Els Testimonis del Llibre de Mormó són un grup de contemporanis a Joseph Smith, que van dir que van veure les planxes d'or des de les quals Smith diu que va traduir el Llibre de Mormó. Els testimonis més significatius són els tres Testimonis i els Vuit Testimonis, que cadascun va signar un testimoniatge en 1830 inclòs en el Llibre de Mormó. Hi ha diverses persones que van dir veure les planxes d'or, els testimoniatges del qual van ser també registrats."},{"page_url":"https://en.wikipedia.org/wiki/History_of_the_ICC_Men%27s_T20_World_Cup","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/05/T20_final_2009.jpg","page_title":"History of the ICC Men's T20 World Cup","context_page_description":"The ICC Men's T20 World Cup was first held in 2007. It was first decided that every two years an ICC T20 World Cup tournament is to take place, except in the event of an ICC Cricket World Cup being scheduled in the same year, in which case it will be held the year before. The first tournament was in 2007 in South Africa where India defeated Pakistan in the final. Two Associate teams had played in the first tournament, selected through the 2007 ICC World Cricket League Division One, a 50-over competition. In December 2007 it was decided to hold a qualifying tournament with a 20-over format to better prepare the teams. With six participants, two would qualify for the 2009 World Twenty20 and would each receive $250,000 in prize money. The second tournament was won by Pakistan who beat Sri Lanka by 8 wickets in England on 21 June 2009. The 2010 ICC World Twenty20 tournament was held in West Indies in May 2010, where England defeated Australia by 7 wickets. The 2012 ICC World Twenty20 was won by the West-Indies, by defeating Sri Lanka at the finals. For the first time, a host nation competed in the final of the ICC World Twenty20."},{"page_url":"https://he.wikipedia.org/wiki/%D7%9E%D7%9E%D7%9C%D7%9B%D7%AA_%D7%93%D7%99%D7%99%D7%9F","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/47/%E9%8E%8F%E9%87%91%E6%8E%B3%E6%8E%A0%E9%93%9C%E6%89%A3%E9%A5%B0.jpg","page_title":"ממלכת דיין","context_page_description":"ממלכת דְייֵן הייתה ממלכה עתיקה שהוקמה על ידי בני הדְייֵן, קבוצה אתנית של שבטים ילידים שאינם סינים, שהתמחו בעיבוד מתכות, ושמשכנם היה סביב מישור אגם דיין במרכז צפון יונאן בסין משלהי תקופת האביב והסתיו עד שושלת האן המזרחית. הדיין נדחקו בהדרגה ולבסוף נטמעו בתרבות הסינית של בני ההאן כאשר שושלת האן התפשטה בסדרה של מסעות צבאיים לעבר יונאן של ימינו. הכיבוש והסיפוח של ממלכת דיין על ידי שושלת האן בשנת 109 לפנה\\"ס הובילו בסופו של דבר להקמת המחוז הצבאי יִיג'וֹאוּ."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkm%C3%A4ler_in_Eschwege","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c3/Marktplatz_16_Eschwege_20180209_001.jpg","page_title":"Liste der Kulturdenkmäler in Eschwege","context_page_description":"Die folgende Liste enthält die in der Denkmaltopographie ausgewiesenen Kulturdenkmäler auf dem Gebiet der Stadt Eschwege, Werra-Meißner-Kreis, Hessen.\\nHinweis: Die Reihenfolge der Denkmäler in dieser Liste orientiert sich zunächst an Stadtteilen und anschließend der Anschrift, alternativ ist sie auch nach der Bezeichnung oder der Bauzeit sortierbar.\\nGrundlage ist die Veröffentlichung der hessischen Denkmalliste, die auf Basis des Denkmalschutzgesetzes vom 5. September 1986 erstmals erstellt und seither laufend ergänzt wurde.\\nDie Kulturdenkmäler der Stadtteile sind in eigenen Listen dargestellt:\\nListe der Kulturdenkmäler in Albungen\\nListe der Kulturdenkmäler in Eltmannshausen\\nListe der Kulturdenkmäler in Niddawitzhausen\\nListe der Kulturdenkmäler in Niederdünzebach\\nListe der Kulturdenkmäler in Niederhone\\nListe der Kulturdenkmäler in Oberdünzebach\\nListe der Kulturdenkmäler in Oberhone"},{"page_url":"https://cs.wikipedia.org/wiki/Melantrich%C5%AFv_d%C5%AFm","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/0e/Eckert10.jpg","page_title":"Melantrichův dům","context_page_description":"Melantrichův dům v Praze na Starém Městě byl významnou renesanční stavební a historickou památkou. V domě sídlil tiskař a humanista Jiří Melantrich z Aventina a jeho tiskárna. Dům byl stržen roku 1893 při asanaci, dochoval se z něj pouze portál a několik kamenických prvků."},{"page_url":"https://fr.wikipedia.org/wiki/Karolina_Bosiek","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9a/Ice_Arena_Tomaszow_Mazowiecki._First_in_Polnad.jpg","page_title":"Karolina Bosiek","context_page_description":"Karolina Bosiek, née le 20 février 2000 est une patineuse de vitesse polonaise."},{"page_url":"https://de.wikipedia.org/wiki/Luch_(Ort)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0d/Ivanovo_Obl_Lukh_asv2018-08_img06.jpg","page_title":"Luch (Ort)","context_page_description":"Luch ist eine Siedlung städtischen Typs und ehemalige Stadt in der Oblast Iwanowo in Russland mit 3024 Einwohnern."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%B2%D8%A8%D8%A7%D9%86_%D8%AA%D8%B1%DA%A9%DB%8C_%D8%B9%D8%AB%D9%85%D8%A7%D9%86%DB%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/Ali_Beheading_Nadr_ibn_al-Harith_in_the_Presence_of_the_Prophet_Muhammad._Miniature_from_volume_4_of_a_copy_of_Mustafa_al-Darir%E2%80%99s_Siyar-i-Nabi._Istanbul%3B_c._1594_The_David_Col..jpg","page_title":"زبان ترکی عثمانی","context_page_description":"زبان ترکی عثمانی یا زبان عثمانی زبان رایج و غالب در امپراتوری عثمانی بود.این زبان شمار فراوانی وام‌واژهٔ عربی و فارسی داشت و با الفبای عربی نوشته می‌شد."},{"page_url":"https://es.wikipedia.org/wiki/Adamuz","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f1/Ayuntamiento_de_Algallar%C3%ADn.jpg","page_title":"Adamuz","context_page_description":"Adamuz es un municipio español situado en la provincia de Córdoba entre Sierra Morena y el Guadalquivir, en la comunidad autónoma de Andalucía. El municipio se encuentra en la comarca del Alto Guadalquivir​ y pertenece al partido judicial de Montoro.​ Sus coordenadas geográficas son 38º 01' N 4º 31' O.​ Se halla situado a una altitud de 242 msnm​ y a unos 32 km de la capital de provincia, Córdoba. La extensión de su término municipal es de 334,7 km².​ En el año 2018 contaba con una población de 4.185 habitantes.​"},{"page_url":"https://it.wikipedia.org/wiki/Grattacieli_pi%C3%B9_alti_di_Seattle","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a4/Wells_Fargo_Center_%28Seattle%29.jpg","page_title":"Grattacieli più alti di Seattle","context_page_description":"Questa è una lista dei grattacieli più alti di Seattle ordinati per altezza.\\nSeattle, Washington, la città più popolosa della regione nord-occidentale del Pacifico del Nord America, ha 116 grattacieli completati alti oltre 73 metri, di cui 42 sono più alti di 120 metri.\\nL'edificio più alto di Seattle è il Columbia Center di 76 piani, alto 286 metri, completato nel 1985. Attualmente è il 29 ° edificio più alto degli Stati Uniti e l'edificio più alto nello stato di Washington. Il secondo grattacielo più alto della città e dello stato è la 1201 Third Avenue, alto 235 metri e completato nel 1988. I 20 edifici più alti di Washington si trovano tutti a Seattle."},{"page_url":"https://zh.wikipedia.org/zh-tw/PowerShot","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f2/Canon_ixus_700.jpg","page_title":"佳能PowerShot系列","context_page_description":"佳能博秀是佳能旗下的數位相機系列。"},{"page_url":"https://sh.wikipedia.org/wiki/Tirana","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d2/Druga_strana.JPG","page_title":"Tirana","context_page_description":"Tirana je glavni i najveći grad Albanije. Po zvaničnim procenama ima 421.286 stanovnika. Tirana je osnovana 1614, a postala je glavni grad 1920 godine.\\nTirana se nalazi na koordinatama 41,33° sever, 19,82° istok, u istoimenoj oblasti i okrugu. Prosečna nadmorska visina iznosi 90 m.\\nTirana se nalazi na reci Išm, i glavni je albanski industrijski i kulturni centar. Glavne industrijske grane su poljoprivredna, tekstilna, farmaceutska i metalska. Tirana je doživela veliki rast i uspostavila mnogo novih industrijskih grana od 1920-ih.\\nTirana trenutno pokušava da razvije turističku industriju, mada su ovi napori otežani zbog političke nestabilnosti."},{"page_url":"https://ca.wikipedia.org/wiki/Frontera_entre_l%27%C3%8Dndia_i_Sri_Lanka","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8d/AdamsBridge02-NASA.jpg","page_title":"Frontera entre l'Índia i Sri Lanka","context_page_description":"La frontera entre l'Índia i Sri Lanka és totalment marítima i està situat a l'Oceà Índic. Anteriorment els dos territoris eren colònies de l'Imperi Britànic, i la qüestió es planteja en la independència el 1947 del Raj britànic i de Ceilan l'any següent.\\nEls dos països estan separats per l'estret de Palk amb una amplada que varia des de 64 fins a 137 quilòmetres. Ambdós països comparteixen el Pont d'Adam, arxipèlag consisteix en bancs de sorra amb d'un costat l'illa índia de Pamban i de l'altra l'illa de Sri Lanka de Mannar.\\nEls dos països en disputen l'estatut de l'illa de Katchatheevu, finalment atorgada al juny de 1974 a Sri Lanka. En març de 1976 les fronteres foren reconegudes durant tot el golf de Mannar i l'estret de Palk; al juliol de 1976, les coordenades de la unió amb les Maldives s'ha ajustat a 04° 47.04′ N, 77° 01.40′ E en ple mar de les Lacadives.\\nL'acord sobre la delimitació de la zona marítima va entrar en vigor l'1 de setembre de 1976."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9A%D0%BB%D0%B5%D1%82%D0%BE%D1%87%D0%BD%D0%BE%D0%B5_%D1%8F%D0%B4%D1%80%D0%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6c/HeLa_cells_stained_with_Hoechst_33258.jpg","page_title":"Клеточное ядро","context_page_description":"Кле́точное ядро́ — окружённый двумя мембранами компартмент эукариотической клетки. Обычно в клетках эукариот имеется одно ядро, однако некоторые типы клеток, например, эритроциты млекопитающих, не имеют ядра, а другие содержат несколько ядер.\\nВ ядре заключена бо́льшая часть генетического материала клетки, представленного несколькими линейными длинными молекулами ДНК, связанного с белками — хромосомами. Гены, локализованные в хромосомах, составляют ядерный геном. Ядро поддерживает целостность генов, а входящие в его состав белки регулируют клеточные процессы посредством управления экспрессией генов, поэтому ядро является, по сути, контролирующим центром клетки. К основным структурам, из которых состоит ядро, относят ядерную оболочку — двойную мембрану, окружающую ядро и изолирующую его от цитоплазмы, а также ядерный матрикс — сеть филаментов, которая обеспечивает механическую поддержку ядра, подобно цитоскелету в цитоплазме.\\nПоскольку ядерная оболочка непроницаема для крупных молекул, для регуляции транспорта молекул через ядерную оболочку служат ядерные поры."},{"page_url":"https://it.wikipedia.org/wiki/Le_Mesnil-Raoult","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ac/Le_Mesnil-Raoult_-_%C3%89glise_Notre-Dame.jpg","page_title":"Le Mesnil-Raoult","context_page_description":"Le Mesnil-Raoult è un comune francese di 382 abitanti situato nel dipartimento della Manica nella regione della Normandia."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%A7%D9%84%D8%AD%D9%8A%D8%A7%D8%A9_%D8%A7%D9%84%D8%A8%D8%B1%D9%8A%D8%A9_%D9%81%D9%8A_%D8%AC%D8%A8%D8%A7%D9%84%D8%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4c/IMG_0029-Trachelium_caeruleum.jpg","page_title":"الحياة البرية في جبالة","context_page_description":"تقع جبالة في شمال غرب المغرب وتتميز الحياة البرية في جبالة بتنوعها و غناها الكبير و ذلك عائد لتنوعها المناخي و لموقعها الفريد بين قارتي أفريقيا و أوروبا الأمر الذي جعلها محطة للأنواع المهاجرة بين الشمال و الجنوب و منحها تنوعا فريدا من حيث نوعية الغطاء النباتي و بالتالي تنوعا من حيث الفونا المستقرة بالمنطقة و قد ساعدها على هذا التنوع تنوع التضاريس في المنطقة"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D0%BE%D0%BA_%D1%84%D1%80%D0%B0%D0%BD%D1%86%D1%83%D0%B7%D1%81%D0%BA%D0%B8%D1%85_%D1%81%D1%8B%D1%80%D0%BE%D0%B2","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fe/Saint-marcellin_%28fromage_fran%C3%A7ais%29.jpg","page_title":"Список французских сыров","context_page_description":"Список сыров, производимых во Франции. По некоторым данным, количество сортов сыра, производимых во Франции, — более 500.\\nНазвание\\nВ списке приводится русское название сыра со ссылкой на статью и оригинальное французское название. Маркировка AOC означает, что данный сорт сыра имеет Appellation d’origine contrôlée, Исконное контролируемое название. «Исконное контролируемое название может быть присвоено сырам, отвечающим требованиям действующего законодательства. Производство молока, служащего сырьём, и весь процесс изготовления сыра должны точно соответствовать местным установившимся традициям и рецептам.» То есть сыр, имеющий соответствующее французское название, может быть изготовлен только в том районе Франции, где этот сыр изготовляли исторически. В таблицу внесены все 45 сортов сыра, получивших маркировку AOC на декабрь 2009 года. Первым AOC получил сыр Рокфор в 1925 году, последним — сыр Риготт де Кондриё 13 января 2009 года.\\nТип сыра\\nВ колонку «тип сыра» объединена классификация по твёрдости и по внешнему виду.\\nОсобенности изготовления и закваска"},{"page_url":"https://sv.wikipedia.org/wiki/Lavagna","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/00/Lavagna_e_Chiavari_da_Santa_Giulia-panorama-1.jpg","page_title":"Lavagna","context_page_description":"Lavagna är en ort och kommun i storstadsregionen Genua, innan 2015 provinsen Genova, i regionen Ligurien i Italien. Kommunen hade 12 566 invånare."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%93%D1%83%D1%97%D0%BC%D0%B0%D1%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/ParroquiaFatima.jpg","page_title":"Гуїмар","context_page_description":"Гуїмар — муніципалітет в Іспанії, у складі автономної спільноти Канарські острови, у провінції Санта-Крус-де-Тенерифе, на острові Тенерифе. Населення — 17 852 особи.\\nМуніципалітет розташований на відстані близько 1780 км на південний захід від Мадрида, 23 км на південний захід від Санта-Крус-де-Тенерифе.\\nНа території муніципалітету розташовані такі населені пункти:\\nАгерче: 0 осіб\\nЛос-Барранкос: 61 особа\\nЛа-Калета: 276 осіб\\nЧимахе: 37 осіб\\nЕль-Ескобональ: 962 особи\\nГуїмар: 12331 особа\\nЛомо-де-Мена: 250 осіб\\nЛа-Медіда: 237 осіб\\nПахара: 125 осіб\\nПуертіто-де-Гуїмар: 2779 осіб\\nЛа-Пуенте: 95 осіб\\nПунта-Прієта: 145 осіб\\nЕль-Сокорро: 311 осіб\\nЕль-Табладо: 236 осіб\\nБаландра-Лос-Пікос: 7 осіб\\nІсанья: 0 осіб"},{"page_url":"https://fr.wikipedia.org/wiki/James_Brydges_(3e_duc_de_Chandos)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bc/Chandos_House.jpg","page_title":"James Brydges (3e duc de Chandos)","context_page_description":"James Brydges, 3ᵉ duc de Chandos PC, titré vicomte Wilton de la naissance jusqu'à 1744, et marquis de Carnarvon de 1744 à 1771, était un pair et un politicien britannique."},{"page_url":"https://vi.wikipedia.org/wiki/S%C3%A2n_v%E1%BA%ADn_%C4%91%E1%BB%99ng_%C3%81nh_s%C3%A1ng_(Lisbon)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1b/LuzLissabon.jpg","page_title":"Sân vận động Ánh sáng (Lisbon)","context_page_description":"Sân vận động Ánh sáng, tên chính thức là Sân vận động Thể thao Lisboa e Benfica, là một sân vận động đa năng nằm ở Lisbon, Bồ Đào Nha. Nó được dùng chủ yếu để tổ chức các trận đấu bóng đá, là sân nhà của câu lạc bộ Bồ Đào Nha S.L. Benfica.\\nMở cửa vào ngày 25 tháng 10 năm 2003 với trận đấu giao hữu giữa Benfica và câu lạc bộ Nacional của Uruguay, sân đã thay thế sân vận động Ánh sáng ban đầu có sức chứa 120.000 chỗ ngồi. Sức chứa chỗ ngồi đã giảm xuống còn 65.647 chỗ ngồi và hiện tại ở mức 64.642 chỗ ngồi. Sân vận động được thiết kế bởi HOK Sport Venue Event và có chi phí xây dựng là 162 triệu euro.\\nĐây là sân vận động được UEFA xếp hạng 4 và là một trong những sân vận động có sức chứa lớn nhất châu Âu, sân này đã tổ chức một số trận đấu ở UEFA Euro 2004, kể cả trận chung kết, cùng với trận chung kết UEFA Champions League 2014 và trận chung kết 2020. Hơn nữa, đây là nơi tổ chức lễ công bố Bảy kỳ quan thế giới mới vào năm 2007. Vào tháng 10 năm 2014, nó được bầu chọn là sân vận động đẹp nhất châu Âu trong một cuộc thăm dò ý kiến của tờ báo Pháp L'Équipe.\\nVào sinh nhật thứ 15, Sân vận động Ánh sáng đã đón nhận hơn 17 triệu khán giả."},{"page_url":"https://el.wikipedia.org/wiki/%CE%97%CF%81%CE%B1%CE%BA%CE%BB%CE%AE%CF%82_(%CE%BC%CF%85%CE%B8%CE%BF%CE%BB%CE%BF%CE%B3%CE%AF%CE%B1)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/69/Ivan_Akimov_-_Herakles_on_the_crossroads.jpeg","page_title":"Ηρακλής (μυθολογία)","context_page_description":"Ο Ηρακλής ή Αλκαίος ή Αλκείδης ήταν αρχαίος μυθικός ήρωας, θεωρούμενος ως ο μέγιστος των Ελλήνων ηρώων. Γεννήθηκε στη Θήβα και ήταν γιος του Δία και της Αλκμήνης, κόρης της Αναξώς, κόρης του Αλκαίου και της Αστυδάμειας."},{"page_url":"https://sv.wikipedia.org/wiki/Olavi_Lind%C3%A9n","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/55/Fiskars_convenience_cutter.jpg","page_title":"Olavi Lindén","context_page_description":"Olavi Lindén, född 1946, är en finländsk industriformgivare och instrumentbyggare.\\nOlavi Lindén blev ingenjör 1970. Han började efter examen arbeta på Fiskars som assistent till formgivaren Olof Bäckström och ansvarig för produktutveckling av saxar. Han var från 1984 och fram till 2000-talet produktutvecklingschef och chefsdesigner på Fiskars Consumer Oy Ab.\\nHan har formgivit saxar och olika trädgårdsredskap på Fiskars. Hans första egna formgivna produkt var en saxslip, som patenterades 1979. Han började som ung att bygga musikinstrument som akustiska basgitarrer och kontrabasar, vilka nu också tillverkas i hans företag Linden Instruments i Åbo.\\nLindén fick det finländska Statliga priset för konstindustri 2002 och Kaj Franck-priset 2006."},{"page_url":"https://ce.wikipedia.org/wiki/%D0%9E%D0%BD%D0%B3%D0%BB%D1%8C%D0%B5%D1%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ef/Ongli%C3%A8res%2C_mairie_-_img_43883.jpg","page_title":"Онгльер","context_page_description":"Онгльер — Францин гӀала-коммуна, лаьтта Бургунди — Франш-Конте регионехь. Коммунан департамент — Юра. Кхузахь климат барамехь ю, аьхка йовха хуьлу, ткъа Ӏа барамехь-шийла хуьлу. ГӀалин бахархой французаш бу. Официалан Французийн мотт бу."},{"page_url":"https://et.wikipedia.org/wiki/Kaltsium","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/96/Calcium_unter_Argon_Schutzgasatmosph%C3%A4re.jpg","page_title":"Kaltsium","context_page_description":"Kaltsium on keemiline element järjenumbriga 20, pehme, halli värvusega leelismuldmetall, mida looduses vabal kujul ei esine. Kaltsiumiioon on keemilistes ühendites tüüpiliselt oksüdatsiooniastmega 2+.\\nSelle elemendi avastas inglise keemik Humphry Davy 1808. aastal.\\nKaltsium on maakoores massi poolest levikult viies element hapniku, räni, alumiiniumi ja raua järel. Cl⁻, Na⁺, Mg²⁺ ja SO₄²⁻ järel on Ca²⁺ viies lahustunud ioon merevees nii massi kui ka molaarsuse poolest.\\nKaltsium on elusorganismidele väga oluline mineraalaine, eriti oluline on see raku füsioloogias, kus kaltsiumiiooni liikumine tsütoplasmasse ja sellest välja toimib olulise signaalina mitmetes rakuprotsessides. Kuna kaltsium on oluline mineraal luude, hammaste ning kodade ehituses on see massi poolest levinuim metall paljudes loomades."},{"page_url":"https://de.wikipedia.org/wiki/Zappendorf","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ae/ZappendorfM%C3%BChle2.JPG","page_title":"Zappendorf","context_page_description":"Zappendorf ist eine Ortschaft der Einheitsgemeinde Salzatal im Saalekreis in Sachsen-Anhalt in Deutschland."},{"page_url":"https://ja.wikipedia.org/wiki/%E4%B8%AD%E5%9B%BD%E3%81%AE%E5%AE%97%E6%95%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/08/Chinese-style_minaret_of_the_Great_Mosque.jpg","page_title":"中国の宗教","context_page_description":"中国の宗教では、中国大陸において誕生、発達ないしは伝来した宗教について詳述する。"},{"page_url":"https://bg.wikipedia.org/wiki/%D0%A0%D0%B0%D1%85%D0%BE%D0%BD%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7e/Thasos_Miller_%281889%29_C.jpg","page_title":"Рахони","context_page_description":"Рахо̀ни е село на остров Тасос, Егейска Македония, Гърция. Селото има 365 жители. Старото име на селото е Вулга̀ро или Булгаро."},{"page_url":"https://sh.wikipedia.org/wiki/Bourmont","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/69/Bourmont_%28Haute-Marne%29.jpg","page_title":"Bourmont","context_page_description":"Burmon je naselje i opština u severoistočnoj Francuskoj u regionu Šampanj-Arden, u departmanu Gornja Marna koja pripada prefekturi Šomon.\\nPo podacima iz 1999. godine u opštini je živelo 533 stanovnika, a gustina naseljenosti je iznosila 33 stanovnika/km². Opština se prostire na površini od 16,07 km². Nalazi se na srednjoj nadmorskoj visini od 410 metara."},{"page_url":"https://nl.wikipedia.org/wiki/Feldatal","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7a/Wappen_Feldatal.png","page_title":"Feldatal","context_page_description":"Feldatal is een gemeente in de Duitse deelstaat Hessen, en maakt deel uit van de Vogelsbergkreis. Feldatal telt 2.529 inwoners."},{"page_url":"https://en.wikipedia.org/wiki/Chalgrave","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/92/All_Saints%2C_Chalgrave_%2C_Chequered_Stonework_-_geograph.org.uk_-_116127.jpg","page_title":"Chalgrave","context_page_description":"Chalgrave is a civil parish in the Central Bedfordshire district of Bedfordshire, England. The hamlets of Tebworth and Wingfield are in the west of the parish, with the church and manor in the east. Nearby places are Toddington, Chalton, Houghton Regis, and Hockliffe. Before 1929, the parish also included part of the village of Hockliffe.\\nChalgrave is part of the ward of 'Heath and Reach' which sends a Councillor to Central Bedfordshire Council. The ward includes the villages of Heath and Reach, Hockliffe, Eggington, Stanbridge, Tilsworth, Tebworth, and Wingrave. The ward was created in 2011 and has since been represented by Councillor Mark Versallion."},{"page_url":"https://de.wikipedia.org/wiki/Bahnstrecke_Halle%E2%80%93Vienenburg","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/Bahnsteig_Vienenburg.JPG","page_title":"Bahnstrecke Halle–Vienenburg","context_page_description":"Die Bahnstrecke Halle–Vienenburg ist eine nicht elektrifizierte Hauptbahn in Sachsen-Anhalt und Niedersachsen. Sie ist eine wichtige Verbindung zwischen dem Ballungsraum Halle und dem nördlichen Harzvorland. Sie wurde von 1862 bis 1872 in mehreren Teilabschnitten von der Magdeburg-Halberstädter Eisenbahngesellschaft eröffnet und wird heute bis auf den stillgelegten Abschnitt zwischen Heudeber-Danstedt und Vienenburg durch DB Netz betrieben. Der Verkehr zwischen Heudeber-Danstedt und Vienenburg nutzt seit 1996 die weiter südlich verlaufende Bahnstrecke über Wernigerode.\\nZwischen Halle Hauptbahnhof und Halle-Trotha verläuft die eingleisige elektrifizierte Strecke, auf der die S-Bahn Mitteldeutschland verkehrt, parallel zur Bahnstrecke Halle –Halberstadt, seit 2015 besteht in Halle-Trotha wieder eine Weichenverbindung zwischen beiden Strecken."},{"page_url":"https://en.wikipedia.org/wiki/Melanephia","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a3/Melanephia_brunneiventris.jpg","page_title":"Melanephia","context_page_description":"Melanephia is a genus of moths of the family Erebidae."},{"page_url":"https://de.wikipedia.org/wiki/Dittwar","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4b/Dittwar_St._Laurentius_innen.JPG","page_title":"Dittwar","context_page_description":"Dittwar ist einer von sieben Stadtteilen von Tauberbischofsheim im Main-Tauber-Kreis mit 693 Einwohnern."},{"page_url":"https://sv.wikipedia.org/wiki/Borgia_(sl%C3%A4kt)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5d/Blas%C3%B3n_Borja_-_Borgia.jpg","page_title":"Borgia (släkt)","context_page_description":"Borgia var en mäktig valenciansk, italiensk, ursprungligen från Borja i Aragonien, en aragonisk, adelssläkt under renässansen.\\nAlfonso Borgia blev under namnet Calixtus III påve. Han adopterade två systersöner, varav den ene Rodrigo Borgia blev påve under namnet Alexander VI. Den andre Pedor Luis användes av Calixtus i flera militära och politiska uppdrag, och avled 1458 utan avkomma. Rodrigo fick med tiden ett antal illegitima barn, av vilka Lucrezia Borgia, och Cesare Borgia är de mest kända. Deras äldste bror hertig Juan Borgia av Gandias sonson var jesuitordens general hertig Francisco Borgia av Gandia. Från Juan Borgia av Gandia härstammade också kardinalen Stefano Borgia."},{"page_url":"https://ko.wikipedia.org/wiki/%EC%B9%B8%ED%83%80%ED%95%B4%EB%A9%94_%EC%A7%80%EC%97%AD","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/af/Kanta-H%C3%A4meen.maakunta.suomi.2008.svg","page_title":"칸타해메 지역","context_page_description":"칸타해메 지역은 핀란드를 구성하는 지역 가운데 하나로, 중심 도시는 헤멘린나이며 면적은 5,203km², 인구는 165,886명이다. 남서수오미 지역, 피르칸마 지역, 패이얘트해메 지역, 우시마 지역과 접하며 11개 지방 자치체를 관할한다."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%A5%D8%AF%D9%88%D8%A7%D8%B1%D8%AF_%D9%83%D9%88%D9%84%D8%B2","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/22/Edward.Coles.png","page_title":"إدوارد كولز","context_page_description":"إدوارد كولز وهو سياسي أمريكي ينتمي إلى الحزب الديمقراطي - الجمهوري ولد إدوارد كولز في 15 كانون الاول - ديسمبر من سنة 1786 في مقاطعة البمارل بولاية فرجينيا شغل كولز منصب حاكم على ولاية الينوي ما بين عامي 1822 إلى عام 1826. توفي إدوارد كولز في 7 تموز - يوليو من سنة 1868 في مدينة فيلادلفيا بولاية بنسلفانيا."},{"page_url":"https://ru.wikipedia.org/wiki/Siemens_Desiro","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b8/5022007_graz.jpg","page_title":"Siemens Desiro","context_page_description":"Siemens Desiro — семейство пассажирских скоростных моторвагонных подвижных составов производства фирмы Siemens AG. Desiro выпускаются как в дизельном, так и в электрическом варианте."},{"page_url":"https://en.wikipedia.org/wiki/University_of_Negros_Occidental_%E2%80%93_Recoletos","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/34/UNO-R_Football_Field.jpg","page_title":"University of Negros Occidental – Recoletos","context_page_description":"The University of Negros Occidental – Recoletos, is a private, Roman Catholic university founded in 1941 in Bacolod, Negros Occidental, Philippines and administered by the Order of Augustinian Recollects.\\nThe University was granted \\"autonomous status\\" by the Commission on Higher Education for five years while its College of Arts and Sciences was granted Level III accreditation by the Philippine Accrediting Association of Schools, Colleges and Universities. CHED also granted the university’s College of Engineering and College of Information Technology the distinction as Centers of Development and Excellence in their Electrical Engineering and Information Technology courses respectively. The university was also granted with Category A by the Institutional Quality Assurance through Monitoring and Evaluation."},{"page_url":"https://nl.wikipedia.org/wiki/Henk_Zweerus","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/19/Beeld_Leidsebosje%2C_Amsterdam.jpeg","page_title":"Henk Zweerus","context_page_description":"Hendrik Johannes Martin Zweerus was een Nederlands beeldhouwer, schilder, tekenaar en docent."},{"page_url":"https://de.wikipedia.org/wiki/Sant_Quint%C3%AD_d%E2%80%99en_Bas","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3d/WLM14ES_-_Ermita_rom%C3%A0nica_de_Sant_Quint%C3%AD%2C_Sant_Esteve_d%27En_Bas%2C_La_Vall_d%27en_Bas%2C_Garrotxa_-_MARIA_ROSA_FERRE.jpg","page_title":"Sant Quintí d’en Bas","context_page_description":"Sant Quintí d’en Bas ist eine kleine, im Ursprung romanische Einsiedlerkapelle auf der linken Seite des Fluvià etwas nördlich des Ortsteils Els Hostalets der Gemeinde La Vall d’en Bas in der katalanischen Provinz Girona in Spanien gelegen. Die Kapelle liegt mitten in Wiesen und Feldern. Im Hintergrund sieht man die Felswände des Puigsacalm."},{"page_url":"https://en.wikipedia.org/wiki/Nevada_State_Route_159","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a9/2015-07-12_15_19_40_View_%22east%22_%28actually_west-northwest%29_from_the_%22west%22_end_of_Nevada_State_Route_159_%28Blue_Diamond_Road%29_near_Las_Vegas%2C_Nevada.jpg","page_title":"Nevada State Route 159","context_page_description":"State Route 159 is a 31.204-mile east–west highway in Clark County, Nevada, United States, providing access to Red Rock Canyon and serving as a thoroughfare in the Las Vegas metropolitan area. A portion of the west end of the route is designated a Nevada Scenic Byway."},{"page_url":"https://fr.wikipedia.org/wiki/Liste_des_monuments_historiques_de_la_Corr%C3%A8ze","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f4/06m09-23_5427.JPG","page_title":"Liste des monuments historiques de la Corrèze","context_page_description":"Cet article recense les monuments historiques de la Corrèze, en France.\\nPour les monuments historiques de Brive-la-Gaillarde, voir la liste des monuments historiques de Brive-la-Gaillarde\\nPour les monuments historiques de Collonges-la-Rouge, voir la liste des monuments historiques de Collonges-la-Rouge"},{"page_url":"https://he.wikipedia.org/wiki/%D7%9E%D7%A0%D7%98%D7%95%D7%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/18/Mentosis.jpg","page_title":"מנטוס","context_page_description":"מנטוס הוא ממתק המשווק ברחבי העולם. את המנטוס פיתחה חברת Van Melle בהולנד בשנת 1950, וזהו המוצר המוביל שלה. המנטוס משווק בעיקר בצורת גליל, אך גם בקופסאות. בכל גליל ישנן 14 סוכריות, למעט סדרת \\"Sour Mix\\" בה יש 11 סוכריות."},{"page_url":"https://fr.wikipedia.org/wiki/John_Cassavetes","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/1f/Paramount_Pictures.jpg","page_title":"John Cassavetes","context_page_description":"John Cassavetes, né le 9 décembre 1929 à New York et mort le 3 février 1989 à Los Angeles, est un acteur, scénariste et réalisateur américain.\\nIl commence sa carrière comme comédien. Il endosse plusieurs rôles d'abord au théâtre, puis à la télévision, dans des séries télévisées dont la plus connue est Johnny Staccato. Sa notoriété grandit lorsqu'il décide de passer au cinéma, notamment dans Face au crime de Don Siegel. Mais c'est surtout derrière la caméra, en tant que cinéaste, que John Cassavetes va se distinguer. En 1959, il réalise Shadows, tournant avec une troupe d'amateurs et avec ses propres moyens. Le film engage le réalisateur et le cinéma américain dans la voie de l'indépendance. En rupture avec l'industrie hollywoodienne avec laquelle il a une courte et décevante expérience, son cinéma évolue vers un style qui lui est propre. Faces, Une femme sous influence, Opening Night continuent à s'inscrire dans une dynamique de cinéma indépendant. Il libère le jeu d'acteur qu'il place au centre de son dispositif cinématographique et focalise son œuvre sur la classe moyenne américaine."},{"page_url":"https://it.wikipedia.org/wiki/Santa_Maria_in_Portuno","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a5/Ex-voto_1892.jpg","page_title":"Santa Maria in Portuno","context_page_description":"Santa Maria in Portuno è una storica località della media valle del Cesano che oggi ricade nel territorio del comune di Corinaldo. Nota per essere stata la sede di uno dei sei monasteri medievali della valle del Cesano, oggi è oggetto di indagini archeologiche che hanno portato alla creazione di un museo accanto al sito archeologico."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%BA%D9%86%D9%8A%D8%B2%D9%86%D9%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e4/Boles%C5%82aw_Chrobry.JPG","page_title":"غنيزنو","context_page_description":"غنيزنو هي مدينة تقع في وسط غرب بولندا تبعد مسافة 50 شرق بوزنان ويقيم بها قرابة 70,000 شخص."},{"page_url":"https://no.wikipedia.org/wiki/Auburn_Hills_(Michigan)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/40/Chrysler_Headquarters_Auburn_Hills_20060624.jpg","page_title":"Auburn Hills (Michigan)","context_page_description":"Auburn Hills er en by i den amerikanske delstaten Michigan. Byen ligger i Oakland County, og er en forstad til Detroit. Auburn Hills har 19 837 innbyggere. Auburn Hills ligger ved Clinton River ble oppkalt etter Auburn av Aaron Webster, den første hvite bosetteren i Auburn Hills.\\nChryslers hovedkvarter ligger i Auburn Hills og er også hovedkvarteret til Volkswagens USA avdeling. NBA-laget Detroit Pistons spiller hjemmekampene sine her, i The Palace of Auburn Hills."},{"page_url":"https://ca.wikipedia.org/wiki/Pelatge_castany","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6e/Akhal_teke.jpg","page_title":"Pelatge castany","context_page_description":"El pelatge castany és un pelatge que presenta els pèls del cos de color castany i les \\"puntes\\" negres. És un pelatge freqüent en els cavalls.\\nEls dos termes que designen el pelatge castany tenen aspectes que cal considerar. El \\"castany\\" terme de pelatge coincideix amb el nom del color, a partir del color dels pèls del cos i de la pellofa del fruit del castanyer. L'equivalent en castellà i portuguès no presenta problemes de traducció. Contràriament, el \\"chestnut\\" anglès - que indica el pelatge \\"alatzà\\"- sí que és problemàtic. El terme \\"bai\\" català coincideix amb el francès \\"bai\\", l'anglès \\"bay\\" i l'italià \\"baio\\". Però no amb el castellà \\"bayo\\" que designa el pelatge falb crema."},{"page_url":"https://tr.wikipedia.org/wiki/Yel_de%C4%9Firmenleri_listesi","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c2/Russia-Suzdal-MWAPL-Windmill-2.jpg","page_title":"Yel değirmenleri listesi","context_page_description":"Bu yel değirmenleri listesinde yel değirmenleri ve değirmenlere bağlantılar bulunur."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%90%D0%BC%D0%B0%D1%80%D1%83%D0%BA%D0%B0%D0%BD%D1%87%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f0/Cabeza_de_Viracocha%2C_Museo_de_Am%C3%A9rica.jpg","page_title":"Амаруканча","context_page_description":"Амаруканча — храм і палац у місті Куско. Зведено за часи розквіту інкської держави Тауантінсую. Було центром поклоніння змію, сама назва перелкдається як Дім змія або Храм змія. На сьогодні на цьому місці розташовано Університет Сан-Антоніо-Абад."},{"page_url":"https://tr.wikipedia.org/wiki/%C3%87ayk%C4%B1%C5%9Fla,_Emirda%C4%9F","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/33/Caykisla.jpg","page_title":"Çaykışla, Emirdağ","context_page_description":"Çaykışla, Afyonkarahisar ilinin Emirdağ ilçesine bağlı bir köydür."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%B7%E3%83%A3%E3%83%BC%E3%83%87%E3%83%BC","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3f/Sade_Adu_Band.jpg","page_title":"シャーデー","context_page_description":"シャーデーは、イギリスのバンド。シャーディーと表記されることもある。女性ソロ歌手だと誤解されることもあるが、女性ボーカルとバック・ミュージシャンから成るバンドの名称である。"},{"page_url":"https://no.wikipedia.org/wiki/Geilo24","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/74/Geilo24.jpg","page_title":"Geilo24","context_page_description":"Geilo24 er et 24-timers terrengsykkelritt, der man enten som lag eller soloutøver skal sykle så mange ganger rundt Ustedalsfjorden som mulig på 24 timer. Rittet ble arrangert første gang i 2007, og er det eneste i sitt slag i Norge."},{"page_url":"https://en.wikipedia.org/wiki/Engadine,_New_South_Wales","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b6/Heathcote_National_Park_8.jpg","page_title":"Engadine, New South Wales","context_page_description":"Engadine is a suburb in southern Sydney, in the state of New South Wales, Australia. Engadine is located 33 kilometres south of the Sydney central business district, in the local government area of the Sutherland Shire."},{"page_url":"https://en.wikipedia.org/wiki/Monument_Mountain_(reservation)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/67/Monument_Mt_Panoramic.jpg","page_title":"Monument Mountain (reservation)","context_page_description":"Monument Mountain is the name of a popular 503-acre open space reservation located in Great Barrington, Massachusetts on the southeast side of Monument Mountain. The reservation is centered on the 1,642 feet subordinate summit of Squaw Peak. It is managed by The Trustees of Reservations, a non-profit conservation organization and is notable for its expansive views of the Housatonic River Valley, The Berkshires, the Taconic Mountains, and the Catskill Mountains of New York from the knife-edge summit of Squaw Peak. Monument Mountain, composed of erosion resistant quartzite, is of The Berkshires geology. The reservation receives over 20,000 visitors a year."},{"page_url":"https://mn.wikipedia.org/wiki/%D0%9E%D1%80%D0%BE%D1%81%D1%8B%D0%BD_%D1%85%D0%BE%D1%82%D1%8B%D0%BD_%D0%B6%D0%B0%D0%B3%D1%81%D0%B0%D0%B0%D0%BB%D1%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/56/Nizhny_Novgorod_View_2.jpg","page_title":"Оросын хотын жагсаалт","context_page_description":"Орос улсад 1100 гаруй хот, 1286 хоторхуу суурин, 153125 энгийн суурин бий."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkmale_in_Saalfeld/Saale","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9f/Burkersdorf_Nr._42_Geh%C3%B6ft.jpg","page_title":"Liste der Kulturdenkmale in Saalfeld/Saale","context_page_description":"In der Liste der Kulturdenkmale in Saalfeld/Saale sind alle Kulturdenkmale der thüringischen Kreisstadt Saalfeld/Saale und ihrer Ortsteile aufgelistet."},{"page_url":"https://be.wikipedia.org/wiki/%D0%93%D1%80%D1%83%D1%82%D0%B2%D1%96%D0%BA%D0%B5%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8d/Grytviken_museum.jpg","page_title":"Грутвікен","context_page_description":"Грутвікен — адміністрацыйны цэнтр брытанскай заморскай тэрыторыі Паўднёвая Георгія і Паўднёвыя Сэндвічавыя астравы. Знаходзіцца на паўночна-ўсходнім беразе вострава Паўднёвая Георгія. Гэта самая паўднёвая «сталіца» ў свеце, галоўны пасёлак краіны, якая хоць і залежная, і нават не мае карэннага насельніцтва, усё ж такі не з'яўляецца часткай іншай дзяржавы. Грутвікен размешчаны на ўсходнім беразе паўвострава Тэтчэр, у невялікім заліве Кінг Эдуард, частка бухты Усходні Камберланд на паўночна-ўсходнім узбярэжжы вострава Паўднёвая Георгія."},{"page_url":"https://es.wikipedia.org/wiki/Cucharmoy","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0b/Cucharmoy_vue.jpg","page_title":"Cucharmoy","context_page_description":"Cucharmoy es una población y comuna francesa, en la región de Isla de Francia, departamento de Sena y Marne, en el distrito de Provins y cantón de Provins."},{"page_url":"https://es.wikipedia.org/wiki/La_Flamengrie_(Norte)","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/9a/Map_commune_FR_insee_code_59232.png","page_title":"La Flamengrie (Norte)","context_page_description":"La Flamengrie es una comuna francesa situada en el departamento de Norte, de la región de Alta Francia."},{"page_url":"https://de.wikipedia.org/wiki/National_Geographic_Channel","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8e/Nat_Geo_HD_Logo.svg","page_title":"National Geographic Channel","context_page_description":"National Geographic Channel ist ein Pay-TV-Sender, der sich auf die Ausstrahlung von Dokumentarfilmen spezialisiert hat."},{"page_url":"https://sv.wikipedia.org/wiki/Jamie_McMurray","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/85/KaseyKahne2006Car.jpg","page_title":"Jamie McMurray","context_page_description":"Jamie McMurray, född den 3 juni 1976 i Joplin, Missouri, USA är en amerikansk racerförare."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%93%D0%B5%D0%B2%D0%B0%D1%80%D0%B0,_%D0%9E%D1%82%D1%82%D0%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b7/Otto_Guevara.jpg","page_title":"Гевара, Отто","context_page_description":"Отто Гевара Гут — политик Коста-Рики и основатель партии Либертарианское движение. Отто Гевара был депутатом в 1998—2006 годах. Отто Гевара является президентом Либертарианского движения и выдвигался от него на выборах президента Коста-Рики в 2002, 2006 и 2010 годах."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%A7%D9%88%D8%AA%D9%88%D8%8C_%D8%B4%D8%A7%D9%87_%DB%8C%D9%88%D9%86%D8%A7%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d1/Otto_of_Greece_II.jpg","page_title":"اوتو، شاه یونان","context_page_description":"اوتو که اوتون نیز خوانده می‌شود، شاهزاده‌ای سلطنتی از بایرن بود که در ۱۸۳۲ مطابق کنفرانس لندن، نخستین شاه یونان معاصر شد. او تا ۱۸۶۲ که از سلطنت خلع شد، بر یونان حکومت کرد.\\nاو دومین پسر شاه لودویگ اول بایرن بود که در زمان جوانی به حکومت دولت تازه تأسیس یونان رسید. در ابتدا دولت یونان توسط سه نایب‌السلطنه از دستگاه اداری بایرن اداره می شد. هنگامی که اوتو به سن قانونی رسید، نایب السلطنه‌ها را به دلیل نامحبوبیت آن‌ها نزد مردم، از کار برکنار کرد و خود مستقیماً اداره امور را بدست گرفت. با تلاش اوتو، یونان در ۱۸۴۳ صاحب قانون اساسی مدونی گردید.\\nسراسر دوره حکومت او، همراه با تلاش‌های سیاسی برای بهبود وضعیت اقتصاد ضعیف یونان و دخالت دولت در امور کلیسا همراه بود. سیاست‌های یونان در این دوره، بر وابستگی به سه ابرقدرت اروپایی بنا شده بود و جلب حمایت این سه کشور نیز کلید باقی ماندن اوتو در قدرت به حساب می آمد.\\nنیروی دریایی پادشاهی بریتانیا در سال‌های ۱۸۵۰ و ۱۸۵۳ برای توقف حملات یونان به امپراتوری عثمانی در جریان جنگ کریمه، دو بار یونان را محاصره کرد که از قدرت و محبوبیت اوتو کاست که در نتیجه آن، در ۱۸۶۲ سوءقصدی به جان ملکه یونان رخ داد. در همان سال، هنگامی که اوتو به حومه شهر رفته بود، او را از سلطنت خلع کردند. وی سرانجام در سال ۱۸۶۷ میلادی، در تبعید، در بایرن در گذشت."},{"page_url":"https://hsb.wikipedia.org/wiki/Lis%C4%87ina_kulturnych_pomnikow_w_Nut%C5%99kownym_m%C4%9Bs%C4%87e_(A%E2%80%93N)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/87/Holzmarkt_8_Bautzen.JPG","page_title":"Lisćina kulturnych pomnikow w Nutřkownym měsće (A–N)","context_page_description":"Lisćina kulturnych pomnikow w Nutřkownym měsće wobsahuje připóznate kulturne pomniki Budyskeho měšćanskeho dźěla Nutřkowne město, kotrež su w pomnikowej lisćinje Sakskeho krajneho zarjada za pomnikoškit zapisane. Na tutej stronje namakaja so kulturne pomniki z adresami wot A do N. Pomniki z adresami wot P do Z su tam."},{"page_url":"https://eo.wikipedia.org/wiki/Pern%C5%A1tejn_(burgo)","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/02/Hrad_Pernstejn_1.JPG","page_title":"Pernštejn (burgo)","context_page_description":"Burgo Pernštejn situas en Ĉeĥio en Sudmoravia regiono, distrikto Brno-provinco, apud vilaĝo Nedvědice, 40 km nordokcidente de Brno.\\nTemas pri unu el la plej konataj, plej vizitataj kaj plej bone konservitaj gotikaj burgoj en la lando, ofte uzata ankaŭ dum filmado de fabeloj kaj historiaj filmoj.\\nPro sia valoro ĝi estas proklamita kiel Nacia kultura memorindaĵo de Ĉeĥio."},{"page_url":"https://de.wikipedia.org/wiki/Browntown_(Wisconsin)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e7/Cadiz_Township_Joint_District_No._2_School.jpg","page_title":"Browntown (Wisconsin)","context_page_description":"Browntown ist eine Gemeinde im Green County im US-amerikanischen Bundesstaat Wisconsin. Im Jahr 2010 hatte Browntown 280 Einwohner."},{"page_url":"https://en.wikipedia.org/wiki/Litton_Reservoirs","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/24/Litton_Resovoir_Upper_pond.JPG","page_title":"Litton Reservoirs","context_page_description":"Litton Reservoirs are two reservoirs near the village of Litton, Somerset, England. They are operated by Bristol Water.\\nThey lie on the boundary between Bath and North East Somerset and Mendip districts.\\nThe individual lakes are called Lower Litton and Upper Litton. The former is 8 acres in size, the latter 16 acres and much deeper. They were built around 1850 by the Bristol Waterworks Company in conjunction with the \\"Line of Works\\" to bring water from the Mendip Hills to Bristol.\\nA public footpath goes around the lakes and across the dam. The banks are home to a variety of flowers including; Primroses, Common Bluebell, Wood anemone, Violets and Campion.\\nSeveral species of birds are frequent visitors including; Moorhen, Coot, Mallard, Swan and Tufted duck.\\nFishing is generally for rainbow and brown trout. Fish breeding takes place in the netted area immediately below the upper dam is the site for fish breeding."},{"page_url":"https://ka.wikipedia.org/wiki/%E1%83%90%E1%83%96%E1%83%90%E1%83%9C%E1%83%92%E1%83%A3%E1%83%9A%E1%83%9D%E1%83%95%E1%83%9D_(%E1%83%91%E1%83%94%E1%83%9A%E1%83%9D%E1%83%A0%E1%83%94%E1%83%AA%E1%83%99%E1%83%98%E1%83%A1_%E1%83%A0%E1%83%90%E1%83%98%E1%83%9D%E1%83%9C%E1%83%98)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/30/IlshatsAznagul.jpg","page_title":"აზანგულოვო (ბელორეცკის რაიონი)","context_page_description":"აზანგულოვო — სოფელი რუსეთის ფედერაციაში, ბაშკირეთის რესპუბლიკის ბელორეცკის რაიონში.\\n2010 წლის მონაცემებით სოფელში ცხოვრობს 290 ადამიანი. რაიონულ ცენტრ ბელრეცკიდან დაშორებულია 34 კილომეტრით. უახლოესი რკინიგზის სადგურია ნოვოაბზაკოვო, რომელიც დაშორებულია 14 კმ-ით."},{"page_url":"https://pl.wikipedia.org/wiki/Przecieszyn","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/14/Otwarcie_boiska_sportowego_w_Przecieszynie.JPG","page_title":"Przecieszyn","context_page_description":"Przecieszyn – wieś w Polsce, położona w województwie małopolskim, w powiecie oświęcimskim, w gminie Brzeszcze."},{"page_url":"https://ast.wikipedia.org/wiki/Padres_fundadores_de_los_Estaos_Xun%C3%ADos","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/Declaration_of_Independence_%281819%29%2C_by_John_Trumbull.jpg","page_title":"Padres fundadores de los Estaos Xuníos","context_page_description":"Los Padres fundadores de los Estaos Xuníos d'América fueron los líderes políticos y homes d'Estáu que participaron na Revolución Americana al roblar la Declaración d'Independencia d'Estaos Xuníos, participando na Guerra d'Independencia, y estableciendo la Constitución d'Estaos Xuníos. Dientro del gran grupu conocíu como los \\"Padres Fundadores\\", hai dos subgrupos principales: los firmantes de la Declaración d'Independencia y los autores de la Constitución. Un subconxuntu adicional ye'l grupu que robló los Artículos de la Confederación.\\nMunchos de los Padres Fundadores teníen esclavos afroamericanos y la Constitución adoptada en 1787 sancionó'l sistema de la esclavitú. Los Padres Fundadores fixeron esfuercios esitosos pa contener o llindar la esclavitú nos Estaos Xuníos y los sos territorios, incluyendo la prohibición de la esclavitú na Ordenanza del Noroeste de 1787, y l'abolición de tratar internacional d'esclavos en 1807."},{"page_url":"https://ml.wikipedia.org/wiki/%E0%B4%AE%E0%B4%A1%E0%B5%8B%E0%B4%A3_%E0%B4%93%E0%B4%AB%E0%B5%8D_%E0%B4%A6_%E0%B4%9A%E0%B5%86%E0%B4%B1%E0%B5%82%E0%B4%AC%E0%B4%BF%E0%B4%AF%E0%B5%BB","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b7/Madonna_Cherubin_Mantegna.jpg","page_title":"മഡോണ ഓഫ് ദ ചെറൂബിയൻ","context_page_description":"1485-ൽ ടെമ്പറ ക്യാൻവാസിൽ ആൻഡ്രിയ മാന്റെഗ്ന ചിത്രീകരിച്ച ഒരു എണ്ണഛായാചിത്രമാണ് മഡോണ ഓഫ് ദ ചെറൂബിയൻ."},{"page_url":"https://fr.wikipedia.org/wiki/Mount_Panorama_Circuit","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/Mount_Panorama_Pit_Straight_and_Pit_Lane_2015.JPG","page_title":"Mount Panorama Circuit","context_page_description":"Le Mount Panorama, Motor Racing Circuit Bathurst est un circuit automobile situé à Bathurst, en Nouvelle-Galles du Sud, en Australie. C'est l'hôte de la célèbre course des Bathurst 1000 qui s'y déroule chaque année en octobre et des 12 Heures de Bathurst courues en février. Le tracé mesure 6,213 km de long et utilise des routes de montagne habituellement ouvertes à la circulation automobile."},{"page_url":"https://es.wikipedia.org/wiki/Licia_Calder%C3%B3n","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/de/Licia_Calderon_in_I_Want_Him_Dead_%281968%29.jpg","page_title":"Licia Calderón","context_page_description":"Alicia Palacios Calderón, ​ conocida como Licia Calderón, es una actriz española nacida en Alicante."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%B4%D9%87%D8%B1%D8%B3%D8%AA%D8%A7%D9%86_%D8%A7%D8%B3%D8%AA%D9%81%D9%86%D8%B2%D8%8C_%D8%AC%D9%88%D8%B1%D8%AC%DB%8C%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bc/Stephens_County%2C_Georgia_courthouse.JPG","page_title":"شهرستان استفنز، جورجیا","context_page_description":"شهرستان استیونز، جورجیا یک سکونتگاه مسکونی در ایالات متحده آمریکا است که در جورجیا واقع شده‌است."},{"page_url":"https://it.wikipedia.org/wiki/Delta_fluviale","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/df/Danube_delta_satelite.png","page_title":"Delta fluviale","context_page_description":"Un delta fluviale, o semplicemente delta, è un accumulo di sedimenti, o corpo sedimentario, che si forma in un'area di foce dove un corso d'acqua convoglia sedimenti terrigeni in un bacino con una massa d'acqua relativamente stazionaria. In base al tipo di bacino, si può avere quindi un delta marino o un delta lacustre. Si contrappone alla foce ad estuario."},{"page_url":"https://en.wikipedia.org/wiki/Thomas_Wharton_(died_1684)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/52/Anthony-van-Dyck-Portrait-of-Sir-Thomas-Wharton-1639.jpg","page_title":"Thomas Wharton (died 1684)","context_page_description":"Sir Thomas Wharton was an English politician who sat in the House of Commons in 1659 and 1660.\\nWharton was the son of Sir Thomas Wharton of Aske Hall and his wife Lady Philadelphia Carey, daughter of Robert Carey, 1st Earl of Monmouth. His father died in 1622. He was educated at Eton College from 1624 to 1625 and matriculated at Exeter College, Oxford on 3 March 1626, aged 11. He was created Knight of the Bath on 2 February 1626. From 1629 to 1632 he travelled abroad in France and entered Lincoln's Inn in 1638.\\nIn 1659, Wharton was elected Member of Parliament for Westmorland in the Third Protectorate Parliament. He was re-elected MP for Westmorland in 1660 for the Convention Parliament.\\nWharton married firstly in 1645, his cousin Lady Mary Carey daughter of Henry Carey, 1st Earl of Dover and had a son, Philip, and three daughters. She died in June 1672 and he married secondly by licence dated 20 April 1677, Jane Robinson, widow of Leonard Robinson of Ravensworth, Yorkshire and daughter of Rowland Dand of Mansfield Woodhouse, Nottinghamshire. They had two daughters. His elder brother Philip inherited the barony from their grandfather."},{"page_url":"https://it.wikipedia.org/wiki/Geografia_del_Ciad","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3d/LocationChad.png","page_title":"Geografia del Ciad","context_page_description":"Il Ciad è uno stato senza sbocco al mare situato nella parte settentrionale dell'Africa centrale.\\nIl paese, che ha una superficie pari a 1.284.000 km² non ha sbocchi sul mare, la capitale N'Djamena dista dall'Oceano Atlantico circa 1.100 km mentre Faya Largeau, un importante centro nel settentrione del paese, è localizzato nel centro del deserto del Sahara a circa 1.550 km dal Mar Mediterraneo.\\nIl territorio si estende da nord a sud per un totale di circa 1.800 km e, tranne negli estremi, ha una larghezza media di circa 800 km."},{"page_url":"https://hr.wikipedia.org/wiki/Dienst","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c1/Etude.style.medieval.6.png","page_title":"Dienst","context_page_description":"Dienst je naziv za građevni element gotičke sakralne arhitekture. Riječ je o tankom polustupu presjeka polovice, četvrtine ili tri četvrtine kruga koji je jedan od sastavnih dijelova svežnjastog stupa ili pilastra.\\nOdgovarajući termin u hrvatskom jeziku zasada ne postoji, no neki autori u istom značenju upotrebljavaju termin služavnik.\\nDienst se u pravilu pruža od dna, preko čitave mase zida, dopirući sve do svoda gdje prelazi u svijeno rebro – svodni nosač.\\nDienst stoga vizualno i konstrukcijski čini jedan od najvažnijih elemenata interijera gotičke sakralne arhitekture, osobito naglašavajući tipično-gotičku vertikalnost volumena i konstrukcije."},{"page_url":"https://ar.wikipedia.org/wiki/NGC_2839","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a6/NGC_2839_SDSS.jpg","page_title":"NGC 2839","context_page_description":"NGC 2839 في الفهرس العام الجديد، هي مجرة، تقع في كوكبة الوشق. اكتشفت في 13 مارس 1850 بواسطة ويليام بارسونز."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%85%D9%82%D8%A7%D8%A8%D8%B1_%D8%A7%D9%84%D8%AE%D9%88%D8%AE%D8%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/76/Luxor_Valley_of_the_Kings_B.jpg","page_title":"مقابر الخوخة","context_page_description":"جبانة الخوخة تقع على الضفة الغربية لنهر النيل في طيبة بصعيد مصر، و تحيط الجبانة بتلة و تنقسم جغرافياً إلى منطقتين خوضة عليا و خوضة سفلى و يوجد بها خمس مقابر من عهد الدولة القديمة و أكثر من 50 مقبرة من عهود الأسرات 18 و 19 و 20 وكذلك بعض المقابر من عصر الاضمحلال الأول و الفترة المتأخرة."},{"page_url":"https://de.wikipedia.org/wiki/Flugunfall_IFO-21","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/8e/USAF_CT-43A_crash_1996.jpg","page_title":"Flugunfall IFO-21","context_page_description":"Unter dem Rufzeichen IFO-21 wurde am 3. April 1996 ein Passagierflugzeug der US-amerikanischen Luftstreitkräfte beim Landeanflug auf den Flughafen Dubrovnik, Kroatien, in einen Berg geflogen. An Bord der Boeing CT-43A, eine Militärversion der Boeing 737-200, befanden sich die fünfköpfige Flugzeugbesatzung sowie die 30 Mitglieder einer Wirtschaftsdelegation unter Leitung des damaligen US-Handelsministers Ron Brown. Nur eine Stewardess im Rang eines Technical Sergeant überlebte den unmittelbaren Aufprall, während des Transports zum Krankenhaus starb auch sie.\\nDas Flugzeug gehörte zur 76th Airlift Squadron des in Ramstein, Deutschland, stationierten 86th Airlift Wing. Anders als zivile Boeing-737-Exemplare war die Militärversion CT-43A weder mit einem Flugdatenschreiber noch mit einem Stimmenrekorder ausgestattet.\\nDer offizielle Abschlussbericht der Flugunfalluntersuchung nannte mehrere Gründe, die zu dem Unglück führten. Als Hauptgründe angeführt wurden \\"ein Versagen auf der Kommandoebene, Fehler der Cockpitbesatzung und ein ungeeignetes Design des Landeanflugs nach Instrumentenflugregeln\\"."},{"page_url":"https://es.wikipedia.org/wiki/Bah%C3%ADa_Port_Phillip","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ce/Port_Melbourne_Beacon_Cove.jpg","page_title":"Bahía Port Phillip","context_page_description":"Port Phillip, también comúnmente conocida como la bahía Port Phillip, y localmente solo como La Bahía, es una gran bahía australiana localizada en el sur del estado de Victoria, en cuya ribera se asienta la ciudad de Melbourne. Geográficamente, la bahía tiene una superficie de 1.930 km² y una costa de 264 km. Aunque para su tamaño es muy poco profunda —la parte más profunda tiene sólo 24 m, y la mitad tiene menos de 8 m—, la mayor parte es navegable. El volumen del agua en la bahía es de unos 25 km³.\\nAntes de la colonización europea el área alrededor de Port Phillip estaba dividida entre los territorios de las naciones de los wathaurong, wurundjeri y boonwurrung. Sus aguas y la costa son hogar de focas, ballenas, delfines, corales y muchos tipos de aves marinas y aves limícolas migratorias.\\nLos primeros europeos en entrar en la bahía fueron los tripulantes del HMS Lady Nelson, comandado por John Murray y, diez semanas después, por el HMS Investigator comandado por Matthew Flinders, en 1802. Expediciones posteriores a la bahía tuvo lugar en 1803 para establecer el primer asentamiento en Victoria, cerca de Sorrento, pero fue abandonado en 1804."},{"page_url":"https://no.wikipedia.org/wiki/Leif_Johan_Holand","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/df/Leif_johan_holand_200px.jpg","page_title":"Leif Johan Holand","context_page_description":"Leif Johan Holand er en norsk filmprodusent, luftfotograf og drone-gründer. Han leder selskapet Griff Aviation, og har tidligere arbeidet i selskapene Fuglefjellet og Magic Air.\\nHoland var gründer av film- og designselskapet Fuglefjellet, der han var daglig leder fram til 2010. Han gikk deretter over til å være «Aerial Manager» og luftkameraoperatør. Holand forlot Fuglefjellet i 2014 og etablerte selskapet Magic Air. Magic Air ble senere solgt til Griff Aviation.\\nHoland og Fuglefjellet/Magic Air, filmet mellom annet Ski-VM i Oslo 2011 fra luften for NRK og Den europeiske kringkastingsunion. Holand filmet i januar 2010 over Sunnmørsalpene til BBC-produksjonen Wonders of the Universe med fysikeren Brian Cox som programleder. I 2011 inngikk Holand og Magic Air kontrakt på helikopterfilming til mer enn ti programserier for TvNorge.\\nHoland er gründer bak drone-selskapet Griff Aviation. Dette ble etablert desember 2015."},{"page_url":"https://fr.wikipedia.org/wiki/Autorail_SOMUA_ZZ_D_1_%26_2","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/Somua_ZZC_D_1-2-plan.jpg","page_title":"Autorail SOMUA ZZ D 1 & 2","context_page_description":"Les Somua ZZ D 1 et D 2 sont 2 prototypes de petit autorail livrés au PLM en 1933 par le constructeur de camions ou d'engins militaires SOMUA. Tel un autobus sur rail, il roule sur 2 essieux et ne possède qu'une cabine de conduite."},{"page_url":"https://da.wikipedia.org/wiki/Podolien","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/50/Ukraine_Podolia.png","page_title":"Podolien","context_page_description":"Podolien, Podilia eller Podillya er en historisk region i det vest-centrale og sydvestlige dele af nutidens Ukraine, som svarer til nutidens Khmelnytskyj oblast og Vínnitsja oblast. Transdnjestr-region i Moldova var også en del af Podolien."},{"page_url":"https://es.wikipedia.org/wiki/Be%C3%A7in","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6f/Becin_5339.jpg","page_title":"Beçin","context_page_description":"Beçin fue un fuerte histórico de Turquía."},{"page_url":"https://fa.wikipedia.org/wiki/%DA%A9%D8%A7%D8%B2%DB%8C%D9%86%D9%88_%D9%85%D9%88%D9%86%D8%AA_%DA%A9%D8%A7%D8%B1%D9%84%D9%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0e/Monte_Carlo_Casino%2C_The_Main_Salon.JPG","page_title":"کازینو مونت کارلو","context_page_description":"کازینوی مونت کارلو یک کازینو و مجتمع تفریحی واقع در شهر مونت کارلو، موناکو است.\\nاین مجموعه شامل کازینو مونت کارلو، اپرای مونت کارلو و باله مونت کارلو است."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A4%D0%B8%D0%BB%D0%BB%D0%BE%D0%BB%D0%B5%D0%BF%D0%B8%D0%B4%D1%8B","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d3/Phyllolepis12DB.jpg","page_title":"Филлолепиды","context_page_description":"Филлолепи́ды — подотряд плакодерм из отряда артродир, живших в среднем и верхнем девоне."},{"page_url":"https://fr.wikipedia.org/wiki/Giampiero_Moretti","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/aa/Momo_NPT90.jpg","page_title":"Giampiero Moretti","context_page_description":"Gianpiero Moretti est un pilote automobile italien. Il a fondé l'entreprise italienne MOMO qui fabrique et conçoit des pièces pour automobiles."},{"page_url":"https://de.wikipedia.org/wiki/Augusta_Fonds","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ef/Kaiserin_Augusta.jpg","page_title":"Augusta Fonds","context_page_description":"Der Augusta Fonds war ein von 1890 bis 2015 durch das Internationale Komitee vom Roten Kreuz verwaltete Fonds in Gedenken an die Deutschen Kaiserin und Königin von Preußen, Augusta von Sachsen-Weimar-Eisenach, und ihrer Unterstützung für das Rote Kreuz."},{"page_url":"https://en.wikipedia.org/wiki/Devon_heraldry","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d3/TothillArms.PNG","page_title":"Devon heraldry","context_page_description":"The landed gentry and nobility of Devonshire, like the rest of the English and European gentry, bore heraldic arms from the start of the age of heraldry circa 1200-1215. The fashion for the display of heraldry ceased about the end of the Victorian era by which time most of the ancient armigerous families of Devonshire had died out, moved away or parted with their landed estates.\\nToday a very few ancient families remain in the county represented by direct male descendants, most notably Courtenay of Powderham, Fulford of Fulford, Kelly of Kelly, Cruwys of Cruwys Morchard, Clifford of Chudleigh, Acland of Killerton and Broadclyst, Wrey of Tawstock, etc. A few ancient Devon estates are still owned by descendants via female lines, for example Castle Hill, Filleigh, Molland, Incledon, Braunton, Hall, Bishop's Tawton, Newnham Park, etc. In most cases the laws of English heraldry preclude the transmission of paternal armorials via a female heiress, thus most of these inheritors via female lines, generally deriving from the same pool of high-status English armigerous families, bring their own paternal heraldry, possibly previously foreign to Devon, to the estates inherited."},{"page_url":"https://en.wikipedia.org/wiki/1920_Grand_Prix_season","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cf/Guido_Meregalli_vainqueur_de_la_Targa_Florio_1920_sur_voiture_Nazzaro.jpg","page_title":"1920 Grand Prix season","context_page_description":"The 1920 Grand Prix season saw further activity in motor-racing gradually increase. Europe was still recovering from the end of the war and the terrible pandemic that swept the continent. Automotive companies were gradually re-establishing themselves after re-tooling from a wartime footing and getting production lines rolling again.\\nA new 3-litre formula was adopted on both sides of the Atlantic and the Indianapolis 500 would be a close contest between the best of the new designs from France and the USA. Ralph DePalma led for over half the race in his Ballot, only for it to catch fire with four laps to go. Gaston Chevrolet inherited the lead and held on to win by six minutes. His Monroe-Frontenac was the first American car to win the great race since 1912. DePalma got his revenge later in the year, winning the last Elgin Trophy, on the only road-course in the AAA Championship. Chevrolet was later recognised as the season champion, but he was killed at the end of the year in a collision at the Beverley Hills race.\\nRacing was gradually returning to Europe, although there was no Grand Prix. Club racing started again at Brooklands."},{"page_url":"https://fr.wikipedia.org/wiki/Liste_des_%C3%A9v%C3%AAques_et_archev%C3%AAques_de_Pozna%C5%84","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/65/Pozna%C5%84%2C_Ostr%C3%B3w_Tumski%2Cul._Mieszka_I%2C_Katedra_pw._%C5%9B%C5%9B_Aposto%C5%82%C3%B3w_Piotra_i_Paw%C5%82a%2C_XI-XX%2C_A_148_z_14.02.1930_%281%29.JPG","page_title":"Liste des évêques et archevêques de Poznań","context_page_description":"Le diocèse de Poznań en Pologne est fondé à la fin du Xᵉ siècle. Il est élevé au rang d'archidiocèse en 1821, en union personnelle avec l'archidiocèse de Gniezno. Les deux archidiocèses sont séparés en 1946. Son siège est la basilique-archicathédrale Saint-Pierre-et-Paul de Poznań."},{"page_url":"https://zh.wikipedia.org/wiki/%E9%AB%98%E9%8C%95","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f7/Charles_K._Kao_cropped_2.jpg","page_title":"高錕","context_page_description":"高錕爵士，大紫荊勳賢，KBE，PhD，科學家，身份同時為香港人、英國人及美國人。上海租界出生及長大。南下香港就讀中學後，前往英美進修及工作，及後回流香港擔任香港中文大學校長、港事顧問年回香港生活，卒於香港。電機工程學家，2009年獲諾貝爾物理學獎以表揚「在光傳輸於纖維的光學通信領域突破性成就」，國際媒體常稱「光纖通訊之父」"},{"page_url":"https://en.wikipedia.org/wiki/Wolli_Creek,_New_South_Wales","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d0/Wolli_Creek_St_Magdalen%27s_Chapel_SEP2019.jpg","page_title":"Wolli Creek, New South Wales","context_page_description":"Wolli Creek is a suburb in southern Sydney, in the state of New South Wales, Australia. It sits beside the Wolli Creek and Cooks River waterways. Wolli Creek is situated between the suburbs of Arncliffe and Tempe, 10 kilometres south of the Sydney central business district and is part of the St George area. Wolli Creek is in the local government area of Bayside Council."},{"page_url":"https://nl.wikipedia.org/wiki/Sint_Servaasbrug","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9f/Maastricht_Sint_Servaasbrug_Restauratie_1932.jpg","page_title":"Sint Servaasbrug","context_page_description":"De Sint Servaasbrug, ook wel oude brug, is een van oorsprong 13e-eeuwse stenen boogbrug over de rivier de Maas in de Nederlandse stad Maastricht. De brug is genoemd naar de 4e-eeuwse bisschop van Maastricht, Sint-Servaas, maar kreeg zijn huidige naam pas in 1932; daarvoor was het gewoon 'de brug'. De Sint Servaasbrug wordt beschouwd als de oudste brug van Nederland en een icoon van de stad Maastricht. Het bouwwerk is een rijksmonument."},{"page_url":"https://zh.wikipedia.org/zh-sg/%E5%A5%BD%E8%8E%B1%E5%9D%9E%E5%A4%A7%E9%81%93","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/Grauman%27s_Chinese_Theatre%2C_by_Carol_Highsmith_fixed_%26_straightened.jpg","page_title":"好莱坞大道","context_page_description":"好莱坞大道，位于美国洛杉矶好莱坞，东接日落大道，西北方止于佛蒙特大道，全长4.5英里。其中一段因为有很多影视明星在大道上留有手印，脚印和签名而出名，被称为好莱坞星光大道。"},{"page_url":"https://en.wikipedia.org/wiki/St._Augustine,_Florida","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c8/Saint_Augustine%2CFlorida%2CUSA._-_panoramio_%2813%29.jpg","page_title":"St. Augustine, Florida","context_page_description":"St. Augustine is a city in the Southeastern United States, on the Atlantic coast of northeastern Florida. Founded in 1565 by Spanish explorers, it is the oldest continuously inhabited European-established settlement in the contiguous United States.\\nSt. Augustine was founded on September 8, 1565, by Spanish admiral Pedro Menéndez de Avilés, Florida's first governor. He named the settlement \\"San Agustín\\", as his ships bearing settlers, troops, and supplies from Spain had first sighted land in Florida eleven days earlier on August 28, the feast day of St. Augustine. The city served as the capital of Spanish Florida for over 200 years. It was designated as the capital of British East Florida when the colony was established in 1763; Great Britain returned Florida to Spain in 1783.\\nSpain ceded Florida to the United States in 1819, and St. Augustine was designated the capital of the Florida Territory upon ratification of the Adams–Onís Treaty in 1821. The Florida National Guard made the city its headquarters that same year. The territorial government moved and made Tallahassee the capital of Florida in 1824.\\nThe county seat of St. Johns County, St."},{"page_url":"https://ceb.wikipedia.org/wiki/Agout","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/89/France_-_Giroussens_-_Agout.jpg","page_title":"Agout","context_page_description":"Suba ang Agout sa Pransiya. Nahimutang ni sa amihanan-sidlakang bahin sa nasod, 600 km sa habagatan sa Paris ang ulohan sa nasod. Ang Agout mao ang bahin sa tubig-saluran sa Garonne."},{"page_url":"https://es.wikipedia.org/wiki/Villa_Mayor","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0f/Villa_Mayor_Antigua_Parque_Grande_002.jpg","page_title":"Villa Mayor","context_page_description":"Villa Mayor La Antigua es un barrio de Bogotá localizado hacia el centro sur del área urbana del Distrito Capital, compartida por las localidades de Antonio Nariño y Rafael Uribe Uribe."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%93%D0%B5%D1%80%D0%B1_%D0%91%D0%B5%D1%80%D0%B4%D1%8F%D0%BD%D1%81%D1%8C%D0%BA%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/95/Berdiansk_coa.png","page_title":"Герб Бердянська","context_page_description":"Герб Бердя́нська — офіційний символ міста Бердянськ Запорізької області, затверджений 27 липня 1999 року рішенням № 16 VIII сесії міської ради XXIII скликання."},{"page_url":"https://sv.wikipedia.org/wiki/Athous","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/49/Rotbauchiger_Laubschnellk%C3%A4fer_5480.JPG","page_title":"Athous","context_page_description":"Athous är ett släkte av skalbaggar som beskrevs av Johann Friedrich von Eschscholtz 1829. Athous ingår i familjen knäppare.\\nKladogram enligt Dyntaxa:"},{"page_url":"https://zh.wikipedia.org/zh-sg/%E5%98%89%E9%9A%86%E8%8B%91","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/74/Ka_Lung_Court_%28clear_view_and_better_contrast%29.jpg","page_title":"嘉隆苑","context_page_description":"嘉隆苑为香港房屋委员会建成的居者有其屋屋苑，全苑建有两座35层及两座36层高新十字型楼宇，其中嘉昇阁及嘉平阁的地下也设有住宅单位，共1402伙。位于港岛南区奇力湾填海区田湾海傍道33号，在华贵邨旁，于1991年11月入伙。并由富城物业管理有限公司负责管理。"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D0%BE%D0%BA_%D0%BA%D1%83%D0%BB%D1%8C%D1%82%D1%83%D1%80%D0%BD%D1%8B%D1%85_%D1%86%D0%B5%D0%BD%D0%BD%D0%BE%D1%81%D1%82%D0%B5%D0%B9_%D0%BD%D0%B0%D1%86%D0%B8%D0%BE%D0%BD%D0%B0%D0%BB%D1%8C%D0%BD%D0%BE%D0%B3%D0%BE_%D0%B7%D0%BD%D0%B0%D1%87%D0%B5%D0%BD%D0%B8%D1%8F_%D0%9B%D0%BE%D0%B7%D0%B0%D0%BD%D0%BD%D1%8B","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4f/Theatre-de-vidy.jpg","page_title":"Список культурных ценностей национального значения Лозанны","context_page_description":"В швейцарском городе Лозанне насчитывается 46 культурных ценностей национального значения."},{"page_url":"https://en.wikipedia.org/wiki/Trams_in_Zagreb","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/00/ZET_Zagreb.png","page_title":"Trams in Zagreb","context_page_description":"The Zagreb tram network, run by the Zagrebački električni tramvaj, consists of 15 day and 4 night lines in Zagreb, Croatia. Trams operate on 116.3 kilometres of metre gauge route. During the day every line runs on average every 5–10 minutes, but almost every station serves at least two routes. Nighttime lines have exact timetables averaging at about every 40 minutes. The first horsecar tram line was opened in 1891, and the first electric tram ran in 1910. Zagreb's tram system transported 204 million passengers in 2008."},{"page_url":"https://zh.wikipedia.org/zh-sg/%E9%8D%BE%E6%A8%B9%E6%A0%B9","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7a/Csk2002.JPG","page_title":"鍾樹根","context_page_description":"锺树根博士，SBS，MH，JP，广东东莞人，香港大学前校董、太平绅士，民建联及工联会成员，前香港市政局议员、东区区议会及立法会议员。"},{"page_url":"https://pl.wikipedia.org/wiki/Radom_(Illinois)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4e/Turchin.jpg","page_title":"Radom (Illinois)","context_page_description":"Radom – wieś w USA, w stanie Illinois, w hrabstwie Washington.\\nNazwa miejscowości pochodzi od Radomia – miasta w Polsce, z którego przybyła część osadników. Kolonia radomska jest najstarszą kolonią polską w południowym Illinois i jednocześnie jedną z najstarszych osad farmerskich założonych przez Polaków w Stanach Zjednoczonych. Założycielem osady, który nadał jej obecną nazwę, był Jan Bazyli Turczyn, weteran wojny krymskiej, w której uczestniczył jako generał rosyjski. Do USA przybył podczas wojny domowej w 1863 i brał w niej czynny udział jako generał brygady. Kolonia polska w Radomiu powstała ok. 1873.\\nDziś Radom to niewielka miejscowość, której populacja stopniowo się kurczy i starzeje. Młodzi ludzi wyjeżdżają pracować w inne części stanów. Większość mieszkańców ma korzenie z okolic polskiego Radomia."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A4%D0%BB%D0%B0%D0%B3_%D0%9F%D1%80%D0%B8%D0%B4%D0%BD%D0%B5%D1%81%D1%82%D1%80%D0%BE%D0%B2%D1%81%D0%BA%D0%BE%D0%B9_%D0%9C%D0%BE%D0%BB%D0%B4%D0%B0%D0%B2%D1%81%D0%BA%D0%BE%D0%B9_%D0%A0%D0%B5%D1%81%D0%BF%D1%83%D0%B1%D0%BB%D0%B8%D0%BA%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/07/Modovian_army_Polski_Kronika_from_1564.jpg","page_title":"Флаг Приднестровской Молдавской Республики","context_page_description":"Государственный флаг Приднестровской Молдавской Республики — один из государственных символов непризнанного государства Приднестровской Молдавской Республики. Принят 2 сентября 1991 года, в первую годовщину провозглашения Приднестровской Молдавской Советской Социалистической Республики."},{"page_url":"https://fr.wikipedia.org/wiki/Mont_Frissell","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/41/Highest_Point_here.JPG","page_title":"Mont Frissell","context_page_description":"Le mont Frissell est une montagne située à la frontière de l'État du Connecticut et du Massachusetts aux États-Unis.\\nLe sommet et la partie nord du massif sont situés dans le Massachusetts, la partie sud du mont Frissel constitue le point culminant de l'État du Connecticut avec 725 m d'altitude."},{"page_url":"https://es.wikipedia.org/wiki/%C3%9Azhgorod","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ac/%D0%92%D1%80%D0%B0%D0%BD%D1%96%D1%88%D0%BD%D1%96%D0%BC%D0%B8_%D0%B2%D1%83%D0%BB%D0%B8%D1%87%D0%BA%D0%B0%D0%BC%D0%B8.jpg","page_title":"Úzhgorod","context_page_description":"Úzhgorod es una ciudad de importancia regional situada en el oeste de Ucrania, en la frontera con Eslovaquia y cerca de la frontera con Hungría. Es la capital de la Óblast de Transcarpatia y del raión de Úzhgorod, si bien no pertenece a este último."},{"page_url":"https://en.wikipedia.org/wiki/National_Register_of_Historic_Places_listings_in_Colbert_County,_Alabama","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/06/Sheffield_Downtown_Commercial_Historic_District_2012-09-30_12-35-17.jpg","page_title":"National Register of Historic Places listings in Colbert County, Alabama","context_page_description":"This is a list of the National Register of Historic Places listings in Colbert County, Alabama.\\nThis is intended to be a complete list of the properties and districts on the National Register of Historic Places in Colbert County, Alabama, United States. Latitude and longitude coordinates are provided for many National Register properties and districts; these locations may be seen together in an online map.\\nThere are 30 properties and districts listed on the National Register in the county, including 3 National Historic Landmarks.\\nThis National Park Service list is complete through NPS recent listings posted February 28, 2020."},{"page_url":"https://ru.wikipedia.org/wiki/NGC_4983","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b5/NGC4983_-_SDSS_DR14.jpg","page_title":"NGC 4983","context_page_description":"NGC 4983 — галактика в созвездии Волосы Вероники.\\nЭтот объект входит в число перечисленных в оригинальной редакции «Нового общего каталога»."},{"page_url":"https://fr.wikipedia.org/wiki/Liste_des_monuments_historiques_du_Gers","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/29/36_-_Ar%C3%A8nes_d%27Estang.JPG","page_title":"Liste des monuments historiques du Gers","context_page_description":"Cet article recense les monuments historiques du Gers, en France.\\nPour les monuments historiques de la commune d'Auch, voir la liste des monuments historiques d'Auch"},{"page_url":"https://en.wikipedia.org/wiki/Stone_crosses_in_Cornwall","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4c/Cornish_Cross_in_The_Lizard_-_geograph.org.uk_-_943719.jpg","page_title":"Stone crosses in Cornwall","context_page_description":"Wayside crosses and Celtic inscribed stones are found in Cornwall in large numbers; the inscribed stones are thought to be earlier in date than the crosses and are a product of Celtic Christian society. It is likely that the crosses represent a development from the inscribed stones but nothing is certain about the dating of them. In the late Middle Ages it is likely that their erection was very common. Since they occur in locations of various types, e.g. by the wayside, in churchyards, and in moorlands. Those by roadsides and on moorlands were doubtless intended as rout markings. A few may have served as boundary stones, and others like the wayside shrines found in Catholic European countries. Crosses to which inscriptions have been added must have been memorial stones. According to W. G. V. Balchin \\"The crosses are either plain or ornamented, invariably carved in granite, and the great majority are of the wheel-headed Celtic type.\\" Their distribution shows a greater concentration in west Cornwall and a gradual diminution further east and further north. In the extreme northeast none are found because it had been settled by West Saxons."},{"page_url":"https://ur.wikipedia.org/wiki/%D8%AA%D8%A7%D8%AC%DA%A9%D8%B3%D8%AA%D8%A7%D9%86_%DA%A9%DB%92_%D8%B5%D9%88%D8%A8%DB%92","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9f/Emblem_of_Tajikistan.svg","page_title":"تاجکستان کے صوبے","context_page_description":"تاجکستان ایک خود مختار صوبے 2 صوبوں جمہوریہ ماتحتی اضلاع میں منقسم ہے۔"},{"page_url":"https://cs.wikipedia.org/wiki/B%C3%ADdn%C3%ADci","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fd/Monsieur_Madeleine_par_Gustave_Brion.jpg","page_title":"Bídníci","context_page_description":"Les Misérables, překládáno jako Bídníci či Ubožáci, je román Victora Huga z roku 1862. Tento román byl velmi úspěšný a prakticky ihned po svém vydání byl přeložen do mnoha jazyků. Do češtiny jej přeložili například Vincenc Vávra Haštalský,\\nEmanuel z Čenkova, Marie Majerová, K. Herman, Karel Čvančara a Zdeňka Pavlousková. Postupem doby byl mnohokrát zfilmován i jinak zpracováván.\\nRomán Bídníci působí nespojitě a jediným dějovým pojítkem je hlavní postava Jean Valjeana, což je nejprve vězeň číslo 24601. Jean Valjean byl odsouzen za krádež chleba k pěti letům na galejích, ale kvůli pokusům o útěk je vězněm devatenáct let. Po propuštění se setká s biskupem Myrielem, kterému ukradne stříbrné příbory a svícny, Valjeana brzy s lupem dopadnou, biskup policii řekne, že mu svícny a příbory daroval. Tento šlechetný skutek změní Jeanu Valjeanovi celý život, stává se z něj úspěšný podnikatel, který svého bohatství využívá ve prospěch chudých. Jako protiklad chování Jeana Valjeana je v knize zdůrazňováno chování policejního prefekta Javerta, který se tak stává příkladem „pedantské“ moci."},{"page_url":"https://zh.wikipedia.org/wiki/%E8%A5%BF%E8%92%99%C2%B7%E8%B4%9D%E5%AE%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/46/Simon_Bening_-_Miniaturenmaler.jpg","page_title":"西蒙·贝宁","context_page_description":"西蒙·贝宁，文艺复兴时期欧洲艺术家。桑德斯·贝宁之子，也是弗兰德尔插图画家。格里米亚的祈祷书插图是其非常杰出的作品。"},{"page_url":"https://en.wikipedia.org/wiki/Marine_life","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/86/Micrurus_fulviusHolbrookV3P10AA.jpg","page_title":"Marine life","context_page_description":"Marine life, or sea life or ocean life, is the plants, animals and other organisms that live in the salt water of the sea or ocean, or the brackish water of coastal estuaries. At a fundamental level, marine life affects the nature of the planet. Marine organisms produce oxygen and sequester carbon. Shorelines are in part shaped and protected by marine life, and some marine organisms even help create new land. The term marine comes from the Latin mare, meaning sea or ocean.\\nMost life forms evolved initially in marine habitats. By volume, oceans provide about 90 percent of the living space on the planet. The earliest vertebrates appeared in the form of fish, which live exclusively in water. Some of these evolved into amphibians which spend portions of their lives in water and portions on land. Other fish evolved into land mammals and subsequently returned to the ocean as seals, dolphins or whales. Plant forms such as kelp and algae grow in the water and are the basis for some underwater ecosystems. Plankton forms the general foundation of the ocean food chain, particularly the phytoplankton which are key primary producers."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A9%D0%B5%D0%BF%D0%B0_%D0%B4%D0%BB%D1%8F_%D0%BA%D0%BE%D0%BF%D1%87%D0%B5%D0%BD%D0%B8%D1%8F","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/Woodchip.jpg","page_title":"Щепа для копчения","context_page_description":"Щепа для копчения — древесные частицы правильной прямоугольной формы, получаемые в процессе измельчения древесного сырья рубильной машиной и представляющие из себя коптильный материал, используемый в дымогенераторах тления, в том числе в кемпинговых коптильнях."},{"page_url":"https://hr.wikipedia.org/wiki/Monopolowa","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1b/Monopolowa_Baczewski.JPG","page_title":"Monopolowa","context_page_description":"Monopolowa je vrsta votke koja se proizvodi u Austriji u destileriji \\"Altvater Gessler & J.A. Baczewski\\". Ova votka se dobiva višestrukom destilacijom krumpira, a smatra se jednom od najboljih votki na svijetu zajedno s votkom Stolichnaya."},{"page_url":"https://es.wikipedia.org/wiki/Departamento_de_%C3%81ncash","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/Antamina_Mine_Tailings_Pond.jpg","page_title":"Departamento de Áncash","context_page_description":"Áncash o Ancash es un departamento de la República del Perú creado el 12 de junio de 1835, ​ en la zona occidental y central del país, limitando con el océano Pacífico al oeste y con los departamentos de La Libertad por el norte, Huánuco por el este, y Lima por el sur. Su capital es Huaraz y su ciudad más poblada, Chimbote. Con 29,6 hab/km² es el octavo departamento más densamente poblado, por detrás de Lima, Lambayeque, La Libertad, Piura, Tumbes, Cajamarca e Ica.\\nDentro del departamento, se diferencian dos tipos de paisajes: la árida llanura costera que domina toda la zona occidental del departamento con un ancho máximo promedio de 15 km, y las zonas montañosas, que ocupan 72 % del territorio departamental y que comprende a los accidentes geográficos de las cordilleras Blanca, Negra, Huallanca, Huayhuash, la Sierra Oriental de Áncash y el Cañón del Marañón, zonas que en conjunto poseen 20 picos por encima de los 6000 msnm. Estas formaciones montañosas dan origen a ríos muy importantes como el Santa y el Pativilca que desembocan en el océano Pacífico, el Yanamayo y el Marañón, afluentes del Amazonas."},{"page_url":"https://ast.wikipedia.org/wiki/Pedro_Casariego_Hern%C3%A1ndez-Vaquero","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/29/Calle_de_Orense%2C4.JPG","page_title":"Pedro Casariego Hernández-Vaquero","context_page_description":"Pedro Casariego Hernández-Vaquero foi un arquiteutu y pintor español. Perteneciente a una familia d'arquiteutos. El so padre foi Francisco Casariego Terrero col que comparte dambes aficiones, el so hermanu: Francisco Casariego Hernández-Vaquero. Collaboró na so vida profesional con Genaro Ala Rodríguez. Ente les sos obres más destacaes cabo mentar la sede social d'Assicurazioni Generali, allugada nel Paséu de la Castellana."},{"page_url":"https://sv.wikipedia.org/wiki/Par_i_hj%C3%A4rter","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/91/Hart_to_Hart.jpg","page_title":"Par i hjärter","context_page_description":"Par i hjärter är en amerikansk kriminalserie, skapad av Sidney Sheldon, producerad av Aaron Spelling och Leonard Goldberg. Den sändes från 1979 till 1984 på ABC.\\nSerien handlar om det framgångsrika äkta paret Jonathan och Jennifer Hart. Han är en inflytelserik företagsledare och hon har en karriär som frilansjournalist. De längtar efter äventyr och ställer upp som privatdetektiver. Deras allt i allo och privatchaufför, Max, har en viktig del i deras framgång.\\nI Sverige sändes serien första gången den 1 juli 1983 på TV2. Serien har repriserats flera gånger i olika kanaler."},{"page_url":"https://hu.wikipedia.org/wiki/Portug%C3%A1lia_kult%C3%BAr%C3%A1ja","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/11/Igreja_Romanica_de_Rates_geral.JPG","page_title":"Portugália kultúrája","context_page_description":"Portugália kultúrája az ókori római civilizáció latin kultúrájának gyökereihez visszavezethető, kelta befolyással, a római és az ibériai kelta kultúra keverékéből alakult ki, de hosszú történelme során számos nép befolyásolta az ország kultúráját, így a rómaiak előtt a föníciaiak, a luzitánok, a gallaecusok, majd később a különféle germán népek, a vizigótok, a zsidók és a mórok is."},{"page_url":"https://simple.wikipedia.org/wiki/Dance","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/20/Moonwalk_y_tiptoe.gif","page_title":"Dance","context_page_description":"Dance is a performing art. It is described in many ways. It is when people move to a musical rhythm. They may be alone, or in a group. The dance may be an informal play, a part of a ritual, or a part of a professional performance. There are many kinds of dances, and every human society has its own dances.\\nAs with other performing arts, some people dance to express their feelings and emotions, or to feel better. Dance can be used to tell a story. In some societies, dance goes with song as well as music. Dancing is sometimes done as sport, and has similar athletic aspects. People who want to learn to dance can go to dance schools. It may take years of practice to become an experienced and capable dancer.\\nTo plan a dance is called choreography, done by a choreographer. Often this goes with music, and fits into a certain style. Dances may be planned in detail, or they may be whatever dancers feel like doing. However, most dancing does follow some general style or pattern. One style is the couple dance, where a man and a woman dance together. Other dances need an ensemble, a group of people together to make it work."},{"page_url":"https://no.wikipedia.org/wiki/Notre-Dame_de_Bonne-Nouvelle","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/NDBonneNouvelleChoeur.JPG","page_title":"Notre-Dame de Bonne-Nouvelle","context_page_description":"Notre-Dame de Bonne-Nouvelle er en kirkebygning i Paris i 2. arrondissement. Kirken, som ligger ved rue de la Lune, ble oppført i nyklassisistisk stil mellom 1823 og 1830 etter tegninger av arkitekten Étienne-Hippolyte Godde, bybyggmester i Paris.\\nKirken består av et treskips langhus fordelt på fem travéer. Det med tønnehvelv dekkede mellomskipet leder frem til en halvsirkelformet abside som dekkes av et hjelmhvelv. Rundbuer hvilende på doriske søyler danner arkader som skiller hovedskipet fra de begge sideskipene som leder ut til tolv mindre kor. Til kirkerommets utsmykning bidro blant andre kunstneren Alexandre-Denis Abel de Pujol."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E9%9D%A2%E6%9D%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6b/Agodashi_Ramen_Ikitsuki_Nagasaki_2008.jpg","page_title":"面条","context_page_description":"麵或麵條，一種用穀物或豆類的麵粉加水和成麵團，之後或者壓或擀製成片再切或壓，或者使用搓、拉、捏等手段，製成條狀或小片狀的食品。可再經煮、炒、燴、炸等烹調方式食用。\\n關於麵條的最早文字記錄在中國東漢時期，2005年時，中國社會科學院考古研究所研究員葉茂林在青海省的喇家遺址中發現了距今4,000年以上歷史的麵條，長50公分，寬0.3公分，由粟製成，根據最早的史料及實物佐證，因此通常認為麵起源於中國新石器時代。"},{"page_url":"https://en.wikipedia.org/wiki/Flag_of_the_Association_of_Southeast_Asian_Nations","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/Flag_of_Asean%2C_Philippine_Post_Office.jpg","page_title":"Flag of the Association of Southeast Asian Nations","context_page_description":"The Flag of the Association of Southeast Asian Nations is one of the official symbols of the Association of Southeast Asian Nations. It consists of the official emblem of ASEAN on a blue background."},{"page_url":"https://gl.wikipedia.org/wiki/Globo_de_papel_seda","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c3/BallonKathedrale01_edit.jpg","page_title":"Globo de papel seda","context_page_description":"Os globos de papel seda son aeronaves non tripuladas que forman parte da identidade cultural de países como Arxentina, Brasil, Colombia, Perú, México e moitos de Asia. O seu obxectivo primixenio era o de ser un simple pasatempo, pero acabaron converténdose unha verdadeira arte: realízanse obras de luz e cor e, conceptualmente, \\"píntase con papel\\".\\nA pesar disto, en países como Brasil están totalmente prohibidos, e esta práctica está considerada como delito polas autoridades competentes. O conto O Globo Fantasma de Rubem Fonseca narra de forma maxistral este conflito.\\nA razón débese a que o globo utiliza o principio de Arquimedes para ser menos denso que o aire e poderse elevar. En consecuencia, é necesario de empregar un dispositivo que produza calor no interior do globo, para facer que o aire do seu interior sexa menos denso que o do ambiente. Este elemento, que se constitúe como o \\"motor\\" do globo, consiste nun queimador de papel absorbente e parafina, que van acesos, aínda que a combustión é lenta, total e sen brasa."},{"page_url":"https://fr.wikipedia.org/wiki/Mus%C3%A9e_des_Beaux-Arts_de_Grenade","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/52/MBAGR_os_liberacionspedro_jramirez.jpg","page_title":"Musée des Beaux-Arts de Grenade","context_page_description":"Le musée des Beaux-Arts de Grenade est une pinacothèque située à Grenade en Andalousie, en Espagne.\\nLe musée a d'abord occupé l'ancien couvent dominicain de Santa Cruz la Real et a été inauguré en 1839, ce qui en fait la plus ancienne pinacothèque provinciale d'Espagne. Après plusieurs changements de lieu, depuis 1958 il a son siège au palais de Charles Quint, remarquable édifice renaissance rattaché à l'Alhambra.\\nLes collections sont principalement constituées de peintures et de sculptures, du XVᵉ au XXᵉ siècle. Les fonds les plus importants et les plus riches proviennent de fondations religieuses désaffectées au XIXᵉ siècle. Des œuvres déposées par le musée du Prado ont été ajoutées plus tard, ainsi que des achats, à la fois des exemples d'art récent et de maîtres anciens."},{"page_url":"https://zh.wikipedia.org/wiki/%E9%97%AA%E5%AD%98%E7%9B%98","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7c/USB_Flash_Drive_animated.gif","page_title":"闪存盘","context_page_description":"隨身碟又稱閃存盤，是一種使用USB介面連接電腦，通常透過快閃記憶體來進行數據儲存的小型可攜式儲存裝置。一般USB隨身碟體積極小、重量輕、可重複寫入，面世後迅速普及並取代傳統的軟碟及軟碟機。有時讀卡機也會被歸類為隨身碟，但這類裝置的記憶晶片並不是內建的，而是可以抽換的記憶卡。\\n相較於其他可攜式儲存裝置，USB隨身碟有許多優點：較不佔空間、能儲存較多資料、讀寫速度較快、不會因刮傷或發霉而無法使用。這類的USB儲存裝置使用USB大量儲存裝置標準，在近代的作業系統如Windows、OS X、Linux與Unix中皆有內建支援。\\nUSB隨身碟通常使用塑膠或金屬外殼，內部含有一張小的印刷電路板，讓USB隨身碟尺寸小到像鑰匙圈飾物一樣能夠放到口袋中，或是串在頸繩上。只有USB連接頭突出於保護殼外，且通常被一個小蓋子蓋住。大多數的USB隨身碟使用標準的Type-A USB接頭，這使得它們可以直接插入個人電腦上的USB介面中。\\n要存取USB隨身碟的資料，就必須把USB隨身碟連接到電腦；無論是直接連接到電腦內建的USB控制器或是一個USB集線器都可以。只有當被插入USB埠時，USB隨身碟才會啟動，而所需的電力也由USB連接埠供給DC+5V。"},{"page_url":"https://hu.wikipedia.org/wiki/Vanuatu","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/72/The_Landing_at_Tana_one_of_the_New_Hebrides%2C_by_William_Hodges.jpg","page_title":"Vanuatu","context_page_description":"Vanuatu a Csendes-óceán délnyugati részén, Melanéziában, Új-Kaledóniától északkeletre, a Korall-tenger keleti szélén található."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9D%D0%B5%D0%B2%D1%96%D0%BB%D0%B5%D1%82%D1%82-%D0%B0%D0%BD-%D0%A8%D0%B0%D1%80%D0%BD%D1%96","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/03/Neuvillette-en-Charnie_-_plaque_de_cocher.jpg","page_title":"Невілетт-ан-Шарні","context_page_description":"Невіле́тт-ан-Шарні́ — муніципалітет у Франції, у регіоні Пеї-де-ла-Луар, департамент Сарта. Населення — 305 осіб.\\nМуніципалітет розташований на відстані близько 210 км на південний захід від Парижа, 140 км на північний схід від Нанта, 32 км на захід від Ле-Мана."},{"page_url":"https://de.wikipedia.org/wiki/Heinkel_HE_57","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0b/Heinkel_HE_57_from_Flight_1931-05-29.jpg","page_title":"Heinkel HE 57","context_page_description":"Die Heinkel HE 57 „Heron“ war der erste Versuch Ernst Heinkels, im Metallflugzeugbau Fuß zu fassen. Die erste Version des Amphibienflugzeugs war zu schwer geraten und konnte bei den „Rollversuchen“ im April 1930 nicht vom Wasser abheben.\\nIm Dezember 1930 ging das komplett umkonstruierte Modell erneut in die Flugerprobung und erhielt im Mai 1931 die Zulassung. Ein kommerzieller Erfolg wurde die Maschine aber nicht, Heinkel konnte lediglich ein Exemplar verkaufen. Nach einer Bruchlandung am 30. Juli 1937 wurde die „Heron“ verschrottet."},{"page_url":"https://ckb.wikipedia.org/wiki/%D8%B9%DB%95%D8%A8%D8%AF%D9%88%D9%84%D9%88%DB%95%D9%84%DB%8C_%D9%85%D8%AD%DB%95%D9%85%D9%85%DB%95%D8%AF_%D8%B9%DB%95%D9%84%DB%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a6/Cabdiweli_Maxamed_Cali.jpg","page_title":"عەبدولوەلی محەممەد عەلی","context_page_description":"عەبدول وەلی محەممەد عەلی چالاکوانێکی بواری ڕامیاری و ئابووری سۆماڵیە لە ٢ی حوزەیرانی ١٩٦٧ لە باکووری سۆماڵ لە دایک بووە. عەلی خاوەنی ڕەگەزنامەی سۆماڵی و ئەمریکییە و بێجگە لە زمانی دایکی، زمانەکانی عەرەبی، ئینگلیزی و ئیتاڵی دەزانێت. عەلی شارەزاییەکی باشی لە ئابووریدا ھەیە و لەگەڵ چەندین ڕێکخراو و دەزگای نێودەوڵەتی کاری کردووە وەک سندووقی دراوی نێودەوڵەتی و بانکی نێودەوڵەتی، پلەی ماستەری بەدەست ھێناوە لە کارگێڕی و ئابووری گشتی لە زانکۆی ھارڤارد و دواتریش پلەی دکتۆرای لە زانکۆی جۆرج مەیسن بە دەست ھێناوە. دوا جاریش لە ١١ی مایسی ٢٠١١دا کرا بە جێگری سەرۆک وەزیرانی سۆماڵ.\\nدەروازەی ژیاننامە"},{"page_url":"https://tr.wikipedia.org/wiki/Osmanl%C4%B1_%C4%B0mparatorlu%C4%9Fu_kronolojisi","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/84/Vienna_Battle_1683.jpg","page_title":"Osmanlı İmparatorluğu kronolojisi","context_page_description":"Osmanlı İmparatorluğu kronolojisi:"},{"page_url":"https://de.wikipedia.org/wiki/Abteikirche_Mozac","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/81/F08.Mozac.0109.JPG","page_title":"Abteikirche Mozac","context_page_description":"Die ehemalige Abteikirche Saint-Pierre und Saint-Caprais liegt inmitten der Ortschaft Mozac, einem unmittelbaren Vorort westlich von Riom in der Region Auvergne-Rhône-Alpes im Département Puy-de-Dôme, etwa zwanzig Kilometer nördlich von Clermont-Ferrand."},{"page_url":"https://en.wikipedia.org/wiki/Shenyang_J-6","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c1/Shenyang_J-6_and_2_Mig_21s.jpg","page_title":"Shenyang J-6","context_page_description":"The Shenyang J-6 is the Chinese-built version of the Soviet MiG-19 'Farmer' fighter aircraft, the world's first mass-produced supersonic aircraft."},{"page_url":"https://pl.wikipedia.org/wiki/Ramanathapuram_(dystrykt)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/79/India_Tamil_Nadu_districts_Ramanathapuram.svg","page_title":"Ramanathapuram (dystrykt)","context_page_description":"Ramanathapuram – jeden z dystryktów stanu Tamilnadu. Od północy graniczy z dystryktami Sivaganga i Pudukkottai, od wschodu z Cieśniną Palk, na południowym wschodzie przez archipelag wysp przebiega granica ze Sri Lanką, na południu znajdują się wody Zatoki Mannar, na zachodzie dystrykty Tuticorin i Virudhunagar. Stolicą dystryktu Ramanathapuram jest miasto Ramanathapuram."},{"page_url":"https://ur.wikipedia.org/wiki/%D8%A8%D8%B1%D8%B3%D9%B9%D9%84_%DA%A9%D8%A7%D9%84%D8%AC%D8%8C_%D9%BE%D9%86%D8%B3%D9%84%D9%88%D8%A7%D9%86%DB%8C%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3f/Bristol_College_1919.JPG","page_title":"برسٹل کالج، پنسلوانیا","context_page_description":"برسٹل کالج، پنسلوانیا ریاستہائے متحدہ امریکا کا ایک رہائشی علاقہ جو 701-721 Shadyside Ave., Croydon, Pennsylvania میں واقع ہے۔"},{"page_url":"https://ko.wikipedia.org/wiki/%EC%9D%B4%EC%93%B0%EC%93%B0%EB%B0%94%EC%8B%9C_%EC%97%AD","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/64/ItsutsubashiEki2005-4.jpg","page_title":"이쓰쓰바시 역","context_page_description":"이쓰쓰바시 역은 일본 미야기현 센다이시 아오바구 이쓰쓰바시 2초메에 있는 센다이 시 지하철 난보쿠 선의 역이다. 역 번호는 N 11이다. 본 문서에서는 과거에 존재한 센다이 시영 전차의 이쓰쓰바시 정류장에 대해서도 기술한다."},{"page_url":"https://it.wikipedia.org/wiki/Combattimenti_nella_citt%C3%A0_di_Stalingrado","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/52/Stalingrad_Orlowka_Frontvorsprung.jpg","page_title":"Combattimenti nella città di Stalingrado","context_page_description":"I combattimenti nella città di Stalingrado furono una fase della grande battaglia combattuta nella seconda metà del 1942 tra le forze della Wehrmacht e quelle dell'Armata Rossa nel settore meridionale tra il Don e il Volga del fronte orientale durante la seconda guerra mondiale.\\nPer oltre due mesi la 6ª Armata del generale Friedrich Paulus sferrò una serie di attacchi violenti e sanguinosi per cercare di conquistare l'importante città industriale di Stalingrado e schiacciare le forze della 62ª Armata sovietica al comando del generale Vasilij Čujkov asserragliata all'interno dell'abitato. I combattimenti, tra i più duri e cruenti di tutta la guerra, si svolsero in gran parte a distanza ravvicinata tra le rovine degli edifici e dei grandi impianti industriali della città devastata e costarono dure perdite ad entrambe le parti."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%90%D1%80%D1%88%D0%B0%D0%BA%D1%96%D0%B4%D0%B8_(%D1%86%D0%B0%D1%80%D1%96_%D0%9F%D0%B0%D1%80%D1%84%D1%96%D1%97)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b2/PhraatesIIICoinHistoryofIran.jpg","page_title":"Аршакіди (царі Парфії)","context_page_description":"Аршакіди — царська династія, що правила у стародавній Парфії. Часто йменується в історіографії Пехлевідами."},{"page_url":"https://de.wikipedia.org/wiki/Alexander_R%C3%BCstow","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b1/Ar07.jpg","page_title":"Alexander Rüstow","context_page_description":"Alexander Rüstow war ein deutscher Soziologe und Wirtschaftswissenschaftler. Er war ein Großneffe von Wilhelm Rüstow.\\nRüstow prägte 1938 auf dem Colloque Walter Lippmann den Begriff Neoliberalismus als Bezeichnung für eine erneuerte liberale Ordnung, die sich vom Laissez-faire-Liberalismus unterscheiden sollte. Im Laufe der Zeit erfuhr der Begriff im allgemeinen Sprachgebrauch einen Bedeutungswandel. Er ist ein Hauptvertreter des dieser heterogenen Denkrichtung zugeordneten Soziologischen Liberalismus. Zudem wird er als einer der Gründerväter der Sozialen Marktwirtschaft bezeichnet. Das im Grundgesetz der Bundesrepublik Deutschland verankerte konstruktive Misstrauensvotum geht teilweise auf Rüstows Kritik der Weimarer Verfassung zurück."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_personen_geboren_in_1950","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/81/PhilHardingArchaeologist.jpg","page_title":"Lijst van personen geboren in 1950","context_page_description":"Dit is een lijst van personen die geboren zijn in 1950.\\nDe inhoud van deze pagina is gebaseerd op gegevens in Wikidata. Als er onvolkomenheden in deze lijst zitten, gelieve dan aldaar de gegevens aan te passen. Achter iedere persoon is hiervoor een link aanwezig met de aanduiding bewerken.\\nWijzigingen in Wikidata worden met enige regelmatigheid geautomatiseerd overgenomen naar deze pagina."},{"page_url":"https://th.wikipedia.org/wiki/%E0%B8%8A%E0%B8%B2%E0%B8%A7%E0%B8%AD%E0%B8%B2%E0%B8%A3%E0%B9%8C%E0%B9%80%E0%B8%88%E0%B8%99%E0%B8%95%E0%B8%B4%E0%B8%99%E0%B8%B2","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f7/Yrigoyen_en_ventanilla_del_ferrocarril_viaje_a_Santa_Fe_campa%C3%B1a_electoral_de_1926..jpg","page_title":"ชาวอาร์เจนตินา","context_page_description":"ชาวอาร์เจนตินา คือประชาชนที่เกิดในประเทศอาร์เจนตินา"},{"page_url":"https://az.wikipedia.org/wiki/Raquza_(%C9%99yal%C9%99t)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5e/Scicli_%28Sicilia%29_2010_017.jpg","page_title":"Raquza (əyalət)","context_page_description":"Raquza — İtaliyanın inzibati bölgüsündə, Siciliya muxtar regionuna aid əyalətdir. Sirakuza əyalətinin inzibati mərkəzi Raquza şəhəridir.\\nƏyalətin sahəsi 1.614,02 km²olub, şimalda Kataniya əyaləti, şərqdə Sirakuza, qərbdə Kaltanissetta əyaləti və cənubda isə Aralıq dənizi suları ilə əhatələnmişdir. Əyalət 1927 ci ildə təsis edilmişdir."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%91%D1%80%D0%B0%D1%81%D0%B5%D0%B7","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/27/Brasseuse_%2860%29%2C_%C3%A9glise_Saint-Pierre%2C_rue_Charles-de-la-B%C3%A9doy%C3%A8re_%281%29.jpg","page_title":"Брасез","context_page_description":"Брасез насеље је и општина у североисточној Француској у региону Пикардија, у департману Оаза која припада префектури Санлис.\\nПо подацима из 2011. године у општини је живело 90 становника, а густина насељености је износила 10,84 становника/km². Општина се простире на површини од 8,3 km². Налази се на средњој надморској висини од 104 метара."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%82%D8%A7%D8%A6%D9%85%D8%A9_%D9%85%D9%84%D9%88%D9%83_%D9%86%D8%A7%D9%81%D8%A7%D8%B1%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d8/Catherine_I_of_Navarre.jpg","page_title":"قائمة ملوك نافارا","context_page_description":"هذه قائمة تحتوي على ملوك أو ملكات نافارا منذ عام 824 حتى تقسيمها بين ممالك إسبانيا في بدايات القرن السادس عشر حيث عرفت بـنافارا العليا، وأصبحت نافارا السفلى مستقلة حتى ضمها مع فرنسا في 1620."},{"page_url":"https://es.wikipedia.org/wiki/Luis_Valent%C3%ADn_Ferrada","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/08/Luis_Valent%C3%ADn_Ferrada_BCN.jpg","page_title":"Luis Valentín Ferrada","context_page_description":"Luis Valentín Ferrada Valenzuela es un abogado y político chileno, exdiputado de Renovación Nacional por el Distrito n.º 39."},{"page_url":"https://de.wikipedia.org/wiki/August_Ganther","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/49/Ganther.jpg","page_title":"August Ganther","context_page_description":"August Ganther war ein Schwarzwälder Heimatdichter, dessen Werke großenteils im alemannischen Dialekt verfasst sind."},{"page_url":"https://en.wikipedia.org/wiki/Gendarmery_(Serbia)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/94/E%C5%A1alon_%C5%BEandarmerije_MUPa_Srbije_-_Odbrana_slobode_2019_Ni%C5%A1_2.jpg","page_title":"Gendarmery (Serbia)","context_page_description":"The Gendarmery is an armed police force of the Serbian police. It was formed on 28 June 2001, after the disbandment of the Special Police Units. Gendarmery in Serbia existed in previous form from 1860 to 1920. As a special unit inside Serbian police, its role can be compared to those of Russian OMON and former Ukrainian Berkut units.\\nAs of 2017, Gendarmery consists of about 2,800 members. The Command of the Gendarmery is in Belgrade.\\nThe gendarmery's duties are both civilian and military, including securing the 'Ground Safety Zone' along the administrative line with Kosovo and providing disaster rescue teams."},{"page_url":"https://ce.wikipedia.org/wiki/%D0%A8%D0%B0%D0%BF%D0%BA%D0%B8%D0%BD%D0%BE_(%D0%A2%D0%B0%D0%BC%D0%B1%D0%BE%D0%B2%D0%BD_%D0%BE%D0%B1%D0%BB%D0%B0%D1%81%D1%82%D1%8C)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c0/%D0%A1%D0%B5%D0%BB%D0%BE_%D0%A8%D0%B0%D0%BF%D0%BA%D0%B8%D0%BD%D0%BE_%28%D0%A2%D0%B0%D0%BC%D0%B1%D0%BE%D0%B2%D1%81%D0%BA%D0%B0%D1%8F_%D0%BE%D0%B1%D0%BB%D0%B0%D1%81%D1%82%D1%8C%29._%D0%9A%D0%B0%D0%B7%D0%B0%D1%87%D0%B8%D0%B9_%D1%86%D0%B5%D0%BD%D1%82%D1%80_-_%D0%BC%D1%83%D0%B7%D0%B5%D0%B9_%22%D0%98%D1%81%D1%82%D0%BE%D0%BA%D0%B8%22_-_%D0%B4%D0%BE_%D1%80%D0%B5%D0%B2%D0%BE%D0%BB%D1%8E%D1%86%D0%B8%D0%B8_-_%D0%B7%D0%B4%D0%B0%D0%BD%D0%B8%D0%B5_%D0%A8%D0%B0%D0%BF%D0%BA%D0%B8%D0%BD%D1%81%D0%BA%D0%BE%D0%B3%D0%BE_%D0%B2%D0%BE%D0%BB%D0%BE%D1%81%D1%82%D0%BD%D0%BE%D0%B3%D0%BE_%D0%BF%D1%80%D0%B0%D0%B2%D0%BB%D0%B5%D0%BD%D0%B8%D1%8F.jpg","page_title":"Шапкино (Тамбовн область)","context_page_description":"Шапкино — Российн Федерацин Тамбовн областан Мучкапскан кӀоштан юкъа йогӀу эвла."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkmale_in_Aurich","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6d/Aurich%2C_Osterstrasse_26.jpg","page_title":"Liste der Baudenkmale in Aurich","context_page_description":"Die Liste der Baudenkmale in Aurich enthält die nach dem Niedersächsischen Denkmalschutzgesetz geschützten Baudenkmale in der ostfriesischen Gemeinde Aurich.\\nGrundlage ist die veröffentlichte Denkmalliste des Landkreises.\\nBaudenkmale sind „im Sinne des Gesetzes Bodendenkmale, bewegliche Denkmale und Denkmale der Erdgeschichte.“"},{"page_url":"https://uk.wikipedia.org/wiki/%D0%93%D0%BE%D0%BB%D0%BE%D0%B2%D0%B0_%D0%B0%D0%B4%D0%BC%D1%96%D0%BD%D1%96%D1%81%D1%82%D1%80%D0%B0%D1%86%D1%96%D1%97_%D0%91%D1%96%D0%BB%D0%BE%D0%B3%D0%BE_%D0%B4%D0%BE%D0%BC%D1%83","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6d/Kenny_O%27Donnell.jpg","page_title":"Голова адміністрації Білого дому","context_page_description":"Голова адміністрації Білого дому— посада, яка є наступником неофіційної ролі особистого секретаря Президента США. Ця роль була формалізована у посаду Помічника Президента в 1946 році і отримала нинішню назву в 1961 році. Нині посада офіційно називається Помічник Президента та голова адміністрації. Голова адміністрації є політичним призначенцем Президента, і це призначення не потребує затвердження Сенатом або ким-небудь іншим. Голова адміністрації підпорядковується тільки Президенту і говорить від його імені, а Президент несе повну відповідальність за дії голови адміністрації. Юридично, Президент не зобов'язаний призначати голову адміністрації, але всі президенти починаючи із Гаррі Трумена це робили. В чинній адміністрації Дональда Трампа головою адміністрації Білого дому є Марк Медоуз, який замінив виконувача обов'язів Міка Малвейні 31 березня 2020. До них головами адміністрації при Трампі були Джон Келлі та Райнс Прібус."},{"page_url":"https://pt.wikipedia.org/wiki/Suiriri","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/2d/Pachyramphus_albescens.jpg","page_title":"Suiriri","context_page_description":"Suiriri é um gênero de aves da família Tyrannidae, que contem as seguintes espécies:\\nSuiriri-cinzento, Suiriri suiriri\\nSuiriri-do-sul, Suiriri suiriri\\nSuiriri-do-cerrado, Suiriri affinis\\nSuirí-da-chapada, Suiriri islerorum"},{"page_url":"https://hu.wikipedia.org/wiki/Alkoholos_ital","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/20/Palinka.jpg","page_title":"Alkoholos ital","context_page_description":"Az alkoholos ital olyan ital, mely jelentős mennyiségű etanolt tartalmaz, és ennek köszönhetően narkotikus hatása van. A legtöbb országban az alkoholt tartalmazó italok fogyasztása legális; gyártásukat, eladásukat és fogyasztásukat több mint 100 országban törvények szabályozzák. Ezen törvények egyik legfontosabb eleme, hogy milyen életkorú állampolgárok ihatnak alkoholt. A minimális életkor 16 és 25 életév közt változik az országtól és néha az ital típusától is függően. A legtöbb országban 18 éves kor fölött legális az alkoholfogyasztás.\\nMinden alkoholos ital természetes erjedésből származó alkoholt tartalmaz, az erjedést azonban gyakran lepárlás követi. Ezért az alkoholos italok két fő csoportba sorolhatók: erjesztett italok és égetett szeszes italok. Az alkohol a legtöbb cukortartalmú italban is előfordul, de a jelentéktelen alkoholtartalmú italokat nem nevezzük alkoholos italoknak.\\nAz alkoholos italokat a köznyelvben, a vendéglátásban vagy a jogban gyakran szeszes italoknak nevezik. A szakmai terminológiában azonban a szeszes ital kizárólag égetett szeszes italokat jelent."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%88%D9%84%D9%8A%D8%A7%D9%85_%D9%88%D9%8A%D8%A8%D8%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/98/William_Whipper_portrait.png","page_title":"وليام ويبر","context_page_description":"وليام ويبر كان من الأمريكيين الأفارقة ومن الإبطاليين. كان ويبر رجل أعمال ناجح لعب دورًا رئيسيًا كمصلح في الحركة المناهضة للعبودية. دعا إلى اللاعنف وشارك في تأسيس الجمعية الأمريكية للإصلاح الأخلاقي، وهي منظمة أمريكية إفريقية إبطالية. يجسد وليام ويبر الازدهار الفريد الذي حققه الشماليون ذوو البشرة السوداء في منتصف القرن التاسع عشر."},{"page_url":"https://ur.wikipedia.org/wiki/%D9%85%D9%88%DB%8C%D9%88%DA%AF%D8%A7%D9%84%D9%BE%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b5/Port_of_Moyogalpa.jpg","page_title":"مویوگالپا","context_page_description":"مویوگالپا نکاراگوا کا ایک آباد مقام جو ریواز محکمہ میں واقع ہے۔"},{"page_url":"https://fr.wikipedia.org/wiki/Asperitas","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/07/Beautiful_clouds.JPG","page_title":"Asperitas","context_page_description":"Un asperitas est une caractéristique supplémentaire de plusieurs genres de nuages et non un nuage particulier. Il fut proposé pour la première fois en 2009, sous le nom asperatus, à l'Atlas international des nuages de l'Organisation météorologique mondiale, comme formation nuageuse distincte. C'était la première fois depuis 1956 que cela fut proposé à l'Atlas international des nuages.\\nEn 2017, l’asperitas a été reconnu par l'OMM dans la nouvelle version de l'Atlas. Le phénomène est surnommé la « rivière du ciel » à cause de « sa beauté et de ses ondulations »."},{"page_url":"https://th.wikipedia.org/wiki/%E0%B8%A1%E0%B8%B2%E0%B8%A3%E0%B8%B5%E0%B9%82%E0%B8%AD_%E0%B8%9A%E0%B8%B2%E0%B9%82%E0%B8%A5%E0%B9%80%E0%B8%95%E0%B8%A5%E0%B8%A5%E0%B8%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/22/Mario_Balotelli_Euro_2012_vs_England_01.JPG","page_title":"มารีโอ บาโลเตลลี","context_page_description":"มารีโอ บาโลเตลลี บาร์วูอา นักฟุตบอลอาชีพชาวอิตาลี เล่นในตำแหน่งกองหน้าตัวรุกให้กับเบรชชา โดยก่อนหน้านั้นได้เล่นให้กับเอ.ซี. มิลาน โดยยืมตัวมาจากลิเวอร์พูล และทีมชาติอิตาลี ทั้งนี้บาโลเตลลีเป็นนักฟุตบอลที่เป็นที่รับรู้กันดีว่า มีพฤติกรรมส่วนตัวที่แย่กับหลายสโมสร\\nบาโลเตลลี เกิดเมื่อวันที่ 12 สิงหาคม ค.ศ. 1990 เป็นชาวอิตาลีเชื้อสายกานา ครอบครัวมีฐานะยากจนมาก แถมมีปัญหาสุขภาพตั้งแต่เด็ก ทำให้พ่อและแม่ต้องตัดสินใจส่งให้กับผู้ที่มีฐานะร่ำรวยกว่าดูแลเมื่ออายุ 3 ขวบ\\nบาโลเตลลีเริ่มอาชีพในฐานะนักฟุตบอลอาชีพกับลูเมซซาเน และได้เล่นในทีมชุดใหญ่เพียง 2 ครั้ง เคยทดสอบฝีเท้ากับบาร์เซโลนา แต่ไม่ประสบความสำเร็จ จากนั้นได้ร่วมกับอินเตอร์มิลาน ในปี ค.ศ. 2007 โรแบร์โต มันชีนี ผู้จัดการทีมนำบาโลเตลลีเข้าสู่ทีมชุดใหญ่ แต่เมื่อมันชีนีออกจากทีมไป วินัยของบาโลเตลลีก็แย่ลง บาโลเตลลีไม่ลงรอยกับโชเซ มูรีนโย ผู้ช่วยผู้จัดการทีม และในเดือนมกราคม ค.ศ. 2009 ก็ถูกพักออกไปจากทีมชุดใหญ่หลังมีปัญหาด้านวินัย ปัญหาเริ่มมากขึ้นในเดือนมีนาคม ค.ศ. 2010 เมื่อถูกวิจารณ์อย่างหนักจากแฟน ๆ อินเตอร์มิลาน เมื่อบาโลเตลลีออกรายการโทรทัศน์อิตาลีที่ชื่อ Striscia la Notizia โดยสวมเสื้อเอ.ซี."},{"page_url":"https://es.wikipedia.org/wiki/Pedro_de_Francia_y_de_Provenza","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/43/Peter_of_Alencon.jpg","page_title":"Pedro de Francia y de Provenza","context_page_description":"Pedro de Francia o Pedro I de Alencón, Tierra Santa, 1251 - Catona, Calabria enero 1283, fue un noble francés, miembro de la dinastía de los Capetos."},{"page_url":"https://cs.wikipedia.org/wiki/Jack_Russell_teri%C3%A9r","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/40/Broken_Coat_Jack_Russell_Terrier_%282006%29.jpg","page_title":"Jack Russell teriér","context_page_description":"Jack Russell teriér, zkratkovitě i JRT, je psí plemeno původem z Anglie. Standard plemene rozeznává tři varianty: krátkosrstou, lámanou a drsnosrstou. Všechny tyto varianty odlišuje jen typ chlupu. Jedná se o temperamentního, svéhlavého a inteligentního psa, který je velmi populární po celém světě. Typický je i jeho přátelský vztah k lidem a především dětem. Často bývá využíván pro pracovní a lovecké účely, například vyhánění lišek z nor či lov drobnější zvěře; převažuje ale chov psa jako společníka. Průměrně se dožívá až 15 let."},{"page_url":"https://de.wikipedia.org/wiki/Viking_River_Cruises","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/4d/Viking_Odin_%28ship%2C_2012%29_004.JPG","page_title":"Viking River Cruises","context_page_description":"Viking River Cruises AG ist ein weltweit agierender Anbieter von Flusskreuzfahrten. Der Hauptsitz des Unternehmens ist in Basel, Schweiz. Bis Ende 2013 bestand eine deutsche Niederlassung in Köln, die Viking Flusskreuzfahrten GmbH. Sie wurde geschlossen, weil Unternehmensstrategie ist, sich auf die lukrativeren englischsprachigen Märkte zu konzentrieren. Viking River Cruises ist eines der weltweit grössten Flusskreuzfahrt-Unternehmen. Im Jahr 2006 erzielte es einen Umsatz von über 200 Millionen US-Dollar. Weltweit sind 1700 Mitarbeiter an Bord und an Land beschäftigt."},{"page_url":"https://en.wikipedia.org/wiki/CUGBP_Elav-like_family_member_4","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/9d/Protein_BRUNOL4_PDB_2dgp.png","page_title":"CUGBP Elav-like family member 4","context_page_description":"CUGBP Elav-like family member 4 also known as bruno-like protein 4 is a protein that in humans is encoded by the CELF4 gene."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Autobahnen_in_Griechenland","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f2/Traffic_Sign_GR_-_KOK_2009_OMOE-KSA_2003_-_PI-27_-_squared_-_VCT.svg","page_title":"Liste der Autobahnen in Griechenland","context_page_description":"Dies ist eine Liste aller griechischen Autobahnen."},{"page_url":"https://fr.wikipedia.org/wiki/Claudius_Pompeianus","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/79/Marco_aurelio_e_barbaros_-_museus_capitolinos.jpg","page_title":"Claudius Pompeianus","context_page_description":"Tiberius Claudius Pompeianus Quintianus est né au début des années 130 et mort un peu après 193. Il fut un des généraux les plus brillants de Marc Aurèle, et sans doute celui qui fut le plus proche de l'empereur philosophe. Associé à la famille impériale par son mariage avec une fille de Marc Aurèle, il fut un personnage incontournable dans les années qui suivirent et fut jugé capable de prétendre au titre impérial, sans pourtant jamais franchir le pas."},{"page_url":"https://he.wikipedia.org/wiki/%D7%A4%D7%95%D7%A8%D7%93_%D7%A7%D7%95%D7%92%D7%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/62/1999_Ford_Cougar_2.0_%2812991164544%29.jpg","page_title":"פורד קוגר","context_page_description":"פורד קוגר היא מכונית ספורטיבית, בתצורת קופה, שתי דלתות, אשר יוצרה על ידי \\"פורד אירופה\\", חברת בת של קונצרן הרכב פורד, בבריטניה בין השנים 1998–2002, ובאוסטרליה בין השנים 1999–2004.\\nבין השנים 1999–2002 נמכר דגם \\"פורד קוגר\\" בארצות הברית ובקנדה תחת השם \\"Mercury Cougar\\". בשנת 1998 יוצר דגם \\"פורד קוגר\\" בארצות הברית.\\nסך הכול יוצרו 230,000 יחידות."},{"page_url":"https://pl.wikipedia.org/wiki/Rejon_perejas%C5%82awski","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/27/Coat_of_Arms_of_Pereiaslav-Khmelnytskiy_Raion_in_Kiev_Oblast.png","page_title":"Rejon perejasławski","context_page_description":"Rejon perejasławski – jednostka administracyjna w składzie obwodu kijowskiego Ukrainy.\\nPowstał w 1932. Ma powierzchnię 956 km² i liczy około 28 tysięcy mieszkańców. Siedzibą władz rejonu jest Perejasław.\\nW skład rejonu wchodzi 37 silskich rad, obejmujących 51 wsi."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_DAV-H%C3%BCtten","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/35/Ansbacher_Huette.JPG","page_title":"Liste der DAV-Hütten","context_page_description":"Die Liste der DAV-Hütten verzeichnet die Höhe, Berherbergungskapazität, Lage und Eigentümer der Schutzhütten des Deutschen Alpenvereins. Der DAV unterhält mit seinen Sektionen insgesamt 323 Hütten in Deutschland, Österreich und der Schweiz – 249 davon in den Alpen und 74 in den deutschen Mittelgebirgen. Der DAV betreibt auch 25 Vertragshäuser."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A8%D0%B0%D1%82%D0%B8%D0%BD%D1%81%D1%8C%D0%BA%D0%B0-%D0%9C%D0%B8%D1%86%D0%B8%D0%BA_%D0%86%D1%80%D0%B8%D0%BD%D0%B0_%D0%A1%D0%B5%D1%80%D0%B3%D1%96%D1%97%D0%B2%D0%BD%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1e/Ernest_the_hedgehog_book.jpg","page_title":"Шатинська-Мицик Ірина Сергіївна","context_page_description":"Шатинська-Мицик Ірина Сергіївна – науковець, кандидат медичних наук, перекладач, митець, автор понад 120 медичних публікацій, дитячої книги «Їжачок Ернест», працювала позаштатним журналістом видання «Ваше Здоров’я»."},{"page_url":"https://en.wikipedia.org/wiki/Winchester,_New_Hampshire","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ec/Conant_Library%2C_Winchester%2C_NH.jpg","page_title":"Winchester, New Hampshire","context_page_description":"Winchester is a town in Cheshire County, New Hampshire, United States. The population was 4,341 at the 2010 census. The primary settlement in the town, where 1,733 people resided at the 2010 census, is defined by the U.S. Census Bureau as the Winchester census-designated place. The town also includes the village of Ashuelot and part of Pisgah State Park."},{"page_url":"https://pl.wikipedia.org/wiki/Zbrodnia_w_So%C5%82otwinie","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/97/Pow.nadworna_rohatyn.jpg","page_title":"Zbrodnia w Sołotwinie","context_page_description":"Zbrodnia w Sołotwinie – zbrodnia dokonana 6 kwietnia 1944 r. przez nacjonalistów ukraińskich na ludności narodowości polskiej. Miejscem zbrodni była Sołotwina w gminie Sołotwina, w powiecie nadwórniańskim województwa stanisławowskiego.\\nNapadu na wieś dokonali banderowcy, którzy ograbili i spalili część polskich domów oraz zabili co najmniej 38 osób. Janusz Stankiewicz uważa, że wśród ofiar zbrodni w Sołotwinie znalazł się m.in. były oficer Policji Państwowej Julian Urbanowski."},{"page_url":"https://tr.wikipedia.org/wiki/Chris_Hughton","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8b/Lewes_0_BHA_0_18_July_2015-1173_%2819874711811%29.jpg","page_title":"Chris Hughton","context_page_description":"Chris Hughton, Brighton & Hove Albion takımında teknik direktörlük yapan İrlandalı millî futbolcudur.\\nProfesyonel futbolculuk kariyerine 1977 yılında Tottenham Hotspur kulübünde başladı. Daha sonra sırasıyla West Ham United ve Brentford kulüplerinde oynadı."},{"page_url":"https://nl.wikipedia.org/wiki/Karen_McCluskey","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2e/Kathryn_Joosten_2009.jpg","page_title":"Karen McCluskey","context_page_description":"Karen McCluskey is een personage uit de Amerikaanse televisieserie Desperate Housewives, gespeeld door Kathryn Joosten, die hiervoor een Emmy Award kreeg in 2005."},{"page_url":"https://cs.wikipedia.org/wiki/Volby_prezidenta_USA_2016","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a8/Jill_Stein_by_Gage_Skidmore.jpg","page_title":"Volby prezidenta USA 2016","context_page_description":"Volby prezidenta USA v roce 2016 se konaly v úterý 8. listopadu 2016, jakožto 58. nepřímé volby prezidenta Spojených států v pořadí. Občané svými hlasy vybrali volitele kandidátů, kteří pak jako sbor volitelů zvolí v pořadí 45. prezidenta a 48. viceprezidenta Spojených států.\\nRozhodující většinu hlasů volitelů, a to 306, získal republikán Donald Trump, čímž porazil kandidátku Demokratické strany Hillary Clintonovou, pro kterou je zaznamenáno 232 volitelů. Donald Trump se stal prezidentem 20. ledna 2017, kdy nahradil Baracka Obamu, jemuž třetí kandidaturu neumožňuje XXII. dodatek Ústavy, jenž stanovuje, že každý prezident může úřad vykonávat nejvýše dvě volební období."},{"page_url":"https://tr.wikipedia.org/wiki/Leopold_August_Abel","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b3/Leopold_August_Abel.jpg","page_title":"Leopold August Abel","context_page_description":"Leopold August Abel, Alman kemancı ve besteci.\\nLeopold August Abel, Köthen'da 24 Mart 1718 tarihinde dünyaya geldi. Karl Friedrich Abel'in abisi ve Johann Leopold Abel'in büyük babasıdır. August Abel, Franz Benda'nın himayesinde keman çalmayı öğrendi. Braunschweig tiyatrosunun orkestrasında sanatını icra etti, Prince of Schwarzburg-Sondershausen saray bandının, The Margrave of Schwedt, Duke of Schwerin şefliğini yaptı. Sinfonia a 8 vociyi, ve Viyana'daki Gesellschaft der Musikfreunde'de bulunan bazı keman eserlerini 1766'da besteledi. Ludwigslust'te 25 Ağustos 1794'te yaşamını yitirdi."},{"page_url":"https://en.wikipedia.org/wiki/Three-wheeler","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/df/Davis_Divan%2C_NATMUS%2C_May_2011.jpg","page_title":"Three-wheeler","context_page_description":"A three-wheeler is a vehicle with three wheels. Some are motorized tricycles, which may be legally classed as motorcycles, while others are tricycles without a motor, some of which are human-powered vehicles and animal-powered vehicles."},{"page_url":"https://sv.wikipedia.org/wiki/Tropidophis_melanurus","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/16/Cuban_Giant_Trope_%28Tropidophis_melanurus%29_%288577519434%29.jpg","page_title":"Tropidophis melanurus","context_page_description":"Tropidophis melanurus är en orm i familjen Tropidophiidae. Ibland används det svenska trivialnamnet Kubansk markboa.\\nArten förekommer i Kuba och på tillhörande öar. Den kan anpassa sig till olika landskap som regnskogar, odlingsmark och klippiga områden.\\nTropidophis melanurus är med en längd omkring 65 cm en liten orm. Den kännetecknas av en kraftig bål, ett litet huvud och små ögon med lodräta pupiller. Fjällen på bålen och på huvudets ovansida har vanligen en rödbrun, gulbrun eller gråaktig färg. Flera exemplar har mörka fläckar på kroppen. Enhetlig färgade individer är sällsynta. Påfallande är svansen som har en avvikande färg. Den kan vara gul eller svart.\\nDenna orm vistas främst på marken men den kan klättra i buskar och på klippor. Arten jagar små ryggradsdjur som grodor, ödlor eller mindre däggdjur. Honor föder cirka 8 levande ungar per tillfälle.\\nVanligen skiljs mellan tre underarter:\\nT. m. melanurus, Kuba med undantag av den västra provinsen\\nT. m. dysodes, i Provincia de Pinar del Río\\nT. m. ericksoni, på Isla de la Juventud"},{"page_url":"https://mk.wikipedia.org/wiki/%D0%9C%D0%B0%D1%80%D1%82%D0%B8%D0%BD_%D0%94%D0%B5%D0%BC%D0%B8%D0%BA%D0%B5%D0%BB%D0%B8%D1%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/12/600px_Bianco_con_diagonale_Rossa.png","page_title":"Мартин Демикелис","context_page_description":"Мартин Гастон Демикелис — поранешен аргентински фудбалер, играч од одбраната."},{"page_url":"https://zh.wikipedia.org/wiki/%E6%96%97%E5%85%AD%E6%A3%92%E7%90%83%E5%A0%B4","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c8/Douliou_Baseball_015.jpg","page_title":"斗六棒球場","context_page_description":"斗六棒球場位於台灣雲林縣斗六市朱丹灣地區，原本以坐落地區命名為「朱丹灣棒球場」，但因地方居民對此命名有疑義，考量到整體地理名稱和知名度，經過重新票選命名為「斗六棒球場」。現為味全龍隊二軍基地。"},{"page_url":"https://es.wikipedia.org/wiki/Tupanatinga","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/ac/Tupanatinga.png","page_title":"Tupanatinga","context_page_description":"Tupanatinga es un municipio brasileño del estado de Pernambuco. Administrativamente, el municipio es compuesto apenas por el distrito sede y por los poblados de Cabo do Campo, Bosque Verde, Boqueirão y Baja Grande."},{"page_url":"https://de.wikipedia.org/wiki/Kloster_Apostolos_Andreas","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4b/St._Andreas_Kloster_Zypern.JPG","page_title":"Kloster Apostolos Andreas","context_page_description":"Das Kloster Apostolos Andreas liegt am nordöstlichsten Punkt der Karpas-Halbinsel auf Zypern und gehört politisch zur Gemeinde Rizokarpaso.\\nDas Kloster ist einer der wichtigsten Wallfahrtsorte der zypriotisch-orthodoxen Kirche und war als das Lourdes von Zypern international bekannt. Die Bewohner gliederten sich in zwei Gruppen: auf der einen Seite die permanent dort lebenden Mönche und andererseits Priester und Laienbrüder, die für eine bestimmte Zeit zu Gast waren. Bis 1974 war ein reger Andrang von Besuchern zu verzeichnen, die neben dem Kloster auch die Sankt-Andreas-Quelle am Fuße des Bauwerks besuchten. Außer den Griechen betrachten auch die Türken die Quelle als heiligen Ort."},{"page_url":"https://de.wikipedia.org/wiki/Erzbistum_Hamburg","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a9/Amtseinf%C3%BChrung_des_Erzbischofs_von_K%C3%B6ln_Rainer_Maria_Kardinal_Woelki-0767.jpg","page_title":"Erzbistum Hamburg","context_page_description":"Das Erzbistum Hamburg ist eine römisch-katholische Diözese im Norden Deutschlands und umfasst die Bundesländer Hamburg und Schleswig-Holstein sowie den Landesteil Mecklenburg des Bundeslands Mecklenburg-Vorpommern. Es ist das flächenmäßig größte Bistum Deutschlands. Kennzeichnend ist die Situation als Bistum in der Diaspora. Sitz des Bischofs ist der St. Marien-Dom in Hamburg-St. Georg."},{"page_url":"https://sl.wikipedia.org/wiki/Nezmo%C5%BEnosti_prilagojena_leta_%C5%BEivljenja","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cb/Disability_Adjusted_Life_Year_Weight_Plot.svg","page_title":"Nezmožnosti prilagojena leta življenja","context_page_description":"Nezmožnosti prilagojena leta življenja so merilo za celotno breme bolezni, izraženo kot število izgubljenih let zaradi slabega zdravja, invalidnosti ali prezgodnje smrti. Razvili so ga leta 1990 kot merilo za primerjave med dolžino zdravega življenja in pričakovano življenjsko dobo v različnih državah.\\nDALY se vse bolj pogosto uporablja na področju javnega zdravja in pri ocene vplivov na zdravje. DALY razširja pojem let, izgubljenih zaradi prezgodnje smrti ... na enakovredna leta 'zdravega' življenja, izgubljena zaradi slabega zdravja ali invalidnosti. Tako sta umrljivost in obolevnost so združeni v eno samo, poenoteno metriko.\\nPogled na breme bolezni s pomočjo DALY lahko razkrije presenetljive stvari o zdravju prebivalstva. Na primer, poročilo WHO 1990 je navedlo, da je 5 izmed 10 najpogostejših vzrokov nezmnožnosti imelo duševne vzroke. Psihična in nevrološka obolenja predstavljajo 28 % vseh v nezmožnosti preživetih let, vendar pa pomenijo samo 1,4 % vseh smrti in 1,1 % izgubljenih let življenja. Če se torej upošteva leta nezmožnosti, imajo psihične motnje, ki tradicionalno ne štejejo med epidemiološke probleme, zelo velik vpliv na prebivalstvo."},{"page_url":"https://ce.wikipedia.org/wiki/NGC_663","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/12/NGC663HunterWilson.jpg","page_title":"NGC 663","context_page_description":"NGC 663 — Дохкаллин а, седарчийн гуламийн а керла юкъара каталогехь ягарйина галактикаш."},{"page_url":"https://en.wikipedia.org/wiki/Renewable_energy_in_the_United_States","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/55/Ten_Year_Generation_Renewables_2018.jpg","page_title":"Renewable energy in the United States","context_page_description":"According to preliminary data from the US Energy Information Administration, renewable energy accounted for about 11% of total primary energy consumption and about 17% of the domestically produced electricity in the United States in 2018.\\nHydroelectric power is currently the largest producer of renewable electricity in the country, generating around 6.5% of the nation's total electricity in 2016 as well as 45.71% of the total renewable electricity generation.\\nThe United States is the fourth largest producer of hydroelectricity in the world after China, Canada and Brazil.\\nThe next largest share of renewable power was provided by wind power at 5.55% of total power production, amounting to 226.5 terawatt-hours during 2016. By January 2017, the United States nameplate generating capacity for wind power was 82,183 megawatts. Texas remained firmly established as the leader in wind power deployment, followed by Iowa and Oklahoma as of year end 2016.\\nSolar power provides a growing share of electricity in the country, with over 50 GW of installed capacity generating about 1.3% of the country's total electricity supply in 2017, up from 0.9% the previous year."},{"page_url":"https://ko.wikipedia.org/wiki/%EC%A0%9C%EC%9D%B4_%EB%9D%BC%EA%B0%80%EC%95%84%EC%9D%B4%EC%95%84","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bc/Jay_Lagaaia_SWW.JPG","page_title":"제이 라가아이아","context_page_description":"제이 라가아이아는 오스트레일리아의 배우, 영화배우, 가수, 텔레비전 배우이다.\\n오클랜드에서 태어났다."},{"page_url":"https://war.wikipedia.org/wiki/Santalum_freycinetianum","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/20/Starr_030222-0079_Santalum_freycinetianum_var._lanaiense.jpg","page_title":"Santalum freycinetianum","context_page_description":"An Santalum freycinetianum in uska species han Magnoliopsida nga ginhulagway ni Gaud.. An Santalum freycinetianum in nahilalakip ha genus nga Santalum, ngan familia nga Santalaceae. Nag-uusahan nga subspecies: S. f. pyrularium."},{"page_url":"https://id.wikipedia.org/wiki/Medan_Petisah,_Medan","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bb/GKPA_Medan_Barat_%28Jl._Cangkir%29%2C_Res._Medan_Barat_02.jpg","page_title":"Medan Petisah, Medan","context_page_description":"Medan Petisah merupakan sebuah kecamatan di kota Medan, provinsi Sumatra Utara, Indonesia.\\nJalan Majapahit yang terkenal sebagai pusat lokasi toko-toko bika Ambon di Medan berada di kecamatan ini. Selain itu, kantor Wali kota juga berada di Medan Petisah, berdekatan dengan Mesjid Agung, Mall Palladium, Grand Aston Hotel, Kantor Pos, Lapangan Merdeka, Merdeka Walk, Kedutaan Besar Republik Singapura dan Gedung Bank Indonesia."},{"page_url":"https://fa.wikipedia.org/wiki/%D9%85%D8%A7%D8%B1%DA%AF%D8%B1%DB%8C%D8%AA_%D8%AF_%D9%84%D8%A7_%D9%85%D9%88%D8%AA","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8b/Marguerite_De_La_Motte_from_Stars_of_the_Photoplay.jpg","page_title":"مارگریت د لا موت","context_page_description":"مارگریت د لا موت یک هنرپیشه اهل ایالات متحده آمریکا بود."},{"page_url":"https://fi.wikipedia.org/wiki/Petteri_Pennanen","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/3e/Petteri_Pennanen_KuPS.jpg","page_title":"Petteri Pennanen","context_page_description":"Petteri Pennanen on suomalainen jalkapalloilija, joka edustaa Veikkausliigassa pelaavaa Kuopion Palloseuraa. Hän on pelipaikaltaan hyökkäävä keskikenttäpelaaja.\\nPennanen luettiin juniorivuosinaan Suomen lahjakkaimpiin junioreihin. Hän on pelannut 11 nuorten ja 36 poikien maaottelua. Pennanen murtautui Kuopion Palloseuran pelaavaan miehistöön 16-vuotiaana keväällä 2007. Hän pelasi ensi kerran KuPS:n edustusmiehistössä 29. huhtikuuta 2007 ottelussa KuPS-VIFK.\\nEnsimmäistä kertaa urallaan avauskokoonpanossa sarjaottelussa Pennanen oli 27. toukokuuta 2007 ottelussa KuPS-PK-35. Kaudella 2007 hän pelasi yhteensä 13 sarjaottelua Ykkösessä, ja voitti myös KuPSin B-nuorten riveissä Suomen mestaruuden. Vuonna 2008 Veikkausliigassa kertyi puolestaan 17 ottelua.\\nPennasella oli Kuopion Palloseuran kanssa kolmen vuoden sopimus, joka olisi päättynyt vuonna 2009. Hänet lainattiin kuitenkin helmikuussa 2009 Eredivisien FC Twenteen. Lainasopimus jatkui kesäkuun 2009 loppuun, jonka päätteeksi hollantilaisseura käytti oikeuden ostaa pelaajan itselleen. Twente teki 22. kesäkuuta 2009 Pennasen kanssa kahden vuoden sopimuksen. Myös KuPSin Tuomas Rannankari siirtyi samalla seuraan."},{"page_url":"https://en.wikipedia.org/wiki/Christine_Shevchenko","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d8/Christine_Shevchenko_by_Klaudia_Suleiman.jpg","page_title":"Christine Shevchenko","context_page_description":"Christine Shevchenko is a Ukrainian-American ballet dancer. She currently performs as a principal dancer with American Ballet Theatre."},{"page_url":"https://he.wikipedia.org/wiki/%D7%92%D7%93%D7%99_%D7%A8%D7%95%D7%9C","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4e/%D7%9E%D7%97%D7%9C%D7%AA_%D7%A0%D7%A2%D7%95%D7%A8%D7%99%D7%9D%2C_%D7%AA%D7%99%D7%90%D7%98%D7%A8%D7%95%D7%9F_%D7%94%D7%A2%D7%99%D7%A8%D7%95%D7%A0%D7%99_%D7%91%D7%9C%D7%92%D7%A8%D7%90%D7%93%2C_2007.jpg","page_title":"גדי רול","context_page_description":"גדי רוֹל הוא במאי תיאטרון ומתרגם ישראלי."},{"page_url":"https://de.wikipedia.org/wiki/Tages-Post_(Linz)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/37/Tages_post_erste_ausgabe.jpg","page_title":"Tages-Post (Linz)","context_page_description":"Die Tages-Post, abweichend auch als Tagespost bezeichnet, war eine österreichische Zeitschrift, die erstmals am 1. Jänner 1865 herausgegeben wurde. Nach der Einstellung im Januar 1944 erschien sie nochmals von Oktober 1953 bis Ende 1954, bis sie mit den 1945 gegründeten Oberösterreichischen Nachrichten fusioniert wurde."},{"page_url":"https://es.wikipedia.org/wiki/Rabia_transmitida_por_murci%C3%A9lagos","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ee/Desmodus_rotundus_distribution_map_1.png","page_title":"Rabia transmitida por murciélagos","context_page_description":"La rabia transmitida por murciélagos, o zoonosis rábica por quirópteros, es una afección emergente de amplia distribución mundial que afecta a animales muy diversos, incluidos los murciélagos. La rabia es debida a un virus que afecta a animales domésticos y salvajes, propagándose a las personas a través del contacto con la saliva infectada por mordeduras o arañazos. Una vez que aparecen los síntomas, la enfermedad es casi siempre mortal.\\nLa rabia transmitida por murciélagos es la segunda causa de mortalidad mundial por rabia, tras la transmitida por cánidos. Los murciélagos son la principal fuente de infección en los casos mortales de rabia en los Estados Unidos y Canadá. La rabia del murciélago se ha convertido recientemente en una amenaza para la salud pública en Australia, América Latina y Europa Occidental. Sin embargo, en estas regiones el número de muertes por rabia transmitida por murciélagos es inferior a las causadas por mordeduras de perros infectados."},{"page_url":"https://de.wikipedia.org/wiki/Teresa_Manetti","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/89/Manetti.JPG","page_title":"Teresa Manetti","context_page_description":"Teresa Adelaide Cesira Manetti war die Gründerin des katholischen Ordens Suore Carmelitane di S. Teresa di Gesù. Sie wurde als Teresa Maria della Croce seliggesprochen.\\nTeresa Manetti stammte aus einfachen Verhältnissen. Ihr Vater Gaetano Manetti starb, als sie drei Jahre alt war, und die Familie lebte in der Folge in Armut. Teresa wurde von Familie und Freunden Bettina genannt.\\n1865 hatte sie eine Vision von Teresa von Ávila und entschloss sich, deren Beispiel zu folgen. 1874 gründete sie mit zwei Freundinnen einen kleinen Konvent und schrieb sich kurz darauf beim Dritten Theresianischen Orden ein, unterstützt durch Ernesto Jacopozzi, den Kaplan der Kirche von San Martino.\\nTeresa entschied sich dafür, sich nicht ausschließlich einem kontemplativen und asketischen Leben zu widmen, sondern ihren beginnenden Orden der Welt zu öffnen, wodurch sich ein bemerkenswertes Hilfswerk entwickelte, das sich besonders um die Unterstützung von Waisen kümmerte. Der Orden expandierte rasch, zuerst in der Toskana und dann in ganz Italien. 1887 wurde in San Martino ein neues Kloster mit angebauter Kirche errichtet.\\nAm 15."},{"page_url":"https://he.wikipedia.org/wiki/%D7%9E%D7%91%D7%A6%D7%A8_%D7%9B%D7%A4%D7%A8%D7%9C%D7%98","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6c/Caferlet_chamber.JPG","page_title":"מבצר כפרלט","context_page_description":"מבצר כפרלט הוא שמו של מבצר קדום מתקופת ימי הביניים, שנמצא בתחומי מושב הבונים שבמישור החוף. המבצר בנוי על גבעת כורכר שגובהה כשלושים מטרים, הנמצאת כ-800 מטרים ממזרח לקו החוף, כשמונה קילומטר מדרום לעתלית וכחמישה עשר קילומטרים מצפון לעיר קיסריה."},{"page_url":"https://da.wikipedia.org/wiki/Claes_Wers%C3%A4ll","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b6/Wers%C3%A4ll_Family_1918.jpg","page_title":"Claes Wersäll","context_page_description":"Claes Axel Wersäll var en svensk gymnast som deltog i OL 1912 i Stockholm.\\nWersäll blev olympisk mester i gymnastik under OL 1912 i Stockholm. Han var med på det svenske hold som vandt holdkonkurrencen for hold i svensk system. Hold fra tre nationer var med i konkurrencen, der blev afholdt på Stockholms Stadion."},{"page_url":"https://nn.wikipedia.org/wiki/Engelsk_litteratur","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8e/In_Black_and_White_cover_by_Rudyard_Kipling_1888.jpg","page_title":"Engelsk litteratur","context_page_description":"Engelsk litteratur kan visa til all engelskspråkleg litteratur, men kan i snevrare forstand visa til litteratur skriven i eller rundt England på moderne engelsk, mellomengelsk eller gammalengelsk. Litteraturen har gått gjennom ei rekkje språklege og stilistiske endringar med innspel frå fleire andre tradisjonar, frå gammalengelsk dikting med bokstavrim og fornyrdislag til mellomengelske riddarromanar etter fransk/normannisk tradisjon til verk frå renessansen, klassisismen og seinare påverka av klassisk gresk og latinsk litteratur. Moderne engelsk litteratur var mellom anna sentral i utviklinga av romansjangeren og av kriminallitteratur."},{"page_url":"https://en.wikipedia.org/wiki/Edwin_Richard_Hallifax","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/04/Sir_Claud_Severn_and_Sun_Yat_Sen.jpg","page_title":"Edwin Richard Hallifax","context_page_description":"Edwin Richard Hallifax was a senior official in Hong Kong in the early 20th century. There is a double \\"l\\" in the spelling of his surname. His official Chinese name is \\"夏理德\\". He was regarded as a very conservative officer. He died on 4 May 1950 in Tiverton."},{"page_url":"https://pt.wikipedia.org/wiki/Fuinha-chocalheira","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d5/Cisticola_chiniana_-Gauteng%2C_South_Africa-8.jpg","page_title":"Fuinha-chocalheira","context_page_description":"A Fuinha-chocalheira é uma espécie de ave da família Cisticolidae.\\nPode ser encontrada nos seguintes países: Angola, Botswana, Burundi, República do Congo, República Democrática do Congo, Etiópia, Quénia, Malawi, Moçambique, Namíbia, Somália, África do Sul, Sudão, Essuatíni, Tanzânia, Uganda, Zâmbia e Zimbabwe.\\nOs seus habitats naturais são: savanas áridas."},{"page_url":"https://azb.wikipedia.org/wiki/%D9%86%D9%88%D8%A7%D8%AF%D8%A7_%D8%AF%D8%B1_%D8%B1%DB%8C%D9%86%D9%88_%D8%A8%DB%8C%D9%84%DB%8C%D9%85%E2%80%8C%DB%8C%D9%88%D8%B1%D8%AF%D9%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/73/Reno_with_mountains.png","page_title":"نوادا در رینو بیلیم‌یوردو","context_page_description":"نوادا در رینو بیلیم‌یوردو آمریکانین رینو، نوادا شهرینده یئرلشن بیر عالی تحصیل موسّسه‌سی. بۇ بیلیم‌یوردو شهرین حومه‌سینده‌دیر. و ۲۰٬۴۲۸ لیسانس و لیسانس‌دان یۆکسک اؤیره‌نجی‌سی واردیر. عۆمومی و دؤولتی‌ اؤیره‌تیم قۇرومودیر و بودجه‌‌سینی دؤولت و بؤیوک شیرکت‌لر و خالقدان آلدیغی اعانه‌لرله تامین ائدیر."},{"page_url":"https://ca.wikipedia.org/wiki/Valent%C3%ADn_Paz-Andrade","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0c/Valent%C3%ADn_Paz_Andrade.jpg","page_title":"Valentín Paz-Andrade","context_page_description":"Valentín Paz-Andrade fou un escriptor, economista i polític gallec. El 1921 es llicencià en dret per la Universitat de Santiago de Compostel·la i el 1922 fou director del diari Galicia. Diario de Vigo. El 1934 milità al Partit Galleguista i col·laborà en la redacció de l'estatut d'autonomia de Galícia de 1936. Durant la guerra civil espanyola hagué de fugir. Posteriorment fou desterrat a Verín, Castro Caldelas, A Pobra de Trives i Villanueva de la Serena\\nPosteriorment, fou un dels fundadors de l'empresa Pescanova, de la que en fou president el 1960. Ha estat expert pesquer de la FAO a Amèrica i membre de l'Institut Argentí de la Producció. És membre de l'Associacions Ciència Regional i acadèmic numerari de la Reial Acadèmia Gallega. Alhora, es relacionà amb cercles galleguistes i col·laborà a la revista Grial, així com els diaris El País, La Vanguardia, Faro de Vigo. A les eleccions generals espanyoles de 1977 fou escollit senador per la província de Pontevedra per la Candidatura Democràtica Gallega."},{"page_url":"https://hu.wikipedia.org/wiki/Geena_Davis","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/91/Geena_Davis_2013_%28cropped%29.jpg","page_title":"Geena Davis","context_page_description":"Virginia Elizabeth „Geena” Davis Oscar-díjas és Golden Globe-díjas, amerikai színésznő, producer, író, modell."},{"page_url":"https://pt.wikipedia.org/wiki/Monumento_do_Paquist%C3%A3o","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f4/Pakistan_Monument_Museum.jpg","page_title":"Monumento do Paquistão","context_page_description":"O Monumento do Paquistão é um monumento nacional e museu localizado na zona de Shakarparian Hills em Islamabad, capital do Paquistão, que simboliza a unidade nacional. O complexo cobre uma área de 2,8 hectares e é um destino popular dos islamabadenses.\\nA construção tem a forma de uma flor com uma estrutura de pétalas, em que os lados dessas pétalas virados para o centro do monumento têm representações do forte de Lahore, da mesquita Badshahi, do passo Khyber e de Minar-e-Pakistan. O monumento abre-se a um terraço de mármore que permite uma vista panorâmica de Islamabad. As quatro pétalas principais do monumento representam as quatro províncias do país, e as três pétalas menores representam os três territórios.\\nO museu do monumento inclui um museu de cera, em que se representam vários acontecimentos que levaram à constituição do Movimento pelo Paquistão — movimento político da década de 1940 que lutou pela criação do Paquistão na área de maioria muçulmana do que então era o Raj Britânico. Para lá disso, há ainda uma biblioteca, um arquivo audiovisual, uma sala de conferências e reuniões e um auditório com 62 lugares designado Panorama Hall."},{"page_url":"https://bn.wikipedia.org/wiki/%E0%A6%B8%E0%A6%AE%E0%A6%95%E0%A6%BE%E0%A6%AE%E0%A6%BF%E0%A6%A4%E0%A6%BE_%E0%A6%A6%E0%A7%87%E0%A6%96%E0%A6%BE_%E0%A6%AF%E0%A6%BE%E0%A6%93%E0%A6%AF%E0%A6%BC%E0%A6%BE_%E0%A6%B8%E0%A7%8D%E0%A6%A4%E0%A6%A8%E0%A7%8D%E0%A6%AF%E0%A6%AA%E0%A6%BE%E0%A6%AF%E0%A6%BC%E0%A7%80_%E0%A6%AA%E0%A7%8D%E0%A6%B0%E0%A6%BE%E0%A6%A3%E0%A7%80%E0%A6%A6%E0%A7%87%E0%A6%B0_%E0%A6%A4%E0%A6%BE%E0%A6%B2%E0%A6%BF%E0%A6%95%E0%A6%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d7/Macaques_%C3%A0_bonnet_petits.jpg","page_title":"সমকামিতা দেখা যাওয়া স্তন্যপায়ী প্রাণীদের তালিকা","context_page_description":"যৌন আচরণ, courtship, affection, pair bonding, অথবা parenting এর মতই স্তন্যপায়ী প্রাণীতে সমকামিতা দেখা যায়।\\nbruce bagemihl এবিষয়ে আলোকপাত করে লিখালিখি করেন। তিনি তার বইয়ে উল্লেখ করেন, ১৯৯০ সালের আগ পর্যন্ত same-sex sexual behavior নিয়ে বিস্তৃত পরিসরে আলোচনা হয় নি, তার কারণ সমকামিতা একটা taboo বিষয় হিসেবে সমাজে পরিগণিত হত। যার দরুণ এলজিবিটি মানুষদের সমাজ পশুর ন্যায় মুল্যায়ন করত। ১৯৯৯ সালে তিনি Biological Exuberance নামে একটি বই লিখেন, যেখানে তিনটা পরিচ্ছেদ এ প্রসঙ্গে উৎসর্গ করেন, যা হল, \\"Two Hundred Years at Looking at Homosexual Wildlife\\", Explaining Animal Homosexuality এবং Not For Breeding Only। এখানে তিনি সমকামিতা নিয়ে জীববিজ্ঞান কী বলছে তার প্রাঞ্জল ব্যাখ্যা দেন। পিটার বোকম্যান, যিনি Against Nature? নামক প্রদর্শনীটির উপদেষ্টা, তিনি এক বিবৃতিতে বলেন, \\"[অ]নেক গবেষক বলেন, সমকামিতা এমন একটা বিষয় যা যৌন সঙ্গম থেকে পুরোপুরি আলাদা। অথচ এটা তারা জানেন না, বা এখন তাদের অনুধাবন করার সময় এসেছে যে, অন্যান্য প্রাণী সঙ্গম তার সাথে করতে পারে, যার সাথে সে চায়, এজন্য তাদের গবেষকদের নৈতিকতার মুলনীতিগুলোর প্রয়োজন হয় না\\"।"},{"page_url":"https://en.wikipedia.org/wiki/Museum_of_Osteology","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/52/Skulls_Unlimited_and_the_Museum_of_Osteology.jpg","page_title":"Museum of Osteology","context_page_description":"The Museum of Osteology, located in Oklahoma City, Oklahoma, United States, North America, is a private museum devoted to the study of bones and skeletons. This museum displays over 350 skeletons from animal species from animals all over the world. With another 7000 specimens as part of the collection, but not on display, this is the largest privately held collection of osteological specimens in the world."},{"page_url":"https://tr.wikipedia.org/wiki/%C3%87ay%C4%B1rd%C3%BC%C4%9Fmesi","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/60/SanguisorbaMinor-plant.jpg","page_title":"Çayırdüğmesi","context_page_description":"Çayırdüğmesi, gülgiller familyasından anavatanı Kuzey yarımkürenin ılıman bölgeleri olan Sanguisorba cinsini oluşturan bitkilerin ortak adı.\\nGövdesi 50–200 cm uzunluğunda olan çayırdüğmesinin küme halindeki taban yapraklarıyla gövde boyunca almaşık dizilmiş gövde yaprakları vardır. Tüysü yapraklar, 5–30 cm uzunluğundaki 7-25 yaprakçıktan oluşur, yaprakçıkların kenarı testere dişlidir. Genç yapraklar bitkinin orta kısmından gelişir. 5–20 cm uzunluğunda sık küme oluşturan küçük çiçekler beyaz ila kırmızı renktedir, her bir çiçekte dört küçük taç yaprak yer alır."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_denkmalgesch%C3%BCtzten_Objekte_in_Eggenburg","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/GuentherZ_2011-09-10_0401_Stoitzendorf_Kirche.jpg","page_title":"Liste der denkmalgeschützten Objekte in Eggenburg","context_page_description":"Die Liste der denkmalgeschützten Objekte in Eggenburg enthält die 99 denkmalgeschützten, unbeweglichen Objekte der niederösterreichischen Stadt Eggenburg."},{"page_url":"https://nl.wikipedia.org/wiki/Eutomostethus_ephippium","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fc/Eutomostethus_ephippium_%28Tenthredinidae%29_-_%28imago%29%2C_Elst_%28Gld%29%2C_the_Netherlands_-_2.jpg","page_title":"Eutomostethus ephippium","context_page_description":"Eutomostethus ephippium is een vliesvleugelig insect uit de familie van de bladwespen. De wetenschappelijke naam van de soort is voor het eerst geldig gepubliceerd in 1798 door Panzer."},{"page_url":"https://es.wikipedia.org/wiki/Champs_(Orne)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/93/Champs._Orne._Eglise_Saint_Evroult_bu_173.jpg","page_title":"Champs (Orne)","context_page_description":"Champs era una comuna francesa situada en el departamento de Orne, de la región de Normandía, que el 1 de enero de 2016 pasó a ser una comuna delegada de la comuna nueva de Tourouvre-au-Perche​ al fusionarse con las comunas de Autheuil, Bivilliers, Bresolettes, Bubertré, La Poterie-au-Perche, Lignerolles, Prepotin, Randonnai y Tourouvre."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E9%98%BF%E5%B8%83%C2%B7%E5%8A%AA%E7%93%A6%E6%96%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ad/Abu_Nuwas.jpg","page_title":"阿布·努瓦斯","context_page_description":"阿布·努瓦斯是阿拉伯詩人。"},{"page_url":"https://zh.wikipedia.org/wiki/%E6%98%93%E7%BB%8F","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d3/DualerAufbau.JPG","page_title":"易经","context_page_description":"《易經》是中國漢族最古老的文獻之一，並被儒家尊為「五經」之始；一般說上古三大奇書包括《黃帝內經》、《易經》、《山海經》，但它們成書都較晚。《易經》以一套符號系統來描述狀態的簡易、變易、不易，表現了中國古典文化的哲學和宇宙觀。它的中心思想，是以演譯自然運行的內在特徵與規律，解讀陰陽的交替變化描述世間萬物。《易經》最初用於占卜和預報天氣，但它的影響遍及中國的哲學、宗教、政治、經濟、醫學、天文、算術、文學、音樂、藝術、軍事和武術等各方面，是一部無所不包的巨著。在四庫全書中為經部，十三經中未經秦始皇焚書之害，它是最早哲學書。自從十七世紀開始，《易經》也被介紹到西方。\\n《易》原有三種版本：《連山》、《歸藏》和《周易》。《連山》和《歸藏》已經失傳，《周易》是唯一有傳至後世的經文。而《周易》相傳是依循周文王主編《易》的著述而來，成書大約在西周時期。1993年湖北江陵荊州鎮出土的王家台秦簡《易占》與輯本《歸藏》相符，被認為《歸藏》古文再現。\\n《易》也叫《易經》，經字特指原文內容。由於三易之中唯周易有幸傳世，因此《易經》通常便泛指《周易》。後人對《周易》再作註解的版本眾多，其中最早期的也是最著名的作品就是《易傳》。所以，不要混淆《易經》跟《易傳》，這是兩個不同的概念。《易傳》的上半部為「經」的部分，是引用《周易》的原文；《易傳》的下半部為「傳」的部分，是由孔子及弟子們聯合撰寫，對周易進行主觀的個人見解注釋，其實並不等同《周易》原文的真正內涵。「傳」的內容包含〈彖辭〉上下、〈象辭〉上下、〈繫辭〉上下、〈文言〉、〈序卦〉、〈說卦〉、〈雜卦〉共十篇，舊稱《十翼》。"},{"page_url":"https://en.wikipedia.org/wiki/Joseph_Foster_Stackhouse","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dc/Jan_mayen_coast_hg.jpg","page_title":"Joseph Foster Stackhouse","context_page_description":"Joseph Foster Stackhouse was a British traveller and would-be explorer who, in 1911, led an expedition to the Arctic island of Jan Mayen. In 1914 he attempted to organise a British expedition to the Antarctic, but this was prevented by the outbreak of the First World War. He died in the sinking of the Lusitania.\\nBorn to an English Quaker family in the north of England, Stackhouse worked as an official with a railway company, while indulging in a passion for foreign travel. A member of the Royal Geographical Society, he was a friend and associate of Robert Falcon Scott, and assisted in the preparation of Scott's Terra Nova Expedition, 1910–13. Stackhouse's aborted plan for an Antarctic expedition was originally conceived as a continuation of Scott's work. After its abandonment he revised and extended his scheme into a broad oceanographic survey, and went to America to gather support and funding for this purpose. He was lost in the Lusitania while returning to England."},{"page_url":"https://sv.wikipedia.org/wiki/J%C3%A4mj%C3%B6_socken","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/41/Brudpar._Folkdr%C3%A4kter%2C_%C3%96stra_h%C3%A4rad%2C_J%C3%A4mj%C3%B6_socken%2C_Blekinge._Bildtryck_-_Nordiska_Museet_-_NMA.0035431.jpg","page_title":"Jämjö socken","context_page_description":"Jämjö socken i Blekinge ingick i Östra härad, ingår sedan 1974 i Karlskrona kommun och motsvarar från 2016 Jämjö distrikt.\\nSocknens areal är 88,2 kvadratkilometer, varav land 87,6. År 2000 fanns här 3 563 invånare. Tätorten Jämjö med sockenkyrkan Jämjö kyrka ligger i socknen."},{"page_url":"https://pt.wikipedia.org/wiki/Esta%C3%A7%C3%A3o_Jos%C3%A9_Hern%C3%A1ndez","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a5/Est._Jose_Hernandez_%2810%29.JPG","page_title":"Estação José Hernández","context_page_description":"A Estação José Hernández é uma das estações do Metro de Buenos Aires, situada em Buenos Aires, entre a Estação Olleros e a Estação Juramento. Faz parte da Linha D.\\nFoi inaugurada em 13 de novembro de 1997. Localiza-se no cruzamento da Avenida Cabildo com a Rua Virrey del Pino. Atende os bairros de Belgrano e Colegiales."},{"page_url":"https://en.wikipedia.org/wiki/History_of_Nizhny_Novgorod","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/34/The_Russian_Revolution%2C_in_Sormovo%2C_Nizhny_Novgorod_1905_2.jpg","page_title":"History of Nizhny Novgorod","context_page_description":"Nizhny Novgorod was founded by Prince Yuri II of Vladimir in 4 February 1221. Citizens organized an army to liberate Moscow from the Poles in 1611, led by Kuzma Minin and Prince Dmitry Pozharsky. During the Russian Empire, in 1817 Nizhny Novgorod became the country's main trading city. In 1896, the city hosted the largest All-Russia exhibition. In the Soviet era, Nizhny Novgorod was renamed Gorky, in honor of the writer Maxim Gorky. Then it was the industrial center of the Soviet Union. During the World War II, the city sent to the front a huge amount of military equipment and ammunition. Therefore, the German air force bombed the city for 3 years. After the dissolution of the Soviet Union, the city was renamed back to Nizhny Novgorod. In Russia, the city became a political center and the capital of the Volga Federal District. Now the city is the center of information technology and develops tourism."},{"page_url":"https://es.wikipedia.org/wiki/Retevisi%C3%B3n","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e3/Logotipo_de_la_corporaci%C3%B3n_Retevisi%C3%B3n.jpg","page_title":"Retevisión","context_page_description":"Retevisión fue una empresa de telecomunicaciones, actualmente integrada en el grupo Abertis, encargada de transmitir las señales de televisión y radio en España."},{"page_url":"https://en.wikipedia.org/wiki/Kelly_Barnes_Dam","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b0/Kelleybarneslake.jpg","page_title":"Kelly Barnes Dam","context_page_description":"Kelly Barnes Dam was an earthen embankment dam located in Stephens County, Georgia, just outside the city of Toccoa. It collapsed on November 6, 1977, after heavy rainfall, and the resulting flood killed 39 people and caused $2.8 million in damage. The dam was never rebuilt, and the Toccoa Falls downstream of the dam site is now a memorial and tourist attraction on the campus of Toccoa Falls College."},{"page_url":"https://en.wikipedia.org/wiki/Krajenka","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7f/PL_Krajenka%2C_ko%C5%9Bci%C3%B3%C5%82_par._p.w._%C5%9B%C5%9B._Miko%C5%82aja_i_Anny_01.JPG","page_title":"Krajenka","context_page_description":"Krajenka is a town in the Greater Poland Voivodeship of Poland. It has 3,804 inhabitants and lies in Złotów County."},{"page_url":"https://it.wikipedia.org/wiki/Sorbus","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/33/Sorbus_aria_a2.jpg","page_title":"Sorbus","context_page_description":"Sorbus L. è un genere di piante della famiglia delle Rosacee.\\nComprende alberi e arbusti che producono frutti simili, ma molto diversi per grandezza e anche per colore.\\nDante Alighieri lo cita come frutto aspro, in contrapposizione al fico, che ha frutti dolci."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%9F%D1%80%D0%B5%D0%B4%D0%B4%D0%B2%D0%BE%D1%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e1/GradHrib-Preddvor-Slovenia.JPG","page_title":"Преддвор","context_page_description":"Преддвор је градић и управно средиште истоимене општине Преддвор, која припада Горењској регији у Републици Словенији.\\nПо последњем попису из 2002. г. насеље Преддвор имало је 829 становника."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A3%D0%BC%D0%B5%D1%80%D1%88%D0%B8%D0%B5_%D0%B2_%D0%BC%D0%B0%D1%80%D1%82%D0%B5_2010_%D0%B3%D0%BE%D0%B4%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d8/Lionel_Cox_Helsinki_1952.jpg","page_title":"Умершие в марте 2010 года","context_page_description":"Это список известных людей, соответствующих установленным критериям значимости, умерших в марте 2010 года.\\nПричина смерти указывается лишь в исключительных случаях. В остальных случаях — не указывается.\\n← Февраль 2010"},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%A6%E3%82%A4%E3%83%B3%E3%82%BF%E9%83%A1_(%E3%83%A6%E3%82%BF%E5%B7%9E)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ad/Map_of_Utah_highlighting_Uintah_County.svg","page_title":"ユインタ郡 (ユタ州)","context_page_description":"ユインタ郡は、アメリカ合衆国ユタ州の北東部に位置する郡である。2010年国勢調査での人口は32,588人であり、2000年の25,224人から29％増加した。郡庁所在地はバーナル市であり、同郡で人口最大の町でもある。1880年に設立され、郡名はユインタ郡となった盆地に住んでいたユト族インディアンに因んで名付けられた。\\nバーナル・ユインタ郡空港がバーナル市の直ぐ外にあり、コロラド州デンバーに毎日定期便が運航されているが、ユタ州の州都であるソルトレイクシティ市への定期便は無い。ユタ州では天然ガスの生産量が最大の郡であり、2008年では2,720億立方フィート を生産した。郡の全体がバーナル小都市圏を構成している。"},{"page_url":"https://pl.wikipedia.org/wiki/Vogelherdh%C3%B6hle","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/MUT127024.jpg","page_title":"Vogelherdhöhle","context_page_description":"Vogelherdhöhle – jaskinia położona w dolinie rzeki Lone w Jurze Szwabskiej, niedaleko Niederstotzingen w niemieckim kraju związkowym Badenia-Wirtembergia, około 30 km na północny wschód od Ulm. Paleolityczne stanowisko archeologiczne.\\nJaskinia została odkryta przypadkowo w maju 1931 roku przez podążającego śladami borsuka Hermanna Mohna. Po znalezieniu we wnętrzu jaskini narzędzi kamiennych Mohn powiadomił o swoim odkryciu dr Gustava Rieka z Uniwersytetu w Tybindze, który w 1932 roku przeprowadził na stanowisku prace archeologiczne. Podczas wykopalisk odsłonięto kilka warstw stratygraficznych sięgających od czasów kultury mustierskiej do neolitu, z których wydobyto liczne narzędzia kamienne. Z warstw związanych z kulturą oryniacką, datowanych na ok. 36-30 tys. lat BP wydobyto kościane figurki przedstawiające zwierzęta, m.in. mamuta, konia i lwa jaskiniowego, jak również szczątki ludzkie zbliżone anatomicznie do człowieka współczesnego.\\nW 2006 roku wznowiono prace archeologiczne w jaskini, odnajdując kolejne figurki kościane, m.in. mamuta o długości 3,7 cm."},{"page_url":"https://pl.wikipedia.org/wiki/Pike_Place_Market","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/ba/Original_Starbucks.jpg","page_title":"Pike Place Market","context_page_description":"Pike Place Market – publiczny targ, będący miejscem widokowym na Zatokę Elliotta w Seattle w stanie Waszyngton w Stanach Zjednoczonych. Rynek otwarty został 17 sierpnia 1907 roku. Jest to jedno z najpopularniejszych miejsc w Seattle, położone w centrum miasta i zajmujące 9 akrów powierzchni.\\nW 1971 roku w pobliżu Pike Place Market otwarta została pierwsza na świecie kawiarnia Starbucks. Na Pike Place Market sklep został przeniesiony w 1976 roku, gdzie funkcjonuje do dziś."},{"page_url":"https://tt.wikipedia.org/wiki/%D0%A1%D0%B5%D0%BD-%D0%96%D1%8E%D1%8D%D1%80%D0%B8_(%D0%A2%D0%B0%D1%80%D0%BD)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/Saint-Ju%C3%A9ry_-_Mairie.JPG","page_title":"Сен-Жюэри (Тарн)","context_page_description":"Сен-Жюэри — Франциянең Тарн департаментына караган коммуна."},{"page_url":"https://en.wikipedia.org/wiki/1936_Norwegian_parliamentary_election","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/15/Johan_Ludwig_Mowinckel.jpg","page_title":"1936 Norwegian parliamentary election","context_page_description":"Parliamentary elections were held in Norway on 19 October 1936, the last before World War II and the German invasion of Norway. The result was a victory for the Labour Party, which won 70 of the 150 seats in the Storting."},{"page_url":"https://de.wikipedia.org/wiki/Filmjahr_1982","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/17/Romy_Schneider_at_Madrid%E2%80%93Barajas_Airport%2C_1965_%28cropped%29.jpg","page_title":"Filmjahr 1982","context_page_description":"Die Berlinale vergibt erstmals einen Goldenen Ehrenbär für das Lebenswerk eines Filmkünstlers. Erster Preisträger ist James Stewart.\\nEs wird erstmals ein Oscar für „Bestes Makeup“ verliehen, der erste Oscar für diese Kategorie geht an Rick Baker für American Werewolf\\nDer Film Das Gespenst von Herbert Achternbusch erscheint und wird wegen Blasphemie in Deutschland zeitweilig verboten. In Österreich ist der Film weiterhin verboten.\\nHugh Grant hat seinen ersten Filmauftritt in dem Film Privileged\\nDie Sieger der Bravo Otto Leserwahl 1982:\\nKategorie – männliche Filmstars: Gold Maxwell Caulfield, Silber Adriano Celentano, Bronze Arnold Schwarzenegger\\nKategorie – weibliche Filmstars: Gold Michelle Pfeiffer, Silber Ornella Muti, Bronze Farrah Fawcett\\nMit Tron kommt einer der ersten Filme heraus, der computergenerierte Videoszenen enthält."},{"page_url":"https://fr.wikipedia.org/wiki/%C3%89glise_du_C%C5%93ur-Immacul%C3%A9-de-Marie_de_Burmarrad","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b2/Malta_-_St._Paul%27s_Bay_-_Triq_Burmarrad-Triq_Toni_Camilleri_-_Misrah_Burmarrad_-_Parish_Church_01_ies.jpg","page_title":"Église du Cœur-Immaculé-de-Marie de Burmarrad","context_page_description":"L'église du Cœur-Immaculée-de-Marie est une église catholique située à Burmarrad, à Malte. Sa dédicace remonte au 30 mai 1964."},{"page_url":"https://sk.wikipedia.org/wiki/Batak_(mesto)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/27/ParSvVasilijVeliki002.jpg","page_title":"Batak (mesto)","context_page_description":"Batak je mesto v južnom Bulharsku v Pazardžickej oblasti blízko mesta Peštera, Pazardžik a Plovdiv v západnej časti pohoria Rodopy. Je administratívnym centrom okresu Batak. Obyvatelia mesta sa v roku 1876 aktívne zapojili do Aprílového povstania a po jeho potlačení bola väčšina z nich zavraždená v priebehu tzv. batackého masakru."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A1%D0%B2%D1%8F%D1%82%D0%BE-%D0%9C%D0%B8%D0%BA%D0%BE%D0%BB%D0%B0%D1%97%D0%B2%D1%81%D1%8C%D0%BA%D0%B0_%D1%86%D0%B5%D1%80%D0%BA%D0%B2%D0%B0_(%D0%93%D0%BE%D1%81%D1%82%D1%80%D0%BE%D0%BB%D1%83%D1%87%D1%87%D1%8F)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/88/%D0%93%D0%BE%D1%81%D1%82%D1%80%D0%BE%D0%BB%D1%83%D1%87%D1%87%D1%8F._%D0%9C%D0%B8%D0%BA%D0%BE%D0%BB%D0%B0%D1%97%D0%B2%D1%81%D1%8C%D0%BA%D0%B0_%D1%86%D0%B5%D1%80%D0%BA%D0%B2%D0%B0._1827-36_%D1%80%D0%BE%D0%BA%D0%B8.jpg","page_title":"Свято-Миколаївська церква (Гостролуччя)","context_page_description":"Свято-Миколаївська церква — православний храм у селі Гостролуччя Баришівського району Київської області; духовний осередок села і пам'ятка архітектури місцевого значення.\\nРозташована у центрі села."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkmale_in_Hann._M%C3%BCnden","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/08/Veckerh%C3%A4ger_Stra%C3%9Fe_41_%28Hann._M%C3%BCnden%29.jpg","page_title":"Liste der Baudenkmale in Hann. Münden","context_page_description":"In der Liste der Baudenkmale in Hann. Münden sind alle denkmalgeschützten Bauten der niedersächsischen Gemeinde Hann. Münden aufgelistet. Der Stand der Liste ist das Jahr 1993 und 1996."},{"page_url":"https://cs.wikipedia.org/wiki/Seznam_rybn%C3%ADk%C5%AF_v_Libereck%C3%A9m_kraji","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/79/Hamersk%C3%BD_rybn%C3%ADk1.jpg","page_title":"Seznam rybníků v Libereckém kraji","context_page_description":"Rybníky v Libereckém kraji jsou od středověku součástí krajiny, životního prostředí severních Čech.\\nHlavním účelem jejich zřizování byl chov ryb. Později byly využity i k rekreaci, sportu, regulaci povodňových srážek, mnohé z nich jsou přírodní rezervace. Mnohé z rybníků získaly dva i více českých a německých jmen."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%A7%D9%84%D8%A7%D9%86%D8%AA%D8%AF%D8%A7%D8%A8_%D8%A7%D9%84%D9%81%D8%B1%D9%86%D8%B3%D9%8A_%D8%B9%D9%84%D9%89_%D8%B3%D9%88%D8%B1%D9%8A%D8%A7_%D9%88%D9%84%D8%A8%D9%86%D8%A7%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/67/Hasan_Kharrat_cropped_1925.jpg","page_title":"الانتداب الفرنسي على سوريا ولبنان","context_page_description":"الانتداب الفرنسي على سورية أو الاستعمار الفرنسي ‏، ‏، هو الحالة التي شكلت النظام الأعلى للسياسة والمجتمع في سورية منذ أن هزمت قوات المملكة السورية العربية ضعيفة التسليح والعدد في معركة ميسلون في 24 تموز عام 1920، وحتى تمام جلاء القوات الفرنسية عن كامل التراب السوري يوم 17 نيسان عام 1946، والذي غدا اليوم الوطني السوري، وقد أقرت عصبة الأمم الانتداب رسمياً عام 1922.\\nيمكن تقسيم الانتداب إلى عدة مراحل تاريخية بدءاً من تقسيم البلاد عام 1920 وإخضاعها للحكم المباشر، إلى الوحدة بين دمشق وحلب في الدولة السورية عام 1925، ثم تمخّض الثورة السورية الكبرى عن انتخابات الجمعية التأسيسية التي وضعت دستور عام 1930 الذي أعلنت بموجبه الجمهورية السورية الأولى، أما الإضراب الستيني فقد أفضى أواخر عهد محمد علي العابد إلى وحدة البلاد ومعاهدة الاستقلال، غير أن فصل لواء إسكندرون واحتجاجات 1939 وكذلك الحرب العالمية الثانية أدت إلى توقيف العمل بالدستور وإعادة البلاد للحكم المباشر، وقد خضعت البلاد لحكومة فيشي حتى عام 1941 حين سيطر عليها الحلفاء، وأعلن شارل ديغول استقلالها وإعادة العمل بالدستور، وبعد الحرب العالمية الثانية أدت انتفاضة الاستقلال إلى تحقيق جلاء الفرنسيين عن كامل التراب السوري."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%93%D0%BE%D0%BC%D0%B5%D0%BD%D1%8E%D0%BA,_%D0%9E%D0%BB%D0%B5%D0%B3_%D0%92%D0%BB%D0%B0%D0%B4%D0%B8%D0%BC%D0%B8%D1%80%D0%BE%D0%B2%D0%B8%D1%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8e/Slugvvs.jpg","page_title":"Гоменюк, Олег Владимирович","context_page_description":"Олег Владимирович Гоменюк — приднестровский государственный и военный деятель. Министр обороны Приднестровской Молдавской Республики. Генерал-майор."},{"page_url":"https://it.wikipedia.org/wiki/Botiinae","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/24/Botia_histrionica.jpg","page_title":"Botiinae","context_page_description":"La sottofamiglia Botiinae comprende alcune specie di pesci della famiglia Cobitidae."},{"page_url":"https://tr.wikipedia.org/wiki/Klorofil","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/63/Chlorophyll_structure.png","page_title":"Klorofil","context_page_description":"Klorofil, çeşitli dalga boylarındaki ışıkları emerek bitkide fotosentez olayının meydana gelmesine sebep olan, yeşil renkli bir biyolojik pigment.\\nKlorofiller fotosentez olayında, karbondioksidin şekerlere ve diğer bitki maddelerine redüksiyomunda kullanılan ışık enerjisini emmektir."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%AC%E3%83%BC%E3%83%87%E3%82%A3%E3%83%B3%E3%82%B0%E3%83%8F%E3%82%A6%E3%82%BC%E3%83%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/80/R%C3%B6dinghausen_-_nature_reserves.png","page_title":"レーディングハウゼン","context_page_description":"レーディングハウゼン は、ドイツ連邦共和国ノルトライン＝ヴェストファーレン州北東部のヘルフォルト郡に属す町村である。ビーレフェルトの北約 30 km にあたる。人口約 1 万人のレーディングハウゼンは、デトモルト行政管区に属すヘルフォルト郡で最小の市町村である。この町が現在の町域となったのは、1969年に旧アムト・レーディングハウゼンの町村が合併した後のことである。しかし肥沃なラーフェンスベルガー地方にあたる現在の町域には、851年にはすでに集落が文献に登場している。"},{"page_url":"https://ro.wikipedia.org/wiki/Medebach","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/1c/Medebach_Sauerland_Ost_281_pk.jpg","page_title":"Medebach","context_page_description":"Medebach este un oraș din landul Renania de Nord-Westfalia, Germania."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9C%D0%B0%D1%80%D1%81%D0%B5%D0%BB%D1%8C%D1%81%D0%BA%D0%BE%D0%B5_%D0%A2%D0%B0%D1%80%D0%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7c/Jean_Dodal_Tarot_trump_05.jpg","page_title":"Марсельское Таро","context_page_description":"«Марсельское Таро» — собирательное название колод карт Таро наиболее распространённого дизайна, происходящего от таро Висконти — Сфорца и считающегося классическим."},{"page_url":"https://id.wikipedia.org/wiki/Frauke_Petry","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b1/Frauke_Petry_2015_%28cropped%29.jpg","page_title":"Frauke Petry","context_page_description":"Frauke Petry adalah seorang politikus Jerman yang menjabat sebagai ketua partai Alternative für Deutschland semenjak 4 Juli 2015. Petry dideskripsikan sebagai perwakilan sayap kanan ekstrem di partainya, tetapi ia menolak label tersebut dan menyatakan dirinya sebagai seorang konservatif nasional.\\nSebelumnya ia merupakan salah satu dari tiga juru bicara partai dari tahun 2013 hingga 2015. Ia menjadi ketua partai pada tahun 2015 setelah terjadinya perebutan kekuasaan internal. Ketua partai sebelumnya Bernd Lucke keluar dari partai setelah Petry terpilih dan menyatakan bahwa partai ini telah \\"jatuh ke tangan yang salah\\". Petry dikenal karena memiliki pandangan anti-Islam dan mengusulkan pelarangan menara masjid dan penggunaan senjata api untuk mencegah masuknya imigran ilegal. Sebelum memulai karier politik, ia mengenyam pendidikan di bidang kimia dan memiliki latar belakang profesional sebagai seorang pebisnis.\\nPada April 2017, Petry mundur dari pencalonan sebagai kanselir karena ingin mengganti kebijakan partai untuk pemilih yang lebih moderat."},{"page_url":"https://vi.wikipedia.org/wiki/Nam_T%C6%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6e/Axis_occupation_of_Yugoslavia%2C_1943-44.png","page_title":"Nam Tư","context_page_description":"Nam Tư miêu tả ba thực thể chính trị tồn tại nối tiếp nhau trên Bán đảo Balkan ở Châu Âu, trong hầu hết thế kỷ 20.\\nQuốc gia đầu tiên được biết với cái tên Nam Tư là Vương quốc Nam Tư, vốn trước ngày 3 tháng 10 năm 1929 từng được gọi là \\"Vương quốc của người Serb, Croat và Slovene\\". Quốc gia này được thành lập ngày 1 tháng 12 năm 1918 bởi liên minh Nhà nước của người Slovene, Croat và Serb và Vương quốc Serbia. Nước này bị phe Trục xâm chiếm năm 1941, và bởi các sự kiện diễn ra tiếp sau đó, đã chính thức bị xoá bỏ năm 1945.\\nQuốc gia với tên này từng là \\"Liên bang Dân chủ Nam Tư\\", tuyên bố năm 1943 bởi những người cộng sản thuộc phong trào kháng chiến trong Chiến tranh thế giới thứ hai. Nó được đổi tên thành \\"Cộng hòa Liên bang Nhân dân Nam Tư\\" năm 1946, khi một chính phủ cộng sản được thành lập. Năm 1963, nó lại được đổi tên thành \\"Cộng hòa Liên bang Xã hội chủ nghĩa Nam Tư\\"."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%96%D0%B5%D0%BD%D0%B3%D1%8F%D0%BB%D0%BE%D0%B2_%D1%85%D0%B0%D1%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a3/Jengyal_roll%2C_Armenia.jpg","page_title":"Женгялов хац","context_page_description":"Женгялов хац — вірменський плоский хліб, посипаний збором різних видів зелені. Цю страву готують тільки в Нагірному Карабасі."},{"page_url":"https://eu.wikipedia.org/wiki/Giron%C3%A8s","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/88/Catalunya_Giron%C3%A8s.png","page_title":"Gironès","context_page_description":"Gironès Kataluniako ipar-ekialdean dagoen barnealdeko eskualdea da. 575.6 km²-ko azalera du eta 160.838 biztanle zituen 2005ean, 27 udalerritan banatuta. Girona da hiriburua eta udalerri populatuena."},{"page_url":"https://vi.wikipedia.org/wiki/Prosthechea_ochracea","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a3/Prosthechea_ochracea_Orchi_004.jpg","page_title":"Prosthechea ochracea","context_page_description":"Prosthechea ochracea là một loài thực vật có hoa trong họ Lan. Loài này được W.E.Higgins miêu tả khoa học đầu tiên năm 1997."},{"page_url":"https://en.wikipedia.org/wiki/San_Diego_State_University","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5f/Ralph_Rubio.jpg","page_title":"San Diego State University","context_page_description":"San Diego State University is a public research university in San Diego, California. Founded in 1897 as San Diego Normal School, it is the third-oldest university in the 23-member California State University system. SDSU has a Fall 2019 student body of 35,081 and an alumni base of more than 300,000.\\nIt is classified among \\"Doctoral Universities: High Research Activity.\\" In the 2015–16 fiscal year, the university obtained $130 million in public and private funding—a total of 707 awards—up from $120.6 million the previous fiscal year. As reported by the Faculty Scholarly Productivity Index released by the Academic Analytics organization of Stony Brook, New York, SDSU is the number one small research university in the United States in 2006 and 2007. SDSU sponsors the second-highest number of Fulbright Scholars in the State of California, just behind UC Berkeley. Since 2005, the university has produced over 65 Fulbright student scholars.\\nThe university generates over $2.4 billion annually for the San Diego economy, while 60 percent of SDSU graduates remain in San Diego, making SDSU a primary educator of the region's work force."},{"page_url":"https://sv.wikipedia.org/wiki/Formica_glacialis","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0e/Formica_glacialis_casent0104762_label_1.jpg","page_title":"Formica glacialis","context_page_description":"Formica glacialis är en myrart som beskrevs av Wheeler 1908. Formica glacialis ingår i släktet Formica och familjen myror. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://fr.wikipedia.org/wiki/Rully_(AOC)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d2/Dactylosphaera_vitifolii_1_meyers_1888_v13_p621.png","page_title":"Rully (AOC)","context_page_description":"Le rully est un vin d'appellation d'origine contrôlée produit sur la commune de Rully, en Saône-et-Loire.\\nL'aire d'appellation fait partie des vignobles de la côte chalonnaise, à environ 15 kilomètres au nord-ouest de Chalon-sur-Saône et à environ 4 kilomètres au sud de Chagny."},{"page_url":"https://ast.wikipedia.org/wiki/R%C3%ADu_Columbia","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8e/Columbia.png","page_title":"Ríu Columbia","context_page_description":"El ríu Columbia ye un ríu del suroeste de Canadá y noroeste d'Estaos Xuníos que flúi en direición norte-sur-oeste pola provincia de Columbia Británica, en Canadá, y los estaos de Washington y Oregón n'Estaos Xuníos, desaguando nel océanu Pacíficu. Con 2044 km ye'l sestu ríu más llargu d'América del Norte, por detrás del Misuri, Misisipi, Bravo, Arkansas y Coloráu.\\nToma'l nome del Columbia Rediviva, el primer barcu occidental conocíu que remontara'l ríu. Naz na provincia canadiense de la Columbia Británica y en cruciando'l estáu de Washington y depués delimitar gran parte de la separación alministrativa ente los estaos de Washington y Oregón, desagua nel Pacíficu. La so cuenca hidrográfica, que drena gran parte de la Columbia Británica, Idaho, Oregón, Washington y pequeñes rexones de Montana, Wyoming, Utah y Nevada, entiende 668 000 km².\\nEn términos de caudal, el Columbia ye'l ríu de Norteamérica más caudalosu de l'aguada del Pacíficu y el cuartu más caudalosu de los Estaos Xuníos."},{"page_url":"https://pt.wikipedia.org/wiki/Arquidiocese_de_Trujillo","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bc/Cathedral_of_Trujillo%2C_Peru_02.jpg","page_title":"Arquidiocese de Trujillo","context_page_description":"A Arquidiocese de Trujillo é uma circunscrição eclesiástica da Igreja Católica situada em Trujillo, Peru. Seu atual arcebispo é Héctor Miguel Cabrejos Vidarte, O.F.M.. Sua Sé é a Catedral Basílica Santa Maria de Trujillo.\\nPossui 75 paróquias servidas por 128 padres, contando com 1 678 221 habitantes, com 76% da população jurisdicionada batizada."},{"page_url":"https://en.wikipedia.org/wiki/Hanfu","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/76/Park_Ji-won.jpg","page_title":"Hanfu","context_page_description":"Hanfu refers to the historical Han clothing styles of China. The Han Chinese historically wore a robe or a shirt for the upper garment, while the lower garment was commonly a pleated skirt. Since the Han dynasty, Chinese clothing had developed varied styles and exquisite textile techniques, particularly on silk, and absorbed favorable elements in foreign cultures. Ancient Chinese clothing was also influential to other traditional East Asian clothing such as the Japanese wafuku and Korean hanbok, as well as traditional Southeast Asian clothing such as the Vietnamese Áo giao lĩnh."},{"page_url":"https://en.wikipedia.org/wiki/1924_College_Football_All-Southern_Team","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/19/Hek.jpg","page_title":"1924 College Football All-Southern Team","context_page_description":"The 1924 College Football All-Southern Team consists of American football players selected to the College Football All-Southern Teams selected by various organizations for the 1924 Southern Conference football season.\\nAlabama won the SoCon championship. Centre defeated Alabama and claims a Southern championship, even though Centre was never a member of the Southern Conference."},{"page_url":"https://de.wikipedia.org/wiki/Bouts-rim%C3%A9s","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8f/Goethe_15-06-1775.jpg","page_title":"Bouts-rimés","context_page_description":"Bouts-rimés sind eine lyrische Kleinform, bei der man nach vorgegebenen Endreimen aus dem Stegreif dichtet. Je ungewöhnlicher die Reimworte zusammengestellt sind, desto verblüffender muss die Ausführung sein, um dem Gedicht zumindest den Anschein des sinnvollen Inhalts zu geben. Die bouts-rimés gelten als Salongattung und waren in der Form von Sonetten besonders während des französischen Grand Siècle als Konversationsspiel beliebt.\\nDie Erfindung der bouts-rimés fiel den Menagiana zufolge dem weitgehend unbekannt und erfolglos gebliebenen Dichter Dulot zu. Von ihm heißt es, dass er 1648 den Diebstahl wertvoller Manuskripte mit dreihundert Sonetten anzeigte. Als man ihn zu der beeindruckend hohen Zahl befragte, antwortete er, dass es sich um « Sonnets en blanc » handelte, bei denen er erst die Reime festgelegt hatte. Die Geschichte machte die Runde in den Salons, wo man die Idee zum Gesellschaftsspiel weiterentwickelte.\\nDie bouts-rimés wurden besonders 1654 zu einer lyrischen Modeerscheinung, als der Finanzminister Nicolas Fouquet ein derart gereimtes Sonett auf den Tod des Papageis seiner Freundin Madame du Plessis-Bellière verfasste."},{"page_url":"https://fr.wikipedia.org/wiki/Phare_de_Punta_de_Sa_Creu","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bd/Sa_Creu_Lighthouse_R01.jpg","page_title":"Phare de Punta de Sa Creu","context_page_description":"Le Phare de Punta de Sa Creu est un phare situé sur le promontoire à l'est de l'entrée du port de Sóller et à l'ouest de l'île de Majorque, dans l'archipel des Îles Baléares. Il fait face au Phare de Cabo Gros se trouvant sur le promontoire ouest.\\nIl est géré par l'autorité portuaire des îles Baléares au port d'Alcúdia."},{"page_url":"https://es.wikipedia.org/wiki/Lata","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6c/Tolkki20091027.jpg","page_title":"Lata","context_page_description":"Lata es un recipiente metálico usado como envase opaco para líquidos y productos en conserva.​ Los materiales de fabricación más habituales son la hojalata y el aluminio."},{"page_url":"https://en.wikipedia.org/wiki/Metro-North_Railroad","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/52/Metro_North.Bronxville.jpg","page_title":"Metro-North Railroad","context_page_description":"The Metro-North Commuter Railroad, trading as MTA Metro-North Railroad or simply Metro-North, is a suburban commuter rail service run by the Metropolitan Transportation Authority, a public authority of the U.S. state of New York and under contract with the Connecticut Department of Transportation. Metro-North runs service between New York City and its northern suburbs in New York and Connecticut, including Port Jervis, Spring Valley, Poughkeepsie, Yonkers, New Rochelle, Scarsdale, Hartsdale, White Plains, and Wassaic in New York and Stamford, New Canaan, Danbury, Waterbury, and New Haven in Connecticut. Metro-North also provides local rail service within the New York City boroughs of Manhattan and the Bronx.\\nMetro-North is the descendant of commuter rail services dating back as early as 1832. By 1969, they had all been acquired by Penn Central. MTA acquired all three lines by 1972, but Penn Central continued to operate them under contract. Service was transferred to Conrail in 1976, when it absorbed most of Penn Central's railroad functions after Penn Central's bankruptcy."},{"page_url":"https://de.wikipedia.org/wiki/Atlas_of_Peculiar_Galaxies","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/24/UGC9425_-_SDSS_DR14.jpg","page_title":"Atlas of Peculiar Galaxies","context_page_description":"Der Atlas of Peculiar Galaxies ist ein Astronomischer Katalog. In ihm sind 338 ungewöhnliche Galaxien mit photographischen Aufnahmen aufgeführt."},{"page_url":"https://war.wikipedia.org/wiki/Buprestis_gibbsii","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/64/1928._Buprestis_gibbsi._Adult._Photo_enlarged_and_detailed._%2834999633886%29.jpg","page_title":"Buprestis gibbsii","context_page_description":"An Buprestis gibbsii in uska species han Coleoptera nga syahan ginhulagway ni Leconte hadton 1857. An Buprestis gibbsii in nahilalakip ha genus nga Buprestis, ngan familia nga Buprestidae. Waray hini subspecies nga nakalista."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E8%81%96%E5%A5%B3%E6%AD%90%E6%96%90%E7%B1%B3%E5%A0%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c1/Santa_Eufemia_facade.jpg","page_title":"聖女歐斐米堂","context_page_description":"聖女歐斐米堂是義大利威尼托大區城市維羅納的一座羅馬天主教的教堂。這座教堂的外觀屬於哥德式建築。"},{"page_url":"https://en.wikipedia.org/wiki/The_X_Factor_(American_season_2)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/Tate_Stevens.jpg","page_title":"The X Factor (American season 2)","context_page_description":"Season two of the American television music competition show The X Factor premiered on Fox on September 12, 2012, and ended on December 20, 2012.\\nBased on the UK format, the competition consists of auditions, in front of producers and then the judges with a live audience; bootcamp; judges' houses and then the live finals. Auditions for the show began in May 2012 and concluded in July 2012. The show is hosted by reality star Khloé Kardashian and Extra host Mario Lopez, replacing Steve Jones from the previous year. Simon Cowell and L.A. Reid returned as judges, while Paula Abdul and Nicole Scherzinger were replaced by Britney Spears and Demi Lovato."},{"page_url":"https://fr.wikipedia.org/wiki/Fagot","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/15/Wellenbock_8900.jpg","page_title":"Fagot","context_page_description":"Un fagot est un assemblage de menus morceaux de bois, broutilles, rémanents, petites branches issues de l'émondage, liés avec une hare. Les broutilles sont appelées l’« âme du fagot ». On dit « châtrer un fagot », quand on en ôte quelques bâtons. Ces menu-bois sont destinés à être brûlés ou à servir de fascine. On en fabrique des balais.\\nLe fagoteur était le faiseur de fagots, le travail s'appelait « fagotage »."},{"page_url":"https://eo.wikipedia.org/wiki/Bela_Crkva_(Serbio)","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a4/Serbia_Bela_Crkva.png","page_title":"Bela Crkva (Serbio)","context_page_description":"Bela Crkva, serbe Бела Црква, hungare Fehértemplom, germane Weißkirchen, rumane Biserica Alba estas urbo kaj samtempe municipo en Serbio, en aŭtonomio Vojvodino, en distrikto Suda Banato. En ĉiuj lingvoj la nomo signifas: blanka preĝejo. Ankoraŭ 13 vilaĝoj apartenas al la municipo."},{"page_url":"https://en.wikipedia.org/wiki/Trayan_Lakavishki","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f5/Trayan_Lakavishki_IMRO_Shtip.jpg","page_title":"Trayan Lakavishki","context_page_description":"Trayan Krastev Stoilov, also known as Trayan Lakavishki, was a Bulgarian revolutionary, and leader of the Internal Macedonian Revolutionary Organization."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_personen_overleden_in_1932","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b8/Ernest_Mangnall.jpg","page_title":"Lijst van personen overleden in 1932","context_page_description":"Dit is een lijst van personen die overleden zijn in 1932.\\nDe inhoud van deze pagina is gebaseerd op gegevens in Wikidata. Als er onvolkomenheden in deze lijst zitten, gelieve dan aldaar de gegevens aan te passen. Achter iedere persoon is hiervoor een link aanwezig met de aanduiding bewerken.\\nWijzigingen in Wikidata worden met enige regelmatigheid geautomatiseerd overgenomen naar deze pagina."},{"page_url":"https://pt.wikipedia.org/wiki/Nikita_Mikhalkov","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/88/Nikita_Mikhalkov.jpg","page_title":"Nikita Mikhalkov","context_page_description":"Nikita Mikhalkov é um cineasta russo, que nas décadas de 1970 e 1980 foi um conhecido dissidente soviético e pró-czarista, atualmente é defensor do presidente Vladimir Putin.\\nIrmão do também grande cineasta Andrei Konchalovsky, Nikita Mikhalkov, como seu irmão se dedicou a filmes históricos na então URSS durante das décadas de 1970 e 1980. Seus primeiros filmes faziam reflexões sobre o gênero cinematográfico com construções em abismos, como pode ser notado em A Slave of Love, de 1976. Em 1977 dirigiu Peça Inacabada de Piano Mecânico. Nesta película mostra o choque das duas Rússias no seio de uma família da classe média.\\nEntre seus filmes mais notáveis, destacam-se Olhos Negros, com Marcello Mastroianni e Silvana Mangano, filmado na Itália, e Anna dos 6 aos 18, documentário filmado ao longo de 12 anos com sua filha, tendo como pano de fundo a vida política soviética em seus últimos anos, da morte de Leonid Brejnev ao golpe de agosto de 1991.\\nEm 1995 Mikhalkov ganhou o Oscar de melhor filme estrangeiro com O Sol Enganador, de 1994."},{"page_url":"https://de.wikipedia.org/wiki/Dollfu%C3%9F-Museum","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3b/2009-09-19_Dr._Dollfu%C3%9F_Museum_in_Texing%2C_Outside.jpg","page_title":"Dollfuß-Museum","context_page_description":"Das Dollfuß-Museum oder nach eigener Schreibweise Dr. Engelbert Dollfuß Museum befindet sich im Geburtshaus von Engelbert Dollfuß im Gemeindegebiet von Texingtal im Mostviertel in Niederösterreich."},{"page_url":"https://ca.wikipedia.org/wiki/Aeroport_Internacional_Hassan_I","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4e/%D8%A7%D9%84%D8%AF%D8%AE%D9%84%D8%A9_%D8%AF_%D9%84%D9%85%D8%B7%D8%A7%D8%B1_%D8%AF_%D8%A7%D9%84%D8%B9%D9%8A%D9%88%D9%86.jpg","page_title":"Aeroport Internacional Hassan I","context_page_description":"L'Aeroport Internacional Hassan I o Aeroport d'Al-Aaiun és un aeroport en Al-Aaiun, Sàhara Occidental administrat per ONDA.\\nA causa de la peculiar situació política del Sàhara Occidental, l'aeroport apareix duplicat en l'AIP, apareixent tant en el d'Espanya com el del Marroc."},{"page_url":"https://en.wikipedia.org/wiki/Largoward","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ed/Largoward_Church_-_geograph.org.uk_-_369228.jpg","page_title":"Largoward","context_page_description":"Largoward is a village in East Fife, Scotland, lying on the road from Leven to St Andrews in the Riggin o Fife, 4½ miles north-east of Lower Largo and 6½ miles south-west of St Andrews. It is an agricultural and former mining village, one of the three main villages of the civil parish of Kilconquhar, along with Colinsburgh and the village of Kilconquhar. Coal must have been worked for a considerable length of time in the district, as it is recorded that coal was driven annually from Falfield, just north-west of the village, to Falkland Palace for the use of King James VI.\\nLargoward and District Community Council covers the northern part of the civil parish of Kilconquhar, plus the Cassingray area to the east.\\nThe name probably means Largo's field, Largo parish and Largo Law being just west of the village. The name Largoward is recorded from the 18th century. Ward or waird is a Scots word meaning an enclosed piece of land, chiefly for pasture. Although in the parish of Kilconquhar, it appears to have had a connection with the parish or barony of Largo as regards tenure. The word ward appears in the neighbouring placenames of Balcarres Ward, West Ward and Knights Ward."},{"page_url":"https://pl.wikipedia.org/wiki/Hanover_(Ohio)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d4/OHMap-doton-Hanover.png","page_title":"Hanover (Ohio)","context_page_description":"Hanover – wieś w USA, w hrabstwie Licking, w stanie Ohio. Pierwszym burmistrzem Hanoveru był Michael Arter.\\nW roku 2010, 29,3% mieszkańców było w wieku poniżej 18 lat, 6,9% było w wieku od 18 do 24 lat, 23,7% miało 25 do 44 lat, 26,3% miało od 45 do 64 lat, a 13,8% było w wieku 65 lat lub starszych. We wsi było 51,8% mężczyzn i 48,2% kobiet.\\nLiczba mieszkańców w 2010 roku wynosiła 921, a w 2012 wynosiła 1 002."},{"page_url":"https://es.wikipedia.org/wiki/Carl_Gustaf_Mosander","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8b/Mosander_Carl_Gustav_bw.jpg","page_title":"Carl Gustaf Mosander","context_page_description":"Carl Gustaf Mosander, a veces escrito, Carl Gustav Mosander, fue un químico sueco. Descubrió los elementos químicos lantano, erbio y terbio."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9A%D1%83%D1%85%D0%BD%D1%8F_%D0%9A%D0%BE%D1%81%D0%BE%D0%B2%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8c/Boza_bg.jpg","page_title":"Кухня Косова","context_page_description":"Кухня Косова аналогічна кухням навколишніх місць. Кухня перебувала під впливом турецької та албанської кухонь. Спільними стравами цих кухонь є бурек, пироги, шашлик, суджук, ковбаски, фарширований перець, баранина, квасоля, сарма, бир'яні, піте та рис. Особливості кухонь варіюються по регіонах.\\nХліб та молочні продукти є найважливішими елементами Косовської кухні. У стравах широко використовують молочні продукти: молоко, кефір, айран, спреди, сир та каймак. М'ясо, квасоля, рис та перець є головними дієтичними продуктами у Косово. Овочі використовуються сезонно. Як правило, косовари маринують огірки, помідори та капусту. Популярністю користуються трави, чорний та червоний перець.\\nКухня змінюється залежно від пори року. Найпоширенішими стравами є бурек, пироги, шашлик, ковбаски, фаршировані перці, баранина, квасоля, сарма, страви з рису та багато інших. Молочні продукти присутні у повсякденній кухні. Найпоширенішими стравами у зимовий час у Косово є овочеві соління та айвар."},{"page_url":"https://en.wikipedia.org/wiki/1966_Syrian_coup_d%27%C3%A9tat","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1e/Senior_officials_in_the_Baath_Party_in_a_rare_un-official_photograph_with_Salah_Jadid_from_1969.jpg","page_title":"1966 Syrian coup d'état","context_page_description":"The 1966 Syrian coup d'état refers to events between 21 and 23 February during which the government of the Syrian Arab Republic was overthrown and replaced. The ruling National Command of the Arab Socialist Ba'ath Party were removed from power by a union of the party's Military Committee and the Regional Command, under the leadership of Salah Jadid.\\nThe coup was precipitated by a heightening in the power struggle between the party's old guard, represented by Michel Aflaq, Salah al-Din al-Bitar, and Munif al-Razzaz, and the younger factions adhering to a Neo-Ba'athist position. On 21 February, supporters of the old guard in the army ordered the transfer of their rivals. Two days later, the Military Committee, backing the younger factions, launched a coup that involved violent fighting in Aleppo, Damascus, Deir ez-Zor, and Latakia. As a result of the coup, the party's historical founders fled the country and spent the rest of their lives in exile.\\nJadid's government was the most radical administration in Syria's history."},{"page_url":"https://en.wikipedia.org/wiki/Margate","image_url":"https://upload.wikimedia.org/wikipedia/en/b/b6/Pleasure_Park_Entrance.jpg","page_title":"Margate","context_page_description":"Margate is a seaside town in Thanet, Kent, South East England, Europe, 15 miles north-east of Canterbury, which includes Cliftonville, Garlinge, Palm Bay and Westbrook."},{"page_url":"https://en.wikipedia.org/wiki/Lillsj%C3%B6n_(Ulvsunda)","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e1/Lillsj%C3%B6n_Bromma_2010c.jpg","page_title":"Lillsjön (Ulvsunda)","context_page_description":"Lillsjön is a small lake in the western suburb Bromma in Stockholm, Sweden. It is one of four lakes in the western suburbs, the other being: Kyrksjön, Judarn, and Råcksta Träsk. Located in the small park Lillsjöparken and surrounded by heavily trafficked artery roads on all sides, it is rich in nutrients with high levels of metals in the sediments. Prospects are to improve the water quality to keep the lake as a locale for birds."},{"page_url":"https://bs.wikipedia.org/wiki/Stadion_Lillek%C3%BCla","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/Samba_boys_kick_off_the_match_in_Tallinn.jpg","page_title":"Stadion Lilleküla","context_page_description":"A. Le Coq Arena je nogometni stadion u Tallinnu, Estonija. Na njemu domaće utakmice igraju nogometni klub Flora i nogometna reprezentacija Estonije. Kapacitet stadiona je 9.692 sjedećih mjesta.\\nStadion je u vlasništvu nogometnog saveza Estonije. U okviru kompleksa stadiona nalazi se Sportland Arena koja može primiti 500 gledalaca. Na stadionu je održano nekoliko muzičkih koncerata."},{"page_url":"https://gl.wikipedia.org/wiki/Megan_Boone","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fc/The_Blacklist_-_Megan_Boone_%28cropped%29.jpg","page_title":"Megan Boone","context_page_description":"Megan Boone nada en Petoskey, Míchigan, o 29 de abril de 1983, é unha actriz estadounidense. É coñecida no seu papel como Elizabeth Keen, unha axente do FBI na serie da NBC titulada The Blacklist. Tamén traballou regularmente nas series Law & Order: LA e Blue Bloods. Ten aparecido en películas como My Bloody Valentine 3D e Step Up Revolution"},{"page_url":"https://ceb.wikipedia.org/wiki/Eubranchipus_grubii","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0c/EubranchipusGrubiiMale%2BFemale.jpg","page_title":"Eubranchipus grubii","context_page_description":"Espesye sa krustaseo nga una nga gihulagway ni Benedykt Dybowski ni adtong 1860 ang Eubranchipus grubii. Ang Eubranchipus grubii sakop sa kahenera nga Eubranchipus sa kabanay nga Chirocephalidae. Pagka karon wala pay siak nga nalista ubos niini niya."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%BC%97%E9%9B%B7%E5%BE%B7%E9%87%8C%E5%85%8B%C2%B7%E6%B3%A2%E7%88%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/18/Frederik_Pohl_Eaton_2008-05-17.png","page_title":"弗雷德里克·波爾","context_page_description":"弗雷德里克·波尔是美国科幻小说作家，曾赢得四次雨果奖和三次星云奖。"},{"page_url":"https://pl.wikipedia.org/wiki/Estadio_Monumental","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/002.Buenos_Aires_desde_el_cielo_%28Estadio_de_River%29.JPG","page_title":"Estadio Monumental","context_page_description":"Estadio Monumental Antonio Vespucio Liberti – stadion sportowy w Buenos Aires, na którym swe mecze rozgrywa CA River Plate oraz reprezentacja narodowa."},{"page_url":"https://de.wikipedia.org/wiki/Betteldorf","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/72/St._Apollonia_%28Betteldorf%29_01.jpg","page_title":"Betteldorf","context_page_description":"Betteldorf ist eine Ortsgemeinde im Landkreis Vulkaneifel in Rheinland-Pfalz. Sie gehört der Verbandsgemeinde Daun an."},{"page_url":"https://sv.wikipedia.org/wiki/Staphylinus_dimidiaticornis","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3e/Staphylinus_dimidiaticornis_01.JPG","page_title":"Staphylinus dimidiaticornis","context_page_description":"Staphylinus dimidiaticornis är en skalbaggsart som beskrevs av Max Gemminger 1851. Staphylinus dimidiaticornis ingår i släktet Staphylinus, och familjen kortvingar. Arten är reproducerande i Sverige."},{"page_url":"https://eu.wikipedia.org/wiki/Montenescourt","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c9/Montenescourt-Eglise2-Juillet-2006.jpg","page_title":"Montenescourt","context_page_description":"Montenescourt Frantziako udalerria da, Pas-de-Calais departamenduan dagoena, Hauts-de-France eskualdean. 2013an 411 biztanle zituen."},{"page_url":"https://en.wikipedia.org/wiki/Insular_G","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c0/Evolution_of_minuscule.svg","page_title":"Insular G","context_page_description":"Insular G is a form of the letter g somewhat resembling a tailed z, used in the medieval insular script of Great Britain and Ireland. It was first used in the Roman Empire in Roman cursive, then it appeared in Irish half uncial script, and after it had passed into Old English, it developed into the Middle English letter yogh. Middle English, having reborrowed the familiar Carolingian g from the Continent, began to use the two forms of g as separate letters."},{"page_url":"https://en.wikipedia.org/wiki/North_Queensland","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a2/Castle_Hill_Townsville.jpg","page_title":"North Queensland","context_page_description":"North Queensland or the Northern Region is the northern part of the Australian state of Queensland that lies just south of Far North Queensland. Queensland is a massive state, larger than many countries, and its tropical northern part has been historically remote and undeveloped, resulting in a distinctive regional character and identity.\\nTownsville is the largest urban centre in North Queensland, leading it to be regarded as an unofficial capital. The region has a population of 231,628 and covers 80,041.5 km²."},{"page_url":"https://zh.wikipedia.org/wiki/%E7%BE%8E%E5%9C%8B%E7%83%B9%E9%A3%AA%E5%AD%B8%E9%99%A2","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8e/Culinary_Institute_of_America_Colavita_and_Roth_Hall.JPG","page_title":"美國烹飪學院","context_page_description":"美國烹飪學院是一家廚藝學院，校本部位於美國紐約州達奇斯縣海德帕克，在加利福尼亞州聖海倫娜、納帕、德克薩斯州聖安東尼奧市以及新加坡有分校，是一家非營利性學術機構，擁有世界最多的美國烹飪協會廚師。學院也提供專業諮詢和繼續教育。"},{"page_url":"https://ml.wikipedia.org/wiki/%E0%B4%90%E0%B4%AC%E0%B5%8A","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f2/RUNSWift_AIBOS.jpg","page_title":"ഐബൊ","context_page_description":"ജപ്പാനിലെ സോണി കോർപ്പൊറേഷൻ നിർമ്മിച്ച യന്ത്ര-വളർത്തുമൃഗങ്ങളിൽ ഒന്നാണു ഐബൊ. Artificial Intelligence roBOt എന്നതിന്റെയ് ചുരുക്കിയെഴുത്താണ് ഐബൊ. ജാപ്പനീസ് ഭാഷയിൽ ഐബൊ എന്നാൽ കൂട്ടാളി അല്ലെങ്കിൽ സുഹൃത്ത് എന്നാണു അർത്ഥം. ആദ്യകാല ഐബൊകൾക്കു ഒരു പട്ടിക്കുട്ടിയുടെ ആകൃതി ആയിരുന്നു ഉണ്ടായിരുന്നത്.കൃത്രിമബുദ്ധി എന്ന സാങ്കേതിക വിദ്യയാണു ഐബൊകളെ പ്രവർത്തനത്തിനടിസ്ഥാനം."},{"page_url":"https://pnb.wikipedia.org/wiki/%D8%A7%D8%B1%D8%AF%D8%A7%D8%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8e/BhaiSahibJiArdas.jpg","page_title":"ارداس","context_page_description":"ارداس عرض + داشت توں بنیا اک شبد اے۔ عرض دا مطلب اے بینتی۔ داشت دا مطلب اے پیش کرنا۔ یعنی بینتی پیش کرنی۔ گرمتِ وچ ارداس دی خاص اہمیت اے۔ ارداس جیو ولوں پرماتما اگے کیتی گئی بینتی اے۔ دکھ ہووے جاں سکھ، خوشی ہووے جاں غمی، ہر موقعے تے گرو دا سکھ گرو دی بخشش لین لئی ارداس کردا اے۔\\nگرو جی ادور پرکھ اگے ارداس کردے ہوئے ایہہ کہندے ہن کہ اے پربھو! جے پروان کرو تاں میں آپ جی دے گن گاؤندیاں-گاؤندیاں نام جس وچ لین ہو جاواں۔\\nجے تیرے اندر غصہ آ جاوے، دکھ آ جاوے تاں گرو امرداس جی نوں یاد کر۔ جدوں بابا داتو نے گرو جی نوں لتّ کڈھ ماری تاں گرو جی نے بابا داتو دے پیر پھڑ کے کیہا، ‘‘میریاں ہڈیاں سخت ہن، تہاڈے کومل چرناں تے سٹّ تاں نہیں لگ گئی؟’’ کتنی نمرتا اتے پیار سی اوہناں دے اندر۔ جہڑا انسان سمرن کردا اے، اس دے اندر اہنکار نہیں آؤندا۔"},{"page_url":"https://en.wikipedia.org/wiki/Luis_de_Salazar_y_Castro","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cd/Luis_Bartolom%C3%A9_de_Salazar_y_Castro._Fot._Biblioteca_Nacional_Madrid.jpg","page_title":"Luis de Salazar y Castro","context_page_description":"Luis de Salazar y Castro was a Spanish genealogist."},{"page_url":"https://be.wikipedia.org/wiki/%D0%A1%D0%B2%D1%8F%D1%82%D0%B0-%D0%9C%D1%96%D0%BA%D0%B0%D0%BB%D0%B0%D0%B5%D1%9E%D1%81%D0%BA%D1%96_%D1%81%D0%B0%D0%B1%D0%BE%D1%80_%D1%96_%D0%BA%D0%BB%D1%8F%D1%88%D1%82%D0%B0%D1%80_%D1%84%D1%80%D0%B0%D0%BD%D1%86%D1%8B%D1%81%D0%BA%D0%B0%D0%BD%D1%86%D0%B0%D1%9E_(%D0%9D%D0%B0%D0%B2%D0%B0%D0%B3%D1%80%D1%83%D0%B4%D0%B0%D0%BA)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/Franciscan_Catholic_Church_in_Navahradak.JPG","page_title":"Свята-Мікалаеўскі сабор і кляштар францысканцаў (Навагрудак)","context_page_description":"Свята-Мікалаеўскі сабор і кляштар францысканцаў — сакральны комплекс у г. Навагрудак, размешчаны па адрасе вул. Гродзенская, 4, 6. Помнік архітэктуры позняга барока."},{"page_url":"https://en.wikipedia.org/wiki/New_Urbanism","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/House_in_baldwin_park.JPG","page_title":"New Urbanism","context_page_description":"New Urbanism is an urban design movement which promotes environmentally friendly habits by creating walkable neighborhoods containing a wide range of housing and job types. It arose in the United States in the early 1980s, and has gradually influenced many aspects of real estate development, urban planning, and municipal land-use strategies. New urbanism attempts to address the ills associated with urban sprawl and post-Second World War suburban development.\\nNew Urbanism is strongly influenced by urban design practices that were prominent until the rise of the automobile prior to World War II; it encompasses ten basic principles such as traditional neighborhood design and transit-oriented development. These ideas can all be circled back to two concepts: building a sense of community and the development of ecological practices.\\nThe organizing body for New Urbanism is the Congress for the New Urbanism, founded in 1993. Its foundational text is the Charter of the New Urbanism, which begins:"},{"page_url":"https://oc.wikipedia.org/wiki/Manh%C3%B2lia","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f0/Fleur_de_magnolia2.jpg","page_title":"Manhòlia","context_page_description":"Los manhòlias forman un genre de plantas de flors, de la familha dels Magnoliacèas, que comprend gaireben cent e dètz espècias, subretot d'arbres e arbrilhons, de las regions temperadas caudas.\\nLos manhòlias apareguèron abans los coleoptèrs, las flors son fachas per encoratjar la polinizacion pels insèctes. Per evitar los domatges causats pels coleoptèrs polinizators, los carpèls de las flors de manhòlia son plan fòrtas. Los especimens fossilizats de Magnolia acuminata datan de 20 milions d'anadas e d'especimens apartenent a la familha dels Magnoliaceae a 95 milions d'anadas. Un autre aspècte primitiu deld Manhòlias es lor abséncia de sepals o de petalas distincts.\\nLos manhòlias an un espandiment natural discontunh, amb un centre principal a l'Èst e al Sud d'Asia e un centre secondari dins l'Èst de l'America del Nòrd, America Centrala, las Antilhas e qualques espècias en America del Sud."},{"page_url":"https://ce.wikipedia.org/wiki/%D0%A3%D1%82%D0%BA%D0%B5%D1%80%D0%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/74/Eglise_Saint-Antoine_%28Houtkerque%29.jpg","page_title":"Уткерк","context_page_description":"Уткерк — Францин гӀала-коммуна, лаьтта О-де-Франс регионехь. Коммунан департамент — Нор. Кхузахь климат барамехь ю, аьхка йовха хуьлу, ткъа Ӏа барамехь-шийла хуьлу. ГӀалин бахархой французаш бу. Официалан Французийн мотт бу."},{"page_url":"https://de.wikipedia.org/wiki/Klaus_Thielmann","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/22/Bundesarchiv_Bild_183-1989-1024-031%2C_Berlin%2C_10._Volkskammertagung.jpg","page_title":"Klaus Thielmann","context_page_description":"Klaus Thielmann ist ein ehemaliger deutscher Politiker sorbischer Herkunft. Er war von Januar 1989 bis April 1990 Minister für Gesundheits- und Sozialwesen der DDR."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A0%D1%83%D0%B0%D0%BD%D1%81%D1%8C%D0%BA%D0%B8%D0%B9_%D1%81%D0%BE%D0%B1%D0%BE%D1%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b4/Notre_Dame_cathedral._Main_ship_-_%28Rouen%29.jpg","page_title":"Руанський собор","context_page_description":"Руа́нський собо́р — готичний собор у місті Руан. Кафедральний собор архієпископа Руана та Нормандії. Належить до числа пам'яток національної спадщини Франції. З 1876 до 1880 року був найвищою будівлею світу, поступившись цим титулом Кельнському собору."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkm%C3%A4ler_in_Rannungen","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/67/Zehntscheune_in_Rannungen.JPG","page_title":"Liste der Baudenkmäler in Rannungen","context_page_description":"Auf dieser Seite sind die Baudenkmäler der unterfränkischen Gemeinde Rannungen zusammengestellt. Diese Tabelle ist eine Teilliste der Liste der Baudenkmäler in Bayern. Grundlage ist die Bayerische Denkmalliste, die auf Basis des Bayerischen Denkmalschutzgesetzes vom 1. Oktober 1973 erstmals erstellt wurde und seither durch das Bayerische Landesamt für Denkmalpflege geführt wird. Die folgenden Angaben ersetzen nicht die rechtsverbindliche Auskunft der Denkmalschutzbehörde.\\nDiese Liste gibt den Fortschreibungsstand vom 15. April 2020 wieder und enthält 25 Baudenkmäler."},{"page_url":"https://et.wikipedia.org/wiki/Vagur_eirenis","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cc/Benny_Trapp_Eirenis_modestus_Samos.jpg","page_title":"Vagur eirenis","context_page_description":"Vagur eirenis on maoliik."},{"page_url":"https://zh.wikipedia.org/wiki/2013%E5%B9%B4%E5%A4%A7%E8%A5%BF%E6%B4%8B%E9%A2%B6%E9%A2%A8%E5%AD%A3","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c1/08L_Sept_6_2013_1735Z.jpg","page_title":"2013年大西洋颶風季","context_page_description":"2013年大西洋飓风季是继1994年以来第一个没有大型飓风形成的大西洋飓风季，也是继1968年以来首次没有任何风暴达到萨菲尔-辛普森飓风等级下的二级飓风强度。热带风暴安德烈亚是全季首场风暴，于6月5日形成，最后一个气旋则是场没有命名的亚热带风暴，于12月7日消散。全年只有飓风英格丽德和温贝托达到飓风强度，是继1982年以来最少的。\\n这年飓风季造成的影响很小，虽有15个热带气旋形成，但大部分不是强度很低，就是一直在海上活动。热带风暴安德烈亚是该飓风季唯一登陆美国的风暴，从佛罗里达州登上美国东岸，导致4人遇难。7月上旬，热带风暴尚塔尔从背风群岛经过，造成1人丧生，但总体破坏程度很轻。热带风暴多利安、埃琳以及飓风温贝托只给佛得角群岛带去了狂风天气。墨西哥是本季受灾最严重的国家，飓风英格丽德、第八号热带低气压、热带风暴巴里和热带风暴费尔南德均在该国登陆，其中仅英格丽德就造成至少23人死亡，经济损失达15亿美元。10月上旬，热带风暴凯伦在美国墨西哥湾沿岸地区中部产生降水和阵风。\\n所有的主流天气预报机构都预测这季的活跃程度会高于平均水平，之后又都在8月上旬将预测数值调低，但事实证明，即便是调整后的数据也仍然过高。这年大西洋热带天气活动程度低主要是因为冬季到春季温盐环流的大幅减弱，减弱程度出人意料。这导致大西洋上空春季天气模式的延长，加上强烈的垂直风切变、中层湿气，以及较为稳定的大气活动共同影响，导致热带气旋的发展受到压制。"},{"page_url":"https://ar.wikipedia.org/wiki/%D9%85%D8%B4%D8%B1%D9%88%D8%A8_%D8%BA%D8%A7%D8%B2%D9%8A","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/2a/Soft_drink_shelf.JPG","page_title":"مشروب غازي","context_page_description":"المشروبات الغازية أو الباردة أو المرطبات هي أي مشروبات صناعية مضاف إليها مواد حافظة وغازات ونكهات تعطيها الطعم المميز الذي يختلف من نوع لآخر حسب النكهة المضافة، ومن أشهر أنواعها الكولا، المياه بنوعيها الفوارة والمنكهة، الشاي المثلج، الليمونادة وبعض أنواع العصائر. أما الشكولاتة الساخنة، الشاي، القهوة، الحليب، العصائر والملك شيك فلا تعدّ من المشروبات الغازية."},{"page_url":"https://vi.wikipedia.org/wiki/Lagidium_viscacia","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/42/Vizcacha_in_the_Atacama.jpg","page_title":"Lagidium viscacia","context_page_description":"Lagidium viscacia là một loài động vật có vú trong họ Chinchillidae, bộ Gặm nhấm. Loài này được Molina mô tả năm 1782. Loài này được tìm thấy ở Argentina, Peru, Chile, Bolivia. Chúng sinh sống thành bầy nhỏ trong các núi đá."},{"page_url":"https://ka.wikipedia.org/wiki/Quercus_castanea","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/87/028_quercus_castanea.jpg","page_title":"Quercus castanea","context_page_description":"Quercus castanea — ორლებნიანთა კლასის ხე წიფლისებრთა ოჯახიდან. გავრცელებულია მექსიკაში."},{"page_url":"https://fr.wikipedia.org/wiki/R%C3%A9seau_hydrographique_de_l%27Orne","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c2/61-Bassins_DCE.jpg","page_title":"Réseau hydrographique de l'Orne","context_page_description":"Le réseau hydrographique de l'Orne est l'ensemble des éléments naturels ou artificiels, drainant le territoire du département de l'Orne. Il regroupe ainsi des cours d'eau ou canaux situés entièrement ou partiellement dans l'Orne.\\nLe réseau hydrographique départemental comprend 16 cours d'eau de longueur supérieure à 50 km et 99 de longueur supérieure à 10 km. Plusieurs plans d'eau complètent ce réseau, dont certains remarquables comme."},{"page_url":"https://pl.wikipedia.org/wiki/Ko%C5%9Bci%C3%B3%C5%82_Niepokalanego_Pocz%C4%99cia_Naj%C5%9Bwi%C4%99tszej_Maryi_Panny_i_%C5%9Bw._Miko%C5%82aja_w_Oksie","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/64/Oksa_-_zb%C3%B3r_kalwi%C5%84ski.JPG","page_title":"Kościół Niepokalanego Poczęcia Najświętszej Maryi Panny i św. Mikołaja w Oksie","context_page_description":"Kościół Niepokalanego Poczęcia Najświętszej Maryi Panny i świętego Mikołaja w Oksie – dawny zbór kalwiński, ufundowany zapewne w latach 60. XVI wieku przez Mikołaja Reja, a ukończony w 1570 przez jego syna - Andrzeja.\\nKs. Jan Wiśniewski oraz Katalog zabytków sztuki w Polsce podają jako datę wzniesienia zboru rok 1570, a za jego fundatora uznają Andrzeja Reja, który odziedziczył Oksę po śmierci ojca w 1569. Tadeusz Przypkowski, na podstawie dostępnych źródeł, trafnie pogodził informacje, że budowę zboru rozpoczął Mikołaj, a ukończył Andrzej Rej. Od końca XVI do 2 połowy XVII wieku zbór w Oksie był jednym z głównych ośrodków kalwinizmu małopolskiego, w którym wielokrotnie odbywały się synody protestanckie. W 1678 został przejęty przez cystersów jędrzejowskich i został filią parafii Konieczno. Według Józefa Łukaszewicza, po przejęciu zboru przez katolików, Rejowie wznieśli nowy drewniany zbór, który istniał do końca XVII wieku. W latach 1762 – 1763 dokonano gruntownej restauracji świątyni; wybudowano wówczas nową zakrystię z ołtarzem głównym.\\nW czerwcu 1914 świątynia została konsekrowana pod wezwaniem św. Mikołaja przez biskupa Augustyna Łosińskiego."},{"page_url":"https://gl.wikipedia.org/wiki/Istmo_de_Tehuantepec","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/06/Isthmus_of_Tehuantepec-aeac.jpg","page_title":"Istmo de Tehuantepec","context_page_description":"O istmo de Tehuantepec é unha rexión comprendida entre os estados de Oaxaca, Chiapas, Tabasco e Veracruz en México. Trátase da zona máis angosta entre os dous océanos que posúe México. É unha zona rica en petróleo e recursos forestais. Tamén é unha das rexións con maior presenza indíxena do país. Nela conviven huaves, zapotecos e zoques.\\nOs principais centros de poboación do istmo de Tehuantepec son Coatzacoalcos, Minatitlán e Acayucan en Veracruz; e Juchitán de Zaragoza, Matias Romero, Salina Cruz e Santo Domingo Tehuantepec, no estado de Oaxaca. Esta última poboación confírelle o nome á rexión. Aínda que se trata dun pobo fundado por zapotecos, o nome é náhuatl, e significa Cerro do xaguar."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%8F%E3%83%B3%E3%83%89%E3%83%9C%E3%83%BC%E3%83%AB","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2b/Handzeichen_05_Schlagen.jpg","page_title":"ハンドボール","context_page_description":"ハンドボールとは、7人ずつの2チームが1個のボールを手で扱い、相手のゴールに投げ入れて得点を競うチームスポーツである。送球とも呼ばれる。公式競技は屋内で行われ、時間内に多くの得点を挙げたチームが勝利となる。\\nサッカーから派生した競技であるが、ボールを手で扱う競技特性から、バスケットボールと類似したルールが追加されてきた特徴を持つ。\\n「走る・投げる・跳ぶ」の3要素が揃ったスポーツで、スピード・迫力ある攻防や華麗なシュートが魅力とされている。"},{"page_url":"https://es.wikipedia.org/wiki/P%C5%99ev%C3%BD%C5%A1ov","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e3/Znak_obce_P%C5%99ev%C3%BD%C5%A1ov.gif","page_title":"Převýšov","context_page_description":"Převýšov es una localidad del distrito de Hradec Králové en la región de Hradec Králové, República Checa, con una población estimada a principio del año 2018 de 335 habitantes.\\nSe encuentra ubicada al sur de la región, a unos 100 km al este de Praga, cerca de la orilla de los ríos Elba y Orlice —un afluente del anterior—, y de la frontera con las regiones de Bohemia Central y Pardubice.​"},{"page_url":"https://kk.wikipedia.org/wiki/%D2%9A%D0%B0%D0%B7%D0%B0%D2%9B_%D0%B3%D1%80%D0%B0%D1%84%D0%B8%D0%BA%D0%B0%D1%81%D1%8B","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ab/Kazakh_latin_alphabet_%281924%29.JPG","page_title":"Қазақ графикасы","context_page_description":"Қазақ графикасы — қоғамдағы түрлі тарихи-әлеуметтік өзгерістерге сәйкес бірнеше жазу нұсқаларына бағындырылған, фонематикалық принципке сүйенетін қазақтың дыбыстық жазуы.\\nГрафика — графемалар, тыныс, екпін белгілері т.б. жазу құралдар жиынтығы, фонемалық жазудағы графема мен фонема арасындағы қатынастар жүйесі және оларды зерттейтін тіл білімінің бір саласы.\\nҚазіргі қазақ графикасы әріптерінің жазылуы тәсіліне және өрнегіне қарай жазу графикасы мен баспа графикасы болып бөлінеді. Қазақ жазу графикасындағы әріптердің нобайы көне орыс жазуындағы дыбыстар нобайының негізінде пайда болған."},{"page_url":"https://no.wikipedia.org/wiki/Trollh%C3%A4ttan_sentralstasjon","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6b/V%C3%A4sttrafikTrollh%C3%A4ttan.jpg","page_title":"Trollhättan sentralstasjon","context_page_description":"Trollhättan sentralstasjon er en jernbanestasjon på Norge/Vänerbanan i Trollhättan kommune. Den blir betjent av fjerntog mellom Oslo og Göteborg, og av regionaltrafikk mellom Vänersborg og Göteborg og mellom Karlstad og Göteborg."},{"page_url":"https://es.wikipedia.org/wiki/Cer%C3%A1mica_siciliota","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/41/Phlyax_scene_Louvre_CA7249.jpg","page_title":"Cerámica siciliota","context_page_description":"La cerámica siciliota es la producción local de cerámica de figuras rojas que comenzó en Sicilia a finales del siglo V a. C., quizás por artesanos atenienses que llegaron a Italia con la fundación de Turios en el 443 a. C.\\nLa producción inicial de esta pequeña escuela, tal vez un solo taller, parece seguir el estilo ático contemporáneo y en particular el del Pintor de Pothos. Alrededor del 380-370 a. C. algunos ceramistas de la escuela siciliota se trasladaron a Campania y Paestum. El período siguiente es poco conocido, pero a partir del año 340 a. C. aumentan los testimonios de la producción local siciliota y la escuela asume una fisonomía clara, dividida en diferentes talleres en la zona central y oriental de Sicilia, hasta el final del siglo; la datación en este período se basa en la de las monedas contemporáneas."},{"page_url":"https://ru.wikipedia.org/wiki/Anagyris_foetida","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c0/Anagyris_foetida_flowers_1.JPG","page_title":"Anagyris foetida","context_page_description":"Anagyris foetida — вид цветущих растений семейства Бобовые. Видовой эпитет происходит от лат. foetida — «вонючий». Считается реликтовым видом флоры субтропической Кайнозойской эры."},{"page_url":"https://it.wikipedia.org/wiki/Giovanna_Plantageneto_(1321-1362)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0c/Joan_Queen_of_Scotland.jpg","page_title":"Giovanna Plantageneto (1321-1362)","context_page_description":"Giovanna Plantageneto conosciuta come Giovanna della Torre perché nacque nella Torre di Londra, fu una principessa inglese e regina consorte di Scozia, come prima moglie del re Davide II."},{"page_url":"https://eo.wikipedia.org/wiki/Jarmilo_de_Rusio","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/70/1000_Griboedov.jpg","page_title":"Jarmilo de Rusio","context_page_description":"La Jarmilo de Rusio estas monumento situanta en Velikij Novgorod, Rusio, kaj konstruita en 1862 je honoro de la miljara jubileo de la legenda alvoko de Varengoj en Rusjon. Aŭtoroj de la projekto estis Miĥail Mikeŝin, Ivan Ŝreder kaj arkitekto Viktor Gartman. La monumento situas en la Kremlo de Novgorod."},{"page_url":"https://et.wikipedia.org/wiki/Tony_Tan_Keng_Yam","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6b/Tony_Tan_Keng_Yam_cropp.jpg","page_title":"Tony Tan Keng Yam","context_page_description":"Tony Tan Keng Yam on Singapuri matemaatik ja poliitik, kes oli 1. septembrist 2011 kuni 1. septembrini 2017 Singapuri president.\\nTal on magistrikraad Massachusettsi Tehnoloogiainstituudist ja doktorikraad rakendusmatemaatika alal Adelaide'i ülikoolist. Kuni 1969. aastani õpetas ta Singapuri ülikoolis matemaatikat, seejärel tegutses panganduse alal. Aastatel 1980–1981 oli ta Singapuri ülikooli asekantsler.\\nTony Tan kuulus kuni presidendiks kandideerimiseni Rahvaaktsiooni Parteisse. Aastatel 1979–2006 oli ta parlamendi liige, 1983–1985 rahandusminister, seejärel 1991. aastani haridusminister, 1995–2005 asepeaminister, 1995–2003 ühtlasi kaitseminister ja 2003–2005 julgeolekuminister."},{"page_url":"https://nl.wikipedia.org/wiki/Semachrysa","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2b/Semachrysa_jade_female_habitus_%28Morphbank_791597%29_-_ZooKeys-214-001-g002.jpg","page_title":"Semachrysa","context_page_description":"Semachrysa is een geslacht van insecten uit de familie van de gaasvliegen, die tot de orde netvleugeligen behoort."},{"page_url":"https://en.wikipedia.org/wiki/Hal_B._Wansley_Power_Plant","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cb/Honoring_Confederate_Veteran_Lewis_H_Brown%2C_one_of_eight_Confedeate_Veterans_in_the_two_Yellow_Dirt_Church_Cemeteries_on_8_October_2011_after_original_flags_were_illegally_removed_by_Georgia_Power.jpg","page_title":"Hal B. Wansley Power Plant","context_page_description":"Hal B. Wansley Power Plant is a power station located in northeastern Heard County, between Franklin and Carrollton, in the state of Georgia, United States. Its various units, powered by coal, oil, and natural gas, are operated by Southern Company, Georgia Power Company, Oglethorpe Power Corporation, Municipal Electric Authority and Dalton Utilities."},{"page_url":"https://de.wikipedia.org/wiki/Lawrence_Weiner","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/32/Gak_bremen.jpg","page_title":"Lawrence Weiner","context_page_description":"Lawrence Weiner ist ein US-amerikanischer bildender Künstler. Weiner gilt – neben Sol LeWitt, Robert Barry, Douglas Huebler und Joseph Kosuth – als ein Vertreter der Konzeptkunst, die in den 1960er-Jahren aus dem Minimalismus entstand."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9F%D1%96%D0%B2%D0%BD%D1%96%D1%87%D0%BD%D0%B5_%D0%92%D1%96%D0%B4%D1%80%D0%BE%D0%B4%D0%B6%D0%B5%D0%BD%D0%BD%D1%8F","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c1/Elizabeth_I_of_England_Westminster_School.jpg","page_title":"Північне Відродження","context_page_description":"Півні́чне Відро́дження — культурний рух та мистецька епоха у північноєвропейських країнах в останнє десятиріччя XV століття та першу чверть XVI століття. Поступилося місцем культурі маньєризму і бароко. Свою назву течія отримала через спільні з італійським Відродженням тенденції. Північне Відродження набуло найбільшого поширення в таких країнах як Німеччина, Нідерланди, Франція та Англія."},{"page_url":"https://fa.wikipedia.org/wiki/%DA%86%D8%A7%D8%B1%D9%84%D8%B2_%D8%AF%DB%8C_%D8%AC%D9%85%D8%A7%D8%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7e/CharlesDGemar.jpg","page_title":"چارلز دی جمار","context_page_description":"چارلز دانالد \\"سم\\" جمار فضانورد اهل کشور ایالات متحده آمریکا است که در ۴ اوت ۱۹۵۵ میلادی در ینکتون، داکوتای جنوبی زاده شد. وی در مأموریت اس‌تی‌اس-۳۸، اس‌تی‌اس-۴۸، اس‌تی‌اس-۶۲ حضور داشته است."},{"page_url":"https://de.wikipedia.org/wiki/Penig","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2b/20180406450DR_Penig_M%C3%BChlgraben_18_Altes_Schlo%C3%9F.jpg","page_title":"Penig","context_page_description":"Penig ist eine Stadt im Westen des Landkreises Mittelsachsen in Sachsen."},{"page_url":"https://pnb.wikipedia.org/wiki/%D9%BE%D9%86%D8%AC%D8%A7%D8%A8_%D8%AF%DB%8C_%D8%AA%D8%B1%DB%8C%D8%AE","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/10/Le_Brun%2C_Alexander_and_Porus.jpg","page_title":"پنجاب دی تریخ","context_page_description":"پنجاب دی دھرتی جگ دے مُڈھلے وسیباں وچوں ہے۔جِنا وسیب پُرانا ہوندا ہے اونا ای اوس دی بولی۔ایتھوں دی لوکائی قبل ازتاریخ توں ای اُچ پدھر دا جیون جیوندی پئی ہے ۔\\nپنجاب دی تریخ تے تہذیب دی اک لمی کہانی اے جیہدے وچ اوہدا ادبی تے ثقافتی ورثہ اک وکھری شناخت تے پچھان رکھدا اے جنہوں پوری دنیا دیاں پرانیاں تہذیباں دے ساہویں اُچے سر تے پورے قد نال کھڑا کیتا جاسکدا اے۔ایس پنجابی ورثے دیاں جے کئی شکلاں تے پرتاں نیں جیہڑیاں ویلے تے حالات دے ٹورے نال دریاواں دیاں لہراں وانگوں اگے ودھدیاں رہیاں نیں ۔\\nپنجاب برصغیر وچ اگونہا اشارہ رہیا اے۔ ایہہ گل پتھر دے زمانے توں لے کے ہن تیکر صحیح اے۔ سندھ وادی دی رہتل دا مرکز پنجاب تے سندھ سی۔ پتھر دے زمانے وچ ایہہ تھاواں پہلاں ایس لئی آباد ہویاں جو ایتھے جنگل بیلے سنگھنے نہیں سن، سگوں ایہہ ورلے رکھاں تے جھاڑیاں والے سن تے اہناں نوں ہتھاں تے پتھراں نال صاف کیتا جا سکدا سی۔ باقی ہندوستان وچ سنگھنے جنگل سن تے لوہے دی ایجاد توں پہلاں اہناں جنگلاں نوں صاف کرکے رہن دے قابل بناونا ممکن نہیں سی۔ایس علاقے وچ واہی بیجی دے وی اگوناے ثبوت ملدے ہین۔ ایس علاقے دی زمین پولی تے زرخیز سی ایس لئی ایتھے لکڑی دے ہل نال وی زمین واہی جا سکدی سی۔ پھیر جدوں سندھ وادی دے اخیرلے وارے وچ لوہے دی ایجاد ہوئی تے اوہ وی ایس علاقے وچ ہوئی۔: سنسکرت وچ ہل دے پھالے لئی پھالے دا ہی لفظ اے۔"},{"page_url":"https://fr.wikipedia.org/wiki/Hollywood/Western_(m%C3%A9tro_de_Los_Angeles)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/46/Los_Angeles_Metro%2C_Hollywood-Western%2C_Platform_%28HSY-approved%29.jpg","page_title":"Hollywood/Western (métro de Los Angeles)","context_page_description":"Hollywood/Western est une station du métro de Los Angeles desservie par les rames de la ligne B et située à East Hollywood, quartier de Los Angeles, en Californie."},{"page_url":"https://io.wikipedia.org/wiki/Marihuano","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8f/Marijuana_Buds.jpg","page_title":"Marihuano","context_page_description":"Marihuano, apude hashisho, esas la maxim ordinara kanaba produkturo. Ol preparesas ek la parti di kanabo. Marihuano esas ek la sikigita folii ed infloresenco di kanabo, qui esas triturita a vejentala granetaro. Marihuano konsumesas generale fumante en pipo o kom sigareto. La efikiganta substanco di la kanaba produkturi esas tetrahidrokanabinolo, per abreviuro THC, qua esas registragita kom narkotajo."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9C%D0%B8%D1%85%D0%B0%D0%B9%D0%BB%D0%BE%D0%B2%D1%81%D0%BA%D0%BE%D0%B5_%D0%B0%D1%80%D1%82%D0%B8%D0%BB%D0%BB%D0%B5%D1%80%D0%B8%D0%B9%D1%81%D0%BA%D0%BE%D0%B5_%D1%83%D1%87%D0%B8%D0%BB%D0%B8%D1%89%D0%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/49/%D0%9C%D0%90%D0%A3_1.jpg","page_title":"Михайловское артиллерийское училище","context_page_description":"Миха́йловское артиллери́йское учи́лище — военно-учебное заведение Российской империи, открытое в Санкт-Петербурге 25 ноября 1820 года по инициативе генерал-фельдцейхмейстера великого князя Михаила Павловича для подготовки офицеров артиллерии. Позже стало подготовительным заведением для Михайловской артиллерийской академии.\\nИзначально училище было рассчитано на 120 штатных и 28 сверхштатных учащихся и предусматривало 5-летний курс обучения. После кончины его основателя, училище получило название Михайловского. Первый официальный выпуск юнкерских классов, состоялся в феврале 1823 года, офицерских классов — в 1825 году.\\nБыло формально расформировано 6 ноября 1917 года, фактически — реорганизовано в 1-е Советские артиллерийские Петроградские командные курсы.\\nВсего за своё более чем 90-летнее существование, училище выпустило свыше 5 тыс. артиллерийских офицеров.\\nПраздник — 8 декабря. Училищная церковь в честь св. Александра Невского освящена в 1825 году.\\nКрупные проекты по теме статьи\\n«Клуб выпускников Коломенского артиллерийского училища»\\n«Российская Императорская армия в Санкт-Петербурге»\\n«Русская Императорская армия»\\n«Офицеры Русской Императорской армии»"},{"page_url":"https://sk.wikipedia.org/wiki/%C4%8Cajovn%C3%ADk_%C4%8D%C3%ADnsky","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e3/Camellia_sinensis_-_K%C3%B6hler%E2%80%93s_Medizinal-Pflanzen-025.jpg","page_title":"Čajovník čínsky","context_page_description":"Čajovník čínsky je vždyzelený ker z rodu čajovník a čeľade čajovníkovité. Jeho listy a púčiky poskytujú čaj, ktorý obsahuje 2,5 % kofeínu. Pochádza z juhovýchodnej Ázie a dnes sa pestuje v trópoch, subtrópoch a v teplých krajinách mierneho pásma celého sveta.\\nBiely čaj, žltý čaj, zelený čaj, oolong, pu-erh a čierny čaj sa vyrábajú z tohto druhu ale sú spracovávané rôzne aby sa dosiahla rôzna úroveň oxidácie.\\nExistujú dva hlavné poddruhy používané pre čaj: čínsky čaj, Camellia sinensis var. sinensis, a indický čaj, Camellia sinensis var. assamica."},{"page_url":"https://vi.wikipedia.org/wiki/%C4%90%C3%A0n_t%E1%BB%B3_b%C3%A0","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6e/%E8%9E%BA%E9%88%BF%E7%9B%B4%E9%A0%B8%E7%90%B5%E7%90%B6.jpg","page_title":"Đàn tỳ bà","context_page_description":"Đàn tỳ bà là tên gọi một nhạc cụ dây gẩy của người phương Đông, qua thời gian dài sử dụng nó đã được bản địa hóa khác nhau tuỳ theo từng vùng hoặc từng quốc gia."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%91%E3%82%BF%E3%82%B4%E3%83%8B%E3%82%A2","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9f/Base_del_Cerro_Catedral_en_Bariloche._%28Patagonia_Argentina%29_01.JPG","page_title":"パタゴニア","context_page_description":"パタゴニアは、南アメリカ大陸の南緯40度付近を流れるコロラド川以南の地域の総称。アルゼンチンとチリの両国にまたがる。アルゼンチンのネウケン、リオネグロ、チュブ、サンタクルス、ティエラ・デル・フエゴ各州とチリのアイセン、マガジャーネス・イ・デ・ラ・アンタルティカ・チレーナ各州が該当する。ブルース・チャトウィンがこの地を旅した体験に基づいてかかれた小説「パタゴニア」も紀行文の名作として知られている。"},{"page_url":"https://en.wikipedia.org/wiki/Choke_ring_antenna","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/DGPS_Reference_Station.jpg","page_title":"Choke ring antenna","context_page_description":"A choke ring antenna is a particular form of omnidirectional antenna for use at high frequencies. It consists of a number of conductive concentric cylinders around a central antenna. Due to its delicate construction, it is often enclosed in a protective cover or radome when placed outside and exposed to the elements.\\nChoke ring antennas are notable for their ability to reject multipath signals from a source. Since the path that a signal takes from a transmitter to receiver can be used to measure the distance between the two, this makes it highly suited for GPS and radar applications. In a GPS ground-based receiver, a choke ring antenna can provide millimeter precision measurements for surveying and geological measurement applications.\\nThe choke ring design originated at the Jet Propulsion Laboratory."},{"page_url":"https://de.wikipedia.org/wiki/Samtgemeinde_Hesel","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9d/Liudgerikirche_Hesel.jpg","page_title":"Samtgemeinde Hesel","context_page_description":"Die Samtgemeinde Hesel ist ein Gemeindeverband an der Nordgrenze des Landkreises Leer in der niedersächsischen Region Ostfriesland. Sie ist neben der Samtgemeinde Jümme eine der beiden Samtgemeinden des Landkreises und von sechs in Ostfriesland. Zur Samtgemeinde gehören neben der Gemeinde Hesel, deren Ortsteil Hesel der Sitz der Samtgemeinde ist, die Mitgliedsgemeinden Brinkum, Firrel, Holtland, Neukamperfehn und Schwerinsdorf mit weiteren Nebenorten und Wohnplätzen. Auf einer Fläche von 84,31 km² leben zirka 10.300 Einwohner, womit sie nur dünn besiedelt ist. In der Raumordnung des Landes Niedersachsen wird der Ort Hesel als Grundzentrum für die Samtgemeinde geführt.\\nDas Gebiet liegt zentral innerhalb des oldenburgisch-ostfriesischen Geestrückens. Bereits in ur- und frühgeschichtlicher Zeit war Hesel Knotenpunkt eines Wegenetzes. Diese Funktion hat es auch heute noch im Straßennetz Ostfrieslands. Auf dem Gebiet der Samtgemeinde befinden sich viele älteste Spuren menschlicher Besiedlung von Ostfriesland. Durch die Lage begünstigt, war der Hauptort Hesel im Hoch- und Spätmittelalter Standort zweier Klöster und mehrerer Klostervorwerke."},{"page_url":"https://en.wikipedia.org/wiki/Ross_Wilson_(musician)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/23/Ross_Wilson%2C_October_2018.jpg","page_title":"Ross Wilson (musician)","context_page_description":"Ross Andrew Wilson is an Australian singer-songwriter, musician and producer. He is the co-founder and frontman of the long-standing rock groups Daddy Cool and Mondo Rock, as well as a number of other former bands, in addition to performing solo. He has produced records for bands such as Skyhooks and Jo Jo Zep & the Falcons, as well as for those of his own bands. He appeared as a judge on celebrity singing TV series It Takes Two from 2005. Wilson was individually inducted into the Australian Recording Industry Association Hall of Fame in 1989 and again as a member of Daddy Cool in 2006."},{"page_url":"https://en.wikipedia.org/wiki/Boston","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b4/Mfa_boston_af.jpg","page_title":"Boston","context_page_description":"Boston is the capital and most populous city of the Commonwealth of Massachusetts in the United States, and the 21st most populous city in the United States. The city proper covers 49 square miles with an estimated population of 692,600 in 2019, also making it the most populous city in New England, and is the seat of Suffolk County. The city is the economic and cultural anchor of a substantially larger metropolitan area known as Greater Boston, a metropolitan statistical area home to a census-estimated 4.8 million people in 2016 and ranking as the tenth-largest such area in the country. As a combined statistical area, this wider commuting region is home to some 8.2 million people, making it the sixth most populous in the United States.\\nBoston is one of the oldest municipalities in the United States, founded on the Shawmut Peninsula in 1630 by Puritan settlers from the English town of the same name. It was the scene of several key events of the American Revolution, such as the Boston Massacre, the Boston Tea Party, the Battle of Bunker Hill, and the Siege of Boston."},{"page_url":"https://de.wikipedia.org/wiki/K%C3%B6lner_Seilbahn","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e9/Rheinseilbahn-K%C3%B6n-Station-Riehl-002.JPG","page_title":"Kölner Seilbahn","context_page_description":"Die Kölner Seilbahn ist eine den Rhein überquerende, 935 Meter lange Seilbahn in Köln. Sie wurde zur Bundesgartenschau 1957 errichtet und verbindet in Höhe der Zoobrücke die beiden Ufer des Flusses in Riehl und Deutz. Betreiber ist die Kölner Seilbahn-Gesellschaft mbH, seit 1998 eine Tochter der Kölner Verkehrs-Betriebe. Die Seilbahn hat bisher über 20 Millionen Fahrgäste befördert. Neben der überwiegend touristisch genutzten Seilbahn wird der Bau eines 33 Kilometer langen Seilbahn-Systems als Ergänzung des Nahverkehrs in Köln diskutiert."},{"page_url":"https://nl.wikipedia.org/wiki/Sigmundur_Dav%C3%AD%C3%B0_Gunnlaugsson","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/03/Sigmundur_Dav%C3%AD%C3%B0_Gunnlaugsson_%28cropped%29.jpg","page_title":"Sigmundur Davíð Gunnlaugsson","context_page_description":"Sigmundur Davíð Gunnlaugsson is een IJslandse politicus. In 2009 werd hij voorzitter van zijn Progressieve Partij en in 2013 premier van IJsland. Nadat zijn naam viel in de Panama Papers nam hij ontslag uit beide functies."},{"page_url":"https://hy.wikipedia.org/wiki/%D4%B1%D5%AC%D5%A5%D6%84%D5%BD%D5%A1%D5%B6%D5%A4%D6%80_(%D5%80%D5%B8%D6%82%D5%B6%D5%A1%D5%BD%D5%BF%D5%A1%D5%B6%D5%AB_%D5%A9%D5%A1%D5%A3%D5%A1%D5%BE%D5%B8%D6%80)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/23/Greek_history_from_1832.GIF","page_title":"Ալեքսանդր (Հունաստանի թագավոր)","context_page_description":"Ալեքսանդր, եղել է Հունաստանի արքա 1917 թվականի հունիսի 11-ից մինչև նրա մահը երեք տարի անց՝ 27 տարեկան հասակում, կապիկների խայթոցի հետևանքով:\\nԿոնստանտինոս I թագավորի երկրորդ որդի Ալեքսանդրը ծնվել է Աթենքի ծայրամասում գտնվող Տատոյ ամառային պալատում: Նա հաջորդեց իր հորը 1917 թվականին՝ Առաջին աշխարհամարտի տարիներին, այն բանից հետո, երբ Անտանտի տերությունները և Էլեֆթերիոս Վենիզելոսի համակիրը պահանջեցին Կոնստանտինոս I-ի հրաժարականը, իսկ ավագ որդուն՝ թագաժառանգ Գեորգիոսին աքսորեցին: Իրական քաղաքական փորձ չունենալով՝ նոր թագավորը զրկվեց իր լիազորություններից վենիզելիստների կողմից և բանտարկվեց սեփական պալատում: Վենիզելոսը՝ որպես վարչապետ, արդյունավետ կառավարիչ էր Անտանտի աջակցությամբ: Թեև իջեցվեց խամաճիկային թագավորի կարգավիճակի, Ալեքսանդրը աջակցեց հունական զորքերին Օսմանյան կայսրության և Բուլղարիայի դեմ իրենց պատերազմի ժամանակ: Նրա օրոք Հունաստանի տարածքը զգալիորեն աճեց Առաջին աշխարհամարտում Անտանտայի և նրանց դաշնակիցների հաղթանակից և Հույն-թուրքական պատերազմի վաղ փուլերից հետո:"},{"page_url":"https://an.wikipedia.org/wiki/Teruel","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c8/Grabado_de_Teruel_en_el_siglo_XVIII.jpg","page_title":"Teruel","context_page_description":"Teruel ye una ciudat d'Aragón, situata en a zona centro-oriental d'a peninsula Iberica, capital d'a provincia d'o mesmo nombre y d'a comarca d'a Comunidat de Teruel. Con una población de 35.675 habitants, ye a capital de provincia menos poblata d'Espanya. Se troba en o forcallo d'os ríos Guadalaviar y Alfambra. O suyo clima se caracteriza por hibiernos fredos y veranos calidos y xutos.\\nA ciudat de Teruel tien una luenga historia, que prencipia con as primeras poblacions estables en a zona mientres a Edat de Bronze, con presencia luego d'os pueblos celtibers y de l'Antiga Roma, dica plegar a lo establimiento d'a ciudat en a Edat Meya por o rei Alifonso II d'Aragón, quan l'adhibió a lo reino d'Aragón. Estió una ciudat ubierta, con muita influencia d'os ganaders que feban a transuancia enta o reino de Valencia, encara que continó estando una ciudat de tamanyo chicot, dica esdevenir en 1833 capital d'a nueva provincia de Teruel, en establir-se en Espanya a nueva división territorial en provincias. En a Guerra Civil Espanyola a ciudat estió o scenario d'a batalla de Teruel, una d'as más importants batallas d'a guerra en territorio aragonés."},{"page_url":"https://sv.wikipedia.org/wiki/Psorothamnus_polydenius","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/80/Psorothamnus_polydenius_4.jpg","page_title":"Psorothamnus polydenius","context_page_description":"Psorothamnus polydenius är en ärtväxtart som först beskrevs av Sereno Watson, och fick sitt nu gällande namn av Per Axel Rydberg. Psorothamnus polydenius ingår i släktet Psorothamnus och familjen ärtväxter."},{"page_url":"https://vi.wikipedia.org/wiki/Pieris_brassicae_wollastoni","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7f/Pieris_wollastoni-PD.png","page_title":"Pieris brassicae wollastoni","context_page_description":"Madeiran Large White là một loài bướm trắng lớn đặc hữu của Madeira. Nó có thể đạt đến kích thước từ 55 đến 65 mm. Cánh có màu trắng tinh với các đối đen rộng trên lưng. Môi trường sống tự nhiên của chúng là rừng nguyệt quế."},{"page_url":"https://ceb.wikipedia.org/wiki/Hamlin_Beach_State_Park","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/57/Hamlin_Beach_State_Park_beach.jpg","page_title":"Hamlin Beach State Park","context_page_description":"Parke ang Hamlin Beach State Park sa Tinipong Bansa. Ang Hamlin Beach State Park nahimutang sa kondado sa Monroe County ug estado sa New York, sa sidlakang bahin sa nasod, 500 km sa amihanan sa ulohang dakbayan Washington, D.C. 80 metros ibabaw sa dagat kahaboga ang nahimutangan sa Hamlin Beach State Park.\\nAng yuta palibot sa Hamlin Beach State Park kay patag. Ang kinahabogang dapit sa palibot dunay gihabogon nga 104 ka metro ug 1.9 km sa kasadpan sa Hamlin Beach State Park. Ang kinadul-ang mas dakong lungsod mao ang Hamlin, 7.1 km sa habagatan sa Hamlin Beach State Park.\\nAng klima hemiboreal. Ang kasarangang giiniton 7 °C. Ang kinainitan nga bulan Hulyo, sa 20 °C, ug ang kinabugnawan Pebrero, sa -12 °C. Ang kasarangang pag-ulan 1,028 milimetro matag tuig. Ang kinabasaan nga bulan Hunyo, sa 121 milimetro nga ulan, ug ang kinaugahan Marso, sa 47 milimetro."},{"page_url":"https://en.wikipedia.org/wiki/Brown_coal_mining_limits_in_North_Bohemia","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7e/Jezeri_from_inside_CSA.JPG","page_title":"Brown coal mining limits in North Bohemia","context_page_description":"Territorial limits to the mining of brown coal in North Bohemia are legally binding according to Resolution No. 444 passed in 1991 by the government of the Czech Republic, on the basis of a proposal tabled by the then Minister for the Environment, Ivan Dejmal. The limits define the areas that can be mined, as well as areas where coal reserves have been written off. There is now the prospect, however, that the limits will be breached and sanction given to increase coal mining further, which would involve the demolition of more communities within the currently demarcated limits, e.g. Horní Jiřetín and Černice.\\nThe limits concern these mining localities: Czechoslovak Army Mine, Jan Šverma Mine, Vršany Mine, Bílina Mine and Nástup - Tušimice Mine."},{"page_url":"https://pt.wikipedia.org/wiki/Frederick_Rolfe","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/65/Fr._Rolfe_III.JPG","page_title":"Frederick Rolfe","context_page_description":"Frederick William Rolfe, mais conhecido como Barão Corvo, mas que também se designava a si mesmo por \\"Frederick William Serafino Austin Lewis Maria Rolfe\\", foi um escritor, artista, fotógrafo inglês."},{"page_url":"https://he.wikipedia.org/wiki/%D7%A7%D7%A4%D7%95%D7%A6%27%D7%99%D7%9F_%D7%A9%D7%97%D7%95%D7%A8-%D7%A4%D7%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1a/Capuchin_monkey_by_e3000.jpg","page_title":"קפוצ'ין שחור-פס","context_page_description":"קפוצין שחור-פס, הוא מין קוף מסוג קפוצ'ין כהה שחי בערבות הסראדו בברזיל, אמריקה הדרומית. בעבר הוא נחשב לתת-מין של קפוצ'ין מצויץ או של קפוצין אזרה.\\nהקפוצינים בעלי פרווה זהובה עם כפות, זנב וציצת ראש שחורים-חומים עם עור ורוד. הם בעלי ידיים חזקות והם יודעים להשתמש בכלים. אורך הקפוצין 34-44 ס\\"מ.\\nהמזון המועדף עליהם הוא פרי של דקל ברזילאי אותו הם מכינים בצורה מיוחדת: הם בודקים ליד העץ אילו אגוזים בשלים, כורתים אותם מהעץ, חושפים בשיניהם את הקליפה ומחכים שבוע. כעבור שבוע האגוז נהיה רך יותר והם לוקחים אותו לאזור זרוע באבני גיר. מעל אבנים אלה הם מניפים אבנים חזקות יותר שמגיעות ממקום גבוה יותר ביער. הם מטיחים אותה נגד האגוז עד שהוא מתפצח. אך צריכים שנים רבות של למידה עד להתקדמות. זה למעשה מבין הפרימטים הבודדים חוץ מהשימפנזה המשתמשים דרך קבע בכלים.\\nהקפוצינים חיים ביער ושם מוצאים מסתור מעופות דורסים היכולים להפתיע אותם בשטח הפתוח. הם מגיעים לאזור זה רק לבקר את עצי הדקל."},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/Arsac","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e8/%C3%89glise_d%27Arsac_-_4.jpg","page_title":"Arsac","context_page_description":"Arsac sī ūi-tī Hoat-kok Aquitaine tōa-khu Gironde séng ê chi̍t ê commune."},{"page_url":"https://ca.wikipedia.org/wiki/Parcs_i_jardins_de_Barcelona","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/12/Parc_de_les_Gl%C3%B2ries1.jpg","page_title":"Parcs i jardins de Barcelona","context_page_description":"El conjunt de parcs i jardins de Barcelona té una extensió de 2.784 hectàrees. La seva gestió depèn de l'Institut Municipal de Parcs i Jardins de Barcelona, un organisme depenent de l'Ajuntament de Barcelona. Des del segle XIX —i especialment al XX— Barcelona ha apostat per l'adequació de zones verdes a la ciutat, i actualment és una de les ciutats europees amb més arbrat viari. L'any 2001 l'Institut de Parcs i Jardins va rebre la certificació ISO 14001 en la conservació i la gestió dels espais verds i de l'arbrat viari públic.\\nLa jardineria a Barcelona ha tingut una evolució dispar en el temps: la primera realització de certa rellevància, el Parc del Laberint d'Horta, és ja del segle XVIII; al segle XIX s'obrí el primer gran parc públic de Barcelona, el de la Ciutadella; però la major part de zones verdes de la ciutat comtal són del segle xx, època en què s'ha donat un gran impuls a la jardineria pública a la capital catalana."},{"page_url":"https://sv.wikipedia.org/wiki/Abutilon_grandifolium","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3f/Gul_blomst_nr_6.jpg","page_title":"Abutilon grandifolium","context_page_description":"Abutilon grandifolium är en malvaväxtart som först beskrevs av Carl Ludwig von Willdenow, och fick sitt nu gällande namn av Robert Sweet. Abutilon grandifolium ingår i släktet klockmalvor, och familjen malvaväxter. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://pa.wikipedia.org/wiki/%E0%A8%AE%E0%A8%BE%E0%A8%A4%E0%A8%BE%E0%A8%82%E0%A8%97%E0%A8%BF%E0%A8%A8%E0%A9%80_%E0%A8%B9%E0%A8%BE%E0%A8%9C%E0%A8%BC%E0%A8%B0%E0%A8%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b6/Matangini_Hazra.jpg","page_title":"ਮਾਤਾਂਗਿਨੀ ਹਾਜ਼ਰਾ","context_page_description":"ਮਾਤੰਗਿਨੀ ਹਾਜ਼ਰਾ ਇੱਕ ਭਾਰਤੀ ਇਨਕਲਾਬੀ ਸੀ ਜਿਸਨੇ ਭਾਰਤੀ ਆਜ਼ਾਦੀ ਦੀ ਲਹਿਰ ਵਿੱਚ ਹਿੱਸਾ ਲਿਆ, ਜਦੋਂ ਤੱਕ ਉਸਨੂੰ 29 ਸਤੰਬਰ, 1942 ਨੂੰ ਤਮਿਲੁਕ ਪੁਲਿਸ ਥਾਣੇ ਦੇ ਸਾਹਮਣੇ ਦੇ ਸਾਹਮਣੇ ਬਰਤਾਨਵੀ ਭਾਰਤੀ ਪੁਲਿਸ ਵਲੋਂ ਗੋਲੀ ਮਾਰ ਦਿੱਤੀ ਗਈ।ਉਸਨੂੰ ਪਿਆਰ ਨਾਲ ਗਾਂਧੀ ਬੁਰੀ ਵਜੋਂ ਜਾਣੀ ਜਾਂਦੀ ਸੀ, ਬੰਗਾਲੀਆਂ ਲਈ ਉਹ ਓਲਡ ਲੇਡੀ ਗਾਂਧੀ ਹੈ।"},{"page_url":"https://fr.wikipedia.org/wiki/Glires_(classification_phylog%C3%A9n%C3%A9tique)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/26/Marmota_marmota_Alpes2.jpg","page_title":"Glires (classification phylogénétique)","context_page_description":"Cette page a pour objet de présenter un arbre phylogénétique des Glires, c'est-à-dire un cladogramme mettant en lumière les relations de parenté existant entre leurs différents groupes, telles que les dernières analyses reconnues les proposent. Ce n'est qu'une possibilité, et les principaux débats qui subsistent au sein de la communauté scientifique sont brièvement présentés ci-dessous, avant la bibliographie."},{"page_url":"https://sk.wikipedia.org/wiki/Zoznam_dopravn%C3%BDch_zna%C4%8Diek_v_Rak%C3%BAsku","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bb/Stopp_in_100m.png","page_title":"Zoznam dopravných značiek v Rakúsku","context_page_description":"Toto je zoznam dopravných značiek v Rakúsku. Na značení sa používa normový font Tern, ktorý v roku 2010 nahradil font Austria."},{"page_url":"https://nn.wikipedia.org/wiki/Kent_Downs","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/82/DownsRanscombeFieldToMway0734c.JPG","page_title":"Kent Downs","context_page_description":"Kent Downs er ein Area of Outstanding Natural Beauty i Kent i England.\\nOmrådet består av den austlege halvdelen av North Downs, og grensar mot ein annan AONB, Surrey Hills. Det strekkjer seg frå grensa mot Stor-London og Surrey til dei kvite klippene ved Dover, og består for det meste av kalksteinsryggar."},{"page_url":"https://de.wikipedia.org/wiki/Sextner_Rotwand","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/77/2010_Sextener_Dolomiten_054.jpg","page_title":"Sextner Rotwand","context_page_description":"Die Sextner Rotwand ist ein Berg mit einer Höhe von 2965 m s.l.m. als östlicher Eckpfeiler der Sextner Dolomiten südlich von Sexten. Sie wird auch Zehner genannt, nach ihrer Position im Kranz der Gipfel der Sextner Sonnenuhr."},{"page_url":"https://de.wikipedia.org/wiki/Eugen_Dietschi","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c5/Eugen_Dietschi_Staatsarchiv_Bern_FN_Jost_P_12047.jpg","page_title":"Eugen Dietschi","context_page_description":"Eugen Dietschi war ein Schweizer Journalist und Politiker."},{"page_url":"https://it.wikipedia.org/wiki/Gens_Apronia","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7e/Antiquarium_%28Albintimilium%29_12.jpg","page_title":"Gens Apronia","context_page_description":"La gens Apronia era una gens plebea romana presente durante la Repubblica e il primo secolo dell'Impero."},{"page_url":"https://es.wikipedia.org/wiki/Fiat_Croma","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/97/CROMAarr.JPG","page_title":"Fiat Croma","context_page_description":"Fiat Croma fue el nombre utilizado para dos tipos del Segmento D distintos producidos por la marca italiana Fiat, un liftback cinco puertas fabricado entre 1985 y 1996 y un familiar entre 2005 y 2010."},{"page_url":"https://hu.wikipedia.org/wiki/Plouider","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/92/Population_-_Municipality_code_29198.svg","page_title":"Plouider","context_page_description":"Plouider település Franciaországban, Finistère megyében. Plouider Plounéour-Trez, Saint-Méen, Goulven, Guissény, Kerlouan, Kernouës, Lanhouarneau, Lesneven, Plounévez-Lochrist, Saint-Frégant és Tréflez községekkel határos."},{"page_url":"https://sv.wikipedia.org/wiki/Vinproduktion","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/24/Old_and_young_riesling_vines.jpg","page_title":"Vinproduktion","context_page_description":"Vinproduktion beskriver hur processen med framställning av vin från vindruvor sker. Produktionen kan generellt delas upp i två olika delar. Vinodling kallas odlingen av vin och det arbete som sker i vingården, samt själva skördandet. Det arbete som sker efter skörden som förädlar vindruvorna till färdigt vin kallas vinframställning.\\nI många fall är det samma företag, tillverkare eller vinbonde som både odlar druvorna och framställer vin av dem. Det förekommer dock att vinbönder enbart är vinodlare, vilket innebär att de säljer sina vindruvor till någon annan som sedan gör vin av dem. Köparen kan vara en annan vinodlare som kompletterar sin egen skörd, eller ett vinföretag som inte själv äger några vingårdar utan köper in alla druvor de gör vin av. I de fall vinbonden säljer sina druvor förekommer både långtidskontrakt och nära samarbete med köparen, och försäljning på respektive skördeårs \\"spotmarknad\\". Som ett mellanting mellan att göra vin själv och sälja sina druvor finns vinkooperativ, där ett antal vinodlare har gått samman kring vinframställningen och försäljningen, och oftast anställt utbildade önologer och marknadsförare för dessa uppgifter."},{"page_url":"https://eo.wikipedia.org/wiki/K%C3%A1roly_Mark%C3%B3_(pli_juna)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7d/Karol_Marko_ml._-_Landscape_with_a_River_and_Group_of_Trees_-_O_5118_-_Slovak_National_Gallery.jpg","page_title":"Károly Markó (pli juna)","context_page_description":"Károly Markó [kAroj], laŭ hungarlingve kutima sinsekvo Ifj. Markó Károly, en Italio Carlo Marco estis hungara pentristo. Lia surskribo sur pentraĵoj estis Carlo, lia patro estis Károly Markó, lia frato estis Ferenc Markó.\\nKároly Markó naskiĝis la 22-an de januaro 1822 en Pest, li mortis en 1891 en Moskvo."},{"page_url":"https://it.wikipedia.org/wiki/Vila_(architettura)","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/26/Tavella.jpg","page_title":"Vila (architettura)","context_page_description":"La vila è un insediamento rurale montano costituito da alcune case e fabbricati privati, con i servizi rustici essenziali in comune tipico della regione ladina nelle aree un tempo appartenenti alla Contea del Tirolo, in particolare in Val Badia dove ne esistono più di 120."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9F%D1%96%D0%B2%D0%BC%D1%96%D1%81%D1%8F%D1%86%D0%B5%D0%B2%D0%B0_%D0%BA%D1%96%D1%81%D1%82%D0%BA%D0%B0","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b2/Ospoignet_-_Lunate_bone.png","page_title":"Півмісяцева кістка","context_page_description":"Півмісяце́ва кістка — одна з кісток зап'ястка. Має глибоку увігнутість та характерну форму півмісяця. Розташована в центрі проксимального ряду зап'ясткових кісток, між латеральною човноподібною і медіальною тригранною кістками. Гомологічна інтермедіуму плазунів і земноводних."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9E%D0%B1%D1%80%D0%B0%D0%B7%D0%BE%D1%82%D0%B2%D0%BE%D1%80%D1%87%D0%B5_%D0%BC%D0%B8%D1%81%D1%82%D0%B5%D1%86%D1%82%D0%B2%D0%BE_%D0%90%D0%BD%D0%B3%D0%BB%D1%96%D1%97","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5e/Thomas_Lawrence%2C_Charles_William_%28Vane-%29Stewart%2C_Later_3rd_Marquess_of_Londonderry%2C_1812%2C_oil_on_canvas%2C_National_Portrait_Gallery%2C_London.jpg","page_title":"Образотворче мистецтво Англії","context_page_description":"Образотворче мистецтво Англії — період розвитку образотворчого мистецтва в королівстві Англія за декілька століть."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%85%D8%B1%D9%83%D8%A8_%D8%A5%D9%83%D8%B3%D9%88%D8%B3%D9%88%D9%85","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2d/Exosome_active_subunits_simple.png","page_title":"مركب إكسوسوم","context_page_description":"مركب إكسوسوم هو مركب متعدد البروتين داخل خلايا معقدة قادر على إتلاف أنواع مختلفة من جزيئات RNA. وقد عُثِرَ على مركب الإكسوسوم في كل من الخلايا حقيقيات النوى والعَتائِق، في حين أن في البكتيريا مركب أبسط يسمى ديغرادوسوم ينفذ وظائف مماثلة.\\nتحتوي نواة الإكسوسوم على بنية حلقية سداسية الأضلاع ترتبط بها بروتينات أخرى. فَفي الخلايا حقيقيات النوى، يوجد مركب الإكسوسوم في سيتوبلازم، ونواة الخلية، وعلى وجه الخصوص في النويّات، على الرغم من أن البروتينات المختلفة تتفاعل مع مركب الإكسوسوم في هذه المقصورات التي تؤدي إلى إتلاف الحمض النووي الريبوزي وتنظم نشاط المركب للركيزات المخصصة لهذه المقصورات الخلوية. وتَشْمَلُ ركائز الإكسوسوم الرنا رسول، والرنا الريبوسومي، والعديد من أنواع الرنا الصغيرة.\\nالإكسوسوم لديه وظيفة إكستريبونوكليوليتيكية، وهذا يعني أنه يَحُطُّ من الحمض النووي الريبوزي بدءا من نهاية واحدة، وفي حقيقيات النوى أيضا وظيفته إندوريبونوكليوليتيكية، وهذا يعني أن الحمض النووي الريبوزي ينفصم في مَواقِع داخل الجُزَيْء.\\nالعديد من البروتينات في الإكسوسوم هي هدف الأجسام الذاتية المضادة عند المرضى الذين يعانون من أنواع محددة من أمراض المناعة الذاتية وبعض العلاج الكيميائي بمضاد المئيضة لمرض السرطان عن طريق منع نشاط الإكسوسوم."},{"page_url":"https://lt.wikipedia.org/wiki/Otto_Dix","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/83/Otto_Dix_on_April_12%2C_1957.jpg","page_title":"Otto Dix","context_page_description":"Otas Diksas – žymus vokiečių XX a. ekspresionizmo tapytojas ir grafikas. Naujojo objektyvizmo dailininkas."},{"page_url":"https://fr.wikipedia.org/wiki/Marcel_Violet","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d6/Violet-Bogey_1913.JPG","page_title":"Marcel Violet","context_page_description":"Achille Marcel Violet, né le 19 février 1887 dans le 17ᵉ arrondissement de Paris et mort le 17 juillet 1973 à Clichy, est un pilote automobile, ingénieur des Arts et Métiers et inventeur français, principalement actif dans le domaine de l'automobile. Il a aussi fondé un laboratoire actif dans le domaine des médecines alternatives à partir de ses découvertes sur les conséquences de l'utilisation d'eau biodynamisée, reprenant les travaux de Stanislas Bignand cinquante ans plus tôt. Cette eau est communément appelée aujourd'hui eau Violet.\\nDurant plus de 30 ans Marcel Violet a expérimenté son eau biodynamisée sur les végétaux, les animaux et les humains."},{"page_url":"https://en.wikipedia.org/wiki/Martock","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b0/Martock_Market_Hall.jpg","page_title":"Martock","context_page_description":"Martock is a large village and civil parish in Somerset, England, situated on the edge of the Somerset Levels 7 miles north west of Yeovil in the South Somerset district. The parish includes Hurst, approximately one mile south of the village, and Bower Hinton, which is located at the western end of the village and bounded by Hurst and the A303. Martock has a population of 4,766 and was historically a market town."},{"page_url":"https://he.wikipedia.org/wiki/%D7%94%D7%97%D7%99_%D7%91%D7%90%D7%95%D7%A1%D7%98%D7%A8%D7%9C%D7%99%D7%94","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/79/Phyllopteryx_taeniolatus1.jpg","page_title":"החי באוסטרליה","context_page_description":"הפאונה האוסטרלית או חברת בעלי החיים של אוסטרליה מורכבת ממגוון רחב של בעלי חיים יחידים במינם; כ-83% מהיונקים, 89% מהזוחלים, 90% מהדגים ומהחרקים ו-93% מהדו-חיים שחיים ביבשת הם אנדמיים לאוסטרליה. הרמה הגבוהה של אנדמיות באוסטרליה מיוחסת לבידודה הגאוגרפי הממושך של היבשת, ליציבות טקטונית ולהשפעות צורת השתנות האקלים המיוחדת על האדמה והפלורה לאורך הזמן הגאולוגי. מאפיין ייחודי של חברת בעלי החיים של אוסטרליה הוא החוסר היחסי ביונקי שליה טבעיים. כתוצאה מכך חיות כיס, קבוצה של בעלי חיים שמגדלים את גוריהם בכיס, שכוללת בין היתר קנגורים, פוסומים וטורפי כיס, מחזיקות בנישות אקולוגיות רבות שבמקומות אחרים בעולם מוחזקות על ידי יונקי שליה. באוסטרליה חיים שניים מתוך חמישה מינים קיימים של בעלי ביב ומיני בעלי חיים ארסיים רבים, ביניהם: ברווזנים, עכבישים, עקרבים, תמנונים, מדוזות, רכיכות, אבנונים וטריגוניים. באופן ייחודי, באוסטרליה חיים יותר מיני נחשים ארסיים מאשר לא ארסיים.\\nיישוב אוסטרליה על ידי האבוריג'ינים לפני למעלה מ-40 אלף שנה ועל ידי האירופאים החל מ-1788 השפיע בצורה משמעותית על הפאונה של אוסטרליה. ציד, הבאת מינים לא מקומיים ופעולות טיפול באדמה גרמו להרס של בתי הגידול הטבעיים והובילו להכחדותם של מספר מינים."},{"page_url":"https://ml.wikipedia.org/wiki/%E0%B4%B8%E0%B5%81%E0%B4%95%E0%B5%81%E0%B4%AE%E0%B4%BE%E0%B5%BC_%E0%B4%95%E0%B4%95%E0%B5%8D%E0%B4%95%E0%B4%BE%E0%B4%9F%E0%B5%8D","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/SukumarKakkad.jpg","page_title":"സുകുമാർ കക്കാട്","context_page_description":"മലയാളത്തിലെ പ്രമുഖ സാഹിത്യകാരനാണ് സുകുമാർ കക്കാട്."},{"page_url":"https://de.wikipedia.org/wiki/Jutta_Hecker","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dd/Max_Hecker_Historischer_Friedhof_Weimar_2_2020-06-05_12.jpg","page_title":"Jutta Hecker","context_page_description":"Jutta Hecker war eine deutsche Schriftstellerin."},{"page_url":"https://fr.wikipedia.org/wiki/Champ_(agriculture)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/92/20120721-NRCS-LSC-0044_-_Flickr_-_USDAgov.jpg","page_title":"Champ (agriculture)","context_page_description":"En agriculture, un champ est un espace de terre arable cultivé. Il est le plus souvent labouré. Dans l'usage courant, on précise souvent son usage, pour sa valeur ajouté cultivé: champ de betterave, de blé, de seigle, d'avoine, etc., bien que la nécessaire rotation des cultures puisse en changer temporairement la destinée. Une culture sans labour est également parfois possible pour certaines récoltes. Champ désigne donc une parcelle de terre à culture souvent unique, plus soignée, semée, labourée, irriguée, plus bornée, délimité, etc., alors que prés sous entend un fourrage où cohabitent des espèces apportées et endémiques naturelles, une terre rarement retournée, moins plane, moins riche, moins amendée et de moindre valeur.\\nPour une bonne délimitation sémantique, une opposition systémique est utile, en définissant d'autres désignations généraliste des terres agricoles : les prés constituent la principale variante, leur valeur ajoutée étant dénommée prairie."},{"page_url":"https://pl.wikipedia.org/wiki/24h_Le_Mans_1998","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/81/Porsche_911_GT1_Coupe_1998_frontleft_2009-03-14_A.JPG","page_title":"24h Le Mans 1998","context_page_description":"24h Le Mans 1998 – 24–godzinny wyścig rozegrany na torze Circuit de la Sarthe w dniach 6-7 czerwca 1998 roku."},{"page_url":"https://en.wikipedia.org/wiki/Okemos_High_School","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/Okemos_High_School.jpg","page_title":"Okemos High School","context_page_description":"Okemos High School is a public high school in Okemos, Michigan, United States. It is the only high school in the Okemos Public Schools district. It is located southeast of the main campus of Michigan State University, between Bennett and Jolly Roads on the North and South, and Hulett and Hagadorn Roads on the East and West. The current building was completed in 1994, replacing the now Chippewa Middle School building as the district's high school. Former students of Chippewa 7-8 School comprise the school's student body."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%91%D0%B0%D0%BD%D0%BA%D0%BD%D0%BE%D1%82%D1%8B_%D1%8F%D0%BF%D0%BE%D0%BD%D1%81%D0%BA%D0%BE%D0%B9_%D0%B8%D0%B5%D0%BD%D1%8B","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/96/SeriesB100Yen_Bank_of_Japan_note_-_back.jpg","page_title":"Банкноты японской иены","context_page_description":"Банкноты японской иены — банкноты японской иены, которые находились в обращении на территории Японии с 1872 года."},{"page_url":"https://hi.wikipedia.org/wiki/%E0%A4%AC%E0%A5%87%E0%A4%82%E0%A4%9F_%E0%A4%AA%E0%A4%BF%E0%A4%B0%E0%A4%BE%E0%A4%AE%E0%A4%BF%E0%A4%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/06/Entrance_of_Snofrus_Bent_Pyramid_in_Dahshur.JPG","page_title":"बेंट पिरामिड","context_page_description":"बेंट पिरामिड मिस्र का एक प्राचीन पिरामिड है, जो काहिरा से लगभग 40 किलोमीटर दक्षिण में, दाहशूर के शाही नेक्रोपोलिस पर स्थित है, जिसे पुराने साम्राज्य फ़राओ स्नेफेरू के तहत बनाया गया था। मिस्र में प्रारंभिक पिरामिड विकास का यह एक अनूठा उदाहरण हैं, स्नेफेरू द्वारा निर्मित यह दूसरा पिरामिड था।\\nबेंट पिरामिड 54-डिग्री के झुकाव पर रेगिस्तान से उठा हुआ है, लेकिन इसका शीर्ष खंड 43 डिग्री के उथले कोण पर बनाया गया है, जो पिरामिड को उसके बहुत स्पष्ट झुकाव स्वरूप को उभार देता है।"},{"page_url":"https://cs.wikipedia.org/wiki/Seznam_kulturn%C3%ADch_pam%C3%A1tek_v_Boskovic%C3%ADch","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/51/Boskovice_-_zidovske_ghetto13.JPG","page_title":"Seznam kulturních památek v Boskovicích","context_page_description":"Tento seznam nemovitých kulturních památek ve městě Boskovice v okrese Blansko vychází z Ústředního seznamu kulturních památek ČR, který na základě zákona č. 20/1987 Sb., o státní památkové péči, vede Národní památkový ústav jako ústřední organizace státní památkové péče. Údaje jsou průběžně upřesňovány, přesto mohou obsahovat i řadu věcných a formálních chyb a nepřesností či být neaktuální.\\nPokud byly některé části dotčeného území vyčleněny do samostatných seznamů, měly by být odkazy na tyto dílčí seznamy uvedeny v úvodu tohoto seznamu nebo v úvodu příslušné sekce seznamu."},{"page_url":"https://ne.wikipedia.org/wiki/%E0%A4%8F%E0%A4%B2%E0%A5%8D%E0%A4%B2%E0%A5%80_%E0%A4%B8%E0%A4%BF%E0%A4%A1%E0%A5%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b2/Ally_Sheedy.jpg","page_title":"एल्ली सिडी","context_page_description":"क्याथरिन लिट्विक एक बहुचर्चित अमेरिकन चलचित्र अभिनेत्री र लेखिका हुन्।"},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkmale_in_K%C3%B6nigsbr%C3%BCck","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/92/18716-K%C3%B6nigsbr%C3%BCck-1915-Garnisonslazarett_mit_Wasserturm-Br%C3%BCck_%26_Sohn_Kunstverlag.jpg","page_title":"Liste der Kulturdenkmale in Königsbrück","context_page_description":"In der Liste der Kulturdenkmale in Königsbrück sind die Kulturdenkmale der sächsischen Stadt Königsbrück verzeichnet, die bis Juli 2017 vom Landesamt für Denkmalpflege Sachsen erfasst wurden. Die Anmerkungen sind zu beachten.\\nDiese Liste ist eine Teilliste der Liste der Kulturdenkmale im Landkreis Bautzen"},{"page_url":"https://he.wikipedia.org/wiki/%D7%90%D7%9C%D7%99%D7%A9%D7%94_%D7%A7%D7%99%D7%96","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2e/AliciaKeys2013%2C2.jpg","page_title":"אלישה קיז","context_page_description":"אלישה אוג'לו קוק, המוכרת בשם הבמה שלה אלישה קיז היא זמרת נשמה ורית'ם אנד בלוז, פזמונאית, פסנתרנית ומפיקת תקליטים אמריקאית. בנוסף, קיז היא גם שחקנית, סופרת ופילנתרופית."},{"page_url":"https://sq.wikipedia.org/wiki/Oksford","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a1/1_view_from_carfax_tower_oxford_2012.jpg","page_title":"Oksford","context_page_description":"Oksfordi është një qytet në rajonin Juglindor të Anglisë dhe kryeqendra e qarkut të Oxfordshire. Me një popullsi prej 159,994 banorësh ai renditet si qyteti i 52-të më i madh në Mbretërinë e Bashkuar. Oksfordi ka një të bazë të gjerë ekonomike, ku spikasin industria e prodhimit të motorëve, arsimi i lartë, industria botuese dhe ajo e teknologjisë së informacionit.\\nQyteti është i njohur në mbarë botën si shtëpia e Universitetit të Oksfordit, universitetit më të vjetër në botën anglofone. Ndërtesat e Oksfordit janë shembuj të dalluar të stileve të ndryshme arkitekturore Angleze qysh nga periudha e vonë Saksone."},{"page_url":"https://vi.wikipedia.org/wiki/Columnea_rubricaulis","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/21/Columnea_rubricaulis_%2818362508866%29.jpg","page_title":"Columnea rubricaulis","context_page_description":"Columnea rubricaulis là một loài thực vật có hoa trong họ Tai voi. Loài này được Standl. mô tả khoa học đầu tiên năm 1938."},{"page_url":"https://cs.wikipedia.org/wiki/Seznam_l%C3%A9%C4%8Div%C3%BDch_rostlin,_S%E2%80%93%C5%A0","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8c/Asplenium_ruta_muraria_nf_cleaned.jpg","page_title":"Seznam léčivých rostlin, S–Š","context_page_description":"Toto je seznam léčivých rostlin, jejichž český název začíná písmeneny S a Š.\\nCELÝ SEZNAM A-B-C-Č-D+Ď-E+F+G-H-Ch+I+J-K-L-M-N+O-P-R+Ř-S+Š-T+U-V+W+Y-Z+Ž"},{"page_url":"https://nn.wikipedia.org/wiki/Beckenham_p%C3%A5_New_Zealand","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/68/FisherAveBeckenham01_gobeirne.jpg","page_title":"Beckenham på New Zealand","context_page_description":"Beckenham er ein indre forstad i Christchurch på New Zealand, og ligg tre kilometer sør for sentrum i byen. Heathcote-elva snor seg gjennom denne bydelen, som for det meste er bustadsområde. Denne delen av elva vert ofte lokalt kalla Beckenham Loop.\\nForstaden fekk namn av kaptein Stephen Fisher etter den engelske byen Beckenham. Fisher busette seg i området i 1871 etter å ha gått av frå tenesta i den britiske marinen etter Krimkrigen. Ei tid vart ein del av Beckenham kalla Fisherton, og Fisher sitt hus stod der Fisher Avenue no ligg.\\nBeckenham grensar til Sydenham i nord, Somerfield i vest, Cashmere og Huntsbury i sør, og St Martins i aust."},{"page_url":"https://en.wikipedia.org/wiki/Department_store","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b7/El_Corte_Ingl%C3%A9s_%286033309835%29.jpg","page_title":"Department store","context_page_description":"A department store is a retail establishment offering a wide range of consumer goods in different areas of the store, each area specializing in a product category. In modern major cities, the department store made a dramatic appearance in the middle of the 19th century, and permanently reshaped shopping habits, and the definition of service and luxury. Similar developments were under way in each of London, in Paris and in New York.\\nToday, departments often include the following: clothing, furniture, home appliances, toys, cosmetics, houseware, gardening, toiletries, sporting goods, do it yourself, paint, and hardware. Additionally, other lines of products such as food, books, jewelry, electronics, stationery, photographic equipment, baby products, and products for pets are sometimes included. Customers generally check out near the front of the store in discount department stores, while higher-end traditional department stores include sales counters within each department. Some stores are one of many within a larger retail chain, while others are independent retailers."},{"page_url":"https://id.wikipedia.org/wiki/Ricardo_Lagos","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f2/Ricardo_Lagos_despedida_%28cropped%29.jpg","page_title":"Ricardo Lagos","context_page_description":"Ricardo Froilán Lagos Escobar adalah pengacara, ekonom, dan politisi Sosialis, di mana ia pernah menjabat sebagai Presiden Chili pada 2000 - 2006. Ia memenangi pemilihan presiden 1999-2000 tahap kedua yang penuh gejolak dari kandidat UDI: Independent Democrat Union, Joaquín Lavín. Ia merupakan presiden ketiga dari aliran kiri-tengah Koalisi Partai untuk Demokrasi semenjak Chili meraih kemerdekaan pada 1990. Ia meletakkan jabatan kepresidenannya pada 11 Maret 2006 dengan pengganti yang Sosialis juga pimpinan Michelle Bachelet, dari sebuah koalisi yang sama dengannya."},{"page_url":"https://war.wikipedia.org/wiki/Paphiopedilum_argus","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/21/Haeckel_Orchidae.jpg","page_title":"Paphiopedilum argus","context_page_description":"An Paphiopedilum argus in uska species han Liliopsida nga syahan ginhulagway ni Heinrich Gustav Reichenbach, ngan ginhatag han pagkayana nga asya nga ngaran ni Stein. An Paphiopedilum argus in nahilalakip ha genus nga Paphiopedilum, ngan familia nga Orchidaceae. Waray hini subspecies nga nakalista."},{"page_url":"https://ja.wikipedia.org/wiki/%E4%B8%96%E7%95%8C%E9%81%BA%E7%94%A3%E5%A7%94%E5%93%A1%E4%BC%9A","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/Minist%C3%A9rio_da_Cultura_-_34%C2%B0_Sess%C3%A3o_do_Comit%C3%AA_do_Patrim%C3%B4nio_Mundial_%283%29.jpg","page_title":"世界遺産委員会","context_page_description":"世界遺産委員会は、世界遺産に関して話し合うための国際連合教育科学文化機関の委員会。世界遺産条約締約国のうち、世界遺産条約締約国総会で選出された21か国の委員国で構成されるが、選出に当たっては地域のバランスが配慮される。委員国の任期は6年だが、自発的に4年に短縮することが可能である。会議には諮問機関である国際自然保護連合 、国際記念物遺跡会議 、文化財の保存及び修復の研究のための国際センター の代表者や非政府組織なども参加する。 事務局は世界遺産センターが務めている。"},{"page_url":"https://cs.wikipedia.org/wiki/Kl%C3%AD%C4%8Dov%C3%A1n%C3%AD_f%C3%A1zov%C3%BDm_posuvem","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/be/QPSK_timing_diagram.png","page_title":"Klíčování fázovým posuvem","context_page_description":"Klíčování fázovým posuvem je metoda digitální modulace, která pro přenos informací používá změny fáze referenčního signálu. PSK se používá pro nižší rychlosti komunikace u Bluetooth, Wi-Fi a pro RFID.\\nDigitální modulace používají pro reprezentaci digitálních dat konečný počet signálů. U PSK se tyto signály liší různými posuvy fáze, z nichž každý reprezentuje určitou hodnotu jednoho nebo několika bitů. U většiny metod každá fáze kóduje stejný počet bitů. Každý bitový vzor tvoří tak zvaný symbol, který je reprezentován určitým fázovým posuvem. Demodulátor, který je navržen pro konkrétní sadu symbolů, určuje fázi přijímaného signálu a mapuje ji zpět na původní symboly. Jestliže demodulátor porovnává fázi přijímaného signálu s referenčním signálem, mluvíme o koherentním detektoru.\\nDruhou možností je, že demodulátor neporovnává aktuální signál s referenční vlnou, ale s předchozím průběhem přijímaného signálu, neboli řídí se změnou fáze přijímaného signálu. Tato metoda se nazývá diferenciální klíčování fázovým posuvem. DPSK může být výrazně jednodušší než běžné PSK, protože demodulátor nemusí udržovat kopii referenčního signálu pro určení přesné fáze přijímaného signálu."},{"page_url":"https://fr.wikipedia.org/wiki/Gare_de_Nexon","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4c/Nexon_gare.JPG","page_title":"Gare de Nexon","context_page_description":"La gare de Nexon est une gare ferroviaire française des lignes de Limoges-Bénédictins à Périgueux et de Nexon à Brive-la-Gaillarde, située sur la commune de Nexon, dans le département de la Haute-Vienne, en région Nouvelle-Aquitaine.\\nC'est une gare de la Société nationale des chemins de fer français, du réseau TER Nouvelle-Aquitaine, desservie par des trains express régionaux."},{"page_url":"https://cv.wikipedia.org/wiki/%D0%A7%D0%B0%D0%BD%D1%87%D0%B0%D1%85%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/23/Chanchakhi_River.PNG","page_title":"Чанчахи","context_page_description":"Чанчахи — Кăнтăр Осетия территоринчи юханшыв. территорипе юхать. Юханшыв Риони юханшыва юхса кĕрет. Юханшыв тăршшĕ 21 км, бассейн лаптăкĕ км²."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%A0%D1%83%D0%B4%D0%BD%D0%B8%D0%BA_%D0%A1%D1%82%D0%BE%D0%BB%D0%B8%D1%86%D0%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/Kostajnik_004.jpg","page_title":"Рудник Столице","context_page_description":"Рудник Столице је рудник антимона у западној Србији у близини градова Крупањ и Лозница. Рудник Столице–Костајник припада комплексу рудника Зајача на подручју Борање. На овом подручју се налазе значајна налазишта антимона, чија је експлоатација почела још 1882. године, а према историјским изворима, традиција прераде руде на овим подручјима потиче од 1445. године. Већ 1888., био је познат највећи број антимонских руда и рудника на овом подручју, међу којима се истиче налазиште Костајник-Столице. Налазишта руде антимона се простиру од Борање до Ваљева, а руда се не налази на великим дубинама."},{"page_url":"https://pt.wikipedia.org/wiki/Quintela_de_Leirado","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4f/Situacion_Quintela_de_Leirado.PNG","page_title":"Quintela de Leirado","context_page_description":"Quintela de Leirado é um município raiano da Espanha na província\\nde Ourense,\\ncomunidade autónoma da Galiza, de área 31,26 km² com\\npopulação de 801 habitantes e densidade populacional de 26,36 hab/km²."},{"page_url":"https://es.wikipedia.org/wiki/Llar%C3%A0s","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6c/Dolmen_d_l_Mosquera_Peramea_any2006.jpg","page_title":"Llaràs","context_page_description":"Llaràs, o las Masías de Llarás, es un lugar del municipio de Baix Pallars, en la comarca leridana del Pallars Sobirá. Está ubicado en el extremo SE del Pla de Corts, al sur de Peramea y al NE de Pujol. Quedan dos casas del antiguo pueblo, siendo el turismo rural su principal actividad.​"},{"page_url":"https://ko.wikipedia.org/wiki/%EC%9D%B4%EC%8A%A4%EB%9D%BC%EC%97%98_%ED%85%8C%EB%9F%AC_%ED%94%BC%ED%95%B4%EC%9E%90_%EC%B6%94%EB%AA%A8%EB%B9%84","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/44/%D7%90%D7%A0%D7%93%D7%A8%D7%98%D7%AA_%D7%97%D7%9C%D7%9C%D7%99_%D7%94%D7%98%D7%A8%D7%95%D7%A8_-_%D7%94%D7%A8_%D7%94%D7%A8%D7%A6%D7%9C_6.jpg","page_title":"이스라엘 테러 피해자 추모비","context_page_description":"이스라엘 테러 피해자 추모비는 이스라엘 예루살렘에 위치한 국립 묘지인 헤르츨 언덕에 위치해있다. 1851년 이후 발생한 이스라엘의 테러 희생자들을 위한 추모비로, 유대인과 비 유대인의 이름이 함께 있다."},{"page_url":"https://nl.wikipedia.org/wiki/Liu_Boming","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3e/Liu_Boming.JPG","page_title":"Liu Boming","context_page_description":"Liu Boming is een Chinees ruimtevaarder. Hij werd in 2008 geselecteerd door de China National Space Administration.\\nLiu's enige missie was Shenzhou 7, gelanceerd met een Lange Mars 2F-draagraket en vond plaats op 25 september 2008. Aan boord werden verschillende wetenschappelijke experimenten uitgevoerd. Ook maakte China zijn eerste ruimtewandeling."},{"page_url":"https://ja.wikipedia.org/wiki/%E6%B8%85%E9%9F%B3%E9%A7%85","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ac/Kiyone_Station_looking_toward_Bitch%C5%AB-Takahashi_Station.jpg","page_title":"清音駅","context_page_description":"清音駅は、岡山県総社市清音上中島にある、西日本旅客鉄道・井原鉄道の駅である。"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%98%D0%B2%D0%BE%D0%BB%D0%B3%D0%B0-%D0%BC%D0%BE%D0%BD%D0%B0%D1%88%D0%B5%D0%BD%D0%BA%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/OriolusMenelikiKeulemans.jpg","page_title":"Иволга-монашенка","context_page_description":"Иволга-монашенка — вид певчих птиц семейства иволговых, распространённый в Эритрее и Эфиопии. Естественной средой обитания вида являются субтропические и тропические влажные леса.\\nПодвиды\\nО. monacha meneliki — южная Эфиопия;\\nО. monacha monacha — северная Эфиопия."},{"page_url":"https://arz.wikipedia.org/wiki/%D8%AC%D8%B1%D9%8A%D8%A7%D8%AA_%D8%B4%D9%8A%D9%81%D9%88%D8%B1%D8%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f2/Great_Shefford-g3.jpg","page_title":"جريات شيفورد","context_page_description":"جريات شيفورد, قريه فى المملكه المتحده."},{"page_url":"https://es.wikipedia.org/wiki/Escudo_de_Rusia","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8f/Greater_coat_of_arms_of_the_Russian_empire.png","page_title":"Escudo de Rusia","context_page_description":"El escudo de Rusia tiene sus orígenes en el antiguo Imperio ruso, y fue restablecido después de la caída de la Unión Soviética. A pesar de que ha sufrido varias modificaciones desde el reinado de Iván III, como el cambio del color del águila de negro a oro y la eliminación de los escudos de los territorios dominados por Rusia que rodeaban al blasón central, el escudo actual se deriva directamente de las diferentes versiones anteriores. El diseño cromático general corresponde al del estandarte usado en el siglo XV, y la forma del águila se remonta a la época de Pedro el Grande.\\nConsiste en un campo de gules con un águila bicéfala de oro, con las alas desplegadas. Sobre su pecho se encuentra el escudo de Moscú, el cual también presenta un campo de gules donde se sitúa un jinete de plata con una capa de azul, montado sobre un caballo también de plata, matando con su lanza a un dragón de color sable. Tradicionalmente, el jinete representa a San Jorge. El águila sostiene en sus garras un orbe y un cetro, y sus cabezas están coronadas cada una con coronas imperiales, y entre estas se sitúa otra similar pero de mayor tamaño, unidas las tres por una cinta."},{"page_url":"https://fr.wikipedia.org/wiki/Peugeot_404","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/46/Peugeot404pickup-TerrassesLavaux-SaintSaphorin-Suisse-byRundvald.jpg","page_title":"Peugeot 404","context_page_description":"La Peugeot 404 est une automobile du constructeur automobile français Peugeot, produite à partir du 10 mai 1960. Ce sera, en mai 1962, la première berline française de série équipée d'un moteur à injection.\\nLa 404 a été retirée du catalogue français en octobre 1975, à l'exception de la camionnette qui fut commercialisée en France jusqu'en 1979. La production s'est prolongée pendant plusieurs années à l'étranger : les dernières 404 étaient des utilitaires assemblés en 1989 à l'usine de Mombassa."},{"page_url":"https://it.wikipedia.org/wiki/Alleanza_Libera_Europea","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/58/Thrace_Periphery_Emblem.png","page_title":"Alleanza Libera Europea","context_page_description":"L'Alleanza Libera Europea è un partito politico europeo che raggruppa 46 movimenti che sostengono le politiche del regionalismo, autonomismo, indipendentismo o simili forme di federalismo o di autogoverno per la propria regione o per le cosiddette nazioni senza Stato.\\nPunti fondanti oltre al diritto dell'autodeterminazione dei popoli e dei minoranze, sono i diritti umani, il rispetto per l'ambiente, lo sviluppo sostenibile, l'attenzione per le tematiche sociali da contrapporre ad una sfrenata liberalizzazione.\\nAl Parlamento europeo l'ALE aderisce al gruppo parlamentare Verdi Europei - Alleanza Libera Europea."},{"page_url":"https://en.wikipedia.org/wiki/Tiktaalik","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6e/Tiktaalik_restoration_by_ObsidianSoul_01.png","page_title":"Tiktaalik","context_page_description":"Tiktaalik is a monospecific genus of extinct sarcopterygian from the Late Devonian Period, about 375 Mya, having many features akin to those of tetrapods.\\nUnearthed in Arctic Canada, Tiktaalik is technically a fish, complete with scales and gills - but it has the flattened head of a crocodile and unusual fins. Its fins have thin ray bones for paddling like most fish, but they also have sturdy interior bones that would have allowed Tiktaalik to prop itself up in shallow water and use its limbs for support as most four-legged animals do. Those fins and a suite of other characteristics set Tiktaalik apart as something special; it has a combination of features that show the evolutionary transition between swimming fish and their descendants, the four-legged vertebrates - a clade which includes amphibians, reptiles, birds and mammals.\\nIt and similar animals may possibly be the common ancestors of the broad swath of all vertebrate terrestrial fauna: amphibians, reptiles, birds, and mammals.\\nThe first well-preserved Tiktaalik fossils were found in 2004 on Ellesmere Island in Nunavut, Canada."},{"page_url":"https://id.wikipedia.org/wiki/Payung","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/01/Parasol_wuhan.jpg","page_title":"Payung","context_page_description":"Payung adalah suatu benda pegang yang digunakan untuk mencegah hujan mengguyur tubuh seseorang. Juga digunakan untuk menciptakan bayang-bayang dan mencegah terpaparnya orang oleh sinar matahari. Payung yang digunakan untuk menahan cahaya matahari disebut parasol.\\nPabrik payung pertama didirikan di Baltimore, Maryland, pada 1928.\\nPayung atau umbrella dalam bahasa Inggris berasal dari bahasa latin \\"umbra\\", yang berarti bayang-bayang. Saat ditemukan pada 4 ribu tahun lalu, awalnya payung kuno didesain khusus hanya untuk melindungi sang pemakai dari terik panas matahari. Sampai akhirnya bangsa China berhasil membuat payung yang berfungsi juga sebagai pelindung terhadap hujan. Mereka berhasil memanfaatkan lilin dan lak sebagai pelapis kertas agar payung itu antiair.\\nPada abad ke-16, keberadaan payung menjadi populer terutama di negara-negara Eropa Utara yang memang kerap sekali turun hujan. Semula payung hanya dianggap sebagai aksesoris kaum wanita. Lalu seorang petualang dan penulis Persia, Jonas Hanway, dengan percaya diri sering membawa payung di depan publik, sehingga menggoda keberadaan payung untuk dipakai juga oleh pria."},{"page_url":"https://it.wikipedia.org/wiki/Gooise_Meren","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/24/Gooimeer.JPG","page_title":"Gooise Meren","context_page_description":"Gooise Meren è una municipalità dei Paesi Bassi situata nella provincia dell'Olanda Settentrionale, ufficialmente istituita il 1º gennaio 2016 e consistente del territorio delle ex municipalità di Bussum, Muiden e Naarden, le quali hanno cessato di esistere lo stesso giorno."},{"page_url":"https://en.wikipedia.org/wiki/Economy_of_Italy","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2c/Toscana_Firenze4_tango7174.jpg","page_title":"Economy of Italy","context_page_description":"The economy of Italy is the third-largest national economy in the European Union, the eighth-largest by nominal GDP in the world, and the 12th-largest by GDP. Italy is a founding member of the European Union, the Eurozone, the OECD, the G7 and the G20; it is the eighth-largest exporter in the world, with $514 billion exported in 2016. Its closest trade ties are with the other countries of the European Union, with whom it conducts about 59% of its total trade. The largest trading partners, in order of market share, are Germany, France, the United States, Switzerland, the United Kingdom and Spain.\\nIn the post-World War II period, Italy was transformed from an agricultural based economy which had been severely affected by the consequences of the World Wars, into one of the world's most advanced nations, and a leading country in world trade and exports. According to the Human Development Index, the country enjoys a very high standard of living, and has the world's 8th highest quality of life according to The Economist. Italy owns the world's third-largest gold reserve, and is the third-largest net contributor to the budget of the European Union."},{"page_url":"https://es.wikipedia.org/wiki/Ej%C3%A9rcito_de_la_Rep%C3%BAblica_de_Azerbaiy%C3%A1n","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/38/2B14_Podnos_at_%22Engineering_Technologies_2010%22_forum.jpg","page_title":"Ejército de la República de Azerbaiyán","context_page_description":"El Ejército de la República de Azerbaiyán se refiere a las fuerzas terrestres dentro de las Fuerzas Armadas de Azerbaiyán. Desde la caída de la Unión Soviética, Azerbaiyán ha estado tratando de desarrollar y mejorar sus FFAA y convertirlas en unas fuerzas profesionales, bien entrenadas y con alta movilidad. Según estadísticas de 2013, el país cuenta con unas fuerzas terrestres de 56 850 efectivos, a los que se les ha de sumar unas fuerzas paramilitares censadas en unas 15 000 soldados. Además, hay 300 000 habitantes que han realizado el servicio militar en los últimos 15 años y que pueden ser convocados en estados de excepción.\\nSegún las leyes de defensa azerbaiyanas, en tiempos de guerra el ejército puede convocar, además de a los paramilitares y a los ciudadanos que realizaron el servicio militar, a la Guardia Nacional, el cuerpo de seguridad interno del país, y a al Servicio Estatal de fronteras. La estructura de la comandancia en tiempos de guerra no está del todo clara."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%9A%D1%83%D1%82%D0%BB%D0%B0%D1%87%D0%B0","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/be/Ladel_aluminium_18j07.JPG","page_title":"Кутлача","context_page_description":"Кутлача је врста кашике која служи за сервирање хране, најчешће разних врста супа и чорба, али и других врста хране. Кутлаче обично имају дугу равну или благо закривљену дршку на чијем се врху налази чинија у коју се захвата храна. Чинија је најчешће оријентисана под тупим углом према дршци да би се олакшало сипање кашасте хране и течности.\\nНајчешће се израђују од нерђајућег челика, али се користе и: алуминијум, сребро, легуре бакра, пластика, меламинске смоле, дрво, бамбус и други материјали. Величина, облик и материјал израде зависи од намјене кутлаче. Тако се кутлаче укупне дужине мање од 7-8 центиметара користе за сосове и зачине, док се за супе, чорбе и пунчеве користе кутлаче које су веће и од 30 центиметара. Најчешћа запремина чиније код кутлаче је 0,14 литара па се у тањир за супу или чорбу сипа 3-5 кутлача што укупно износи око 0,4-0,7 литара.\\nНа неким такмичењима у кувању прва награда носи назив Прва кутлача.\\nКутлача је и презиме које носе Срби поријеклом из околине Книна и Хрвати из околине Сплита."},{"page_url":"https://en.wikipedia.org/wiki/Raymond_T._Baker","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/58/Raymond-Baker-Mint-US.jpg","page_title":"Raymond T. Baker","context_page_description":"Raymond Thomas Baker was a wealthy United States businessman who was Director of the United States Mint from 1917 to 1922."},{"page_url":"https://pl.wikipedia.org/wiki/Katafrakt","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3c/028_Conrad_Cichorius%2C_Die_Reliefs_der_Traianss%C3%A4ule%2C_Tafel_XXVIII_%28Ausschnitt_01%29.jpg","page_title":"Katafrakt","context_page_description":"Katafrakt – ciężki kawalerzysta w czasach starożytnych i w średniowieczu. Znany m.in. w wojskach Sarmatów, Partów, Seleukidów, Sasanidów, Arabów z Palmyry, Ormian, Rzymian i Bizantyńczyków."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%91%D1%80%D1%91%D0%BD%D0%BD%D1%91%D0%B9%D1%81%D1%83%D0%BD%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1a/Telegrafen_Br%C3%B8nn%C3%B8ysund.jpg","page_title":"Брённёйсунн","context_page_description":"Брённёйсунн — город и бывшая коммуна, расположен в центре коммуны Брённёй в фюльке Нурланн в Норвегии.\\nБрённёйсунн был отделён от Бренная как отдельный город и коммуна в 1923 году. 1 января 1964 года он снова был объединён с соседними коммунами Сёмна и Велфьорд образовав Брённёй и потерял статус города вплоть до 2000 года. В 1977 году Сёмна была отделена как отдельная коммуна.\\nСейчас город является коммерческим и административным центром коммуны Брённёй, население в 2009 году составляло 4 506 жителей. Новое городское управление было провозглашено в 2000 году. Береговой экспресс Хуртигрутен два раза в день заходит в город: направляясь на север ночью и возвращаясь в южном направлении — после полудня. В городе есть аэропорт и при движении на восток — выезд на трассу Е6.\\nДля всей Норвегии город известен как место расположения Норвежского регистрационного центра. Штаб-квартира норвежской корабельной компании Torghatten Trafikkselskap находится в Брённёйсунне."},{"page_url":"https://af.wikipedia.org/wiki/Coco_Lee","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7d/CoCo_Lee_at_Shanghai_2013718_%28cropped%29.jpg","page_title":"Coco Lee","context_page_description":"Coco Lee is 'n Amerikaanse aktrise. Sy is bekend vir haar rolle in die rolprente Runaway Bride, Crouching Tiger, Hidden Dragon, Rush Hour 2, en Crouching Tiger, Hidden Dragon: Sword of Destiny."},{"page_url":"https://ja.wikipedia.org/wiki/%E4%BA%AC%E6%88%90%E3%82%BF%E3%82%A6%E3%83%B3%E3%83%90%E3%82%B9","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/Keisei_Town_Bus_T056_Shinkin_Line.jpg","page_title":"京成タウンバス","context_page_description":"京成タウンバスは京成電鉄奥戸自動車営業所の一部の分社化により誕生したバス事業者である。京成電鉄の子会社であり、京成グループの企業である。\\n本社は東京都葛飾区奥戸にあり、営業所は同住所の奥戸営業所のみである。運行している路線もその周囲となっている。"},{"page_url":"https://zh.wikipedia.org/wiki/%E6%B0%A3%E7%9B%B8%E8%89%B2%E8%AD%9C%E6%B3%95-%E8%B3%AA%E8%AD%9C%E8%81%AF%E7%94%A8","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b9/Gcms_schematic.gif","page_title":"氣相色譜法-質譜聯用","context_page_description":"氣相色譜法–質譜法聯用是一種結合氣相色譜法和質譜法的特性，在試樣中鑒別不同物質的分析的方法。GC-MS的使用包括藥物檢測、火災調查、環境分析、爆炸調查和未知樣品的測定。GC-MS 也用於為保障機場安全測定行李和人體中的物質。另外，GC-MS還可以用於識別物質中以前認為在未被識別前就已經蛻變了的痕量元素。\\nGC-MS已經被廣泛地譽為司法學物質鑒定的金標方法，因為它被用於進行「專一性測試」。所謂「專一性測試」就是能十分肯定地在一個給定的試樣中識別出某個物質的實際存在。而非專一性測試則只能指出試樣中有哪類物質存在。儘管非專一性測試能夠用統計的方法提示該物質具體是那種物質，但存在識別上的正偏差。"},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A1%D0%BA%D0%BB%D0%B0%D0%B4_(%D0%B1%D1%83%D0%B4%D1%96%D0%B2%D0%BB%D1%8F)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/61/Allentown_Project_042.jpg","page_title":"Склад (будівля)","context_page_description":"Склад, рідше комора — це обладнане місце, приміщення або споруда, інфраструктура, різноманітне обладнання та внутрішня транспортна система, яка застосовується для прийому, розміщення та зберігання матеріальних цінностей, підготовки їх до споживання та видачі споживачу.\\nСклади є ключовим елементом логістичної системи, у якій виконують функцію акумуляції резервів матеріальних ресурсів, необхідних для демпфування коливань обсягів постачань і попиту, а також синхронізації швидкостей потоків товарів у системах просування від виробників до споживачів або потоків матеріалів у технологічних виробничих системах."},{"page_url":"https://hy.wikipedia.org/wiki/%D4%BC%D5%B8%D6%82%D5%AD%D5%B8%D5%BE%D5%AB%D6%81%D5%AF%D5%AB_%D5%B7%D6%80%D5%BB%D5%A1%D5%B6","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f1/Flag_of_Lukhovitsky_rayon_%28Moscow_oblast%29.png","page_title":"Լուխովիցկի շրջան","context_page_description":"Լուխովիցկի շրջան, մունիցիպալ շրջան Ռուսաստանի Դաշնության Մոսկվայի մարզում։\\nՍտեղծվել է 1929 թվականին։ Վարչական կենտրոնը՝ Լուխովիցի։"},{"page_url":"https://en.wikipedia.org/wiki/List_of_Gothic_brick_buildings_in_the_Netherlands","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/Overzicht_van_de_achterzijde_van_het_hoofdgebouw_met_poorttoren_en_trapgevel_-_Heijen_-_20381517_-_RCE.jpg","page_title":"List of Gothic brick buildings in the Netherlands","context_page_description":"This list is a part of the international List of Gothic brick buildings.\\nFor the parts of this list on the various countries see:\\n– In long tables, vertical arrows link to the navigation boards above and below. –"},{"page_url":"https://es.wikipedia.org/wiki/Cistoadenoma_seroso_de_ovario","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cf/Ovarian_serous_cystadenoma_-_alt_--_intermed_mag.jpg","page_title":"Cistoadenoma seroso de ovario","context_page_description":"El cistoadenoma seroso de ovario, también conocido como cistoadenoma seroso, es la neoplasia ovárica más común, que representa el 20% de las neoplasias ováricas, y es de carácter benigno.​\\nTiene un parecido muy superficial con el tipo más común de cáncer de ovario bajo el microscopio; sin embargo, es prácticamente imposible de mezclarse con su contraparte maligna, y no comparte los rasgos genéticos de los tumores serosos indeterminados, también denominados tumores serosos límite, que pueden transformarse en carcinoma seroso.​\\nNo están relacionados con los cistoadenomas serosos del páncreas, es decir, la presencia de cistoadenoma ya sea en ovario o páncreas no sugiere un riesgo mayor de padecerlo en el otro órgano.\\nLos procedimientos de diagnóstico incluyen inicialmente un estudio de ultrasonido o doppler en color para conocer el tamaño y la naturaleza de la masa. La investigación de la sangre incluye el nivel de CA 125 para la detección y más CEA, niveles de beta hCG, AFP, CA19-9 y niveles de LDH para confirmar el diagnóstico. Antes de acudir a la cirugía se realiza una investigación de rutina."},{"page_url":"https://hu.wikipedia.org/wiki/Miskolc_t%C3%B6megk%C3%B6zleked%C3%A9se","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/28/Villamos_Miskolc_Siemens_199_1.jpg","page_title":"Miskolc tömegközlekedése","context_page_description":"Miskolc tömegközlekedéséről a Miskolc Városi Közlekedési Zrt. gondoskodik, amely – több más város közlekedési szolgáltatójával ellentétben – nem osztozik a Volánbusz Zrt-vel a város közlekedésében, hanem egymaga látja el Miskolc és a közeli Felsőzsolca tömegközlekedését, míg a Volánbusz Zrt. kizárólag a helyközi közlekedésért felelős. Miskolcon összesen 2 villamosjárat és 46 autóbuszjárat van, melyből kettő szerződéses járat a város szélein fekvő áruházakhoz. A város járműparkja buszokból és villamosokból áll. A közlekedési vállalat járműparkját az elmúlt években jelentősen korszerűsítették: 2013–14-ben 31 Škoda 26T villamos váltotta le a teljes korábbi állományt, valamint 2016-ban 40 szóló és 35 csuklós kivitelű MAN Lion's City CNG autóbusz állt szolgálatba.\\nMiskolcon a tömegközlekedés nagy múltra tekint vissza. A villamosközlekedés 1897-ben indult meg, a menetrend szerinti buszjáratok pedig először 1903-ban indultak. Ma Miskolc egyike annak a hat magyar városnak, amelyeknek saját közlekedési vállalata van. A városnak két pályaudvara és egy kisebb repülőtere van."},{"page_url":"https://de.wikipedia.org/wiki/Hafen_Lubmin","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ce/Marina_Lubmin_Flaggenmast.jpg","page_title":"Hafen Lubmin","context_page_description":"Die Hafen Lubmin ist ein Hafen im Nordosten Mecklenburg-Vorpommerns östlich des Seebads Lubmin. Der Hafen liegt am Greifswalder Bodden zwischen der Peenemündung und Greifswald. Das Eigentum des Industriehafens liegt beim Zweckverband Energie- und Technologiestandort Freesendorf, der wiederum von den drei Standortgemeinden Lubmin, Kröslin und Rubenow getragen wird."},{"page_url":"https://et.wikipedia.org/wiki/T%C3%B5rva","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cc/T%C3%B5rva_1928.jpg","page_title":"Tõrva","context_page_description":"Tõrva on linn Lõuna-Eestis, Tõrva valla keskus. See asub Valga maakonna keskosas Õhne jõe ääres, maakonnakeskusest Valga linnast 30 kilomeetrit põhjas. Tõrva on üks Valga maakonna kolmest suuremast keskusest Valga ja Otepää kõrval. See oli Helme kihelkonna ja Helme valla keskus. Tõrva sai linnaõigused 2. juulil 1926.\\n2017. aasta kohalike omavalitsuste volikogude korralistel valimistel ühinesid Tõrva linn, Helme, Hummuli ja Põdrala vald Tõrva vallaks, mille tulemusena sai Tõrvast vallasisene linn ja uue omavalitsuse keskus."},{"page_url":"https://be.wikipedia.org/wiki/%D0%A1%D0%B0%D0%BD-%D0%9D%D1%96%D0%BA%D0%BE%D0%BB%D0%B0_%D0%B4%D1%8D%D1%96_%D0%9C%D0%B5%D0%BD%D0%B4%D0%B7%D1%96%D0%BA%D0%BE%D0%BB%D1%96","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/53/San_Nicol%C3%B2_dei_Mendicoli_%28Venice%29_Organ.jpg","page_title":"Сан-Нікола дэі Мендзіколі","context_page_description":"Царква Сан-Нікола дэі Мендзіколі — царква ў Венецыі, размешчаная ў раёне Дарсадура.\\nУпершыню на гэтым месцы царква была пабудавана ў VII стагоддзі. Царква атрымала назву Mendicoli, з-за галечы мясцовага насельніцтва.\\nУ XII стагоддзі царква была перабудавана і з тых часоў яшчэ некалькі разоў перабудоўвалася. Цяперашняя званіца прыбудавана ў 1764 годзе.\\nМаленькая і ўтульная царква ў 1970-х гадах была адрэстаўраваная на сродкі фонду «Ратуйце Венецыю». За працэсам рэстаўрацыі можна назіраць у культавым фільме жахаў \\"А цяпер не глядзі\\".\\nУ царкве знаходзяцца драўляныя скульптуры і карціны вучняў Веранезэ з выявай сцэн з жыцця Хрыста."},{"page_url":"https://en.wikipedia.org/wiki/Tea,_South_Dakota","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a5/Lincoln_County_South_Dakota_Incorporated_and_Unincorporated_areas_Tea_Highlighted.svg","page_title":"Tea, South Dakota","context_page_description":"Tea is a city in Lincoln County, South Dakota, United States and is a suburb of Sioux Falls. The population was 3,806 at the 2010 census.\\nTea was laid out in 1894. The name \\"Tea\\" was selected on account of its brevity."},{"page_url":"https://fr.wikipedia.org/wiki/Signalisation_ferroviaire_du_m%C3%A9tro_de_Paris","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/76/Track_circuit.png","page_title":"Signalisation ferroviaire du métro de Paris","context_page_description":"La signalisation ferroviaire du métro de Paris est un système adapté à l'intensité du trafic et à la densité de circulation. Il doit être parfaitement fiable afin d'assurer la sécurité des convois et fonctionner avec la plus grande régularité possible. Dès les origines, le principe de protection des trains par deux signaux fermés successifs est adopté, pour éviter au maximum les rattrapages. Plusieurs systèmes se sont succédé en un peu plus d'un siècle d'existence, du block automatique système Hall des années 1900 au système d'automatisation de l'exploitation des trains du XXIᵉ siècle."},{"page_url":"https://fr.wikipedia.org/wiki/Prieur%C3%A9_de_Carluc","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c9/Partie_troglodyte_-_vue_g%C3%A9n%C3%A9rale.JPG","page_title":"Prieuré de Carluc","context_page_description":"Le prieuré de Carluc est situé sur la commune de Céreste, dans le département des Alpes-de-Haute-Provence. Il présente un complexe médiéval bien conservé."},{"page_url":"https://nl.wikipedia.org/wiki/Copa_Am%C3%A9rica_1987","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/002.Buenos_Aires_desde_el_cielo_%28Estadio_de_River%29.JPG","page_title":"Copa América 1987","context_page_description":"De Copa América 1987 was een voetbaltoernooi gehouden in Argentinië van 27 juni tot 12 juli 1987.\\nAlle landen van de CONMEBOL deden mee.\\nDe landen werden verdeeld over drie groepen van drie teams. De nummers één samen met Uruguay gingen door naar de halve finales.\\nDe puntenverdeling was als volgt:\\nTwee punten voor winst\\nEén punt voor gelijkspel\\nNul punten voor verlies"},{"page_url":"https://eu.wikipedia.org/wiki/Neuroptera","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/57/Chrysopidae_01_%28MK%29.jpg","page_title":"Neuroptera","context_page_description":"Neuroptera intsektuen ordena bat da. Ordena horretako intsektuei neuroptero deritze.\\nNeuropteroek, ugaltzean, metamorfosiaren aldi guztiak igarotzen dituzte. Lau hego dituzte, elkarren antzekoak eta mintz sendokoak; geldi daudenean, gorputzaren gainera bilduta dauzkate. Aho murtxikatzailea dute. Hogei bat familia biltzen ditu ordenak; besteak beste, dilaridoak, sisiridoak, krisopidoak."},{"page_url":"https://ja.wikipedia.org/wiki/%E5%BC%93%E6%8A%98%E5%B2%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8f/Nount_Nukedo_and_Mount_Onoma_from_Mount_Yumiori.jpg","page_title":"弓折岳","context_page_description":"弓折岳は、岐阜県高山市にある飛騨山脈南部の標高2,592 mの山。弓折岳を含む飛騨山脈の主な山域は1934年12月4日に中部山岳国立公園の指定を受けている。山頂は台地状。花の百名山、続ぎふ百山の一つに選定されている。東山腹にある鏡平が、新高山市100景の一つに選定されている。"},{"page_url":"https://es.wikipedia.org/wiki/Willy_Taveras","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2b/Willy_Taveras_24_August_2006_001.jpg","page_title":"Willy Taveras","context_page_description":"Willy Taveras es un jardinero central dominicano de Grandes Ligas que actualmente juega para los Acereros de Monclova en la Liga Mexicana de Béisbol."},{"page_url":"https://it.wikipedia.org/wiki/Caio_Duilio_(D_554)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7f/Duilio_stern.jpg","page_title":"Caio Duilio (D 554)","context_page_description":"Il Caio Duilio è un cacciatorpediniere lanciamissili della Marina Militare. Esso fa parte, con l'Andrea Doria, della classe Orizzonte, a loro volta, assieme alle navi francesi Forbin e Chevalier Paul.\\nIl Caio Duilio è contraddistinto dal distintivo ottico D 554 secondo la classificazione NATO."},{"page_url":"https://zh.wikipedia.org/wiki/%E8%8B%8F%E5%B7%9E%E5%B8%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/12/Stonebrigeinliongrovegarden.jpg","page_title":"苏州市","context_page_description":"苏州，古称吴，现简称苏，是中华人民共和国江苏省东南部的一个地级市，位于长江三角洲和太湖平原的中心地带，著名的鱼米之乡、状元之乡、院士之乡、经济重镇、历史文化名城，自古享有“人间天堂”的美誉。\\n苏州有文字记载的历史已有4000余年，而官方认定的建城史逾2500年，是中国现存最古老的城市之一，江南吴文化的发祥地，历史上长期为江南地区一级行政区的首府和经济文化中心。早在东汉中期，就成为仅次于中国首都洛阳的全国第二大城市和世界十大城市之一，明清时期，更成为全国的经济文化中心。当时，苏州是全国最大的工商业城市，世界十大城市之一。但19世纪时受到西方列强的冲击，上海开埠与之后太平天国的庚申之劫后，工商业衰败，人口锐减外移，苏州经历了长达一百多年的衰落时期。直到20世纪80年代左右，随着苏南模式的发展和众多开发区的建立，苏州经济开始快速发展，1978-2013年年均经济增长超过14%。据联合国的报告，苏州人口在2000年至2014年年均增长6.5%，在全球超过五百万人口的城市高居增长首位，也因此被认为是全球最具潜力的新兴城市。\\n苏州是国内经国务院批准的享有地方立法权的较大的市之一，长江三角洲经济圈北翼最重要的经济中心，是江苏省经济最发达、现代化程度最高的城市之一，经济总量长期居全省之冠，是全省的经济中心、工商业中心、对外贸易中心和物流中心，也是全省重要的金融、文化、科教城市及交通枢纽。根据2015年官方发布的各项统计数据，苏州的人类发展指数已达到0.894，相当于世界第18位的以色列。\\n苏州文化底蕴深厚，是中华人民共和国首批24个国家历史文化名城之一，10个全国重点风景旅游城市之一，首批中国优秀旅游城市。苏州古典园林作为中国古典园林的代表，已列入《世界文化遗产名录》。苏州还承办过第28届世界遗产大会。在2018年举办的世界遗产城市组织第三届亚太区大会上，苏州市被授予全球首个“世界遗产典范城市”称号。苏州是中国重要的旅游城镇之一，被《米其林旅游指南》评为“三星级旅游推荐”。"},{"page_url":"https://hr.wikipedia.org/wiki/Alpine_A110","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4c/Alpine-A110-Berlinette-avant.jpg","page_title":"Alpine A110","context_page_description":"Alpine A110, znan pod nazivom \\"Berlinette\\", bio je sportski automobil francuskog proizvođača automobila Alpine koji se proizvodio od 1961. do 1977. Model je predstavljen kao nasljednik modela Alpine A108.\\nNa modelu iz 1961., kao uostalom i na drugim Alpine modelima, mnogi dijelovi, uključujući i motor su bili Renaultovi. A110 je dolazio sa dva motora: 1.1 L R8 Major ili R8 Gordini. Gordini motor davao je 95 KS SAE pri 6500 okr/min. Kasnih 1960ih čelični R8 Gordini, zamijenjen je aluminijskim Renault 16 TS motorom. Sa duplim Weber 45 karburatorom, TS motor je razvijao 125 KS DIN pri 6000 okr/min, što je tvornički A110 1600S tjeralo da najveće brzine od 210 km/h.\\nAutomobil je slavu stekao tijekom 1970ih kao pobjednički reli automobil. Nakon što je 1960ih pobijedio na brojnim reli utrkama, pokazao se uspješnim u novoosnovnom međunarodnom prvenstvu za proizvođaće koje se je održavalo od 1970. do 1972. i koje je prethodilo svjetskom prvenstvu u reliju prvi put održanom 1973. Prve sezone je A110 1600S, u vozačkim rukama Bernard Darniche, Jean-Pierre Nicolas, Jean-Luc Thérier, te Jean-Claude Andruet osvojio svoj prvi i jedini naslov svjetskog prvaka u reliju."},{"page_url":"https://es.wikipedia.org/wiki/Zorra_Plateada","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4a/LynnCollinsApr09.jpg","page_title":"Zorra Plateada","context_page_description":"Zorra Plateada es un personaje Marvel Comics. Zorra Plateada es un antiguo interés amoroso para Wolverine, y actualmente trabaja para la organización terrorista HYDRA."},{"page_url":"https://de.wikipedia.org/wiki/Dejima","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f5/Dutch_personnel_and_Japanese_women_watching_an_incoming_towed_Dutch_sailing_ship_at_Dejima_by_Kawahara_Keiga.jpg","page_title":"Dejima","context_page_description":"Dejima war eine fächerförmige kleine künstliche Insel in der Bucht von Nagasaki. Während der Edo-Zeit war sie der einzige Ort des direkten Handels und Austauschs zwischen Japan und Europa. Im modernen Japanisch wird die Aussprache des Namens in den Silbenschriften Hiragana und Katakana als でじま bzw. デジマ wiedergegeben und dementsprechend in Hepburn-Umschrift als Dejima transkribiert. In der Edo-Zeit sind in westlichen Berichten Schreibungen wie „Disma“, „Decima“, „Dezima“, „Desima“, „Desjima“ und „Deshima“ zu finden. Auch in japanischen Quellen gibt es Indizien, dass die damalige Aussprache eher der Schreibung Deshima nahekam."},{"page_url":"https://es.wikipedia.org/wiki/LeBron_James","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/76/LeBronWizards1.jpg","page_title":"LeBron James","context_page_description":"LeBron Raymone James es un jugador de baloncesto estadounidense que actualmente pertenece a la plantilla de Los Angeles Lakers de la NBA. Con 2,06 metros de estatura, su posición es la de alero, pero su talento, versatilidad y poderío físico le permiten jugar tanto de base como de ala-pívot.​ James es considerado como uno de los mejores jugadores de baloncesto del mundo y de la historia.​\\nCuando James se proclamó tres veces Mr. Basketball en Ohio durante el instituto, y apenas cursaba su temporada sophomore en St. Vincent–St. Mary High School, ya era considerado por los medios de comunicación como la futura gran estrella de la NBA. Firmó un contrato de 90 millones de dólares con Nike antes de debutar en la NBA. Con 18 años, James fue elegido en la primera posición del Draft de la NBA de 2003 por Cleveland Cavaliers. Con los Cavs ratificó el prometedor futuro que se labró durante su estancia en el instituto, y en su primera temporada se llevó el premio al Rookie del Año de la NBA. Desde que llegó a la liga, LeBron ha registrado muchos récords de precocidad, entre ellos, el del jugador más joven en alcanzar los 10 000, 15 000, 20 000, 25 000 y 30 000 puntos."},{"page_url":"https://pt.wikipedia.org/wiki/Dieta_federal","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cc/Bundesbrief.jpg","page_title":"Dieta federal","context_page_description":"A Dieta federal, como é conhecida a Dieta da Confederação Suíça, é até 1848 a assembleia dos deputados dos cantões suíços."},{"page_url":"https://fi.wikipedia.org/wiki/Kimi_R%C3%A4ikk%C3%B6nen","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f1/Ferrari_SF70H_R%C3%A4ikk%C3%B6nen_Barcelona_Test.jpg","page_title":"Kimi Räikkönen","context_page_description":"Kimi-Matias Räikkönen on suomalainen autourheilija ja Formula 1 -sarjan maailmanmestari. Räikkönen on voittojen, palkintosijojen, nopeimpien kierrosten ja MM-mitalien määrällä mitattuna kaikkien aikojen menestynein suomalainen Formula 1 -kuljettaja. Ajettujen kilpailukilometrien määrässä Räikkönen on myös kaikkien aikojen kokenein kuljettaja. Hän ohitti tilastossa Fernando Alonson Espanjan GP:ssa 2020. Räikkönen on myös ainoa kuljettaja, joka on ajanut voiton kolmella eri moottorikaudella. Kaudella 2020 Räikkönen ajaa Formula 1:ssä Alfa Romeolla.\\nRäikkönen aloitti Formula 1 -uransa Sauberilla vuonna 2001. Räikkönen siirtyi McLarenille kaudeksi 2002 ja ajoi tallissa aina kauden 2006 loppuun asti. McLarenilla hän sijoittui parhaimmillaan toiseksi MM-sarjassa kausilla 2003 ja 2005. Kaudeksi 2007 hän siirtyi ajamaan Scuderia Ferrarille ja voitti debyyttivuonnaan tallissa maailmanmestaruuden. Räikkösen sopimus Ferrarilla päättyi kauden 2009 jälkeen, ja hän siirtyi rallin MM-sarjaan Citroënin kuljettajaksi. Räikkönen ajoi rallia kaksi vuotta, joista jälkimmäisen omassa yksityistallissaan."},{"page_url":"https://es.wikipedia.org/wiki/Celos%C3%ADa_(horticultura)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/36/Parc_de_Versailles%2C_Bosquet_de_l%27Encelade%2C_treillage_01_%28niche%29.jpg","page_title":"Celosía (horticultura)","context_page_description":"La celosía usada en horticultura, también conocida como enrejado, espaldera, o por el galicismo de « treillage », es una estructura arquitectónica, por lo general a partir de un marco abierto o celosía de piezas entrelazadas o de intersección de madera, bambú, metal poliéster, PVC, etc., siempre se ha utilizado para separar ambientes, normalmente para apoyar y mostrar plantas, especialmente plantas trepadoras.​ Ahora, se usa más para conformar estructuras y como apoyo a las demás construcciones. Por ejemplo, con celosías se cierran espacios huecos de pérgolas y cenadores."},{"page_url":"https://de.wikipedia.org/wiki/UEFA_Champions_League_2010/11","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d2/Lionel_Messi_Player_of_the_Year_2011.jpg","page_title":"UEFA Champions League 2010/11","context_page_description":"Die UEFA Champions League 2010/11 war die 19. Spielzeit des wichtigsten europäischen Wettbewerbs für Vereinsmannschaften im Fußball unter dieser Bezeichnung und die 56. insgesamt. Am Wettbewerb nahmen 76 Klubs aus 52 Landesverbänden teil. Lediglich Liechtenstein stellte keinen Vertreter.\\nDie Saison begann mit der ersten Qualifikationsrunde am 29. Juni 2010 und endete mit dem Finale im Londoner Wembley-Stadion am 28. Mai 2011. Dort schlug der FC Barcelona Manchester United mit 3:1.\\nTorschützenkönig des Wettbewerbs wurde bereits zum dritten Mal in Folge der Argentinier Lionel Messi von Sieger FC Barcelona mit 12 Toren."},{"page_url":"https://es.wikipedia.org/wiki/Ofensiva_de_K%C3%A9renski","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a5/AA_Brusilov_03.jpg","page_title":"Ofensiva de Kérenski","context_page_description":"La Ofensiva de Kérenski fue la última ofensiva rusa durante la Primera Guerra Mundial y tuvo lugar en julio de 1917.​ Sus objetivos principales eran evitar el traslado de tropas de las Potencias Centrales al frente occidental antes de la llegada de las fuerzas estadounidenses que debían dar ventaja a la Triple Entente, además de recobrar la disciplina y el espíritu de combate entre las tropas rusas, muy debilitadas por las penalidades de la guerra y la Revolución de Febrero.​\\nEl régimen zarista​ se había comprometido con los Aliados a participar en una nueva ofensiva conjunta en 1917. Al comienzo, esta se había fijado para comienzos de año pero las necesidades militares anglo-británicas y el rechazo ruso a combatir en mitad del invierno obligaron a retrasar las operaciones hasta la primavera. Para entonces la desorganización del Ejército ruso, en parte por las enormes bajas sufridas y el hartazgo por la guerra y en parte por las medidas democratizadoras del nuevo Gobierno provisional que desbarataron la antigua disciplina, impidió al alto mando participar en las operaciones de primavera."},{"page_url":"https://de.wikipedia.org/wiki/Posteo","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3f/Posteo.png","page_title":"Posteo","context_page_description":"Posteo ist ein im Jahr 2009 gegründetes Unternehmen in der Rechtsform eines Eingetragenen Kaufmanns mit dem Geschäftssitz in Berlin-Kreuzberg. Das Unternehmen bietet E-Mail-Dienste mit Fokus auf Sicherheit und Verschlüsselung, Kontakteverwaltung und Kalender werbefrei und kostenpflichtig an.\\nDer Dienst wurde im Jahr 2013 in den deutschen Medien vor allem genannt, nachdem die Enthüllungen Edward Snowdens rund um die NSA-Überwachung die Debatte über sichere E-Mail-Dienstleistungen und E-Mail-Verschlüsselung befördert hatten und der US-amerikanische Anbieter Lavabit geschlossen wurde. Die Website von Posteo ist auf Deutsch, Englisch und Französisch verfügbar. Die Webmail-Oberfläche bietet eine freie Sprachwahl für über 70 Sprachen zur Bedienung des Postfaches an.\\nBis März 2015 erreichte das Unternehmen eine Anzahl von etwa 100.000 Postfächern. Im Jahr 2016 stieg die Anzahl der geführten E-Mail-Postfächer um rund 40 Prozent. Im Jahr 2019 wurden von Posteo ca. 350.000 Postfächer betrieben. Ende 2016 hatte Posteo weniger als 20 Mitarbeiter."},{"page_url":"https://vi.wikipedia.org/wiki/KGP-9","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/ea/KGP-9_1.jpg","page_title":"KGP-9","context_page_description":"KGP-9 là loại súng tiểu liên được sử dụng bởi quân đội Hungary và các nhân viên canh tù. Nó hoạt động bằng cơ chế lên đạn bằng phản lực bắn cơ bản, sử dụng loại đạn 9mm Parabellum rất phổ biến và thoi nạp đạn mở. Nó được lắp ráp từ các linh kiện thép ép và gia cố bằng các vật liệu đúc. KGP-9 bắn bằng cơ chế búa và kim điểm hỏa ở trong khoang chứa đạn và có thể đạt tới tốc độ bắn 900 viên/phút.\\nĐiều đáng chú ý của loại súng này là nòng súng cơ bản của nó có thể tháo ra và thay bằng nòng dài hơn, biến loại súng này thành loại súng trường nhỏ với tầm bắn xa hơn súng tiểu liên. Loại súng này có mẫu dành cho dân thường nhưng chỉ có chế độ bắn bán tự động."},{"page_url":"https://id.wikipedia.org/wiki/Sosialisme_abad_ke-21","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/F%C3%B3rum_Social_Mundial_2008_-_AL.jpg","page_title":"Sosialisme abad ke-21","context_page_description":"Sosialisme abad ke-21 adalah istilah politik yang digunakan untuk menjelaskan interpretasi prinsip-prinsip sosialis yang pertama kali dianjurkan oleh Heinz Dieterich pada 1996 dan kemudian oleh pemimpin Amerika Latin seperti Hugo Chávez dari Venezuela, Rafaei Correa dari Ekuador, Evo Morales dari Bolivia, dan Luiz Inácio Lula da Silva dari Brasil. Sosialisme abad ke-21 berpendapat bahwa kapitalisme industrial pasar bebas dan sosialisme abad ke-20 telah gagal memecahkan masalah mendesak kemanusiaan, seperti kemiskinan, kelaparan, eksploitasi, penindasan ekonomi, seksisme, rasisme, penghancuran sumber daya alam, dan ketidakhadiran demokrasi partisipatoris. Oleh karena kondisi lokal yang unik, sosialisme abad ke-21 sering dikontraskan dengan aplikasi sosialisme sebelumnya di negara lain, dan bertujuan untuk lebih terdesentralisasi dan partisipatoris dalam proses perencanaan. Sosialisme abad ke-21 memiliki elemen sosialisme demokratik, tapi terutama sekali menyerupai Marxis Revisionis."},{"page_url":"https://en.wikipedia.org/wiki/CFCL_Australia","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fe/CFCLA_PMS-3C.jpg","page_title":"CFCL Australia","context_page_description":"CFCL Australia is an Australian locomotive and rolling stock leasing company operating in the rail freight market. CFCLA leases assets to a number of private rail operators in the local rail industry, predominantly on the defined standard gauge interstate network.\\nThough primarily based in New South Wales, CFCLA’s assets can be found operating in most Australian states and with all major train operating companies. It has rolling stock on both long term lease to these companies as well as assets that are available for spot hire. It is owned by Chicago Freight Car Leasing Company and Marubeni Corporation"},{"page_url":"https://zh.wikipedia.org/wiki/%E8%80%81%E6%8C%9D","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/46/Luang_Prabang_Phou_Si_2.jpg","page_title":"老挝","context_page_description":"老挝人民民主共和国，简称老挝，是位于东南亚中南半岛的社会主义国家，首都及最大城市为万象。通行老挝语，面积23.68万平方公里，人口700万人，老挝是东南亚唯一的内陆国，东邻越南，南界柬埔寨，西连泰国、缅甸，北与中华人民共和国接壤。\\n老挝历史上第一个统一国家为法昂在1353年建立的澜沧王国，首都为琅勃拉邦，曾是中南半岛的人口、贸易与文化大国。澜沧王国存在近四个世纪，代表着老挝历史的鼎盛时期。1707年，澜沧王国因王位继承纷争而陷入分裂，又不断遭到邻国暹罗和越南的入侵，沦为两国的属国。1893年，沦为法国殖民地，老挝保护国成立，奠定现代老挝疆界。1953年，老挝宣布独立，建立君主立宪制国家，但很快陷入长期内战。1975年，共产主义组织巴特寮推翻君主制政权，老挝人民民主共和国建立并存续至今。\\n老挝是以马列主义为官方意识形态的社会主义共和国，唯一政党是老挝人民革命党。老挝是多民族国家，佬族占总人口的55%，在政治和文化领域占主导地位；丘陵和高山地区则分布着众多其他民族；按居住地区分类，又分为低地的老龙、丘陵的老听和高山的老松三大族群。老龙族通用老挝语，而老听族和老松族则使用汉藏语、孟-高棉语和苗语等其他语言。传统上，以上座部佛教为主流的宗教信仰。\\n老挝的经济以农业为主，工业基础薄弱。老挝工业经济的支柱部门是水力发电，透过输电和铁路运输和邻国建立经贸联系。\\n老挝是高速发展的经济体之一，2013年至2018年的平均GDP增长率为7.25%。2018年，老挝的人均国内生产总值按购买力平价计算，位列东南亚第七位，排在新加坡、文莱、马来西亚、泰国、印尼、菲律宾之后；人类发展指数位列世界第139位，属中等组别。老挝目前是联合国、东南亚国家联盟、东亚峰会和法语圈国际组织成员，2013年加入世界贸易组织。"},{"page_url":"https://uk.wikipedia.org/wiki/%D0%91%D0%B0%D0%BD%D1%8C%D0%B9%D0%BE%D1%81-%D0%B4%D0%B5-%D0%95%D0%B1%D1%80%D0%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/42/Iglesia_parroquial_de_Ntra._Sta._de_la_Antigua_-_Ba%C3%B1os_de_Ebro.jpg","page_title":"Баньйос-де-Ебро","context_page_description":"Баньйос-де-Ебро, Маньюета — муніципалітет в Іспанії, у складі автономної спільноти Країна Басків, у провінції Алава. Населення — 333 осіб.\\nМуніципалітет розташований на відстані близько 250 км на північ від Мадрида, 34 км на південь від Віторії."},{"page_url":"https://ja.wikipedia.org/wiki/%E6%9D%B1%E4%BA%AC%E3%83%89%E3%83%BC%E3%83%A0","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d8/Tokyo_Dome_2007-4.jpg","page_title":"東京ドーム","context_page_description":"東京ドームは、東京都文京区後楽1-3-61にあるドーム球場。プロ野球・セントラル・リーグの読売ジャイアンツが専用球場としている。\\n1988年3月18日に開場した日本初の屋根付き球場であり、株式会社東京ドームが運営する東京ドームシティの中核施設である。野球のほかにも格闘技・プロレスの興行やコンサート、商品の展示会なども行われている。"},{"page_url":"https://it.wikipedia.org/wiki/Pern%C5%A1tejnsk%C3%A9_Jest%C5%99ab%C3%AD","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/87/Pern%C5%A1tejnsk%C3%A9_Jest%C5%99ab%C3%AD_vlajka.jpg","page_title":"Pernštejnské Jestřabí","context_page_description":"Pernštejnské Jestřabí è un comune della Repubblica Ceca facente parte del distretto di Brno-venkov, in Moravia Meridionale."},{"page_url":"https://de.wikipedia.org/wiki/Cristoforo_Colombo_(Schiff,_1954)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/21/Italian_passenger_ship_Cristoforo_Colombo_-_Cote_d%27Azur%2C_in_May_1962.png","page_title":"Cristoforo Colombo (Schiff, 1954)","context_page_description":"Die Cristoforo Colombo war ein 1954 in Dienst gestelltes Transatlantik-Passagierschiff der italienischen Reederei Italia – Società di Navigazione. Die Cristoforo Colombo war bei ihrer Indienststellung das größte Schiff der italienischen Handelsmarine. Sie war das Schwesterschiff der 1956 gesunkenen Andrea Doria."},{"page_url":"https://zh.wikipedia.org/wiki/%E8%8A%9D%E5%8A%A0%E5%93%A5%E9%A6%AC%E6%8B%89%E6%9D%BE","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/cd/Chicago_Marathon_2008_Race_Start.jpg","page_title":"芝加哥馬拉松","context_page_description":"芝加哥馬拉松每年舉行一次，是世界馬拉松大滿貫之一。芝加哥馬拉松於1977年設立，首次比賽於1977年9月25日舉行。1987年起比賽開始每年定期舉行。2008年起，美國銀行成為主要贊助商，官方冠名為「美國銀行芝加哥馬拉松」至今。"},{"page_url":"https://pl.wikipedia.org/wiki/Eckfeld","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6f/Wappen_Eckfeld.png","page_title":"Eckfeld","context_page_description":"Eckfeld – miejscowość i gmina w Niemczech, w kraju związkowym Nadrenia-Palatynat, w powiecie Bernkastel-Wittlich, wchodzi w skład gminy związkowej Wittlich-Land. Do 30 czerwca 2014 wchodziła w skład gminy związkowej Manderscheid."},{"page_url":"https://it.wikipedia.org/wiki/Seconda_battaglia_di_Passchendaele","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c8/Passchendaele_aerial_view.jpg","page_title":"Seconda battaglia di Passchendaele","context_page_description":"La Seconda battaglia di Passchendaele fu l'attacco finale della Terza battaglia di Ypres, durante la prima guerra mondiale. La battaglia ebbe luogo nell'area del Saliente di Ypres, situato sul Fronte occidentale, in particolare nei pressi del paese belga di Passchendaele, tra il 26 ottobre e il 10 novembre 1917.\\nIl Canadian Corps, affiancato dalle truppe del II ANZAC Corps, continuò l'avanzata iniziata durante la Prima battaglia di Passchendaele, riuscendo finalmente a catturare il paese di Passchendaele stesso. Oltre a guadagnare delle buone posizioni di osservazione, la battaglia era mirata anche a conquistare delle postazioni sopraelevate più asciutte, in vista dell'arrivo dell'inverno.\\nLa posizione d'assalto era situata immediatamente a sud del confine tra la Fifth e la Second Army inglese. Di conseguenza il Canadian Corps avrebbe attaccato sfruttando il supporto delle formazioni provenienti dalla Fifth Army, a nord, e dal I ANZAC Corps, a sud. L'offensiva fu eseguita attraverso una serie di attacchi, ognuno dei quali aveva particolari obiettivi. Gli attacchi furono lanciati ad intervalli di tre o più giorni l'uno dall'altro."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkmale_in_Leisnig","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6a/LeisnigPost.JPG","page_title":"Liste der Kulturdenkmale in Leisnig","context_page_description":"Die Liste der Kulturdenkmale in Leisnig enthält die Kulturdenkmale in Leisnig.\\nDiese Liste ist eine Teilliste der Liste der Kulturdenkmale in Sachsen."},{"page_url":"https://ceb.wikipedia.org/wiki/Calloplesiops_altivelis","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/ba/Marine_Comet_%28Calloplesiops_altivelis%29_-_GRB.jpg","page_title":"Calloplesiops altivelis","context_page_description":"Espesye sa isda nga una nga gihulagway ni Franz Steindachner ni adtong 1903 ang Calloplesiops altivelis. Ang Calloplesiops altivelis sakop sa kahenera nga Calloplesiops sa kabanay nga Plesiopidae. Pagka karon wala pay siak nga nalista ubos niini niya."},{"page_url":"https://vi.wikipedia.org/wiki/Hecatesia_fenestrata","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/53/Hecatesia_fenestrata02.jpg","page_title":"Hecatesia fenestrata","context_page_description":"Hecatesia fenestrata là một loài bướm đêm thuộc họ Noctuidae. Nó là loài đặc hữu của tây nam Úc.\\nSải cánh dài khoảng 30 mm.\\nẤu trùng ăn Cassytha melantha."},{"page_url":"https://arz.wikipedia.org/wiki/%D8%A7%D9%86_%D8%AC%D9%89_%D8%B3%D9%89_1517_(%D9%85%D8%AC%D8%B1%D9%87)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1d/NGC_1517_DSS.jpg","page_title":"ان جى سى 1517 (مجره)","context_page_description":"ان جى سى 1517 هى مجره بتتبع كوكبه الثور و اللى اكتشفها ادوارد ستيفان و الاكتشاف كان بتاريخ 23 ديسمبر 1884."},{"page_url":"https://cs.wikipedia.org/wiki/Seznam_savc%C5%AF_%C4%8Ceska","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ae/Sorex_minutus.jpg","page_title":"Seznam savců Česka","context_page_description":"Seznam savců Česka uvádí všechny savce vyskytující se volně, třeba i na malém území, v Česku. Seznam obsahuje i člověkem zavlečené druhy. Celkem se jedná o 88 druhů."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%84%D9%88%D8%AD%D8%A9_%D8%A7%D9%84%D9%85%D9%81%D8%A7%D8%AA%D9%8A%D8%AD_%D8%A7%D9%84%D9%85%D8%B1%D9%8A%D8%AD%D8%A9","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/45/Maltron_Dual_Hand_keyboard_with_Malt_Key_distribution.jpg","page_title":"لوحة المفاتيح المريحة","context_page_description":"لوحة المفاتيح المريحة هي لوحة مفاتيح كمبيوتر مصممة مع خصائص مريحة لتقليل إجهاد العضلات وتقليل مجموعة من المشاكل ذات الصلة. عادةً ما يتم إنشاء لوحات المفاتيح هذه للكتّاب على شكل V، للسماح لليدين اليمنى واليسرى بالكتابة بزاوية طفيفة أكثر طبيعية لشكل الجسم البشري."},{"page_url":"https://cs.wikipedia.org/wiki/Tambo_(poho%C5%99%C3%AD)","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/75/Picswiss_GR-84-05_Spl%C3%BCgen-_Skigebiet_Tambo.jpg","page_title":"Tambo (pohoří)","context_page_description":"Tambo je pohoří ležící na území Itálie svou větší částí a ve Švýcarsku svou menší plochou, avšak vysoko vyzdviženou. Plošně je pohoří poměrně rozlehlé, mezi turisty ale v celku málo vyhledávané. Geograficky je zařazováno do Západních Alp, v Italských zdrojích je skupina udávána spolu s pohořími Platta a Tessinskými Alpami pod celek Lepontinské Alpy. Nejvyšším vrcholem pohoří je Tambohorn."},{"page_url":"https://hu.wikipedia.org/wiki/August_Wilhelm_Schlegel","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9d/August_Wilhelm_von_Schlegel.jpg","page_title":"August Wilhelm Schlegel","context_page_description":"August Wilhelm Schlegel német költő, műfordító, műkritikus, a német romantika egyik úttörője."},{"page_url":"https://zh.wikipedia.org/wiki/%E6%88%88%E4%BA%9E%E6%96%AF%E5%B7%9E%E5%B8%82%E9%8E%AE%E5%88%97%E8%A1%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/75/Praca_Conego_Trindage_2.jpg","page_title":"戈亞斯州市鎮列表","context_page_description":"戈亞斯州市鎮列表列出位於巴西中西部的戈亞斯州當前下轄的所有市鎮。巴西地理統計局於2018年估計，該州人口6,921,161人，占巴西人口的3.32%，在巴西各州及聯邦區名列第12；面積340,125.715平方公里，占巴西國土的4.00%，在巴西各州及聯邦區排名第7位。\\n戈亞斯州在被巴西被殖民之前，居住著阿瓦斯-卡諾伊羅人及塔普伊亞人。在班代蘭蒂斯於米納斯吉拉斯發現黃金後，他們便沿著被稱為「戈亞斯道路」的印地安小徑往西北方前進以尋找更多貴重金屬。在同一時期，來自北方的傳教士抵達此地。1682年，巴爾托洛梅烏·布埃諾·達·席爾瓦在阿拉瓜亞河支流的礫石中發現黃金。1720年，巴爾托洛梅烏抵達梅斯特德阿瑪斯湖，並發現許多不同的金屬塊。此二次的發現吸引了數以千計的探險者及班代蘭蒂斯來到此處。1748年戈亞斯領地成立，其中大部分的區域尚未被歐洲人開發。1822年成為帝國的一省，1889年成為合眾國的一州。1891年，巴西合眾國憲法第三條規定聯邦區應設置於巴西高原上。1930年代，農業與鐵路的擴張使戈亞斯州成為繁榮之地。1933年，新首府戈亞尼亞成立。1956年，戈亞斯被選為新首都巴西利亞的所在地，並於1960年正式遷入。1988年，托坎廷斯州自該州劃出，該州因此失去了約40%的土地。\\n戈亞斯州劃分為6個中級地理區、22個直接地理區及246個市鎮。戈亞尼亞為戈亞斯州首府及人口最多的城市，人口數逼近150萬。阿尼揚格拉為人口數最少的市鎮，同時亦是面積最小的市鎮，尼克蘭迪亞則是面積最大的市鎮。戈亞斯州瓦爾帕萊索為人口密度最高的市鎮，卡瓦坎特則為人口密度最低的市鎮。"},{"page_url":"https://it.wikipedia.org/wiki/Parco_nazionale_di_Yellowstone","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/21/ElkYNP.jpg","page_title":"Parco nazionale di Yellowstone","context_page_description":"Il Parco nazionale di Yellowstone si trova negli Stati Uniti d'America e più precisamente nell'estremo settore nord-occidentale dello Stato del Wyoming e sconfina, per un piccolo tratto, negli Stati del Montana e dell'Idaho, occupando un'ampia zona delle Montagne Rocciose.\\nIl nome Yellowstone deriva dai fenomeni vulcanici attivi e la pietra gialla probabilmente deriva dallo zolfo presente in zona; è il nucleo centrale del Greater Yellowstone Ecosystem, uno dei più grandi ecosistemi intatti della zona temperata rimasto sulla Terra, oltre ad essere il più antico Parco nazionale del mondo e la più grande area protetta statunitense e, dal 1978, dichiarato Patrimonio dell'umanità dall'UNESCO.\\nNel 2015, il Parco è stato visitato da più di 4.000.000 di persone."}]`),T={name:"App",components:{PoemCard:P},data(){return{searchQuery:"",visibleCount:4,poemsData:M,isLoading:!1}},computed:{filteredPoems(){const a=this.searchQuery.trim().toLowerCase();return a?this.poemsData.filter(e=>e.page_title&&e.page_title.toLowerCase().includes(a)||e.context_page_description&&e.context_page_description.toLowerCase().includes(a)):this.poemsData},displayedPoems(){return this.searchQuery.trim()?this.filteredPoems:this.filteredPoems.slice(0,this.visibleCount)},hasMorePoems(){return!this.searchQuery.trim()&&this.visibleCount<this.poemsData.length}},methods:{async loadMore(){this.isLoading=!0,await new Promise(a=>setTimeout(a,1e3)),this.visibleCount+=4,this.isLoading=!1}}},L={class:"search-container"},G